Schweiz-Osterzgebirge. - MdB seit 1990; Vors. der Gruppe der Vertriebenen, Aussiedler und deutschen Minderheiten und Vorstandsmitgl. im Parlamentskreis Mittelstand der CDU/CSU-Fraktion; stellv. Vors. Ausschuss für Tourismus; Vors. dt.-österreichische Parlamentariergruppe.', 'Klaus', '11000240');
