INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (00788, NULL, 'Dr. h.c.', 'Dr. h.c.', 'Vizepräsidentin DBT, Studienrätin', 'verheiratet', '04.03.1951', NULL, 'Petershagen / Westfalen', 'weiblich', NULL, '18.02.1987', 'Bulmahn', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>	Berghof-Stiftung für Konfliktforschung GmbH, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		Humboldt-Universität zu Berlin, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Institut für Diversitätsforschung der Universität Göttingen, Göttingen,<br/>Mitglied des Beirates, ehrenamtlich (bis 31.12.2015)<br/><br/>Medizinische Hochschule Hannover (MHH), Hannover,<br/>Member of the Board, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeitsgemeinschaft industrieller Forschungsvereinigungen ?Otto von Guericke? e.V. (AiF), Köln,<br/>Ehrensenatorin<br/><br/>Atlantik-Brücke e.V., Berlin,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Centre for European Policy Studies (CEPS), Brüssel,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>CEPS European Institute for Energy and Climate Policy Studies, Brüssel,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Deutsche Gesellschaft der Freunde des Weizmann-Instituts e.V., Heidelberg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Deutsche Telekom Stiftung, Bonn,<br/>Stellv. Vorsitzende des Kuratoriums, jährlich, Stufe 3<br/><br/>Deutsche Tinnitus-Stiftung Charité, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Deutsches Institut für Wirtschaftsforschung (DIW) e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Emiratisch-Deutsche Freundschaftsgesellschaft (EDFG) e.V., Berlin,<br/>Stellv. Vorsitzende, ehrenamtlich (bis 31.12.2013)<br/><br/>Femtec.Alumnae e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Gesellschaft für Denkmalpflege in Niedersachsen e.V., Hannover,<br/>Vorsitzende, ehrenamtlich<br/><br/>Helmut und Loki Schmidt-Stiftung, Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>IMPULS-Stiftung, Frankfurt/Main,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Lebendiges Linden e.V., Hannover,<br/>Vorsitzende, ehrenamtlich<br/><br/>Rationalisierungs- und Innovationszentrum der Deutschen Wirtschaft e.V., Eschborn,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis September 2015)<br/><br/>Stiftung ?GIGA - German Institute of Global and Area Studies?, Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Lesen, Mainz,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Niedersachsen, Hannover,<br/>Senatorin, ehrenamtlich<br/><br/>Trilaterale Kommission, Berlin,<br/>Stellv. Vorsitzende der deutschen Gruppe, ehrenamtlich', '1959/62 Volksschule Döhren, 1972 Abitur am Aufbaugymnasium Petershagen. 1972/73 Auslandsaufenthalt im Kibbutz Bror Chail. Studium der Politischen Wissenschaften und Anglistik in Hannover, 1978 Erstes, 1980 Zweites Staatsexamen. Studienrätin Lutherschule bis 1987. 1990/98 Mitgl. Kuratorium Ökoinstitut, Mitgl. AWO. 1994/98 Mitgl. Kuratorium Fraunhofer-Gesellschaft, 1995/98 Mitgl. Kuratorium und seit 2014 Ehrensenatorin der Arbeitsgemeinschaft industrieller Forschungseinrichtungen (AiF) "Otto von Guericke", 1999/09 Kuratorium der Volkswagenstiftung, stellv. Vors. Kuratorium der Deutschen Telekom Stiftung, Mitgl. Kuratorium des DIW Berlin, 1999/09 Senatorin der Stiftung Niedersachsen, Vorsitzende der Gesellschaft für Denkmalpflege Niedersachsen, Mitgl. Stiftungsrat der Berghof Stiftung für Konfliktforschung, stellv. Vors. Atlantik-Brücke, Schirmherrin der Linden-Limmer-Stiftung, Hannover, seit 2016 Mitgl. Kuratorium Humboldt-Univ. Berlin. Mitgl. der SPD seit 1969, Mitgl. Parteivorst. der SPD 1993/2011, Landesvors. der SPD Niedersachen 1998/03, 1995/2011 Vors. Wissenschaftsforum der Sozialdemokratie. - MdB seit 1987; 1987/90 stellv. Vors. Enquete-Kommission Technikfolgenabschätzung, 1990/94 stellv. Vors. Ausschuss Forschung und Technologie, 1994/96 Vors. Ausschuss für Bildung, Wissenschaft, Forschung, Technologie und Technikfolgenabschätzung; 1996/98 Sprecherin für Bildung und Forschung der SPD-Fraktion; 1998/bis Okt. 05 Bundesministerin für Bildung und Forschung; 2005/09 Vors. Ausschuss für Wirtschaft und Technologie, 2011/13 Sprecherin SPD-Fraktion in der Enquete-Kommission "Wachstum, Wohlstand, Lebensqualität"; seit 22. Okt. 2013 Vizepräsidentin des Bundestages.', 'Edelgard', '11000305');
