INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (00938, NULL, 'Dr.', 'Dr.', 'Autor, Geschäftsführer', 'verheiratet', '03.04.1950', NULL, 'Frankfurt/Main', 'männlich', NULL, '18.10.2005', 'Dehm', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Publizist, Autor und Liederschreiber, selbständig, Berlin<br/>GEMA, Berlin, jährlich, Stufe 4<br/><br/>Funktionen in Unternehmen: <br/>Hit Radio FFH, Radio/Tele FFH GmbH & Co. Betriebs KG, Bad Vilbel,<br/>Mitglied des Gesellschafterausschusses<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europaverband der Selbständigen - Deutschland e.V. (ESD), Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Edition Musikant GmbH, Eiterfeld<br/><br/>Gesellschaft für Gegenöffentlichkeit mbH, Berlin', 'Gymnasium. Liedermacher, Theater-, Romanautor und Komponist; als Komponist, Texter und Musikverleger dreifaches GEMA-Vollmitglied. 1967/68 Mitgl. AUSS-Bundesvorst. und SDS-Präsidium; 1975/79 stellv. Landesvors. SJD-Die Falken Hessen. 1966 Eintritt in die SPD, 1998 Austritt aus der SPD, bis 1996 Bundesvors. der AG der Selbstständigen in der SPD. 1999/03 stellv. Parteivors. der PDS, ab 2003 Landesvors. der Linkspartei Niedersachsen, 2007/10 Vors. der Partei DIE LINKE. Niedersachsen, seit Mai 2010 Mitgl. im Vorst. der Partei DIE LINKE, Vors. Bundesarbeitsgemeinschaft "Linke Unternehmerinnen und Unternehmer" der Partei DIE LINKE (BAG LiU), seit Dez. 2010 Schatzmeister der Partei der Europäischen Linken. 1993 Magistrat der Stadt Frankfurt am Main. Mitgl. der AWO, ver.di, Künstler gegen Krieg, ver.di - Deutsche Journalistenunion, VVN-BdA, attac, Initiative Vermögender für eine Vermögensabgabe, Gesellschafter HIT Radio FFH. Englisch (f), Französisch (G). - MdB 1994 und seit Okt. 2005; Mitgl. Mittelstandsbeirat beim BMWi.', 'Diether', '11000365');
