INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (01233, NULL, 'Dr. h.c.', 'Dr. h.c.', 'Verlagsleiter, Staatsminister a. D.', 'verheiratet, 1 Kind', '03.05.1944', NULL, 'Meißen', 'männlich', NULL, '18.02.1987', 'Erler', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Albert-Ludwig-Universität, Freiburg, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arnold-Bergstraesser-Institut für kulturwissenschaftliche Forschung e.V.<br/>	an der Albert-Ludwigs-Universität Freiburg, Freiburg, <br/>	Mitglied des Beirates, ehrenamtlich<br/>	<br/>Deutsch-Aserbaidschanisches Forum e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Deutsch-Bulgarisches Forum e.V., Berlin, <br/>	Vorsitzender, ehrenamtlich<br/>	<br/>Deutsche Stiftung Friedensforschung (DSF), Osnabrück, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/>	<br/>Deutsch-Kasachisches Forum, Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/>	<br/>Deutsch-Rumänisches Forum e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Deutsch-Russisches Forum e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Deutsch-Ukrainisches Forum e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/>	<br/>Stiftung Entwicklung und Frieden (SEF), Bonn, <br/>	Mitglied des Beirates, ehrenamtlich<br/>	<br/>Südosteuropa-Gesellschaft, München, <br/>	Präsident, ehrenamtlich<br/>	<br/>West-Ost-Gesellschaft Südbaden e.V., Freiburg, <br/>	Vorsitzender, ehrenamtlich', 'Gymnasium in Berlin-Steglitz. Studium der Geschichte, slavischen Sprachen und Politik FU Berlin und Albert-Ludwigs-Univ. in Freiburg 1963/67, Staatsexamen 1967. Verlagsredakteur 1968/69. Wissenschaftl. Assistent und wissenschaftl. Mitarbeiter am Seminar für osteuropäische Geschichte der Univ. Freiburg 1969/79. Verlagsleiter in Freiburg 1980/87. Mitgl. ver.di, AWO, Öko-Institut Freiburg. Vors. West-Ost-Gesellschaft Südbaden, Deutsch-Bulgarisches Forum und Präsident der Südosteuropa-Gesellschaft. SPD-Mitgl. seit 1970, Ortsvereinsvors. in Freiburg-Tiengen 1973/77, Kreisvors. der Freiburger SPD 1977/87. 1976/84 Ortschaftsrat in Freiburg-Tiengen. Englisch (f), Russisch (f), Französisch (G). - MdB seit 1987; Nov. 1998/Nov. 2005 und Okt. 2009/Dez. 2013 stellv. Vors. der SPD-Fraktion für die Bereiche Außenpolitik, Sicherheitspolitik, Menschenrechte und Entwicklungspolitik, 2003/06 Koord. für deutsch-russ. zwischengesell. Zusammenarbeit im AA, Nov. 2005/Okt. 2009 Staatsminister beim BMin. des Auswärtigen, seit Jan. 2014 Koord. für die zwischengesell. Zusammenarbeit mit Russland, Zentralasien und den Ländern der Östlichen Partnerschaft, 2015/16 Sonderbeauftragter der BReg. für den OSZE-Vorsitz.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 282 (Lörrach-Müllheim)<br/>Wahlkreis 286 (Schwarzwald-Baar)', 'Gernot', '11000489');
