INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (01339, NULL, NULL, NULL, 'Programmiererin, Parl. Staatssekretärin', 'verheiratet', '05.05.1958', NULL, 'Idar-Oberstein / Krs. Birkenfeld (Rheinland-Pfalz)', 'weiblich', NULL, '20.12.1990', 'Ferner', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Feuerbestattungsverein für das Saarland e.V., Saarbrücken, <br/>Vorsitzende, ehrenamtlich<br/><br/>Verein gegen sexuelle Ausbeutung von Mädchen e.V., Saarbrücken, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Vereinigung der Deutsch-Griechischen-Gesellschaften e.V. (VDGG), Bonn, <br/>Mitglied des Beirates, ehrenamtlich', '1977 Abitur. Kaufmännische Berufsschule, Kaufmannsgehilfenbrief IHK, 1977/79 Ausbildung zur Datenverarbeitungskauffrau bei LKS Datenservice AG in Saarbrücken. 1979/84 Programmiererin bei ASKO Deutsche Kaufhaus AG, 1985/90 bei den Saarbrücker Stadtwerken. 1998/2000 Staatssekretärin im Bundesministerium für Verkehr, Bau- und Wohnungswesen. Mitgl. der SPD seit 1983, 1997/07 stellv. Vors. der SPD Saarbrücken, 2003/07 stellv. Vors. der saarländischen SPD, Nov. 2005/Okt. 2007 stellv. Vors. der SPD, Mitgl. SPD-Parteivorst., bis 2011 Mitgl. im SPD-Präsidium; 1991/99 Vors. der ASF Saar, Mitgl. ASF-Bundesvorst. und seit 2004 Bundesvors. der ASF, seit Juni 2015 Mitgl. im Vorst. der SPE-Frauen. 1984/89 Mitgl. Bezirksrat Mitte der Landeshauptstadt Saarbrücken. Mitgl. ver.di, Pro Familia, AWO, Marie Schlei Verein e. V., Gegen Vergessen für Demokratie e. V., Eurosolar, VCD, Verein zur Förderung einer Städtepartnerschaft Saarbrücken-Diriamba, Verein Miteinander leben und lernen e. V., Verein für Frauenkultur und Frauenbildung e. V. und Verein gegen sexuelle Ausbeutung von Mädchen e. V. (Nele), Karnevalsges. Daarler Dabbesse. - MdB 1990/94, Nov. 1994/98 und seit Okt. 2002; 1994/98 verkehrspol. Sprecherin der SPD-Fraktion, 2005/13 stellv. Vors. der SPD-Fraktion; seit Dez. 2013 Parl. Staatssekretärin bei der BMin für Familie, Senioren, Frauen und Jugend.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 297 (Saarlouis)', 'Elke', '11000535');
