INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (01366, NULL, NULL, NULL, 'Rechtsanwalt', NULL, '29.11.1943', NULL, 'Bevensen / Krs. Uelzen', 'männlich', NULL, '04.11.1980', 'Fischer', '(Hamburg)', 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>		DB Netz AG, Frankfurt/Main, <br/>	Mitglied des Aufsichtsrates<br/><br/>	DB Station&Service AG, Berlin, <br/>	Mitglied des Aufsichtsrates<br/><br/>	DFS Deutsche Flugsicherung GmbH, Langen, <br/>	Mitglied des Beirates<br/><br/>	Studio Hamburg Berlin Brandenburg GmbH, Berlin, <br/>	Mitglied des Beirates (bis 31.12.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Deutscher Fußball-Bund e.V. (DFB), Frankfurt/Main, <br/>	Mitglied des Vorstandes und der Konferenz der DFB-RV/LV-Vorsitzenden, ehrenamtlich<br/><br/>	Hamburger Fußball-Verband e.V. (HFV), Hamburg, <br/>	Präsident, ehrenamtlich<br/><br/>	Norddeutscher Fußball-Verband e.V. (NFV), Bremen, <br/>	Vizepräsident, ehrenamtlich<br/><br/>	Jürgen-Echternach-Stiftung für Bildung und Demokratie, Hamburg, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Stiftung Berliner Schloss - Humboldtforum, Berlin, <br/>	Mitglied des Stiftungsrates', 'Abitur 1964 am Ostseegymnasium Timmendorfer Strand. 1964/66 Wehrdienst bei der Bundeswehr, z. Z. Oberleutnant d. R. Studium an der Univ. Hamburg, Rechtswissenschaftl. Fakultät, 1975 1., 1978 2. jur. Staatsexamen. 1978/80 Justitiar in einem Großhandelsunternehmen. Seit 1982 Zulassung als Rechtsanwalt. Seit 1967 Mitgl. der CDU und der JU, 1970/77 Landesvors. der JU Hamburg; seit 1972 Mitgl. CDU-Landesvorst. in Hamburg, 1976/92 stellv. CDU-Landesvors., 1974/96 Kreisvors. der CDU Hamburg-Nord, 1992/07 Landesvors. der CDU Hamburg und Mitgl. CDU-Bundesvorst. 1970/81 Mitgl. der Hamburger Bürgerschaft. Englisch (f), Französisch (f), Portugiesisch (G). - MdB seit 1980; ab 1989 Vors. Arbeitsgruppe Verkehr der CDU/CSU-Fraktion, ab 1998 Vors. AG Verkehr, Bau- und Wohnungswesen, ab Nov. 2005 Vors. AG Verkehr, Bau und Stadtentwicklung, Aufbau Ost, Nov. 2009/Jan. 2014 Vors. AG Verkehr, Bau und Stadtentwicklung.', 'Dirk', '11000549');
