INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (01519, NULL, NULL, NULL, 'Parl. Staatssekretär', 'verheiratet, 4 Kinder', '13.02.1952', NULL, 'Sulz am Neckar', 'männlich', NULL, '18.02.1987', 'Fuchtel', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Beauftragter für die Deutsch-Griechische Versammlung, Berlin<br/><br/>Internationales Forum Burg Liebenzell e.V., Bad Liebenzell, <br/>Mitglied des Vorstandes, ehrenamtlich', 'Grundschule in Eutingen im Gäu, Abitur in Nagold. Studium der Rechtswissenschaft und Wirtschaftswissenschaft Univ. Tübingen, 2. jur. Staatsexamen 1979/80. Höherer Dienst des Landes Baden-Württemberg, zuletzt vom Landtag abgeordnet zur CDU-Landtagsfraktion als Parlamentarischer Berater bei Erwin Teufel. 1992/09 Rechtsanwalt in Nagold, seit der Berufung zum Parl. Staatssekretär ruht die Rechtsanwaltstätigkeit. Bis März 2010 Präsident der THW-Bundesvereinigung e. V. und Vorstandsvors. Stiftung THW - Technisch Helfen Weltweit, jetzt Ehrenpräsident der THW-Bundesvereinigung; Vors. Kreisverband Blasmusik Calw e. V.; Mitgl. Verein "Freunde der Bauwagen" Kreis Calw; Ehrenamtl. Vorstandsmitgl. Internationales Forum Burg Liebenzell. Mitgl. Verein "Helfende Hände" e.V., 2013 Ehrensenator Deutsch-Hellenische Wirtschaftsvereinigung, 2013 Preisträger der Akademie-Medaille der Deutsch-Griechischen Akademie. Bundesverdienstkreuz 2006. 1975/87 Stadtrat in Altensteig, mehrere Jahre 1. Bürgermeister-Stellvertreter, 1979/09 Mitgl. des Calwer Kreistages. Englisch (f). - MdB seit 1987; bis 2009 Obmann der Schriftführer und 2005/09 stellv. Vors. Rechnungsprüfungsausschuss; Okt. 2009/Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Arbeit und Soziales, ab Nov. 2011 zusätzlich Beauftragter für die Dt.-Griechische Versammlung, seit Dez. 2013 Parl. Staatssekretär beim Bundesminister für wirtschaftliche Zusammenarbeit und Entwicklung.', 'Hans-Joachim', '11000616');
