INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (01700, NULL, NULL, NULL, 'Bauingenieurin, Parl. Staatssekretärin', 'verheiratet', '18.07.1964', NULL, 'Schleusingen / Krs. Suhl (Thüringen)', 'weiblich', NULL, '20.12.1990', 'Gleicke', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>	Deutsche Energie-Agentur GmbH (dena), Berlin, <br/>	Vorsitzende des Aufsichtsrates<br/><br/>	Germany Trade and Invest - Gesellschaft für Außenwirtschaft und<br/>	Standortmarketing mbH, Berlin, <br/>	Stellv. Vorsitzender des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesstiftung zur Aufarbeitung der SED-Diktatur, Berlin, <br/>	Mitglied des Stiftungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Arbeiter-Samariter-Bund Deutschland e.V., Köln, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/><br/>	Zentralverband der Ingenieurvereine ZBI e.V., Berlin, <br/>	Präsidentin, ehrenamtlich (bis 20.12.2013)', 'Polytechn. Oberschule Schleusingen; im Anschluss daran Bauzeichnerlehre. Studium an der Fachschule in Gotha. Projektantin im VEB Stadtbau Suhl, Angestellte im Stadtbauamt Schleusingen, zuletzt Bereichsingenieurin in der Flurneuordnungsbehörde Südthüringen. Mitgl. IG Bau, AWO, Mitgl. Präsidium ASB, Mitgl. weiterer überregionaler Vereine und Initiativen; Vors. Thüringer Mieterbund. 1990 (Gründungs-)Mitgl. der SDP/SPD Schleusingen. Fraktionsvors. und Vors. des Bauausschusses sowie Mitgl. des Sozialausschusses im Rat der Stadt Schleusingen Mai/Dez. 1990. - MdB seit 1990; Nov. 1998/Okt. 2002 stellv. Vors. der SPD-Fraktion. Okt. 2002/Nov. 2005 Parl. Staatssekretärin beim Bundesminister für Verkehr, Bau- und Wohnungswesen; Nov. 2005/Dez. 2013 Parl. Geschäftsführerin der SPD-Fraktion, Nov. 2006/Dez. 2013 Sprecherin der Landesgruppe Ost der SPD-Fraktion, Jan. 2012/Sept. 2013 stellv. Mitgl. 2. Untersuchungsausschuss "Terrorgruppe NSU". Dez. 2013/Jan. 2017 Parl. Staatssekretärin beim BMin. für Wirtschaft und Energie und seit Jan. 2017 bei der BMin. für Wirtschaft und Energie, Beauftragte der BReg. für die neuen Länder, Beauftragte der BReg. für Mittelstand und Tourismus.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 190 (Eisenach - Wartburgkreis - Unstrut-Hainich-Kreis II)<br/>Wahlkreis 192 (Gotha - Ilm-Kreis)<br/>Wahlkreis 196 (Sonneberg - Saalfeld - Rudolstadt - Saale-Orla-Kreis)', 'Iris', '11000687');
