INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (02036, NULL, NULL, NULL, 'Vizepräsidentin DBT a.D., Dipl.-Volkswirtin, Bundesministerin a. D.', 'verheiratet, 2 Kinder', '07.07.1950', NULL, 'Straubing / Niederbayern', 'weiblich', NULL, '24.03.1987', 'Hasselfeldt', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesakademie für Sicherheitspolitik (BAKS), Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Deutsches Museum, München,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis 09.05.2016)<br/><br/>Stiftung Jüdisches Museum Berlin, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Eugen-Biser-Stiftung, München,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Hanns-Seidel-Stiftung e.V., München,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>SAP Streicher Akademie des Puchheimer Jugendkammer-Orchester e.V., Gröbenzell,<br/>Mitglied des Beirates, ehrenamtlich', 'Abitur 1969. Studium der Volkswirtschaftslehre in München und Regensburg, Diplomprüfung 1975. 1975/87 Mitarbeiterin bei der Bundesanstalt für Arbeit, zuletzt Leiterin der Abteilung Berufsberatung im Arbeitsamt Deggendorf. Seit 1969 Mitgl. der CSU; in versch. Vorstandsgremien der Frauen-Union und der CSU tätig, 1978/89 Kreisrätin im Kreis Regen, 1995/05 Kreisvors. der CSU Fürstenfeldbruck, 1996/04 Kreisrätin im Kreis Fürstenfeldbruck. - MdB seit März 1987; April 1989/Jan. 1991 BMin. für Raumordnung, Bauwesen und Städtebau, Jan. 1991/Mai 1992 BMin. für Gesundheit. 1995/02 Vors. AG Finanzen der CDU/CSU-Fraktion, 2002/05 stellv. Vors. der CDU/CSU-Fraktion, 2005/11 Vizepräsidentin des Deutschen Bundestages, seit März 2011 Vors. der CSU-Landesgruppe und 1. stellv. Vors. der CDU/CSU-Fraktion.', 'Gerda', '11000825');
