INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (02403, NULL, NULL, NULL, 'Diplomverwaltungswirt', 'verheiratet, 3 Kinder', '03.11.1956', NULL, 'Lünen', 'männlich', NULL, '01.02.1991', 'Hüppe', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Beauftragter der Bundesregierung für die Belange Behinderter<br/>	Menschen, Berlin (bis 16.01.2014), <br/>	monatlich, Stufe 1<br/><br/>	Bundesinstitut für Bau-, Stadt- und Raumforschung (BBSR), Bonn, <br/>	Mitglied der forschungsbegleitenden Arbeitsgruppe "Leitfaden<br/>	Barrierefreies Bauen" (bis 16.01.2014)<br/><br/>	Bundeskriminalamt, Wiesbaden, <br/>	Mitglied der Arbeitsgruppe "Notruf-App" (bis 16.01.2014)<br/><br/>	Bundesministerium für Arbeit und Soziales, Berlin, <br/>	Mitglied des Ausschusses des Nationalen Aktionsplans<br/>	(bis 16.01.2014)<br/>	Mitglied des Beirates zur wissenschaftlichen Begleitforschung<br/>	"Persönliches Budget" (bis 16.01.2014)<br/><br/>	Bundesministerium für Arbeit und Soziales, Berlin, <br/>	Mitglied des Beirates für die Teilhabe behinderter Menschen nach<br/>	§ 64 SGB IX und des Projektbeirates zur Evaluation von Leistungen<br/>	zur Teilhabe behinderter Menschen (bis 16.01.2014)<br/><br/>	Bundesministerium für Gesundheit, Berlin, <br/>	Mitglied des Expertenbeirates zur Ausgestaltung eines neuen<br/>	Pflegebedürftigkeitsbegriffs (bis 16.01.2014)<br/><br/>	Staatliche Koordinierungsstelle nach Artikel 33<br/>	UN-Behindertenrechtskonvention, Berlin, <br/>	Vorsitzender des Inklusionsbeirates (bis 16.01.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesarbeitsgemeinschaft der Freiwilligenagenturen (bagfa) e.V.,<br/>	Berlin, 	<br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Bundesvereinigung Lebenshilfe für Menschen mit geistiger<br/>	Behinderung e.V., Marburg, <br/>	Kooptiertes Mitglied des Bundesvorstandes, ehrenamtlich<br/><br/>	Christdemokraten für das Leben e.V., Münster, <br/>	Stellv. Bundesvorsitzender, ehrenamtlich<br/><br/>	Deutsche UNESCO Kommission e.V., Berlin, <br/>	Mitglied des Sprecherrates des Expertenkreises "Inklusive Bildung"<br/><br/>	Deutscher Verein für öffentliche und private Fürsorge e.V., Berlin, <br/>	Mitglied des Hauptausschusses, ehrenamtlich<br/><br/>	Special Olympics Deutschland e.V., Berlin, <br/>	Vizepräsident, ehrenamtlich<br/><br/>	ASbH-Stiftung, Stiftung der Arbeitsgemeinschaft Spina bifida und<br/>	Hydrocephalus e.V., Dortmund, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis 31.12.2013)<br/><br/>	Bundesarbeitsgemeinschaft für Rehabilitation e.V. (BAR), Frankfurt/Main, <br/>	Mitglied der Arbeitsgruppe "Barrierefreie Umweltgestaltung" und<br/>	der Expertenrunde zur Frühförderung (bis 16.01.2014)<br/><br/>	Bundesarbeitsgemeinschaft Integrationsfirmen e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich (bis 16.01.2014)<br/><br/>	Bundesverband Frauenberatungsstellen und Frauennotrufe (BFF), Berlin, <br/>	Mitglied des Beirates des Projekts "Zugang für alle!" (bis 16.01.2014)<br/><br/>	Deutsche Gesellschaft für Psychiatrie und Psychotherapie,<br/>	Psychosomatik und Nervenheilkunde e.V. (DGPPN), Berlin, <br/>	Mitglied des Beirates "Ausstellungsprojekt der DGPPN zur<br/>	NS-Psychiatrie" (bis 16.01.2014)<br/><br/>	Deutsche Vereinigung für Rehabilitation e.V. (DVfR), Berlin, <br/>	Mitglied des Diskussionsforums Reha-Recht (bis 16.01.2014)<br/><br/>	Deutsches Seminar für Tourismus Berlin e.V. (DSFT), Berlin, <br/>	Mitglied des Projektbeirates "Entwicklung und Vermarktung<br/>	barrierefreier Angebote und Dienstleistungen im Sinne eines<br/>	Tourismus für Alle in Deutschland" (bis 16.01.2014)<br/><br/>	GKV-Spitzenverband, Berlin, <br/>	Mitglied des Beirates "Pflegebudgets" (bis 16.01.2014)<br/><br/>	Interessenvertretung Selbstbestimmt Leben in Deutschland e.V. (ISL),<br/>	Berlin, <br/>	Mitglied des Projektbeirates "Job-Win-Win - Mentoren-Netzwerk für<br/>	mehr Vielfalt in Unternehmen" (bis 16.01.2014)<br/><br/>	Stiftung Digitale Chancen, Berlin, <br/>	Mitglied des Beirates (bis 16.01.2014)', '1974/80 Jugendleiter des Bundes Deutscher Kommunalbeamter und Arbeitnehmer im DBB. Aktiv in der Lebensrechtsbewegung, Mitgl. Bundesvorst. Lebenshilfe e.V., seit Nov. 2014 Vizepräs. Special Olympics Deutschland, Mitgl. der Landesarbeitsgemeinschaft Gemeinsam Leben, Gemeinsam Lernen NRW e. V., seit 1986 stellv. Bundesvors. der Christdemokraten für das Leben (CDL), Mitgl. Arbeitsgemeinschaft Spina bifida und Hydrocephalus (ASbH e. V.). Mitgl. bagfa Bundesarbeitsgemeinschaft der Freiwilligenagenturen im Projekt "Sensibilisieren, Qualifizieren und Begleiten - Freiwilligenagenturen als inklusive Anlauf- und Netzwerkstellen für Engagement weiterentwickeln", Mitgl. der KAB. 1971 Eintritt in die Schüler-Union und JU, 1974 Mitgl. der CDU, 1982 der CDA, 1987/2014 Mitgl. CDU-Bezirksvorst. Ruhrgebiet, 1989/2013 Kreisvors. der CDU Unna, 2010/14 Mitgl. CDU-Bundesvorst. Englisch (G). - MdB 1991/2009 und seit Aug. 2012; Jan. 2010/Jan. 2014 Behindertenbeauftragter der Bundesregierung.', 'Hubert', '11000975');
