INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (02527, NULL, NULL, NULL, 'Dipl.-Soziologin, Journalistin', 'keine Angaben', '09.06.1951', NULL, 'Hamburg', 'weiblich', NULL, '20.12.1990', 'Jelpke', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Gelernte Friseurin, Kontoristin, Buchhändlerin. 1993 Abschluss als Diplom-Soziologin und Volkswirtin. Seit 1981 aktiv als Strafvollzugshelferin, 1981/89 zweimal zur Abgeordneten für die Grün-Alternative Liste (GAL) in die Bürgerschaft Hamburg gewählt, dort im Innen-, Rechts-, Frauen- und Sozialausschuss gearbeitet, zwischenzeitlich 3 Jahre Frauenreferentin bei der GAL-Fraktion. 2002/05 Ressortleiterin für Innenpolitik bei der linken Tageszeitung "junge Welt" und Mitherausgeberin, Autorin der Zeitschrift Ossietzky. Mitgl. des Kuratoriums der Stiftung "Erinnerung, Verantwortung und Zukunft", Mitgl. Beirat Bündnis für Demokratie und Toleranz, Mitgl. VVN-BdA. Englisch (G). - MdB 1990/02 und seit Okt. 2005;  1990/02 und seit Okt. 2005 Leiterin AG Innenpolitik und innenpolitische Sprecherin der PDS-Fraktion bzw. der Fraktion DIE LINKE., Schwerpunkte: Migrations- und Flüchtlingspolitik, Sicherheitsgesetze u. Verteidigung von Grundrechten, Antifaschismus u. Menschenrechtsfragen, 1990/02 und seit Okt. 2005 Obfrau und Mitgl. Innenausschuss.', 'Ulla', '11001023');
