INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (02927, NULL, NULL, NULL, 'Geschäftsführer', 'verheiratet, 3 Kinder', '16.04.1959', NULL, 'Forchheim / Oberfranken', 'männlich', NULL, '20.12.1990', 'Koschyk', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>		SeniVita Sozial gemeinnützige GmbH, Bayreuth, <br/>	Vorsitzender des Aufsichtsrates, jährlich, Stufe 3 (ab Januar 2016)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		Beauftragter der Bundesregierung für Aussiedlerfragen und nationale Minderheiten, Berlin, <br/>	monatlich, Stufe 1 (ab Januar 2014)<br/><br/>	Landkreis Bayreuth, Bayreuth, <br/>	Mitglied des Kreistages, ehrenamtlich<br/><br/>	Stiftung zur Aufarbeitung der SED-Diktatur, Berlin, <br/>	Stellv. Vorsitzender, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Kultur- und Sozialstiftung Internationale Junge Orchesterakademie, Bayreuth, <br/>	Stellv. Vorsitzender, ehrenamtlich (bis 31.05.2014)<br/><br/>	Stiftung "Archiv der Parteien und Massenorganisationen in der DDR", Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung für deutsch-polnische Zusammenarbeit, Warschau, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>	Stiftung Verbundenheit mit den Deutschen im Ausland, St. Augustin, <br/>	Vorsitzender des Stiftungsrates, ehrenamtlich', 'Die Eltern wurden aus Oberschlesien vertrieben. 1978 Abitur. Eintritt in die Bundeswehr, Offiziersanwärter, 1983 ausgeschieden, seit 2014 Oberstleutnant d. R. 1983/87 wissenschaftl. Mitarbeiter des CDU-MdB Sauer (Salzgitter), daneben Studium der Geschichte und der Pol. Wissenschaft. 1987/91 Generalsekretär des Bundes der Vertriebenen. Stellv. Stiftungsratsvors. der Stiftung zur Aufarbeitung der SED-Diktatur; 1998/08 Mitgl. Beirat beim Bundesbeauftragten für die Unterlagen der Staatssicherheit der ehemaligen DDR. 1994/14 Bundesvors. Verein für Dt. Kulturbeziehungen im Ausland e. V., seit 2009 Vors. Stiftungsrat "Stiftung Verbundenheit mit den Deutschen im Ausland", 2003/12 Präs. der Dt.-Koreanischen Gesellschaft. Seit 1978 Mitgl. der CSU, seit 1999 Kreisvors. CSU-Kreisverb. Bayreuth-Land, seit 1997 stellv. Vors. CSU-Bezirksverb. Oberfranken. - MdB seit 1990; Sprecher der CDU/CSU-Fraktion in den Enquete-Kommissionen "Aufarbeitung von Geschichte und Folgen der SED-Diktatur in Deutschland des 12. BT und "Überwindung der Folgen der SED-Diktatur im Prozess der deutschen Einheit" des 13. BT; 1990/05 Vors. Gruppe Vertriebene und Flüchtlinge der CDU/CSU-Fraktion, in der 15. WP Vors. AG Innen der CDU/CSU-Fraktion, Nov. 2005/Okt. 2009 Stellv. des 1. Parl. Geschäftsführers der CDU/CSU-Fraktion und Parl. Geschäftsführer der CSU-Landesgruppe. 1998/09 und ab Mai 2014 Vors. der Dt.-Koreanischen Parlamentariergruppe, ab 2006 Ko-Vors. Deutsch-Koreanisches Forum. Okt. 2009/Dez. 2013 Parl. Staatssekretär beim Bundesminister der Finanzen; seit Jan. 2014 Beauftragter der Bundesregierung für Aussiedlerfragen und nationale Minderheiten.', 'Hartmut', '11001186');
