INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (03092, NULL, 'Dr.', 'Dr.', 'Präsident DBT, Vizepräsident DBT a.D., Dipl.-Sozialwissenschaftler', 'verheiratet, 4 Kinder', '16.11.1948', NULL, 'Bochum', 'männlich', NULL, '04.11.1980', 'Lammert', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>GEFMA Deutscher Verband für Facility Management e.V., Bonn,<br/>Rede, 2016, Stufe 2 (GEFMA Kamingespräch)<br/><br/>Institut Ökonomie der Zukunft GmbH, Karlsruhe,<br/>Vortrag, 2015, Stufe 2 ("Was Politik kann. Was Politik nicht kann.")<br/><br/>Funktionen in Unternehmen: <br/>Kultur Ruhr GmbH, Essen,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Ruhr 2010 GmbH, Essen,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Ruhrfestspiele Recklinghausen GmbH, Recklinghausen,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>RAG AG, Essen,<br/>Mitglied des Aufsichtsrates, jährlich, Stufe 5<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Regionalverband Ruhr, Essen,<br/>Mitglied der Verbandsversammlung, ehrenamtlich (bis 30.06.2014)<br/><br/>Stiftung Denkmal für die ermordeten Juden Europas, Berlin,<br/>Vorsitzender des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Nationalstiftung, Hamburg,<br/>Mitglied des Senats, ehrenamtlich<br/><br/>Gesellschaft der Freunde der Berliner Philharmonie e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>"Glückauf Zukunft!", Projekt der RAG Stiftung, RAG AG und Evonik Industries AG, Essen,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Konrad-Adenauer-Stiftung e.V., St. Augustin,<br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Kulturpolitische Gesellschaft e.V., Bonn,<br/>Mitglied des Kuratoriums des Instituts für Kulturpolitik, ehrenamtlich<br/><br/>Kulturstiftung des Bundes, Halle an der Saale,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>musica reanimata Förderverein zur Wiederentdeckung NS-verfolgter Komponisten und ihrer Werke e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>musikFabrik/Landesensemble Nordrhein-Westfalen e.V., Köln,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Norbert-Lammert-Stiftung, St. Augustin,<br/>Vorsitzender des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Deutsche Sprache, Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Stiftung Situation Kunst, Bochum,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Abitur 1967. Wehrdienst 1967/69. Studium der Politikwissenschaft, Soziologie, Neueren Geschichte und Sozialökonomie Univ. Bochum und Oxford (England) 1969/75; Diplom 1972, Promotion zum Doktor der Sozialwissenschaften 1975. Freiberufl. Dozent in der Erwachsenenbildung; Lehrbeauftragter für Politikwissenschaft; seit Feb. 2008 Honorarprofessor Ruhr-Univ. Bochum. Zahlreiche Veröffentlichungen. Mitgl. CDU seit 1966, stellv. Kreisvors. der CDU Bochum 1977/85, stellv. Landesvors. JU Westfalen-Lippe 1978/84, seit 1986 Mitgl. Landesvorst. CDU NRW, 1986/08 Vors. des CDU-Bezirksverb. Ruhr, seit 2008 Ehrenvors. Mitgl. Rat der Stadt Bochum 1975/80. 2004/2014 Mitglied der Verbandsversammlung des Regionalverbandes Ruhr. - MdB seit 1980; April 1989/Nov. 1994 Parl. Staatssekretär beim BMin. für Bildung und Wissenschaft, Nov. 1994/Mai 1997 beim BMin. für Wirtschaft, Mai 1997/Okt. 1998 beim BMin. für Verkehr. Jan. 1995/Okt. 1998 Koordinator der Bundesregierung für Luft- und Raumfahrt. 1996/06 Vors. Landesgruppe NRW, Nov. 1998/Okt. 2002 kultur- und medienpol. Sprecher der CDU/CSU-Fraktion. Okt. 2002/Okt. 2005 Vizepräsident und seit 18. Okt. 2005 Präsident des Deutschen Bundestages.', 'Norbert', '11001274');
