002/Nov. 2005 Vors. der CDU/CSU-Fraktion; seit 22. Nov. 2005 Bundeskanzlerin der Bundesrepublik Deutschland, 28. Okt. 2009 und 17. Dez. 2013 Wiederwahl zur Bundeskanzlerin.', 'Angela', '11001478');
