mmer. 1995 Projektentwickler, 1996/02 Geschäftsführerin eines mittelständischen Unternehmens. Seit 1972 Mitgl. der CDU, seit 1989 Vors. CDU-Ortsverb. Großdubrau, seit 1990 Mitgl. CDU-Kreisvorst. Bautzen, 1992/07 Kreisvors., derzeit stellv. Kreisvors., 1996/01 Landesvors. der Frauen-Union Sachsen, 1996/2012 Mitgl. CDU-Bundesvorst. Seit 2001 Landesvors. "donum vitae" Sachsen e. V., seit 2000 Vors. des Rates für sorbische Angelegenheiten im Freistaat Sachsen, seit 2002 Mitgl. Parl. Beirat der Stiftung für das Sorbische Volk. Seit 2008 Vors. Freundeskreis Kloster St. Marienthal in Ostritz. Sorbisch (f), Russisch (G). - MdB Okt./Dez. 1990, Febr. 1991/94 und seit Okt. 2002; seit Sept. 2015 gesundheitspol. Sprecher der CDU/CSU-Fraktion.', 'Maria', '11001501');
