INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (04250, NULL, 'Dr.', 'Dr.', 'Bundesminister a. D., Dipl.-Kaufmann, Müllermeister', 'verheiratet, 4 Kinder', '10.02.1954', NULL, 'München', 'männlich', NULL, '20.12.1990', 'Ramsauer', NULL, 'CSU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Strategieberatung, Traunwalchen<br/>   Mandant 1, monatlich, Stufe 3 (ab Mai 2014)<br/>   Mandant 2, 2015, Stufe 3; 2016, Stufe 4<br/><br/>Deutschland baut! e.V., Frankfurt/Main,<br/>Beratung, 2015, Stufe 4; 2016, Stufe 4<br/><br/>PKS Kommunikations- und Strategieberatung GmbH, Berlin,<br/>Vortrag, 2014, Stufe 2 (Mobilität gestalten: Für eine bessere Zukunft, PTV-Group, Karlsruhe)<br/>Vortrag, 2014, Stufe 1 (Architekten und Politik 2014, Landesarchitektenkammer Niedersachsen, Hannover)<br/>Vortrag, 2014, Stufe 3 (Mobilität der Zukunft, ARUA GbR, Berlin)<br/>Vortrag, 2016, Stufe 2 (FEFCO-Summit 2016: Europe Today, European Federation of Corrugated Board Manufacturers (FEFCO), Brüssel)<br/>Vortrag, 2016, Stufe 2 (Nudging - Anstoß für eine "richtige" Lebensführung!?, Deutscher Zigarettenverband e.V., Berlin, und Deutsche Fachverlag GmbH, Frankfurt/Main)<br/><br/>Widenmoos Resort, Reitenau, Schweiz,<br/>Vortrag und Beratung, 2016, Stufe 3 (Clubtag)<br/><br/>Funktionen in Unternehmen: <br/>	Aebi Schmidt Holding AG, Frauenfeld, Schweiz,<br/>Mitglied des Verwaltungsrates, 2016, Stufe 5<br/><br/>CNC - Communications & Network Consulting AG, München,<br/>Mitglied des Expertenrates, 2015, Stufe 3; 2016, Stufe 3<br/><br/>Gothaer Versicherungsbank VVaG, Köln,<br/>Mitglied des Unternehmerbeirates<br/><br/>Münchener Hypothekenbank eG, München,<br/>Mitglied des Aufsichtsrates, 2014, Stufe 4; 2015, Stufe 4<br/><br/>SKW Stahl-Metallurgie Holding AG, München,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Landkreis Traunstein, Traunstein, <br/>	Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bürgerstiftung Berchtesgadener Land, Bad Reichenhall,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>DUK Versorgungswerk e.V., Berlin,<br/>Mitglied des Beirates, 2015, Stufe 3<br/><br/>Förderkreis des Ensemble Amphion München-Wien e.V., München,<br/>Vorsitzender, ehrenamtlich<br/><br/>Ghorfa - Arab-German Chamber of Commerce and Industry e.V., Berlin,<br/>Präsident, monatlich, Stufe 2 (ab Juni 2014)<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Ramsauer Talmühle KG, Traunwalchen', 'Abitur am Staatl. Landschulheim Marquartstein. Studium der Wirtschaftswissenschaften Ludwig-Max.-Univ. München, 1979 Diplomkaufmann und 1985 Promotion zum Doktor der Staatswissenschaften. Ausbildung im Müllerhandwerk, 1977 Gesellen-, 1980 Meisterprüfung. - MdB seit 1990; 2005/2009 Vors. der CSU-Landesgruppe und 1. stellv. Vors. der CDU/CSU-Fraktion; 2009/2013 Bundesminister für Verkehr, Bau und Stadtentwicklung; seit Jan. 2014 Vors. Ausschuss für Wirtschaft und Energie.', 'Peter', '11001772');
