INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (04434, NULL, 'Dr.', 'Dr.', 'Dipl.-Chemiker, Bundesminister a. D.', 'verheiratet, 4 Kinder', '01.12.1935', NULL, 'Frankfurt/Main', 'männlich', NULL, '14.12.1976', 'Riesenhuber', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>acatech - Deutsche Akademie der Technikwissenschaften e.V., München,<br/>Gutachterliche Tätigkeit, 2016, Stufe 1<br/><br/>Kabel Deutschland Holding AG, Unterföhring, <br/>	Beratung, 2014, Stufe 4<br/><br/>	marcus evans Germany Ltd., Berlin, <br/>	Vortrag, 2014, Stufe 3 (Vom Mindestlohn bis zur Energiewende - <br/>	neue politische Rahmenbedingungen für das Facility Management,<br/>	Facility Management Gipfel 2014)<br/><br/>Funktionen in Unternehmen: <br/>HBM Healthcare Investments AG, Baar/Schweiz, <br/>	Vizepräsident des Verwaltungsrates, 2014, Stufe 6; 2015, Stufe 10; 2016, Stufe 6<br/><br/>	Kabel Deutschland Holding AG, Unterföhring, <br/>	Ehrenvorsitzender des Aufsichtsrates (bis 16.05.2014)<br/><br/>	NAsP GmbH, Marburg, <br/>	Mitglied des Beirates<br/><br/>	Reclay Holding GmbH, Köln, <br/>	Vorsitzender des Beirates (bis 30.06.2015), 2014, Stufe 7;<br/>	2015, Stufe 5<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Parlamentarische Gesellschaft e.V., Berlin, <br/>	Präsident, ehrenamtlich<br/><br/>	Hessische Multiple Sklerose Stiftung, Frankfurt/Main, <br/>	Vorsitzender, ehrenamtlich<br/><br/>	Senckenberg Gesellschaft für Naturforschung, Frankfurt/Main, <br/>	Mitglied des Verwaltungsrates, ehrenamtlich', '1955 Abitur. Studium Naturwissenschaften und Volkswirtschaft, 1961 Dipl.-Chemiker, 1965 Dr. rer. nat. 1962/65 wiss. Assistent Univ. Frankfurt; Patentanmeldungen. 1966/71 Erzgesellschaft mbH im Haus Metallges. AG, Frankfurt, 1968/71 als Geschäftsf. 1971/82 Geschäftsf. bei Synthomer Chemie GmbH Frankfurt. 1982/93 Bmin. für Forschung und Technologie. Seit 1995 Honorarprof. Univ. Frankfurt. Dr. h. c. des Weizmann-Instituts in Rehovot, Israel, der Berg- und Hüttenakademie Krakau, der Univ. Surrey, England, und der Univ. Göttingen. Mitgl. in Aufsichtsräten und Beiräten von Unternehmen in Deutschland und im Ausland. 1996/98 Vors. Deutsch-Amerikanisches Akademisches Konzil, 1994/02 Ko-Vors. Deutsch-Japanischer Kooperationsrat für Hochtechnologie und Umwelttechnik. Seit 2006 Präs. Dt. Parlamentarische Gesellschaft. Vors. Hess. Multiple Sklerose-Stiftung, Frankfurt. Mitgl. Verwaltungsrat SGN (Senckenberg Ges. f. Naturforschung), seit 2015 Mitgl. Senatskollegium acatech, seit 2014 Ehrensenator AiF Arbeitsgem. industrieller Forschungsvereinigungen e.V. 1961 JU und CDU; 1965/69 Landesvors. JU Hessen, 1968 stellv. Bundesvors. JU; seit 1979 Bezirksvors. CDU Frankfurt RheinMain, 1965 Mitgl. Landesvorst., seit 1968 Mitgl. Präsidium der CDU Hessen. 1973/78 Kreisvors. CDU Frankfurt, 1977/82 Vors. Bundesfachausschuss Energie und Umwelt der CDU Deutschland, Mitgl. Bundesvorst. Wirtschaftsrat der CDU. Englisch (f). - MdB seit 1976; 1980/82 energiepol. Sprecher der CDU/CSU-Fraktion, Vorstandsmitgl. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, 2001/02 Vors. Ausschuss für Wirtschaft und Technologie. Alterspräsident des 17. und 18. Deutschen Bundestages.', 'Heinz', '11001849');
