INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (04777, NULL, NULL, NULL, 'Bundesminister für Ernährung und Landwirtschaft, Rechtsanwalt', 'verheiratet, 2 Kinder', '26.08.1957', NULL, 'Obernzenn, Landkrs. Neustadt/Aisch-Bad Windsheim', 'männlich', NULL, '20.12.1990', 'Schmidt', '(Fürth)', 'CSU', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Unternehmen: <br/>Report Verlag GmbH, Bonn,<br/>Mitglied des Beirates der Zeitschrift "Strategie & Technik", ehrenamtlich (bis Dezember 2013)<br/><br/>Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin,<br/>Mitglied des Verwaltungsrates, von Amts wegen (bis Dezember 2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreditanstalt für Wiederaufbau (KfW), Frankfurt/Main,<br/>Mitglied des Verwaltungsrates, von Amts wegen<br/><br/>Landwirtschaftliche Rentenbank, Frankfurt/Main,<br/>Stellv. Vorsitzender des Verwaltungsrates, von Amts wegen<br/><br/>Stiftung zur Aufarbeitung der SED-Diktatur, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>American Jewish Committee e.V. (AJC), Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Deutsch-Tschechisches Gesprächsforum, Prag,<br/>Deutscher Co-Vorsitzender des Koordinierungsrates, ehrenamtlich<br/><br/>Deutsche Atlantische Gesellschaft e.V., Berlin,<br/>Präsident, ehrenamtlich<br/><br/>Deutsche Stiftung Friedensforschung (DSF), Osnabrück,<br/>Mitglied des Stiftungsrates, von Amts wegen (bis Dezember 2013)<br/><br/>Gesellschaft für Wehr- und Sicherheitspolitik e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Help - Hilfe zur Selbsthilfe e.V., Bonn,<br/>Mitglied des Vorstandes, ehrenamtlich (bis September 2014)<br/><br/>Leo Baeck Foundation, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich', '1976 Abitur Bad Windsheim. 1976/77 Wehrdienst. 1977/82 Studium Rechtswiss. Univ. Erlangen und Lausanne, 1982 1., 1985 2. jur. Staatsprüfung. Seit 1985 Rechtsanwalt mit Schwerpunkt Arbeitsrecht (Zulassung ruht). 1980/86 Vorstandsmitgl. der Europa-Union Bayern; Präs. Deutsch-Atlantische Gesellschaft; Mitgl. der Gesellschaft für christlich-jüdische Zusammenarbeit. 1974 Eintritt in die JU, 1976 in die CSU; 1979/82 Kreisvors. JU, 1982/91 Bezirksvors. JU Mittelfranken; stellv. Bundesvors. des EAK der CDU/CSU, 1999/09 Kreisvors. der CSU Fürth-Stadt. Vors. des Ev. Arbeitskreises der CSU, 2004/14 Vors. des Arbeitskreises Außen- und Sicherheitspolitik der CSU, seit 2011 stellv. Parteivors. der CSU. 1984/90 Mitgl. Gemeinderat in Obernzenn, 1984/90 Kreisrat im Landkr. Neustadt/Aisch-Bad Windsheim. Englisch (f), Französisch (G). - MdB seit 1990; Okt. 2002/Nov. 2005 Vors. AG Verteidigung der CDU/CSU-Fraktion; Nov. 2005/Dez. 2013 Parl. Staatssekretär beim BMin. der Verteidigung, Dez. 2013/Feb. 2014 Parl. Staatssekretär beim BMin. für wirtschaftliche Zusammenarbeit und Entwicklung, seit Feb. 2014 Bundesminister für Ernährung und Landwirtschaft.', 'Christian', '11002003');
