INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (05450, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet', '07.06.1939', NULL, 'Halle / Saale', 'männlich', NULL, '31.03.1985', 'Ströbele', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Berlin<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>taz Panter Stiftung, Berlin, <br/>Mitglied des Kuratoriums', 'Abitur in Marl/Westfalen. Studium der Rechts- und Pol. Wissenschaft in Heidelberg und FU Berlin, Referendariat in Berlin. Wehrdienst Luftwaffe in Aurich, Kanonier d. R. Seit 1969 Rechtsanwalt in Berlin, 10 Jahre "Sozialistisches Anwaltskollektiv", 30 Jahre Verteidiger in pol. Strafverfahren. Engagement in der Studentenbewegung Ende der 60er Jahre. 1970/74 Mitgl. der SPD. Mitwirkung bei der Gründung der "Alternativen Liste für Demokratie und Umweltschutz", späterer Landesverband der Grünen in Berlin, Mitgl. der Alternativen Liste seit 1985, zeitweise Sprecher im Bundesvorst. und Landesverb. Die Grünen. - MdB 1985/87 und seit 1998; Okt. 2002/Okt. 2009 stellv. Fraktionsvors. und Koordinator des Arbeitskreises III Demokratie, Recht und Gesellschaftspolitik der Fraktion BÜNDNIS 90/DIE GRÜNEN; Mitgl. Parl. Kontrollgremium.', 'Hans-Christian', '11002273');
