INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06257, NULL, NULL, NULL, 'Juristin', 'verheiratet, 1 Kind', '22.05.1953', NULL, 'Ludwigshafen', 'weiblich', NULL, '10.11.1994', 'Barnett', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>	Hochschule der Wirtschaft für Management gemeinnützige GmbH (HdWM), Mannheim,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>RSBK Strategie Beratung Kommunikation AG, Frankfurt/Main,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Saint-Gobain ISOVER G+H AG, Ludwigshafen,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Diakoniestiftung für die Pfalz, Speyer,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Energiedialog 2050 e.V., Berlin,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Institut für Europäische Politik e.V. (IEP), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>NaturFreunde Landesverband Rheinland-Pfalz e.V., Ludwigshafen am Rhein,<br/>Vorsitzende des Landesvorstandes, ehrenamtlich<br/><br/>Oskar-Patzelt-Stiftung, Leipzig,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Verein zur Förderung der beruflichen Bildung e.V. (VFBB), Speyer,<br/>Mitglied des Vorstandes, ehrenamtlich', 'Staatliche Handelsschule, Wirtschaftsgymnasium, Abitur. Jurastudium an der Johannes-Gutenberg-Univ. Mainz, 2. Staatsexamen. Ein Jahr beim DGB und vier Jahre bei der ÖTV als Rechtssekretärin tätig; anschließend fünf Jahre bei den Technischen Werken Ludwigshafen in der Personalabteilung. Anschließend Leiterin des Sozialverwaltungsamtes der Stadtverwaltung Ludwigshafen. Mitgl. ver.di, der IG BCE, der AWO und im Arbeitsgerichtsverband, Landesvors. der Naturfreunde Rheinland-Pfalz. Mitgl. SPD seit 1971, seit 1984 im Ortsvereinsvorst. Ludwigshafen-Oggersheim, seit 1992 im Landesvorst. der SPD. Englisch (f), Französisch (G). - MdB seit 1994; in der 14. WP Vors. Ausschuss für Arbeit und Sozialordnung, in der 16. WP Vors. Unterausschuss für Regionale Wirtschaftspolitik; seit der 17. WP Leiterin dt. Delegation in der Parl. Versammlung der OSZE (OSZE PV), 2013/15 Vizepräsidentin der OSZE PV, seit 2015 Schatzmeisterin der OSZE PV.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 209 (Neustadt-Speyer)', 'Doris', '11002621');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06258, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'ledig', '28.12.1955', NULL, 'München', 'männlich', NULL, '01.12.2005', 'Barthel', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesministerium für Wirtschaft und Energie, Berlin, <br/>Mitglied des Außenwirtschaftsbeirates<br/><br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn, <br/>Vorsitzender des Beirates<br/><br/>Landkreis Bad Tölz-Wolfratshausen, Bad Tölz, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeitsgemeinschaft industrieller Forschungsvereinigungen<br/>"Otto von Guericke" e.V. (AiF), Köln, <br/>Mitglied des Senats, ehrenamtlich<br/><br/>Deutsch-Brasilianische Gesellschaft e.V., Berlin, <br/>Mitglied des Kuratoriums', 'Volksschule und Gymnasium in München, Abitur. Studium der Pol. Wissenschaft mit den Nebenfächern Soziologie und Geschichte an der Ludwig-Maximilians-Univ. München; Magister Artium. Zivildienst. Div. berufl. Aushilfstätigkeiten. Gewerkschaftssekretär, Schwerpunkte Jugend und berufl. Bildung bei der ÖTV, Bezirksverwaltung Bayern. Mitgl. in DGB-Gewerkschaften seit 1977, derzeit ver.di; 2007/08, 2015/16 Vors. und 2008/10 stellv. Vors. Beirat Bundesnetzagentur. 1975 Eintritt in die SPD, div. Funktionen seit 1976, 1983/88 Mitgl. SPD-Bezirksvorst. Südbayern, 1991/2000 und 2005/13 stellv. Vors. SPD-Bezirk Oberbayern, seit 2007 Mitgl. SPD-Landesvorst., seit 2009 des Landespräsidiums, ab April 2011 Mitgl. SPD-Parteirat, dann Parteikonvent; seit 2009 Landesvors. der AfA, 2010/12 stellv. Bundesvors. und seit April 2012 Bundesvors. der AfA; 1983/88 Vors. der südbayer. Jungsozialisten. Seit 2002 Kreisrat Lkr. Bad Tölz-Wolfratshausen. Ab Mai 2014 Mitgl. Senat bei der AIF. Seit Sept. 2012 Träger Bayer. Verdienstorden. Englisch (f), Französisch (G). - MdB seit 1994; 1998 Vors. Ausschuss für Post und Telekommunikation (13. WP), 1998/02 Vors. Unterausschuss für Telekommunikation und Post, 2009/13 stellv. Sprecher der SPD-Fraktion für Wirtschaft und Technologie, seit 2013 stellv. Vors. Ausschuss für Wirtschaft und Energie, seit 2009 Vors. Gesprächskreis Lateinamerika der SPD-Fraktion, seit 2014 Vors. Dt.-Südamerikanische Parlamentariergruppe, 2009 stellv. Vors. und seit 2011 Vors. AG Weltwirtschaft, seit 2015 Sprecher AG für Arbeitnehmer/innen-Politik der SPD-Fraktion; seit 2015 Mitgl. Außenwirtschaftsbeirat beim BM für Wirtschaft und Energie.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 226 (Weilheim)', 'Klaus', '11002622');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06259, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 2 Kinder', '22.08.1944', NULL, 'Trier', 'männlich', NULL, '10.11.1994', 'Basten', NULL, 'CDU', NULL, 'katholisch', NULL, NULL, NULL, 'Franz-Peter', '11002623');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06260, NULL, NULL, NULL, 'Parl. Staatssekretärin a. D., Realschullehrerin', 'verheiratet, 2 Kinder', '25.06.1952', NULL, 'Bramsche / Osnabrück', 'weiblich', NULL, '21.12.1991', 'Beck', '(Bremen)', 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Verein Brücke der Hoffnung, Bremen, <br/>Vorsitzende', 'Abitur 1970 in Osnabrück. Studium Deutsch, Geschichte, Gemeinschaftskunde in Bielefeld und Heidelberg. Lehrerin an der Konrad-Adenauer-Realschule in Pforzheim. Vors. des Vereins "Brücke der Hoffnung". Mitgl. der Gesellschaft für bedrohte Völker und des BUND, Mitgl. Vorstand im Petersburger Dialog e. V. Ehrenbürgerin der bosn. Stadt Lukavac. 1991/94 Mitgl. der Bremischen Bürgerschaft. Mitgl. des Vorstands Petersburger Dialog e. V. - MdB 1983/April 1985, 1987/90 und seit 1994; im Kabinett Schröder/Fischer Beauftragte der Bundesregierung für Migration, Flüchtlinge und Integration und Parl. Staatssekretärin beim BMFSJ. Sprecherin für Osteuropapolitik der Fraktion Bündnis 90/ Die Grünen und Obfrau im Auswärtigen Ausschuss; Mitgl. der PV des Europarates; Vors. Dt.-Bosnische PG, stellv. Vors. Dt.-Ukrainische PG und Mitgl. Dt.-Südkaukasische PG.', 'Marieluise', '11002624');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06263, NULL, NULL, NULL, 'Referent, Erster Parl. Geschäftsführer a. D.', 'verpartnert', '12.12.1960', NULL, 'Stuttgart-Bad Cannstadt', 'männlich', NULL, '10.11.1994', 'Beck', '(Köln)', 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Ullstein Buchverlage GmbH, Berlin, <br/>	Publizistische Tätigkeit, 2015, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Heinrich-Heine-Universität, Düsseldorf, <br/>	Mitglied des Kuratoriums für Deutsches und Internationales Parteienrecht und<br/>	Parteienforschung, ehrenamtlich<br/><br/>	Hessischer Härtefonds für NS-Verfolgte, Wiesbaden, <br/>	Beiratssprecher, ehrenamtlich<br/><br/>	Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Denkmal für die ermordeten Juden Europas, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Aktion Courage e.V. - SOS Rassismus, Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Aktion Deutschland Hilft e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Arbeitskreis der Opferhilfen in der Bundesrepublik Deutschland e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Bundesstiftung Magnus Hirschfeld, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>	Deutscher Koordinierungsrat der Gesellschaften für Christlich-Jüdische Zusammenarbeit e.V., Bad Nauheim, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Hirschfeld-Eddy-Stiftung,<br/>	Stiftung für die Menschenrechte von Lesben und Schwulen,<br/>	Bisexuellen und Transgender, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Informations- und Dokumentationszentrum für Antirassismusarbeit e.V. (IDA), Düsseldorf, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Leo Baeck Foundation, Potsdam, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>	Stiftung Deutsches Holocaust-Museum, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Sudetendeutscher Rat e.V., München, <br/>	Mitglied der Kurie der Parteien, ehrenamtlich<br/><br/>	The American Jewish Committee, Berlin, <br/>	Mitglied des Beirates, ehrenamtlich', 'Studium der Geschichte, Kunstgeschichte und Germanistik in Stuttgart. 2002/13 Mitgl. Parteirat BÜNDNIS 90/DIE GRÜNEN. Französisch (f), Englisch (G). - MdB seit 1994; 1994/02 rechtspolitischer Sprecher der Fraktion BÜNDNIS 90/DIE GRÜNEN, Mitgl. im Fraktionsvorst. und 1998/02 politischer Koordinator des Arbeitskreises Innen, Recht, Frauen, Jugend und Petitionen. Okt. 2002/Okt. 2013 1. Parl. Geschäftsführer der Fraktion BÜNDNIS 90/DIE GRÜNEN, 2005/13 menschenrechtspolitischer Sprecher der Fraktion BÜNDNIS 90/DIE GRÜNEN, seit 2014 religionspol. Sprecher, 2014/März 2016 innenpol. Sprecher und seit 2016 migrationspol. Sprecher der Fraktion BÜNDNIS 90/DIE GRÜNEN, 2014/März 2016 Vors. der Deutsch-Israelischen Parlamentariergruppe des Deutschen Bundestages.', 'Volker', '11002625');
