zmesse ?Pools and Finance?, bbg Betriebsberatungs GmbH, Bayreuth)<br/>Vortrag, 2016, Stufe 2 (Vertreterversammlung, Donau Iller Bank eG, Baden-Württemberg)<br/><br/>Premium Conferences GmbH, Neerach (Schweiz),<br/>Vortrag, 2016, Stufe 2 (14. Alpensymposium 2016)<br/><br/>quirin bank AG, Berlin,<br/>Vortrag, 2016, Stufe 1 (Aktuelles aus der Bundespolitik. Was jetzt zu tun ist.)<br/><br/>Rheinische Post Verlagsgesellschaft mbH, Düsseldorf,<br/>Vortrag, 2016, Stufe 1 (1. RP-Wirtschaftsforum Sicherheit in Deutschland)<br/><br/>Ring Deutscher Makler, Landesverband Berlin und Brandenburg e.V. (RDM), Berlin,<br/>Vortrag, 2015, Stufe 2 (Immobilientag 2015, Die Welt im Wandel - Deutschlands Chancen in den Zeiten der Globalisierung)<br/><br/>sas Institute GmbH, Heidelberg,<br/>Vortrag, 2013, Stufe 2 (Jahrestischgespräch)<br/>Vortrag, 2014, Stufe 2 (Erörterungen zu Fragen der aktuellen politischen Lage)<br/>Vortrag, 2015, Stufe 2 (Jahrestischgespräch)<br/><br/>SchmidtColleg GmbH & Co KG, Kronach,<br/>Vortrag, 2013, Stufe 1 (SchmidtColleg Seminare)<br/><br/>The London Speaker Bureau, Karlsruhe,<br/>Vortrag, 2013, Stufe 2 (Hauptstadtforum 2013 der Landesbank Berlin)<br/>Vortrag, 2015, Stufe 2 (8. SRS-Wirtschaftskongress, Quer denken? Klar handeln!, SRS OHG, Karlsruhe)<br/>Vortrag, 2015, Stufe 2 (Deutschland und die Welt im Wandel - Worauf es jetzt ankommt, GfM mbH & Co Betriebs KG, Neustadt/Donau)<br/>Vortrag, 2016, Stufe 2 (Aktuelles aus der Bundespolitik, J.P. Morgan Securities plc, Frankfurt/Main)<br/>Vortrag, 2016, Stufe 2 (Sicherheitskonferenz 2016 Gemeinsam die Zukunft sichern, Lufthansa Cargo AG, Frankfurt/Main)<br/>Vortrag, 2016, Stufe 2 (BÄKO Technik- und Innovationstag 2016, BÄKO-ZENTRALE NORD eG, Duisburg)<br/><br/>Verband Fenster + Fassade (VFF), Frankfurt/Main,<br/>Vortrag, 2016, Stufe 1 (Jahreskongress 2016)<br/><br/>Volksbank Hohenlimburg eG, Hagen,<br/>Vortrag, 2016, Stufe 1 (Kundenveranstaltung)<br/><br/>VR-Bank Kreis Steinfurt eG, Rheine,<br/>Vortrag, 2015, Stufe 1 (Kundenveranstaltung)<br/><br/>Funktionen in Unternehmen: <br/>	1. FC Köln GmbH & Co. KGaA, Köln,<br/>Mitglied des Beirates<br/><br/>AHG Allgemeine Hospitalgesellschaft AG, Düsseldorf,<br/>Mitglied des Aufsichtsrates, 2013, Stufe 4; 2014, Stufe 3; 2016, Stufe 3<br/><br/>DBV Deutsche Beamten-Versicherung AG, Wiesbaden,<br/>Mitglied des Beirates des öffentlichen Dienstes, jährlich, Stufe 3<br/><br/>Deutsche Telekom AG, Bonn,<br/>Mitglied des Datenschutzbeirates<br/><br/>Kölner Bank eG, Köln,<br/>Mitglied des Zentralbeirates<br/><br/>Signal Iduna Allgemeine Versicherung AG, Hamburg, Dortmund,<br/>Mitglied des Aufsichtsrates, jährlich, Stufe 4<br/><br/>Talanx Deutschland Bancassurance GmbH, Hilden,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	ZDF, Mainz, <br/>	Mitglied des Fernsehrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Gegen Vergessen - Für Demokratie e.V., Bonn,<br/>Mitglied des Vorstandes (bis 22.11.2014)<br/><br/>Kölner Eishockey-Club "Die Haie" e.V., Köln,<br/>Mitglied des Beirates<br/><br/>Stiftung Menschen für Menschen - Karlheinz Böhms Äthiopienhilfe -, München,<br/>Mitglied des Transparenzgremiums', '1968 Mittlere Reife. Ausbildung zum Einzelhandelskaufmann bei der Konsumgenossenschaft Köln eG/COOP West AG, Supermarktleiter. Besuch der Rheinischen Akademie in Köln mit Abschluss "Staatlich geprüfter Betriebswirt". Abitur auf dem zweiten Bildungsweg. Studium der Rechtswissenschaften Univ. Köln, 1988 1. und 1991 2. jur. Staatsexamen. Seit 1991 Tätigkeit als Rechtsanwalt. 1972 Eintritt in die CDU. 1975/79 Mitgl. Kreistag Rheinisch-Bergischer Kreis; 1979/99 Mitgl. des Rates der Stadt Bergisch Gladbach. 2000/06 Mitgl. im Kuratorium der Stiftung "Erinnerung, Verantwortung und Zukunft". Englisch (f), Französisch (G). - MdB seit 1994; Febr. 2000/Nov. 2009 stellv. Vors. der CDU/CSU-Fraktion, Nov. 2009/Sept. 2015 Vors. Innenausschuss.', 'Wolfgang', '11002632');
