INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06308, NULL, NULL, NULL, 'Hochschuldozentin, Grundschullehrerin', 'geschieden, 2 Kinder', '11.11.1955', NULL, 'Remscheid', 'weiblich', NULL, '10.11.1994', 'Ernstberger', NULL, 'SPD', NULL, 'katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn,<br/>Ombudsfrau bei der Deutschen Bank Bauspar AG<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Berliner Republik e.V., Berlin,<br/>Schatzmeisterin, ehrenamtlich<br/><br/>Deutsche Parlamentarische Gesellschaft e.V., Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Deutsch-Tschechisches Gesprächsforum, Prag,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Förderkreis Deutsch-Tschechische Fußballschule e.V., Rehau,<br/>Vorsitzende, ehrenamtlich<br/><br/>Friedrich-Ebert-Stiftung e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich', 'Abitur 1975. Studium an der Univ. Bayreuth für das Lehramt an Volksschulen, 1. Staatsexamen 1978, 2. Staatsexamen 1981. Lehrerin an Volksschulen; 1990/94 Dozentin an der Univ. Bayreuth als wissenschaftl. Mitarbeiterin, Schwerpunkt Grundschulpädagogik/Grundschuldidaktik am gleichnamigen Lehrstuhl. Bis 1994 Frauenbeauftragte der kulturwissenschaftl. Fakultät der Univ. Bayreuth. Mitgl. der SPD seit 1990, 1992/05 Vors. Unterbezirk Hof/Saale. Mitgl. der IG BCE, Mitgl. AWO, des BRK (Bayrisches Rotes Kreuz), Mitgl. im BLLV (Bayerischer Lehrer- und Lehrerinnenverband e. V.) und in weiteren Vereinen und Organisationen. Trägerin des Bundesverdienstkreuzes am Bande, des Bayerischen Verdienstordens und des deutsch-tschechischen Kunstpreises. - MdB seit 1994; seit Nov. 2004 Parl. Geschäftsführerin der SPD-Fraktion; Mitgl. des Ältestenrates.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 238 (Coburg)', 'Petra', '11002648');
