INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06326, NULL, NULL, NULL, 'Lehrerin', 'keine Angaben', '03.03.1953', NULL, 'Letmathe', 'weiblich', NULL, '10.11.1994', 'Freitag', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Westfälischer Industrieklub Dortmund e.V., Dortmund, <br/>	Vortrag, 2014, Stufe 1 (Ist die Integrität des Sports in Gefahr?)<br/><br/>Funktionen in Unternehmen: <br/>	Deutsche Leichtathletik Promotion- und Projektgesellschaft mbH (DLP), Darmstadt, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Deutsche Sporthochschule Köln, Köln,<br/>Mitglied des Hochschulrates, ehrenamtlich<br/><br/>Deutsche Welle, Bonn,<br/>Stellv. Vorsitzende des Rundfunkrates, jährlich, Stufe 3 (ab 2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Schulsportstiftung, Stuttgart,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis Februar 2014)<br/><br/>Deutscher Behindertensportverband e.V. (DBS), Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis Februar 2014)<br/><br/>Deutscher Leichtathletik-Verband, Darmstadt,<br/>Vizepräsidentin, ehrenamtlich<br/><br/>Nationale Anti-Doping Agentur Deutschland (NADA), Bonn,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Robert-Enke-Stiftung, Hannover,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis Februar 2014)<br/><br/>Sepp Herberger-Stiftung, Köln,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1972 Abitur. Lehramtsstudium Anglistik und Sportwiss. in Bochum. Realschullehrerin, 1980/92 Realschule Schwerte, 1992/94 Gesamtschule Schwerte. Mitgl. AWO, in diversen Sport- und Fördervereinen, im Deutschen Tierschutzbund und im Tierschutzverein Iserlohn, seit 2001 Vizepräsidentin im Deutschen Leichtathletik-Verband, seit 2014 stellv. Vors. Rundfunkrat Deutsche Welle. Mitgl. der SPD seit 1975. Ratsmitgl. und Vors. des Sportausschusses der Stadt Iserlohn 1989/99. Englisch (f), Französisch (G), Schwedisch (G). - MdB seit 1994; 1998/09 sportpolitische Sprecherin der SPD-Fraktion, seit Nov. 2009 Vors. Sportausschuss, Mitgl. Innere Kommission des Ältestenrates; seit 2014 Mitgl. der Parl. Versammlung der NATO, Mitgl. der deutschen Delegation der Interparlamentarischen Union, 2014/16 Vors. der Parlamentariergruppe SADC-Staaten, seit Okt. 2016 Vors. der Parlamentariergruppe USA.', 'Dagmar', '11002655');
