INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06348, NULL, NULL, NULL, 'Bundesminister für Gesundheit, Rechtsanwalt', 'verheiratet, 4 Kinder', '25.02.1961', NULL, 'Uedem / Kreis Kleve', 'männlich', NULL, '10.11.1994', 'Gröhe', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Christlich Demokratische Union Deutschlands, Berlin, <br/>	Generalsekretär (bis 17.12.2013), monatlich, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Evangelische Kirche in Deutschland (EKD), Hannover, <br/>	Mitglied der Synode, ehrenamtlich<br/><br/>	ZDF, Mainz, <br/>	Mitglied des Fernsehrates (bis 17.12.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Konrad-Adenauer-Stiftung e.V., St. Augustin, <br/>Mitglied des Vorstandes, ehrenamtlich', '1971/80 Quirinus-Gymnasium Neuss, Abitur 1980. 1980/87 Studium der Rechtswissenschaften an der Univ. Köln, 1987 1. jur. Staatsprüfung. 1987/93 wissenschaftl. Mitarbeiter am Seminar für Staatsphilosophie und Rechtspolitik Univ. Köln; 1991/93 Rechtsreferendariat am Landgericht Köln, 1993 2. jur. Staatsprüfung. Seit 1994 Rechtsanwalt (Zulassung ruht seit Dez. 2013). Evangelische Kirche in Deutschland (EKD): seit 1997 Mitgl. der Synode, 1997/09 Mitgl. im Rat der EKD, Vorstandsmitgl. in der Konrad-Adenauer-Stiftung, 2000/Sept. 2008 Vors. Diakonisches Werk Neuss, März 2010/Dez. 2013 Mitgl. ZDF-Fernsehrat. Seit 1977 Mitgl. CDU, 1983/89 Kreisvors. JU Neuss, 1989/94 Bundesvors. der JU Deutschlands, 2001/Nov. 2009 Vors. der CDU im Rhein-Kreis Neuss, seit Dez. 2014 Mitgl. des Bundesvorst. der CDU Deutschlands. 1984/89 und 1993/94 Mitgl. Kreistag Neuss. Englisch (f). - MdB seit 1994; 1994/98 Sprecher der Jungen Gruppe der CDU/CSU-Fraktion, 1998/05 Sprecher der CDU/CSU-Fraktion für Menschenrechte und Humanitäre Hilfe, Nov. 2005/Sept. 2008 Justitiar der CDU/CSU-Fraktion. Okt. 2008/Okt. 2009 Staatsminister bei der Bundeskanzlerin; Okt. 2009/Dez. 2013 Generalsekretär der CDU Deutschlands; seit Dez. 2013 Bundesminister für Gesundheit.', 'Hermann', '11002666');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06355, NULL, NULL, NULL, 'Dipl.-Elektroingenieur', 'verheiratet, 4 Kinder', '03.07.1955', NULL, 'Zeitz / Sachsen-Anhalt', 'männlich', NULL, '10.11.1994', 'Grund', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Deutsch-Kasachische Gesellschaft e.V., Berlin, <br/>	Stellv. Vorsitzender, ehrenamtlich<br/><br/>	Deutsch-Moldauisches Forum e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich', 'Abitur in Lützen. Anschl. Tätigkeit als Turbinenmaschinist im Braunkohlekombinat Deuben. 1974/75 Grundwehrdienst. 1976/80 Studium der Elektrotechnik an der TU Dresden. 1980/90 Netzingenieur im Energiekombinat Erfurt, Betriebsteil Bleicherode. Okt. 1990/Juni 1994 1. Kreisbeigeordneter und Dezernent in der Kreisverwaltung Heiligenstadt. Bis 1990 ohne parteipolitische Bindung. Herbst 1989 Sprecher der Bürgerinitiative Heiligenstadt. Eintritt in die CDU Jan. 1990. Englisch (f), Russisch (G). - MdB seit 1994; seit Okt. 1998 Parl. Geschäftsführer der CDU/CSU-Fraktion; Mitgl. PKGr; Mitgl. des Ältestenrates; Mitgl. dt. Delegation in der PV der OSZE; Vors. Dt.-Zentralasiatische Parlamentariergruppe, Mitgl. Schwarzmeerwirtschaftskooperation.', 'Manfred', '11002667');
