INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06371, NULL, 'Dr.', 'Dr.', 'Bundesministerin für Umwelt, Naturschutz, Bau und Reaktorsicherheit, Historikerin', 'keine Angaben', '29.04.1952', NULL, 'Kleve', 'weiblich', NULL, '10.11.1994', 'Hendricks', NULL, 'SPD', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Sozialdemokratische Partei Deutschlands, Berlin, <br/>Schatzmeisterin (bis 17.12.2013), monatlich, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>Volksfürsorge Deutsche Lebensversicherung AG, Hamburg, <br/>Mitglied des Beirates (bis 17.12.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeszentrale für politische Bildung, Bonn, <br/>Mitglied des Kuratoriums (bis Mitte Januar 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion pro Humanität e.V., Kevelaer,<br/>Mitglied des Kuratoriums<br/><br/>Bundesstiftung Magnus Hirschfeld, Berlin,<br/>Mitglied des Kuratoriums (bis Mitte Januar 2014)<br/><br/>Deutsch-Niederländische Konferenz, Berlin, Den Haag,<br/>Mitglied des Deutschen Lenkungsausschusses<br/><br/>Forum Ökologisch-Soziale Marktwirtschaft e.V. (FÖS), Berlin,<br/>Mitglied des Beirates, ehrenamtlich (bis Mitte Januar 2014)<br/><br/>Freundeskreis Willy-Brandt-Haus e.V., Berlin,<br/>Vorsitzende (bis November 2014)<br/><br/>Katholischer Deutscher Frauenbund e.V., Köln,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis Mitte Januar 2014)<br/><br/>Kulturforum der Sozialdemokratie, Berlin,<br/>Mitglied des Vorstandes (bis Mitte Mai 2014)<br/><br/>Zentralkomitee der deutschen Katholiken (ZdK), Bonn,<br/>Mitglied der Vollversammlung, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Deutsche Druck- und Verlagsgesellschaft mbH, Berlin (bis 17.12.2013)<br/><br/>Konzentration GmbH, Berlin (bis 17.12.2013)<br/><br/>Verwaltungsgesellschaft Bürohaus Berlin Stresemannstr./Wilhelmstr. mbH, Berlin (bis 17.12.2013)<br/><br/>(jeweils treuhänderisch für den Parteivorstand der SPD)', 'Abitur 1970. Studium der Geschichte und Sozialwissenschaften in Bonn, 1976 Staatsexamen für das Lehramt an Gymnasien, 1980 Promotion zum Dr. phil. 1976/78 Honorartätigkeit beim Deutschen Studentenwerk, 1978/81 Referentin in der Pressestelle der SPD-Bundestagsfraktion, 1981/90 Sprecherin des nordrhein-westfälischen Finanzministers; seit 1991 Ministerialrätin im Ministerium für Umwelt, Raumordnung und Landwirtschaft des Landes NRW, Referatsleiterin für grenzüberschreitende Planungen. Mitgl. der SPD seit 1972, 1989/Juni 2014 Vors. der SPD Kreis Kleve, 1990/2001 Mitgl. Parteirat, Nov. 2001/13 Mitgl. Bundesparteivorst., 1987/2001 Mitgl. Landesvorst. der SPD NRW, dort 1996/2001 Schatzmeisterin, 2007/ 2013 Schatzmeisterin der Bundes-SPD. 1984/89 Mitgl. Kreistag Kleve. - MdB seit 1994; Okt. 1998/Nov. 2007 Parl. Staatssekretärin beim BMin. der Finanzen, seit Dez. 2013 Bundesministerin für Umwelt, Naturschutz, Bau und Reaktorsicherheit.', 'Barbara', '11002672');
