INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06452, NULL, 'Dr. Dr. h.c.', 'Dr. Dr. h.c.', 'Rechtsanwalt', 'keine Angaben', '12.02.1951', NULL, 'Duisburg-Hamborn', 'männlich', NULL, '07.06.2016', 'Lamers', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Anwaltssozietät Hengerer & Niemeier, Mannheim, <br/>Rechtsanwalt<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Amerikanisch-Europäischer Freundschaftsclub Heidelberg e.V., Heidelberg,<br/>Präsident, ehrenamtlich (bis Dezember 2014)<br/><br/>Deutsche Atlantische Gesellschaft e.V., Berlin,<br/>Vizepräsident, ehrenamtlich<br/><br/>Deutsche Stiftung Friedensforschung (DSF), Osnabrück,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Heidelberger Stiftung Chirurgie, Heidelberg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Mid Atlantic Club Berlin e.V., Berlin,<br/>Präsident, ehrenamtlich (bis April 2015)<br/><br/>Stiftung Reichspräsident-Friedrich-Ebert-Gedenkstätte, Heidelberg,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Abitur 1969. Studium der Rechtswissenschaften an der Westf. Wilhelms-Univ. Münster, 1. jur. Staatsexamen in Münster, Dr. jur., 2. jur. Staatsprüfung in Stuttgart. Wiss. Referent am Max-Planck-Institut für ausländisches öffentl. Recht und Völkerrecht in Heidelberg; MinRat im Landtag von Baden-Württemberg, Leiter des Pers. Büros des Landtagspräsidenten und zuständig für die Pflege der internat. Beziehungen. Mitgl. Internat. Institut für Strategische Studien/London (IISS); Mitgl. im Lions-Club Heidelberg-Palatina. 1975/86 Mitgl. der JU, stellv. Landesvors. der JU Baden-Württemberg; seit 1975 Mitgl. der CDU, Kreisvors. der CDU Heidelberg 1985/2003, seit 2003 Ehrenvors. der CDU Heidelberg. - MdB seit 1994; 2003/07 Vors. Unterausschuss "Weiterentwicklung der Inneren Führung" des Verteidigungsausschusses, seit 2006 stellv. Vors. Verteidigungsausschuss. Mitgl. Parl. Vers. (PV) der NATO seit 1998, Leiter der CDU/CSU-Delegation in der NATO PV seit 2003, stellv. Vors. des Politischen Ausschusses 2003/04, Vors. Unterausschuss "NATO-Partnerschaften" 2004/08, Vors. der Gruppe der Konservativen, Christdemokraten und Assoziierten in der NATO PV seit Mai 2005, Leiter der dt. Delegation seit Mai 2006, Vors. Politischer Ausschuss der NATO PV 2008/10, Präsident der NATO PV 2010/12, Vizepräs. der NATO PV 2006/08 und 2012/14, Präsident der Atlantic Treaty Association (ATA) 2008/14.', 'Karl A.', '11002716');
