INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06459, NULL, NULL, NULL, 'Dipl.-Agraringenieurin', 'verheiratet, 1 Kind', '19.01.1968', NULL, 'Dessau', 'weiblich', NULL, '10.11.1994', 'Lemke', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Bündnis 90/Die Grünen, Berlin,<br/>	Politische Bundesgeschäftsführerin<br/><br/>Funktionen in Unternehmen: <br/>	ProDialog GmbH, Berlin, <br/>	Mitglied des Beirates, ehrenamtlich (bis 30.04.2014)<br/><br/>	RTL Television GmbH, Berlin, <br/>	Mitglied des Programmausschusses, ehrenamtlich (bis 25.11.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesamt für Naturschutz, Bonn, <br/>	Mitglied des Beirates der Internationalen Naturschutzakademie Insel Vilm (INA), ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Denkwerk Demokratie e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Heinrich-Böll-Stiftung e.V., Berlin, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich (bis 31.01.2014)', '1974/84 POS Dessau. 1984/86 Ausbildung zur Zootechnikerin. 1986/88 Tätigkeit als Briefträgerin. 1986/88 Abendschule und Abitur am Philanthropinum, Dessau. 1988/93 Studium der Agrarwissenschaften Humboldt-Univ. Berlin. 1993/94 Fraktionsgeschäftsführerin der Stadtratsfraktion Bürger/Forum/Grüne in Dessau. Seit 1990 Mitgl. BÜNDNIS 90/DIE GRÜNEN, 1993/94 Mitgl. Landesvorst. BÜNDNIS 90/DIE GRÜNEN Sachsen-Anhalt; 2004 Leiterin des Wahlkampfes der Partei zum Europaparlament; 2005 Leiterin des Bundestagswahlkampfs von BÜNDNIS 90/DIE GRÜNEN gemeinsam mit Fritz Kuhn, 2002/13 Politische Bundesgeschäftsführerin von BÜNDNIS 90/DIE GRÜNEN. - MdB 1994/02 und seit Okt. 2013, 1998/02 und seit Okt. 2013 Parl. Geschäftsführerin der Fraktion BÜNDNIS 90/DIE GRÜNEN.', 'Steffi', '11002720');
