INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06486, NULL, 'Dr.', 'Dr.', 'Diplom Mathematiker, Parl. Staatssekretär', 'verheiratet, 2 Kinder', '09.06.1961', NULL, 'Lorsch / Krs. Bergstraße', 'männlich', NULL, '10.11.1994', 'Meister', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Eckardt-Steuerkreis, München, <br/>Vortrag, 2013, Stufe 1 (Sitzung des Arbeitskreises Steuerpolitik)<br/><br/>Funktionen in Unternehmen: <br/>Forschungsinstitut zur Zukunft der Arbeit GmbH (IZA), Bonn, <br/>	Policy Fellow, ehrenamtlich<br/>	<br/>KfW-Deutsche Investitions- und Entwicklungsgesellschaft mbH, Köln, <br/>	Mitglied des Prüfungsausschusses<br/>	<br/>Steinbeis-Hochschule Berlin GmbH, Berlin,<br/>	Institute Risk and Fraud Management<br/>	Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn, <br/>	Vertrauensmann für die Bausparer der Wüstenrot Bausparkasse AG (bis 16.12.2013)<br/>	<br/>Bundesnetzagentur für Elektrizität, Gas,<br/>	Telekommunikation, Post und Eisenbahnen, Bonn, <br/>	Stellv. Mitglied des Beirates (bis 20.02.2014)<br/>	<br/>Kreditanstalt für Wiederaufbau, Frankfurt/Main, <br/>	Mitglied des Verwaltungsrates (bis 31.01.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich (bis 17.12.2013)<br/>	<br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin, <br/>	Vorsitzender, ehrenamtlich<br/>	<br/>Institut Finanzen und Steuern e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Stiftung Berliner Schloss - Humboldtforum, Berlin, <br/>	Mitglied des Stiftungsrates<br/>	<br/>Wirtschaftsrat Deutschland e.V., Berlin, <br/>	Mitglied des Präsidiums, ehrenamtlich', 'Abitur 1980 in Bensheim. 1980/85 Studium der Mathematik und Informatik an der TH Darmstadt, Diplom. 1986/88 Wissenschaftl. Mitarbeiter TH Darmstadt, 1988 Promotion Dr. rer. nat. 1989/90 Grundwehrdienst. April 1990/Jan. 1995 im Operationszentrum der Europ. Raumfahrtbehörde in Darmstadt. 1991 Eintritt in die CDU, 1991/94 Vors. CDU Bensheim, seit 1994 Kreisvors. der CDU Bergstraße, seit Dez. 1999 Bezirksvors. der CDU Südhessen und Mitgl. des Präsidiums der CDU Hessen, 2010 Mitgl. Bundesvorst. der CDU Deutschlands. Ortsbeirat in Bensheim-Zell 1983/94, Ortsvorsteher Bensheim-Zell 1985/94, 1989/97 Stadtverordneter in Bensheim, 1993/94 Fraktionsvors. der CDU in Bensheim. Englisch (f), Französisch (G). - MdB seit 1994; Okt. 2002/Dez. 2004 Vors. AG Finanzen der CDU/CSU-Fraktion, 2004/13 stellv. Vors. der CDU/CSU-Fraktion, seit Dez. 2009 Vors. der CDU-Landesgruppe Hessen; seit Dez. 2013 Parl. Staatssekretär beim Bundesminister der Finanzen..', 'Michael', '11002733');
