INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06500, NULL, 'Dr. h.c.', 'Dr. h.c.', 'Selbständiger Unternehmer, Bürgermeister a. D.', 'verheiratet, 3 Kinder', '03.05.1949', NULL, 'Gemünden am Main', 'männlich', NULL, '05.09.2006', 'Michelbach', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>MIBEG Unternehmensgruppe, Bad Soden-Salmünster, Gemünden a. Main, <br/>	Inhaber und persönlich haftender Gesellschafter, jährlich, Stufe 10, Gewinn<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Industrie- und Handelskammer zu Coburg, Coburg, <br/>Mitglied der Vollversammlung, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Coburger Turnerschaft 1861 e.V., Coburg, <br/>	Präsident, ehrenamtlich<br/><br/>	Festspielverein der Stadt Gemünden e.V., Gemünden, <br/>	Vorsitzender, ehrenamtlich<br/><br/>	Förderkreis der Coburger Studenten e.V., Coburg, <br/>	Vorsitzender, ehrenamtlich<br/><br/>	Handelsverband Deutschland - HDE e.V., Berlin, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Familienunternehmen Schäffer GmbH, Gemünden a. Main<br/><br/>	MIBEG Investment International GmbH, Gemünden a. Main<br/><br/>	MOMA Invest GmbH (bis 31.12.2014), Gemünden a. Main', 'Gymnasium in Lohr am Main. Ausbildung zum Groß- und Einzelhandelskaufmann, Wirtschaftsfachschule für Management und Betriebswirtschaft. Vorstandsassistent in Handelskonzern. 1972 Eintritt in die Familienunternehmen. Neugründung der Unternehmensgruppe MIBEG Investment. Präsidiumsmitglied des Hauptverbandes des Dt. Einzelhandels (HDE). Vors. der BWK Coburg/Kronach, Vollversammlungsmitgl. der IHK Coburg; Präs. Coburger Turnerschaft e. V., Vors. des Festspielvereins, Mitgl. Kuratorium der Hochschule Coburg. 1998 Mitgl. Parteivorst. der CSU. Vors. der Mittelstands-Union, stellv. Bundesvors. der CDU/CSU MIT. 1978 stellv. Bürgermeister und 1982, 1988 und 1994 Wahl zum 1. Bürgermeister.  - MdB seit 1994; 2002 Vorstandsmitgl. der CDU/CSU-Fraktion, stellv. Vors. des Parlamentskreises Mittelstand; seit 2009 Obmann der CDU/CSU-Fraktion im Finanzausschuss, 2013 stellv. Vors. der CSU-Landesgruppe.', 'Hans', '11002738');
