INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06512, NULL, 'Dr.', 'Dr.', 'Bundesminister für wirtschaftliche Zusammenarbeit und Entwicklung, Dipl.-Wirtschaftspädagoge', 'verheiratet, 2 Kinder', '25.08.1955', NULL, 'Krumbach / Schwaben', 'männlich', NULL, '10.11.1994', 'Müller', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Abitur. Wehrdienst. Studium der Wirtschafts- und Sozialwissenschaften, Stipendiat der Konrad-Adenauer-Stiftung, Staatsexamen, Diplomwirtschaftspädagoge, Promotion. Oberregierungsrat a. D. Bayerisches Staatsministerium für Wirtschaft und Verkehr. 2009 Honorarprofessor an der Hochschule für Technik und Wirtschaft in Dresden. 1989 bis 1994 Mitglied des Europäischen Parlaments. - MdB seit 1994; bis 2005 außen- und europapolitischer Sprecher der CSU-Landesgruppe; 2005/Dez 2013 Parl. Staatssekretär bei der Bundesministerin für Ernährung, Landwirtschaft und Verbraucherschutz, seit Dez. 2013 Bundesminister für wirtschaftliche Zusammenarbeit und Entwicklung.', 'Gerd', '11002742');
