INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06516, NULL, NULL, NULL, 'Dipl.-Sozialpädagoge (FH)', 'verheiratet, 2 Kinder', '21.12.1965', NULL, 'Bad Urach / Baden-Württemberg', 'männlich', NULL, '10.11.1994', 'Özdemir', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bündnis 90/Die Grünen, Berlin,<br/>Bundesvorsitzender<br/><br/>Funktionen in Unternehmen: <br/>START-Stiftung gemeinnützige GmbH, Frankfurt/Main, <br/>Mitglied des Kuratoriums<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>ZDF, Mainz, <br/>Mitglied des Fernsehrates (bis 31.12.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>American Jewish Committee e.V. (AJC), Berlin, <br/>Mitglied des Beirates<br/><br/>Avicenna-Studienwerk e.V., Osnabrück, <br/>Mitglied des Kuratoriums<br/><br/>Bundesverband mittelständische Wirtschaft e.V. (BVMW), München, <br/>Mitglied des politischen Beirates, monatlich, Stufe 1<br/><br/>Deutsch-Türkisches Forum Stuttgart e.V., Stuttgart, <br/>Mitglied des Kuratoriums<br/><br/>Ich kann was!-Initiative für Kinder und Jugendliche e.V., Bonn, <br/>Mitglied des Beirates<br/><br/>Stiftung neue Verantwortung e.V., Berlin, <br/>Mitglied des Präsidiums<br/><br/>Theodor-Heuss-Stiftung, Stuttgart, <br/>Mitglied des Kuratoriums<br/><br/>Türkisch-Deutsche Studierenden und Akademiker Plattform e.V., Köln, <br/>Mitglied des Beirates', 'Berufsausbildung zum Erzieher. Studium der Sozialpädagogik an der Evangelischen Fachhochschule für Sozialwesen in Reutlingen, 1994 Abschluss. 2003 Transatlantic Fellow beim amerikanischen Think Tank "German Marshall Fund of the United States" in Washington und Brüssel. Mitgl. Pol. Beirat des Bundesverb. Mittelständische Wirtschaft (BVMW), Gründungsmitgl. des Europ. Council on Foreign Relations (ECFR), Mitgl. Beirat des Berliner Büros des American Jewish Committee (AJC), Mitgl. Kuratorium des Dt.-Türkischen Forums Stuttgart e. V. und im Kuratorium der Theodor-Heuss-Stiftung. Mitgl. der Partei DIE GRÜNEN bzw. BÜNDNIS 90/DIE GRÜNEN seit 1981, 1989/94 im Landesvorstand Baden-Württemberg, seit Nov. 2008 Bundesvorsitzender. Mitgl. Europäisches Parlament für Deutschland Juli 2004/Juli 2009, Januar 2006/Februar 2007 stellv. Vors. des nichtständigen Ausschusses zu CIA-Aktivitäten in Europa. - MdB Nov. 1994/Okt. 2002 und seit Okt. 2013.', 'Cem', '11002746');
