INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06532, NULL, NULL, NULL, 'Politikwissenschaftler, Parl. Staatssekretär', 'verheiratet, 1 Kind', '17.05.1962', NULL, 'Düren', 'männlich', NULL, '10.11.1994', 'Rachel', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>	START-Stiftung gemeinnützige GmbH, Frankfurt/Main,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Evangelische Kirche in Deutschland (EKD), Hannover, <br/>	Stellv. Mitglied der Synode, ehrenamtlich<br/>	Mitglied des Rates, ehrenamtlich<br/><br/>	Evangelische Kirche Rheinland, Düsseldorf, <br/>	Landessynodaler, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsch-Israelische Stiftung für wissenschaftliche Forschung und Entwicklung (G.I.F.), Berlin, <br/>	Vertreter der Bundesministerin für Bildung und Forschung, von Amts wegen<br/><br/>	Deutsch-Russische Initiative Bildung, Forschung und Innovation, Berlin/Moskau, <br/>	Stellv. Vorsitzender, von Amts wegen<br/><br/>	Fraunhofer-Gesellschaft zur Förderung der angewandten Forschung e.V., München, <br/>	Senator, von Amts wegen<br/><br/>	Kinder-Kultur-Magazin "KiKuMa" der Ursula-Lübbe-Stiftung, Bergisch Gladbach, <br/>	Mitglied des Herausgeberbeirates, ehrenamtlich (bis 19.03.2014)<br/><br/>	Kompetenznetzwerk Stammzellenforschung NRW, Düsseldorf, <br/>	Mitglied des Beirates, von Amts wegen (bis 06.01.2015)<br/><br/>	Leo Baeck Stiftung, Potsdam, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Vereinigung der Deutsch-Griechischen Gesellschaften e.V. (VDGG), Mülheim a. d. Ruhr, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Wasser-Info-Zentrum Eifel in Heimbach, Heimbach, <br/>	Fördermitglied, ehrenamtlich<br/><br/>	Wissenschafts-Pressekonferenz (WPK) e.V., Bonn, <br/>	Mitglied des Kuratoriums, von Amts wegen', '1982 Abitur in Düren. 1992 Magister Artium (M. A.) in den Fächern Politische Wissenschaft, Geschichte und Staatsrecht Univ. Bonn; 1985 Stipendiat der Konrad-Adenauer-Stiftung. 1992/04 Angestellter der Wirtschaftsvereinigung Stahl, Düsseldorf. 1997/05 Mitgl. Ausschuss für Öffentliche Verantwortung der Ev. Kirche im Rheinland. 2001/12 Vors. des CDU-Stadtverbandes Düren, 1989/12 stellv. Kreisvors. und seit 2012 Vors. CDU Kreis Düren, seit 2011 Vors. CDU-Bezirk Aachen; 1995/04 Landesvors. des Ev. Arbeitskreises (EAK) der CDU NRW und seit 2003 Bundesvors. des EAK des CDU/CSU Deutschlands. Seit 2000 Landessynodaler der Ev. Kirche im Rheinland, seit 2003 stellv. Mitgl. der Synode der Ev. Kirche in Deutschland (EKD), seit Nov. 2015 Mitgl. im Rat der EKD; seit 2006 Senator der Fraunhofer Gesellschaft. - MdB seit 1994; 1999/02 stellv. Vors. der Enquete-Kommission "Globalisierung der Weltwirtschaft", 1998/05 Obmann f. Bildung u. Forschung der CDU/CSU-Fraktion und 2003/05 Sprecher der CDU/CSU-Fraktion in der Enquete-Kommission "Ethik und Recht der modernen Medizin"; seit Nov. 2005 Parl. Staatssekretär bei der Bundesministerin für Bildung und Forschung.', 'Thomas', '11002754');
