bank AG, Hamburg, Kiel)<br/>Vortrag, 2013, Stufe 2 (politisches Podiumsgespräch, Deutsches Wirtschaftsforum, Frankfurt/Main)<br/>Mitwirkung am Kundenabend, 2016, Stufe 3 (bei der BB-Bank, Berlin)<br/>Mitwirkung an einer Diskussionsveranstaltung, 2016, Stufe 3 (bbg Betriebsberatungs GmbH, Bayreuth)<br/><br/>Funktionen in Unternehmen: <br/>Fachhochschule des Mittelstands (FHM) Bielefeld gemeinnützige GmbH, Nationales Zentrum für Bürokratiekostenabbau, Bielefeld,<br/>Vorsitzender des Kuratoriums, ehrenamtlich<br/><br/>Hertie School of Governance gemeinnützige GmbH, Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Macquarie Group, London,<br/>Mitglied des Advisory Panels, jährlich, Stufe 4 (ab 2016)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Atlantik-Brücke e.V., Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>European Council on Foreign Relations (ECFR), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Internationaler Club La Redoute Bonn e.V., Bonn,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Stiftung Neue Verantwortung e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Villa Vigoni e.V., Deutsch-Italienisches Zentrum, Loveno di Menaggio, Italien,<br/>Nichtständiges Mitglied des Kuratoriums, ehrenamtlich', '1984 Abitur. 1984/89 Studium der Rechtswissenschaften an der Universität Bonn, 1989 1. jur. Staatsprüfung, 1993 2. jur. Staatsprüfung. 2001 Promotion zum Dr. jur. 1993 Zulassung als Rechtsanwalt. 1984/Nov. 2010 Mitgl. des Kreisvorst. der CDU Rhein-Sieg-Kreis, 1992/96 Landesvors. der JU NRW, 2001/09 Vors. des Bundesarbeitskreises Christlich-Demokratischer Juristen (BACDJ), Nov. 2009/Okt. 2011 Vors. CDU-Bezirksverb. Mittelrhein, Nov. 2010/Juni 2012 Vors. CDU NRW, Nov. 2010/Dez. 2012 stellv. Vors. der CDU Deutschlands. - MdB seit 1994; Okt. 2002/Febr. 2005 rechtspolitischer Sprecher der CDU/CSU-Fraktion, Febr. 2005/Okt. 2009 1. Parl. Geschäftsführer der CDU/CSU-Fraktion; Okt. 2009/Mai 2012 Bundesminister für Umwelt, Naturschutz und Reaktorsicherheit; seit Jan. 2014 Vors. Auswärtiger Ausschuss.', 'Norbert', '11002765');
