INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06612, NULL, NULL, NULL, 'Diplom Mathematiker', 'verheiratet, 3 Kinder', '13.01.1956', NULL, 'Lobenstein / Bez. Gera', 'männlich', NULL, '10.11.1994', 'Selle', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Mitteldeutsche Medienförderung GmbH, Leipzig, <br/>Beratung, monatlich, Stufe 1', '1974 Abitur. Bis 1976 Grundwehrdienst NVA. Bis 1981 Studium mit Abschluss Diplom-Mathematiker. Bis 1991 Projektleiter EDV, bis 1994 Geschäftstellenleiter eines Computerunternehmens, seit 1998 Mitarbeiter Mitteldeutsche Medienförderung GmbH Leipzig, 2007/09 zugleich Leiter KinderMedienZentrum Erfurt. Stellv. Vors. Gemeindekirchenrat, Vors. Kirchfördervereins St. Bonifatius. Seit 1990 Mitgl. der CDU, Mitgl. Kreisvorst. CDU Kyffhäuserkreis. Mitgl. Kreistag Kyffhäuserkreis. - MdB 1994/98 und seit Okt. 2009.', 'Johannes', '11002798');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06613, NULL, NULL, NULL, 'Selbstständiger Kaufmann', 'verheiratet, 2 Kinder', '17.10.1949', NULL, 'Gudensberg / Schwalm-Eder-Kreis', 'männlich', NULL, '10.11.1994', 'Siebert', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Mittler Report Verlag GmbH, Bonn, <br/>Mitglied des Beirates der Zeitschrift "Europäische Sicherheit & Technik", ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreissparkasse Schwalm-Eder, Melsungen, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Schwalm-Eder-Kreis, Homberg, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Gesellschaft für Wehrtechnik e.V., Bonn, <br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Förderkreis Deutsches Heer e.V., Bonn, <br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Fa. Willi Siebert GmbH & Co KG, Gudensberg<br/><br/>Fa. Willi Siebert Verwaltungs GmbH, Gudensberg', 'Volksschule in Gudensberg-Dorla. König-Heinrich-Schule Fritzlar, Abitur. Mathematik-, Physik- und Volkswirtschaftsstudium an der Philipps-Univ. Marburg. Inhaber eines mittelständischen Betriebs. Träger der Ehrenplakette des Schwalm-Eder-Kreises. Seit 1969 Mitgl. der JU und CDU, 1970/76 Kreisvors. der JU, 1975/83 Bezirksvors. JU Nordhessen, Landesvorstandsmitgl. der JU Hessen bis 1982; seit 1988 Kreisvors. der CDU Schwalm-Eder, seit 1997 Bezirksvors. der CDU Kurhessen-Waldeck, Mitgl. Präsidium CDU Hessen seit 1998, Vors. Landesfachausschuss "Außen- und Sicherheitspolitik" der CDU Hessen, 2004/10 stellv. Vors. Bundesfachausschuss "Außen-, Europa- und Sicherheitspolitik" der CDU. Mitgl. Kreistag Schwalm-Eder-Kreis seit 1972, stellv. Kreistagsvors.; Stadtverordneter und Fraktionsvors. in Gudensberg bis 2002. MdL Hessen Febr. 1991/Nov. 1994, dort Mitgl. Fraktionsvorst. und Vors. AK Landwirtschaft, Forsten, Naturschutz und Landesentwicklung. Vizepräs. Förderkreis Deutsches Heer e. V., Mitgl. Präsidium DWT e. V., Mitgl. Beirat Zeitschrift "Europäische Sicherheit und Technik", Mitgl. Redaktionsbeirat Newsletter Verteidigung. Englisch (f), Französisch (G). - MdB seit Okt. 1994; 2003/09 Vors. Landesgruppe Hessen der CDU/CSU-Fraktion, 2005/09 verteidigungspol. Sprecher der CDU/CSU-Fraktion und 2003/09 Mitgl. Fraktionsvorst.; Mitgl. Parl. Versammlung des Europarates.', 'Bernd', '11002799');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06616, NULL, NULL, NULL, 'Vizepräsident DBT, Ministerialrat a. D.', 'verheiratet, 6 Kinder', '09.05.1953', NULL, 'München', 'männlich', NULL, '10.11.1994', 'Singhammer', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Kanzlei Dr. Menges, München,<br/>Rechtsanwalt<br/>   Mandant 1, 2015, Stufe 3<br/><br/>DUK Versorgungswerk e.V., Berlin,<br/>Vortrag, 2013, Stufe 3 (Jahresabschlusssitzung 2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Deutsches Museum, München, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bayerisch-Togoische Gesellschaft e.V., München,<br/>Vorsitzender, ehrenamtlich<br/><br/>Deutsch-Mosambikanische Gesellschaft e.V., München,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Deutsche Afrika Stiftung e.V., Berlin,<br/>Vizepräsident, ehrenamtlich<br/><br/>Deutscher Familienverband e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Diözesanrat der Katholiken der Erzdiözese München und Freising, München,<br/>Einzelpersönlichkeit in der Vollversammlung, ehrenamtlich<br/><br/>Lebenshilfe für Menschen mit geistiger Behinderung e.V., München,<br/>Stellv. Vorsitzender des Vorstandes, ehrenamtlich<br/><br/>Max-Planck-Institut für Psychiatrie, München,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1999/03 Bezirksvors. der CSU München. 2004/07 Vors. und 2007/10 Mitgl. des Beirats bei der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen. - MdB seit Okt. 1994; 1994/98 Mitgl. der Kinderkommission, zuletzt Vors., 1998/02 Vors. Arbeitskreis Arbeit und Sozialordnung, Gesundheit, Familie, Senioren, Frauen und Jugend der CSU-Landesgruppe, 2002/05 wirtschafts- und arbeitspolitischer Sprecher der CSU-Landesgruppe, 2005/09 Familien-, Senioren-, Frauen- und Jugendpolitischer Sprecher der CDU/CSU-Fraktion und Nov. 2009/Okt. 2013 stellv. Vors. der CDU/CSU-Fraktion für die Bereiche Gesundheit, Ernährung, Landwirtschaft und Verbraucherschutz; seit Okt. 2013 Vizepräsident des Bundestages.', 'Johannes', '11002800');
