her Sprecher der CSU-Landesgruppe und seit Jan. 2006 Mitgl. Vorstand der CDU/CSU-Fraktion, 2009/13 stellv. Vors. Ausschuss für Arbeit und Soziales, seit Dez. 2013 Parl. Geschäftsführer der CSU-Landesgruppe.', 'Max', '11002812');
