INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06655, NULL, NULL, NULL, 'Industriekaufmann, Gewerkschaftssekretär, Parl. Staatssekretär a. D.', 'verheiratet, 2 Kinder', '16.09.1954', NULL, 'Essen', 'männlich', NULL, '10.11.1994', 'Thönnes', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Deutsch-Norwegische Freundschaftsgesellschaft e.V., Essen,<br/>Bundesvorsitzender, ehrenamtlich<br/><br/>Deutsch-Norwegische Gesellschaft, Oslo,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Deutsch-Norwegisches Jugendforum, Köln,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Internationaler Bund - IB Nord, Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Norwegisch-Deutsche Willy-Brandt-Stiftung, Oslo,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Tafelstiftung Schleswig-Holstein, Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Tausendfüßler Stiftung, Kaltenkirchen,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Verein zur Förderung der Norwegisch-Deutschen Willy-Brandt-Stiftung, Berlin,<br/>Vorsitzender, ehrenamtlich<br/><br/>Zentrum für Osteuropa- und internationale Studien (ZOIS), Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich', 'Mittlere Reife, Ausbildung zum Industriekaufmann. 1973/78 Verkaufssachbearbeiter, 1972/78 Jugendvertreter und Betriebsrat, 1978/79 Studium Sozialakademie Dortmund. 1979/02 Sekretär, 1980/88 Bezirkssekretär, 1988/94 Geschäftsführer der IG Chemie-Papier-Keramik in Hamburg. 1989/94 Mitgl. AR AlliedSignal GmbH, Arbeitnehmervertr., 1989/94 ehrenamtl. Arbeitsrichter. Mitgl. (ehrenamtl.) AWO; Heimvolkshochschule Hustedt e. V.; Bundesvors. Dt.-Norwegische Freundschaftsges.; stellv. Vors. Norwegisch-Dt. Willy-Brandt-Stiftung Oslo und Vors. Verein zur Förderung der Norwegisch-Dt. Willy-Brandt-Stiftung Berlin, Mitgl. Parl. Beirat Bundesverb. Dt. Stiftungen, Mitgl. Beirat Dt.-Norw. Jugendforum, Kuratorium Tafelstiftung Schleswig-Holstein Hamburg, Landeskuratorium Intern. Bund und Beirat Tausendfüßler-Stiftung Kaltenkirchen, Mitgl. Stiftungsrat Stiftung Zentrum für Osteuropa- und intern. Studien (ZOiS). Seit 1978 SPD, 1986/92 Kreisvors. SPD Stormarn, 1986/94 Kreistagsabg. Kreis Stormarn, 1990/94 stellv. Kreisrat. 1992/94 Ortsvereinsvors., 1997/99 stellv. Landesvors., April 1999/April 2003 Landesvors. SPD Schleswig-Holstein. - MdB seit 1994; Nov. 2000/Jan. 2001 sozialpol. Sprecher, Feb. 2001/Okt. 2002 stellv. Vors. der SPD-Fraktion. Okt. 2002/Nov. 2005 Parl. Staatssekretär bei der BMin. für Gesundheit und Soziale Sicherung, Nov. 2005/Nov. 2009 beim BMin. für Arbeit und Soziales. 1998/02 und seit März 2006 Vors. der Dt.-Nordischen Parlamentariergruppe. Seit 1998 Mitgl. und seit 2002 Leiter der Delegation des BT in der Baltic Sea Parliamentary Conference (BSPC), seit 2006 Mitgl. und 2006/07 Vors. des Ständigen Ausschusses der BSPC, seit Nov. 2011 Mitgl. im Steuerungsausschuss des "Baltic Sea Labour Forum"; seit 2009 stellv. Mitgl., seit 2014 Mitgl. Parl. Vers. OSZE, seit 2010 Leiter Gesprächskreis Russland/GUS der SPD-Fraktion, seit 2013 stellv. Vors. Auswärtiger Ausschuss sowie stellv. außenpol. Sprecher der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 3 (Steinburg - Dithmarschen Süd)', 'Franz', '11002818');
