INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06676, NULL, NULL, NULL, 'Rechtsanwältin und Unternehmerin, Parl. Staatssekretärin a. D.', 'verheiratet, 2 Kinder', '05.05.1954', NULL, 'Stein bei Nürnberg', 'weiblich', NULL, '10.11.1994', 'Wöhrl', NULL, 'CSU', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>MiDa-Parkverwaltungs- und Werbegesellschaft mbH, Nürnberg, <br/>	Geschäftsführerin, monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>Bank I.Safra Sarasin Ltd., Basel,<br/>Mitglied des Verwaltungsrates, 2013, Stufe 6; 2014, Stufe 7; 2015, Stufe 7; <br/>2016, Stufe 7<br/><br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn,<br/>Mitglied des Aufsichtsrates<br/><br/>DORMERO Hotel AG, Berlin,<br/>Vorsitzende des Aufsichtsrates (bis 30.06.2015)<br/><br/>Nürnberger Beteiligungs-AG, Nürnberg,<br/>Mitglied des Aufsichtsrates, 2014, Stufe 8; 2016, Stufe 7<br/><br/>Nürnberger Krankenversicherung AG, Nürnberg,<br/>Mitglied des Aufsichtsrates, 2013, Stufe 3; 2014, Stufe 4; 2015, Stufe 4<br/><br/>Nürnberger Lebensversicherung AG, Nürnberg,<br/>Mitglied des Aufsichtsrates, 2013, Stufe 5; 2014, Stufe 6; 2016, Stufe 6<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Akademie der Bildenden Künste in Nürnberg, Nürnberg,<br/>Mitglied des Hochschulrates, ehrenamtlich<br/><br/>Deutschlandradio, Berlin,<br/>Mitglied des Hörfunkrates (bis 31.03.2014)<br/><br/>FFA - Filmförderungsanstalt, Berlin,<br/>Mitglied des Verwaltungsrates<br/><br/>Hochschule für Musik Nürnberg, Nürnberg,<br/>Mitglied des Hochschulrates<br/><br/>Industrie- und Handelskammer Nürnberg für Mittelfranken, Nürnberg,<br/>Mitglied der Vollversammlung, ehrenamtlich<br/><br/>Kulturakademie Tarabya, Istanbul,<br/>Mitglied des Beirates<br/><br/>Stiftung Denkmal für die ermordeten Juden Europas, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Deutschland Hilft e.V. (ADH), Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Bayerische AIDS-Stiftung e.V., München,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Bundesstiftung Magnus Hirschfeld, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis April 2014)<br/><br/>Bundesverband mittelständische Wirtschaft e.V. (BVMW), München,<br/>Mitglied des Beirates, monatlich, Stufe 1<br/><br/>cnetz - Verein für Netzpolitik e.V., Berlin,<br/>Mitglied des Vorstandes<br/><br/>Deutsche Parlamentarische Gesellschaft e.V., Berlin,<br/>Stellv. Präsidentin<br/><br/>Emanuel Wöhrl Stiftung, Nürnberg,<br/>Vorsitzende des Stiftungsrates, ehrenamtlich<br/><br/>Tierschutzverein Nürnberg-Fürth und Umgebung e.V., Nürnberg,<br/>Präsidentin, ehrenamtlich<br/><br/>Wirtschaftsbeirat der Union e.V., München,<br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>MiDa Parkverwaltungs- und Werbegesellschaft mbH, Nürnberg', '1973 Abitur. Jurastudium Friedrich-Alexander-Univ. Erlangen-Nürnberg, 1. und 2. Staatsexamen. Seit 1987 Rechtsanwältin und Unternehmerin. 1995/03 Landesschatzmeisterin der CSU, 1995/13 Präsidiumsmitgl. der CSU, Vors. der CSU-Finanzkommission, Mitgl. im Präsidium des Wirtschaftsbeirates der Union. 1990/94 Stadträtin in Nürnberg, wohnungspol. Sprecherin, Schwerpunkte: Wirtschaft, Recht, Stadtplanung und Stadtentwicklung. Präs. Tierschutzverein Nürnberg-Fürth, Stiftungsrätin Emanuel-Stiftung, Kuratoriumsmitgl. der Bayerischen Aids-Stiftung, Mitgl. Dt. UNESCO-Kommission, Mitgl. der Vollversammlung der IHK Nürnberg. - MdB seit 1994; in der 14. WP wirtschaftspol. Sprecherin und Vors. des Arbeitskreises Wirtschaft und Technologie der CSU-Landesgruppe, 15. WP wirtschaftspol. Sprecherin der CDU/CSU-Fraktion; 16. WP Parl. Staatssekretärin beim Bundesminister für Wirtschaft und Technologie, Koordinatorin der Bundesregierung für die Maritime Wirtschaft; seit Nov. 2009 Vors. Ausschuss für wirtschaftliche Zusammenarbeit und Entwicklung.', 'Dagmar G.', '11002829');
