INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06692, NULL, NULL, NULL, 'Diplom Psychologin', 'verheiratet, 3 Kinder', '01.07.1947', NULL, 'Duisburg', 'weiblich', NULL, '23.12.1996', 'Kühn-Mengel', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Otto Benecke Stiftung, Bonn,<br/>	Referentin für Öffentlichkeitsarbeit<br/><br/>Funktionen in Unternehmen: <br/>	Zentrum für Frühbehandlung und Frühförderung<br/>	gemeinnützige GmbH, Köln, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Aktion Psychisch Kranke e.V. (APK), Bonn, <br/>	Mitglied des Vorstandes<br/><br/>	Arbeiterwohlfahrt Bezirksverband Mittelrhein e.V., Köln, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Arbeiterwohlfahrt Bundesverband e.V., Berlin, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/><br/>	Arbeiterwohlfahrt Regionalverband Rhein-Erft & Euskirchen e.V.,<br/>	Bergheim, <br/>	Vorsitzende, ehrenamtlich<br/><br/>	Brühler Museumsgesellschaft e.V., Brühl, <br/>	Vorsitzende, ehrenamtlich<br/><br/>	Bundesvereinigung Prävention und Gesundheitsförderung e.V.<br/>	(BVPG), Bonn, <br/>	Präsidentin, ehrenamtlich<br/><br/>	Elly Heuss-Knapp Stiftung - Deutsches Müttergenesungswerk,<br/>	Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Forschungsgemeinschaft "Der körperbehinderte Mensch" e.V. (FKM), Köln, <br/>	Vorsitzende, ehrenamtlich<br/><br/>	Hospizverein Brühl e.V., Brühl, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Institut für Sozialarbeit und Sozialpädagogik e.V. (ISS), Frankfurt/Main, <br/>	Mitglied des Vorstandes, ehrenamtlich', '1967 Abitur am Erzbischöflichen Gymnasium in Brühl. Studium der Psychologie Univ. Köln, 1972 Diplom-Psychologin. Ab 1972 als Diplompsychologin tätig bei der Forschungsgemeinschaft "Das körperbehinderte Kind" e.V., Köln, danach am Zentrum für Frühförderung und Frühbehandlung Köln. Seit 1972 Mitgl. der SPD, stellv. Vors. Arbeitsgem. SozialdemokratInnen im Gesundheitswesen. Seit 2002 Präsidentin Bundesvereinigung Prävention und Gesundheitsförderung e.V. (BVPG), Bonn, Mitgl. Präsidium AWO-Bundesver., Vors. Regionalverband AWO Rhein-Erft Kreis & Euskirchen e.V., seit 1992 Vorstandsmitgl. AWO-Bezirksverb. Mittelrhein e.V.; Vors. Forschungsgemeinschaft "Der Körperbehinderte Mensch" e.V. (FKM), Vorstandsmitgl. Zentrum für Frühbehandlung und Frühförderung, Köln, Vorstandsmitgl. Institut für Sozialarbeit und Sozialpädagogik e.V. (I.S.S.); Vorstandsmitgl. Verein Aktion Psychisch Kranke; Mitgl. Kuratorium Elly Heuss-Knapp Stiftung-Dt. Müttergenesungswerk, Berlin, Vorstandsmitgl. Hospizverein Brühl e.V.; stellv. Vors. und Geschäftsführerin Brühler Museumsgesellschaft e.V.; Mitgl. Kinderschutzbund und bei der Lebenshilfe; Kuratoriumsmitgl. Stiftung Männergesundheit; Mitgl. Deutscher Verein für öffentl. und private Fürsorge, Beirat im Projekt "Zugewandert und geblieben" des DOSB. 2004/09 Beauftragte der BReg. für die Belange der Patientinnen und Patienten. Englisch (f), Französisch (f), Italienisch (f), Spanisch (G). - MdB  1996/2009 und seit Okt. 2013; Mitglied im Ältestenrat, Beauftragte der SPD-Fraktion für die Belange von Patienten und Pflegebedürftigen.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 91 (Rhein-Erft-Kreis I)', 'Helga', '11003010');
