INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06706, NULL, NULL, NULL, 'Volkshochschulangestellter', 'verheiratet, 1 Kind', '21.06.1950', NULL, 'Stuttgart', 'männlich', NULL, '26.10.1998', 'Arnold', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Mittler Report Verlag GmbH, Bonn, <br/>Mitglied des Beirates der Zeitschrift "Europäische Sicherheit & Technik", ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Gesellschaft für Wehrtechnik e.V., Bonn, <br/>Mitglied des Präsidiums, ehrenamtlich', 'Realschule. Lehre als Fernmeldemonteur 1967/70, 1971 Fachhochschulreife. 1970/73 Fernmelderevisor. Eignungsprüfung für das Studium ohne Reifezeugnis 1973. Päd. Hochschule Esslingen 1974/78, Kontaktstudium Erwachsenenbildung PH Ludwigsburg 1983. Während der Studienzeit nebenberufl. Musiker. Seit 1980 bei der VHS Stuttgart Leiter der Organisationsabteilung und Fachbereichsleiter EDV. 1972 Eintritt in die SPD, 1974/81 Ortsvereinsvors., 1981/95 Kreisvors. Landkreis Esslingen, 1996/97 Mitgl. SPD-Landesvorst. Baden-Württemberg. 1980/92 Stadtrat in Filderstadt, 1989/94 Kreisrat Kreis Esslingen. Mitgl. der Verbandsvers. Region Stuttgart 1994/98. Vorstandsvors. Werner-Weinmann-Stiftung; Mitgl. Beirat Deutsche Gesellschaft für Wehrtechnik; Mitgl. im Musikverein Wolfschlugen, der Schutzgemeinschaft Filder, im TSV Harthausen, im Verein "Gegen Vergessen - für Demokratie" e. V., der Europa-Union Deutschland, Landesverb. Baden-Württemberg e. V., des Beirats von Strategie & Technik, der Stauffenberg Gesellschaft Baden-Württemberg e. V. und des Fördervereins Wolfschlugen - Diakoniestation Nürtingen. - MdB seit 1998; seit Okt. 2002 Sprecher der AG Sicherheits- und Verteidigungspolitik der SPD-Fraktion, seit 2004 Mitgl. im Fraktionsvorst., seit 2014 Vors. der Deutsch-Rumänischen Parlamentariergruppe.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 261 (Esslingen)', 'Rainer', '11003029');
