INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06720, NULL, NULL, NULL, 'Parlamentarischer Staatssekretär, Ministerialrat a. D.', 'verheiratet, 2 Kinder', '01.02.1952', NULL, 'Schwäbisch Gmünd', 'männlich', NULL, '26.10.1998', 'Barthle', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreditanstalt für Wiederaufbau, Frankfurt/Main, <br/>	Mitglied des Verwaltungsrates, ehrenamtlich (bis 15.04.2015)<br/><br/>	Kreissparkasse Ostalb, Aalen, <br/>	Mitglied des Verwaltungsrates<br/><br/>	Regionalverband Ostwürttemberg, Schwäbisch Gmünd, <br/>	Mitglied der Verbandsversammlung, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Skiverband (DSV), Planegg, <br/>	Mitglied der Führung Sportentwicklung<br/><br/>	Deutscher Verband für das Skilehrwesen e.V. - <br/>	INTERSKI DEUTSCHLAND, Stuttgart, <br/>	Präsident, ehrenamtlich<br/><br/>	Internationaler Verband der Schneesport-Instruktoren e.V., München, <br/>	Präsident, ehrenamtlich<br/><br/>	SG Sonnenhof Grossaspach e.V., Aspach, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich', 'Grundschule, Gymnasium, allgemeinbildendes Abitur 1972. Grundwehrdienst. Studium der Germanistik, Sportwissenschaften und Philosophie in Tübingen, 1. Staatsexamen 1979, Referendardienst, 2. Staatsexamen 1981. 1981/90 Lehramt an allgemeinbildenden Gymnasien (Deutsch, Sport). 1990 Referent für Öffentlichkeitsarbeit im Ministerium für Kultus, Jugend und Sport des Landes Baden-Württemberg, ab 1992 Pressesprecher im Kultusministerium. Seit 1990 Mitgl. der CDU, Ehrenvors. des CDU-Kreisverbandes Ostalb. Präs. im Deutschen Verband für das Skilehrwesen, Präs. im Internationalen Verband d. Schneesportinstruktoren. Englisch (f), Französisch (G), Latein (G). - MdB seit 1998; 2009/15 haushaltspol. Sprecher der CDU/CSU-Fraktion, seit Febr. 2015 Parl. Staatssekretär beim BMin. für Verkehr und digitale Infrastruktur.', 'Norbert', '11003033');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06721, NULL, 'Dr.', 'Dr.', 'Wirtschaftswissenschaftler', 'verheiratet, 2 Kinder', '31.03.1958', NULL, 'Stralsund', 'männlich', NULL, '26.10.1998', 'Bartsch', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Funktionen in Unternehmen: <br/>	Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Eschborn, <br/>	Mitglied des Aufsichtsrates (bis Dezember 2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsche Parlamentarische Gesellschaft e.V., Berlin, <br/>	Mitglied des Vorstandes', 'Abitur. Grundwehrdienst. Studium an der Hochschule für Ökonomie, Berlin-Karlshorst. Aspirantur an der Akademie für Gesellschaftswissenschaften beim ZK der KPdSU in Moskau zum Dr. oec., 1990/91 Geschäftsführer Verlag Junge Welt, 1991/97 Schatzmeister der PDS, 1997/02 Bundesgeschäftsführer der PDS, 2003/04 Unternehmensberater, 2004/05 Geschäftsführer der Neues Deutschland Druckerei und Verlag GmbH, 2005/07 Bundesgeschäftsführer Linkspartei.PDS, 2007/10 Bundesgeschäftsführer DIE LINKE. Mitgl. Rosa-Luxemburg-Stiftung und Stiftung Denkmalschutz. Russisch (G), Englisch (G). - MdB 1998/02 und seit 2005; 2010/2013 und wieder Okt. 2013/Okt. 2015 2. stellv. Vors. der Fraktion DIE LINKE., seit Okt. 2015 Vors. der Fraktion DIE LINKE.', 'Dietmar', '11003034');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06727, NULL, NULL, NULL, 'Dipl.-Ingenieur, Bürgermeister a. D.', 'verheiratet, 2 Kinder', '01.08.1947', NULL, 'Annaberg-Buchholz', 'männlich', NULL, '26.10.1998', 'Baumann', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Unternehmen: <br/>Thermalbad Wiesenbad Gesellschaft für<br/>Kur- und Rehabilitation mbH, Thermalbad Wiesenbad, <br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Volksbank Chemnitz eG, Chemnitz, <br/>Stellv. Vorsitzender des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Erzgebirgskreis, Annaberg-Buchholz, <br/>Mitglied des Kreistages, ehrenamtlich', 'Oberschule in Annaberg-Buchholz, Berufsausbildung mit Abitur in Glauchau. Studium an der TU Dresden, 1971 Abschluss als Diplomingenieur für Textiltechnologie. 1971/90 Werkleiter in einem Posamentenbetrieb. 1990/98 Bürgermeister in Jöhstadt. Seit 1972 Mitgl. der CDU. 1990/2014 Mitgl. Kreistag Erzgebirgskreis. 2001/11 Landesvors. Sachsen und Thüringen des THW. - MdB seit 1998; Vors. der Arbeitsgruppe Petitionen der CDU/CSU-Fraktion.', 'Günter', '11003035');
