INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06732, NULL, NULL, NULL, 'Unternehmensberater', 'verheiratet, 2 Kinder', '13.02.1942', NULL, 'Rendsburg', 'männlich', NULL, '26.10.1998', 'Bernhardt', NULL, 'CDU', NULL, 'evangelisch', NULL, NULL, NULL, 'Otto', '11003037');
