INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06738, NULL, NULL, NULL, 'Starkstromelektriker, Mathematiker', 'verheiratet, 2 Kinder', '01.04.1950', NULL, 'Sandershausen', 'männlich', NULL, '26.10.1998', 'Binding', '(Heidelberg)', 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Bildungsstätte Stangenrod,<br/>Angelika und Lothar Binding GbR, Grünberg', 'Volksschule. 1965/68 Lehre als Starkstromelektriker. 1969 Fachschulreife, 1972 allgemeine Hochschulreife am Hessenkolleg Kassel. Zivildienst. Studium Mathematik, Physik und Philosophie in Tübingen und Heidelberg, 1981 Diplomhauptprüfung. Zur Finanzierung des Studiums 4 Jahre Elektroinstallateur im Handwerk. Aufbau und Betrieb einer selbstverwalteten Jugendbildungsstätte. 1979/82 wiss. Hilfskraft; 1982/86 techn. Angestellter, 1987/98 wiss. Angestellter Rechenzentrum Univ. Heidelberg. Seit 1987 nebenberufl. selbst. Tätigkeiten. Seit 1965 Mitgl. IG Metall. Mitgl. SPD seit 1966, 1986/94 und 1998/01 Vors. der SPD Heidelberg. 1989/2000 Gemeinderat in Heidelberg, dort 1994/2000 Vors. der SPD-Fraktion. 1989/03 Mitgl. im Regionalverband Unterer Neckar. 1989/95 Aufsichtsrat der Stadtwerke Heidelberg (SWH), 1995/2000 Verwaltungsrat der Sparkasse und Aufsichtsrat der Heidelberger Versorgungs- und Verkehrsbetriebe (HVV). 2009/12 Mitgl. Verwaltungsrat GIZ, Gesellschaft für Internationale Zusammenarbeit (bis 2010 GTZ). Vors. Mieterverein Heidelberg; Mitgl. AWO, ver.di, WERKstattSCHULE e. V. - Arbeiten im 3. System, attac, Lobby Control und in zahlr. Vereinen und Einrichtungen. Englisch (G). - MdB seit 1998; seit Juni 2012 finanzpol. Sprecher.', 'Lothar', '11003050');
