INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06745, NULL, NULL, NULL, 'Großhandelskaufmann, Sozialpädagoge, Gewerkschaftssekretär', 'verheiratet, 2 Kinder', '10.10.1951', NULL, 'Quetzen / Kreis Minden-Lübecke', 'männlich', NULL, '26.10.1998', 'Brase', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>BCO Brase & Collegen AG, Hamburg,<br/>Stellv. Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bezirksregierung Arnsberg, Arnsberg,<br/>Beratendes Mitglied, ehrenamtlich (bis Juli 2014)<br/><br/>Evangelischer Kirchenkreis Siegen, Siegen,<br/>Mitglied der Kreissynode, ehrenamtlich (bis Oktober 2015)<br/><br/>Kreis Siegen-Wittgenstein, Siegen,<br/>Stellv Mitglied des Sozialausschusses des Kreistages, ehrenamtlich (bis Juli 2014)<br/><br/>Studentenwerk Siegen, Siegen,<br/>Ersatzmitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Universität Siegen, Siegen,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Ehrbare Versicherungskaufleute e.V., Hamburg,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Freundes- und Förderkreis der Telefonseelsorge Siegen e.V., Siegen,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Fachoberschule. 1971/72 Wehr- und Ersatzdienst. 1973/76 Studium Sozialpädagogik FH, 1977/78 berufspraktisches Jahr. 1978/80 Jugendamt Abteilung Jugendpflege, 1981/84 Landesjugendbildungsreferent, 1984/88 Landesjugendsekretär beim DGB Landesbez. NRW, seit 1989 DGB-Kreisvors. Siegen-Wittgenstein. Seit 1976 Mitgl. ver.di. Mitgl. SPD seit 1981, SPD-Unterbezirksvors. Siegen-Wittgenstein. Ab 1994 DGB-Regionsvors. für Siegen-Wittgenstein-Olpe, bis Sept. 2012 DGB-Regionsvors. für Südwestfalen. Bis Sept. 2012 u. a. Vorstandsmitgl. Landesarbeitsgemeinschaft Arbeit und Leben NRW, alternierender Vors. Verwaltungsausschuss Agentur für Arbeit Siegen und im Berufsbildungsausschuss der IHK Siegen und der IHK Arnsberg, Hellweg-Sauerland. Ehrenamtl. Mitgl. der Kreissynode des Ev. Kirchenkreises Siegen, ehrenamtl. Mitgl. Kuratorium der Universität Siegen, ehrenamtl. Ersatzmitgl. Verwaltungsrat Studentenwerk Siegen. - MdB seit 1998.', 'Willi', '11003054');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06746, NULL, 'Dr.', 'Dr.', 'Wissenschaftlicher Assistent, Parl. Staatssekretär', 'verheiratet, 4 Kinder', '14.03.1967', NULL, 'Hattingen / Ennepe-Ruhr-Kreis', 'männlich', NULL, '26.10.1998', 'Brauksiepe', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>	Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH<br/>	(ZIF), Berlin, <br/>	Mitglied des Aufsichtsrates, von Amts wegen<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Landkreis Ennepe-Ruhr, Schwelm, <br/>	Sachkundiger Bürger, ehrenamtlich<br/><br/>	Ruhr-Universität Bochum,<br/>	Institut für Entwicklungsforschung und Entwicklungspolitik,<br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung zur Aufarbeitung der SED-Diktatur, Berlin, <br/>	Mitglied des Stiftungsrates, von Amts wegen<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsche Atlantische Gesellschaft e.V., Berlin, <br/>	Beisitzer des Vorstandes, ehrenamtlich<br/><br/>	Deutsche Orient-Stiftung, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Deutsche Stiftung Friedensforschung (DSF), Osnabrück, <br/>	Mitglied des Stiftungsrates<br/><br/>	Förderverein der Deutschen Arbeitsschutzausstellung e.V., Dortmund, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis 06.04.2014)<br/><br/>	Otto Benecke Stiftung e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich', '1986 Abitur in Hattingen. 1986/90 Studium der Wirtschaftswissenschaft in Bochum, 1990 Dipl.-Ökonom. 1990/95 Wiss. Mitarbeiter am Institut für Entwicklungsforschung und Entwicklungspolitik Ruhr-Univ. Bochum, 1995 Dr. rer. oec. 1996/98 Wiss. Assistent Fakultät für Wirtschaftswissenschaft Ruhr-Univ. Bochum. 1983 Eintritt in JU und CDU, 1989 KPV, 1992 CDA. 1988/94 Stadtverbandsvors. JU Hattingen, 1992/96 Kreisvors. JU Ennepe-Ruhr, 1996/2000 Landesvors. JU NRW. 1994/98 Ortsvors. CDU Hattingen-Mitte, seit 1995 Kreisvors. CDU Ennepe-Ruhr, seit 2014 Beisitzer im Bundesvorst. der CDU. Seit 2002 Landesvors. CDA NRW, seit 2003 stellv. CDA-Bundesvors., seit 2005 Beisitzer Präs. EUCDA, seit 2011 Bundesvors. CDA/dbb-AG, seit 2016 Vors. Bundesfachausschuss Arbeit und Soziales der CDU. Beisitzer im Vorst. der Deutschen Atlantischen Gesellschaft; Mitgl. Kuratorium Dt. Orient-Stiftung, Mitgl. Stiftungsrat der Stiftung zur Aufarbeitung der SED-Diktatur. Mitgl. KAB. - MdB seit 1998; 2005/09 Vors. der AG Arbeit und Soziales der CDU/CSU-Fraktion; Okt. 2009/Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Arbeit und Soziales, seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin der Verteidigung.', 'Ralf', '11003055');
