INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06753, NULL, NULL, NULL, 'Dipl.-Forstingenieur', 'verheiratet, 3 Kinder', '22.01.1951', NULL, 'Rinteln', 'männlich', NULL, '09.07.2007', 'Caesar', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>	DBU Naturerbe GmbH, Osnabrück, <br/>	Vorsitzender des Beirates<br/><br/>	wald-wird-mobil.de gemeinnützige GmbH, Göttingen, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Kreis Lippe, Detmold, <br/>	Sachkundiger Bürger, ehrenamtlich (bis 24.05.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bund Heimat und Umwelt in Deutschland e.V. (BHU), Bonn, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Deutsche Bundesstiftung Umwelt (DBU), Osnabrück, <br/>	Mitglied des Kuratoriums, jährlich, Stufe 3<br/><br/>	PEFC Deutschland e.V., Stuttgart, <br/>	Mitglied des Deutschen Forstzertifizierungsrates (DFZR), ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Caesar GbR, Kalletal<br/><br/>	Cajus Caesar GbR, Kalletal', 'Mittlere Reife. 1969/71 Forstlehre, Landesforstschule Arnsberg, Fachhochschulreife. 1971/74 Revierförsteranwärter. Dipl.-Forsting., Forstamtsrat. 1974/78 Revierleiter Forstrevier Lage, 1978/80 Forsteinrichtung Landesverb. Lippe, 1980/98 Revierleiter Forstrevier Kirchberg, 2005/07 und 2010/11 Projektleiter Forstmanagement beim Landesverb. Lippe. Seit 1969 Mitgl. CDU, 1980/84 Ortsvors. JU Kalletal, 1985/90 CDU-Gemeindeverbandsvors. Kalletal, 1990/Okt. 2013 Kreisvors. der CDU Lippe, seit 1992 Bezirksvorstandsmitgl. der CDU Ostwestfalen-Lippe. 1980/99 Mitgl. Gemeinderatsfraktion Kalletal, 1984/99 Mitgl. Lippischer Kreistag, u. a. Vors. Umweltausschuss und stellv. Fraktionsvors. der CDU. 1986/99 Mitgl. Landschaftsvers. Landschaftsverb. Westfalen-Lippe, dort u. a. umweltpol. Sprecher und stellv. Fraktionsvors. der CDU, Auszeichnung mit der Freiherr vom Stein Medaille in Silber, 1999/06 Abg. der Verbandsvers. Landesverb. Lippe, dort Fraktionsvors. der CDU. U. a. 2003/13 Mitgl. Bundespräs. Bund Heimat und Umwelt (BHU), seit Juni 2013 Mitgl. Kuratorium BHU, Mitgl. Bund Dt. Forstleute (BDF), dort 1975/82 stellv. Bundesjugendleiter und Landesjugendleiter NRW, Dt. Jagdschutzverband (DJV), Schutzgem. Dt. Wald (SDW), seit Mai 2014 Mitgl. Kuratorium Dt. Bundesumweltstiftung (DBU), seit Sept. 2014 Vors. Beirat der DBU Naturerbe GmbH, ehrenamtl. Mitgl. Dt. Forstzertifizierungsrat bei PEFC Dt. e. V., ehrenamtl. Mitgl. Aufsichtsrat wald-wird-mobil.de gGmbH, Mitgl. WWF, Energie Impuls OWL e. V. und in zahlr. regionalen Vereinen, Sport, Feuerwehr, Schützen, Heimat, Kultur, Ziegler, Wirtschaft und Kultur. Englisch (G). - MdB 1998/2005 und 2007/09 und seit Feb. 2011.', 'Cajus', '11003064');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06754, NULL, NULL, NULL, 'Dipl.-Ingenieurökonom', 'geschieden, 2 Kinder', '18.12.1954', NULL, 'Hettstedt', 'männlich', NULL, '26.10.1998', 'Claus', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Schulbildung in Hettstedt, Abitur. Spezialklassen und Studium an der Technischen Hochschule Merseburg, 1976 Abschluss Diplom-Ingenieurökonom. 1976/89 div. Funktionen in der FDJ, u. a. 1. Sekretär der Bezirksleitung Halle; seit 1978 Mitgl. der SED, 1990 Bezirksvors. PDS Halle, 1990/97 Landesvors. PDS Sachsen-Anhalt, 2003/05 Koordinator der PDS-Fraktionsvors.-Konferenz. März/Okt. 1990 Mitgl. der Volkskammer, 1990/98 Mitgl. Landtag Sachsen-Anhalt. Englisch (G), Russisch (G), Bulgarisch (G). - MdB 1998/02 und seit 2005; 1998/2000 Parl. Geschäftsführer, 2000/02 Vors. der PDS-Fraktion; seit 2005 Ostkoordinator der Fraktion DIE LINKE.', 'Roland', '11003065');
