INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06763, NULL, NULL, NULL, 'Dipl.-Verwaltungswissenschaftlerin', 'verheiratet, 2 Kinder', '21.04.1971', 'Türkei', 'Tokat', 'weiblich', NULL, '26.10.1998', 'Deligöz', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'Islam', NULL, 'Funktionen in Unternehmen: <br/>Ulmer Volksbank eG, Ulm, <br/>	Mitglied der Vertreterversammlung, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Sparkassenverband Bayern, München, <br/>	Mitglied des Beirates für sparkassenpolitische Grundsatzfragen<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Gegen Vergessen - Für Demokratie e.V., Bonn, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	UNICEF Deutschland, Köln, <br/>	Mitglied des Vorstandes, ehrenamtlich', 'Deutsche Staatsbürgerschaft seit 1997. Grundschule in Istanbul, ab 1979 in Senden, 1982/92 Gymnasium Weißenhorn. Studium an den Univ. Konstanz und Wien. Seit 1988 Mitgl. BÜNDNIS 90/DIE GRÜNEN, Ehrenmitgl. des grünen Jugendverbandes in Bayern. Vorstandsmitgl. UNICEF Deutschland, Vorstandsmitgl. und stellv. Vors. Gegen Vergessen - Für Demokratie e. V., der Vertretervers. der Ulmer Volksbank e. G. Englisch (f), Türkisch (f), Französisch (G). - MdB seit 1998; 2002/05 Parl. Geschäftsführerin und Nov. 2009/Okt. 2013 Koordinatorin Arbeitskreis V - Wissensgesellschaft und Generation der Fraktion BÜNDNIS 90/DIE GRÜNEN; 	stellv. Vors. Rechnungsprüfungsausschuss, Mitgl. Haushaltsausschuss.', 'Ekin', '11003068');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06768, NULL, NULL, NULL, 'Redakteur', 'verheiratet, 2 Kinder', '27.08.1965', NULL, 'Tiengen', 'männlich', NULL, '26.10.1998', 'Dörflinger', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Kolpingwerk Deutschland, Köln, <br/>Bundesvorsitzender, ehrenamtlich', 'Abitur 1984. 1984/85 Wehrdienst. 1986 journalistisches Praktikum. Studium Geschichte und Politikwissenschaft Univ. Konstanz 1986/92, Abschluss M. A. 1992/93 Volontariat RTL Radio, 1993/94 Redakteur und Redaktionsleitung RTL Radio Südbaden, Kündigung durch Betriebsschließung, arbeitslos. 1995/96 wiss. Mitarbeiter für BMin. Claudia Nolte. 1997/98 Redakteur einer Regionalzeitung. 1978/84 Mitgl. JU, versch. Funktionen auf Orts- und Kreisebene, seit 1984 Mitgl. der CDU, seit 1995 Mitgl. Kreisvorst; Mitgl. der CDA. Mitgl. und seit 2004 Bundesvors. Kolpingwerk Deutschland. - MdB seit 1998; Vors. Dt.-Schweizerische Parlamentariergruppe.', 'Thomas', '11003069');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06770, NULL, NULL, NULL, 'Einzelhandelskauffrau', 'verheiratet, 1 Kind', '20.04.1953', NULL, 'Nordhorn / Krs. Grafschaft Bentheim, NDS', 'weiblich', NULL, '26.10.1998', 'Dött', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bund Katholischer Unternehmer e.V., Köln,<br/>Vorsitzende, ehrenamtlich<br/><br/>Bundesvereinigung der Deutschen Arbeitgeberverbände e.V. (BDA), Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Don Bosco Mondo e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Förderverein Hochschule Rhein-Waal e.V., Kleve,<br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Guardini-Stiftung e.V., Berlin,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Interparlamentarische Arbeitsgemeinschaft e.V., Bonn,<br/>Mitglied des Vorstandes, ehrenamtlich (bis 01.04.2014)', 'Abitur. Ausbildung als Einzelhandelskauffrau, Gemmologin und Diamantgutachterin, Unternehmerin. 1984 Eintritt in die CDU, 1994/98 Stadtrat in Höxter, 1997/99 Mitgl. im Landesvorst. der CDU NRW, seit 2009 stellv. Kreisvors. CDU Oberhausen. 1995/03 Kreisverbandsvors. der Mittelstandsvereinigung der CDU (MIT), seit 1995 im Bundesvorst. der Mittelstands- und Wirtschaftsvereinigung der CDU (MIT/WIV). Seit 2001 Vors. Bund Katholischer Unternehmer (BKU), Mitgl. Präsidium Guardini Stiftung, Mitgl. Unternehmerfrauen im Handwerk (UFH), Mitgl. Initiative Neue Soziale Marktwirtschaft (INSM), Mitgl. im Wirtschaftsrat der CDU e. V., stellv. Vors. Gesellschaft zum Studium strukturpolitischer Fragen e.V., Mitgl. der Kommission für Zeitgeschichte, Mitgl. Kolping, Kinderschutzbund, Weißer Ring, Kuratorium Don Bosco Mondo. - MdB seit 1998; seit 1998 stellv. Vors. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, seit Nov. 2005 Vors. der AG Umwelt, Naturschutz und Reaktorsicherheit, ab 2014 zusätzl. Baupolitik, seit Jan. 2014 Umwelt- und Baupolitische Sprecherin der CDU/CSU-Fraktion.', 'Marie-Luise', '11003070');
