INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06816, NULL, NULL, NULL, 'Verwaltungsangestellter', 'verheiratet, 1 Kind', '08.09.1943', NULL, 'Reichau / Bayern', 'männlich', NULL, '26.10.1998', 'Gehrcke', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung Wissenschaft und Politik, Berlin, <br/>Mitglied des Stiftungsrates', '1950/59 Volksschule. 1959/61 Verwaltungslehre. 1961/68 Verwaltungsangest. bei der Bundesanst. für Arbeit, seit 1968 versch. berufl. Tätigkeiten im Verlagswesen und in politischen Funktionen. 1961 Ausschluss aus den FaLKEN, Eintritt in die illegale KPD. Mitinitiator der Ostermarschbewegung und Bewegung gegen die Notstandsgesetze. 1968 Mitbegründer und stellv. Vors., später Vors. der Sozialitischen Dt. Arbeiterjugend (SDAJ). Gründungsmitgl. Der DKP, ab 1973 Mitgl. DKP-Parteivorst. und zeitw. Präsidium, 1981/89 Bezirksvors. der DKP Hamburg, Sprecher der Erneuerungsströmung, 1990 Austritt aus der DKP, Eintritt in die PDS, 1991/93 Bundesgeschäftsführer der PDS, 1993/98 stellv. Bundesvors., Mitgl. Parteivorst. und Sprecher für Außenpolitik und intern. Zusammenarbeit; 2005 Gründungsmitgl. der Partei der Europ. Linken, 2007/16 Mitgl. Parteivorst. DIE LINKE., Mitverantwortung für deren Außenpolitik. 2004/05 MdL Brandenburg. - MdB 1998/02 und seit Okt. 2005; 1998/02 stellv. Vors. PDS-Fraktion, 1998/2002 und 2005/13 Obmann im Auswärtigen Ausschuss, außenpolitischer Sprecher der PDS-Fraktion, dann der Fraktion DIE LINKE., seit April 2011 Mitgl. Fraktionsvorst. u. seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE.; seit 2005 Vors. der Dt.-Mittelamerikanischen Parlamentariergruppe.', 'Wolfgang', '11003130');
