INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06844, NULL, NULL, NULL, 'Politikwissenschaftler', 'verheiratet, 2 Kinder', '03.11.1972', NULL, 'Hildesheim', 'männlich', NULL, '26.10.1998', 'Heil', '(Peine)', 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	FernUniversität in Hagen, Hagen, <br/>	Mitglied des Parlamentarischen Beirates<br/><br/>	Kreditanstalt für Wiederaufbau, Frankfurt/Main, <br/>	Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Stiftung Neue Verantwortung e.V., Berlin, <br/>	Mitglied des Präsidiums<br/><br/>	Wissenschaftsgemeinschaft Gottfried Wilhelm Leibniz e.V., Berlin, <br/>	Mitglied des Senats', 'Abitur am Gymnasium am Silberkamp Peine. Zivildienst beim Paritätischen Wohlfahrtsverband Peine. Studium der Politikwissenschaft und Soziologie an der Univ. Potsdam, Abschluss an der FernUniv. Hagen. Mitarbeiter im Landtag Brandenburg, 1998 Mitarbeiter einer Bundestagsabgeordneten. Herausgeber der Zeitschrift "Berliner Republik". Mitgl. AWO, IG Metall, Mitgl. VfB Peine, TSV Bildung Peine, KfW Bank, Stiftung Neue Verantwortung, Friedrich-Ebert-Stiftung, Leibniz-Gemeinschaft, Deutsch-Chinesisches Dialogforum. 1988 Eintritt in die SPD, Mitgl. der SGK; Nov. 2005/Nov. 2009 und seit Juni 2017 Generalsekretär der SPD, seit Dez. 2009 Vors. des SPD-Bezirks Braunschweig, seit Dez. 2011 Mitgl. SPD-Parteivorstand. - MdB seit 1998; seit Okt. 2009 stellv. Vors. der SPD-Fraktion.', 'Hubertus', '11003142');
