hwarz-Rot-Gold, Bund aktiver Demokraten e.V., Hamburg,<br/>Vorsitzender, ehrenamtlich<br/><br/>Stiftung Schifffahrtsstandort Deutschland, Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Abitur. Jurist. Stabsstellenleiter bei der SAGA. Seit 1982 Mitgl. der SPD, seit 2002 SPD-Kreisvors. 1993/98 Mitgl. der Bezirksversammlung Hamburg-Mitte. Mitgl. AWO und ver.di, Mitgl. Deutsche Hilfsgemeinschaft, Mitgl. Bürgerverein zu St. Georg von 1880. Schatzmeister der Dt. Atlantischen Gesellschaft, Mitgl. der Deutsch-Israelischen Gesellschaft, Vors. der Kurt-Schumacher-Gesellschaft, Vors. THW-Landeshelfervereinigung Hamburg, Präsidiumsmitgl. des Deutschen Nationalkomitees für Denkmalschutz; Bundesvors. Reichsbanner Schwarz-Rot-Gold; Aufsichtsratsmitgl. Fröbel e. V., Mitgl. Sozialverband Deutschland e. V., Wingolfbund, LSVD, Guttempler in Deutschland; Mitgl. FC St. Pauli. Englisch (f). - MdB seit 1998; seit 2004 Sprecher des Seeheimer Kreises in der SPD-Fraktion; Vors. der AG Haushalt der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 21 (Hamburg-Nord)', 'Johannes', '11003157');
