INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06887, NULL, NULL, NULL, 'Rechtsanwältin und Fachanwältin für Arbeitsrecht, Parl. Staatssekretärin', 'ledig', '10.10.1967', NULL, 'Essen', 'weiblich', NULL, '26.10.1998', 'Kramme', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Kramme, Günther & Kollegen, Bayreuth, <br/>	Rechtsanwältin (bis Ende 2013), 2012, Stufe 3, Gewinn (Nachtrag zur 17. Wahlperiode)<br/>	Mandant 093, 2012<br/>	Mandant 221, 2012<br/>	Mandant 372, 2012<br/>	Mandant 375, 2012<br/>	Mandant 437, 2012<br/>	Mandant 439, 2012<br/>	Mandant 445, 2012<br/>	Mandant 452, 2012<br/>	Mandant 453, 2012<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Krankenhauszweckverband Bayreuth, Bayreuth, <br/>	Mitglied der Verbandsversammlung<br/>	<br/>Landkreis Bayreuth, Bayreuth, <br/>	Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesinitiative Daheim statt Heim e.V., Berlin, <br/>Ehrenpräsidentin<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Kramme, Günther & Kollegen, Bayreuth', 'Abitur in Essen. Studium der Rechtswissenschaften Univ. Bayreuth, zwei Staatsexamina. Partnerin der Kanzlei Kramme, Günther und Kollegen. Mitgl. der SPD seit 1988, seit 2007 Vors. des Bezirksverbands Oberfranken, seit 2007 Mitgl. im Landesvorst. und seit 2009 Mitgl. im Präsidium der BayernSPD, 2011/13 Mitglied im Parteivorstand. Mitgliedschaften bei AWO, VdK, ver.di, IG Metall. - MdB seit 1998; bis 2013 sozialpolitische Sprecherin der SPD-Fraktion; seit Dez. 2013 Parl. Staatssekretärin bei der Bundesministerin für Arbeit und Soziales.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 240 (Kulmbach)', 'Anette', '11003162');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06889, NULL, 'Dr.', 'Dr.', 'Journalistin, Politikwissenschaftlerin', 'verheiratet', '10.07.1964', NULL, 'Hannover', 'weiblich', NULL, '26.10.1998', 'Krogmann', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, NULL, NULL, 'Martina', '11003163');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06893, NULL, NULL, NULL, 'Beigeordnete a. D., Dezernentin', 'verheiratet, 2 Kinder', '13.08.1951', NULL, 'Jüterbog', 'weiblich', NULL, '26.10.1998', 'Krüger-Leißner', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'POS und EOS in Jüterbog, 1970 Abitur und Eisenbahnfacharbeiterabschluss. 1970/74 Hochschulstudium in Leipzig, Diplomlehrerin für Kunsterziehung und Geschichte. 1974/87 Fachlehrertätigkeit in Jüterbog und Schönwalde. 1988/89 Studium für Jugendhilfe mit Abschluss. 1990/94 Beigeordnete und Dezernentin für Soziales, Familie, Jugend, Sport im Landkreis Nauen, 1992/98 stellv. Landrätin, 1994/98 Beigeordnete und Dezernentin für Soziales, Jugend, Kultur, Sport und Gesundheit im Landkreis Havelland. Seit 1990 Mitgl. SPD, 1992/93 Mitgl. Kreisvorst. Nauen, 1993/05 Mitgl. Unterbezirksvorst. Havelland, 1998/Juni 2002 Mitgl. Landesvorst. der SPD Brandenburg. 1990/94 Mitgl. Kreistag Nauen, 1994/08 Mitgl. Kreistag Havelland. Stellv. Vors. "Jugendaufbauwerke Nauen e. V.", Vorstandsmitgl. Dt.-Chinesische Gesellschaft - Freunde Taiwans; Mitgl. Verwaltungsrat und Vergabekommission der Filmförderungsanstalt Berlin, Vors. dt.-franz. Filmabkommenskommission, Mitgl. Vorauswahlkommission für den Dt. Filmpreis, Mitgl. Verein "Das Deutsch-Französische Filmtreffen", Gründungsmitgl. "Förderverein Deutsch-Russische Filmakademie e. V.".  - MdB 1998/2013 und seit Feb. 2017; Nov. 2009/2013 stellv. Vors. Ausschuss für Kultur und Medien; filmpol. und stellv. arbeitsmarktpol. Sprecherin der SPD-Fraktion,  stellv. Vors. Parlamentariergruppe "Freundeskreis Taipei" und der Parlamentariergruppe AWEPA.<br/><br/>eingetreten am 25.02.17 > Abg.  Dr. Frank-Walter Steinmeier', 'Angelika', '11003164');
