INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06901, NULL, NULL, NULL, 'Rechtsanwältin', 'ledig, 1 Kind', '19.06.1965', NULL, 'Mannheim', 'weiblich', NULL, '26.10.1998', 'Lambrecht', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwältin, selbständig, Viernheim', '1984 Abitur in Viernheim. 1984 Studium der Rechtswissenschaften in Mannheim und Mainz, 1. und 2. jur. Staatsexamen. 1992 Aufbaustudium an der Verwaltungshochschule in Speyer, Abschluss Magister der Verwaltungswissenschaften. 1992 Lehrauftrag an der Berufsakademie Mannheim für Zivil- und Wirtschaftsrecht. Vorträge in der Erwachsenenbildung. Seit 1995 selbstständige Rechtsanwältin in Viernheim. Seit 1982 Mitgl. der SPD, stellv. Vors. SPD Hessen-Süd und Vorstandsmitgl. SPD-Landesverb. Hessen, seit 2007 SPD-Unterbezirksvors. Kreis Bergstraße, Mitgl. SPD-Parteikonvent. 1985/10 Stadtverordnete Stadt Viernheim, 1989/97 Kreistagsabg. Kreis Bergstraße. Mitgl. AWO, VdK, Verein Bürger und Polizei e. V., Gründungsmitgl. Frauenhaus Verein Bergstraße e. V., 2010 Vizepräsidentin THW-Helfervereinigung. - MdB seit 1998; April 2011/Dez. 2013 stellv. Vors. und seit Dez. 2013 1. Parl. Geschäftsführerin der SPD-Fraktion; Mitgl. Vermittlungsausschuss und gemeinsamer Ausschuss.', 'Christine', '11003167');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06902, NULL, NULL, NULL, 'Oberregierungsrat a. D., Parl. Staatssekretär', 'keine Angaben', '27.02.1964', NULL, 'Saarlouis', 'männlich', NULL, '26.10.1998', 'Lange', '(Backnang)', 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Stiftung Bundespräsident-Theodor-Heuss-Haus, Stuttgart, <br/>	Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Atlantik-Brücke e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Deutsche Stiftung für internationale rechtliche Zusammenarbeit e.V. (IRZ), Bonn, <br/>	Stellv. Vorsitzender des Kuratoriums, ehrenamtlich<br/><br/>	Deutsch-Israelische Gesellschaft e.V., Berlin, <br/>	Vizepräsident, ehrenamtlich<br/><br/>	Deutsch-Portugiesische Gesellschaft e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Festival Europäische Kirchenmusik, Schwäbisch Gmünd, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Forum Region Stuttgart e.V., Stuttgart, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis 07.10.2015)<br/><br/>	Kunststiftung Baden-Württemberg, Stuttgart, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	GbR Mörikestr. 17, Backnang', '1983 Abitur. Studium der Rechtswissenschaften, 1989 1. jur. Staatsexamen Univ. Tübingen. 1989/91 Zivildienst. 1991/93 Referendariat in Stuttgart und Brüssel, 1993 2. jur. Staatsexamen in Stuttgart. Seit 1993 bis zur Wahl in den BT im Wirtschaftsministerium Baden-Württemberg, zunächst Landesbeauftragter beim Bund und Bundesratsreferent, dann Referent für Handwerk und Mittelstand. Oberregierungsrat a. D. Gründer und Mithrsg. des pol. Magazins "Berliner Republik". 1993/95 stellv. Bundesvors. der Jusos. Vizepräsident Dt.-Israelische Gesellschaft (DIG); Vorstandsmitgl. Atlantik-Brücke e. V., stellv. Vors. Kuratorium Deutsche Stiftung für Internat. rechtliche Zusammenarbeit (IRZ). - MdB seit 1998; bis 2013 Parl. Geschäftsführer der SPD-Fraktion; Vors. der Dt.-Portugiesischen Parlamentariergruppe; seit Dez. 2013 Parl. Staatssekretär beim BMin der Justiz und für Verbraucherschutz.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 264 (Waiblingen)<br/>Wahlkreis 265 (Ludwigsburg)', 'Christian', '11003168');
