INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06933, NULL, NULL, NULL, 'Bundesministerin für Arbeit, Literaturwissenschaftlerin M. A.', '1 Kind', '20.06.1970', NULL, 'Mendig', 'weiblich', NULL, '26.10.1998', 'Nahles', NULL, 'SPD', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Sozialdemokratische Partei Deutschlands, Berlin, <br/>	Generalsekretärin (bis 16.12.2013), monatlich, Stufe 3<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Förderverein Willy Brandt Center, Berlin, <br/>Vorsitzende', 'Literaturwissenschaftlerin M. A. 1988 Eintritt in die SPD, 1989 Gründung Ortsverein Weiler, 2000/09 Vors. SPD-Kreisverband Mayen-Koblenz, 1993/95 Landesvors. der Jusos Rheinland-Pfalz, 1995/99 Juso-Bundesvors., seit 1997 Mitgl. SPD-Parteivorstand. Seit 1999 im Kreistag. Mitbegründerin und 2000/08 Vors. Forum Demokratische Linke 21. Seit Dez. 2003 Mitgl. SPD-Präsidium, seit 2004 Leiterin der Projektgruppe Bürgerversicherung beim SPD-Parteivorstand, Okt. 2007/Nov. 2009 stellv. Vors. der SPD, 2009/13 Generalsekretärin der SPD. Mitgl. IG Metall und Eurosolar. - MdB 1998/02 und seit Okt. 2005; Nov. 2007/Nov. 2009 arbeitsmarktpolitische Sprecherin der SPD-Fraktion; seit Dez. 2013 Bundesministerin für Arbeit und Soziales.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 203 (Bitburg)', 'Andrea', '11003196');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06934, NULL, NULL, NULL, 'Agraringenieurin', 'verheiratet, 2 Kinder', '07.12.1958', NULL, 'Bad Frankenhausen / Kyffheuserkreis, Thüringen', 'weiblich', NULL, '28.09.2009', 'Steinke', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1965/75 Besuch der POS. 1975/78 Berufsausbildung zum Agrotechniker/Mechanisator mit Abitur. Fernstudium mit Abschluss Agraringenieurin der Tierproduktion. 1981/83 Futterökonom in der LPG (T) Bad Frankenhausen, 1983/89 Sekretär des Kreisvorstandes des Verbandes der Kleingärtner, Siedler und Kleintierzüchter (VKSK) Artern, 1991/93 arbeitslos, 1993/94 Anzeigenberaterin beim "Echo-Verlag" Wiehe, 1994/95 und 2002/03 arbeitslos, 2003/04 politische Mitarbeiterin im Landesverband der PDS. Mitgl. Jugendweihe Sömmerda und Umland e. V., seit 2005 Mitgl. VVN/BdA Thüringen. Seit 2008 Mitgl. Kreisvorstand der Volkssolidarität. 1981/89 Mitgl. der SED, danach der PDS/Die Linkspartei.PDS, 1995/98 stellv. Landesvors. der PDS Thüringen, seit 1998 Mitgl. und 1998/06 Sprecherin des Bundesparteirates der PDS, 2006/10 Mitgl. Parteivorst. und Juni 2008/Mai 2010 Mitgl. geschäftsführender Vorst. DIE LINKE. 1990/10 und seit 2014 Mitgl. Kreistag Kyffhäuserkreis, 2004/05 Mitgl. des Thüringer Landtags. - MdB 1998/02 und seit 2005; seit Nov. 2005 Vors. Petitionsausschuss.', 'Kersten', '11003197');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06935, NULL, NULL, NULL, 'Bundesminister, Dipl.-Verwaltungswirt (FH), Arbeitsvermittler', 'verheiratet, 3 Kinder', '29.03.1963', NULL, 'Hamburg', 'männlich', NULL, '26.10.1998', 'Niebel', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Dirk', '11003198');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06937, NULL, NULL, NULL, 'Angestellter', 'verheiratet, 2 Kinder', '25.05.1964', NULL, 'Düren', 'männlich', NULL, '26.10.1998', 'Nietan', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Sozialdemokratische Partei Deutschlands, Berlin, <br/>Schatzmeister, monatlich, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>Innovationsregion Rheinisches Revier GmbH (IRR), Jülich, <br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Solar-Institut Jülich der Fachhochschule Aachen, Jülich, <br/>	Mitglied des Kuratoriums<br/>	<br/>Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin, <br/>	Mitglied des Kuratoriums<br/>	<br/>Stiftung Flucht, Vertreibung, Versöhnung, Berlin, <br/>	Mitglied des Stiftungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung für die internationale Jugendbegegnungsstätte Auschwitz, Oswiecim (Polen), <br/>Vorsitzender des Stiftungsrates<br/><br/>Stiftung Lebenshilfe, Düren, <br/>Mitglied des Vorstandes<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Deutsche Druck- und Verlagsgesellschaft mbH, Berlin<br/>	<br/>Konzentration GmbH, Berlin<br/>	<br/>Verwaltungsgesellschaft Bürohaus Berlin Stresemannstr./Wilhelmstr. mbH, Berlin<br/>	<br/>	(jeweils treuhänderisch für den Parteivorstand der SPD)', '1970/74 Martin-Luther-Grundschule Düren, 1974/83 Burgau-Gymnasium Düren, Abitur. 1983/85 Zivildienst St. Augustinus Krankenhaus Düren-Lendersdorf. Studium Biologie und Sozialwissenschaften Univ. Köln (ohne Abschluss). Pflegediensthelfer, Tutor an der math.-nat. Fakultät Univ. Köln, Mitarbeiter Büromaschinen Vertrieb und Service GmbH, Wahlkreismitarbeiter, MdB, Europapolitischer Koordinator, Mitarbeiter Martin Schulz, MdEP. Vors. DPG-Bundesverband; Mitglied u. a. GEW, Vors. Stiftungsrat Stiftung für die internationale Jugendbegegnungsstätte Oswiecim, Oswiecim (Polen), Mitgl. Kuratorium Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin, Mitgl. Vorst. Stiftung Lebenshilfe Düren, Mitgl. Stiftung Flucht, Vertreibung, Versöhnung. 1990/98 Vors. SPD Ortsverein Düren-Mitte, seit 1998 Vors. SPD Unterbezirks Düren, 2005/14 Vors. SPD Mittelrhein, seit Jan. 2014 Schatzmeister der SPD. 1984/94 sachkundiger Bürger der Stadt Düren, 1994/10 Mitgl. Kreistag Düren. Englisch (f). - MdB 1998/05 und seit Okt. 2009.', 'Dietmar', '11003199');
