INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06953, NULL, NULL, NULL, 'Vizepräsidentin DBT, Lehrerin', 'verheiratet', '09.08.1963', NULL, 'Berlin', 'weiblich', NULL, '26.10.1998', 'Pau', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin, <br/>	Stellv. Mitglied des Kuratoriums<br/><br/>	Stiftung Denkmal für die ermordeten Juden Europas, Berlin, <br/>	Mitglied des Kuratoriums<br/><br/>	Stiftung zur Aufarbeitung der SED-Diktatur, Berlin, <br/>	Stellv. Mitglied des Stiftungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Sühnezeichen Friedensdienste e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Deutsche Parlamentarische Gesellschaft e.V., Berlin, <br/>	Vizepräsidentin<br/><br/>	Gesellschaft für Christlich-Jüdische Zusammenarbeit in Berlin e.V.,<br/>	Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Heinz Galinski-Stiftung, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Neue Verantwortung e.V., Berlin, <br/>	Mitglied des Präsidiums, ehrenamtlich', 'POS, 1979 Abschluss. Ausbildung am Zentralinstitut der Pionierorganisation Droyßig, 1983 Abschluss als Freundschaftspionierleiterin und Lehrerin für Deutsch und Kunsterziehung. 1983/85 Pionierleiterin, Lehrerin. Studium an der Parteihochschule "Karl Marx", 1988 Dipl.-Gesellschaftswissenschaftlerin. 1988/90 Mitarbeiterin für Aus- und Weiterbildung in der Pionierorganisation/Zentralrat der FDJ; Jan. 1991/Nov. 1995 hauptamtl. Tätigkeit bei der PDS. 1983/89 Mitgl. der SED; seit 1990 Mitgl. der PDS, Jan./Okt. 1991 PDS-Bezirksvors. Hellersdorf, Okt. 1991/Okt. 1992 stellv. Landesvors., Okt. 1992/Dez. 2001 Landesvors. Berlin der PDS, Okt. 2000/Okt. 2002 stellv. Parteivors. der PDS. 1990/95 BVV Hellersdorf. MdA Nov. 1995/98. Seit Nov. 2010 Mitgl. Präsidium Stiftung "Neue Verantwortung" e. V., Mitgl. Heimatverein Hellersdorf, Mahlsdorf, Kaulsdorf, Kuratorium "Stiftung Denkmal für die ermordeten Juden Europas", Verein der Förderer des Tierparks Friedrichsfelde e. V. und Dt. Vereinigung für Parlamentsfragen, seit Mai 2009 Mitgl. Kuratorium Gesellschaft für Christlich-Jüdische Zusammenarbeit in Berlin e. V., seit Nov. 2009 Mitgl. Kuratorium der Heinz-Galinski-Stiftung, seit 2009 Vizepräsidentin Dt. Parlamentarische Gesellschaft. - MdB seit 1998; Okt. 2000/Okt. 2002 stellv. Vors. der PDS-Fraktion; Okt. 2005 bis Feb. 2008 stellv. Vors. Fraktion Die Linke; Vizepräsidentin des Deutschen Bundestages, Mitgl. des Ältestenrates.', 'Petra', '11003206');
