INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06960, NULL, NULL, NULL, 'Dipl.-Chemikerin, Parl. Staatssekretärin a.D.', 'verheiratet, 3 Kinder', '16.07.1973', NULL, 'Luckenwalde', 'weiblich', NULL, '26.10.1998', 'Reiche', '(Potsdam)', 'CDU', NULL, 'evangelisch', NULL, NULL, NULL, 'Katherina', '11003209');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06966, NULL, NULL, NULL, 'Dipl.-Biologe', 'verheiratet, 4 Kinder', '09.07.1964', NULL, 'Hagen / Westfalen', 'männlich', NULL, '26.10.1998', 'Röspel', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Internationales Bildungs- und Begegnungswerk<br/>gemeinnützige GmbH (IBB), Dortmund, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>FernUniversität in Hagen, Hagen, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeiterwohlfahrt Bezirk Westliches Westfalen e.V., Dortmund, <br/>	Mitglied des Bezirksvorstandes, ehrenamtlich<br/>	<br/>Arbeiterwohlfahrt Bundesverband e.V., Berlin, <br/>	Mitglied des Ethikrates, ehrenamtlich<br/>	<br/>Arbeiterwohlfahrt im Ennepe-Ruhr-Kreis, Gevelsberg, <br/>	Vorsitzender des Kreisverbandes und des Unterbezirkes, ehrenamtlich<br/>	<br/>Georg Kraus Stiftung, Hagen, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>German European Security Association e.V. (GESA), Berlin, <br/>	Mitglied des Politischen Beirates, ehrenamtlich<br/>	<br/>Hermann von Helmholtz-Gemeinschaft<br/>	Deutscher Forschungszentren e.V., Bonn, <br/>	Mitglied des Senats, ehrenamtlich<br/>	<br/>Max-Planck-Institut für molekulare Physiologie, Dortmund, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>NaturwissenschaftlerInnen - Initiative, Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/>	<br/>Stiftung "Ein Haus für Kinder" Deutscher Kinderschutzbund<br/>	Ortsverband Hagen e.V., Hagen, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Stiftung Zukunft EN, Gevelsberg, <br/>	Mitglied des Kuratoriums, ehrenamtlich', '1980 Realschule Oberhagen, 1983 Abitur Gymnasium Hohenlimburg. 1983/84 Wehrdienst, Sanitätssoldat. 1984/85 Vertretung des erkrankten Vaters als Schulhausmeister. 1985/88 Ausbildung zum Versicherungskaufmann. 1988 KDV-Anerkennung, Restzivildienst. 1988/93 Studium Biologie Ruhr-Univ. Bochum u. Diplomarbeit Max-Planck-Institut f. Molekulare Physiologie Dortmund, 1993/94 Ökologie-Studium (nebenberufl.) Univ.-GHS Essen. 1994/98 wissenschaftl. Mitarbeiter am Uniklinikum Essen. 1983 Eintritt in die SPD, stellv. Kassierer SPD Oberhagen. 1993/94 Mitgl. der Bezirksvertretung Eilpe/Dahl, 1994/98 Ratsmitgl. in Hagen. Vors. AWO Ennepe-Ruhr. Mitgl. ver.di, Falken, Naturschutzbund, Hagener Friedenszeichen, Eurosolar, Solarenergieförderverein, 3.-Welt-Laden, TSV Fichte Hagen, Verein Gegen Vergessen - Für Demokratie, Erzählcafé, Hospiz Emmaus Gevelsberg, Kuratorium "Ein Haus für Kinder" Hagen und Stiftung Zukunft EN, Gevelsberg und Mitgl. im Senat der Helmholtz-Gemeinschaft. Englisch (f), Französisch (G). - MdB seit 1998; in der 15. WP Vors. der Enquete-Kommission "Ethik und Recht der modernen Medizin",  2008/09 Vors. Parl. Ethik-Beirat.', 'René', '11003210');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06968, NULL, 'Dr.', 'Dr.', 'Dipl.-Psychologe', 'verheiratet, 1 Kind', '04.02.1951', NULL, 'Elmshorn', 'männlich', NULL, '26.10.1998', 'Rossmann', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Hamburger Fern-Hochschule gemeinnützige GmbH, Hamburg, <br/>Mitglied des Kuratoriums, ehrenamtlich (bis Ende November 2013)<br/><br/>TELC GmbH, Frankfurt/Main, <br/>Vorsitzender der Gesellschafterversammlung, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Volkshochschul-Verband e.V., Bonn, <br/>Vorsitzender, ehrenamtlich<br/><br/>Deutsches Institut für Erwachsenenbildung e.V. (DIE), Bonn, <br/>Mitglied des Verwaltungsrates, ehrenamtlich (bis Ende Oktober 2013)<br/><br/>Forum Demokratische Linke 21 e.V., Berlin, <br/>Kooptiertes Mitglied des Vorstandes, ehrenamtlich', '1969 Abitur. 1974 Diplom in Psychologie; 1985 Promotion zum Doktor der Sportwissenschaften. 1975/88 wissenschaftlicher Angestellter an einer Fachschule für Sozialpädagogik, dazu 1976/83 Durchführung zweier sportwissenschaftlicher Projekte (Bundesinstitut für Sportwissenschaften) und div. Lehraufträge für Sportwissenschaft an der Univ. Hamburg. Mitgl. der GEW, der AWO, des Naturschutzbundes Deutschland (NABU), langjährige ehrenamtl. Arbeit in einer Obdachlosensiedlung; seit 2007 Vors. Deutscher Volkshochschulverband (DVV). 1971 Eintritt in die SPD, Jungsozialist, SPD-Ortsvors. Stadtverordneter, Stadtrat und Kulturdezernent. MdL Schleswig-Holstein 1987/98, 1996/98 stellv. Fraktionsvors., 1992/96 Zweiter Landtagsvizepräsident. - MdB seit 1998; 1998/09 stellv. Sprecher der AG Bildung und Forschung der SPD-Fraktion, seit 2002 Sprecher der SPD-Landesgruppe Schleswig-Holstein, seit 2002 Mitglied im SPD-Fraktionsvorst., seit März 2009 bildungs- und forschungspol. Sprecher der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 3 (Steinburg - Dithmarschen Süd)', 'Ernst Dieter', '11003211');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06969, NULL, NULL, NULL, 'Vizepräsidentin DBT, Dramaturgin', 'ledig', '15.05.1955', NULL, 'Ulm', 'weiblich', NULL, '26.10.1998', 'Roth', '(Augsburg)', 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Westdeutscher Rundfunk (WDR), Köln,<br/>Mitwirkung in der TV-Sendung "Zimmer frei!", 2014, Stufe 1<br/><br/>Westend Verlag GmbH, Frankfurt/Main,<br/>Publizistische Tätigkeit, 2016, Stufe 2<br/><br/>Funktionen in Unternehmen: <br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Hochschule für angewandte Wissenschaften, Augsburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Kulturakademie Tarabya, Istanbul,<br/>Mitglied des Beirates<br/><br/>Universität Augsburg, Augsburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>DFB-Kulturstiftung, Frankfurt/Main,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Goethe-Institut e.V., München,<br/>Außerordentliches Mitglied<br/><br/>Humanistische Union e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Internationale Journalisten-Programme e.V. (IJP), Königstein/Taunus,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung für die Internationalen Wochen gegen Rassismus, Darmstadt,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Wilhelm-Leuschner-Stiftung, Bayreuth,<br/>Mitglied des Stiftungsrates, ehrenamtlich (bis Juni 2015)', '1974 Abitur. Dramaturgin an den Städtischen Bühnen Dortmund und Mitgl. "Hoffmans Comic Teater", Managerin der Rock-Band "Ton Steine Scherben". 1985/89 Pressesprecherin der GRÜNEN im Bundestag. Mitgl. Humanistische Union, Pro Asyl und Lesben- und Schwulenverband in Deutschland (LSVD), Mitgl. Stiftungsrat "Stiftung für die Internationalen Wochen gegen Rassismus", Kuratorium der DFB-Kulturstiftung, Kuratorium Universität Augsburg. 1971/90 Mitgl. der Jungdemokraten. Seit 1987 Mitgl. von BÜNDNIS 90/DIE GRÜNEN (ehemals: DIE GRÜNEN), 2001/Dez. 2002 und Okt. 2004/Okt. 2013 Bundesvors. von BÜNDNIS 90/DIE GRÜNEN. MdEP 1989/98, ab 1994 Fraktionsvors. der Grünen im EP. Englisch (f), Französisch (f), Italienisch (G). - MdB 1998/März 2001 und seit Okt. 2002; 1998/März 2001 Vors. Ausschuss für Menschenrechte und Humanitäre Hilfe. März 2003/Okt. 2004 Beauftragte der Bundesregierung für Menschenrechtspolitik und Humanitäre Hilfe im Auswärtigen Amt. Seit 22. Okt. 2013 Vizepräsidentin des Bundestages, ord. Mitgl. Interparlamentarische Union IPU in der 18. WP. Sprecherin der Fraktion Bündnis 90/Die Grünen für auswärtige Kulturpolitik', 'Claudia', '11003212');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06975, NULL, NULL, NULL, 'Dipl.-Politologe, Staatsminister für Europa, Auswärtiges Amt', 'keine Angaben', '24.08.1970', NULL, 'Heringen', 'männlich', NULL, '26.10.1998', 'Roth', '(Heringen)', 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin, <br/>Vorsitzender des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Deutsche Welle, Bonn, <br/>	Mitglied des Rundfunkrates<br/>	<br/>Evangelische Kirche in Deutschland (EKD), Hannover, <br/>	Mitglied der Kammer für Öffentliche Verantwortung<br/>	<br/>Evangelische Kirche von Kurhessen-Waldeck, Kassel, <br/>	Mitglied der Landessynode<br/>	<br/>Stiftung Denkmal für die ermordeten Juden Europas, Berlin, <br/>	Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Französisches Institut Ludwigsburg, Ludwigsburg, <br/>Mitglied des Vorstandes, von Amts wegen<br/><br/>Institut für Europäische Politik (IEP), Berlin, <br/>	Mitglied des Kuratoriums', '1991/97 Studium Politologie, Öffentliches Recht, Germanistik und Soziologie in Frankfurt/Main. Seit 1987 Mitgl. der SPD, 1996/15 Vorstandsmitgl. SPD-Bezirk Hessen-Nord, 2009/14 Generalsekretär SPD Hessen. Seit 2004 Mitgl. der Landessynode der Ev. Kirche Kurhessen-Waldeck und der Kammer für Öff. Verantwortung der EKD. Kuratoriumsmitgl. Stiftung Denkmal für die ermordeten Juden Europas, Mitgl. des Rundfunkrates Deutsche Welle. Aufsichtsratsvors. Zentrum für Internationale Friedenseinsätze ZIF, Kuratoriumsmitgl. Institut für europäische Politik IEP, Mitgl. des Vorst. des Dt.-Französischen Instituts, Mitgl. Stiftungsrat der Stiftung Flucht, Vertreibung, Versöhnung, Mitgl. Stiftungsrat der Deutschen Stiftung Friedensforschung (DSF). - MdB seit 1998; 2010/13 europapol. Sprecher der SPD-Fraktion, 2009/14 Vors. der Landesgruppe Hessen der SPD-Fraktion. Seit Dez. 2013 Staatsminister für Europa im Auswärtigen Amt, seit Jan. 2014 Beauftragter der Bundesregierung für die dt.-französische Zusammenarbeit.', 'Michael', '11003213');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06976, NULL, NULL, NULL, 'Dozentin', 'keine Angaben', '15.07.1968', NULL, 'Speyer', 'weiblich', NULL, '26.10.1998', 'Roth', '(Speyer)', 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Birgit', '11003214');
