INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06983, NULL, NULL, NULL, 'Angestellte', 'ledig', '09.07.1951', NULL, 'Saalstadt', 'weiblich', NULL, '17.10.2002', 'Schäfer', '(Saalstadt)', 'CDU', NULL, 'katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Verwaltungsangestellte. Bis 1985 Büroleiterin bei MdB Dr. Werner Marx und bis 1998 bei MdB Dr. Klaus-Dieter Uelhoff. Vors. der deutsch-chinesischen Gesellschaft e. V. - Freunde Taiwans, Vors. des Kuratoriums der Deutschen Stiftung für politische Bildung und Völkerverständigung e. V., Mitgl. Verwaltungsrat des Vereins für deutsche Kulturbeziehungen im Ausland e. V., seit 1995 Mitgl. der Europa-Union Deutschland. Gründerin und Vors. "Förderverein Druckmuseum Zweibrücken", Mitgl. Parl. Ring des Volksbundes Dt. Kriegsgräberfürsorge. Seit 1979 Mitgl. der CDU, 1992/2013 stellv. Vors. des CDU-Kreisverbandes Südwestpfalz, 1998/2007 Mitgl. des CDU-Bezirksvorst. Rheinhessen-Pfalz, 1998/2014 Vors. der Frauen-Union Südwestpfalz, seit 1998 Mitgl.der CDU/CSU- Mittelstands- und Wirtschaftsvereinigung. - MdB seit 1998; Mitgl. der Parl. Versammlung der NATO, Vors. der Parlamentariergruppe Östliches Afrika.', 'Anita', '11003216');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06986, NULL, NULL, NULL, 'Diplomsozialarbeiterin, Behindertenbeauftragte der SPD-Bundestagsfraktion', 'geschieden, 2 Kinder', '25.03.1954', NULL, 'Klostermansfeld / Landkreis Mansfelder Land', 'weiblich', NULL, '26.10.1998', 'Schmidt', '(Eisleben)', 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Silvia', '11003217');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (06989, NULL, NULL, NULL, 'Bankkaufmann', 'verheiratet, 1 Kind', '23.01.1976', NULL, 'Erfurt', 'männlich', NULL, '26.10.1998', 'Schneider', '(Erfurt)', 'SPD', NULL, 'konfessionslos', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Monega Kapitalanlagengesellschaft mbH, Köln,<br/>Vortrag, 2013, Stufe 3 (Nachtrag zur 17. Wahlperiode)<br/><br/>The London Speaker Bureau, Karlsruhe,<br/>Podiumsdiskussion, 2014, Stufe 2 ("Euro, Wachstum und Gerechtigkeit",<br/>Investmentkonferenz Sal. Oppenheim jr. & Cie. AG & Co. KGaA, Köln)<br/><br/>Funktionen in Unternehmen: <br/>CNC - Communications & Network Consulting AG, München, <br/>	Mitglied des Expertenrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn,<br/>Stellv. Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Kreditanstalt für Wiederaufbau (KfW), Frankfurt/Main,<br/>Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Gemeinsinn e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis 01.11.2013)<br/><br/>Bauhaus.Weimar.Moderne - Die Kunstfreunde e.V., Weimar,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Deutsch-Brasilianische Gesellschaft e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis 15.10.2014)<br/><br/>Erfurt rennt e.V., Erfurt,<br/>Vorsitzender, ehrenamtlich<br/><br/>Forum Ostdeutschland der Sozialdemokratie e.V., Berlin,<br/>Schatzmeister, ehrenamtlich<br/><br/>Fraunhofer-Gesellschaft zur Förderung der angewandten Forschung e.V., München,<br/>Mitglied des Senats, ehrenamtlich<br/><br/>Verband der Sparda-Banken e.V., Frankfurt/Main,<br/>Mitglied des Beirates<br/><br/>Weimarer Republik e.V., Weimar,<br/>Vorsitzender, ehrenamtlich', '1982/84 Dorfschule in Klettbach, 1984/91 POS in Erfurt, 1991/94 Johann-Wilhelm-Häßler-Gymnasium in Erfurt, Abitur. 1994/97 Ausbildung zum Bankkaufmann bei der Volksbank Erfurt eG. 1997/98 Zivildienst in der Jugendherberge Erfurt. 1998 Bankkaufmann bei der Sparkasse Erfurt. 1994 Mitgl. der Jusos, seit 1995 Mitgl. der SPD, seit 2014 stellv. Vors. der SPD Thüringen. 2004/05 Mitgl. im Erfurter Stadtrat. Mitgl. ver.di, ADFC und AWO, VDSF. - MdB seit 1998; 2005/13 haushaltspol. Sprecher der SPD-Fraktion, seit 2013 stellv. Vors. der SPD-Fraktion.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 194 (Gera -Jena - Saale-Holzland-Kreis)<br/>Wahlkreis 195 (Greiz - Altenburger Land)', 'Carsten', '11003218');
