INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07000, NULL, NULL, NULL, 'Dipl.-Betriebswirt  (FH), Marketing- und Kommunikationsberater', 'verheiratet, 4 Kinder', '15.04.1954', NULL, 'Ebersberg', 'männlich', NULL, '26.10.1998', 'Schurer', NULL, 'SPD', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>INFORM Schurer, Ebersberg, <br/>Unternehmensberater<br/>IABG Industrieanlagen-Betriebsgesellschaft mbH, München, monatlich, Stufe 1', 'Volksschule. 1969/72 Ausbildung zum Groß- und Außenhandelskaufmann. 1972/74 Disponent bei der BMW AG, 1975/76 Berufsaufbauschule, 1977/78 Berufsoberschule-Abitur. 1980/81 Zivildienst. 1982/87 Studium der Betriebswissenschaften. 1988/98 Kunden- und Großkundenberater bei Dun & Bradstreet Deutschland GmbH, seit 2002 selbstständiger Kommunikationsberater. Seit 1972 Mitgl. der SPD, 1978/85 Mitgl. Vorst. Jusos Südbayern, 1978/90 SPD-Ortsvors. in Ebersberg, 1990/04 und 2009/11 SPD-Unterbezirksvors., seit 2003 SPD-Bezirksvors. in Oberbayern, seit Juli 2009 stellv. Landesvors. BayernSPD. Seit 1984 Mitgl. Kreistag Ebersberg. Mitgl. im DGB, ver.di, AWO, Bund Naturschutz und in regionalen Vereinen. - MdB 1998/02 und seit 2005; haushaltspol. Sprecher der SPD-Landesgruppe Bayern.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 213 (Altötting)<br/>Wahlkreis 215 (Freising)<br/>Wahlkreis 217 (Ingolstadt)', 'Ewald', '11003234');
