INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07027, NULL, NULL, NULL, 'Dipl.-Sozialwirt, Journalist, Bundesminister a. D.', 'ledig, 1 Kind', '25.07.1954', NULL, 'Bremen', 'männlich', NULL, '26.10.1998', 'Trittin', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>		BBuK - Betriebliche Bildung und Kommunikation GmbH, Frankfurt/Main,<br/>Podiumsdiskussion, 2015, Stufe 1 (Betriebsrätekonferenz GdL: Tarifeinheit - Pro und Contra)<br/><br/>HSH-Nordbank AG, Kiel,<br/>Vortrag, 2015, Stufe 2 (Die neue Welt(un)ordnung, Deutschlands Verantwortung in der globalisierten Welt)<br/><br/>Kampagnenforum GmbH, Zürich, Schweiz,<br/>Vortrag, 2016, Stufe 2 (Nuclear Phaseout Congress, Schweizerische Energie-Stiftung, Zürich)<br/><br/>Kerkhoff Consulting GmbH, Düsseldorf,<br/>Kamingespräch, 2016, Stufe 3 (Welt im Wandel: Wandel der Deutschen Außenpolitik)<br/><br/>Management Circle AG, Eschborn,<br/>Vortrag, 2016, Stufe 2 (Innovationsforum Energie 2015, Wie sehen die Energieversorgungsunternehmen der Zukunft aus?)<br/><br/>Mesago Messe Frankfurt GmbH, Stuttgart,<br/>Vortrag, 2015, Stufe 3 (Facility Management Fachkongress 2015: Die Herausforderung der Energiewende auf den Immobilienbestand)<br/><br/>Staatsschauspiel Dresden, Dresden,<br/>Vortrag, 2014, Stufe 1 (Dresdner Rede ?Wider die Renaissance des Nationalen - mehr Europa - mehr Gerechtigkeit - mehr Ökologie?)<br/><br/>stöbe mehnert. GmbH, Die Agentur für Kommunikation, Berlin,<br/>Vortrag, 2014, Stufe 1 (Dinner-Speech ?Klimaschutz & Gebäude-Innovation?, OVG Real Estate GmbH, Berlin)<br/><br/>The London Speaker Bureau, Karlsruhe,<br/>Vortrag 1, 2015, Stufe 1 (Digitales Deutschland: Deutschland und die USA - Friendship Reloaded?, Microsoft Deutschland GmbH, Berlin)<br/>Vortrag 2, 2015, Stufe 2 (SAP-Forum für Personalmanagement: New Work-Life Balance - Arbeitnehmer neuen Typs?, SAP Deutschland SE & Co. KG, Walldorf)<br/><br/>TRIFOLION Echternach, Echternach,<br/>Vortrag, 2016, Stufe 1 (Lesung beim Centre Culturel Turistque et de Congres, Echternach)<br/><br/>Union-Stahl-Handel, Wuppertal,<br/>Vortrag, 2016, Stufe 2 (12. Union Stahlforum 2016, Ökologie und Ökonomie - zwei Seiten einer Medaille)<br/><br/>Verein für Kommunikation und Kultur in Kierspe und Meinerzhagen (KUK), Meinerzhagen,<br/>Vortrag, 2014, Stufe 1 (Lesung)<br/><br/>Buchhandlung Decius GmbH, Hildesheim,<br/>Vortrag, 2014, Stufe 1 (Lesung)<br/><br/>Buchhandlung Gillmeister, Peine,<br/>Vortrag, 2014, Stufe 1 (Lesung)<br/><br/>Buchhandlung Hugendubel GmbH & Co. KG, Frankfurt/Main,<br/>Vortrag, 2015, Stufe 1 (Lesung)<br/><br/>Buchhandlung Rupprecht GmbH, Vohenstrauß,<br/>Vortrag 1, 2014, Stufe 1 (Lesung)<br/>Vortrag 2, 2014, Stufe 1 (Lesung)<br/><br/>Kulturamt der Stadt Hameln, Hameln,<br/>Vortrag, 2014, Stufe 1 (Lesung)<br/><br/>Lehmanns Media GmbH, Leipzig,<br/>Vortrag, 2015, Stufe 1 (Lesung)<br/><br/>Max-Weber-Schule, Freiburg,<br/>Vortrag, 2015, Stufe 1 (Lesung)<br/><br/>Röhm Buch und Büro GmbH, Sindelfingen,<br/>Vortrag, 2014, Stufe 1 (Lesung)<br/><br/>Stadt Dorsten, Dorsten,<br/>Vortrag, 2015, Stufe 1 (Lesung)<br/><br/>Universitätsbuchhandlung, Bochum,<br/>Vortrag, 2014, Stufe 1 (Lesung)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		Bundesministerium für Wirtschaft und Energie, Berlin, <br/>	Mitglied der Kommission zur Überprüfung der Finanzierung des Kernenergieausstiegs (KFK)', '1973 Abitur. Wehr- und Zivildienst. Studium der Sozialwissenschaften in Göttingen. Tätigkeiten als Journalist und Pressesprecher. Mitgl. der Grünen seit 1980, 1994/98 Sprecher des Bundesvorst. von BÜNDNIS 90/DIE GRÜNEN. MdL Niedersachsen der 10. und 11. WP, mehrmals Vors. der Fraktion Die Grünen; 1990/94 Niedersächsischer Minister für Bundes- und Europaangelegenheiten. Mitgl. ver.di. - MdB seit 1998; Okt. 1998/Nov. 2005 Bundesminister für Umwelt, Naturschutz und Reaktorsicherheit; Okt. 2005/Okt. 2009 stellv. Vors. der Fraktion Bündnis 90/Die Grünen und Okt. 2009/Okt. 2013 Fraktionsvors. der Fraktion Bündnis 90/Die Grünen; Mitgl. Parl. Versammlung der NATO, Nov. 2015/April 2016 Ko-Vors. der Kommission zur Überprüfung der Finanzierung des Kernenergieausstiegs (KFK).', 'Jürgen', '11003246');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07032, NULL, 'Dr.', 'Dr.', 'Kreisverwaltungsreferent a. D., Rechtsanwalt', 'verheiratet, 4 Kinder', '05.08.1944', NULL, 'Tübingen', 'männlich', NULL, '26.10.1998', 'Uhl', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, selbständig, München<br/>	Mandant 2, monatlich, Stufe 1 (bis Dezember 2013); 2016, Stufe 4<br/><br/>	Rechtsanwaltskanzlei Wagensonner und Partner, München, <br/>	Rechtsanwalt, monatlich, Stufe 2; Zusatzhonorar, 2013, Stufe 4; 2014, Stufe 7; 2015, Stufe 5; 2016, Stufe 9', 'Gymnasium und Abitur in Ravensburg. 2 Jahre Soldat auf Zeit, Oberleutnant d. R. Studium der Rechtswissenschaft mit 1. und 2. Staatsexamen, Promotion zum Dr. jur. in München. Jurist in der Bayerischen Finanzverwaltung. 1970 Eintritt in die CSU; 9 Jahre ehrenamtl. Stadtrat und 11 Jahre berufsmäßiger Stadtrat, Kreisverwaltungsreferent der Landeshauptstadt München. - MdB seit 1998; Vors. des Visa-Untersuchungsausschusses in der 15. WP, Nov. 2005/Jan. 2014 Vors. der AG Innen und seit Jan. 2014 Justiziar der CDU/CSU-Fraktion.', 'Hans-Peter', '11003247');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07037, NULL, NULL, NULL, 'Diplom-Mathematiker, Staatsminister a. D.', 'verheiratet, 4 Kinder', '09.08.1955', NULL, 'Weida', 'männlich', NULL, '26.10.1998', 'Vaatz', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Super Illu Verlag GmbH & Co. KG, Berlin,<br/>Publizistische Tätigkeit, monatlich, Stufe 1 (ab 01.01.2016)<br/><br/>Verband Philatelistischer Prüfer e.V., Lauf,<br/>Verbandsprüfer<br/>   Kunde 1, 2016, Stufe 2<br/>   Kunde 2, 2016, Stufe 1<br/>   Kunde 4, 2016, Stufe 1', '1981/90 tätig im Chemieanlagenbau. Bis 1990 parteilos. Bis Febr. 1990 Pressesprecher des NEUEN FORUM und Mitgl. der "Gruppe der 20" in Dresden. Seit Febr. 1990 Mitgl. CDU. Mai/Okt. 1990 stellv. Regierungsbeauftragter für Dresden. 1990/91 Staatsminister in der Staatskanzlei, 1992/98 Staatsminister für Umwelt und Landesentwicklung. MdL Sachsen Okt. 1990/1998. - MdB seit 1998; seit Okt. 2002 stellv. Vors. der CDU/CSU-Fraktion.', 'Arnold', '11003248');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07040, NULL, NULL, NULL, 'Rechtsanwalt, Landrat a. D.', 'verheiratet, 1 Kind', '03.05.1949', NULL, 'Berlin', 'männlich', NULL, '26.10.1998', 'Veit', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Abitur. 1967/72 Studium der Rechts- und Staatswissenschaften, 1972 1. Staatsexamen, 1972/75 Rechtsreferendar, 1975 2. Staatsexamen. 1975/85 Rechtsanwalt; 1985/86 1. Kreisbeigeordneter und 1986/98 Landrat im Landkreis Gießen. Mitgl. ver.di, AWO; 1986/98 Mitgl., stellv. Vors. und Vors. in diversen Aufsichts- bzw. Verwaltungsräten kommunaler Beteiligungsgesellschaften (z. B. Energieversorgung, Verkehrsunternehmen, Sparkasse, Landesbank, Stadttheater, Beschäftigungsgesellschaft). Seit 1969 Mitgl. SPD, seit 1970 im SPD-Unterbezirksvorst. Gießen, 1988/04 Vors. Unterbezirk Gießen, seit 1990 im SPD-Bezirksvorst. Hessen-Süd, 1993/95 im SPD-Landesvorst. Hessen. 1968/70 im Studentenparlament und Universitätssenaten; 1978/79 in der Bezirksvertretung und 1979/85 Mitgl. des Kreistages. - MdB seit 1998.', 'Rüdiger', '11003249');
