INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07053, NULL, NULL, NULL, 'Referatsleiter, Geschäftsführer', '3 Kinder', '12.03.1956', NULL, 'Feiburg / Breisgau', 'männlich', NULL, '26.10.1998', 'Weiß', '(Emmendingen)', 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>PAX-Bank, Köln, <br/>	Mitglied des Ethik-Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Psychisch Kranke e.V. (APK), Bonn, <br/>	Vorsitzender des Vorstandes, ehrenamtlich<br/><br/>	Caritasverband für die Erzdiözese Freiburg e.V., Freiburg, <br/>	Stellv. Vorsitzender<br/><br/>	Exposure- und Dialogprogramme (EDP) e.V., Bonn, <br/>	Mitglied des Fachbeirates<br/><br/>	Maximilian-Kolbe-Stiftung, Köln, <br/>	Vorsitzender<br/><br/>	Maximilian-Kolbe-Werk e.V., Freiburg, <br/>	Präsident<br/><br/>	Peter-Hesse-Stiftung "Solidarität in Partnerschaft", Erkrath, <br/>	Mitglied des Kuratoriums<br/><br/>	Stiftung PSD L(i)ebenswert der PSD-Bank RheinNeckarSaar eG,<br/>	Stuttgart, <br/>	Mitglied des Kuratoriums<br/><br/>	XertifiX e.V., Freiburg, <br/>	Schatzmeister', 'Abitur 1976. Studium Kath. Theologie 1976/82. Volontariat und Redakteur in München 1982/85. Seit 1985 Referent in der Bundeszentrale des Deutschen Caritasverbandes in Freiburg, ab 1991 Referatsleiter im Generalsekretariat. 1993/98 Geschäftsführer der Kath. Fachhochschule Freiburg GmbH, beurlaubt. 1991/97 Kreisvors. der CDU Freiburg, Mitgl. des Bezirksvorst. der CDU Südbaden; seit 2000 Bezirksvors. der Christlich-Demokratischen Arbeitnehmerschaft (CDA) Südbaden. 1994/98 Vors. der CDU-Stadtratsfraktion Freiburg. Präsident des Maximilian-Kolbe-Werks. - MdB seit 1998; Vors. der Arbeitnehmergruppe der CDU/CSU-Fraktion.', 'Peter', '11003255');
