INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07064, NULL, NULL, NULL, 'Parl. Staatssekretärin', 'verheiratet', '13.06.1966', NULL, 'Tübingen', 'weiblich', NULL, '26.10.1998', 'Widmann-Mauz', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung Reichspräsident-Friedrich-Ebert-Gedenkstätte, Heidelberg, <br/>	Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Hospiz- und Palliativ-Stiftung (DHPS), Berlin,<br/>Mitglied des Stiftungsrates<br/><br/>Gesellschaft für Recht und Politik im Gesundheitswesen e.V. (GRPG),<br/>	München, <br/>	Co-Beisitzerin des Vorstandes, ehrenamtlich (bis 16.01.2015)', 'Abitur am Gymnasium Balingen. Studium der Politik- und Rechtswissenschaften Eberhard-Karls-Univ. Tübingen. 1993/98 Mitarbeiterin am EU-Projekt "European Studies Program (ESP)" der Univ. Tübingen. Seit 1984 Mitgl. CDU, seit 2003 stellv. Vors. der CDU Baden-Württemberg und seit Dez. 2012 Mitgl. im Bundesvorst. der CDU Deutschlands; 1986/89 stellv. Vors. der JU Baden-Württemberg, 1995/2015 Landesvors. der Frauen Union Baden-Württemberg, seit 2015 Bundesvors. der Frauen Union der CDU Deutschlands. 1999/09 Mitgl. im Kreistag Zollernalb. Mitgl. Stiftungsrat Dt. Hospiz- u. Palliativstiftung, Berlin, Schirmherrin Bundesverband Niere e. V., Mainz, "Arche IntensivKinder - Förderverein Betreutes Wohnen dauerbeatmeter Kinder" e. V., Kusterdingen und Initiative "Kinder brauchen Frieden" e. V., Hechingen. Mitgl. u. a. Eugen-Bolz-Stiftung e. V., Rottenburg, Donum Vitae e. V., Bonn, Irma-West-Gemeinschaft e. V., Hechingen und Förderverein "Schwäbischer Dialekt" e. V., Tübingen. - MdB seit 1998; 2000/05 Vors. der Gruppe der Frauen der CDU/CSU-Fraktion, 2000/09 Mitgl. Fraktionsvorst. CDU/CSU, 2001/02 Beauftragte für Verbraucherschutz und Lebensmittelsicherheit der CDU/CSU-Fraktion; 2002/09 gesundheitspol. Sprecherin und 2005/09 Vors. AG Gesundheit der CDU/CSU-Fraktion; seit 2009 Parl. Staatssekretärin beim Bundesminister für Gesundheit.', 'Annette', '11003259');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07067, NULL, NULL, NULL, 'Nachrichtentechniker', 'verheiratet, 3 Kinder', '15.10.1948', NULL, 'Gaschwitz Kreis Leipzig-Land', 'männlich', NULL, '26.10.1998', 'Wieczorek', '(Böhlen)', 'SPD', NULL, 'konfessionslos', NULL, NULL, NULL, 'Jürgen', '11003260');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07068, NULL, NULL, NULL, 'Lehrer', 'verheiratet, 3 Kinder', '03.04.1945', NULL, 'Ehingen- Berkach', 'männlich', NULL, '26.10.1998', 'Wiese', '(Ehingen)', 'CDU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Humanistisches Gymnasium in Ehingen, 1964 Abitur. 1964/66Studium an der Pädagogischen Hochschule Weingarten. 1966/98 Lehrer an Grund- und Hauptschulen, Sonderschulen und Förderschulen, davon 1966/76 in der Piuspflege Oggelbeuren, Heim für erziehungsschwierige Kinder und Jugendliche, 1976/86 an der Sonderschule für Lernbehinderte in Blaubeuren und 1986/88 in Munderkingen, 1988/98 und 2002/10 an der Förderschule Erbach. Mitgl. der GEW, Verkehrswacht, der Kolpingfamilie, bei den Maltesern und in versch. Vereinen, zahlreiche Ehrenämter. 1965/66 stellv. Vors. RCDS Weingarten, 1966/79 Vors. der Jungen Union Ehingen/Donau, 1973/81 Bezirksvors. der JU Württemberg-Hohenzollern und Mitgl. Landesvorst. der JU Baden-Württemberg, seit 1974 Bezirks- und Kreisvorst. von CDU und CDA, seit 1970 Mitgl. im Bezirks- und Landesfachausschuss Bildungspolitik, 1981/87 Beisitzer im Landesvorst. der CDU Baden-Württemberg, 1982/87 Mitgl. CDU-Bundesfachausschuss "Jugendpolitik", seit 1986 Vors. der CDU Ehingen. Seit 1971 Stadtrat der Großen Kreisstadt Ehingen, 1994/09 und seit 2014 ehrenamtl. Stellvertreter des Oberbürgermeisters; seit 1978 Kreisrat im Alb-Donau-Kreis; seit 2004 stellv. Landesvors. der CDA Baden-Württemberg, seit 2005 Beisitzer im Bundesvorstand der CDA. - MdB 1998/02 und seit Okt. 2013.', 'Heinz', '11003261');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07069, NULL, NULL, NULL, 'Geschäftsführer', 'verheiratet, 1 Kind', '28.05.1952', NULL, 'Bremen', 'männlich', NULL, '26.10.1998', 'Wiese', '(Hannover)', 'SPD', NULL, 'evangelisch-lutherisch', NULL, NULL, NULL, 'Heino', '11003262');
