INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07075, NULL, NULL, NULL, 'Dipl.-Volkswirt, Bürgermeister a. D.', 'verheiratet, 5 Kinder', '28.02.1961', NULL, 'Bad Schwalbach', 'männlich', NULL, '26.10.1998', 'Willsch', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Beratender Volkswirt, freiberuflich, Hohenstein<br/><br/>FinanzBuch Verlag, München,<br/>Publizistische Tätigkeit, 2016, Stufe 3<br/><br/>Rheingau-Taunus Monatsanzeiger, Hohenstein,<br/>Herausgeber<br/>   Kunde 01, 2014, Stufe 1; 2015, Stufe 4; 2016, Stufe 1<br/>   Kunde 02, 2014, Stufe 2; 2015, Stufe 3; 2016, Stufe 1<br/>   Kunde 03, 2014, Stufe 2; 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 04, 2014, Stufe 2; 2015, Stufe 3; 2016, Stufe 4<br/>   Kunde 05, 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 06, 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 07, 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 08, 2013, Stufe 1; 2015, Stufe 1; 2016, Stufe 2<br/>   Kunde 09, 2013, Stufe 2; 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 10, 2013, Stufe 1; 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 11, 2015, Stufe 2; 2016, Stufe 1<br/>   Kunde 12, 2015, Stufe 1; 2016, Stufe 2<br/>   Kunde 13, 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 14, 2015, Stufe 1; 2016, Stufe 2<br/>   Kunde 15, 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 16, 2015, Stufe 2; 2016, Stufe 1<br/>   Kunde 17, 2016, Stufe 1<br/>   Kunde 18, 2016, Stufe 1<br/>   Kunde 19, 2016, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>	go4copy.net eG, Frankfurt/Main, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Wissenschaftszentrum Berlin für Sozialforschung (WZB) gemeinnützige GmbH, Berlin, <br/>	Mitglied des Kuratoriums<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Rheingau-Taunus-Kreis, Bad Schwalbach,<br/>Vorsitzender des Kreistages<br/><br/>Sparkassenzweckverband Nassau, Wiesbaden,<br/>Stellv. Mitglied der Verbandsversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bürgeraktion PRO Flughafen, Frankfurt/Main,<br/>Stellv. Vorsitzender des Vorstandes<br/><br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates<br/><br/>Forum Luft- und Raumfahrt e.V., Berlin,<br/>Kooptiertes Mitglied des Vorstandes<br/><br/>Fraunhofer-Institut für Produktionsanlagen und Konstruktionstechnik (IPK), Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Rheingau-Taunus-Marketing e.V., Oestrich-Winkel,<br/>Vorsitzender des Vorstandes', 'Abitur 1979 in Wiesbaden. 1980/86 Studium Volkswirtschaftslehre und Politikwiss. Univ. Mainz, Diplom-Volkswirt. Wehrdienst 1987/88, Hauptmann d. R. 1989/94 Flughafen Frankfurt/Main AG. Ab April 1994 Bürgermeister in Schlangenbad. Beratungs- und Vortragstätigkeit als beratender Volkswirt, Herausgeber einer Monatszeitung. 2015 Veröffentlichung "Von Rettern und Rebellen". Okt. 2003/Okt. 2010 Mitgl. Senat der Fraunhofer Ges., seit 2010 Vors. Freundeskreis Berlin-Taipeh, seit 2008 Mitgl. im Universitätsrat der Dt.-Vietnamesischen Universität, seit 2013 Vors. Rheingau-Taunus Marketingverein und Mitgl. Aufsichtsrat Rheingau-Taunus-Kultur und Tourismus GmbH. 1978/96 Mitgl. JU, Gemeindeverbandsvors. Hohenstein, Kreisvors. Rheingau-Taunus, 1986/92 im Landesvorst., seit 1979 Mitgl. der CDU, seitdem im Kreisvorst., seit 2002 Kreisvors. der CDU im Rheingau-Taunus, seit 1993 Mitgl. Bezirksvorst., seit 2013 Bezirksvors. Westhessen. 1981/93 Gemeindevertreter in Hohenstein, 1985/11 und seit 2016 Mitgl. Kreistag Rheingau-Taunus-Kreis, bis 2011 stellv. Fraktionsvors., seit 2016 Kreistagsvors. 1993/01 Kreisvors. KPV Rheingau-Taunus, 1993/06 Mitgl. Landesvorst. Mitgl. in zahlr. Gremien und Vereinen, Mitgl. Kuratorium Wissenschaftszentrum Berlin für Sozialforschung (WZB) gGmbH und im Kuratorium Fraunhofer/IPK. Englisch (f), Französisch (G). - MdB seit 1998;  Beisitzer im Vorst. des Parlamentskreises Mittelstand; 2005/09 Vors. Unterausschuss zu Fragen der Europäischen Union im Haushaltsausschuss, 2009/13 Obmann der CDU/CSU-Fraktion im Haushaltsausschuss; 2006/10 Vors. und 2010/13 stellv. Vors. Dt.-Kroatische Parlamentariergruppe, seit 2009 Vors. Parlamentsgruppe Luft- und Raumfahrt.', 'Klaus-Peter', '11003264');
