INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07088, NULL, NULL, NULL, 'Dipl.-Kauffrau, Dipl.-Soziologin', 'verheiratet, 4 Kinder', '20.03.1961', NULL, 'Marburg', 'weiblich', NULL, '07.09.1999', 'Arndt-Brauer', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Parea gemeinnützige Gesellschaft für soziale Dienstleistungen mbH, Greven,<br/>Mitglied des Beirates<br/><br/>Wirtschaftsförderungsgesellschaft für den Kreis Borken mbH, Ahaus,<br/>Beratendes Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutschland- und Europapolitisches Bildungswerk NRW e.V. (DEPB), Tecklenburg,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Institut Finanzen und Steuern e.V. (ifst), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Gesamtschule Wetter, Abitur Gymnasium Philippinum Marburg. 1980/85 Studium der Betriebswirtschaftslehre und Soziologie in Marburg. Nach Familienphase 1998/99 Leiterin "Kommunales Marketing" beim Kreis Steinfurt. Mitgl. SPD seit 1983, 1987/92 versch. Funktionen bei Jusos, ASF und Partei im Unterbezirk Würzburg, seit 1992 versch. Funktionen im Unterbezirk Steinfurt. 1985/86 Stadtverordnete in Wetter/Hessen, 1994/97 Kreistagsabg. Kreis Steinfurt. 1980 Eintritt in die GEW, seit 1999 Mitgl. der AWO. - MdB seit Juli 1999; Mitglied im Vorstand der SPD-Fraktion, seit Jan. 2014 Vors. Finanzausschuss.<br/><br/>Betreuter Wahlkreis: <br/>Wahlkreis 128 (Steinfurt III)', 'Ingrid', '11003422');
