INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07095, NULL, 'Dr.', 'Dr.', 'Biotechnologin', 'ledig', '25.08.1967', NULL, 'Goch / Kreis Kleve', 'weiblich', NULL, '22.02.2000', 'Reimann', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Bezirksverband Braunschweig e.V., Braunschweig,<br/>Beisitzerin des Präsidiums', '1987 Abitur am Städtischen Gymnasium Goch. Studium der Biotechnologie an der TU Braunschweig, 1993 Diplom. 1994 Wiss. Hilfskraft am Institut für Technologie an der Bundesforschungsanstalt für Landwirtschaft (FAL) in Braunschweig. 1995/99 Promotion. 1998/99 Referentin im Bereich Public Health, 2000 Projektleiterin medizinisches Marketing. Seit 1986 Mitgl. der SPD, 1990/97 Vors. und stellv. Vors. der Jusos im Unterbezirk Braunschweig, 2002/11 Vors. des SPD-Unterbezirks Braunschweig, seit 2011 stellv. Vors. SPD-Bezirk Braunschweig, seit 2008 Mitgl. des Landesvorst. der SPD Niedersachsen. Seit 2016 Beisitzerin des Präsidiums des AWO-Unterbezirks Braunschweig. - MdB seit Febr. 2000; 2005/09 gesundheitspol. Sprecherin der SPD-Fraktion, 2009/13 Vors. Ausschuss für Gesundheit, seit Dez. 2013 stellv. Vors. der SPD-Fraktion, zuständig für Arbeit und Soziales, Familie, Senioren, Frauen und Jugend.', 'Carola', '11003434');
