INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07099, NULL, NULL, NULL, 'Historikerin', 'keine Angaben', '06.12.1966', NULL, 'Münster / Westfalen', 'weiblich', NULL, '11.05.2000', 'Griese', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Evangelische Kirche im Rheinland (EKiR), Düsseldorf,<br/>Stellv. Mitglied der Synode, ehrenamtlich<br/><br/>Evangelische Kirche in Deutschland (EKD), Hannover,<br/>Mitglied der Synode, ehrenamtlich<br/>Mitglied des Rates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeiter-Samariter-Bund Landesverband Nordrhein-Westfalen e.V., Köln,<br/>Vizepräsidentin, ehrenamtlich<br/><br/>Bergische Diakonie Aprath, Wülfrath,<br/>Mitglied der Mitgliederversammlung, ehrenamtlich<br/><br/>Gegen Vergessen - Für Demokratie e.V., Bonn,<br/>Mitglied des geschäftsführenden Vorstandes, ehrenamtlich<br/><br/>Graf Recke Stiftung, Düsseldorf,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis 07.12.2016)<br/><br/>Kindernothilfe-Stiftung, Duisburg,<br/>Mitglied des Stiftungsrates, ehrenamtlich', '1985 Abitur in Düsseldorf. Studium der Neueren Geschichte, Osteurop. Geschichte und Politikwissenschaft an der Heinrich-Heine-Univ. Düsseldorf, 1997 Magister Artium. 1987/97 freie und 1997/2000 Wiss. Mitarbeiterin der Mahn- und Gedenkstätte für die Opfer des Nationalsozialismus in Düsseldorf. 1986 Eintritt in die SPD; 1989/90 AStA-Vors; 1989/93 Mitgl. Bundesvorst. Juso-Hochschulgruppen und Juso-Bundesvorst.; 1995/2011 und seit 2013 Mitgl. SPD-Parteivorst. Seit 2003 Mitgl. der Synode und seit Nov. 2015 Mitgl. im Rat der EKD, seit 2001 stellv. Mitgl. der Synode der Ev. Kirche Rheinland, 2009/10 Vorstand Sozialpolitik des Diakonischen Werkes der EKD e. V.; Mitgl. Berliner Republik e. V., Willy-Brandt-Zentrum Jerusalem, Dt.-Israelische Gesellschaft, Gesellschaft für christlich-jüdische Zusammenarbeit, Gegen Vergessen - für Demokratie, Kinderschutzbund, Marie-Schlei-Verein, IG BCE, AWO, ASB, Pro Asyl. - MdB Mai 2000/Oktober 2009 und seit Juli 2010; in der 15. und 16. WP Vors. Ausschuss für Familie, Senioren, Frauen und Jugend; in der 16. WP und ab Nov. 2011 Beauftragte der SPD-Fraktion für Kirchen und Religionsgemeinschaften, seit Jan 2014 Vors. Ausschuss für Arbeit und Soziales, seit 2014 stellv. Vors. Deutsch-Israelische Parlamentariergruppe.', 'Kerstin', '11003440');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07100, NULL, NULL, NULL, 'Politikwissenschaftlerin', 'keine Angaben', '17.03.1971', NULL, 'Sindelfingen', 'weiblich', NULL, '24.08.2000', 'Maier', NULL, 'PDS', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Pia', '11003449');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07105, NULL, NULL, NULL, 'Dipl.-Informatiker, Parl. Staatssekretär', 'verheiratet, 5 Kinder', '29.03.1968', NULL, 'Bamberg', 'männlich', NULL, '01.09.2000', 'Kelber', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Agora Energiewende, SEFEP GmbH, Berlin, <br/>	Mitglied des Rates der Agora, ehrenamtlich<br/>	<br/>Gesellschaft für Energie- und Gebäudemanagement GmbH, Bonn, <br/>	Mitglied des Aufsichtsrates (bis 31.12.2013)<br/>	<br/>Stadtwerke Bonn Energie und Wasser GmbH, Bonn, <br/>	Mitglied des Aufsichtsrates (bis 31.12.2013)<br/>	<br/>VPV Versicherungen VVaG, Stuttgart, <br/>	Mitglied des Beirates (bis 31.12.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>	Post und Eisenbahnen, Bonn, <br/>	Stellv. Mitglied des Beirates (bis 13.02.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Alexander-Koenig-Gesellschaft e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Bundesverband BioEnergie e.V. (BBE), Bonn, <br/>	Mitglied im Politisch/Wissenschaftlichen Beirat, ehrenamtlich (bis 31.12.2013)<br/>	<br/>Bundesverband Erneuerbare Energie e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich (bis 31.12.2013)<br/>	<br/>Bürger für Beethoven e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Forum Ökologisch-Soziale Marktwirtschaft e.V. (FÖS), Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/>	<br/>HELP - Hilfe zur Selbsthilfe e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Mid-Atlantik Club Bonn e.V., Bonn, <br/>	Mitglied des Vorstandes, ehrenamtlich (bis 03.02.2016)<br/>	<br/>Otto-Benecke-Stiftung e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Stiftung Bundeskanzler-Adenauer-Haus, Bad Honnef-Rhöndorf, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis 11.02.2014)<br/>	<br/>Stiftung Entwicklung und Frieden (SEF), Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich', '1974/78 Grundschule, 1978/87 Gymnasium in Bonn. 1987/93 Studium der Informatik und Biologie. 1991/95 wissenschaftlicher Mitarbeiter am Forschungszentrum Informationstechnik der GMD, 1996/2000 Wissensmanagement-Berater bei einer IT-Firma. 1985 Eintritt in die SPD, 1992/08 Mitgl. des Vorst. der Bonner SPD, 1992/2000 Sprecher und 2001/08 Vors. der Bonner SPD, 2009/11 Mitgl. SPD-Parteivorst. 1987/89 sachkundiger Bürger im Umweltausschuss der Stadt Bonn, 1989/94 Mitgl. der Bezirksvertretung Bonn-Beuel, 1994/02 Mitgl. im Rat der Stadt Bonn. Mitgl. u. a. ver.di, Greenpeace, BUND, ADFC, Eurosolar. Englisch (f), Französisch (G). - MdB seit Sept. 2000; Nov. 2005/Dez. 2013 stellv. Vors. der SPD-Fraktion; seit Dez. 2013 Parl. Staatssekretär beim BMin. der Justiz und für Verbraucherschutz.', 'Ulrich', '11003450');
