INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07111, NULL, NULL, NULL, 'Dipl.-Sozialpädagogin, Parl. Staatssekretärin', '2 Kinder', '20.04.1951', NULL, 'Bovenden bei Göttingen', 'weiblich', NULL, '01.11.2001', 'Lösekrug-Möller', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeitskreis Evangelische Familienerholung, Berlin, <br/>	Vorsitzende<br/>	<br/>Bundesarbeitsgemeinschaft Familienerholung, Berlin, <br/>	Vorsitzende<br/>	<br/>Landesverband niedersächsischer Musikschulen e.V., Hannover, <br/>	Präsidentin', '1966 Abschluss der Realschule, bis 1974 Ausbildung und Tätigkeit als Buchhändlerin in Göttingen. Bis 1979 Studium an der ev. FH für Sozialpädagogik in Hannover. Bis 1990 Tätigkeit als Dipl.-Sozialpädagogin und Sozialarbeiterin in Isernhagen, bis 1993 Tätigkeiten in der Erwachsenenbildung/Gesundheitsförderung in Hameln-Pyrmont und bis 1995 Familienarbeit. Ab 1995 selbstständige Tätigkeit als Trainerin und Organisationsberaterin. 1972 Eintritt in die SPD; Funktionen auf Unterbezirks- und Landesebene. 1997/2015 Vors. des Unterbezirks Hameln-Pyrmont, 1999/11 Vorstandsmitgl. des SPD-Bezirks Hannover, 2003/April 2016 Mitgl. des Landesvorstandes, seit Dez. 2011 Mitgl. Parteivorst. 1996/Nov. 2011 Kreistagsabgeordnete im Landkreis Hameln-Pyrmont. Mitgl. ÖTV und AWO. - MdB seit Nov. 2001; Sept. 2011/Sept. 2013 Vors. der Landesgruppen Niedersachsen/Bremen; seit Dez. 2013 Parl. Staatssekretärin bei der Bundesministerin für Arbeit und Soziales.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 40 (Nienburg II - Schaumburg)', 'Gabriele', '11003482');
