INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07117, NULL, NULL, NULL, 'Dipl.-Volkswirtin', 'verheiratet, 3 Kinder', '21.10.1968', NULL, 'Schramberg', 'weiblich', NULL, '17.10.2002', 'Andreae', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>UWC Robert Bosch College gemeinnützige GmbH, Freiburg,<br/>Mitglied des Kuratoriums<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Albert-Ludwigs-Universität Freiburg, Freiburg,<br/>Mitglied des Beirates<br/><br/>Evangelische Fachhochschule Freiburg, Freiburg,<br/>Mitglied des Beirates<br/><br/>Kreditanstalt für Wiederaufbau (KfW), Frankfurt/Main,<br/>Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AIDS-Hilfe Freiburg e.V., Freiburg,<br/>Mitglied des Kuratoriums<br/><br/>Europäische Akademie für Frauen in der Politik und Wirtschaft Berlin e.V., Berlin,<br/>Mitglied des Beirates<br/><br/>Freundeskreis Wirtschaftsjunioren Freiburg, Freiburg,<br/>Fördermitglied<br/><br/>Reinacher Europadialoge e.V., Freiburg,<br/>Mitglied des Beirates', 'Abitur 1988. Studium der Volkswirtschaftslehre an der Albert-Ludwigs-Univ. Freiburg, Abschluss als Diplom-Volkswirtin 1996. 1996/97 medikur, Agentur für Gesundheits- und Kurtechnologie, Hamm. 1998/2000 Projektmanagement beim Sozialwissenschaftlichen Frauenforschungsinstitut der ev. Fachhochschule Freiburg. 2001/02 Mitarbeit in "Das Grüne Emissionshaus", Finanzdienstleister im Bereich Windenergie, Freiburg. 1991/93 Landesvorst. der Grün-Alternativen Jugend Baden-Württemberg, 1992/99 Kreisvorst. Bü90/Die Grünen Freiburg, 1999/01 Landesvorst. Bü90/Die Grünen Baden-Württemberg. 1999/02 Gemeinderätin in Freiburg. Mitgl. Beirat der Albert-Ludwigs-Univ. Freiburg, Mitgl. Kuratorium Aids-Hilfe Freiburg e. V., Mitgl. im Förderverein wohnungsloser Frauen OFF. Mitgl. Kuratorium UWC Robert Bosch College, Schirmherin der UNICEF Gruppe Freiburg, Mitgl. im Trinationalen Atomschutzverband TRAS. - MdB seit Okt. 2002; bis März 2012 Wirtschaftspol. Sprecherin und seit Feb. 2012 stellv. Vors. der Fraktion Bündnis 90/Die Grünen.', 'Kerstin', '11003493');
