 Kurhessen-Waldeck, seit Sept. 2016 stellv. Vorstandsvors. Terra Tech Förderprojekte e. V. - MdB seit Okt. 2002; 2004/11 stellv. Sprecher und  bis 2013 Sprecher der Arbeitsgruppe Verkehr, Bau und Stadtentwicklung der SPD-Fraktion und Mitgl. im Fraktionsvorst., seit Dez. 2013 stellv. Vors. der SPD-Fraktion; Mitgl. Parlamentsgruppe Schienenverkehr; stellv. Mitgl. der Kommission des Ältestenrates für Bau- und Raumangelegenheiten.', 'Sören', '11003496');
