INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07142, NULL, NULL, NULL, 'Verwaltungs-Betriebswirtin (VWA), Fachkauffrau für Marketing /Vertrieb (VWA)', 'verheiratet, 1 Kind', '20.11.1960', NULL, 'Karl-Marx-Stadt / Chemnitz', 'weiblich', NULL, '17.10.2002', 'Bellmann', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Mittelsachsen, Freiberg, <br/>Mitglied des Kreistages, ehrenamtlich', 'POS. 1977/80 Fachschulstudium zur Krippenpädagogin, 1994/95 Anschlussqualifizierung staatl. anerkannte Erzieherin/Sozialarbeiterin. 1991/94 berufsbegleit. Studium Wirtschafts- und Verwaltungswissenschaften (VWA). 1995 Studium Rechts-, Kommunikations- u. Politikwissenschaft TU Dresden, 2000/02 berufsbegleit. Aufbaustudium Fachkauffrau für Marketing und Vertrieb (VWA). 1980/92 Krippenerzieherin, Gruppenleiterin, 1992/94 Sozialarbeiterin. 1995/02 Assistentin der Geschäftsleitung der Sita-Entsorgung GmbH Sachsen. 1989 Gründungsmitgl. Bürgerinitiative, bis 1990 parteilos. Seit 1990 Mitgl. der CDU, u. a. seit 2008 stellv. Vors. CDU Mittelsachsen. 1990/94 stellv. CDU-Fraktionsvors. im Kreistag Flöha, seit Aug. 2008 Mitgl. Kreistag Mittelsachsen. 1994/02 MdL Sachsen, Mitgl. Präsidium. Mitgl. in den Fördervereinen der Gedenkstätte Hohenschönhausen, der Konrad-Adenauer-Stiftung, des Schlosses Augustusburg, der Peter-Apian-Mittelschule Leisnig, der Wilhelm-Walther Grundschule Neuhausen-Cämmerswalde sowie des Samuel-von-Pufendorf-Gymnasiums Flöha, Mitgl. in zahlreichen örtl. Vereinen sowie der Freiberger Tafel, dem Oederaner Hospiz, dem Falkenauer Genossenschaftsladen der Trade Fair Freiberg eG und dem Bürgerkraftwerk "Tivoli". Englisch (G), Russisch (G). - MdB seit Okt. 2002.', 'Veronika', '11003501');
