INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07162, NULL, 'Dr.', 'Dr.', 'Professor, Arzt, Staatsminister im Bundeskanzleramt', 'verheiratet', '18.10.1972', NULL, 'Gießen', 'männlich', NULL, '17.10.2002', 'Braun', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angabenöffentlichungspflichtigen Angaben.', '1992 Abitur an der Liebigschule in Gießen. 1993/94 Wehrdienst bei der Bundeswehr, Koblenz. 1994/01 Studium der Humanmedizin an der Justus-Liebig-Universität Gießen, 2007 Promotion zum Dr. med. 2001/09 Wiss. Mitarbeiter am Universitätsklinikum Gießen. Seit 2015 Honorarprofessor an der Universität Frankfurt. 1989 Eintritt in die JU und in die CDU, 1992/97 JU-Kreisvors. und 1998/01 JU-Bezirksvors., seit 2004 Vors. des CDU Kreisverbandes Gießen, seit 2007 Vors. CDU-Bezirksverband Mittelhessen. 1997/09 Stadtverordneter in der Gießener Stadtverordnentenvers., 2006/09 Mitgl. Kreistag im Landkreis Gießen und Vors. der CDU Kreistagsfraktion. Englisch (f), Spanisch (G). - MdB 2002/05 und seit Okt. 2009; in der 15. WP Sprecher der CDU/CSU-Fraktion im Parl. Beirat für nachhaltige Entwicklung, 2003/05 und seit 2011 stellv. Vors. der Landesgruppe Hessen der CDU/CSU-Fraktion. Okt. 2009/Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Bildung und Forschung. Seit Dez. 2013 Staatsminister bei der Bundeskanzlerin.', 'Helge', '11003510');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07165, NULL, NULL, NULL, 'Wirtschaftsinformatikerin, Major d. R.', 'verheiratet, 4 Kinder', '13.07.1951', NULL, 'Bremen', 'weiblich', NULL, '17.10.2002', 'Brüning', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, NULL, NULL, 'Monika', '11003511');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07170, NULL, NULL, NULL, 'Freier Journalist', 'geschieden, 1 Kind', '14.06.1971', NULL, 'Dortmund', 'männlich', NULL, '17.10.2002', 'Bülow', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Erneuerbare Energie e.V., Paderborn, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich (bis 06.03.2014)<br/><br/>GLOBE Deutschland, Berlin, <br/>	Beisitzer, ehrenamtlich<br/><br/>Institut Solidarische Moderne e.V., Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich', 'Abitur an der Anne-Frank-Gesamtschule. Studium Journalistik, Geschichte und Politikwissenschaft. Freier Journalist. Schülerarbeit, u. a. Schülersprecher ab 1987, Neugründung Juso-Hochschulgruppe 1992, Mitgl. Studierendenparlament Univ. Dortmund, Mitgl. AStA 1992/94, u. a. als stellv. AStA-Vors. Seit 1992 Mitgl. der SPD, 1992/99 Mitgl. im Dortmunder Juso-Vorst., zeitweise Vors., Mitgl. Vorst. SPD Dortmund seit 1996, seit 1999 stellv. Vors. Ortsverein Westfalenhalle Dortmund. Sachkundiger Bürger im Dortmunder Rat 1999/02. Mitgl. AWO, Greenpeace, ver.di, amnesty international, Kunst- und Literaturverein für Gefangene e. V., BVB 09, Verein Steinwache, Eurosolar, Naturfreunde Deutschland, VCD, Kuratorium Dortmunder Aidshilfe, Kuratorium Institut Solidarische Moderne und Netzwerk Recherche, Auslandsgesellschaft Deutschland e.V. (AgD), CORREKT!V, Lobby Control. - MdB seit Okt. 2002; 2005/09 Sprecher der AG Umwelt, Naturschutz und Reaktorsicherheit, 2009/13 stellv. energiepol. Sprecher der SPD-Fraktion und Berichterstatter Atom der SPD-Fraktion.', 'Marco', '11003512');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07171, NULL, NULL, NULL, 'Lehrerin, Staatssekretärin a. D.', 'verheiratet, 2 Kinder', '26.03.1955', NULL, 'Berlin', 'weiblich', NULL, '17.10.2002', 'Butalikakis', NULL, 'CDU', NULL, 'evangelisch', NULL, NULL, NULL, 'Verena', '11003513');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07173, NULL, NULL, NULL, 'Volljuristin', 'verheiratet', '10.05.1964', NULL, 'Leer', 'weiblich', NULL, '17.10.2002', 'Connemann', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Unternehmen: <br/>Johannesburg GmbH, Surwold, <br/>Mitglied der Gesellschafterversammlung, ehrenamtlich<br/><br/>LeeWerk-WISA gemeinnützige GmbH, Leer, <br/>Mitglied der Gesellschafterversammlung, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Leer, Leer, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Israelische Gesellschaft e.V., Berlin, <br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Förderverein des Parlamentskreises Mittelstand e.V., Berlin, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Kinder- und Jugendstiftung der Hiltruper Herz-Jesu-Missionare im Emsland, Surwold, <br/>Mitglied des Stiftungsvorstandes, ehrenamtlich<br/><br/>Landesverband niedersächsischer Musikschulen e.V., Hannover, <br/>Kooptiertes Mitglied des Vorstandes und Ehrenpräsidentin, ehrenamtlich', '1983 Abitur in Leer. Ausbildung zur Einzelhandelsverkäuferin. 1984/90 Studium der Rechtswissenschaften, 1993 2. Staatsexamen. 1993/95 Angestellte Rechtsanwältin, 1995/01 Syndika bei einem Arbeitgeberverband, 2001/12 selbstständige Rechtsanwältin. 1996 Eintritt in die CDU. Seit 2001 Mitgl. Kreistag Landkreis Leer. Ehrenpräsidentin Landesverband Niedersächsischer Musikschulen, Vizepräsidentin Deutsch-Israelische Gesellschaft e. V., Vorstand Kinder- und Jugendstiftung der Hiltruper-Herz-Jesu-Missionare, Gesellschafterversammlung Johannesburg GmbH, Vorstand Stiftung Diakonie im Landkreis Leer, Mitgl. Gesellschafterversammlung Leewerk-WISA gGmbH, Kuratorium Aktion Sühnezeichen und Kuratorium Koordinierungsrat gegen Antisemitismus. Englisch (f), Niederländisch (f), Französisch (G) - MdB seit Okt. 2002; 2003/07 Vors. Enquete-Kommission "Kultur in Deutschland"; Jan. 2014/Jan. 2015 Vors. Ausschuss für Ernährung und Landwirtschaft, seit Jan. 2015 stellv. Vors. CDU/CSU-Fraktion.', 'Gitta', '11003514');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07174, NULL, NULL, NULL, 'Hotelkauffrau', 'verheiratet, 2 Kinder', '12.06.1942', NULL, 'Wuppertal-Elberfeld', 'weiblich', NULL, '17.10.2002', 'Daub', NULL, 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Helga', '11003515');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07179, NULL, NULL, NULL, 'Bundesminister für Verkehr und digitale Infrastruktur, Diplom-Soziologe', 'verheiratet, 1 Kind', '07.06.1970', NULL, 'Peißenberg', 'männlich', NULL, '17.10.2002', 'Dobrindt', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Christlich-Soziale Union in Bayern e.V., München, <br/>	Generalsekretär (bis 16.12.2013), monatlich, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreditanstalt für Wiederaufbau, Frankfurt/Main, <br/>Mitglied des Verwaltungsrates, von Amts wegen<br/><br/>Landkreis Weilheim-Schongau, Weilheim, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>ZDF, Mainz, <br/>Mitglied des Fernsehrates (bis 04.03.2014)', 'Abitur am Gymnasium Weilheim. Studium an der Ludwig-Maximilians-Univ. München, Diplom-Soziologe. 1996/01 Kaufm. Leiter im Maschinenbau, 2001/05 Geschäftsführer im Maschinenbau. 1986 Eintritt in die JU, 1990/97 JU-Kreisvors.; seit 1990 Mitgl. der CSU, 1999/11 Ortsvors. der CSU, seit 2009 Kreisvors. der CSU Weilheim-Schongau. Seit 1996 Kreisrat in Weilheim/Schongau, 1996/11 Marktgemeinderat in Peißenberg. Febr. 2009/Dez. 2013 Generalsekretär der CSU. - MdB seit Okt. 2002; in der 15. WP stellv. Vors. des Ausschusses für Wirtschaft und Arbeit; in der 16. WP wirtschaftspol. Sprecher der CSU-Landesgruppe und bildungs- und forschungspol. Sprecher der CDU/CSU-Fraktion; seit Dez. 2013 Bundesminister für Verkehr und digitale Infrastruktur.', 'Alexander', '11003516');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07184, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet', '30.06.1962', NULL, 'Herten / Krs. Recklinghausen', 'männlich', NULL, '17.10.2002', 'Dörmann', NULL, 'SPD', NULL, 'katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesministerium der Finanzen, Berlin,<br/>Mitglied des Beirates für die grafische Gestaltung der<br/>Sonderpostwertzeichen<br/><br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Mitglied des Beirates<br/><br/>Deutsche Welle, Bonn,<br/>Mitglied des Verwaltungsrates<br/><br/>Landesanstalt für Medien Nordrhein-Westfalen (LfM), Düsseldorf,<br/>Stellv. Mitglied der Medienkommission (bis Mitte Februar 2015)<br/><br/>Stiftung Haus der Geschichte der Bundesrepublik Deutschland, Bonn,<br/>Mitglied des Kuratoriums', '1981 Abitur. Zivildienst bei der Arbeiterwohlfahrt Köln. Studium der Rechtswissenschaften in Köln und Bonn. 1992/98 Mitarbeiter bei Bundestagsabgeordneten. 1997/99 Rechtsreferendar am Landgericht Köln. 1999/03 Tätigkeit als Rechtsanwalt. Mitgl. der SPD seit 1979, 1997/07 stellv. Vors. der Kölner SPD. 1989/94 Mitgl. der Bezirksvertretung Köln-Rodenkirchen. - MdB seit Okt. 2002.', 'Martin', '11003517');
