INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07192, NULL, NULL, NULL, 'Städtischer Ltd. Verwaltungsdirektor a.D.', 'verheiratet, 1 Kind', '24.01.1952', NULL, 'Moers', 'männlich', NULL, '17.10.2002', 'Ehrmann', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>	Moers Kultur GmbH, Moers,<br/>Mitglied des Aufsichtsrates<br/><br/>Paul Gerhardt Werk gemeinnützige GmbH, Berlin/Cottbus,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Schlosstheater Moers GmbH, Moers,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Der Bundesbeauftragte für die Unterlagen des Staatssicherheitsdienstes der ehemaligen DDR, Berlin,<br/>Mitglied des Beirates<br/><br/>Deutsche Nationalbibliothek, Frankfurt/Main,<br/>Mitglied des Verwaltungsrates<br/><br/>Deutsche Welle, Bonn,<br/>Stellv. Mitglied des Rundfunkrates<br/><br/>Stiftung Deutsches Historisches Museum (DHM), Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Stiftung zur Aufarbeitung der SED-Diktatur, Berlin,<br/>Mitglied des Stiftungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bürgerstiftung Neukirchen-Vluyn, Neukirchen-Vluyn,<br/>Stellv. Vorsitzender des Stiftungsrates<br/><br/>Kulturstiftung des Bundes, Halle/Saale,<br/>Stellv. Mitglied des Stiftungsrates<br/><br/>Kunststiftung NRW, Düsseldorf,<br/>Mitglied des Kuratoriums<br/><br/>Lebenshilfe für Menschen mit geistiger Behinderung Krefeld e.V., Krefeld,<br/>Mitglied des Stiftungskuratoriums<br/><br/>Leo Baeck Foundation, Berlin,<br/>Mitglied des Stiftungsrates<br/><br/>Neukirchener Erziehungsverein, Neukirchen-Vluyn,<br/>Vorsitzender des Aufsichtsrates, ehrenamtlich<br/><br/>Stiftung Brot für die Welt, Stuttgart/Berlin,<br/>Mitglied des Stiftungsrates<br/><br/>Stiftung Händel-Haus Halle, Halle,<br/>Mitglied des Kuratoriums<br/><br/>Stiftung Neukirchener Kinder- und Jugendhilfe, Neukirchen-Vluyn,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Stiftung Neukirchener Kinder-, Jugend- und Familienstiftung, Neukirchen-Vluyn,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1968 Mittlere Reife. 1973 Diplom-Verwaltungswirt, 1977 Kommunal-Diplom (VWA). 1968/2002 Beamter der Stadt Moers; 1988/93 Leiter des Personal- und Organisationsamtes, 1994/2002 Personal- und Kulturdezernent in Moers, Städt. ltd. Verwaltungsdirektor a. D. 1970 Eintritt in die SPD, seit 1991 Mitgl. im SPD-Ortsvereinsvorst. Neukirchen-Vluyn, März 2004/Nov. 2013 Vors. des SPD-Stadtverbands Moers. 1984/90 Ratsmitgl. Stadtrat Neukirchen und dort Mitgl. des SPD-Fraktionsvorstands. Seit Anfang der 70er Jahre Mitarbeit in entwicklungs-, friedens- und umweltpolitischen Initiativen. 1974/85 Vors. des CVJM Neukirchen e. V., 1979/84 Mitgl. des ÖTV-Kreisvorstandes, seit Jan. 2009 Präses des Neukirchener Erziehungsvereins. Englisch (G). - MdB seit 2002; 2003/07 Sprecher der SPD-Arbeitsgruppe in der Enquete-Kommission "Kultur in Deutschland", 2006/07 stellv. Vors. Enquete-Kommission "Kultur in Deutschland", 2005/09 stellv. Vors. Ausschuss für Kultur und Medien, Nov. 2009/Febr. 2011 Beauftragter für Kirchen und Religionsgemeinschaften der SPD-Fraktion, 2009/14 Sprecher der SPD-AG Kultur und Medien, seit Jan. 2014 Vors. Ausschuss für Kultur und Medien, seit 2014 Mitgl. SPD-Fraktionsvorst., Beauftragter der SPD-Fraktion für das Reformationsjubiläum, Mitgl. Unterausschuss Auswärtige Bildungs- und Kulturpolitik.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 110 (Krefeld I - Neuss II)', 'Siegmund', '11003521');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07194, NULL, NULL, NULL, 'Bundesfinanzminister a. D.', 'verheiratet, 2 Kinder', '24.12.1941', NULL, 'Kassel', 'männlich', NULL, '17.10.2002', 'Eichel', NULL, 'SPD', NULL, 'evangelisch', NULL, NULL, NULL, 'Hans', '11003522');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07199, NULL, NULL, NULL, 'Journalistin, Autorin', 'verheiratet, 2 Kinder', '10.09.1949', NULL, 'Neuenburg / Landkreis Friesland', 'weiblich', NULL, '17.10.2002', 'Evers-Meyer', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Stiftung für politische Bildung und Völkerverständigung e.V., Bonn, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Evangelische Arbeitsgemeinschaft für Soldatenbetreuung e.V., Berlin, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Förderkreis Deutsches Heer e.V., Bonn, <br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Institut für niederdeutsche Sprache e.V., Bremen, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Niederdeutscher Bühnenbund Niedersachsen - Bremen e.V., Oldenburg, <br/>Ehrenpräsidentin, ehrenamtlich', 'Mittlere Reife. Kaufmännische Ausbildung. 8 Jahre Tätigkeit an der Akademie der Künste, Berlin, Immaturenprüfung. Erziehungspause, Autorentätigkeit, freie Mitarbeit bei Rundfunk und Fernsehen; Autorin und Filmemacherin für Industriefilme. 1986/06 Kreistagsmitgl. im Landkreis Friesland, 1990/94 stellv. Fraktionsvors.; 1994/03 ehrenamtl. Landrätin Landkreis Friesland; 1997/01 Ratsfrau und stellv. Bürgermeisterin in der Gemeinde Zetel. 1998/02 MdL Niedersachsen. Seit 2010 Mitgl. UNESCO-Expertenkommission "Inklusive Bildung". Ehrenpräsidentin des Niederdeutschen Bühnenbundes Niedersachsen und Bremen; ehrenamtl. Tätigkeiten in verschiedenen Organisationen und Vereinen. - MdB seit Okt. 2002; Nov. 2005/Okt. 2009 Beauftragte der Bundesregierung für die Belange behinderter Menschen; seit 2013 Mitgl. PV der NATO.', 'Karin', '11003523');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07201, NULL, NULL, NULL, 'Dipl.-Ökonom', 'verheiratet, 2 Kinder', '08.02.1968', NULL, 'München', 'männlich', NULL, '17.10.2002', 'Fahrenschon', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Georg', '11003524');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07204, NULL, NULL, NULL, 'Geschäftsführer, Parl. Staatssekretär', 'verheiratet, 2 Kinder', '12.07.1963', NULL, 'Bad Rothenfelde', 'männlich', NULL, '17.10.2002', 'Ferlemann', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Dr. Mingramm GmbH Immobilien und Handel, Cuxhaven, <br/>Geschäftsführer<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Cuxhaven, Cuxhaven, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Stadt Cuxhaven, Cuxhaven, <br/>Mitglied des Stadtrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Förderverein Rot-Weiß Cuxhaven 1990 e.V., Cuxhaven, <br/>Vorsitzender, ehrenamtlich<br/><br/>Rot-Weiß Cuxhaven 1990 e.V., Cuxhaven, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Wirtschaftsrat der CDU e.V., Landesverband Niedersachsen, Hannover, <br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Dr. Mingramm GmbH Immobilien und Handel, Cuxhaven', 'Lichtenberggymnasium, 1982 Abitur. 1982 Banklehre bei einer norddeutschen Privatbank. 1984 Wehrdienst, Luftwaffe. 1985 Studium der Rechtswissenschaft, Politikwissenschaft und Philosophie. Anschl. Tätigkeiten in wirtschaftsberatenden Berufen. 1995/09 geschäftsführender Gesellschafter einer Wirtschaftsberatungsgesellschaft. 1976 Mitgl. Schülerunion und JU, Stadt-, Kreis- und Bezirksvors., Mitgl. Landesvorst., Mitgl. der CDU seit 1979, 1990/95 Stadtverbandsvors. Cuxhaven, seit 1995 Vors. CDU-Kreisverband Cuxhaven, seit 1999 Vors. CDU-Bezirksverb. Elbe-Weser, Mitgl. Landesvorst. der Niedersachsen CDU; stellv. Vors. des Wirtschaftsrates Niedersachsen der CDU e. V. Seit 1986 Mitgl. Rat der Stadt Cuxhaven, 1991/09 Fraktionsvors., Vors. Wirtschaftsausschuss, seit 1991 Mitgl. Kreistag Landkreis Cuxhaven. Englisch (f), Französisch (G). - MdB seit Okt. 2002; 2005/09 und 2013/14 Vors., ab 2014 stellv. Vors. Landesgruppe Niedersachsen der CDU/CSU-Fraktion; 2007/09 Vors. Unterausschuss Eisenbahninfrastruktur; seit Okt. 2009 Parl. Staatssekretär beim Bundesminister für Verkehr, Bau und Stadtentwicklung, seit Dez. 2013 beim Bundesminister für Verkehr und digitale Infrastruktur.', 'Enak', '11003525');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07205, NULL, NULL, NULL, 'Einzelhandelskaufmann', 'verheiratet, 2 Kinder', '14.11.1948', NULL, 'Verden an der Aller', 'männlich', NULL, '17.10.2002', 'Fischer', '(Göttingen)', 'CDU', NULL, 'evangelisch', NULL, NULL, NULL, 'Hartwig', '11003526');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07209, NULL, 'Dr.', 'Dr.', 'Tierärztin, Parl. Staatssekretärin', 'verheiratet, 2 Kinder', '02.06.1963', NULL, 'Lünen / Westfalen', 'weiblich', NULL, '17.10.2002', 'Flachsbarth', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>	Deutsche Energie-Agentur GmbH (dena), Berlin, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	CaritasStiftung Hannover, Hannover, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Katholischer Deutscher Frauenbund (KDFB), Köln, <br/>	Präsidentin, ehrenamtlich<br/><br/>	Malteser Hilfsdienst e.V., Hannover, <br/>	Beratendes Mitglied, ehrenamtlich<br/><br/>	Stiftung Katholischer Deutscher Frauenbund, Köln, <br/>	Vorsitzende des Stiftungsvorstandes, ehrenamtlich<br/><br/>	Zentralkomitee der deutschen Katholiken (ZdK), Bonn, <br/>	Mitglied der Vollversammlung und der Gemeinsamen Konferenz,<br/>	ehrenamtlich', '1982/87 Studium der Tiermedizin an der Tierärztl. Hochschule Hannover (TiHo), 1990 Promotion. 1989/97 wissenschaftl. Mitarbeiterin im Anatomischen Institut, Rektorassistentin, Leiterin der Pressestelle der TiHo. Seit 2011 Präsidentin des Kath. Deutschen Frauenbundes (KDFB), seit 2011 Mitgl. Zentralkomitee der deutschen Katholiken. Seit 1980 Mitgl. der JU, seit 1991 Mitgl. der CDU, seit Nov. 2007 Vors. CDU-Bezirksverband Hannover, seit Sept. 2006 stellv. Landesvors. der CDU in Niedersachsen. - MdB seit Okt. 2002; in der 17. WP Beauftragte für Kirchen und Religionsgemeinschaften der CDU/CSU-Fraktion; in der 17. WP Vorsitzende 1. Untersuchungsausschuss (Gorleben); seit Dez. 2013 Parl. Staatssekretärin beim Bundesminister für Ernährung und Landwirtschaft.', 'Maria', '11003527');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07214, NULL, NULL, NULL, 'Dipl.-Kaufmann,  Wirtschaftsberater', 'verheiratet, 3 Kinder', '08.01.1952', NULL, 'Wipperfürth', 'männlich', NULL, '17.10.2002', 'Flosbach', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Selbständiger Wirtschaftsberater (Finanzdienstleistungen), Waldbröl<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn, <br/>	Mitglied des Verwaltungsrates<br/>	<br/>Kreditanstalt für Wiederaufbau (KfW), Frankfurt/Main, <br/>	Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Stiftung Lichtbrücke für soziale Entwicklung und Frieden, Engelskirchen, <br/>	Mitglied des Kuratoriums, ehrenamtlich', 'Abitur am Engelbert-von-Berg Gymnasium Wipperfürth. Betriebswirtschaftsstudium an der Univ. Köln, 1979 Diplom-Kaufmann. 1979/92 Angestellter in Finanzunternehmen, seit 1992 selbstständiger Wirtschaftsberater. 1972 Eintritt in die CDU, 1974/84 JU-Stadtverbands-, Kreis- und Bezirksvors., 1987/91 Kreisvors. der Mittelstandsvereinigung, 1989/95 Kreisschatzmeister der CDU, 1995/15 CDU-Kreisvors. Oberberg. 1979/82 Stadtrat in Wipperfürth, 1994 und 1999/10 Mitgl. Oberbergischer Kreistag, dort 1999/02 CDU-Fraktionsvors. 1999/02 Mitgl. der Landschaftsversammlung Rheinland. Englisch (f), Französisch (f). - MdB seit Okt. 2002; seit 2006 Vors. deutsch-kanadische Parlamentariergruppe; 2009/11 stellv. Vors. Finanzausschuss; 2011/14 finanzpolitischer Sprecher der CDU/CSU-Fraktion, seit 2014 Vors. parl. Finanzmarktgremium (Soffin).', 'Klaus-Peter', '11003528');
