INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07223, NULL, 'Dr.', 'Dr.', 'Unternehmer', 'verheiratet, 2 Kinder', '06.02.1949', NULL, 'Koblenz', 'männlich', NULL, '17.10.2002', 'Fuchs', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>AGA Norddeutscher Unternehmerverband Großhandel-Außenhandel-Dienstleistung e.V., Hamburg,<br/>Vortrag, 2013, Stufe 3 (Jahreshauptversammlung, ?Deutschland nach der Wahl?)<br/><br/>Beratungs- und Vermittlungsbüro für Gastvorträge Wolfgang Bohun, Hohenstein-Ernstthal,<br/>Vortrag, 2014, Stufe 2 (?Große Koalition - gut für Deutschland?, Investors Workshop der Evangelischen Darlehensgenossenschaft eG, Kiel)<br/><br/>Financial Experts Association e.V., Hamburg,<br/>Vortrag, 2013, Stufe 1 (Jahreshauptversammlung, ?Deutschland vor der Wahl?)<br/>Vortrag, 2014, Stufe 2 (Jahreshauptversammlung, ?Deutschland- und der Euro?)<br/><br/>Hakluyt & Company, London,<br/>Vortrag, 2013, Stufe 2 (German Energy Policy)<br/>Vortrag, 2014, Stufe 2 (Euroentwicklung auf dem Finanzmarkt)<br/>Vortrag, 2014, Stufe 2 (German Energy Strategy)<br/>Vortrag, 2014, Stufe 4 (Jahresberatungen zur Energie-, Finanz- und Wirtschaftspolitik)<br/>Vortrag, 2015, Stufe 2 (The Euro & the Greek crisis)<br/>Vortrag, 2015, Stufe 2 (Financing of Greece´s national debt with IMF)<br/>Vortrag, 2015, Stufe 3 (Grexit & Brexit)<br/>Vortrag, 2015, Stufe 3 (Refugees in Europe)<br/>Vortrag, 2015, Stufe 2 (German Energy Policy & Europe)<br/>Vortrag, 2016, Stufe 2 (Brexit - bigger risk for Europe or the UK?)<br/>Vortrag, 2016, Stufe 2 (The renewable energy - solution for the future?)<br/>Vortrag, 2016, Stufe 2 (Banking passport - a risk for the UK?)<br/>Vortrag, 2016, Stufe 3 (European integration at risk)<br/>Vortrag, 2016, Stufe 2 (Brexit - the risks for UK and Europe)<br/><br/>Hermes Germany GmbH, Hamburg,<br/>Vortrag, 2016, Stufe 2 (Go digital, go international)<br/><br/>Internationaler Wirtschaftssenat e.V., Berlin,<br/>Beratung, 2014, Stufe 2<br/><br/>juris GmbH, Saarbrücken,<br/>Vortrag, 2015, Stufe 2 (Aktuelle Wirtschafts- und Energiepolitik)<br/><br/>Kerkhoff Group GmbH, Düsseldorf,<br/>Vortrag, 2015, Stufe 2 (Ist der Euro noch zu retten?)<br/>Vortrag, 2015, Stufe 2 (Griechenland und die Eurokrise)<br/><br/>Funktionen in Unternehmen: <br/>IVG Immobilien AG, Bonn,<br/>Mitglied des Beirates (bis 31.08.2014)<br/><br/>Kienbaum Consultants International GmbH, Gummersbach,<br/>Mitglied des Beirates, 2014, Stufe 3<br/><br/>RHODIUS Mineralquellen und Getränke GmbH & Co. KG, Burgbrohl,<br/>Mitglied des Beirates, 2013, Stufe 3; 2014, Stufe 5; 2015, Stufe 4; 2016, Stufe 5<br/><br/>Schmiedewerke Gröditz GmbH, Gröditz,<br/>Vorsitzender des Aufsichtsrates, 2014, Stufe 3; 2015, Stufe 3; 2016, Stufe 3<br/><br/>Triton Beteiligungsberatung GmbH, Frankfurt/Main,<br/>Mitglied des Beirates (bis 31.12.2016), 2013, Stufe 3; 2014, Stufe 4; 2015, Stufe 4; 2016, Stufe 3<br/><br/>Verlag für die Deutsche Wirtschaft AG, Bonn,<br/>Mitglied des Aufsichtsrates, 2014, Stufe 5; 2015, Stufe 5; 2016, Stufe 5<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		Bundesministerium für Wirtschaft und Energie, Berlin,<br/>Mitglied der Kommission zur Überprüfung der Finanzierung des Kernenergieausstiegs (KFK)<br/><br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen, Bonn,<br/>Stellv. Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband des Deutschen Groß- und Außenhandels e.V. (BGA), Berlin,<br/>Ehrenpräsident, ehrenamtlich<br/><br/>Deutsch-Aserbaidschanisches Forum e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Deutsche Außenhandelskammer, Hong Kong,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>ifo Institut für Wirtschaftsforschung e.V., München,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Ludwig-Erhard-Stiftung e.V., Bonn,<br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Rhein-Museum Koblenz e.V., Koblenz,<br/>Vorsitzender des Vorstandes, ehrenamtlich (bis 31.12.2015)<br/><br/>Taiwan-Ausschuss der Deutschen Wirtschaft, Berlin,<br/>Vorsitzender, ehrenamtlich (bis 31.08.2015)<br/><br/>Trilaterale Kommission, Paris, Berlin,<br/>Mitglied des Vorstandes, Stellv. Vorsitzender der European Group, Vorsitzender der Deutschen Gruppe der Trilateralen Kommission e.V., ehrenamtlich<br/><br/>Wirtschaftsrat der CDU e.V., Berlin,<br/>Mitglied des Präsidiums, ehrenamtlich (bis 31.07.2015)<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>		Fuchs-Immobilienverwaltungs-GmbH, Koblenz<br/><br/>Grundstückverwaltungs- und Beratungs-GmbH & Co KG, Koblenz<br/><br/>MK Immobilienverwaltungs-GmbH, Koblenz', '1967 Abitur. 1969/73 Pharmaziestudium, 1973 Approbation zum Apotheker, 1976 Promotion in Biochemie zum Dr. rer. nat. 1980 Gründung der Firma Impex Electronic. 1986 Vors. Arbeitgeberverband Großhandel Rheinland-Pfalz und Vors. Landesverband Groß- und Außenhandel Rheinland-Pfalz. 1987 Bundesvors. Bundesverband Junger Unternehmer, 1992 Präsidiumsmitgl. BDA, 1992/01 Präs. BGA, heute Ehrenvors. 1992 Vizepräs. FEWITA, Committee Member der German Chamber of Commerce, Hong Kong, 1995 Vorstandsmitgl. Asien-Pazifikausschuss und 1997 Vors. des Taiwan-Ausschusses der Deutschen Wirtschaft. 1999/01 Gründungspräsident Bundesvereinigung Deutscher Handelsverbände. Jan. 2001 Vors. Deutsche Gruppe der Trilateralen Kommission und Mai 2010 Vize-Vors. der Europäischen Gruppe der Trilateralen Kommission. Seit 2006 Mitgl. CDU-Bundesvorstand. Englisch (f), Französisch (f), Italienisch (f).- MdB seit Okt. 2002; Nov. 2006/Nov. 2011 Vors. des Parlamentskreises Mittelstand, seit Nov. 2011 PKM-Ehrenvors. und seit Nov. 2009 stellv. Vors. der CDU/CSU-Fraktion für Wirtschaft, Mittelstand, Tourismus und Petitionen, seit Jan. 2014 für Wirtschaft und Energie, Mittelstand, Tourismus.', 'Michael', '11003531');
