INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07234, NULL, NULL, NULL, 'Kaufmann', 'verheiratet, 3 Kinder', '21.07.1951', NULL, 'Künzelsau', 'männlich', NULL, '17.10.2002', 'Gienger', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	BoeselGienger GbR, Heidenrod,<br/>Geschäftsführer<br/><br/>Eberhard Gienger Pro-Motion GmbH, Heidenrod,<br/>Geschäftsführer<br/><br/>Funktionen in Unternehmen: <br/>	Internationales Wirtschaftsforum Baden-Baden GmbH, Baden-Baden,<br/>Mitglied des Kuratoriums<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	FernUniversität in Hagen, Hagen,<br/>Mitglied des Parlamentarischen Beirates (bis 12.05.2016)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesliga-Stiftung, Frankfurt/Main,<br/>Mitglied des Kuratoriums<br/><br/>Deutsche Kinderturnstiftung, Frankfurt/Main,<br/>Mitglied des Kuratoriums<br/><br/>"Freundeskreis Turnen" in der STB-Stiftung des Schwäbischen Turnerbundes e.V., Stuttgart,<br/>Vorsitzender<br/><br/>Heinz Ziehl-Stiftung, Künzelsau,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Oesophagus-Stiftung für Kinder mit Speiseröhrenfehlbildung, Stuttgart,<br/>Mitglied des Beirates<br/><br/>Salto Beirat, Frankfurt/Main,<br/>Mitglied des Kuratoriums (bis September 2015)<br/><br/>Stiftung Deutsche Sporthilfe (DSH), Frankfurt/Main,<br/>Mitglied des Kuratoriums<br/><br/>Stiftung Sporthilfe Hessen, Frankfurt/Main,<br/>Mitglied des Kuratoriums<br/><br/>Wir sind Stuttgart 21 e.V., Stuttgart,<br/>Mitglied des Beirates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Dropit OHG, Heidenrod', '1970 Abitur Freiherr-vom-Stein Schule Frankfurt/Main. 1971/75 Studium Diplomsportlehrer, 1975/81 Studium Russisch und Englisch Johannes Guttenberg-Univ. Mainz. Geschäftsführer der Eberhard Gienger Pro-Motion GmbH und BoeselGienger GbR Heidenrod. Seit Okt. 2001 Mitgl. der CDU, seit 1996 Mitgl. des AK Leistungssport der CDU, seit 2001 Mitgl. CDU-Kreisvorst. Ludwigsburg; Mitgl. Europa Union Deutschland e. V. 1984/92 Sekretär Technisches Komitees FIG Internationaler Turnerbund, 1986/06 Mitgl. Nationales Olympisches Komitee für Deutschland (NOK), 1988/2000 Vors. Technischen Komitee, bis 2006 Vizepräs. für den Olympischen Spitzensport Deutscher Turner-Bund (DTB), 2006/10 Vizepräs. für Leistungssport Deutscher Olympischer Sportbund (DOSB), bis 2010 Mitgl. Vorstand und Aufsichtsrat Stiftung Deutsche Sporthilfe, bis 2010 Mitgl. Aufsichtsrat Bewerbungsgesellschaft Olympia München 2018 GmbH, bisOkt. 2015 Mitgl. Salto-Beirat DOSB, bis Mai 2016 Mitgl. Parl. Beirat FernUniversität Hagen. Vors. Sportgemeinschaft Deutscher Bundestag e. V. und "Freundeskreis Turnen" STB-Stiftung Schwäbischer Turnerbund e. V. (STB); Mitgl. Kuratorium Bundesliga-Stiftung, Kinderturnstiftung DTB, Heinz Ziehl-Stiftung, Stiftung Deutsche Sporthilfe, Stiftung Sporthilfe Hessen und Internationales Wirtschaftsforum Baden-Baden GmbH; Mitgl. Beirat Wir sind Stuttgart 21 e. V. und Oesophagus-Stiftung für Kinder mit Speiseröhrenmissbildung Englisch (f), Russisch (f), Französisch (G). - MdB seit Okt. 2002; seit Jan. 2014 Vors. der Arbeitsgruppe Sport und Ehrenamt und sportpol. Sprecher der CDU/CSU-Fraktion.', 'Eberhard', '11003534');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07237, NULL, NULL, NULL, 'Jurist', 'keine Angaben', '19.07.1961', NULL, 'Morlautern / Pfalz', 'männlich', NULL, '17.10.2002', 'Göbel', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Ralf', '11003535');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07239, NULL, NULL, NULL, 'Rechtsanwältin', 'keine Angaben', '23.07.1969', NULL, 'Sigmaringen', 'weiblich', NULL, '17.10.2002', 'Gönner', NULL, 'CDU', NULL, 'katholisch', NULL, NULL, NULL, 'Tanja', '11003536');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07244, NULL, NULL, NULL, 'Dipl.-Forstingenieur (FH)', 'verheiratet, 4 Kinder', '16.08.1950', NULL, 'Rauenzell / Landkreis Ansbach', 'männlich', NULL, '17.10.2002', 'Göppel', NULL, 'CSU', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>Holz von Hier gemeinnützige GmbH, Bayreuth,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Regionalstrom Franken eG, Geslau,<br/>Vorsitzender des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bayerischer Naturschutzfonds, München, <br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Bundesverband Erneuerbare Energie e.V., Paderborn,<br/>Vorsitzender des Parlamentarischen Beirates, ehrenamtlich (bis 28.01.2014)<br/><br/>Deutsche Unternehmensinitiative für Energieeffizienz e.V. - DENEFF, Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Deutscher Verband für Landschaftspflege e.V., Ansbach,<br/>Vorsitzender, ehrenamtlich<br/><br/>Forum Ökologisch-Soziale Marktwirtschaft e.V. (FÖS), Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Stiftung Deutsche Landschaften, Ansbach,<br/>Mitglied des Vorstandes<br/><br/>Stiftung Nachwachsende Rohstoffe, Straubing,<br/>Mitglied des Stiftungsrates, ehrenamtlich', '1956 Volksschule, 1962 Realschule. 1966/72 Berufsausbildung zum Diplom-Forstingenieur (FH). 1972/94 Förster im Außendienst. 1972/04 Mitgl. Stadtrat in Herrieden, 1974/94 Mitgl. Bezirkstag Mittelfranken, seit 1996 Mitgl. Kreistag Ansbach, 1994/02 MdL Bayern, Direktabgeordneter Stimmkreis Ansbach-Süd. Seit 1991 Vors. Arbeitskreis Umwelt und Landesentwicklung der CSU. 1970 Beitritt zum Bund Naturschutz Bayern, 1986 Gründung des Landschaftspflegeverbandes Mittelfranken, 1993 Gründung des Deutschen Verbandes für Landschaftspflege, 1998 2. Vors. Förderverein "Offene Behinderungsarbeit Ansbach-Süd", 1999 Beitritt zu Eurosolar, 2005 Gründung des Netzwerks Erneuerbare Energien in der Region Westmittelfranken, 2006 Gründung des Zukunftssalons Umwelt, 2012 Mitbegründer Bundesprojekt Bürgerenergie, 2014 Initiierung der Genossenschaft Regionalstrom Franken eG, einer regionalen Stromvermarktung im Raum Nürnberg (Dezentrale Stromerzeuger erhalten nach dem Ende der EEG-Vergütung einen verlässlichen Absatzmarkt). Seit 2011 Mitgl. Parl. Beirat der Dt. Unternehmensinitiative Energieeffizienz (DENEFF e. V.). Seit 2007 Mitgl. der Deutschen Afrika Stiftung e. V. 2010 Adam-Smith-Preis für marktwirtsch. Umweltpolitik. Englisch (f), Französisch (G). - MdB seit Okt. 2002.', 'Josef', '11003537');
