INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07249, NULL, NULL, NULL, 'Fernsehjournalist', 'verheiratet, 2 Kinder', '19.09.1961', NULL, 'Hamburg', 'männlich', NULL, '17.10.2002', 'Grindel', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Reinhard', '11003539');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07253, NULL, NULL, NULL, 'Fremdsprachensekretärin', 'geschieden, 2 Kinder', '19.09.1955', NULL, 'Essen', 'weiblich', NULL, '17.10.2002', 'Groneberg', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>		Sozialdemokratische Partei Deutschlands (SPD) Bezirk Weser-Ems, Oldenburg,<br/>Leiterin der SPD-Regionalstelle Oldenburg<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Deutsch-Jordanische Gesellschaft e.V., Hannover,<br/>Vizepräsidentin, ehrenamtlich<br/><br/>Deutsche Afrika Stiftung e.V., Berlin,<br/>Vizepräsidentin, ehrenamtlich<br/><br/>EMA Euro-Mediterran-Arabischer Länderverein, Hamburg,<br/>Vizepräsidentin, ehrenamtlich<br/><br/>Europaverband der Selbständigen - Deutschland e.V. (ESD), Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Institut Privater Bauherren e.V., Berlin,<br/>Mitglied des Politisch-Parlamentarischen Beirates, ehrenamtlich<br/><br/>Marie-Schlei-Verein e.V., Hamburg,<br/>Vorsitzende des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Datenschutz, Leipzig,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Wirtschaftsverband Brandschutz e.V., Berlin,<br/>Mitglied des Politisch-Parlamentarischen Beirates, ehrenamtlich', 'Handelsschule, mittlere Reife. 11 Jahre Fremdsprachensekretärin im Ausland. Acht Jahre Mitarbeiterin des MdB Günter Graf in Cloppenburg, 1994/96 Leiterin der SPD-Geschäftsstelle Cloppenburg/Vechta des SPD-Bezirks Weser-Ems, 2010/12 Leiterin der Regionalgeschäftsstelle Oldenburg. Seit 1988 Mitgl. der SPD; 1991/01 Ratsfrau der Stadt Cloppenburg, 1991/96 stellv. Fraktionsvors. der SPD im Stadtrat Cloppenburg, 1996/01 Vors. der Gruppe SPD-BÜNDNIS 90/DIE GRÜNEN-UWG im Stadtrat Cloppenburg; 1996/06 Mitgl. im Kreistag des Landkreises Cloppenburg, 1996/03 Fraktionsvors. der SPD im Kreistag Cloppenburg; 2003/10 Mitgl. der SGK auf Bundesebene, 2006/10 stellv. Bundesvors. der SGK; 2006/10 Mitgl. im Stadtrat Cloppenburg, in der 13. und 14. WP Mitgl. des Landtages Niedersachsen. Mitgl. Förderverein inhaftierte Frauen Vechta,  Kreisverkehrswacht Cloppenburg, Kinderschutzbund, Malteser Hilfsdienst, Parl. Vereinigung Niedersachsen e. V., AWO und REUNION e.V. Ehrenamtl. Vizepräs. Deutsche Afrika Stiftung e. V., Mitgl. Pol.-Parl. Beirat Brandschutz e. V., Mitgl. Pol.-Parl. Beirat Institut privater Bauherren e. V. Mitgl. Parl. Beirat Europaverband der Selbstständigen (ESD) e. V., ehrenamtl. Vizepräsidentin Dt.-Jordanische Gesellschaft e. V., Vors. Kuratorium Marie-Schlei-Verein e. V. (e), Vizepräs. EMA Euro-Mediterran-Arabischer Länderverein (e). - MdB 2002/09, 2012/13 und seit Feb. 2014; stellv. Vors. PG Arab.-sprachige Staaten des Nahen Ostens, Mitgl. PG östliches Afrika und PG Maghreb-Staaten.<br/><br/>eingetreten am 11.2.14 für Abg. Edathy', 'Gabriele', '11003540');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07256, NULL, NULL, NULL, 'Rechtsanwalt und Notar a. D.', 'verheiratet, 2 Kinder', '12.10.1960', NULL, 'Oberhausen', 'männlich', NULL, '17.10.2002', 'Grosse-Brömer', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Barmenia Allgemeine Versicherungs-AG, Wuppertal,<br/>Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung Naturschutzpark Lüneburger Heide, Bispingen-Niederhaverbeck,<br/>Mitglied des Stiftungsrates, ehrenamtlich', '1980 Abitur. Wehrdienst auf Zeit beim Pionierbataillon 6 in Plön/Holstein. Studium der Rechtswissenschaften Univ. Hamburg, 1989 1. jur. Staatsprüfung, 1992 2. jur. Staatsprüfung. Seit Dez. 1992 selbstständiger Rechtsanwalt, 2001 Bestellung zum niedersächsischen Notar, seit Mai 2009 Notar a. D. 1982 Eintritt in die CDU, 1992/15 Kreisvors. der CDU Harburg-Land, seit 2003 Vors. des CDU-Bezirksverbands Nordostniedersachsen. - MdB seit Okt. 2002; Okt. 2009/Okt. 2013 Vors. der CDU-Landesgruppe Niedersachsen, März 2010/Mai 2012 Justiziar und seit Mai 2012 Erster Parl. Geschäftsführer der CDU/CSU-Fraktion; Mitgl. Ältestenrat.', 'Michael', '11003541');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07261, NULL, NULL, NULL, 'Notar a. D., Parl. Staatssekretär', 'verheiratet', '15.10.1959', NULL, 'Esslingen am Neckar', 'männlich', NULL, '17.10.2002', 'Grübel', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Esslingen live - Kultur und Kongress GmbH, Esslingen am Neckar, <br/>Mitglied der Gesellschafterversammlung (bis 23.12.2013)<br/><br/>Life Science Fonds Esslingen GmbH & Co. KG, Esslingen am Neckar, <br/>Mitglied des Beirates (bis 23.12.2013)<br/><br/>Robert Bosch Stiftung GmbH, Stuttgart, <br/>Mitglied des Beirates und des Modellprogramms "Engagement braucht Leadership" (bis 23.12.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bürgerstiftung Esslinger Sozialwerk, Esslingen, <br/>Mitglied des Kuratoriums, ehrenamtlich (bis 17.02.2014)<br/><br/>Diözese Rottenburg-Stuttgart, Rottenburg, <br/>Vorsitzender der Kommission sexueller Missbrauch, ehrenamtlich (bis 08.01.2014)<br/><br/>Katholisches Militärbischofsamt, Berlin, <br/>Missbrauchsbeauftragter für die Katholische Militärseelsorge, ehrenamtlich (bis 31.01.2014)<br/><br/>Stadt Esslingen am Neckar, Esslingen am Neckar, <br/>Mitglied des Gemeinderates, ehrenamtlich (bis 17.02.2014)<br/><br/>Stiftung Bundespräsident -Theodor-Heuss-Haus, Stuttgart, <br/>Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Blasmusikverband Esslingen e.V., Holzmaden, <br/>Präsident, ehrenamtlich<br/><br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Caritasverband der Diözese Rottenburg-Stuttgart e.V., Stuttgart, <br/>Mitglied des Caritasrates, ehrenamtlich (bis 08.01.2014)<br/><br/>Freundeskreis der historischen Bürgerwehren, Bürgermilizen und<br/>Stadtgarden in Baden-Württemberg, Stuttgart, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Freundeskreis Fregatte Baden-Württemberg e.V., Esslingen, <br/>Vorsitzender, ehrenamtlich<br/><br/>Katholische Arbeitsgemeinschaft für Soldatenbetreuung e.V., Bonn, <br/>Vorsitzender des Vorstandes, ehrenamtlich (bis 06.05.2014)<br/><br/>Katholische Familienstiftung für Soldaten, Bonn, <br/>Mitglied des Stiftungsrates, ehrenamtlich', '1978 Abitur. Wehrdienst Luftwaffe, Reserveoffizier Marine. 1979/84 Ausbildung zum Notar, Studium an der Notarakademie Baden-Württemberg. 1985/90 Notarvertreter, 1990 Fachberater bei Liegenschaftsämtern in Sachsen, 1991 Leiter Grundbuchamt Dresden. 1992/94 Referent im Sächsischen Staatsministerium der Justiz. Notar in Stuttgart z. Zt. ruhend. 1989/14 Stadtrat in Esslingen, 1994/02 Vors. der CDU-Fraktion; 1999/02 Kreisrat Landkreis Esslingen. Mitgl. Kolpingwerk; seit 2006 Präs. Blasmusikverband Esslingen; 2007/14 Vorstandsvors. der Kath. Arbeitsgemeinschaft für Soldatenbetreuung, 2011/14 Vors. unabhängige Kommission sexueller Missbrauch der Diözese Rottenburg-Stuttgart. Englisch (G), Französisch (G). - MdB seit Okt. 2002; seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin der Verteidigung.', 'Markus', '11003542');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07265, 'Frhr.', NULL, NULL, 'MdB', 'verheiratet, 2 Kinder', '05.12.1971', NULL, 'München', 'männlich', NULL, '24.02.2011', 'Guttenberg', NULL, 'CSU', 'zu', 'römisch-katholisch', NULL, NULL, NULL, 'Karl-Theodor', '11003543');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07270, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 1 Kind', '14.10.1970', NULL, 'Karlsruhe', 'männlich', NULL, '17.10.2002', 'Gutting', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>		Gutting Steuerberater und Rechtsanwälte GbR, Oberhausen-Rheinhausen,<br/>Rechtsanwalt, 2012, Stufe 3, Gewinn (Nachtrag zur 17. Wahlperiode);<br/>2013, Stufe 8, Gewinn<br/><br/>Funktionen in Unternehmen: <br/>		HandwerkMedia AG, Ubstadt-Weiher,<br/>Mitglied des Aufsichtsrates (bis 31.12.2015)<br/><br/>Volksbank-Bruhrain-Kraich-Hardt eG, Oberhausen-Rheinhausen,<br/>Vorsitzender des Aufsichtsrates<br/><br/>Wirsol Solar AG, Waghäusel,<br/>Vorsitzender des Aufsichtsrates (bis 30.04.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn,<br/>Vertrauensmann bei der Wüstenrot Bausparkasse AG<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Institut Mittelstand & Compliance e.V., Pforzheim,<br/>Mitglied des Vorstandes<br/><br/>Verband der Sparda-Banken e.V., Frankfurt/Main,<br/>Mitglied des Beirates<br/><br/>Weltliga für Freiheit und Demokratie - Deutschland e.V., Berlin,<br/>Stellv. Vorsitzender<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>		Brunnen Restaurant UG (haftungsbeschränkt), Oberhausen-Rheinhausen (bis 31.07.2014)<br/><br/>Gutting Steuerberater und Rechtsanwälte GbR, Oberhausen-Rheinhausen', '1990 Abitur am Copernikus-Gymnasium Philippsburg. 1990/92 Studium der Rechtswissenschaften an der Univ. Mannheim, 1992/93 des Internationalen Rechts und Soziologie Stetson University, USA, 1993/97 der Rechtswissenschaften Univ. Heidelberg, 1997 1. jur. Staatsexamen, 1997/99 Referendariat am Landgericht Leipzig, 1999 2. jur. Staatsexamen. 2000 Rechtsanwalt Kanzlei Ritterhaus, Mannheim, seit 2001 Rechtsanwalt und Sozius in der Kanzlei Gutting, Steuerberater und Rechtsanwälte, Oberhausen-Rheinhausen. Mitgl. der JU seit 1987, Mitgl. der CDU seit 2001. Stellv. Vors. Institut Mittelstand und Compliance e. V., stellv. Vors. der Weltliga für Freiheit und Demokratie. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2002; Mitgl. im Vorstand der CDU/CSU-Fraktion.', 'Olav', '11003544');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07273, NULL, NULL, NULL, 'Goldschmiedin', 'geschieden, 3 Kinder', '26.12.1955', NULL, 'Kiel', 'weiblich', NULL, '17.10.2002', 'Hagedorn', NULL, 'SPD', NULL, 'konfessionslos', NULL, 'Funktionen in Unternehmen: <br/>Verkehrsinfrastrukturfinanzierungsgesellschaft mbH (VIFG), Berlin,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeszentrale für politische Bildung, Bonn, <br/>Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Anny-Trapp-Verein e.V., Eutin,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Deutsches Kinderhilfswerk e.V., Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich', '1974 Abitur am Preetzer Gymnasium. Studium Sonderschulpädagogik und Biologie Univ. Hamburg bis 1976. 1976/80 Goldschmiedelehre mit Gesellenbrief in Plön. 1983 Eintritt in die SPD, 1993/03 stellv. Kreisvors. SPD Ostholstein, seit 2003 Mitglied im SPD-Landesvorst. Schleswig-Holstein, seit März 2007 als stellv. Landesvors., Mitgl. Umweltforum. 1984/2003 Arbeit in der Kommunalpolitik, 1990/97 Fraktionsvors., 1994/97 stellv. Bürgermeisterin, 1997/2003 ehrenamtl. Bürgermeisterin, 2001/03 ehrenamtliche Amtsvorsteherin Amt Schönwalde. 2005/10 Kuratoriumsmitgl. und seit 2010 stellv. Mitgl. der Bundeszentrale für politische Bildung.Seit 2005 Mitgl. Vertrauensgremium, seit 2013/2014 Mitgl. Vorst. des Deutschen Kinderhilfswerks. Englisch (f). - MdB seit Okt. 2002; seit 2009 stellv. Sprecherin der SPD im Haushaltsausschuss und Sprecherin im Rechnungsprüfungsausschuss, seit 2014 Vors. Rechnungsprüfungsausschuss, seit 2005 stellv. Sprecherin AG Kommunalpolitik der SPD-Fraktion, seit 2008 stellv. Mitgl. Ostseeparlamentarierkonferenz.', 'Bettina', '11003545');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07277, NULL, NULL, NULL, 'Angestellter', 'verheiratet', '25.09.1971', NULL, 'Usingen', 'männlich', NULL, '17.10.2002', 'Haibach', NULL, 'CDU', NULL, 'evangelisch', NULL, NULL, NULL, 'Holger', '11003546');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07278, NULL, NULL, NULL, 'Dipl.-Psychologin', 'ohne Angaben', '08.06.1963', NULL, 'Duisburg', 'weiblich', NULL, '17.10.2002', 'Hajduk', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Mitglied der Hamburgischen Bürgerschaft, Hamburg<br/><br/>Funktionen in Unternehmen: <br/>		Bewerbungsgesellschaft Hamburg 2024 GmbH, Hamburg,<br/>Mitglied des Aufsichtsrates (bis Februar 2016)<br/><br/>mdex AG, Tangstedt,<br/>Mitglied des Aufsichtsrates (bis Juli 2015), jährlich, Stufe 3<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		World Vision Deutschland e.V., Friedrichsdorf,<br/>Mitglied des Kuratoriums', '1982 Abitur in Duisburg-Homberg. 1982/88 Studium der Psychologie in Düsseldorf und Hamburg. 1989/97 angestellte Psychologin im interkulturellen Jugendaustausch. Seit 1995 Mitglied von Bündnis 90/Die Grünen, 2000/01 Beisitzerin im Landesvorst. GAL Hamburg, 2002/08 Landesvors. 1997/02 Mitgl. der Hamburgischen Bürgerschaft, Parl. Geschäftsführerin der GAL-Fraktion, haushalts- und kulturpolitische Sprecherin; 2011/13 Mitgl. der Hamburgischen Bürgerschaft, stellv. Vors. der Fraktion Bündnis 90/Die Grünen, haushaltspol. Sprecherin. 2008/10 Senatorin für Stadtentwicklung und Umwelt der Freien und Hansestadt Hamburg. Englisch (f), Französisch (G). - MdB 2002/08 und seit Okt. 2013; 2002/04 stellv. Vors. Haushaltsausschuss, 2004/08 haushaltpolitische Sprecherin der Fraktion Bündnis 90/DIE GRÜNEN, 2007/08 stellv. Mitgl. Kommission zur Modernisierung der Bund-Länder-Finanzbeziehungen (Föderalismuskommission II); seit Okt. 2013 Parl. Geschäftsführerin der Fraktion BÜNDNIS 90/DIE GRÜNEN.', 'Anja', '11003547');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07279, NULL, 'Dr.', NULL, 'Dipl.-Kaufmann', 'verheiratet, 2 Kinder', '21.05.1972', NULL, 'Essen', 'männlich', NULL, '01.01.2007', 'Hartmann', '(Homburg)', 'FDP', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Christoph', '11003548');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07282, NULL, NULL, NULL, 'Regierungsangestellter', 'ledig', '11.05.1963', NULL, 'Pirmasens', 'männlich', NULL, '17.10.2002', 'Hartmann', '(Wackernheim)', 'SPD', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Institut für Deutsches und Internationales Parteienrecht und Parteienforschung<br/>an der Heinrich-Heine-Universität Düsseldorf, Düsseldorf,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Landkreis Mainz-Bingen, Mainz,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Baseball und Softball Verband e.V., Mainz,<br/>Präsident, ehrenamtlich (bis Juli 2014)<br/><br/>Förderkreis Rheinland-Pfälzischer Multiple-Sklerose-Kranker e.V., Mainz,<br/>Vorsitzender, ehrenamtlich<br/><br/>MAGENZA-Stiftung für Jüdisches Leben in Mainz, Mainz,<br/>Stellv. Vorsitzender des Verwaltungsrates, ehrenamtlich<br/><br/>Stiftung Hoher Dom zu Mainz, Mainz,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Trägerverein Netzwerk Berlin e.V., Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Zentralkomitee der deutschen Katholiken (ZdK), Bonn,<br/>Mitglied des Arbeitskreises Politische Grundfragen, ehrenamtlich', '1982 Abitur am Neusprachl. Gymnasium Pirmasens. Danach Studium Politikwiss., Soziologie und deutschen Volkskunde Johannes-Gutenberg-Univ. Mainz, Stipendiat der Friedrich-Ebert-Stiftung. 1995/99 Referent beim SPD-Landesverb., dort u. a. zuständig für die Betreuung der Untergliederungen und Kommissionen und Beratung bei Kommunal- und Urwahlen. 1999/02 Sprecher des rheinland-pfälzischen Innenministers Walter Zuber. 1983 Eintritt in die SPD; bei den Jungsozialisten an der Joh.-Gutenberg-Univ. und im Bezirk Rheinhessen in unterschiedl. Funktionen aktiv. 1988/93 Vors. SPD-Ortsverein Wackernheim, Vors. SPD-Verb. Heidesheim, versch. Ämter im SPD-Unterbez. Mainz-Bingen, 1999/2014 Vors., 1996/05 Vors. der SGK im Landkreis Mainz-Bingen; seit 2004 Mitgl. des Vorst. und des Präs. der SPD Rheinland-Pfalz. Fraktionsvors. der SPD im Verbandsgemeinderat Heidesheim bis 1994, 1. Beigeordneter der Ortsgemeinde Wackernheim 1994/99, dann 1999/04 Fraktionsvors. im dortigen Gemeinderat und 2004/12 Mitgl. des Gemeinderates. Mitgl. Kreistag seit 1999. Seit 2005 Mitgl. AK Politische Grundfragen des ZdK. 2009/15 Vors. Förderkreis MS-Kranke in Rheinland-Pfalz. Mitgl. in zahlr. Vereinen und der AWO; 2007/14 Präsident Dt. Baseball und Softball Verband e. V. - MdB seit Okt. 2002; in der 16. WP stellv. innenpol. Sprecher der SPD-Fraktion und Obmann im 1. Untersuchungsausschuss der 16. WP; in der 17. WP bis Okt. 2011 Obmann im Ausschuss für Wahlprüfung, Immunität und Geschäftsordnung, Okt. 2011/Juli 2014 innenpol. Sprecher der SPD-Fraktion; Mitgl. PKGr, stellv. Mitgl. G 10-Kommission bis Juli 2014.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 202 (Kreuznach)', 'Michael', '11003549');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07284, NULL, NULL, NULL, 'Dipl.-Ingenieurin (FH) Lebensmittelkonservierer', 'verheiratet, 2 Kinder', '15.06.1951', NULL, 'Großengottern / Thüringen', 'weiblich', NULL, '17.10.2002', 'Heller', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Kreisverwaltung des Landkreises Mansfeld-Südharz, Sangerhausen,<br/>Projektleiterin des Bundesprojekts "Perspektive Berufsabschluss"', 'Ausbildung in der Lebensmittelindustrie. Studium der Lebensmitteltechnologie. 1974/76 TKO-Leiterin Thüringer Konservenfabrik. 1976/85 Lebensmittelkontrolleur der Hygieneinspektion Kreis Sangerhausen. 1987 Eintritt in die CDU, 1992/07 Vors. Kreistag Sangerhausen, 1991 Gründungsmitgl. der MIT im Landkreis Sangerhausen, 1998/10 stellv. Landesvors. der CDU Sachsen-Anhalt, Präsidialmitgl. des Landkreistages Sachsen-Anhalt, Mitgl. im Kulturausschusses des Deutschen Landkreistages, 2010/13 Projektleiterin des Bundesprojekts "Perspektive Berufsabschluss" im Landkreis Mansfeld-Südharz. 1994/98 Mitgl. im Kongress der Gemeinden und Regionen des Europarates. 2010 Bundesverdienstkreuz. - MdB 2002/09 und seit Okt. 2013; 2005/09 Vors. der CDU-Landesgruppe Sachsen-Anhalt.', 'Uda', '11003550');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07289, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 2 Kinder', '14.01.1965', NULL, 'Balingen', 'männlich', NULL, '17.10.2002', 'Hennrich', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	AMGEN GmbH, München,<br/>Vortrag, 2015, Stufe 1 (Der Wert von innovativen Medikamenten, GLOBAL Value, Access & Policy Summit 2015)<br/><br/>Bayer Vital GmbH, Leverkusen,<br/>Vortrag 1, 2013, Stufe 1 (Pharma Strategieworkshop)<br/>Vortrag 2, 2014, Stufe 1 (Das AMINOG als lernendes System - Bestandsaufnahme und mögliche politische Korrekturen, 19. Bad-Orber Gespräche)<br/><br/>ConEvent GmbH, Hamburg,<br/>Diskussionsrunde, 2014, Stufe 1 (Interaktives berufspolitisches Forum "Versorgungsengpässe und Versorgungsprozesse in der Onkologie" der Deutschen Gesellschaft für Onkologische Pharmazie e.V.)<br/><br/>MEDA Pharma GmbH & Co. KG, Bad Homburg v.d. Höhe,<br/>Vortrag, 2013, Stufe 1 (Nachtrag zur 17. Wahlperiode)<br/>Moderation, 2014, Stufe 1 (Runder Tisch - Arzneimittelversorgung)<br/><br/>Rheumatologische Fortbildungsakademie GmbH, Berlin,<br/>Vortrag, 2014, Stufe 1 (Ambulante Spezialfachärztliche Versorgung nach § 116b - Ausgestaltung der Anlage schwere Verlaufsformen rheumatischer Erkrankungen aus Sicht der Bundesregierung)<br/><br/>RS Medical Consult GmbH, Bad Mergentheim,<br/>Vortrag, 2016, Stufe 1 (10. Expertenforum - Pharma)<br/><br/>Springer Medizin Verlag GmbH, Berlin,<br/>Vortrag, 2016, Stufe 1 (Interdisziplinäre Plattform zur Nutzenbewertung)<br/><br/>Ulrich Opherk Consulting, Starnberg,<br/>Vortrag, 2013, Stufe 1 (Nachtrag zur 17. Wahlperiode)<br/><br/>Funktionen in Unternehmen: <br/>cui bono health-consulting GmbH, Berlin,<br/>Mitglied des Beirates (bis Oktober 2015)<br/><br/>Süddeutsche Krankenversicherung a.G., Fellbach,<br/>Mitglied des Aufsichtsrates, jährlich, Stufe 3<br/><br/>Süddeutsche Lebensversicherung a.G., Fellbach,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Arabische Freundschaftsgesellschaft e.V. (DAFG), Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>DUK Versorgungswerk e.V., Berlin,<br/>Mitglied des Beirates<br/><br/>Haus & Grund Württemberg e.V., Stuttgart,<br/>Landesvorsitzender, ehrenamtlich, monatlich, Stufe 1', '1985 Abitur am Robert-Bosch-Gymnasium Wendlingen. 1985/86 Wehrdienst Rommelkaserne in Dornstadt. 1986/91 Studium der Rechtswissenschaften in Passau und Bonn, Dez. 1991 1. jur. Staatsexamen, Juli 1995 2. jur. Staatsexamen. 1991/95 wissenschaftlicher Mitarbeiter von Elmar Müller MdB, 1992/93 wissenschaftlicher Mitarbeiter an der juristischen Fakultät der Univ. Rostock. Seit Sept. 1995 selbstständiger Rechtsanwalt. 1998/03 Landesgeschäftsführer des Wirtschaftsrates der CDU Baden-Württemberg. 1983 Eintritt in die JU, seit 1984 Mitgl. der CDU, 1985/87 Kreisvors. der JU Esslingen, 1992/96 stellv. Kreisvors. der KPV der CDU im Kreisverb. Esslingen. 1999/05 Vors. des Haus-, Wohnungs- und Grundeigentümervereins Kirchheim unter Teck, seit 2003 Vorstandsmitgl. und seit 2008 Vors. Haus und Grund Württemberg, seit 2008 Mitgl. Bundesvorst. Haus und Grund Deutschland. - MdB seit Okt. 2002; Mitgl. Parlamentarische Versammlung des Europarates.', 'Michael', '11003551');
