INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07303, NULL, NULL, NULL, 'Redakteurin', 'geschieden, 2 Kinder', '28.02.1953', NULL, 'Lübeck', 'weiblich', NULL, '17.10.2002', 'Hiller-Ohm', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Nordelbische Evangelisch-Lutherische Kirche (NEK), Kiel, <br/>Mitglied des Beirates des Kirchlichen Dienstes in der<br/>Arbeitswelt, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsches Seminar für Tourismus Berlin e.V. (DSFT), Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich', 'Abitur. Studium Germanistik, Geschichte und Pädagogik an der Univ. Hamburg. 1982/87 Redakteurin. 1987/02 Angestellte im öffentl. Dienst an der FH Lübeck, 1987/97 Referentin für Presse- und Öffentlichkeitsarbeit an der FH Lübeck, 1997/02 Leiterin des FH Lübeck/LEONARDO-Büros. 1983 Eintritt in die SPD, Ortsvereinsvors., Vors. ASF Lübeck. 1990/02 Mitgl. Bürgerschaft der Hansestadt Lübeck, dort 1994/99 stellv. Fraktionsvors., 1999/02 Fraktionsvors. 1995/97 Senatorin (e). 1997 Verleihung der Senatsplakette der Hansestadt Lübeck. 1999/02 Vors. AR der Lübecker Hafengesellschaft mbH. Mitgl. IG BCE. - MdB seit Okt. 2002; tourismuspolitische Sprecherin der SPD-Fraktion.', 'Gabriele', '11003556');
