Entwicklungszusammenarbeit gGmbH, Vorstand Euro-Mediterranean Association für Cooperation and Development e. V. Englisch (f). - MdB seit Okt. 2002; seit 2009 Obmann der CDU/CSU-Fraktion im Ausschuss für wirtschaftliche Zusammenarbeit und Entwicklung, Obmann der CDU/CSU-Fraktion im Unterausschuss Vereinte Nationen, Internationale Org. und Globalisierung, Vors. der AG Elbe der CDU/CSU-Fraktion, Sprecher der CDU/CSU-MdBs der PV der OSZE, stellv. Mitgl. Ostseeparlamentarierkonferenz (BSPC).', 'Jürgen', '11003565');
