INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07351, NULL, NULL, NULL, 'Dipl.-Wirtschaftsingenieur (FH)', '2 Kinder', '07.05.1975', NULL, 'Görlitz', 'männlich', NULL, '17.10.2002', 'Kretschmer', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>CDU Landesverband Sachsen, Dresden, <br/>Generalsekretär<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Görlitz, Görlitz, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates<br/><br/>Deutsch-Polnische Gesellschaft Bundesverband e.V., Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Diakoniewerk Oberlausitz e.V., Großhennersdorf,<br/>Mitglied des Verwaltungsrates (bis 17.12.2015)<br/><br/>Evangelisches Studienwerk e.V. Villigst, Schwerte,<br/>Mitglied des Kuratoriums<br/><br/>Förderverein "Fürst-Pückler-Park Bad Muskau" e.V., Bad Muskau,<br/>Vorsitzender<br/><br/>Hermann von Helmholtz-Gemeinschaft Deutscher Forschungszentren e.V., Bonn,<br/>Mitglied des Senats<br/><br/>Internationales Begegnungszentrum St. Marienthal, Ostritz,<br/>Mitglied des Kuratoriums<br/><br/>Max-Planck-Institut für Physik komplexer Systeme, Dresden,<br/>Mitglied des Kuratoriums<br/><br/>Senckenberg Gesellschaft für Naturforschung, Frankfurt/Main,<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Stiftung "Sachsen . Land der Ingenieure", Dresden,<br/>Mitglied des Kuratoriums<br/><br/>Wissenschaftsgemeinschaft Gottfried Wilhelm Leibniz e.V., Berlin,<br/>Mitglied des Senats', '1981/91 Erich-Weinert-Oberschule Görlitz-Weinhübel. Ausbildung zum Büroinformationselektroniker. 1997/98 Fachhochschulreife. 1998/02 Studium an der Hochschule für Technik und Wirtschaft Dresden (FH). 1989 Eintritt in die CDJ Christlich Demokratische Jugend, 1993/02 Mitgl. Landesvorst. der JU Sachsen und Niederschlesien, seit 2003 Mitgl. Landesvorst. CDU Sachsen, seit April 2005 Generalsekretär der CDU Sachsen. 1994/99 Stadtrat der kreisfreien Stadt Görlitz, seit 2008 Mitgl. Kreistag Görlitz. Mitgl. im Senat der Helmholtz-Gemeinschaft, im Senat der Leibniz-Gemeinschaft, im Förderverein des Landesmuseums Schlesien und im Förderverein der Hochschule Zittau/Görlitz, Vors. Förderverein  "Fürst-Pückler-Park Bad Muskau" e. V. - MdB seit Okt. 2002; seit Nov. 2009 stellv. Vors. der CDU/CSU-Fraktion, seit Sept. 2013 Vors. CDU-Landesgruppe Sachsen', 'Michael', '11003572');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07356, NULL, NULL, NULL, 'Wirtschaftsjurist', 'verheiratet, 3 Kinder', '04.05.1964', NULL, 'Korntal', 'männlich', NULL, '17.10.2002', 'Krichbaum', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Parlamentarische Gesellschaft e.V., Berlin,<br/>Revisor, ehrenamtlich<br/><br/>Europa-Union Deutschland e.V. (EUD), Berlin,<br/>Kooptiertes Mitglied des Präsidiums, ehrenamtlich<br/><br/>Fondation Robert Schuman, Paris,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Institut für Europäische Politik e.V. (IEP), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1984 Abitur am Solitude-Gymnasium Stuttgart-Weilimdorf. 1984/85 Wehrdienst. 1985/91 Studium der Rechtswissenschaften in Tübingen, Lausanne, Genf und Heidelberg, 1. und 2. jur. Staatsexamen. 1995/02 selbstständiger Wirtschaftsberater. Mitgl. der CDU seit 1983, seit 2010 Vors. CDU-Kreisverb. Pforzheim/Enzkreis, Mitgl. Wirtschaftsrat und Mittelstandsvereinigung. Mitgl. Atlantik-Brücke e. V., Vorstand der Fondation Robert Schuman (Paris), Vorstand der Europäischen Volkspartei (EVP), Kuratorium des Instituts für Europäische Politik (IEP), BFA Europa der CDU Deutschland und Vorstand der Europa Union Deutschland (kooptiert). Vors. Blasmusik-Kreisverband Pforzheim/Enzkreis und Förderverein Schiller-Gymnasiums Pforzheim. Mitgl. Vorstand Nordstadt-Bürgerverein, Kuratorium der Hochschule Pforzheim und Kirchensynode der ev. Kirche Pforzheim-Land. Mitgl. Lebenshilfe e. V., Förderverein Fachhochschule Pforzheim, Löbliche Singergesellschaft von 1501 Pforzheim, Karnevalsgesellschaften PFG und KGHO und Fußballverein 1. CfR Pforzheim. Englisch (f), Französisch (f). - MdB seit Okt. 2002; seit Juni 2007 Vors. Ausschuss für die Angelegenheiten der Europäischen Union.', 'Gunther', '11003573');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07361, NULL, 'Dr.', 'Dr.', 'Volljurist, Parl. Staatssekretär', NULL, '07.08.1969', NULL, 'Rheydt', 'männlich', NULL, '17.10.2002', 'Krings', NULL, 'CDU', NULL, 'evangelisch-reformiert', NULL, 'Funktionen in Unternehmen: <br/>Evangelisches Krankenhaus Bethesda gemeinnützige GmbH, Mönchengladbach, <br/>Mitglied des Aufsichtsrates, ehrenamtlich (bis Ende 2013)<br/><br/>Nationales Zentrum für Bürokratieabbau an der Fachhochschule des<br/>Mittelstands (FHM) Bielefeld gemeinnützige GmbH, Bielefeld, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Quadriga Hochschule GmbH, Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich (bis Ende 2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Evangelische Kirche in Deutschland, Hannover, <br/>Mitglied der Kammer für nachhaltige Entwicklung, ehrenamtlich<br/><br/>Evangelischer Kirchenkreis Gladbach-Neuss, Mönchengladbach/Neuss, <br/>Mitglied der Synode, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Deutsch-Amerikanische Juristenvereinigung e.V., Bonn, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Deutsche Gesellschaft für Gesetzgebung e.V., Hamburg, <br/>Vorsitzender, ehrenamtlich<br/><br/>Frischluft e.V., Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>International Association of Legislation (IAL) e.V., Den Haag, <br/>Mitglied im Advisory Council, ehrenamtlich', 'Abitur 1989. 1989/94 Studium Rechtwissenschaft und Geschichte Univ. Köln, 1994 1. jur. Staatsprüfung; 1994/95 Studium des US-amerikanischen und internat. Rechts Temple University Philadelphia (USA), 1995 Master of Laws (LL.M.), 1997 2. jur. Staatsprüfung. 1997/02 Wiss. Mitarbeiter Institut für Staatsrecht Univ. Köln, 2002 Promotion Dr. jur. 1997/02 Dozent an der Kölner Journalistenschule. Seit 1998 Rechtsanwalt in Mönchengladbach. Seit 2004 Lehrbeauftragter für Staatsrecht, seit 2010 Honorarprofessor an der Univ. Köln. 1992/03 Bezirksvors. der JU Niederrhein; 1998/14 stellv. Bezirksvors. und seit Nov. 2014 Bezirksvors. der CDU Niederrhein, Kreisvors. der CDU Mönchengladbach, Landesvorst. CDU NRW; stellv. Landesvors. MIT NRW; Vors. Bundesarbeitskreis Christl.-Dem. Juristen. Seit 1989 Mitgl. Kulturausschuss der Stadt Mönchengladbach. Schirmherr GBS-Patienten-Initiative, Mitgl. Synode Ev. Kirchenkreis Gladbach, Mitgl. Kuratorium Haus der Geschichte Bonn, Mitgl. Verwaltungsrat Dt. Nationalbibliothek, Vors. Dt. Gesellschaft für Gesetzgebung, Mitgl. Freiwillige Feuerwehr Herrath. Englisch (f), Französisch (G). - MdB seit Okt. 2002; seit Nov. 2009 stellv. Vors. der CDU/CSU-Fraktion, seit Jan. 2017 Vors. der NRW-Landesgruppe der CDU/CSU-Fraktion. Seit Dez. 2013 Parl. Staatssekretär beim BMin. des Innern.', 'Günter', '11003574');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07364, NULL, 'Dr.', 'Dr.', 'Staatssekretär im Ministerium für Inneres und Kommunales NRW a.D.', 'verheiratet, 3 Kinder', '07.04.1952', NULL, 'Lemgo', 'männlich', NULL, '17.10.2002', 'Krüger', NULL, 'SPD', NULL, 'evangelisch-reformiert', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Staatssekretär im Ministerium für Inneres und Kommunales des Landes Nordrhein-Westfalen, Düsseldorf<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn, <br/>	Vertrauensmann der Bausparer der LBS Westdeutsche Landesbausparkasse<br/><br/>	Niederrheinische Sparkasse RheinLippe, Wesel, <br/>	Stellv. Treuhänder nach § 7 PfandBG (ab Oktober 2015)<br/><br/>	Sparkasse Dinslaken-Voerde-Hünxe, Dinslaken, <br/>	Treuhänder nach § 7 PfandBG (bis 30.09.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Förderverein Haus Voerde e.V., Voerde, <br/>	1. Vorsitzender, ehrenamtlich', '1971 Abitur am Engelbert-Kämpfer-Gymnasium in Lemgo. Studium der Rechtswissenschaften, 1979/82 wissenschaftl. Assistent Univ. Bielefeld, Promotion zum Dr. jur. Tätigkeit als Rechtsanwalt. 1982/86 Richter am Amts- und Landgericht Osnabrück, an den Amtsgerichten Bersenbrück und Papenburg, 1986/88 Richter am Landgericht Osnabrück. 1985/88 Lehrbeauftragter der Universität Osnabrück. 1988/91 städtischer Oberrechtsrat in der Alten Hansestadt Lemgo, 1991/97 Stadtdirektor der Stadt Voerde, 1997/02 hauptamtlicher Bürgermeister der Stadt Voerde. Juli 2010/Okt. 2013 Staatssekretär im Ministerium für Inneres und Kommunales des Landes Nordrhein-Westfalen. 2010/15 Vors. SPD-Unterbezirk Kreis Wesel. 2. Vors. Förderverein Haus Voerde. - MdB 2002/09 und seit Okt. 2013; 2008/09 finanzpolitischer Sprecher der SPD-Fraktion, seit 2013 haushaltspolitischer Sprecher der SPD-Fraktion; Mitgl. Finanzmarktgremium, seit Feb. 2016 Vors. Cum-Ex-Untersuchungsausschuss.', 'Hans-Ulrich', '11003575');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07365, NULL, NULL, NULL, 'Rechtsanwältin, Sozialarbeiterin, Bundesministerin a.D., Fraktionsvorsitzende a. D.', 'verheiratet', '15.12.1955', NULL, 'Recklinghausen', 'weiblich', NULL, '17.10.2002', 'Künast', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Alice-Salomon-Hochschule für Sozialarbeit und Sozialpädagogik Berlin (ASH), Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Berliner AIDS-Hilfe e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>	Förderkreis politische Rhetorik und Kommunikation, Bonn, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Humanistische Union e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich (bis 31.03.2014)', '1973/76 FH für Sozialarbeit, 1976 Sozialarbeiterin (grad.). 1976/77 Anerkennungsjahr als Sozialarbeiterin (staatl. Anerkennung), 1977/79 Sozialarbeiterin in der JVA Tegel. Studium der Rechtswissenschaften an der FU, 1982 1. jur. Staatsexamen; 1982/85 Rechtsreferendarin, 1985 2. jur. Staatsexamen. Rechtsanwältin. Seit 1979 Mitgl. der AL, jetzt BÜNDNIS 90/DIE GRÜNEN, versch. Funktionen, Juni 2000/März 2001 Vors. des Bundesvorst. von BÜNDNIS 90/DIE GRÜNEN. Mitgl. Abghs. Berlin 1985/87 und März 1989/Juni 2000, dort 1990/93 Vors. der Fraktion Bündnis 90/Grüne (AL)/UFV, 1995/98 stellv. Vors. und Jan. 1998/Juni 2000 Vors. der Fraktion BÜNDNIS 90/DIE GRÜNEN. - MdB seit Okt. 2002; Jan. 2001/Okt. 2005 Bundesministerin für Verbraucherschutz, Ernährung und Landwirtschaft, Okt. 2005/Okt. 2013 Vors. der Fraktion BÜNDNIS 90/DIE GRÜNEN, seit Jan. 2014 Vors. Ausschuss für Recht und Verbraucherschutz.', 'Renate', '11003576');
