INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07380, NULL, 'Dr.', 'Dr.', 'Philologin', 'verheiratet, 2 Kinder', '07.08.1961', NULL, 'Berlin', 'weiblich', NULL, '17.10.2002', 'Lötzsch', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreditanstalt für Wiederaufbau, Frankfurt/Main, <br/>Mitglied des Verwaltungsrates<br/><br/>ZDF, Mainz, <br/>Mitglied des Fernsehrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Harald-Breuer-Stiftung, Berlin, <br/>Mitglied des Vorstandes', '1980 Abitur. 1980/85 Humboldt-Univ. Berlin, 1985 Dipl.-Lehrerin. 1985/88 Forschungsstudium Humboldt-Univ., 1988 Promotion Dr. phil. Wissenschaftl. Assistentin Humboldt-Univ., Auslandsaufenthalt: 1987 Forschungssemester in den Niederlanden. 1984/90 Mitgl. der SED, seit 1990 Mitgl. der PDS, 1994/2012 Vors. des Bezirksverbandes der PDS Berlin-Lichtenberg, Mai 2010/April 2012 Vors. der Partei DIE LINKE. 1989/90 Mitgl. der BVV Lichtenberg, Mai/Dez. 1990 Mitgl. der Stadtverordnetenvers. Berlin. 1991/02 Mitgl. Abgeordnetenhaus Berlin, 1991/93 Vors. der PDS-Fraktion, bis 2002 Vors. Ausschuss für Europa. U. a. Mitgl. GEW, Bund demokratischer Wissenschaftlerinnen und der Gesellschaft für Interlinguistik. Mitgl. Stefan Heym Gesellschaft, Mitgl. Verwaltungsrat der KfW und in der Mitgliedervers. des Goethe-Instituts. - MdB seit Okt. 2002; 2005/April 2012 stellv. Fraktionsvors., seit Jan. 2014 Vors. Haushaltsausschuss.', 'Gesine', '11003584');
