INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07384, NULL, NULL, NULL, 'Diplom-Politologin, Parl. Staatssekretärin', 'verheiratet, 3 Kinder', '19.04.1978', NULL, 'Bamberg', 'weiblich', NULL, '13.02.2006', 'Bär', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Christlich-Soziale Union, München,<br/>Stellv. Generalsekretärin (bis 17.12.2013), monatlich, Stufe 2<br/><br/>Funktionen in Unternehmen: <br/>CNC - Communications & Network Consulting AG, München,<br/>Mitglied des Expertenrates (bis 17.12.2013)<br/><br/>ÖPP Deutschland AG, Berlin,<br/>Mitglied des Aufsichtsrates, von Amts wegen<br/><br/>Region Mainfranken GmbH, Würzburg,<br/>Mitglied des Rates der Region (bis 17.12.2013)<br/><br/>Rhön-Klinikum AG, Bad Neustadt,<br/>Mitglied des Beirates (bis 17.12.2013)<br/><br/>RTL Television GmbH, Köln,<br/>Mitglied des Programmausschusses (bis 17.12.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>FFA - Filmförderungsanstalt, Berlin,<br/>Mitglied des Verwaltungsrates (bis 17.12.2013)<br/><br/>Julius-Maximilians-Universität Würzburg, Würzburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Landkreis Haßberge, Haßfurt,<br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AFS Interkulturelle Begegnungen e.V., Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>BFV-Sozialstiftung, München,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Deutsche Akademie für Kinder- und Jugendliteratur e.V., Volkach,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Freunde und Förderer des RCDS in Bayern e.V., München,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Kissinger Sommer, Bad Kissingen,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Highschool-Diploma, Grayslake, Illinois, USA, Abitur am Franz-Ludwig-Gymnasium in Bamberg. Diplom Politikwissenschaften an der Hochschule für Politik in München und am Otto-Suhr-Institut der Freien Universität in Berlin. 1992 Eintritt in die Junge Union, 1994 Eintritt in die CSU; 2001/03 Landesvors. RCDS in Bayern; 2003/07 stellv. Landesvors. JU Bayern, 2008/12 stellv. Bundesvors. JU Deutschland; seit 2001 Mitglied im CSU Parteivorstand, seit 2011 stellv. Vors. CSU Unterfranken, Febr. 2009/Dez. 2013 stellv. CSU-Generalsekretärin, seit 2010 Vors. CSU-Netzrat, seit 2011 Vors. CSUnet. Seit 2008 Kreisrätin im Landkreis Haßberge. - MdB 2002/05 und seit Nov. 2005; seit Dez. 2013 Parlamentarische Staatssekretärin beim Bundesminister für Verkehr und digitale Infrastruktur, seit 2014 Koordinatorin der BReg für Güterverkehr und Logistik.', 'Dorothee', '11003586');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07386, NULL, NULL, NULL, 'Dipl.-Geographin, Parl. Staatssekretärin', '2 Kinder', '25.09.1963', NULL, 'Bad Pyrmont', 'weiblich', NULL, '17.10.2002', 'Marks', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Wedemark, Wedemark, <br/>Mitglied des Gemeinderates<br/>Mitglied des Ortsrates Mellendorf/Gailhof (bis Januar 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Verein für öffentliche und private Fürsorge e.V., Berlin, <br/>Mitglied des Hauptausschusses, ehrenamtlich (bis Januar 2014)<br/><br/>Deutsch-Französisches Jugendwerk, Berlin, <br/>Stellv. Mitglied des Verwaltungsrates, ehrenamtlich (bis Januar 2014)<br/><br/>Pestalozzi-Stiftung, Burgwedel, <br/>Mitglied des Verwaltungsrates, ehrenamtlich (bis Dezember 2013)<br/><br/>Pro Familia, Landesverband Niedersachsen, Hannover, <br/>Vorsitzende, ehrenamtlich (bis Dezember 2013)', '1983 Abitur am Gymnasium Mellendorf in der Wedemark. 1983/88 Studium der Geographie Univ. Hannover, 1988 Abschluss Diplom-Geographin. 1989/90 wissenschaftl. Mitarbeiterin an der Univ. Hannover. 1991 Geburt des 1. Kindes, bis 2002 Familienfrau. Seit 1998 Mitgl. der SPD, seit 1999 Vors. SPD-Ortsverein Wedemark, Mitgl. im SPD-Bezirksvorstand Hannover. Nov. 2001/Okt. 2002 Mitgl. der Regionsversammlung der Region Hannover, seit Nov. 2001 Mitgl. im Rat der Gemeinde Wedemark, 2011/14 Mitgl. im Ortsrat Mellendorf/Gailhof. Dez. 2009/Dez. 2013 Vors. pro familia Landesverband Niedersachsen; Mitgl. IG BCE, AWO, pro familia, Sozialdemokratische Gemeinschaft für Kommunalpolitik (SGK), Freiwillige Feuerwehr Mellendorf, Schützenverein Mellendorf, Kneipp-Verein Garbsen und Hannover 96. Nov. 2011/Jan. 2014 stellv. Mitgl. Verwaltungsrat Deutsch-Französisches Jugendwerk, 2011/Dez. 2013 Mitgl. Verwaltungsrat Pestalozzi-Stiftung. - MdB seit Okt. 2002; seit Dez. 2005 Mitgl. im Fraktionsvorst. und 2008/13 Sprecherin der SPD-Fraktion für Familie, Senioren, Frauen und Jugend; seit Dez. 2013 Parlamentarische Staatssekretärin bei der Bundesministerin für Familie, Senioren, Frauen und Jugend.', 'Caren', '11003587');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07387, NULL, NULL, NULL, 'Hauptschullehrerin', 'verheiratet, 2 Kinder', '06.10.1954', NULL, 'Finnentrop', 'weiblich', NULL, '17.10.2002', 'Mattheis', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1974 Abitur. Bis 1978 PH Esslingen, 1980 2. Dienstprüfung für das Lehramt GHS. Bis 1991 GHS-Lehrerin, 1991/94 Mitarbeiterin in einem Abgeordnetenbüro, 1994/02 GHS-Lehrerin. 1986 Eintritt in die SPD, seit 1995 Mitgl. SPD-Landesvorst. Baden-Württemberg, seit 1997 stellv. Landesvors. (Südwürttemberg), 2005/13 Mitgl. SPD-Parteivorst.; 1999/07 ASF-Landesvors. Baden-Württemberg. Mitgl. GEW, BUND, Naturfreunde, AIDS-Hilfe, Drogenhilfe, AWO, Gegen Vergessen und für Demokratie, Forum Demokratische Linke 21 und Dokumentationszentrum Oberer Kuhberg e. V. - MdB seit Okt. 2002; 2005/07 Mitgl. SPD-Fraktionsvorst., 2009/13 stellv. Sprecherin AG Gesundheit und Berichterstatterin Bereiche Pflege, Psychiatrie, Armut und Gesundheit, Hausärzte der SPD-Fraktion, seit 2013 Sprecherin AG Gesundheit der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 295 (Zollernalb - Sigmaringen)', 'Hilde', '11003588');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07392, NULL, NULL, NULL, 'Rechtsanwalt', 'ledig', '15.12.1973', NULL, 'Burghausen', 'männlich', NULL, '17.10.2002', 'Mayer', '(Altötting)', 'CSU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Nachmann Rechtsanwalts GmbH, München, <br/>Rechtsanwalt, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Altötting, Altötting, <br/>Mitglied des Kreistages<br/><br/>Stadt Neuötting, Neuötting, <br/>Mitglied des Stadtrates<br/><br/>Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin, <br/>Stellv. Mitglied des Kuratoriums<br/><br/>Stiftung Deutsches Historisches Museum (DHM), Berlin, <br/>Mitglied des Kuratoriums<br/><br/>Stiftung Flucht, Vertreibung, Versöhnung, Berlin, <br/>Mitglied des Stiftungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bund der Vertriebenen (BdV), Bonn, <br/>Mitglied des Präsidiums<br/><br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates<br/><br/>THW-Bundesvereinigung e.V., Berlin, <br/>Präsident', '1980/84 Grundschule in Neuötting, 1984/93 König-Karlmann-Gymnasium Altötting, allg. Hochschulreife. 1993/97 Studium der Rechtswissenschaft Ludwig-Maximilians-Univ. München, 1997 1. jur. Staatsexamen, 2000 2. jur. Staatsexamen. Seit Sept. 2000 Rechtsanwalt, derzeit  in einer Anwaltskanzlei in München, Schwerpunkte Wirtschafts- und Verwaltungsrecht.1994/03 JU-Kreisvors., seit April 1997 stellv. Vors. CSU-Kreisverb. Altötting, seit Juli 1997 Beisitzer in der CSU-Bezirksvorstandschaft Oberbayern, seit 1997 Mitgl. des CSU-Bezirksvorst. Oberbayern, seit 2009 Mitgl. des CSU-Parteivorst.. Seit Mai 1996 Stadtrat in Neuötting und Kreisrat im Landkreis Altötting, seit 2002 stellv. Fraktionsvors. der CSU-Kreistagsfraktion Altötting. 1998/02 Jugendreferent der Stadt Neuötting. Nov. 2007/Okt. 2010 Landesvors. THW Bayern, seit April 2008 Mitgl. Präsidium Bund der Vertriebenen. 2000/03 Abteilungsleiter der Tennisabteilung TSV Neuötting e. V., seit März 2010 Präsident THW-Bundesvereinigung e. V. Englisch (f), Französisch (G), Italienisch (G). - MdB seit Okt. 2002; seit Jan. 2014 Vors. der AG Innen der CDU/CSU-Fraktion.', 'Stephan', '11003589');
