INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07405, NULL, NULL, NULL, 'Meisterin der ländlichen Hauswirtschaft', 'verheiratet, 3 Kinder', '16.10.1955', NULL, 'Lauf a. d. Pegnitz', 'weiblich', NULL, '17.10.2002', 'Mortler', NULL, 'CSU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>QS Qualität und Sicherheit GmbH, Bonn, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Absatzfonds der Landwirtschaft, Bonn, <br/>Stellv. Vorsitzende des Verwaltungsrates<br/><br/>Landkreis Nürnberger Land, Lauf an der Pegnitz, <br/>Mitglied des Kreistages, ehrenamtlich', 'Mittlere Reife, Landwirtschaftsschule Roth, 1981 Meisterprüfung in der ländlichen Hauswirtschaft. 1983 Übernahme des landwirtschaftlichen Betriebes der Eltern in Lauf/Dehnberg. Seit 1990 Kreisrätin im Nürnberger Land. Seit 1996 Mitgl. der Frauen Union Bayern, seit Juni 2009 stellv. Vors. des CSU Bezirksverbands Mittelfranken, seit Okt. 2011 Mitgl. im CSU-Parteivorstand, seit Nov. 2011 Landesvors. der Arbeitsgemeinschaft Landwirtschaft der CSU, seit Feb. 2014 Mitgl. im Landesvorstand der Frauen Union Bayern. - MdB seit 2002; 2004/05 agrar- und verbraucherpol. Sprecherin der CSU-Landesgruppe; 2006/09 Vors. Ausschuss für Tourismus; 2009/14 tourismuspol. Sprecherin der CDU/CSU-Fraktion; seit 2010 Mitgl. der Dt.-Maltesischen Parlamentariergruppe; seit Jan. 2014 Drogenbeauftragte der Bundesregierung; seit Jan. 2014 Vors. des Arbeitskreises VI (Ernährung, Landwirtschaft, Umwelt, Naturschutz, Bau und Reaktorsicherheit) der CSU-Landesgruppe und stellv. Vors. der CSU-Landesgruppe.', 'Marlene', '11003596');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07410, NULL, NULL, NULL, 'Bankfachwirt, Parl. Staatssekretär', 'verheiratet, 1 Kind', '03.09.1975', NULL, 'Neustadt a. d. Aisch', 'männlich', NULL, '17.10.2002', 'Müller', '(Erlangen)', 'CSU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Erlangen-Höchstadt, Erlangen, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Stiftung Friedensforschung (DSF), Osnabrück,<br/>Stellv. Vorsitzender des Stiftungsrates<br/>Mitglied des Geschäftsführenden Vorstandes<br/><br/>Deutsches Institut für Wirtschaftsforschung (DIW) e.V., Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Friedrich-Alexander-Universität Erlangen-Nürnberg, Erlangen/Nürnberg,<br/>Mitglied des Kuratoriums<br/><br/>Lebenshilfe Erlangen-Höchstadt (West) e.V., Herzogenaurach,<br/>Mitglied des Vorstandes<br/><br/>Stiftung Lesen, Mainz,<br/>Mitglied des Kuratoriums', '1992 Abschluss Realschule. Ausbildung zum Bankkaufmann. 1995/96 Wehrdienst. Berufsbegleitendes Studium an der Bankakademie. Mehrjährige Tätigkeit im Bankgewerbe. Vors. des Kreisverb. des Bayerischen-Roten-Kreuz Erlangen-Höchstadt. Mitgl. im Kuratorium der Friedrich-Alexander-Universität Erlangen-Nürnberg. Mitgl. der Jungen Union und der CSU seit 1990/1991, Nov. 2007/Nov. 2011 Landesvors. der Jungen Union Bayern, seit 2011Kreisvors. der CSU im Landkreis Erlangen-Höchstadt. Mitgl. des Kreistages Erlangen-Höchstadt. - MdB seit Okt. 2002; 2009/Dez. 2013 Parl. Geschäftsführer der CSU-Landesgruppe und Mitgl. des Ältestenrates, seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Bildung und Forschung.', 'Stefan', '11003597');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07412, NULL, NULL, NULL, 'Dipl.-Kauffrau, Staatsministerin a. D.', '1 Kind', '29.06.1967', NULL, 'Rheine / Steinfurt', 'weiblich', NULL, '17.10.2002', 'Müller', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Hildegard', '11003598');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07417, NULL, 'Dr.', 'Dr.', 'Politikwissenschaftler', 'verheiratet, 2 Kinder', '25.06.1959', NULL, 'Köln', 'männlich', NULL, '17.10.2002', 'Mützenich', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Zeitschrift für Außen- und Sicherheitspolitik (ZfAS) VS Verlag, Wiesbaden, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeitskreis Darmstädter Signal, Hamburg, <br/>	Mitglied des Förderkreises, ehrenamtlich<br/>	<br/>Archiv der Arbeiterjugendbewegung, Oer-Erkenschwick, <br/>	Mitglied des Förderkreises, ehrenamtlich<br/>	<br/>Deutsche Osttimor Gesellschaft e.V., Köln, <br/>	Mitglied des Beirates, ehrenamtlich<br/>	<br/>Friedrich-Ebert-Stiftung e.V., Bonn, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/>	<br/>Max-Planck-Institut für Gesellschaftsforschung, Köln, <br/>	Vorsitzender des Kuratoriums, ehrenamtlich<br/>	<br/>Stiftung Entwicklung und Frieden (SEF), Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Stiftung Wissenschaft und Politik, Berlin, <br/>	Mitglied des Stiftungsrates, ehrenamtlich (bis Mai 2014)', '1966 Grundschule, 1969 Hauptschule, 1975 Gymnasium, 1978 Allg. Hochschulreife. 1979 Studium der Politikwissenschaft, Geschichte und der Wirtschaftswissenschaft, 1990 Diplom, 1991 Promotion. Seit 1979 Mitarbeiter bei versch. MdB, 1991/93 und 1998/01 Referatsleiter bei der Landesregierung NRW, 1993/98 Wiss. Referent bei der SPD-Landtagsfraktion NRW, 2001/02 Leiter Präsidialbüro im Landtag NRW. Mitgl. der SPD seit 1975 und seit 1977 versch. Funktionen bei den Jungsozialisten, der SJD - "Die Falken" und der SPD Köln. Mitgl. ver.di, Kindernöte e. V.; Mitgl. Vorst. Friedrich-Ebert-Stiftung, ehrenamtlich, seit Okt. 2011 Vors. Kuratorium des Max-Planck-Instituts für Gesellschaftsforschung in Köln, Vorstandsmitgl. des Arbeitskreises für das ausländische Kind e. V. und des Arbeiter-Samariter-Bundes Köln, Kuratoriumsmitgl. Stiftung Entwicklung & Frieden (sef), Bonn  (alle ehrenamtl.). - MdB seit Okt. 2002; 2004/09 nahost- und abrüstungspol. Sprecher, 2009/13 außenpol. Sprecher der SPD-Fraktion, seit Dez. 2013 stellv. Vors. der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 94 (Köln II)', 'Rolf', '11003599');
