INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07426, NULL, 'Dr.', 'Dr.', 'Diplom Kaufmann', NULL, '10.04.1969', NULL, 'Krumbach', 'männlich', NULL, '17.10.2002', 'Nüßlein', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Betrieb eines Klein- Wasserkraftwerks, Münsterhausen<br/>	Elektrizitätswerk Gemeinde Burtenbach, (als Abnehmer nach § 4 EEG), monatlich, Stufe 2<br/><br/>	FORUM Institut für Management GmbH, Heidelberg, <br/>	Vortrag, 2014, Stufe 1 (4. Stadtwerketag Bayern - Die Auswirkungen der Energiewende-Reform auf den Freistaat)<br/><br/>	Wirtschaftsberater, freiberuflich, Münsterhausen<br/><br/>Funktionen in Unternehmen: <br/>	on-collect solutions AG, Illertissen, <br/>	Vorsitzender des Aufsichtsrates, monatlich, Stufe 1<br/><br/>	Sfirion AG, München, <br/>	Mitglied des Aufsichtsrates, jährlich, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesministerium für Wirtschaft und Energie, Berlin, <br/>	Mitglied der Kommission zur Überprüfung der Finanzierung des Kernenergieausstiegs (KFK)<br/><br/>	Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>	Post und Eisenbahnen, Bonn, <br/>	Mitglied des Beirates<br/><br/>	Kammlachfischereigenossenschaft, Krumbach, <br/>	1. Vorstand, ehrenamtlich<br/><br/>	Sparkassenverband Bayern, München, <br/>	Mitglied des Beirates für sparkassenpolitische Grundsatzfragen<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband Erneuerbare Energie e.V., Paderborn, <br/>	Mitglied des Beirates<br/><br/>	Vereinigung Wasserkraftwerke in Bayern e.V., München, <br/>	Mitglied des Beirates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Tectum Holding GmbH, Berlin', '1988 Abitur in Krumbach. 1993 Abschluss des Studiums der Wirtschafts- und Sozialwissenschaften an der Univ. Augsburg; 1998 berufsbegl. Promotion zum Doktor der Rechtswissenschaften an der Univ. Augsburg. Seit 1993 berufstätig im Bereich Bank- und Finanzwesen, Bankhaus Reuschel & Co. Privatbank in München; bis 2000 nebenberuflich Dozent an der Bankakademie in Frankfurt. 1994/01 Kreisvors. der JU, 1995/97 Mitglied im JU-Deutschlandrat und Mitgl. im Landesausschuss der JU Bayern, 1997/01 stellv. Bezirksvors. der JU Schwaben. Seit 1996 Marktrat in Münsterhausen; 1996/02 und seit 2008 Kreisrat im Landkreis Günzburg. - MdB seit 2002; 2005/08 energiepol. Sprecher der CSU-Landesgruppe; 2005/13 stellv. Vors. des Energiekoordinationskreises der CDU/CSU Fraktion; 2008/Okt. 2009 stellv. Vors. Ausschuss für Wirtschaft und Technologie; 2008/12 wirtschafts- und energiepol. Sprecher der CSU-Landesgruppe; 2009/13 Beauftragter der CDU/CSU-Fraktion für IT-,Kommunikations- und Postpolitik; Obmann der CDU/CSU-Fraktion in der Enquete-Kommission "Wachstum, Wohlstand, Lebensqualität"; 2012/13 wirtschafts-, energie- und verkehrspol. Sprecher der CSU-Landesgruppe; seit 2014 stellv. Vors. der CDU/CSU-Fraktion.', 'Georg', '11003602');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07428, NULL, 'Dr.', 'Dr.', 'Frauenärztin', 'verheiratet, 2 Kinder', '30.10.1950', NULL, 'Saarbrücken', 'weiblich', NULL, '17.10.2002', 'Ober', NULL, 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Erika', '11003603');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07429, NULL, NULL, NULL, 'Landwirt', 'verheiratet, 1 Kind', '12.01.1953', NULL, 'Dortmund', 'männlich', NULL, '17.10.2002', 'Ostendorff', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Unternehmen: <br/>Biofleisch NRW. e.G., Bergkamen, <br/>Mitglied des Genossenschaftsvorstandes, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landwirtschaftliche Rentenbank, Frankfurt/Main, <br/>	Mitglied der Anstaltsversammlung<br/><br/>	Sparkasse Münsterland, Münster, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AbL - Arbeitsgemeinschaft bäuerliche Landwirtschaft e.V., Hamm, <br/>	Beisitzer des Vorstandes, ehrenamtlich<br/><br/>	BUND Landesverband Nordrhein-Westfalen, Düsseldorf, <br/>	Beisitzer des Vorstandes, ehrenamtlich', 'Mittlere Reife. 1974 Meisterprüfung zum Landwirt. Seit 2006 Mitgl. im Landesvorst. des BUND, 2007/Okt. 2009 stellv. Landesvors., 2008/10 Bundesagrarsprecher des BUND. Mitbegünder der AbL - Arbeitsgemeinschaft bäuerliche Landwirtschaft e. V., 13 Jahre Landesvors. NRW. Mitbegründer Neulandverband für tiergerechte und umweltschonende Nutztierhaltung. Aufbau und ehrenamtl. Mitglied des Genossenschaftsvorst. 1980 Mitbegründer der Grünen im Kreis Unna, 2005/12 Kreisvors. der Grünen in Unna, 2010/13 Sprecher der BAG Landwirtschaft und ländliche Entwicklung von Bündnis 90/Die Grünen. 1994 bis 2002 Fraktionsvors. der Grünen im Kreistag Unna, 1999/02 Mitgl. im Regionalrat Arnsberg, 2005/10 grüner Kreissprecher und Vors. im Kreistag und Regionalrat. - MdB 2002/05 und seit Okt. 2009; agrarpolitischer Sprecher der Fraktion Bündnis 90/Die Grünen; in der 17. WP stellv. Vors. Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz, in 18. WP stellv. Vors. Ausschuss für  Ernährung und Landwirtschaft.', 'Friedrich', '11003604');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07430, NULL, NULL, NULL, 'Bootsmann, Dipl.-Staatswiss., Selbst. Unternehmer', 'verheiratet, 3 Kinder', '14.06.1948', NULL, 'Neu-Lübstorf', 'männlich', NULL, '17.10.2002', 'Otto', '(Godern)', 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Eberhard', '11003605');
