des strategischen Beirates<br/><br/>Forum Region Stuttgart e.V., Stuttgart,<br/>Mitglied des Kuratoriums (bis 31.12.2015)<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Vorsitzender des Beirates für Wirtschaft und Wirtschaftsrecht<br/><br/>Institut der deutschen Immobilienwirtschaft e.V. (iddiw), Frankfurt/Main,<br/>Mitglied des Beirates<br/><br/>Institute for Cultural Diplomacy e.V. (ICD), Berlin,<br/>Mitglied des Beirates<br/><br/>Landesverband Württembergischer Karnevalvereine e.V. 1958, Stuttgart,<br/>Beisitzer im Rechtsausschuss<br/><br/>Packaging Excellence Region Stuttgart e.V.<br/>Kompetenzzentrum für Verpackungs- und Automatisierungstechnik, Waiblingen,<br/>Mitglied des Beirates<br/><br/>Sportkreis Rems-Murr e.V., Backnang,<br/>Mitglied des Beirates<br/><br/>Stiftung Energie & Klimaschutz Baden-Württemberg, Karlsruhe,<br/>Mitglied des Kuratoriums<br/><br/>Stiftung Theaterhaus Stuttgart, Stuttgart,<br/>Mitglied des Kuratoriums<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	MACONSO GmbH, Plüderhausen', '1986 Abitur am Wirtschaftsgymnasium Schwäbisch Gmünd. 1986/88 Bundeswehr, Reserveoffizier, derzeitiger Dienstgrad Hauptmann d. R. 1988/92 Studium der technisch-orientierten Betriebswirtschaftslehre Univ. Stuttgart, Dipl.-Kaufmann, 1997 Promotion zum Dr. rer. pol. 1992/97 Energieversorgung Schwaben AG (EVS), Controlling. 1997/02 Leiter der Wirtschafts- und Arbeitsförderung der Landeshauptstadt Stuttgart. Seit 2002 freiberufliche beratende Tätigkeit (Dr. Joachim Pfeiffer Consulting), seit Okt. 2006 Lehrbeauftragter für Energiepolitik am Institut für Energiewirtschaft und Rationelle Energieanwendung der Univ. Stuttgart. 1982 Eintritt in die JU, seit 1985 Mitgl. der CDU, 1990/94 Kreisvors. der JU Rems-Murr, seit 2000 Kreisvors. der CDU Rems-Murr, Mitgl. CDU-Wirtschaftsrat. 1992/99 Mitgl. Gemeinderat Urbach, seit 1994 Mitgl. der Regionalversammlung im Verband Region Stuttgart, seit 1996 Vors. der CDU-Fraktion. - MdB seit Okt. 2002; 2005/09 Koordinator in Energiefragen, seit Nov. 2009 wirtschafts- und energiepol. Sprecher der CDU/CSU-Fraktion.', 'Joachim', '11003608');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07441, NULL, NULL, NULL, 'ehemalige Geschäftsführerin in einem mittelständischen Familienunternehmen', 'geschieden, 2 Kinder', '16.10.1951', NULL, 'Wetzlar', 'weiblich', NULL, '17.10.2002', 'Pfeiffer', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>DEval - Deutsches Evaluierungsinstitut der Entwicklungszusammenarbeit gemeinnützige GmbH, Berlin, <br/>	Mitglied des Beirates (bis Mitte Februar 2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Wetzlar, Wetzlar, <br/>Mitglied der Stadtverordnetenversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/>	<br/>Förderverein Landgestüt Dillenburg, Dillenburg, <br/>	Mitglied des Vorstandes<br/>	<br/>Reit- und Fahrverein Wetzlar, Wetzlar, <br/>	Vorsitzende<br/>	<br/>Wetzlarer Festspiele, Wetzlar, <br/>	Mitglied des Vorstandes<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>P & S Grundstücksgesellschaft mbH & Co. KG, Wetzlar', 'Abitur. Bankkauffrau. 1985/02 Geschäftsführerin in einem mittelständischen Familienunternehmen. Mitgl. der CDU seit 1992, Mitgl. Kreisvorst. CDU Lahn-Dill; Kreisvors. der Frauen-Union Lahn-Dill, Mitgl. MIT und EAK. Mitgl. CDU-Fraktion Stadtverband Wetzlar, dort bis 2002 Vors. der Finanz- und Wirtschaftsaussch. Vors. des Reit- und Fahrvereins Wetzlar, Mitgl. im Vorst. Wetzlarer Festspiele und Förderverein Hessisches Landgestüt Dillbung. Englisch (G), Französisch (G). - MdB seit Okt. 2002; Nov. 2005/Okt. 2009 stellv. Vors. Ausschuss für wirtschaftliche Zusammenarbeit und Entwicklung, Nov. 2009/März 2011 stellv. Vors. Ausschuss für Menschenrechte und humanitäre Hilfe; seit 2011 Vors. AG Wirtschaftliche Zusammenarbeit und Entwicklung der CDU/CSU-Fraktion.', 'Sibylle', '11003609');
