INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07445, NULL, 'Dr.', 'Dr.', 'Tierarzt', 'verheiratet, 4 Kinder', '25.07.1954', NULL, 'Rahden / Westfalen', 'männlich', NULL, '17.10.2002', 'Priesmeier', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Unternehmen: <br/>	QS Qualität und Sicherheit GmbH, Bonn, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bund Heimat und Umwelt in Deutschland e.V. (BHU), Bonn, <br/>	Mitglied des Präsidiums (bis 31.03.2015)', '1960/68 Volksschule Stemwede-Oppenwehe, 1968/74 Söderblom-Gymnasium der ev. Landeskirche in Espelkamp. 1974/75 Wehrdienst. 1975/80 Studium an der Tierärztlichen Hochschule Hannover (TIHO), 1981 dort Promotion zum Dr. med. vet. 1980/81 wissenschaftl. Assistent an der Tierärztlichen Hochschule Hannover, 1981/84 Praxisassistent. 1984 Niederlassung als Tierarzt in Dassel-Markoldendorf, Niedersachsen. Seit 1970 Mitgl. der SPD, als Jungsozialist versch. Ämter auf Unterbezirks- und Bezirksebene, an der TIHO Asta-Vors., 1975/80 Mitgl. Konzil und Senat der TIHO. 1991/03 Mitgl. Stadtrat Dassel, 1996/03 Mitgl. im Kreistag Northeim. Mitgl. Freiwillige Feuerwehr Markoldendorf, Mitgl. Kuratorium QS Qualität und Sicherheit GmbH, Mitgl. Deutscher Ultraleichtverband e. V., Fördermitgl. Fachagentur Nachwachsende Rohstoffe e. V. (FNR). Englisch (f). - MdB seit Okt. 2002; seit 2009 Sprecher für Ernährung, Landwirtschaft und Verbraucherschutz , seit  Jan. 2014 für Ernährung und Landwirtschaft der SPD-Fraktion.', 'Wilhelm', '11003611');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07446, NULL, NULL, NULL, 'Rechtsanwalt, Parl. Staatssekretär', 'ledig', '28.12.1972', NULL, 'Passau', 'männlich', NULL, '17.10.2002', 'Pronold', NULL, 'SPD', NULL, 'konfessionslos', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Kanzlei Paluka, Sobola & Partner, Regensburg, <br/>Rechtsanwalt (bis 17.12.2013)<br/><br/>Funktionen in Unternehmen: <br/>Humboldt Forum Kultur GmbH, Berlin,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>VDI Zentrum Ressourceneffizienz GmbH, Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bayerischer Rundfunk, München, <br/>Mitglied des Rundfunkrates und stellv. Vorsitzender des Ausschusses<br/>für Grundsatzfragen und Geschäftsordnung, jährlich, Stufe 3<br/><br/>Landkreis Deggendorf, Deggendorf, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Georg-von-Vollmar-Akademie e.V., München, <br/>Stellv. Vorsitzender, ehrenamtlich', '1992/95 Ausbildung zum Bankkaufmann. 1995/99 Studium der Rechtswissenschaft. Seit Juli 2002 Rechtsanwalt (Tätigkeit ruht seit Dez. 2013). Mitgl. bei amnesty international, Arbeiterwohlfahrt, ver.di, Bund Naturschutz und im Sozialverband VdK; Rundfunkrat des Bayer. Rundfunks (KdÖR). Mitgl. der Friedrich-Ebert-Stiftung, München, Vors. des Stiftungsrates Humboldt-Forum im Berliner Schloss. Mitgl. der SPD seit 1989, div. Funktionen bei der SPD und bei den Jungsozialisten/-innen, seit 2004 Vors. des SPD-Unterbez. Rottal-Inn, 1999/04 Landesvors. der Jungsozialisten, 2009/17 SPD-Landesvors. Bayern, seit 2007 Mitgl. SPD-Parteivorst., seit 2009 Mitgl. im Präsidium der SPD. Seit 1996 Kreisrat in Deggendorf. - MdB seit Okt. 2002; 2006/10 Vors. der bayer. Landesgruppe der SPD-Fraktion, Okt. 2009/Dez. 2013 stellv. Vors. der SPD-Fraktion; seit Dez. 2013 Parl. Staatssekretär bei der Bundesministerin für Umwelt, Naturschutz, Bau und Reaktorsicherheit.', 'Florian', '11003612');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07450, NULL, NULL, NULL, 'Juristin', 'verheiratet, 2 Kinder', '07.07.1975', NULL, 'München', 'weiblich', NULL, '15.12.2010', 'Ludwig', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bayerisches Rotes Kreuz, Kreisverband Rosenheim, Rosenheim, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Bundesstiftung Baukultur, Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich (bis 22.04.2015)<br/><br/>	Landkreis Rosenheim, Rosenheim, <br/>	Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>DONUM VITAE in Bayern e.V., München, <br/>	Mitglied des Landesvorstandes, ehrenamtlich', '1995 Abitur am Ignaz-Günther-Gymnasium in Rosenheim. Studium der Rechtswissenschaften in München. Mitgl. im Parteivorstand der CSU, Mitgl. im Bezirksvorstand der CSU Oberbayern, stellv. Kreisvors. der CSU Rosenheim-Land, Leiterin der CSU-Verkehrskommission, stellv. Landesvors. der Frauen-Union Bayern, stellv. Kreisvors. der Frauen-Union Rosenheim-Land, Mitglied im Bezirksvorstand der Frauen-Union Oberbayern.  Kreisrätin. Stellv. Kreisvors. des Bayerischen Roten Kreuzes Rosenheim, Schirmherrin Förderverein Kinderklinik Rosenheim, Schirmherrin Bundesverband Konduktive Förderung nach Petö e. V., Schirmherrschaft Pflegestiftung Meltl, Vorstandsmitgl. Fortschritt Rosenheim e.V. - MdB seit Okt. 2002; Vors. der AG Tourismus der CDU/CSU-Fraktion, stellv. Vors. der Gruppe der Frauen der CDU/CSU-Fraktion.', 'Daniela', '11003613');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07453, NULL, 'Dr.', 'Dr.', 'Bürgermeister a. D.', 'verheiratet, 4 Kinder', '10.06.1968', NULL, 'Frankfurt/Main', 'männlich', NULL, '17.10.2002', 'Raabe', NULL, 'SPD', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Eschborn, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis 24.03.2014)<br/>	<br/>DEval - Deutsches Evaluierungsinstitut der Entwicklungszusammenarbeit gemeinnützige GmbH, Bonn, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Welthungerhilfe e.V., Bonn, <br/>	Ständiger Bevollmächtigter des Vorsitzenden der SPD-Bundestagsfraktion in der Mitgliederversammlung, ehrenamtlich', '1987 Abitur in Freigericht. 1987/89 Zivildienst bei der Selbsthilfe Köperbehinderter Hanau/Gelnhausen e. V. 1989/94 Studium der Politischen Wissenschaften an der Goethe-Univ. Frankfurt, Promotion. 1994/96 Studium der Rechtswissenschaften an der Goethe-Univ. Frankfurt. 1990 Eintritt in die SPD. 1995/96 wissenschaftlicher Mitarbeiter von MdB Bernd Reuter. 1996/2002 Hauptamtlicher Bürgermeister von Rodenbach/Main-Kinzig-Kreis. Mitgl. AWO, der Freiwilligen Feuerwehr sowie div. sozialer und kultureller Organisationen und Sportvereine. Englisch (f). - MdB seit Okt. 2002; 2005/14 entwicklungspolitischer Sprecher der SPD-Fraktion.', 'Sascha', '11003614');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07456, NULL, NULL, NULL, 'Studienrat', 'verheiratet', '28.09.1953', NULL, 'Geinsheim', 'männlich', NULL, '17.10.2002', 'Reichenbach', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>	Deutsche Telekom AG, Bonn, <br/>	Mitglied des Datenschutzbeirates, jährlich, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Freie Universität Berlin, Forschungsforum Öffentliche Sicherheit, Berlin, <br/>	Mitglied des Steuerungskreises, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>	Deutscher Feuerwehrverband e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Deutsches Komitee Katastrophenvorsorge e.V. (DKKV), Bonn, <br/>	Vorsitzender, ehrenamtlich (bis 07.12.2015)<br/><br/>	Stiftung Datenschutz, Leipzig, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Stiftung Technisches Hilfswerk, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	THW-Bundesvereinigung e.V., Berlin, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/><br/>	THW-Landesvereinigung Hessen e.V., Frankfurt/Main, <br/>	Vorsitzender, ehrenamtlich<br/><br/>	Verbraucherzentrale Bundesverband e.V. (vzbv), Berlin, <br/>	Mitglied des Parlamentarischen Beirates des Marktwächters Digitale Welt, ehrenamtlich<br/><br/>	Zukunftsforum Öffentliche Sicherheit e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich', '1972 Abitur. 1972/78 Studium Deutsch und Sozialkunde, 1978 1. Staatsexamen, Referendariat, 1980 2. Staatsexamen. 1981/95 Gymnasiallehrer. 1976 Eintritt in die SPD, 1980/81 Juso-Vors. Unterbezirk Groß-Gerau, 1984/2014 Mitgl. SPD-Unterbezirksvorst. Groß-Gerau, 2008/10 Vors. SPD-Unterbezirk Groß-Gerau, 2001/15 Mitgl. im Bezirksvorst. Hessen-Süd. 1988/10 Mitgl. im Kreistag Groß-Gerau. MdL Hessen 1995/02. Seit 1976 Mitgl. THW, seit 1998 Landesvors. THW-Vereinigung Hessen, Mitgl. Präsidium der Bundesvereinigung THW. Ehrnamtl. Mitgl. Kuratorium Stiftung Technisches Hilfswerk, ehrenamtl. Mitgl. Beirat Zukunftsforum öffentliche Sicherheit e. V., Berlin, und Beirat Forschungsforum öffentliche Sicherheit, FU Berlin, ehrenamtl. Mitgl. Beirat Deutscher Feuerwehrverband, Mitgl. Beirat Stiftung Datenschutz, Mitgl. Beirat Marktwächters Digitale Welt des VZBV, Mitgl. Datenschutzbeirat Dt. Telekom. Mitgl. IG Bau, AWO, Naturfreunde. Mitgl. Katastrophenschutzstab Landkreis Groß-Gerau, Kreisbeauftragter und Fachberater des THW, Mitgl. der SEEBA (Schnelleinsatzeinheit Bergung Ausland des THW), Mitgl. (inaktiv) im Katastrophen-, Erkundungs- und Koordinierungsteam der Vereinten Nationen (UNDAC), div. Hilfseinsätze im In- und Ausland; Mitbegründer Zukunftsforum Öffentliche Sicherheit. Englisch (f). - MdB seit Okt. 2002; stellv. Vors. Ausschuss Digitale Agenda.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 181 (Main-Taunus)', 'Gerold', '11003615');
