INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07466, NULL, NULL, NULL, 'Diplom-Volkswirt', 'verheiratet, 2 Kinder', '10.06.1968', NULL, 'Waldthurn', 'männlich', NULL, '28.01.2014', 'Rupprecht', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rupprecht Consulting, Albersrieth,<br/>Beratung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Neustadt a. d. Waldnaab, Neustadt a. d. Waldnaab, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin, <br/>Mitglied des Beirates für Bildung, Forschung und Technikfolgenabschätzung, ehrenamtlich', '1979/88 Augustinus-Gymnasium Weiden i. d. Oberpfalz, Abitur. Wehrdienst bei der Marine. 1989/95 Studium Volkswirtschaft in Regensburg, Dipl.-Volkswirt, 1990/93 paralleles Zweitstudium, Vordiplom Soziologie. Mitgl. der CSU und der Mittelstandsunion, 1995/99 stellv. Bezirksvors. JU Oberpfalz, seit 1997 CSU-Kreisvorstandsmitgl. Neustadt, 1999/03 Bezirksvors. der JU Oberpfalz, seit Juni 2003 Mitgl. CSU-Bezirksvorst. Oberpfalz. Seit dem 14. Lebensjahr ehrenamtl. Engagement bei einer Vielzahl von Vereinen und Verbänden. - MdB seit Okt. 2002; Nov. 2005/Dez. 2007 stellv. Vors. Ausschuss für Wirtschaft und Technologie, Nov. 2008/Okt. 2009 Vors. Gremium gem. § 10 a Finanzmarktstabilisierungsgesetz (Soffinkontrollgremium); seit Nov. 2009 Vors. der AG Bildung und Forschung der CDU/CSU-Fraktion.', 'Albert', '11003620');
