INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07477, NULL, NULL, NULL, 'Generalsekretär', 'verheiratet, 1 Kind', '03.08.1952', NULL, 'Frankfurt/Main', 'männlich', NULL, '17.10.2002', 'Schäfer', '(Bochum)', 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europäische Bewegung Deutschland, Berlin, <br/>Vizepräsident', '1959 Grundschule, 1963 Gymnasium. 1968 Ausbildung im öffentl. Dienst, Berufsschule und Studieninstitut/FH, 1981/82 Weiterbildung an der Ruhr-Universität Bochum. 1968 Stadtverwaltung Frankfurt/Main, 1972 Stadtverwaltung Bochum. 1983/84 Leiter Europawahlbüro im SPD-Parteivorst. bei Willy Brandt, 1984/94 Leiter Europabüro im SPD-Bezirk Westliches Westfalen. 1999/2001 Akademieleiter einer Europäischen Heimvolkshochschule, seit 2002 Generalsekretär (z. Z. beurlaubt) und seit 2003 Vizepräsident Europäische Bewegung Deutschland. Lehrauftrag an der TH Georg Agricola zu Bochum. Seit 1969 Mitgl. SPD, seit 1970 versch. Parteiämter, seit 1976 Vors. SPD-Ortsverein Querenburg, seit 2001 Mitgl. SPD-Parteirat bzw. -konvent, seit 2000 Mitgl. SPD-Vorst. Westliches Westfalen/LV-NRW. Seit 1995 OSZE-Wahlbeobachter. Mitgl. ver.di, IG BCE, VDK, Heinz-Kühn-BW., Naturfreunde, AWO, ASB, THW, FES, IEP, Städtepartnerschaft, VfL Bochum sowie Kultur-, Karnevals- und Sport-Clubs. 1994/99 MdEP. Englisch (f), Französisch (G). - MdB seit Okt. 2002; 2005/10 Sprecher der AG Angelegenheiten der Europäischen Union, 2009/15 Vors. der Landesgruppe NRW der SPD-Fraktion, seit Sept. 2010 stellv. Vors. der SPD-Fraktion.', 'Axel', '11003624');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07481, NULL, NULL, NULL, 'Magister in Politologie, Wirtschaftswissenschaften und Soziologie', 'verheiratet, 1 Kind', '26.09.1974', NULL, 'Passau', 'männlich', NULL, '17.10.2002', 'Scheuer', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Christlich-Soziale Union in Bayern e.V., München, <br/>Generalsekretär, monatlich, Stufe 3<br/><br/>Private Mills Germany e.V., Neuhemsbach,<br/>Vortrag, 2016, Stufe 1 (Mittelstand und Familienunternehmen in Deutschland - Aktuelle politische Rahmenbedingungen mit Zukunftsausblick)<br/><br/>Funktionen in Unternehmen: <br/>Klinik Prof. Schedel GmbH, Thyrnau/Kellberg,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Passau, Passau, <br/>Mitglied des Stadtrates<br/><br/>ZDF, Mainz, <br/>	Mitglied des Fernsehrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Tschechische und -Slowakische Gesellschaft e.V. (DTSG), Berlin, <br/>Vorsitzender<br/><br/>Herzpartie e.V., Passau, <br/>Vorsitzender', '1994 Abitur am Gymnasium Leopoldinum Passau. 1998 erstes Staatsexamen Lehramt Realschule, anschließend Magisterstudium der Politikwissenschaft, Wirtschaft und Soziologie an der Univ. Passau mit Abschluss 2001; 2004 Promotion an der Karlsuniversität Prag. Seit 1994 Mitgl. der CSU und der JU, 1997/03 JU-Kreisvors. Passau-Stadt, 1999/01 Wahl zum JU-Deutschlandrat, 2001/03 JU-Landesvorst., seit 2001 CSU-Bezirksvorst. Niederbayern, 2003/07 Bezirksvors. der JU Niederbayern, seit Febr. 2016 Bezirksvors. der CSU Niederbayern, seit Dez. 2013 Generalsekretär der CSU. Seit 2002 Stadtrat. - MdB seit Okt. 2002; Okt. 2009/Dez. 2013 Parl. Staatssekretär beim Bundesminister für Verkehr, Bau und Stadtentwicklung und Koordinator der BReg für Güterverkehr und Logistik.', 'Andreas', '11003625');
