INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07490, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt, Parl. Staatssekretär', 'verheiratet, 2 Kinder', '27.08.1971', NULL, 'Hamburg', 'männlich', NULL, '17.10.2002', 'Schröder', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin, <br/>Stellv. Vorsitzender des Aufsichtsrates, von Amts wegen', '1991 Abitur, Wolfgang-Borchert-Gymnasium in Halstenbek. Juni 1991/Sept. 1992 Wehrdienst, Soldat auf Zeit bei der Luftwaffe. 1992/97 Studium der Rechtswissenschaften Univ. Hamburg, 1. jur. Staatsprüfung, 1998/99 Studium Univ. of Stellenbosch/Südafrika, Dez. 1998 Abschluss Master of Laws, Juli 2000 Dr. der Rechtswissenschaften; 1999/Okt. 2001 Referendariat und 2. jur. Staatsprüfung, seit 2001 tätig als Rechtsanwalt. Seit 2005 Kreisvors. CDU Pinneberg, seit 2002 Mitgl. Landesvorst. CDU Schleswig-Holstein. 1994/98 Gemeinderatsmitgl. in Rellingen. Mitgl. Deutsch-Südafrikanische Juristenvereinigung e. V. - MdB seit Okt. 2002; seit Okt. 2007 Vors. der CDU-Landesgruppe Schleswig-Holstein; seit Okt. 2009 Parl. Staatssekretär beim Bundesminister des Innern.', 'Ole', '11003628');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07495, NULL, NULL, NULL, 'Dipl.-Agraringenieur, selbständiger Land-und Forstwirt', 'verheiratet, 4 Kinder', '05.02.1951', NULL, 'Möhnsee-Körbecke', 'männlich', NULL, '17.10.2002', 'Schulte-Drüggelte', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Absatzförderungsfonds der deutschen<br/>Land- und Ernährungswirtschaft, Bonn, <br/>Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Schutzgemeinschaft Deutscher Wald e.V., Bonn, <br/>Vorsitzender des Kreisverbandes Soest<br/><br/>Schutzgemeinschaft Deutscher Wald<br/>Landesverband Nordrhein-Westfalen e.V., Oberhausen, <br/>Mitglied des Vorstandes<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Drüggelter GbR, Möhnesee<br/>MB-Schulte-Drüggelte GbR, Möhnesee', 'Landw. Lehre. GH Paderborn, Fachrichtung Landbau in Soest (Ing. grad.), Univ. Göttingen und Bonn (Dipl.-Ing. agr.), Fachrichtung Wirtschafts- und Sozialwissenschaften. Seit 1978 Selbstständiger Land- und Forstwirt. Mitgl. der CDU seit 1972, 1989/95 Schatzmeister CDU-Kreisverb. Soest, 1995/ Juni 2015 Vors. und seit Okt. 2016 Ehrenvors. CDU-Kreisverb. Soest. 1979/89 Mitgl. im Kreistag Soest, Wahlkreis Möhnesee. Seit 2003 Vors. Schutzgemeinschaft Deutscher Wald, Kreis Soest. - MdB seit Okt. 2002; Mitgl. des Ältestenrates, Mitgl. Haushaltsausschuss, Vors. Unterausschuss zu Fragen der EU, Berichterstatter für internationale Austauschprogramme.', 'Bernhard', '11003629');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07498, NULL, NULL, NULL, 'Redaktionsdirektor, Diplom-Politologe', 'verheiratet, 2 Kinder', '01.03.1968', NULL, 'Hamburg', 'männlich', NULL, '17.10.2002', 'Schulz', '(Spandau)', 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>	Berliner Werkstätten für Menschen mit Behinderung GmbH (BWB), Berlin, <br/>	Mitglied der Gesellschafterversammlung<br/><br/>	Wissenschaftszentrum Berlin für Sozialforschung (WZB) gemeinnützige GmbH, Berlin, <br/>	Mitglied des Kuratoriums<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	FernUniversität in Hagen, Hagen, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Arbeiterwohlfahrt Kreisverband Spandau e.V., Berlin, <br/>	Beisitzer des Vorstandes, ehrenamtlich<br/><br/>	Arbeiterwohlfahrt Landesverband Berlin e.V., Berlin, <br/>	Stellv. Vorsitzender (bis 06.11.2015)<br/><br/>	Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>	Evangelisches Studienwerk e.V. Villigst, Schwerte, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis Ende April 2014)<br/><br/>	Franz-Neumann-Stiftung zur Förderung der Behindertenhilfe und<br/>	pädagogischer Kinder- und Jugendarbeit, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Humanistischer Verband Deutschlands, Landesverband Berlin-Brandenburg e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Wissenschaftsforum der Sozialdemokratie, Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>	Wissenschaftsforum der Sozialdemokratie in Berlin,<br/>	Brandenburg und Mecklenburg-Vorpommern e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Wissenschaftsgemeinschaft Gottfried Wilhelm Leibniz e.V., Berlin, <br/>	Senator, ehrenamtlich<br/><br/>	Wissenschaftsstiftung Ernst Reuter, Berlin, <br/>	Kooptiertes Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>	Zukunftsstiftung der Fraunhofer Gesellschaft, München, <br/>	Mitglied des Stiftungsrates, von Amts wegen', '1987 Abitur in Hamburg. 1987/93 Studium der Politikwissenschaften an der FU Berlin, 1993 Diplom-Politologe. 1994/98 wissenschaftlicher Mitarbeiter im Deutschen Bundestag, 1998/02 Redaktionsdirektor. Seit 1986 Mitgl. der SPD, 1998/08 Vors. der SPD Spandau. 1998/02 Bezirksverordneter in Berlin-Spandau. Mitgl. u.a. Vorstand AWO Spandau, Berliner Komitee für Unesco-Arbeit e. V., Gegen Vergessen - Für Demokratie e. V., Institut für soziale Demokratie, Sozialverband Deutschland e. V. (Reichsbund); Mitgl. Parlamentarischer Beirat Bundesverband Deutscher Stiftungen e. V. - MdB seit Okt. 2002.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 80 (Berlin-Charlottenburg - Wilmersdorf)', 'Swen', '11003630');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07503, NULL, NULL, NULL, 'Groß- und Außenhandelskaufmann', 'ledig', '14.11.1957', 'Australien', 'Adelaide', 'männlich', NULL, '17.10.2002', 'Schummer', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>RWE Power AG, Essen,<br/>Mitglied des Aufsichtsrates (bis 15.06.2016), jährlich, Stufe 4<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesarbeitsgemeinschaft Integrationsfirmen e.V., Berlin,<br/>Mitglied des Beirates<br/><br/>Deutsches Medikamenten-Hilfswerk action medeor e.V., Tönisvorst,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Kolping Berufsbildungswerke in der Diözese Aachen, Aachen,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Lebenshilfe Nordrhein Westfalen e.V., Hürth,<br/>Landesvorsitzender, ehrenamtlich', '1974 Mittlere Reife. 1979/80 Bundeswehr, Sportkompanie Warendorf. 1980/83 kaufmännischer Angestellter bei den Stadtwerken Willich, 1983/87 Jugendbildungsreferent der Kath. Arbeitnehmerbewegung (KAB). 1987/89 Mitarbeiter Büro MdB Norbert Blüm, Pressesprecher der CDA Deutschland, 1998 Chefredakteur des Magazins "Soziale Ordnung", 1996/02 Geschäftsführer der CDA Deutschland. Mitgl. IG-Metall, Kolping und Landesvors. der Lebenshilfe NRW e. V.- MdB seit Okt. 2002; stellv. Vors. der CDU/CSU-Arbeitnehmergruppe und Beauftragter der CDU/CSU-Fraktion für Menschen mit Behinderung.', 'Uwe', '11003631');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07504, NULL, 'Dr.', 'Dr.', 'Wirtschafts- und Sozialwissenschaftler', 'keine Angaben', '19.06.1960', NULL, 'Stirpe', 'männlich', NULL, '17.10.2002', 'Schwanholz', NULL, 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Martin', '11003632');
