INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07514, NULL, NULL, NULL, 'Rechtsanwalt (Tätigkeit ruhend), Parl. Staatssekretär', 'verheiratet, 2 Kinder', '12.11.1968', NULL, 'Kemmern / Lkr. Bamberg', 'männlich', NULL, '17.10.2002', 'Silberhorn', NULL, 'CSU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, selbständig, Berlin (bis Februar 2014)<br/>	Mandant 01, 2014, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Afrikanische Entwicklungsbank (AfDB) und<br/>	Afrikanischer Entwicklungsfonds (AfDF), Abidjan (Elfenbeinküste), <br/>	<br/>Deutscher Gouverneur, von Amts wegen<br/>	Deutsche Welle, Bonn, <br/>	Mitglied des Rundfunkrates, von Amts wegen<br/>	<br/>Landkreis Bamberg, Bamberg, <br/>	Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Christian-Liebig-Stiftung e.V., München, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Deutsche Stiftung Friedensforschung (DSF), Osnabrück, <br/>	Mitglied des Stiftungsrates, von Amts wegen<br/>	<br/>Förderkreis Deutsches Heer e.V., Bonn, <br/>	Mitglied des Präsidiums, ehrenamtlich (bis Februar 2014)<br/>	<br/>Stiftung Wissenschaft und Politik (SWP), Berlin, <br/>	Mitglied des Stiftungsrates, von Amts wegen', '1987 Abitur in Bamberg. 1987/92 Studium der Rechtswissenschaften in Erlangen, München und Bayreuth, 1992 1. jur. Staatsexamen, 1994 2. jur. Staatsexamen. 1994/2000 wissenschaftl. Assistent Univ. Bayreuth, seit 2001 Rechtsanwalt (Tätigkeit ruhend). 1985/03 Mitgl. der JU, 1995/03 Mitgl. Landesausschuss JU Bayern, 1998/02 Mitgl. Bundesvorst. JU Deutschland; seit 1987 Mitgl. der CSU, seit 2009 Kreisvors. CSU Bamberg-Land, seit 2005 stellv. Bezirksvors. CSU Oberfranken, 2001/05 und 2007/09 CSU-Parteivorst. Seit 2002 Mitgl. Kreistag Bamberg. Englisch (f), Französisch (f). - MdB seit Okt. 2002; Jan./Feb. 2014 stellv. Vors. der CDU/CSU-Fraktion. Seit Feb. 2014 Parl. Staatssekretär beim BMin für wirtschaftl. Zusammenarbeit und Entwicklung.', 'Thomas', '11003636');
