INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07520, NULL, NULL, NULL, 'Bankkaufmann, Politologe', 'ledig', '16.05.1980', NULL, 'Ahaus', 'männlich', NULL, '17.10.2002', 'Spahn', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>4C Group AG, Berlin, <br/>	Vortrag, 2015, Stufe 2 (Zukunft der GKV)<br/><br/>	Berufsverband der Niedergelassenen Hämatologen und Onkologen<br/>	in Deutschland - BNHO e.V., Berlin, <br/>	Vortrag, 2014, Stufe 1 (Die onkologische fachärztliche Versorgung<br/>	in Deutschland)<br/><br/>	Comline AG, Dortmund, <br/>	Vortrag, 2014, Stufe 2 (GKV-Infotag)<br/><br/>	ConEvent GmbH, Hamburg, <br/>	Vortrag, 2015, Stufe 1 (Aktuelle Fragen der Gesundheitsversorgung)<br/><br/>	DKG e.V., Berlin, <br/>	Vortrag, 2014, Stufe 1 (Qualitätskongreß)<br/><br/>	face to face GmbH, Köln, <br/>	Vortrag, 2014, Stufe 2 ("Transplantationssymposium",<br/>	Astellas GmbH, München)<br/><br/>	Keppler Verlag GmbH, Heusenstamm, <br/>	Vortrag, 2015, Stufe1 (Apotheke 2020)<br/><br/>	MEDA Pharma GmbH und Co. KG, Bad Homburg v.d. Höhe, <br/>	Moderation, 2014, Stufe 2 (Arzneimittelversorgung)<br/><br/>	Moventus GmbH, Berlin, <br/>	Vortrag, 2015, Stufe 2 (Seltene Erkrankungen)<br/><br/>	SPS Bamberg GmbH, Bamberg, <br/>	Vortrag, 2015, Stufe 2 (Zukunftsforum Krankenkassen)<br/><br/>	Summary Seven Consulting GmbH, Münster, <br/>	Vortrag, 2014, Stufe 1 ("Qualität in der Versorgung", Otto Bock GmbH,<br/>	Duderstadt)<br/><br/>	Unicredit Bank AG, München, <br/>	Vortrag, 2013, Stufe 1 (Kundenseminar)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreis Borken, Borken, <br/>	Mitglied des Kreistages (bis 22.06.2015)<br/><br/>	Sparkasse Westmünsterland, Dülmen, <br/>	Mitglied des Verwaltungsrates (bis 22.06.2015), jährlich, Stufe 3<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche AIDS-Stiftung, Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Deutsche Bundesstiftung Umwelt (DBU), Osnabrück, <br/>	Mitglied des Kuratoriums<br/><br/>	Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin, <br/>	Vorsitzender des Beirates für Gesundheit, ehrenamtlich (bis 16.03.2015)<br/><br/>	Jugend gegen AIDS e.V., Hamburg, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>Kulturstiftung des Bundes, Halle/Saale,<br/>Mitglied des Kuratoriums<br/><br/>	Stiftung "Humanitäre Hilfe für durch Blutprodukte HIV-infizierte<br/>	Personen", Bonn, <br/>	Vorsitzender des Stiftungsrates', 'Abitur 1999. 1999/2001 Ausbildung zum Bankkaufmann, anschließend Studium der Politikwissenschaft, 2008 Bachelor of Arts (B. A.). Mitgl. der JU seit 1995, Mitgl. der CDU seit 1997, seit 2005 Vors. des CDU-Kreisverb. Borken, seit Dez. 2012 Mitgl. Bundesvorst. der CDU Deutschlands, seit Dez. 2014 Mitgl. Präsidium der CDU Deutschlands. 1999/09 Mitgl. im Rat der Stadt Ahaus, 2009/15 Mitgl. Kreistag Kreis Borken. Mitgl. der Katholischen Jungen Gemeinde (KJG), Mitgl. in diversen Vereinen und Verbänden. - MdB seit Okt. 2002; 2005/09 Obmann und 2009/15 Vors. der AG Gesundheit der CDU/CSU-Fraktion; seit Juli 2015 Parl. Staatssekretär beim Bundesminister der Finanzen.', 'Jens', '11003638');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07525, 'Frhr.', NULL, NULL, 'Dipl.-Betriebswirt (FH), Selbständiger Unternehmer', 'verheiratet, 1 Kind', '24.07.1970', NULL, 'Stuttgart', 'männlich', NULL, '17.10.2002', 'Stetten', NULL, 'CDU', 'von', 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Kriwan Industrie-Elektronik GmbH, Forchtenberg,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Schloss Stetten Holding AG, Künzelsau,<br/>Vorsitzender des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Honorarkonsulat der Republik der Malediven, Berlin,<br/>Honorarkonsul, ehrenamtlich (bis 31.12.2015)<br/><br/>Landkreis Hohenlohe, Künzelsau,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Regionalverband Heilbronn-Franken, Heilbronn,<br/>Mitglied der Verbandsversammlung, ehrenamtlich (bis 24.10.2014)<br/><br/>Stadt Künzelsau, Künzelsau,<br/>Mitglied des Stadtrates, ehrenamtlich<br/>Erster stellv. Bürgermeister, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Anne-Schmidt-Brücken-Stiftung, Künzelsau,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Bürgerverein Berlin-Hohenlohe e.V., Berlin,<br/>Vorsitzender, ehrenamtlich<br/><br/>Extrem-Sportclub Hohenlohe e.V., Künzelsau,<br/>Vorsitzender, ehrenamtlich<br/><br/>Friedrich Kriwan-Stiftung, Forchtenberg,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Förderverein der Künzelsauer Burgfestspiele Schloß Stetten e.V., Künzelsau,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Stiftung des Hohenlohekreises und der Stadt Künzelsau zur Förderung der Reinhold Würth Hochschule, Künzelsau,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Verein zur Förderung der Arbeit des Parlamentskreises Mittelstand e.V., Berlin,<br/>Vorsitzender, ehrenamtlich<br/><br/>Wolfgang von Stetten Stiftung, Künzelsau,<br/>Vorsitzender des Ritterrates, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Barockschloss Stetten GmbH, Künzelsau<br/><br/>	Schloss Stetten Holding AG, Künzelsau<br/><br/>	Stetten Bau GmbH, Künzelsau<br/><br/>	Technologie Holding Christian Stetten GmbH, Künzelsau', 'Während des Studiums der Betriebswirtschaftslehre 1994 Schritt in die Selbstständigkeit und Unternehmensgründung 1996, geschäftsführender Gesellschafter und seit 2009 Aufsichtsratsvorsitzender der eigenen Unternehmen. 1990/02 verschiedene Vorstandsfunktionen innerhalb der JU Deutschlands; seit 2003 Bundesvorstandsmitgl. der Mittelstands- und Wirtschaftsvereinigung der CDU/CSU (MIT); seit 2015 Präsidiumsmitgl. des CDU Wirtschaftsrats e. V.; seit 2005 Mitgl. im Bundesvorst. der Kommunalpolitischen Vereinigung der CDU/CSU (KPV). Seit 1994 Stadtrat in Künzelsau, und erster stellv. Bürgermeister und seit 1994 Kreisrat des Hohenlohekreises. Vorstands- und Beiratsmitgl. zahlr. kultureller und soz. Vereine und Stiftungen. - MdB seit Okt. 2002; mittelstandspol. Sprecher der CDU/CSU-Fraktion und Vors. Parlamentskreis Mittelstand (PKM).', 'Christian', '11003639');
