INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07532, NULL, NULL, NULL, 'Dipl.-Betriebswirt (FH)', 'verheiratet, 3 Kinder', '12.02.1958', NULL, 'Bad Segeberg', 'männlich', NULL, '17.10.2002', 'Storjohann', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>	Post und Eisenbahnen, Bonn, <br/>Vorsitzender des Eisenbahninfrastrukturbeirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Verkehrswacht e.V., Berlin, <br/>	Mitglied des Präsidiums, ehrenamtlich (bis 04.06.2016)<br/><br/>	Landesverkehrswacht Schleswig-Holstein e.V., Kiel, <br/>	Präsident, ehrenamtlich (bis 29.04.2015)<br/><br/>	THW-Landesvereinigung Schleswig-Holstein e.V., Kiel, <br/>	Stellv. Vorsitzender, ehrenamtlich (bis 13.06.2015)', 'Abitur. 2 Jahre Soldat auf Zeit. Lehre zum Kaufmann im Groß- und Außenhandel. Studium der Betriebswirtschaftslehre, Abschluss Dipl.-Betriebswirt (FH). 1989/94 Sachbearbeiter im Kostencontrolling. 1975 Mitgl. der JU, 1977 der CDU, 1982/91 Kreisvors. der JU Segeberg, seit 1997 CDU-Kreisvors. 1990/94 Kreistagsabg., 1987/02 Gemeindevertreter. MdL Schleswig-Holstein 1994/02. Englisch (G). - MdB seit Okt. 2002.', 'Gero', '11003643');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07535, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet', '12.06.1949', NULL, 'Velbert', 'männlich', NULL, '17.10.2002', 'Strässer', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwälte König, Strässer & Partner GbR, Münster, <br/>Rechtsanwalt<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsches Institut für Menschenrechte e.V., Berlin, <br/>Mitglied des Kuratoriums<br/><br/>Kneipp-Bund e.V., Bad Wörishofen, <br/>Vorsitzender des Schiedsausschusses, ehrenamtlich', '1967 Abitur am Städtischen Neusprachlichen Gymnasium in Velbert. Wehrdienst in Mittenwald als Gebirgsjäger. Ab 1969 Studium der Rechtswissenschaften Ruhruniv. Bochum, ab 1970 an der Westfälischen Wilhelms-Univ. Münster, 1974 1. Staatsexamen, 1980 2. Staatsexamen in Münster. Jugendbildungsreferent beim Landesverband NRW der Jungdemokraten, danach Referendariat am Landgericht Wuppertal. Seit 1982 Rechtsanwalt in Münster, seit 1993 zusätzlich auch in Wittenberg, Sachsen-Anhalt. Seit Okt. 2016 Präsident Preußen Münster. 1969 Eintritt in die Jungdemokraten, 1977/80 Bundesvors. der Jungdemokraten, bis 1982 Mitgl. Bundesvorst. der FDP, 1982 Austritt aus der FDP wegen der Aufkündigung der Sozialliberalen Koalition. 1984 Eintritt in die SPD, 1993/07 Vors. Unterbezirk. Münster. 1999/02 Mitgl. Rat der Stadt Münster als Vors. der Finanz- und Beteiligungskommission. Politisches Engagement in der Umwelt- und Friedensbewegung, intensive Beschäftigung mit Fragen der Menschenrechts- und Rechtspolitik. Englisch (f), Französisch (G). - MdB seit Okt. 2002; Dez. 2005/Jan. 2014 Sprecher der AG Menschenrechte und humanitäre Hilfe der SPD-Fraktion; Jan. 2014/Feb. 2016 Beauftragter der BReg für Menschenrechtspolitik und humanitäre Hilfe.', 'Christoph', '11003644');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07539, NULL, NULL, NULL, 'Vizepräsidentin DBT, Rechtsanwältin, Parl. Geschäftsführerin', 'verheiratet, 4 Kinder', '24.12.1959', NULL, 'Düsseldorf', 'weiblich', NULL, '01.01.2003', 'Noll', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Förderkreis ZNS Langenfeld e.V., Langenfeld,<br/>Präsidentin, ehrenamtlich<br/><br/>Katholische Arbeitsgemeinschaft für Soldatenbetreuung e.V., Bonn,<br/>Vorsitzende des Vorstandes, ehrenamtlich (bis 05.05.2015)', '1982/87 Studium der Rechtswissenschaft, 1987 1. jur. Staatsprüfung, 1991 2. jur. Staatsprüfung. 1994/01 Referentin der Frauen-Union NRW in Düsseldorf, seit 2001 Rechtsanwältin. 2010/12 stellv. Landesvors. der CDU Nordrhein-Westfalen, stellv. Vors. der CDU im Kreis Mettmann, bis 2013 stellv. Vors. BFA Familie, Frauen, Senioren und Jugend der CDU Deutschlands. Präsidentin "Förderkreis ZNS Langenfeld e. V. ", Schirmherrin Franziskus-Hospiz Hochdahl, Schirmherrin "Zündstoff - die 2. Chance" Erkrath. Englisch (f), Französisch (f). - MdB seit Okt. 2002; Jan. 2008/Okt. 2009 Obfrau der CDU/CSU-Fraktion im Ausschuss für Familie, Frauen, Senioren und Jugend; Nov. 2009/März 2010 Justiziarin und April 2010/Jan. 2017 Parl. Geschäftsführerin der CDU/CSU-Fraktion; Mitgl. Ältestenrat, seit 19. Jan. 2017 Vizepräsidentin des Bundestages.', 'Michaela', '11003645');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07542, NULL, NULL, NULL, 'Steuerberaterin, Diplomfinanzwirtin', 'geschieden, 1 Kind', '28.08.1964', NULL, 'Düsseldorf', 'weiblich', NULL, '17.10.2002', 'Tillmann', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkassenzweckverband Mittelthüringen, Erfurt, <br/>	Mitglied des Verbandsrates (bis 16.09.2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Freundeskreis des Evangelischen Augustinerklosters zu Erfurt e.V.,<br/>	Erfurt, <br/>	Mitglied des Vorstandes<br/><br/>Katholische Schulstiftung im Bistum Erfurt, Erfurt, <br/>	Mitglied des Beirates', 'Abitur. Studium an der Fachhochschule für Finanzen, 1986 Abschluss als Dipl.-Finanzwirtin, anschl. Finanzbeamtin in NRW, 1991 Wechsel nach Brandenburg zum Mitaufbau der dortigen Fachhochschule. 1993/98 Finanzbeamtin im Thüringer Finanzministerium. 1998 Steuerberaterprüfung, nun tätig als Steuerberaterin. Fortbildungsprüfung zur Landwirtschaftlichen Buchstelle. 1989/93 Mitgl. im Stadtrat Neuss, 1994/02 und seit 2014 Mitgl. im Erfurter Stadtrat, 1998/02 Fraktionsvors.; Mitgl. im Steuerberaterverband Thüringen, Mitgl. Mittelstandsvereinigung und CDA. Mitgl. im Beirat des Staatswissenschaftlichen Forums e. V., Mitgl. Förderverein Ursulinenkloster Erfurt, Mitgl. Beirat Katholische Schulstiftung im Bistum Erfurt, Vorstandsmitgl. Freundeskreis des Ev. Augustinerklosters zu Erfurt e. V. Englisch (G). - MdB seit Okt. 2002; seit Jan. 2014 Vors. der AG Finanzen der CDU/CSU-Fraktion.', 'Antje', '11003646');
