INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07551, NULL, NULL, NULL, 'Mechaniker, Dipl.-Ingenieur (FH), Technischer Geschäftsleiter', 'verheiratet, 2 Kinder', '18.01.1959', NULL, 'Gera', 'männlich', NULL, '27.10.2009', 'Vogel', '(Kleinsaara)', 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Deutsche Einheit Fernstraßenplanungs- und -bau GmbH (DEGES), Berlin, <br/>Mitglied des Aufsichtsrates<br/><br/>Deutsche Rockwool GmbH + Co. OHG, Gladbeck, <br/>Mitglied des Fachbeirates, jährlich, Stufe 4<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas,<br/>Telekommunikation, Post und Eisenbahnen, Bonn, <br/>Mitglied des Eisenbahninfrastrukturbeirates<br/><br/>Deutsches Nationalkomitee für Denkmalschutz, Bonn, <br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Landkreis Greiz, Greiz, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Gütegemeinschaft Brandschutz im Ausbau e.V., Berlin, <br/>Mitglied des Politisch-Parlamentarischen Beirates<br/><br/>THW-Landesvereinigung Sachsen und Thüringen e.V., Altenburg, <br/>Stellv. Vorsitzender<br/><br/>Volkssolidarität Kreisverband Altenburger Land e.V., Altenburg, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Wirtschaftsverband Brandschutz e.V. - WVB, Berlin, <br/>Mitglied des Politisch- Parlamentarischen Beirates', '1978 Abitur mit Facharbeiterausbildung. 1981/86 Fernstudium an der FH "Carl Zeiss" in Jena. 1986/91 Technischer Leiter im Schlachthof Gera. Seit 1991 Abfallwirtschaftszweckverband Ostthüringen, seit 1992 dort Technischer Geschäftsleiter. Seit 1981 Mitgl. der CDU, 1991/10 Kreisvors., seit Jan. 2002 Mitgl. in der Mittelstands- und Wirtschaftsvereinigung der CDU. 1990/99 und seit 2004 Kreistagsmitgl. Landkreis Greiz. Mitgl. Volkssolidarität Kreisverband Altenburger Land e. V., Fördermitgl. der Freiwilligen Feuerwehr in Saara, seit Feb. 2011 Mitgl. im Präsidium des Dt. Nationalkomitees für Denkmalschutz, seit März 2010 Mitgl. des Aufsichtsrats der DEGES - Dt. Einheit Fernstraßenplanungs- und -bau GmbH, seit 2014 stellv. Mitgl. Stiftungsrat Stiftung Berliner Schloss-Humboldtforum, seit 2014 Mitgl. Stiftungsrat Bundesstiftung Baukultur, seit Okt. 2014 Mitgl. im Beirat des Verbandes Wohneigentum. Englisch (G), Russisch (G). - MdB seit Okt. 2002.', 'Volkmar', '11003650');
