INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07564, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 2 Kinder', '10.10.1975', NULL, 'Chemnitz', 'männlich', NULL, '17.10.2002', 'Wanderwitz', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Rechtsanwälte Prof. Mayer & Kollegen, Leipzig, <br/>	Rechtsanwalt<br/><br/>Funktionen in Unternehmen: <br/>	SRM Sachsenring-Rennstrecken-Management GmbH, Hohenstein-Ernstthal,<br/>Vorsitzender des Aufsichtsrates<br/><br/>Tourismus und Sport GmbH Stausee Oberwald, Callenberg,<br/>Mitglied des Aufsichtsrates<br/><br/>Volksbank Mittweida eG, Mittweida,<br/>Mitglied des Aufsichtsrates<br/><br/>Wohnungsgesellschaft Hohenstein-Ernstthal mbH, Hohenstein-Ernstthal,<br/>Mitglied des Aufsichtsrates (bis 08.07.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Deutsche Welle, Bonn,<br/>Mitglied des Rundfunkrates und Vorsitzender des Distributionsausschusses<br/><br/>FFA - Filmförderungsanstalt, Berlin,<br/>Mitglied des Verwaltungsrates und des Präsidiums<br/><br/>Landkreis Zwickau, Zwickau,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Stadt Hohenstein-Ernstthal, Hohenstein-Ernstthal,<br/>Mitglied des Stadtrates, ehrenamtlich<br/><br/>Zweckverband "Am Sachsenring", Hohenstein-Ernstthal,<br/>Mitglied des Verbandsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Portugiesische Gesellschaft e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Förderverein Gedenkstätte Stollberg - Frauenhaftanstalt Hoheneck e.V., Stollberg,<br/>Mitglied des Vorstandes, ehrenamtlich (bis 07.11.2015)<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Vorsitzender des Beirates für Medien, Internet und Telekommunikation, ehrenamtlich<br/><br/>Initiative Südwestsachsen e.V, Chemnitz,<br/>Mitglied des Vorstandes, ehrenamtlich (bis 31.12.2015)', '1994/95 Wehrdienst. 1995/2000 Hochschulstudium. Kreisvors. der CDU Zwickau, Vors. Netzwerk Medien und Regulierung der CDU Deutschlands. Ehrenamtl. Stadtrat der Großen Kreisstadt Hohenstein-Ernstthal, ehrenamtl. Verbandsrat Zweckverband "Am Sachsenring", ehrenamtl. Kreisrat Landkreis Zwickau. Vors. Aufsichtsrat der SRM Sachsenring Rennstrecken Management GmbH, Mitgl. Aufsichtsrat Volksbank Mittweida eG., Mitgl. Präsidium der Filmförderungsanstalt, Vors. Distributionsausschuss des Rundfunkrats der Deutschen Welle. - MdB seit Okt. 2002; Mitgl. im Fraktionsvorst, seit Jan. 2014 Vors. der AG Kultur und Medien der CDU/CSU-Fraktion; Mitgl. Richterwahlausschuss.', 'Marco', '11003655');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07565, NULL, NULL, NULL, 'Geschäftsführer', 'verheiratet, 2 Kinder', '24.06.1964', NULL, 'Werdau', 'männlich', NULL, '17.10.2002', 'Weigel', NULL, 'SPD', NULL, 'evangelisch', NULL, NULL, NULL, 'Andreas', '11003656');
