INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07572, NULL, NULL, NULL, 'Vorsitzender Richter am Landgericht a. D.', 'verheiratet, 2 Kinder', '16.12.1959', NULL, 'Karlsruhe', 'männlich', NULL, '17.10.2002', 'Wellenreuther', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Fußballbund e.V. (DFB), Frankfurt/Main, <br/>Mitglied des Vorstandes<br/><br/>Karlsruher Kindertisch e.V., Karlsruhe, <br/>1. Vorsitzender<br/><br/>Karlsruher Sport-Club Mühlburg-Phönix e.V., Karlsruhe, <br/>Präsident', '1970/79 Goethe-Gymnasium Karlsruhe. 1979/85 Jurastudium, 1986 erstes Staatsexamen, 1986/89 Rechtsreferendar, 1989 zweites Staatsexamen. 1989/91 Staatsanwalt in Baden-Baden, 1991/2000 Richter am Landgericht Karlsruhe; 2000 Referent der CDU/CSU-Bundestagsfraktion im 1. Untersuchungsausschuss "Parteispenden". 2001 Oberlandesgericht Karlsruhe (abgeordnet), seit Okt. 2002 Vorsitzender Richter am Landgericht a. D. Seit 2010 Präsident des Karlsruher Sportclub e. V. (KSC), seit 2013 Mitgl. Vorst. des Dt. Fußball-Bundes e. V. (DFB), seit 2002 Vorstandsmitgl. Landesvereinigung Baden in Europa e. V. und Kuratoriumsmitgl. im Internationalen Bund - Freier Träger der Jugend-, Sozial- und Bildungsarbeit e. V., 2006/11 Mitgl. im Kuratorium der Stiftung "Erinnerung, Verantwortung und Zukunft"; seit 2007 Mitgl. im Kuratorium der Bundeszentrale für politische Bildung, seit 2008 Vors. Karlsruher Kindertisch e. V. Seit 2002 Kreisvors. der CDU Karlsruhe. 1999/13 Stadtrat in Karlsruhe. - MdB seit Okt. 2002.', 'Ingo', '11003658');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07576, NULL, NULL, NULL, 'Dipl.-Ökonomin', 'verheiratet, 1 Kind', '06.03.1958', NULL, 'Potsdam-Babelsberg', 'weiblich', NULL, '17.10.2002', 'Wicklein', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>GSE Protect Gesellschaft für Sicherheit und Eigentumsschutz mbH,<br/>	Potsdam, <br/>	Mitglied des Aufsichtsrates (bis 31.07.2016)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Potsdam-Mittelmark, Belzig, <br/>	Mitglied des Kreistages (bis 07.11.2014)<br/><br/>	Stiftung zur Aufarbeitung der SED-Diktatur, Berlin, <br/>	Mitglied des Stiftungsrates, ehrenamtlich (bis Februar 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Forum Ostdeutschland der Sozialdemokratie e.V., Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Internationaler Bund (IB) Freier Träger der Jugend-, Sozial- und Bildungsarbeit e.V., Frankfurt/Main,<br/>Mitglied des Bundeskuratoriums, ehrenamtlich (bis 31.10.2016)<br/><br/>Verein für Demokratie, politische und kulturelle Bildung Potsdam e.V., Potsdam,<br/>Vorsitzende, ehrenamtlich<br/><br/>Wissenschaftsforum der Sozialdemokratie in Berlin, Brandenburg und Mecklenburg-Vorpommern e.V., Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich', '1964/74 POS. Berufsausbildung zur Fachverkäuferin mit Abitur 1977. 1978/84 Fernstudium Handels-Hochschule Leipzig, Dipl.-Ökonomin. 1977/90 Verwaltungsangestellte, Lehrausbilderin in der Berufsausbildung, Lehrerin für Erwachsenenbildung in der Einzelhandelsorganisation Potsdam; 1990/91 arbeitslos. 1991 Verkäuferin FILA Deutschland GmbH, 1991/92 Mitarbeiterin Bürgerberatung Brandenburg e. V. im Haus des SPD-Landesverb. 1992/2000 Mitarbeiterin in einem Bundestagsbüro; 2000/2002 Referentin für Öffentlichkeitsarbeit der SPD-Landtagsfraktion Brandenburg. 1992 Eintritt in die SPD. Vors. Verein für Demokratie, politische und kulturelle Bildung Potsdam e. V., Mitgl. AWO Potsdam, Mitgl. Vorst. Wissenschaftsforum der Sozialdemokratie Berlin, Brandenburg, Mecklenburg-Vorpommern, Mitgl. der IG Metall. Mitgl. Verein proWissen e. V., der Universitätsgesellschaft Potsdam e. V., im Verein der Freunde und Förderer des PIK e. V., im Verein Gegen Vergessen - Für Demokratie e. V., Berlin, Mitgl. Universitätsgesellschaft Potsdam e. V., Mitgl. Förderverein Begegnungshaus der Generationen Nuthetal e. V. und Mitgl. Kuratorium DLRG-Landesverb. Brandenburg e. V.- MdB seit Okt. 2002.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 62 (Dahme-Spreewald - Teltow-Fläming III - Oberspreewald-Lausitz I)', 'Andrea', '11003659');
