INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07584, NULL, NULL, NULL, 'Stellvertr. Schulleiter, Studiendirektor a. D.', 'Lebensgemeinschaft', '29.08.1950', NULL, 'Bülkau / Niedersachsen', 'männlich', NULL, '17.10.2002', 'Zöllmer', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Schufa Holding AG, Wiesbaden, <br/>Vorsitzender des Verbraucherbeirates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht, Bonn, <br/>Mitglied des Verwaltungsrates', '1970 Abitur am Max-Planck-Gymnasium Dortmund. Studium der Volks- und Betriebswirtschaft sowie Sozialwissenschaften an der Ruhr-Univ. Bochum, 1976 1. Staatsprüfung für das Lehramt an Gymnasien, 1977 2. Staatsprüfung. Seit 1977 Lehrtätigkeit am Bergischen Kolleg in Wuppertal (2. Bildungsweg); 1982 Ernennung zum Oberstudienrat, 1998 Ernennung zum Studiendirektor und stellv. Schulleiter. Seit 1972 Mitgl. der SPD, 1981/94 Vors. Ortsverein Elberfeld-Nordstadt, 2000/12 Mitgl. im Unterbezirksvorst. 1989/02 Mitgl. im Rat der Stadt Wuppertal, 1993/99 stellv. Fraktionsvors., 1999/02 Vors. Mitgl. im Verwaltungsrat und im Haushaltskontroll- und Prüfungsausschuss der BaFin. Mitgl. GEW, AWO, Else-Lasker-Schüler-Gesellschaft, Bürgerverein Elberfelder Nordweststadt und SV Bayer. Englisch (f). - MdB seit Okt. 2002; 2005/09 stellv. Vors. Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz; stellv. Vors. der Dt.-Brasilianischen Parlamentariergruppe; seit Mai 2012 stellv. finanzpol. Sprecher der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 103 (Solingen - Remscheid - Wuppertal II)', 'Manfred', '11003663');
