INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07592, NULL, NULL, NULL, 'Handwerksunternehmerin, Damenschneidermeisterin', 'verheiratet, 1 Kind', '20.12.1952', NULL, 'Münster / Westfalen', 'weiblich', NULL, '03.07.2003', 'Strothmann', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Kleegräfe und Strothmann GmbH & Co KG, <br/>Gütersloh, Einzelhandel und Handwerk<br/>Geschäftsführerin<br/><br/>Funktionen in Unternehmen: <br/>Handwerksbau AG, Dortmund, <br/>Mitglied des Aufsichtsrates<br/><br/>Signal Iduna Unfallversicherung a.G., Dortmund, <br/>Mitglied des Aufsichtsrates, jährlich, Stufe 4<br/><br/>Verlagsanstalt Handwerk GmbH, Düsseldorf, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Handwerkskammer Ostwestfalen-Lippe zu Bielefeld, Bielefeld, <br/>Präsidentin, monatlich, Stufe 1<br/><br/>Nordrhein-Westfälischer Handwerkstag (NWHT), Düsseldorf, <br/>Mitglied des Vorstandes<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Zentralverband des Deutschen Handwerks e.V. (ZDH), Berlin, <br/>Mitglied des Präsidiums<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Kleegräfe und Strothmann GmbH & Co KG, Gütersloh', 'Gymnasium. Lehre zur Damenschneiderin in Lippstadt, Studium Modedesign und Meisterprüfung in München. 1977 Designerin und Ausbilderin in der Bekleidungsindustrie in Gütersloh, seit 1983 selbstständig, seit 1993 Geschäftsführerin "Kleegräfe und Strothmann - Die Maßschneider". 1997 Mitgl. der CDU, 2005 stellv. Kreisvors. der CDU Bielefeld, 2001 Mitgl. des Bezirksvorst. Ostwestfalen-Lippe. 1999/03 Mitgl. Rat der Stadt Gütersloh. 1998 Präsidentin der Handwerkskammer Ostwestfalen-Lippe zu Bielefeld. 2005 Mitgl. des Präsidiums des ZDH und Vors. des Ausschusses Organisation und Recht des ZDH. - MdB seit Juli 2003.', 'Lena', '11003699');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07593, NULL, 'Dr.', 'Dr.', 'Richter am Landgericht a. D.', 'verheiratet, 1 Kind', '22.04.1970', NULL, 'Landau / Pfalz', 'männlich', NULL, '23.01.1904', 'Wissing', NULL, 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Volker', '11003702');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07594, NULL, NULL, NULL, 'Dipl.-Pädagogin a. D., Rektorin', 'verheiratet', '26.06.1951', NULL, 'Norderney', 'weiblich', NULL, '18.05.2004', 'Drobinski-Weiß', NULL, 'SPD', NULL, 'katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Stiftung Verbraucherschutz, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Deutsch-Französisches Jugendwerk (DFJW), Berlin,<br/>Stellv. Mitglied des Beirates, ehrenamtlich<br/><br/>Initiative "Genießt uns!" Initiative gegen die Verschwendung von<br/>Lebensmitteln vom Erzeuger bis zum Verbraucher, Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Zentrum für Europäischen Verbraucherschutz e.V., Kehl,<br/>Mitglied des Verwaltungsbeirates, ehrenamtlich', 'Abitur an der Liebfrauenschule in Oldenburg. 1971/77 Studium der Pädagogik an der Carl-von-Ossietzky-Univ. in Oldenburg, 1. und 2. Staatsprüfung für das Lehramt an Grund- und Hauptschulen, Diplompädagogin. 1975/79 Schuldienst in Niedersachsen, ab 1979 in Baden-Württemberg, zuletzt als Rektorin an der Grund- und Hauptschule mit Werkrealschule Kollnau in Waldkirch. Mitgl. der SPD seit 1976, 2005/13 stellv. Vors. der SPD Baden-Württemberg. 1989/90 Gemeinderätin in Bahlingen. Mitgl. in verschiedenen örtlichen Vereinen, u. a. beim Deutschen Roten Kreuz Kehl, im Verein "Gegen Vergessen - Für Demokratie", im Förderverein Ursulaheim Offenburg. Trägerin des "Ordine della Stella della Solidarieta Italiana". Kuratoriumsmitgl. Deutsche Stiftung Verbraucherschutz, Mitgl. Verwaltungsbeirat Zentrum für Europäischen Verbraucherschutz e. V. - MdB seit Mai 2004; verbraucherpol. Sprecherin der SPD-Fraktion; Mitgl. der Parl. Versammlung der OSZE.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 286 (Schwarzwald-Baar)', 'Elvira', '11003705');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07595, NULL, NULL, NULL, 'Landwirtschaftsmeister', 'ledig', '09.03.1963', NULL, 'Oberhochstatt', 'männlich', NULL, '29.07.2004', 'Auernhammer', NULL, 'CSU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Landwirt, Oberhochstatt<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Landwirt, selbständig, Oberhochstatt<br/>   Molkerei Neuburg, Neuburg, 2013, Stufe 3<br/>   NVG-bovex GmbH, Würzburg, 2013, Stufe 3<br/>   Vertragspartner 1, 2014, Stufe 4; 2015, Stufe 3; 2016, Stufe 3<br/>   Vertragspartner 2, 2014, Stufe 4<br/>   Vertragspartner 3, 2014, Stufe 5; 2015, Stufe 5; 2016, Stufe 5<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bayerischer Bauernverband, München,<br/>Stellv. Kreisobmann, ehrenamtlich<br/><br/>Landkreis Weißenburg-Gunzenhausen, Weißenburg,<br/>Mitglied des Kreistages<br/><br/>Stadt Weißenburg i. Bay., Weißenburg,<br/>Mitglied des Stadtrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Maschinen- und Betriebshilfsring Weißenburg-Gunzenhausen e.V., Weißenburg,<br/>Vorsitzender des Vorstandes, ehrenamtlich', 'Berufsfachaufbauschule für Landwirtschaft in Ansbach, Landwirtschaftliche Lehre, Landwirtschaftliche Fachschule, Höhere Landbauschule Triesdorf. Studienkurs "Landwirtschaft und Interessenvertretung" Deutsche Landjugendakademie in Bonn-Röttgen. 1985 Übernahme des elterlichen Bauernhofes mit Schwerpunkt Milchviehhaltung. 1994 Eintritt in die CSU, stellv. Landesvors. CSU-AG Landwirtschaft (AGL), Gründungsmitgl. und stellv. Landesvors. CSU-Arbeitskreis Energiewende (AKE). Seit 1996 Kreisrat, seit 2002 Stadtrat. Vors. Maschinen- und Betriebshilfsring, stellv. Kreisobmann, Ortsobmann des Bayer. Bauernverbandes; bis zum Eintritt in den Bundestag ehrenamtl. Richter am Bayer. VGH; ehrenamtl. Richter am OLG Nürnberg; seit Nov. 2015 ehrenamtl. Vorstandsvors. des Bundesverbands BioEnergie. - MdB Juli 2004/05 und seit Okt. 2013.', 'Artur', '11003706');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07596, NULL, NULL, NULL, 'Juristin', 'verheiratet, 3 Kinder', '01.08.1943', NULL, 'Nordhausen', 'weiblich', NULL, '28.07.2004', 'Schmid', NULL, 'CDU', NULL, 'katholisch', NULL, NULL, NULL, 'Angela', '11003708');
