INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07598, NULL, 'Dr.', 'Dr.', 'Sprachwissenschaftlerin, Bankkauffrau, Dipl.-Informatikerin (FH)', 'keine Angaben', '24.05.1967', NULL, 'Freilassing', 'weiblich', NULL, '21.09.2004', 'Kofler', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Traunstein, Traunstein, <br/>	Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>CARE Deutschland-Luxemburg e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Deutscher Akademischer Austauschdienst e.V. (DAAD), Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Eine Welt Netzwerk Bayern e.V., Augsburg,<br/>Prominentes Fördermitglied, ehrenamtlich<br/><br/>mobifair - Verein fairer Wettbewerb in der Mobilitätswirtschaft e.V., Frankfurt/Main,<br/>Mitglied des Vorstandes, ehrenamtlich (bis November 2014)<br/><br/>Programm für Arbeits- und Studien-Aufenthalte (ASA), Bonn,<br/>Mitglied des Beirates, ehrenamtlich (bis Januar 2014)', '1983 Mittlere Reife. 1983/86 Banklehre. 1987 Fachhochschulreife (Zweiter Bildungsweg), 1987/92 Informatikstudium an der FH Rosenheim, 1992/96 Studium der Sprachwissenschaften, Russisch und Spanisch an der Univ. Salzburg. 1998 Promotion Dr. phil. 1986/87 Bankangestellte. 1996/99 Angestellte einer Salzburger Tourismusfirma, 1999/01 DAAD-Lektorin in Moskau, 2001/02 Sprachlehrerin Deutsch als Fremdsprache, Russisch. 2002/04 Dozentin an einer Zivildienstschule. Gewerkschaftsmitgl. seit 1986, z. Zt. GEW, IG Metall und IG BCE; Mitgl. der AWO. 1991 Eintritt in die SPD, stellv. Bezirksvors.  SPD Oberbayern, seit Juni 2015 Vors. SPD-Kreisverband Traunstein. Seit Mai 2014 Mitgl. Kreistag Traunstein. - MdB seit Sept. 2004; Mitgl. im Vorst. der SPD-Fraktion, stellv. Vors. der Landesgruppe Bayern der SPD-Fraktion. Seit März 2016 Beauftragte der BReg für Menschenrechtspolitik und Humanitäre Hilfe.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 213 (Altötting)<br/>Wahlkreis 223 (Rosenheim)', 'Bärbel', '11003710');
