INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07602, NULL, NULL, NULL, 'Bäckerin und Betriebswirtin', 'keine Angaben', '13.09.1967', NULL, 'Leipzig', 'weiblich', NULL, '21.12.2004', 'Lazar', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'konfessionslos', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Netzwerk für Demokratie und Courage e.V. (NDC), Dresden, <br/>Stellv. Vorsitzende, ehrenamtlich', '1986 Abitur an der Rudolf-Hildebrandt-Oberschule in Markkleeberg. 1986/90 Studium der Ökonomie des Binnenhandels an der Handelshochschule Leipzig. 1990/96 Bäckerin im elterlichen Betrieb, dazu Ausbildung zur Bäckerin 1991/93. 1996/98 Aufbaustudium Betriebswirtschaft und Weiterbildung zur Betriebswirtin. 1998/04 Mitarbeiterin beim "ZeitPunkt-Kulturmagazin" Leipzig. Seit 1993 Mitgl. von BÜNDNIS 90/DIE GRÜNEN. 1997/98 Mitgl. im Landesvorst. Sachsen; Direktkandidatin Bundestag 1998, 2002, 2005, 2009 und 2013. 1994/99 Stadträtin von Markkleeberg. Stellv. Vors. Netzwerk für Demokratie und Courage, Terre des Femmes e. V., Fördermitgl. Netzwerk Demokratische Kultur e. V. und Fördermitgl. Aktion Zivilcourage Pirna e. V., Fördermitgl. Landesfrauenrat Sachsen e. V. - MdB seit Dez. 2004.', 'Monika', '11003714');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07603, NULL, NULL, NULL, 'Wissenschaftler Mitarbeiter', 'ledig', '23.02.1978', NULL, 'Soltau', 'männlich', NULL, '24.01.2005', 'Klingbeil', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Initiative Musik gemeinnützige Projektgesellschaft mbH, Berlin,<br/>Mitglied des Aufsichtsrates (bis 07.03.2016)<br/><br/>Quadriga Hochschule GmbH, Berlin,<br/>Mitglied des Beirates "Politik & Public Affairs"<br/><br/>Stadtwerke Munster-Bispingen GmbH, Munster,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Stellv. Mitglied des Beirates<br/><br/>Landkreis Heidekreis, Bad Fallingbostel,<br/>Mitglied des Kreistages<br/><br/>Stadt Munster, Munster,<br/>Mitglied des Stadtrates (bis 11.09.2016)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutschland-Russland - Die neue Generation e.V., Berlin,<br/>Trustee, ehrenamtlich<br/><br/>Förderkreis Deutsches Heer e.V., Bonn,<br/>Mitglied des Präsidiums<br/><br/>Soldaten und Veteranen Stiftung (SVS), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Sankt Barbara, Munster,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1998 Abitur. 1998/99 Zivildienst in der Bahnhofsmission Hannover. 1999/04 Studium der Politischen Wissenschaften, Geschichte und Soziologie an der Leibniz Universität Hannover, Abschluss Magister. 2001/04 Stipendiat der Friedrich-Ebert-Stiftung (FES), 2001 Praktika bei der FES in New York und der ARD in New York, 2003 Forschungsaufenthalt bei der FES in Washington, 2004 Forschungsaufenthalt bei der Stiftung Wissenschaft und Politik (SWP) in Berlin. 2001/03 Mitarbeiter im Wahlkreisbüro des damaligen Bundeskanzlers Gerhard Schröder; 2004/05 Jugendbildungsreferent im SPD-Landesverband NRW, 2005/09 Büroleiter des niedersächsischen Bundestagsabgeordneten und SPD-Landesvorsitzenden Garrelt Duin. Mitgliedschaften in der IG Bergbau, Chemie und Energie, AWO, Verkehrswacht. 1996 Eintritt in die SPD; 1996/97 Stadtschülersprecher Munster; seit 2002 Mitgl. im SPD-Bezirksvorst. Nord-Niedersachsen, 2003/07 stellv. Bundesvors. der Jusos in der SPD, seit 2006 SPD-Unterbezirksvors. Soltau-Fallingbostel. Seit 2006 Mitgl. des Kreistages Soltau-Fallingbostel, stellv. Fraktionsvors., seit 2001 Mitgl. des Stadtrates in Munster. - MdB Januar/Okt. 2005 und seit Okt. 2009; ab 2009 netzpolitischer Sprecher der SPD-Fraktion, seit Jan. 2014 Sprecher für digitale Agenda der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 30 (Stade I - Rotenburg II)', 'Lars', '11003715');
