INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07619, NULL, NULL, NULL, 'Historiker', 'ledig', '06.04.1973', NULL, 'Hamburg', 'männlich', NULL, '18.10.2005', 'Annen', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Friedrich-Ebert-Stiftung e.V., Bonn,<br/>Angestellter/Wissenschaftlicher Mitarbeiter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeskanzler-Helmut-Schmidt-Stiftung, Hamburg,<br/>Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Atlantische Initiative e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Deutsche Gesellschaft für Auswärtige Politik e.V., Berlin,<br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Forum eine Welt e.V., Berlin,<br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Friedrich-Ebert-Stiftung e.V., Bonn,<br/>Mitglied des Beirates der ehemaligen Stipendiatinnen und Stipendiaten, ehrenamtlich<br/><br/>Herbert und Elsbeth Weichmann-Stiftung, Hamburg,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Institut für Friedensforschung und Sicherheitspolitik an der Universität Hamburg (IFSH), Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung ?GIGA - German Institute of Global and Area Studies?, Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Wissenschaft und Politik (SWP), Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich', '1992 Abitur an der Peter-Petersen Schule, Hamburg. 1993/94 Zivildienst, Landesjugendring Hamburg. 1994/01 Studium der Geschichte und Lateinamerikastudien Univ. Hamburg, 2010 Bachelor of Arts, Geschichte und Spanisch an der Humboldt Universität, Berlin, 2011 Master of International Public Policy, Johns Hopkins University, Washington D.C., USA. 2010/11 Senior Resident Fellow, German Marshall Fund, Washington D.C., USA; 2011/13 Referat Internationale Politikanalyse der Friedrich-Ebert-Stiftung in Berlin. 2001/04 Bundesvors. der Jungsozialistinnen und Jungsozialisten in der SPD, seit 2003 Mitgl. des SPD-Parteivorst. Englisch (f), Spanisch (f), Portugiesisch (G). - MdB 2005/09 und seit Okt. 2013; außenpolitischer Sprecher der SPD-Fraktion.', 'Niels', '11003732');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07620, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'verheiratet, 1 Kind', '22.10.1962', 'Türkei', 'Pülümür', 'männlich', NULL, '18.10.2005', 'Aydin', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Hüseyin-Kenan', '11003733');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07624, NULL, NULL, NULL, 'Dipl.-Betriebswirt (BA)', 'verheiratet', '15.02.1975', NULL, 'Albstadt-Ebingen', 'männlich', NULL, '18.10.2005', 'Bareiß', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>BRUNATA-METRONA GmbH, Hürth,<br/>Vortrag, 2016, Stufe 2 (Klausurtagung)<br/><br/>FORUM Institut für Management GmbH, Heidelberg,<br/>Tagungsleitung, 2014, Stufe 1 (2. Think Tank Energy 40 - "Energieumbau, Märkte, globale Herausforderungen")<br/>Tagungsleitung, 2015, Stufe 1 (3. Think Tank Energy 40 - "Neue Märkte, neue Spieler, neue Lösungen")<br/><br/>Viessmann Deutschland GmbH, Allendorf (Eder),<br/>Vortrag, 2016, Stufe 1 (Energieforum)<br/><br/>Funktionen in Unternehmen: <br/>Agora Energiewende, SEFEP GmbH, Berlin,<br/>Mitglied des Rates der Agora, ehrenamtlich<br/><br/>Deutsche Rockwool GmbH + Co. OHG, Gladbeck,<br/>Mitglied des Fachbeirates, jährlich, Stufe 4<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>	Post und Eisenbahnen, Bonn, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Ausbildungs- und Berufsförderungsstätte Albstadt e.V., Albstadt,<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Deutsch-Aserbaidschanisches Forum e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Vorsitzender des Beirates für Energie, ehrenamtlich<br/><br/>Gesellschaft zur Förderung des Energiewirtschaftlichen Instituts an der Universität zu Köln e.V., Köln,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Johanniter-Schwesternschaft e.V., Berlin,<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Max-Planck-Institut für Chemische Energiekonversion, Mülheim an der Ruhr,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Pro RegioStadtbahn e.V., Tübingen,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Verein der Freunde der Erzabtei St. Martin zu Beuron e.V., Albstadt,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Zukunft ERDGAS e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich', '1994 Abitur am Wirtschaftsgymnasium in Albstadt-Ebingen. 1994/95 Wehrdienst. 1995/98 Studium Betriebswirtschaftslehre an der Berufsakademie in Ravensburg. 1998/99 Praktika und Auslandserfahrung in Izmir (Türkei), bei Industrieunternehmen in Phoenix, USA, und einer Steuerberatungs- und Wirtschaftsprüfungskanzlei in Stuttgart. 1999/05 Leiter Controlling sowie Leiter des Bereichs EDV und Organisation bei einem mittelst.Textilunternehmen. 1990 Eintritt in die Junge Union und seit 1994 Mitgl. der CDU. 1997/03 Kreisvors. der JU Zollernalb, 2002/06 Landesvors. der JU Baden-Württemberg, 2007/12 Kreisvors. der CDU Zollernalb, seit Okt. 2011 Vors. CDU-Bezirksverb. Württemberg-Hohenzollern, seit 2002 Mitgl. im Landesvorst. der CDU Baden-Württemberg. 1999/08 Mitgl. im Gemeinderat Meßstetten, 2004/13 Mitgl. im Kreistag Zollernalb. Mitgl. Beirat der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen, Mitgl. Verwaltungsrat der Johanniter-Schwesternschaft e.V. - MdB seit 2005; Energiebeauftragter der CDU/CSU-Fraktion.', 'Thomas', '11003734');
