INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07630, NULL, 'Dr.', 'Dr.', 'Bayerischer Staatsminister des Inneren', 'verheiratet, 3 Kinder', '23.11.1943', NULL, 'Hersbruck', 'männlich', NULL, '18.10.2005', 'Beckstein', NULL, 'CSU', NULL, 'evangelisch', NULL, NULL, NULL, 'Günther', '11003737');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07631, NULL, NULL, NULL, 'Gewerkschaftssekretärin, Handelsfachwirtin', 'Lebensgemeinschaft', '28.08.1957', NULL, 'Stuttgart', 'weiblich', NULL, '18.10.2005', 'Binder', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1974 Mittlere Reife. 1975/77 Ausbildung zur Einzelhandelskauffrau. 1980/82 Abendschule zur Handelsfachwirtin IHK. 1977/80 Kaufm. Angestellte im Einzelhandel, 1980/2000 Sachbearbeiterin in einem Verlagsunternehmen in Stuttgart, 2001/03 Sachbearbeiterin einer Firma für Außenwerbung in Konstanz, 2003/05 Hauptamtl. Vors. DGB-Region Mittelbaden in Karlsruhe. 1975/98 SPD-Mitgl. in versch. Funktion auf Orts-, Kreis- u. Landesebene, 1990/92 Stadträtin in Stuttgart. Seit 2005 Mitgl. der Linkspartei und WASG, seit 2007 Mitgl. DIE LINKE, 2007/16 Kreissprecherin DIE LINKE Karlsruhe. Seit 1975 Gewerkschaftsmitgl. bei ver.di (früher HBV) und NGG, 1976/78 Jugendvertreterin, 1987/2000 Betriebsrätin, Betriebsratsvors. im Verlagsunternehmen, 2001/03 Vors. ver.di-Kreisverb. Konstanz. 2000/03 Sprecherin Konstanzer Netzwerk gegen Rechts, 2003/05 alternierende Vors. Verwaltungsaussch. der Agentur für Arbeit Karlsruhe, 2003/05 Mitgl. Berufsbildungsaussch. IHK Karlsruhe, 2005/16 Mitgl. Bezirksrat AOK Karlsruhe. Mitgl. u. a. Kuratorium QS, Kuratorium Deutsche Stiftung Verbraucherschutz, Parlamentarischer Beirat der Fernuniversität Hagen, BUND, Aktionsbündnis Gentechnikfreie Region Mittlerer Oberrhein, Greenpeace, VVN-BdA, DFG-VK, amnesty international, AIDS-Hilfe, Fördermitgl. Linksjugend [''solid], Englisch (G), Französisch (G). - MdB seit 2005; Parlamentarische Geschäftsführerin und Mitgl. der Mitarbeiterkommission des Ältestenrates.', 'Karin', '11003738');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07632, NULL, 'Dr.', 'Dr.', 'Prof., Medienwissenschaftler', 'verheiratet, 3 Kinder', '17.08.1941', NULL, 'Zollbrück / Kreis Rummelsburg', 'männlich', NULL, '18.10.2005', 'Bisky', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', '13.08.2013', NULL, NULL, 'Lothar', '11003739');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07633, NULL, NULL, NULL, 'Bauzeichnerin, Gesellschaftswissenschaftlerin', 'geschieden, 2 Kinder', '18.01.1958', NULL, 'Schwerin', 'weiblich', NULL, '18.10.2005', 'Bluhm', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	B&B Hausverwaltung GbR, Schwerin, <br/>	Geschäftsführende Gesellschafterin<br/><br/>Funktionen in Unternehmen: <br/>TreuhandliegenschaftsGenossenschaft "FAIRWOHNEN" i.G., Berlin, <br/>	Vorsitzende des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Immobilienaufgaben, Bonn, <br/>	Mitglied des Verwaltungsrates<br/><br/>	Bundesstiftung Baukultur, Potsdam, <br/>	Mitglied des Stiftungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>BFW Bundesverband Freier Immobilien- und <br/>	Wohnungsunternehmen e.V., Berlin, <br/>	Mitglied des Kuratoriums<br/><br/>	Stiftung Berliner Schloss - Humboldtforum, Berlin, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	B&B Hausverwaltung GbR, Schwerin', 'Polytechnische Oberschule, Berufsausbildung zum Bauzeichner. Studium der Gesellschaftswissenschaften und der Innenarchitektur mit Diplom. 1991/02 selbstständig mit eigenem Planungsbüro, danach bis Okt. 2010 Wahlbeamtin. Seit 2008 geschäftsführende Gesellschafterin der B&B Hausverwaltung GbR. 1977 Mitgl. der SED, jetzt DIE LINKE, seit Nov. 2012 Landesvors. der Partei DIE LINKE in Mecklenburg-Vorpommern; 1978/90 hauptamtliche Tätigkeiten bei der FDJ, FDGB, SED und SED/PDS. 1990/02 Kommunalpolitikerin, 1995/99 Stadtpräsidentin der Landeshauptstadt Schwerin, 2002/05 erste Stellvertreterin des Oberbürgermeisters und Beigeordnete für Bauen, Ordnung und Umwelt in Schwerin. Mitgl. Stiftungsrat der Bundesstiftung Baukultur, Mitgl. Verwaltungsrat der Bundesanstalt für Immobilienangelegenheiten, seit 2013 Mitgl. Stiftungsrat der Stiftung Berliner Schloss-Humboldtforum. Englisch (G), Russisch (G). - MdB seit 2005.', 'Heidrun', '11003740');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07635, NULL, NULL, NULL, 'Koch', 'keine Angaben', '16.06.1946', NULL, 'Jena', 'männlich', NULL, '18.10.2005', 'Blumentritt', NULL, 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Volker', '11003741');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07639, NULL, NULL, NULL, 'Angestellter, Pressesprecher', 'verheiratet, 3 Kinder', '19.11.1973', NULL, 'Fulda', 'männlich', NULL, '18.10.2005', 'Brand', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Kinder-Akademie Fulda gemeinnützige GmbH, Fulda, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Biosphärenreservat Rhön, Gersfeld, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Bundeszentrale für politische Bildung, Bonn, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Landkreis Fulda, Fulda, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Deutschland Hilft e.V. (ADH), Bonn, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Point Alpha Stiftung, Geisa, <br/>Mitglied des Stiftungsrates, ehrenamtlich', '1994 Abitur an der Winfriedschule Fulda. 1994/95 Wehrdienst. 1995 Studium Politische Wissenschaften, Rechtswissenschaften und Geschichte in Bonn; 1997/98 Auslandsstudium in Sarajevo (Bosnien-Herzegowina); 2001 Abschluss "Magister Artium" an der Univ. Bonn. 1995/2000 European Balkan Institute, Bonn; 1998 OSZE-Wahlbeobachter in Bosnien-Herzegowina; 1996/ 2000 freie journalistische Tätigkeit im In- und Ausland; 2000/01 Pressesprecher JU Deutschlands, Berlin, 2001/05 Pressesprecher CDU-Fraktion im Hess. Landtag, Pressesprecher CDU Hessen, Wiesbaden. Mitgl. Förderverein Florenberg e. V., Malteser Hilfsdienst, Freunde und Förderer der Hochschule Fulda, Gesellschaft für bedrohte Völker e. V., Fuldaer Karnevalsgesellschaft e. V., Stiftungsrat "Point Alpha Stiftung", Kuratorium "Aktion Deutschland Hilft" (ADH), seit 2015 Mitgl. der Kammer für öffentl. Verantwortung der EKD, Mitgl. im Beirat Kinder-Akademie Fulda, Vors. Hospiz-Förderverein Fulda e. V. Seit 1993 Mitgl. der CDU. Seit 2006 Mitgl. im Kreistag des Landkreises Fulda. Englisch (f), Französisch (G), Bosnisch (G). - MdB seit 2005; stellv. Vors. der Dt.-Bosnischen Parlamentariergruppe; bis Jan 2017 Vors. Ausschuss für Menschenrechte und humanitäre Hilfe; seit Jan. 2017 menschenrechtspol. Sprecher und Vors. der AG Menschenrechte und humanitäre Hilfe der CDU/CSU-Fraktion.', 'Michael', '11003742');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07640, NULL, 'Dr.', 'Dr.', 'Sozialwissenschaftlerin', 'keine Angaben', '18.05.1951', NULL, 'Leipzig', 'weiblich', NULL, '18.10.2005', 'Bunge', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Martina', '11003743');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07641, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'verheiratet, 2 Kinder', '14.10.1964', NULL, 'Würzburg', 'männlich', NULL, '18.10.2005', 'Burkert', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>	ADLER Versicherung AG, Dortmund,<br/>Mitglied des Aufsichtsrates<br/><br/>DB Schenker Rail Deutschland AG, Mainz,<br/>Mitglied des Aufsichtsrates<br/><br/>DEVK Deutsche Eisenbahn Versicherung Lebensversicherungsverein a.G., Köln,<br/>Mitglied des Beirates (bis November 2015)<br/><br/>DEVK Vermögensvorsorge- und Beteiligungs-AG, Köln,<br/>Stellv. Vorsitzender des Aufsichtsrates, monatlich, Stufe 1 (ab November 2015)<br/><br/>S-Bahn Berlin GmbH, Berlin,<br/>Mitglied des Aufsichtsrates<br/><br/>SCHULTHEISS Wohnbau AG, Nürnberg,<br/>Mitglied des Aufsichtsrates (bis 30.06.2014)<br/><br/>SIGNAL IDUNA Gruppe - Versicherungen und Finanzen, Dortmund,<br/>Mitglied des Beirates<br/><br/>TeamBank AG, Nürnberg,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen, Bonn,<br/>Mitglied des Eisenbahninfrastrukturbeirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bildungs- und Förderungswerk der EVG e.V., Frankfurt/Main,<br/>Mitglied des Vorstandes<br/><br/>EVG Eisenbahn- und Verkehrsgewerkschaft, Berlin, Frankfurt/Main,<br/>Mitglied des geschäftsführenden Vorstandes, monatlich, Stufe 2 (bis 30.06.2016); monatlich, Stufe 3 (ab 01.07.2016)<br/><br/>GUV Fakulta, Gewerkschaftliche Unterstützungseinrichtung der DGB-Gewerkschaften, Ludwigsburg,<br/>Mitglied des Vorstandes<br/><br/>Nürnberger Herzhilfe e.V., Nürnberg,<br/>Vorsitzender, ehrenamtlich', 'Qualif. Hauptschulabschluss. 1987/88 Mittlere nichttechn. Beamtenlaufbahn. Wehrdienst. Seit 1990 Gewerkschaftssekr. Eisenbahn- und Verkehrsgewerkschaft (EVG), ehem. TRANSNET. Seit 2008 Vorstandsmitgl. EVG, Mitgl. AWO, ACE, im Eisenbahnerverein 03, Vors. der Nürnberger Herzhilfe, Mitgl. ESV-Nürnberg-Rangierbahnhof, Familienverband, Bürgerverein Gebersdorf, Zugführer- und Schaffnerverein sowie im Fränkischen Albverein. Mitgl. der SPD seit 1985, Mitgl. Bahnsozialwerk (BSW). Englisch (G). - MdB seit 2005; seit Feb. 2010 Vors. der bayerischen Landesgruppe der SPD-Fraktion, seit Jan. 2014 Vors. Ausschuss für Verkehr und digitale Infrastruktur.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 241 (Ansbach)', 'Martin', '11003744');
