INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07650, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'ledig', '01.11.1954', NULL, 'München', 'männlich', NULL, '18.10.2005', 'Ernst', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Volksschule, Realschule. 1974 Facharbeiterprüfung. Berufliche Tätigkeit als Elektromechaniker und Elektrotechniker. Jugendvertreter, Betriebsrat. 1979/84 Studium, Abschluss Diplom-Volkswirt und Diplom-Sozialökonom. Seit 1972 Mitgl. IG Metall, Wahl zum Vors. DGB-Jugend und IG Metall-Jugend München. Bis 1995 Gewerkschaftssekretär der IG Metall Stuttgart, 1995/Juni 2010 1. Bevollmächtigter der IG Metall Schweinfurt. Bis 2004 Mitgl. der SPD, Gründungsmitgl. der Initiative für Arbeit und soziale Gerechtigkeit, des Vereins Wahlalternative Arbeit und soziale Gerechtigkeit und der Partei WASG, ab 2005 Mitgl. des geschäftsführenden Vorst. der WASG, Juni 2007/Mai 2010 stellv. Parteivors. und Mai 2010/Juni 2012 Parteivors. Die Linke. - MdB seit 2005; Okt. 2005/Juni 2010 u. seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE.', 'Klaus', '11003753');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07651, NULL, NULL, NULL, 'Diplom-Verwaltungswissenschaftler', 'verheiratet, 2 Kinder', '06.05.1972', NULL, 'Karlsruhe', 'männlich', NULL, '18.10.2005', 'Friedrich', NULL, 'SPD', NULL, 'konfessionslos', NULL, NULL, NULL, 'Peter', '11003754');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07654, NULL, NULL, NULL, 'Bundesminister des Auswärtigen, Gymnasiallehrer', 'verheiratet, 3 Kinder', '12.09.1959', NULL, 'Goslar', 'männlich', NULL, '18.10.2005', 'Gabriel', NULL, 'SPD', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Sozialdemokratische Partei Deutschlands, Berlin,<br/>Vorsitzender, monatlich, Stufe 3 (bis Ende 2013); <br/>monatlich, Stufe 1 (ab 01.03.2014 bis 31.12.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreditanstalt für Wiederaufbau (KfW), Frankfurt/Main,<br/>Vorsitzender des Verwaltungsrats, des Kreditausschusses, des Mittelstandsrats,<br/>des Präsidialausschusses und stellv. Vorsitzender des Prüfungsausschusses<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>CJD Braunschweig, Braunschweig,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>RAG-Stiftung, Essen,<br/>Mitglied des Kuratoriums<br/><br/>Stiftung Knabenhof bei St. Leonhard, Braunschweig,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Verein der Freunde von Neve Shalom/Wahat al Salam e.V., St. Augustin,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1975 Realschulabschluss, 1979 Abitur. Für 2 Jahre Zeitsoldat. Studium Germanistik, Politik und Soziologie an der Univ. Göttingen, 1987 1. Staatsexamen für das Lehramt an Gymnasien (Deutsch, Gemeinschaftskunde), 1989 2. Staatsexamen. 1983/90 Dozent in der Erwachsenenbildung. 1999/03 Ministerpräs. des Landes Niedersachsen. Eintritt in die SPD 1977, 1976/89 ehrenamtl. Jugendarbeit im SPD nahen Jugendverb. der Falken.  2009/17 Vors. der SPD. 1987/98 Kreistagsabg. im Landkreis Goslar, 1991/99 Ratsherr der Stadt Goslar, 1990/05 Abg. des Niedersächsischen Landtags, dort 1998/99 und 2003/05 Vors. der SPD-Fraktion. Mitgl. AWO, IG Metall, SJD-Die Falken. Englisch (f), Französich (G). - MdB seit Okt. 2005; Nov. 2005/Okt. 2009 BMin. für Umwelt, Naturschutz und Reaktorsicherheit; Nov. 2009/Mrz. 2017 Vors. der SPD, Dez. 2013/Jan. 2017 BMin. für Wirtschaft und Energie und Stellvertreter der Bundeskanzlerin, seit 27. Jan. 2017 Bundesminister des Auswärtigen und Stellvertreter der Bundeskanzlerin.', 'Sigmar', '11003755');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07655, NULL, NULL, NULL, 'Dipl.-Sozialwissenschaftler', 'gleichgeschlechtliche Partnerschaft', '26.12.1977', NULL, 'Mülheim / Ruhr', 'männlich', NULL, '18.10.2005', 'Gehring', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundeszentrale für politische Bildung, Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>FernUniversität in Hagen, Hagen,<br/>Stellv. Vorsitzender des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsches Studentenwerk e.V. (DSW), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Evangelisches Studienwerk e.V. Villigst, Schwerte,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Heinrich-Böll-Stiftung e.V., Berlin,<br/>Mitglied im Fachbeirat des Studienwerkes, ehrenamtlich<br/><br/>Kompetenzzentrum Technik-Diversity-Chancengleichheit e.V., Bielefeld,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Lesen, Mainz,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis 10.05.2016)<br/><br/>Wissenschaftsgemeinschaft Gottfried Wilhelm Leibniz e.V., Berlin,<br/>Mitglied des Senats, ehrenamtlich', '1984/88 Fischlaker Grundschule Essen, 1988/97 Geschwister-Scholl-Gymnasium Velbert, Abitur. 1997/98 Zivildienst in der Evangelischen Studierendengemeinde (ESG), Universität Duisburg-Essen. 1998/04 Studium der Sozialwissenschaft, Ruhr-Universität Bochum. Seit 1998 Mitgl. Bündnis 90/Die Grünen (Kreisverband Essen), Gründungsmitgl. Grüne Jugend NRW, 1999/02 im Landesvorstand Grüne Jugend, 2000/02 als Sprecher, 2002/06 Mitgl. im Landesvorstand der Grünen Nordrhein-Westfalen. Mitgl. Deutsche Parlamentarische Gesellschaft, Mitgl. Kuratorium Bundeszentrale für pol. Bildung (BpB), Mitgl. Kuratorium Deutsches Studentenwerk (DSW), Mitgl. Fachbeirat Studienwerk der Heinrich-Böll-Stiftung, Mitgl. Kuratorium Ev. Studienwerk e. V. Villigst, stellv. Vors. Beirat FernUniv. Hagen, Mitgl. Senat der Leibniz-Gemeinschaft, Mitgl. Kuratorium der Stiftung Lesen, Mitgl. Kuratorium Kompetenzzentrum Technik-Diversity-Chancengleichheit, Mitgl. im Lesben- und Schwulenverband in Deutschland (LSVD) e. V., Mitgl. bei amnesty international und Greenpeace. - MdB seit 2005; 2005/11 Sprecher für Jugend- und Hochschulpolitik der Fraktion Bündnis 90/Die Grünen, 2011/13 Sprecher für Bildungs- und Hochschulpolitik, seit 2013 Sprecher für Hochschule, Wissenschaft und Forschung, Obmann im Ausschuss für Bildung, Forschung und Technikfolgenabschätzung.', 'Kai', '11003756');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07656, NULL, 'Dr.', 'Dr.', 'Dipl.-Agraringenieur, Landwirtschaftsdirektor a. D.', 'verheiratet, 1 Kind', '05.03.1949', NULL, 'Lützkampen / Eifel', 'männlich', NULL, '18.10.2005', 'Geisen', NULL, 'FDP', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Edmund Peter', '11003757');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07657, NULL, NULL, NULL, 'Parlamentarischer Berater im Landtag', 'verheiratet, 1 Kind', '30.08.1971', NULL, 'Biberach an der Riß', 'männlich', NULL, '18.10.2005', 'Gerster', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich (bis März 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Sportakrobatik Bund e.V., Pfungstadt, <br/>	Präsident, ehrenamtlich (bis Januar 2014)<br/>	<br/>Kuratorium Sport und Natur e.V., München, <br/>	Stellv. Vorsitzender, ehrenamtlich (bis Januar 2014)<br/>	<br/>Special Olympics Deutschland e.V., Berlin, <br/>	Vizepräsident, ehrenamtlich (bis Januar 2014)', '1978/82 Braith-Grundschule Biberach, 1983/91 Pestalozzi-Gymnasium Biberach. 1991/93 Ausbildung zum Redakteur, Radio 7 Biberach. 1994/02 Studium der Politikwissenschaft, Geschichte und Volkswirtschaftslehre an der Johannes-Gutenberg-Universität Mainz, Magister Artium. 1993/02 Freier Journalist u. a. für die Schwäbische Zeitung, Radio 7 und ZDF. 1999/01 Mitarbeit beim Democratic National Commitee in Washington D. C. und "Hillary Clinton for Senate" in New York. Landtagswahlkampf für Ute Vogt, SPD in Baden-Württemberg, 2002/05 parlamentarischer Berater im Landtag Baden-Württemberg (Bereiche Schule, Bildung und Sport). 1990 Eintritt in die SPD, seit 2001 Vors. des Kreisverbandes Biberach. Englisch (f), Französisch (G), Spanisch (G), Italienisch (f). - MdB seit Okt. 2005.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 293 (Bodensee)<br/>Wahlkreis 294 (Ravensburg)', 'Martin', '11003758');
