INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07660, NULL, NULL, NULL, 'Professorin, Stiftungsvorstand, Staatsministerin für Kultur und Medien', 'ledig', '09.01.1962', NULL, 'Münster / Westfalen', 'weiblich', NULL, '18.10.2005', 'Grütters', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Freie Universität Berlin, Berlin, <br/>Honorarprofessorin<br/><br/>Funktionen in Unternehmen: <br/>Kulturveranstaltung des Bundes in Berlin GmbH, Berlin,<br/>Vorsitzende des Aufsichtsrates<br/><br/>Kunst- und Ausstellungshalle der Bundesrepublik Deutschland GmbH, Bonn,<br/>Vertreterin des Bundes in der Gesellschafterversammlung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Deutsches Nationalkomitee für Denkmalschutz, Bonn,<br/>Vizepräsidentin, ehrenamtlich<br/><br/>Deutschlandradio, Berlin,<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Hauptstadtkulturfonds, Berlin,<br/>Mitglied des Gemeinsamen Ausschusses<br/><br/>Lutherdekade, Wittenberg,<br/>Mitglied des Kuratoriums zur Vorbereitung des Reformationsjubiläums 2017, ehrenamtlich<br/><br/>RIAS Berlin Kommission, Berlin,<br/>Ehrenvorsitzende, ehrenamtlich<br/><br/>Stiftung Berliner Philharmoniker, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Stiftung Denkmal für die ermordeten Juden Europas, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Flucht, Vertreibung, Versöhnung, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Stiftung Jüdisches Museum Berlin, Berlin,<br/>Vorsitzende des Stiftungsrates, ehrenamtlich<br/><br/>Stiftung Preußischer Kulturbesitz, Berlin,<br/>Vorsitzende des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Dokumentations- und Kulturzentrum Deutscher Sinti und Roma e.V., Heidelberg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Internationale Journalisten-Programme e.V. (IJP), Königstein/Taunus,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Konrad-Adenauer-Stiftung e.V., St. Augustin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Kulturstiftung der Länder, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Kulturstiftung des Bundes, Halle/Saale,<br/>Vorsitzende des Stiftungsrates, ehrenamtlich<br/><br/>Stiftung Genshagen, Genshagen,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Zentralkomitee der deutschen Katholiken (ZdK), Bonn,<br/>Mitglied der Vollversammlung, ehrenamtlich', 'Studium Germanistik, Kunstgeschichte u. Politikwissenschaft, Stipendiatin Institut für Begabtenförderung der Konrad-Adenauer-Stiftung. 1990/91 Museum für Verkehr und Technik, 1991/92 Verlags-und Buchhandelsgesellschaft Bouvier, 1992/95 Pressesprecherin Senatsverwaltung für Wissenschaft und Forschung Berlin; 1995/05 Mitglied Abgeordnetenhaus von Berlin, wissenschafts- und kulturpolitische Sprecherin der CDU-Fraktion. Seit 2009 erste stellv. Landesvors. CDU Berlin. 1998/13 Vorstand Stiftung "Brandenburger Tor", 1991/99 Lehrbeauftragte für Kulturmanagement, seit 1999 Honorarprofessorin, FU Berlin. Seit Nov. Mitgl. 2012 Zentralkomitee der deutschen Katholiken, Mitgl. Kuratorium Internationale Journalisten-Programme e. V. (IJP), Königstein/Taunus. Englisch (f), Italienisch (G). - MdB seit 2005; 2009/13 Vors. Ausschuss für Kultur und Medien. Seit Dez. 2013 Staatsministerin, Beauftragte der BReg. für Kultur und Medien.', 'Monika', '11003761');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07661, NULL, NULL, NULL, 'Polizeipräsident a. D.', 'verheiratet', '15.05.1947', NULL, 'Berlin', 'männlich', NULL, '18.10.2005', 'Gunkel', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1964 mittlere Reife. 1972 Fachabitur Polizei, 1981 Polizeiführungsakademie, 1964 Eintritt in den Polizeidienst, Polizeiwachtmeister, 1974 geh. Dienst, Polizeikommissar, Dipl.-Verwaltungswirt, 1982 höh. Dienst, Polizeirat, 1997 Prorektor der Fachhochschule für Polizei Sachsen, 2000 Leiter der Polizeidirektion Bautzen, Leitender Polizeidirektor, 2005 Leiter der Polizeidirektion Oberlausitz/Niederschlesien, Polizeipräsident. 1976 Mitglied der SPD, 1977/97 versch. Funktionen auf Abteilungs, Kreis- und Landesebene der SPD Berlin (ehrenamtl.), 2001/09 Vors. AK Innere Sicherheit beim SPD-Landesverband Sachsen, 2006/14 Beisitzer im Landesvorst. der SPD Sachsen, seit 2012 Beisitzer im AWO-Kreisvorst. Lausitz. Mitgl. der Gewerkschaft der Polizei. Englisch (G), Französisch (G). - MdB seit 2005.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 163 (Chemnitzer Umland - Erzgebirgskreis II)<br/>Wahlkreis 166 (Vogtlandkreis)', 'Wolfgang', '11003762');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07662, NULL, NULL, NULL, 'Ernährungswissenschaftlerin', 'ledig', '01.01.1966', NULL, 'Stuttgart', 'weiblich', NULL, '18.10.2005', 'Hänsel', NULL, 'DIE LINKE.', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>DEval - Deutsches Evaluierungsinstitut der Entwicklungs-<br/>zusammenarbeit gemeinnützige GmbH, Bonn, <br/>Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Friedensplenum/Antikriegsbündnis Tübingen e.V., Tübingen, <br/>Mitglied des Vorstandes', '1985 Abitur am Romäusgymnasium Villingen. 1986/89 Studium der Katholischen Theologie an der Eberhard-Karls-Universität Tübingen, 1990/97 Studium der Oecotrophologie an der Justus-Liebig-Universität Gießen, 1997 Diplomabschluss. Seit 1997 Projektleitung und Öffentlichkeitsarbeit bei der Gesellschaft Kultur des Friedens. Mitgl. bei ver.di, Attac und DFG-VK. - MdB seit Okt. 2005, seit Nov. 2015 stellv. Vors. der Fraktion DIE LINKE.', 'Heike', '11003763');
