INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07673, NULL, 'Dr.', 'Dr.', 'Dipl.-Biologe', 'ledig', '02.02.1970', NULL, 'München', 'männlich', NULL, '18.10.2005', 'Hofreiter', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis München, München, <br/>	Mitglied des Kreistages (bis 30.04.2014)', '1990 Hochschulreife. Studium der Biologie an der Ludwig-Maximilian-Universität, 1997 Diplom-Biologe, Sept. 2003 Promotion im Fach Biologie. Seit Okt. 2003 tätig als unabhängiger Postdoc am Institut für Systematische Botanik. Nov. 1998/Okt. 2003 Mitarbeiter von Susanna Tausendfreund (MdL) und Nov. 2003/Okt. 2005 von Dr. Christian Magerl (MdL). Seit 1984 Mitarbeit, seit 1986 Mitgl. bei Bündnis 90/Die Grünen, 1988/95 Sprecher im Ortsverband Sauerlach, seit 1996 im Kreisverband München-Land, seit 2001 der LAK Ökologie. 2002/05 Gemeinderat in Sauerlach, 2003/14 Kreisrat im Kreistag des Landkreises München. Mitgl. beim Bund Naturschutz, VCD, LBV, Naturfreunde Deutschland und ver.di. - MdB seit Okt. 2005; 2011/13 Vors. Ausschuss für Verkehr, Bau und Stadtentwicklung; seit Okt. 2013 Vors. der Fraktion Bündnis 90/Die Grünen.', 'Anton', '11003772');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07674, NULL, NULL, NULL, 'Dipl.-Betriebswirtin', '1 Kind', '29.10.1950', NULL, 'Diepholz', 'weiblich', NULL, '21.12.2006', 'Höger', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', '1957/65 Volksschule Haldem, 1965/67 Handelsschule Rahden. 1967/69 Ausbildung zur Speditionskauffrau. 1970/73 Studium an der Hochschule für Wirtschaft Bremen; danach Beschäftigung in versch. Unternehmen im betriebl. Rechnungswesen, seit 1994 Angestellte bei der AOK Westfalen-Lippe, Regionaldirektion Herford, Minden-Lübbecke. Seit vielen Jahren aktiv in Gewerkschaften, sozialen Bewegungen und in der Frauenbewegung. 1990/95 Sprecherin Stadtelternrat Herford, 1993/05 Vors. DGB-Frauenausschuss, 1996/05 Personalrätin AOK, 1997/05 Mitgl. der ver.di-Bundestarifkommission für die AOK, 2000/05 im Gesamtpersonalrat AOK Westfalen-Lippe. Mitgl. der ÖTV, Mitgl. seit Gründung von ver.di, dort bis 2005 im Landesfachbereichsvorstand Sozialversicherung und stellv. Vors. der Landesfachgruppe gesetzliche Krankenversicherung; Mitgl in Friedensgruppen und der DFG-VK. Gründungsmitgl. der WASG Nordrhein-Westfalen, seit Juni 2005 Mitgl. Linkspartei.PDS, nun DIE LINKE. Mitgl. attac, Bildungsgemeinschaft SALZ, DFG-VK, Förderverein gewerkschaftlicher Arbeitslosenarbeit, Kuratorium "Erinnern-Forschen-Gedenken" Herford, Informationsstelle Millitarisierung Tübingen, Naturfreunde Herford, pro asyl, Rosa-Luxemburg-Stiftung NRW, Rote Hilfe e. V., Vereinigung der Verfolgten des Naziregimes VVN-BdA, Welthaus Bielefeld und HERFORD-CONTEGA-Freundschaftsverein. - MdB seit 2005.', 'Inge', '11003773');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07675, NULL, NULL, NULL, 'Diplom-Mathematikerin', 'verheiratet, 2 Kinder', '04.05.1952', NULL, 'Flensburg', 'weiblich', NULL, '18.10.2005', 'Höhn', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Brasilianische Gesellschaft e.V., Bonn/Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Deutsche Bundesstiftung Umwelt (DBU), Osnabrück, <br/>	Mitglied des Kuratoriums, jährlich, Stufe 3<br/>	<br/>Exposure- und Dialogprogramme (EDP) e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Faire Welt e.V., Dinslaken, <br/>	Stellv. Vorsitzende, ehrenamtlich<br/>	<br/>GLOBE Deutschland, Berlin, <br/>	Beisitzerin des Vorstandes, ehrenamtlich', '1959/71 Schule mit Abitur. 1971/76 Studium der Mathematik und VWL, Abschluss Dipl.-Mathematikerin. 1978/90 wissenschaftl. Mitarbeiterin Univ. Duisburg/Essen. 1985 Eintritt in Bündnis90/Die Grünen, seit 1999 Mitgl. im Parteirat, Juni 2012/Juni 2014 Mitgl. Landesvorst. Bündnis 90/Die Grünen NRW. 1985/89 Stadtverordnete Oberhausen; 1990/95 Fraktionsvors. der Grünen im Landtag NRW, 1995/2000 Ministerin für Umwelt, Raumordnung und Landwirtschaft in NRW, 2000/05 Ministerin für Umwelt, Naturschutz, Landwirtschaft und Verbraucherschutz in NRW. Mitgl. bei ver.di. Englisch. - MdB seit 2005; Nov. 2005/Mai 2006 Vors.  Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz, Mai 2006/Okt. 2013 stellv. Fraktionsvors. und Pol. Koordinatorin des AK Umwelt und Energie der Fraktion Bündnis 90/Die Grünen, seit Jan. 2014 Vors. Ausschuss für Umwelt, Naturschutz, Bau und Reaktorsicherheit.', 'Bärbel', '11003774');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07676, NULL, NULL, NULL, 'Landwirtschaftsmeister, Industriekaufmann', 'verheiratet, 4 Kinder', '08.01.1960', NULL, 'Altenoythe', 'männlich', NULL, '18.10.2005', 'Holzenkamp', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>	AGRAVIS Raiffeisen AG, Münster, <br/>	Vorsitzender des Aufsichtsrates, monatlich, Stufe 2 (bis 31.05.2016); monatlich, Stufe 3 (ab 01.06.2016)<br/><br/>	LVM Landwirtschaftlicher Versicherungsverein Münster a.G., Münster, <br/>	Vorstandsbeirat (bis 30.06.2016), monatlich, Stufe 1<br/><br/>	LVM-Krankenversicherungs AG, Münster, <br/>	Mitglied des Aufsichtsrates, jährlich, Stufe 3<br/><br/>	LVM-Lebensversicherungs AG, Münster, <br/>	Mitglied des Aufsichtsrates, jährlich, Stufe 3<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Marketinggesellschaft der niedersächsischen Land- und Ernährungswirtschaft e.V., Hannover, <br/>	Vorsitzender des Vorstandes, ehrenamtlich (bis 22.01.2015)<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Christoph Holzenkamp GbR, Garthe (bis 30.06.2015)<br/><br/>	Wiltrud Holzenkamp GbR, Garthe<br/><br/>	WKA Holzenkamp GmbH & Co. KG, Garthe', 'Allgem. Hochschulreife. Ausbildung zum Industriekaufmann, Ausbildung zum Landwirtschaftsmeister, selbstständiger Landwirt. Mitgl. der CDU seit 1996, seit 2008 Vors. CDU-Kreisverb. Cloppenburg, seit 2009 Vors. CDU-Landesverb. Oldenburg. - MdB seit 2005; Feb. 2011/Jan. 2014 Vors. der Arbeitsgruppe Ernährung, Landwirtschaft und Verbraucherschutz, seit Jan. 2014  der Arbeitsgruppe Ernährung und Landwirtschaft der CDU/CSU-Fraktion.', 'Franz-Josef', '11003775');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07679, NULL, NULL, NULL, 'Juristin', 'verheiratet, 1 Kind', '09.07.1955', NULL, 'Neunkirchen / Saar', 'weiblich', NULL, '18.10.2005', 'Hübinger', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>	Engagement Global gemeinnützige GmbH, Berlin, <br/>	Mitglied des Parlamentarischen Beirates des ASA-Programms, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Georg Kraus Stiftung, Hagen, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis 30.10.2014)<br/><br/>	Help - Hilfe zur Selbsthilfe e.V., Bonn, <br/>	Mitglied des geschäftsführenden Vorstandes, ehrenamtlich<br/><br/>	Stiftung Haus der kleinen Forscher, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Wissenschaftsgemeinschaft Gottfried Wilhelm Leibniz e.V., Berlin, <br/>	Senatorin, ehrenamtlich<br/><br/>	Zukunftsstiftung der Fraunhofer Gesellschaft, München, <br/>	Mitglied des Haushaltsausschusses, von Amts wegen', '1974 Abitur in Neunkirchen Saar. 1974/81 Studium der Rechtswissenschaften an der Univ. des Saarlandes, 1981 1. jur. Staatsexamen; 1981/84 Rechtsreferendariat, 1984 2. jur. Staatsexamen. 1984/89 Pers. Referentin MdB Werner Schreiber, 1989/2000 Hausfrau und Mutter. 1999/09 Bezirksbürgermeisterin (ehrenamtl.) im Stadtbezirk Halberg der Landeshauptstadt Saarbrücken. 2000/16 stellv. Kreisvors. CDU-Kreisverb. Saarbrücken-Stadt, seit 2000 Vors. CDU-Stadtbezirksverb. Halberg, 2003/05 Mitgl. im Landesvorst. der CDU Saar; seit 2008 Mitgl. BFA der CDU Deutschlands für Außen-, Sicherheits-, Entwicklungs- und Menschenrechtspolitik, 2011/13 Mitgl. BFA der CDU Deutschlands für Bildung, Forschung und Innovation; seit 2014 Mitgl. Bundesarbeitsgruppe Staatsfinanzen im Wirtschaftsrat der CDU e. V. Seit 2006 Vorstandsmitgl. bei Hilfe zur Selbsthilfe e. V. (HELP), seit 2010 Mitgl. Habitat for Humanity Deutschland, 2010/12 Mitgl. im ASA-Programmbeirat der Gesellschaft für Internationale Zusammenarbeit (GIZ), 2010/14 Mitgl. im Kuratorium der Georg Kraus Stiftung, seit 2011 Mitgl. Parl. Beirat für Bevölkerung und Entwicklung, seit 2014 Senatorin der Leibniz-Gemeinschaft, seit 2015 Kuratoriumsmitgl. Stiftung Haus der kleinen Forscher. - MdB seit 2005; seit 2010 Mitgl.der PV des Europarates, 2010 bis zur Auflösung Juni 2011 Mitgl. der Europ. Versammlung für Sicherheit und Verteidigung/Versammlung der WEU.', 'Anette', '11003776');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07680, NULL, 'Dr.', 'Dr.', 'Publizistin', 'keine Angaben', '01.03.1936', NULL, 'Nürnberg', 'weiblich', NULL, '18.10.2005', 'Jochimsen', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Lukrezia', '11003777');
