INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07682, NULL, NULL, NULL, 'Politikwissenschaftler MA, wissenschaftlicher Mitarbeiter', 'verheiratet', '27.03.1967', NULL, 'Karlsruhe', 'männlich', NULL, '18.10.2005', 'Jung', '(Karlsruhe)', 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Johannes', '11003779');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07686, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 1 Kind', '13.05.1975', NULL, 'Freiburg / Breisgau', 'männlich', NULL, '14.03.2014', 'Jung', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>Mainau GmbH, Insel Mainau, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband Erneuerbare Energie e.V. (BEE), Berlin, <br/>	Vorsitzender des Parlamentarischen Beirates<br/><br/>Deutsch-Französisches Institut e.V. (dfi), Ludwigsburg,<br/>Mitglied des Vorstandes<br/><br/>Fondation Entente Franco-Allemande (FEFA), Straßburg,<br/>Mitglied des Verwaltungsrates<br/>	<br/>GLOBE Deutschland, Berlin, <br/>	Präsident<br/><br/>Stiftung Energie & Klimaschutz Baden-Württemberg, Karlsruhe,<br/>Mitglied des Kuratoriums<br/><br/>Vereinigung Deutsch-Französischer Gesellschaften für Europa e.V. (VDFG), Mainz,<br/>Mitglied des Parlamentarischen Beirates', '1994 Abitur, Nellenburggymnasium Stockach. 1994/2000 Studium der Rechtswissenschaften Universität Konstanz, 2000 1. Jur. Staatsexamen Konstanz, 2002 2. Jur. Staatsexamen Freiburg. Seit 2003 Rechtsanwalt, Kanzlei Rittershaus Mannheim. 1991/93 Ortsvors. Junge Union Stockach, 1993/99 JU Kreisvors. in Konstanz, 2000/02 JU Bundesvorstand, 2002/05 Bezirksvors. JU Südbaden; seit 1995 Mitgl. Kreisvorstand CDU Konstanz, 2007/11 Kreisvors., seit 2011 Bezirksvors. CDU Südbaden, seit 2001 Mitgl. Landesvorstand und seit 2011 auch Mitgl. Präsidium CDU Baden-Württemberg. Englisch (f), Französisch (f). - MdB seit 2005; Beauftragter für Klimaschutz, seit 2010 Vors. Parl. Beirat für nachhaltige Entwicklung, seit 2015 Vors. der deutsch-französischen Parlamentariergruppe, seit Juli 2016 Vors. der CDU-Landesgruppe Badan-Württemberg.', 'Andreas', '11003780');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07689, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt und Notar, Bundesminister a. D.', 'verheiratet, 3 Kinder', '05.03.1949', NULL, 'Erbach / Rheingau', 'männlich', NULL, '18.10.2005', 'Jung', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>		Dr. Jung - Weckel - Felzer Rechtsanwälte Notare Fachanwälte, Eltville, <br/>	Rechtsanwalt und Notar<br/>	Mandant 1, 2014, Stufe 1; 2015, Stufe 1; 2016, Stufe 1<br/>	Mandant 2, 2015, Stufe 1<br/>	Mandant 3, 2014, Stufe 1; 2015, Stufe 1<br/>	Mandant 4, 2013, Stufe 1; 2014, Stufe 1<br/>	Mandant 5, 2014, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>		Eintracht Frankfurt Fußball AG, Frankfurt/Main, <br/>	Mitglied des Beirates<br/><br/>	Rheingau Musik Festival Konzertgesellschaft mbH, Oestrich-Winkel, <br/>	Mitglied des Kuratoriums<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		ZDF, Mainz, <br/>	Mitglied des Fernsehrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		bundesAdler - Fanclub von Eintracht Frankfurt im Deutschen Bundestag, Berlin, <br/>	Stellv. Vorsitzender<br/><br/>	Bundesarbeitsgemeinschaft für Soldatenbetreuung e.V. (BAS), Berlin, <br/>	Vorsitzender<br/><br/>Bundesverband mittelständische Wirtschaft e.V. (BVMW), Berlin,<br/>Mitglied des Beirates<br/><br/>	Förderkreis Festspielstadt Eltville, Eltville, <br/>	Mitglied des Beirates<br/><br/>	Gesellschaft zur Förderung der Forschungsanstalt Geisenheim e.V., Geisenheim, <br/>	Vorsitzender<br/><br/>	Petersburger Dialog e.V., Berlin, <br/>	Mitglied des Vorstandes', '1968 Abitur in Geisenheim. 1968/69 Wehrdienst. 1970/74 Jurastudium Universität Mainz, 1974/76 Referendariat am Landgericht in Wiesbaden. Seit 1976 Rechtsanwalt, seit 1983 auch Notar in Eltville. 1978 Promotion zum Dr. jur. 1973/83 Mitgl. Bundesvorst. JU Deutschland, 1981/83 stellv. Bundesvors. JU Deutschland;1987/91 Generalsekretär der CDU Hessen, 1998/14 stellv. Landesvors. CDU Hessen, seit 1998 Mitgl. Bundesvorstand CDU Deutschland, 2012/14 Vors. Medienpolitischer Expertenkreis der CDU Deutschlands. 1972/87 Kreistagsabg. Rheingau-Taunus-Kreis; 1983/Nov. 2005 Mitgl. des Hessischen Landtags, 1987/99 Parlamentarischer Geschäftsführer CDU-Fraktion, April 2003/Nov. 2005 CDU-Fraktionsvors.; 1999/2000 Hessischer Minister für Bundes- und Europaangelegenheiten und Chef der Staatskanzlei; 1989 Mitgl. der 9., 1994 der 10., 1999 der 11., 2004 der 12. und 2009 der 13., 2010 der 14. und 2012 der 15. Bundesversammlung. Seit Okt. 2015 Vorstandsmitgl. des "Petersburger Dialogs", seit Nov. 2015 Vors. der Bundesarbeitsgemeinschaft für Soldatenbetreuung. 2010 Autor des Buches "Die letzten Tage der Teilung". - MdB seit Okt. 2005; 2005/Okt. 2009 Bundesminister der Verteidigung und Okt./Nov. 2009 Bundesminister für Arbeit und Soziales; 2013/Jan. 2014 stellv. Vors. für Landwirtschaft und Ernährung der CDU/CSU-Fraktion, seit Jan. 2015 stellv. Vors. für Außen- und Sicherheitspolitik der CDU/CSU-Fraktion, seit Febr. 2014 Beauftragter der CDU/CSU-Fraktion für Kirchen und Religionsgemeinschaften.', 'Franz Josef', '11003781');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07690, NULL, NULL, NULL, 'Kfz.-Mechaniker', 'verheiratet, 3 Kinder', '15.01.1959', 'Kroatien', 'Koprvnica', 'männlich', NULL, '18.10.2005', 'Juratovic', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Regionalverband Heilbronn-Franken, Heilbronn,<br/>Mitglied der Verbandsversammlung, ehrenamtlich (bis 24.10.2014)<br/><br/>Stadt Gundelsheim, Gundelsheim,<br/>Mitglied des Stadtrates, ehrenamtlich (bis 31.12.2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung Schüler Helfen Leben, Berlin,<br/>Mitglied des Stiftungskuratoriums<br/><br/>Südosteuropa-Gesellschaft e.V., München,<br/>Beisitzer des Präsidiums', '1966/74 Gesamtschule in Kroatien, 1975/76 Hauptschule Gundelsheim, 1976/77 Berufsfachschule Metall Neckarsulm. 1977/79 Kfz-Mechaniker-Lehre in Bad Rappenau. 1981/83 tätig als Kfz-Mechaniker in Mannheim, 1983/2000 tätig als Fließbandarbeiter und in der Qualitätssicherung bei Audi Neckarsulm, 2000/05 Betriebsrat bei Audi Neckarsulm. 1982 Eintritt SPD, 1984/91 Ortsvereinsvors. in Gundelsheim, 1986/89 stellv. Juso-Kreisvors., 1993/2011 stellv. Kreisvors. SPD Heilbronn-Land, seit 2011 Kreisvors., 1997/13 Mitgl. Landesvorstand SPD Baden-Württemberg. 2004 Stadtrat Gundelsheim, 2009/11 Mitgl. Kreistag und seit 2009 Mitgl. Regionalversammlung Heilbronn-Franken. Mitgl. IG Metall, NABU, BUND, AWO, VdK. 1995 Gründung der Friedensinitiative "Neue Brücke" ehemaliger Jugoslawen in der IG Metall, 2005 Gründung der "Initiative Berufsabschluss - Jugendlichen eine Chance geben". Kroatisch/Serbisch (f), Englisch (G). - MdB seit 2005; seit 2014 Integrationsbeauftragter der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 266 (Neckar-Zaber)', 'Josip', '11003782');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07691, NULL, NULL, NULL, 'Baukaufmann', 'verheiratet, 1 Kind', '16.06.1948', NULL, 'Varel', 'männlich', NULL, '18.10.2005', 'Kammer', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Senioren- und Pflegeheim Osterforde gemeinnützige GmbH, Bockhorn, <br/>Vorsitzender des Aufsichtsrates', 'Ausbildung zum Groß- und Außenhandelskaufmann, Weiterbildung zum staatl. anerkannten Bilanzbuchhalter. 1970/05 tätig als Baukaufmann in einem großen Bauunternehmen in Wilhelmshaven, dort ca. 30 Jahre als Prokurist und kaufmännischer Leiter in verantwortl. Position. Seit 1974 Mitgl. CDU, Vorstandsmitgl. CDU Zetel, 1976/92 dort Vors., 2002/10 Vors. CDU Friesland, seit Dez. 2015 Vors. CDU Zetel/Neuenburg. 1976/98 und seit Nov. 2016 Mitgl. Gemeinderat Zetel, 1981/91 Bürgermeister; 1980/Okt. 2011 Mitgl. Kreistag Friesland, 2001/11 Vors. Kreistagsfraktion. Vors. Pflegeheim Osterforde. - MdB 2005/09 und seit April 2010; stellv. Vors. AK Küste der CDU/CSU-Fraktion.', 'Hans-Werner', '11003783');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07695, NULL, NULL, NULL, 'Oberbürgermeister a. D., Rechtsanwalt', 'verheiratet, 2 Kinder', '22.11.1950', NULL, 'Neumarkt', 'männlich', NULL, '18.10.2005', 'Karl', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, selbständig, Neumarkt<br/>Mandant 1, 2013, Stufe 3<br/>Mandant 2, 2014, Stufe 3', 'Abitur am Willibald-Gluck-Gymnasium in Neumarkt. Studium der Rechts- und Wirtschaftswissenschaften an der Universität Regensburg, 1976 1. jur. Staatsprüfung, 1979 2. jur. Staatsprüfung. Rechtsanwalt. Jan. 1981/April 1990 Leiter des Rechtsamtes der Stadt Neumarkt. Mai 1990/Okt. 2005 Oberbürgermeister der Stadt Neumarkt. Früher versch. Funktionen in der JU, jetzt in der CSU auf Orts-, Kreis- und Bezirksebene, CSU-Kreisvors. Neumarkt i. d. Oberpfalz. 1978/80 und 2008/10 Stadtrat in Neumarkt, seit 1984 Mitgl. im Kreistag Neumarkt. Mitgl. in vielen Vereinen, u.a. bei Kolping. Englisch (G). - MdB seit 2005; Vors. Dt.-baltische Parlamentariergruppe.', 'Alois', '11003784');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07696, NULL, 'Dr.', 'Dr.', 'Professor für Politik und Migrationspolitik', '2 Kinder', '12.02.1943', 'Türkei', 'Macka', 'männlich', NULL, '18.10.2005', 'Keskin', NULL, 'DIE LINKE.', NULL, 'Islam', NULL, NULL, NULL, 'Hakki', '11003785');
