INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07702, NULL, NULL, NULL, 'Elektro-Techniker, Unternehmer', 'verheiratet, 1 Kind', '27.09.1962', NULL, 'Zeitz', 'männlich', NULL, '18.10.2005', 'Koeppen', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Elektromonteur, Meister Industrieelektrotechnik, Meister Elektroinstallateurhandwerk, 1990 bis 2010 selbstständiger Unternehmer. 1989 Mitgl. Neues Forum, seit 2001 Kreisvors. CDU Uckermark, seit 2003 Mitgl. im Landesvorst. der CDU Brandenburg, Vors. Landesfachausschuss Wirtschaft, Energie und Digitale Agenda der CDU Brandenburg. Kreistagsabgeordneter, Gemeindevertretung Berkholz-Meyenburg. - MdB seit 2005; Vors. Ausschuss Digitale Agenda, Mitgl. Ältestenrat, Vorstandsmitglied Parlamentskreis Mittelstand, Mitgl. AG Handwerk, Kommission Aufbau Ost; Schriftführer im Bundestag (Obmann).', 'Jens', '11003789');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07704, NULL, NULL, NULL, 'Politikwissenschaftler M. A.', 'verheiratet, 1 Kind', '05.04.1977', NULL, 'Osnabrück', 'männlich', NULL, '18.10.2005', 'Korte', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Neues Deutschland Druckerei und Verlag GmbH, Berlin, <br/>	Buchautor, 2014, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung zur Aufarbeitung der SED-Diktatur, Berlin, <br/>Mitglied des Stiftungsrates', '1983/87 Grundschule Georgsmarienhütte, 1987/89 Orientierungsstufe, 1989/97 Gymnasium, 1997 Abitur. 1997/98 Zivildienst. Sommer 1999 Studium der Politischen Wissenschaft, Soziologie und Geschichte Univ. Hannover, Winter 2005 Abschluss als Politikwissenschaftler M. A. 1996/99 Fraktionsvors. von Bündnis 90/Die Grünen im Rat der Stadt Georgsmarienhütte, 1999 Austritt aus BÜNDNIS 90/DIE GRÜNEN. 1999 Eintritt PDS, 2004/Ende 2005 Vors. PDS Hannover, 2004/07 Mitgl. Parteivorstand Linkspartei.PDS, Juni 2007/Mai 2010 Mitgl. Parteivorstand DIE LINKE. Mitgl. bei ver.di und dem Anglerverein Bitterfeld e. V. Englisch (G), Latein (G). - MdB seit Okt. 2005; Datenschutzbeauftragter der Fraktion DIE LINKE; stellv. Vors. der Dt.-Israelischen Parlamentariergruppe, Okt. 2009/Okt. 2011 Leiter des AK "Bürgerrechte und Demokratie" und Nov. 2011/Nov. 2015 Leiter des AK "Demokratie, Kultur, Wissen und Bildung" der Fraktion DIE LINKE, seit Okt. 2009 Mitgl. Fraktionsvorst, seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE.', 'Jan', '11003790');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07707, NULL, 'Dr.', 'Dr.', 'Zahnarzt', 'verheiratet, 1 Kind', '17.06.1956', NULL, 'Bad Bramstedt', 'männlich', NULL, '18.10.2005', 'Koschorrek', NULL, 'CDU', NULL, 'evangelisch', NULL, NULL, NULL, 'Rolf', '11003791');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07708, NULL, NULL, NULL, 'Dozentin', '2 Kinder', '29.12.1952', NULL, 'Karlsruhe', 'weiblich', NULL, '18.10.2005', 'Kotting-Uhl', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Abitur. Studium der Germanistik, Anglistik und Kunstgeschichte in Heidelberg, Edinburgh und Zaragoza. Dramaturgin, Leiterin einer Kinderwerkstatt, bis 2005 Dozentin bei freien Bildungsträgern. 1995/99 und 2001/13 Mitgl. im Landesvorstand Baden-Württemberg, 2003/05 Landesvors. Bündnis 90/Die Grünen. Mitgl. bei BUND, WWF, Greenpeace, Europa-Union, Amnesty International, Institut Solidarische Moderne, div. kulturellen und sozialen Einrichtungen Baden-Württembergs. - MdB seit 2005; in der 16. WP Sprecherin für Umweltpolitik, seit der 17. WP Sprecherin für Atompolitik der Fraktion Bündnis 90/Die Grünen, in der 18. WP Mitgl. Kommission Lagerung hoch radioaktiver Abfallstoffe.', 'Sylvia', '11003792');
