INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07714, NULL, NULL, NULL, 'Dipl.-Ingenieurin (FH)', 'verheiratet, 1 Kind', '06.04.1964', NULL, 'Wolmirstedt', 'weiblich', NULL, '18.10.2005', 'Kunert', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Funktionen in Unternehmen: <br/>ALS Dienstleistungsgesellschaft mbH, Stendal, <br/>Mitglied des Aufsichtsrates<br/><br/>TreuhandliegenschaftsGenossenschaft "FAIRWOHNEN" i.G., Berlin, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreissparkasse Stendal, Stendal, <br/>Mitglied des Verwaltungsrates<br/><br/>Landkreis Stendal, Stendal, <br/>Mitglied des Kreistages<br/><br/>Stadt Stendal, Stendal, <br/>Mitglied des Stadtrates', 'Ausbildung zur Rinderzüchterin. Studium zur Diplom-Ingenieurin (FH). Umschulung zur Floristin. 1998/05 Mitarbeiterin einer Abg. im Landtag Sachsen-Anhalt. Mitgl. Volkssolidarität, Aufsichtsratsmitgl. der TLG FAIRWOHNEN; seit 2005 Mitgl. Verwaltungsrat Kreissparkasse Stendal. 2003/06 Mitgl. des Parteivorstandes der Linkspartei.PDS, stellv. Kreisvors. DIE LINKE Stendal. 1991/94 Mitgl. Kreistag Osterburg, seit 1995 Mitgl. Kreistag Stendal, seit 2009 Mitgl. Stadtrat Stendal. - MdB seit 2005.', 'Katrin', '11003795');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07718, NULL, NULL, NULL, 'MdL a. D., Konditor, Diplom-Ingenieur (FH)', 'verheiratet, 2 Kinder', '19.04.1959', NULL, 'Falkenstein / Vogtland', 'männlich', NULL, '18.10.2005', 'Lämmel', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Sächsische Dampfschiffahrts-GmbH & Co. Conti Elbschiffahrts KG, Dresden, <br/>Mitglied des Beirates<br/><br/>Tourismus Marketing Gesellschaft Sachsen mbH, Dresden, <br/>Mitglied des Aufsichtsrates<br/><br/>Wohnungsgenossenschaft "Glückauf" Süd Dresden e.G., Dresden, <br/>Vorsitzender des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas,<br/>Telekommunikation, Post und Eisenbahnen, Bonn, <br/>Mitglied des Beirates<br/><br/>Sächsische Aufbaubank - Förderbank, Dresden, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Afrika Stiftung e.V., Berlin, <br/>Mitglied des Vorstandes<br/><br/>Deutsch-Mosambikanische Gesellschaft e.V., München, <br/>Vorsitzender des Beirates<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin, <br/>Stellv. Vorsitzender des Beirates für Welthandel<br/><br/>Landestourismusverband Sachsen e.V., Dresden, <br/>Präsident<br/><br/>Stiftung Dresdner Kreuzchor - Förderstiftung, Dresden, <br/>Mitglied des Kuratoriums', 'Nach Schulbesuch Lehre im Handwerk als Konditor. 1978/79 Wehrdienst. 1979/82 Studium an der TH Leipzig, Abschluss Dipl.-Ing. (FH). 1989 Tätigkeit als Projektmanager für Investitionsprojekte in der Industrie. 1991/92 Referatsleiter Grundsatzfragen im Sächsischen Staatsministerium für Wirtschaft und Arbeit. 1993/94 Abteilungsleiter Unternehmensansiedlung bei der Wirtschaftsförderung Sachsen GmbH. 1990 Geschäftsführer des NEUEN FORUM, später des CDU-Kreisverb. Dresden. 1994/05 Mitgl. des Sächsischen Landtags, zuletzt Vors. Ausschuss für Wirtschaft. Seit Juni 2010 Mitgl. im Beirat der Bundesnetzagentur, seit Nov. 2010 Mitgl. im Vorstand der Deutschen Afrika Stiftung e. V. - MdB seit Okt. 2005; seit Okt. 2009 Obmann der CDU/CSU-Fraktion im Ausschuss für Wirtschaft und Technologie, jetzt Ausschuss für Wirtschaft und Energie, seit Nov. 2011 stellv. Vors. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, seit Nov. 2013 Vors. Arbeitskreis Afrika der CDU/CSU-Fraktion.', 'Andreas G.', '11003796');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07722, NULL, 'Dr.', 'Dr.', 'Universitätsprofessor', 'geschieden, 4 Kinder', '21.02.1963', NULL, 'Düren', 'männlich', NULL, '18.10.2005', 'Lauterbach', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Center for Transnational Legal Studies, London,<br/>Vortrag, 2014, Stufe 1 (Lectures in Transnational Justice)<br/><br/>Curagita AG, Heidelberg,<br/>Vortrag, 2017, Stufe 2 (8. Radiologentag)<br/><br/>Deutsche Arbeitsgemeinschaft für Psychosoziale Onkologie e.V., Ludwigshafen,<br/>Vortrag, 2013, Stufe 1 (Nachtrag zur 17. Wahlperiode)<br/><br/>Deutsche Druck- und Verlagsgesellschaft mbH (ddvg), Hamburg,<br/>Wissenschaftliche Beratung, 2015, Stufe 4; 2016, Stufe 4<br/><br/>Deutsche Wirbelsäulengesellschaft e.V., Ulm,<br/>Vortrag, 2016, Stufe 2 (11. Jahrestagung der Deutschen Wirbelsäulengesellschaft)<br/><br/>Gesundheitsregion Mecklenburg-Vorpommern e.V., Rostock,<br/>Vortrag, 2013, Stufe 2 (Nachtrag zur 17. Wahlperiode)<br/><br/>Harvard Universität, Cambridge, Massachusetts, USA,<br/>Wissenschaftliche Beratung, 2013, Stufe 1 (Nachtrag zur 17. Wahlperiode);<br/>2015, Stufe 1<br/><br/>Inter-American Development Bank, Washington D.C., USA,<br/>Wissenschaftliche Beratung der kolumbianischen Regierung, 2015, Stufe 2<br/><br/>Oxford Policy Management Ltd., Oxford, GB,<br/>Wissenschaftliche Beratung, 2015, Stufe 4<br/><br/>Rowohlt Berlin Verlag GmbH, Berlin,<br/>Autorenhonorar, 2014, Stufe 4; 2015, Stufe 4<br/><br/>Seufert Rechtsanwälte, München,<br/>Vortrag, 2014, Stufe 2 (Zukunft Kommunale Kliniken)<br/><br/>SKC Beratungsgesellschaft mbH, Hannover,<br/>Vortrag, 2013, Stufe 2 (Nachtrag zur 17. Wahlperiode)<br/><br/>Supreme Council Of Health, Doha, Katar,<br/>Wissenschaftliche Beratung, 2013, Stufe 3<br/><br/>The London Speaker Bureau, Karlsruhe,<br/>Vortrag, 2015, Stufe 2 (Investmentkonferenz, Sal. Oppenheim jr. & Cie. AG & Co. KGaA, Köln)<br/><br/>World Bank, Washington, USA,<br/>Vortrag, 2014, Stufe 1 (Official World Bank Mission to Deliver Egypt National Workshop)<br/>Wissenschaftliche Beratung, 2014, Stufe 2<br/><br/>Funktionen in Unternehmen: <br/>Rhön-Klinikum AG, Bad Neustadt/Saale,<br/>Mitglied des Aufsichtsrates (bis Juni 2013), 2014, Stufe 3 (Nachzahlung für 2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Muhanna-Stiftung, Zürich, <br/>	Mitglied des Stiftungsrates, ehrenamtlich', 'Studium der Medizin in Aachen, Texas (USA) und Düsseldorf, Promotion zum Dr. med. Studium der Epidemiologie und Gesundheitsökonomie (Health Policy and Management), Promotion an der Harvard Universität in Boston, USA. 1998/05 Direktor des Instituts für Gesundheitsökonomie und Klinische Epidemiologie (IGKE) der Universität zu Köln, seit 2008 Adjunktprofessor an der Harvard School of Public Health in Boston. 1999/05 Mitgl. im Sachverständigenrat zur Begutachtung der Entwicklung im Gesundheitswesen, 2003/05 Mitgl. der Kommission für die Nachhaltigkeit in der Finanzierung der Sozialen Sicherungssysteme (Rürup-Kommission). Mitgl. der Programmkommission der SPD Köln, 2004 Mitgl. der AG Bürgerversicherung des SPD-Parteivorst. Mitgl. bei ver.di. - MdB seit Okt. 2005; seit Dez. 2013 stellv. Vors. SPD-Fraktion.', 'Karl', '11003797');
