INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07729, NULL, NULL, NULL, 'Rechtsanwalt, Altbürgermeister', 'verheiratet, 2 Kinder', '20.11.1959', NULL, 'Ochsenfurt', 'männlich', NULL, '18.10.2005', 'Lehrieder', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Würzburg, Würzburg, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesvereinigung Deutscher Musikverbände e.V. (BDMV), Stuttgart,<br/>Präsident, ehrenamtlich', '1966/80 Grundschule, Gymnasium Marktbreit. 1980/81 Grundwehrdienst Heeresflieger Niederstetten. 1981/84 Lehre als Augenoptiker, Gesellenbrief. 1984/89 Studium Rechtswissenschaft Univ. Würzburg, 1. jur. Staatsexamen, 1990/93 Referendariat, 2. jur. Staatsexamen. 1990/06 Erster Bürgermeister der Gemeinde Gaukönigshofen. 1993 Zulassung als Rechtsanwalt. 1980 Gründungsmitgl. JU Gaukönigshofen, stellv. Kreisvors. JU Würzburg-Land; Mitgl. Kommunalpol. Vereinigung der CSU; Mitgl. CSA; stellv. Ortsvors. CSU Gaukönigshofen, Mitgl. im Kreis- und Bezirksvorstand der CSU. Seit 1996 Kreisrat, 2002/05 stellv. Landrat. 1. Vors. Förderverein Wärmestube e. V.; Mitgl. Nordbay. Musikbund, seit 2016 Präsident Bundesvereinigung Deutscher Musikverbände (BDMV) e. V. Englisch (f), Französisch (G). - MdB seit Okt. 2005; März 2009/Jan. 2014 stellv. Vors. AG Arbeit und Soziales der CDU/CSU-Fraktion, stellv. Vors. der Arbeitnehmergruppe; stellv. Vors. dt.-südasiatische Parlamentariergruppe; seit Jan. 2014 Vors. Ausschuss für Familie, Senioren, Frauen und Jugend.', 'Paul', '11003799');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07730, NULL, NULL, NULL, 'Diplom-Soziologe', 'verheiratet, 2 Kinder', '08.08.1974', NULL, 'Schlema', 'männlich', NULL, '18.10.2005', 'Leutert', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Funktionen in Unternehmen: <br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn, Eschborn,<br/>Mitglied des Aufsichtsrates', '1993 Abitur Gymnasium Mittweida. 1994/02 Studium Soziologie, Recht, Politik an der TU Chemnitz und der TU Dresden, 2002 Abschluss als Dipl.-Soziologe an der TU Dresden. 1999/04 Mitarbeiter der MdL Katja Kipping. Seit 1991 Mitgl. der PDS, 1998/99 Landesjugendkoordinator der PDS Sachsen, 1999/05 stellv. Landesvors. der PDS Sachsen. Mitgl. ver.di, der Rosa-Luxemburg-Stiftung Sachsen, bundesweites Netzwerk Grundeinkommen und im kommunalpolitischen Forum Sachsen. Englisch (G), Russisch (G). - MdB seit 2005; 2005/09 menschenrechtspolitischer Sprecher der Fraktion DIE LINKE, Vors. der Deutsch-Mexikanischen Parlamentariergruppe.', 'Michael', '11003800');
