INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07751, NULL, NULL, NULL, 'Bankkaufmann, Rechtsanwalt', 'ledig', '08.05.1970', NULL, 'Braunschweig', 'männlich', NULL, '18.10.2005', 'Müller', '(Braunschweig)', 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwalt, selbständig, Braunschweig<br/><br/>Carsten Müller Fahrzeughandel, Braunschweig<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, selbständig, Braunschweig<br/>   Mandant 1, 2014, Stufe 1<br/><br/>Artemis Energy Braunschweiger Bio Energie GmbH & Co KG, Braunschweig,<br/>Geschäftsführer der Komplementärin (bis 31.12.2013), monatlich, Stufe 1<br/><br/>Artemis Energy GmbH, Braunschweig,<br/>Geschäftsführer<br/><br/>Carsten Müller Fahrzeughandel, Braunschweig,<br/>Kaufmann, selbständig<br/>   ATS - Agro Tradling & Solutions GmbH, Hardegsen, 2016, Stufe 2<br/><br/>Funktionen in Unternehmen: <br/>Braunschweiger Verkehrs-GmbH, Braunschweig,<br/>Vorsitzender des Aufsichtsrates (bis 01.11.2016)<br/><br/>Cleanventure AG, Hamburg,<br/>Mitglied des Aufsichtsrates (bis 05.02.2014)<br/><br/>Kraftverkehr Mundstock GmbH, Vechelde,<br/>Vorsitzender des Aufsichtsrates<br/><br/>Minol Messtechnik W. Lehmann GmbH & Co. KG, Berlin,<br/>Mitglied des Kundenbeirates<br/><br/>Stadt Braunschweig Beteiligungsgesellschaft mbH, Braunschweig,<br/>Mitglied des Aufsichtsrates<br/><br/>Stadthalle Braunschweig Betriebsgesellschaft mbH, Braunschweig,<br/>Mitglied der Gesellschafterversammlung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Braunschweig, Braunschweig,<br/>Mitglied des Stadtrates (bis 01.11.2016)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Arabischer Bildungsverein e.V., Braunschweig,<br/>Vorsitzender, ehrenamtlich<br/><br/>Deutsche Unternehmensinitiative für Energieeffizienz e.V. - DENEFF, Berlin,<br/>Vorsitzender des Vorstandes, ehrenamtlich<br/><br/>IAK Initiative Automobiles Kulturgut e.V., Potsdam,<br/>Präsident, ehrenamtlich<br/><br/>VMDU e.V. - Verein Mittelständischer Dienstleistungsunternehmen e.V., Schwerte,<br/>Vorsitzender, ehrenamtlich', '1989 Abitur in Braunschweig. 1989/91 Ausbildung zum Bankkaufmann. 1992/99 Bundesanstalt Technisches Hilfswerk. 1992/98 Studium der Rechtswissenschaften Univ. Göttingen; 1999/01 juristisches Referendariat am OLG Braunschweig. 1991/01 Tätigkeit (auch studienbegleitend) bei der Deutschen Bank AG in Braunschweig, Hannover und London. 1998/01 Geschäftsführer in einer Ingenieurgesellschaft. Seit 2002 selbstständiger Rechtsanwalt. 2003/Januar 2006 und erneut seit Mai 2010 Geschäftsführer in mittelständischen Unternehmen. Seit 1986 Mitgl. der Jungen Union und CDU, 1989/90 Landesvors. der Schüler Union Niedersachsen, 1989/91 der Jungen Union Braunschweig, 1990/92 und seit 2000 Mitgl. CDU-Landesvorst. Braunschweig, derzeit Landesschatzmeister, seit 1998 stellv. Kreisvors. der CDU Braunschweig, seit 2014 Mitgl. im Präsidium der CDU Niedersachsen. 1991/2016 Ratsherr der Stadt Braunschweig. Seit 2010 ehrenamtl. Vors. der Deutschen Unternehmensinitiative Energieeffizienz e. V. (DENEFF). - MdB 2005/09 und seit Okt. 2013; seit 2014 Vors. Parlamentskreis "Automobiles Kulturgut", seit 2014 Vors. Parlamentskreis "Energieeffizienz".', 'Carsten', '11003815');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07753, NULL, NULL, NULL, 'Lokomotivführer', 'verheiratet, 2 Kinder', '20.08.1964', NULL, 'Karl-Marx-Stadt', 'männlich', NULL, '18.10.2005', 'Müller', '(Chemnitz)', 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>DB RegioNetz Verkehrs GmbH, Erzgebirgsbahn, Chemnitz,<br/>Teamleiter Disposition, Security- und Qualitätsmanagement<br/><br/>Funktionen in Unternehmen: <br/>Chemnitzer Verkehrs-AG, Chemnitz,<br/>Mitglied des Aufsichtsrates<br/><br/>eins energie in sachsen GmbH & Co. KG, Chemnitz,<br/>Mitglied des Aufsichtsrates<br/><br/>Versorgungs- und Verkehrsholding Chemnitz GmbH, Chemnitz,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkasse Chemnitz, Chemnitz,<br/>Mitglied des Verwaltungsrates<br/><br/>Stadt Chemnitz, Chemnitz,<br/>Mitglied des Stadtrates, Fraktionsvorsitzender<br/>Mitglied des Ortschaftsrates und stellv. Ortsvorsteher Klaffenbach<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Freundeskreis "Indira Gandhi" e.V., Chemnitz,<br/>Stellv. Vorsitzender, ehrenamtlich', '1971/81 Besuch der Allgemeinbildenden Oberschule. 1981/83 Ausbildung zum Lokomotivführer. Seit 1983 Lokomotivführer (Diesel- und E-Traktion), berufsbegl. Weiterbildung zum Ausbilder, Prüfer und Kontrolleur für Lokomotiv- und Triebfahrzeugführer der Deutschen Bahn AG. Ab 2002 Teamleiter "Fahrzeuge und Personal" bei der Erzgebirgsbahn in Chemnitz, seit 2009 Teamleiter "Disposition, Security und Qualität" bei der Erzgebirgsbahn in Chemnitz. Seit 1990 Mitgl. der SPD, Vorstandsmitgl. und stellv. Vors. SPD-Unterbezirk Chemnitz. Ortschaftsrat Chemnitz-Klaffenbach, stellv. Ortsvorsteher in Chemnitz-Klaffenbach, seit 1994 Stadtrat in Chemnitz, dort 1999/05 und seit 2014 Vors. der SPD-Fraktion und Mitgl. im Planungs-, Bau- und Umweltausschuss und im Kultur- und Sportausschuss. 2005/14 Präsident Basketballvereinigung Chemnitz 99 e. V. - Die "NINERS". - MdB 2005/09 und seit Dez. 2014.<br/><br/>eingetreten am 19.12.2014 für Abg. Tiefensee', 'Detlef', '11003816');
