INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07758, NULL, NULL, NULL, 'Jurist, Landesminister a. D., Fraktionsvorsitzender', '4 Kinder', '27.04.1954', NULL, 'Freekenhorst', 'männlich', NULL, '18.10.2005', 'Oppermann', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Unternehmen: <br/>Hertie School of Governance gemeinnützige GmbH, Berlin, <br/>	Mitglied des Kuratoriums<br/><br/>	Internationale Händel-Festspiele Göttingen gemeinnützige GmbH, <br/>	Göttingen, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>ZDF, Mainz, <br/>	Mitglied des Fernsehrates (bis 07.07.2016)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>	Bürgerstiftung Göttingen, Göttingen, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Kulturstiftung Kornhaus, Einbeck,<br/>Mitglied des Kuratoriums für den Zweckbetrieb PS.Speicher, ehrenamtlich<br/><br/>	Max-Planck-Institut für biophysikalische Chemie, Göttingen, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Max-Planck-Institut für Sonnensystemforschung,<br/>	Katlenburg-Lindau, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Palliativzentrum der Universität Göttingen, Göttingen, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Wissenschaftskolleg zu Berlin, Berlin, <br/>	Mitglied des Stiftungsrates der Wissenschaftsstiftung Ernst Reuter,<br/>	ehrenamtlich (bis April 2015)<br/><br/>	XLAB-Stiftung zur Förderung der Naturwissenschaften, Göttingen, <br/>	Mitglied des Kuratoriums, ehrenamtlich', 'Abitur an der Goetheschule Einbeck. Studium der Germanistik u. Anglistik in Tübingen. 1976/78 USA-Aufenthalt mit Aktion Sühnezeichen/Friedensdienste in Washington D.C. u. New York, Mitarbeit im Boykottbüro der Feld- u. Wanderarbeitergewerkschaft UFW/AFL-CIO. Studium der Rechtswissenschaften in Göttingen, 1983 Referendarexamen, danach wiss. Hilfskraft u. Arbeit in der Mieterberatung, 1986 Assessorexamen. 1986/90 Richter am Verwaltungsgericht. Seit 1980 Mitgl. der SPD, Funktionen bei den Jungsozialisten, seit 1989 Vors. SPD-Unterbezirk Göttingen. 1990/05 Mitgl. des Niedersächsischen Landtags, 1998/03 Minister für Wissenschaft und Kultur. 1999/04 Vors. Kuratorium VW-Stiftung, Mitgl. Kuratorium XLAB-Stiftung und Kuratorium Hertie School of Governance GmbH, Mitgl. in Kuratorien versch. Max-Planck-Institute, Juni 2014/Juni 2016 Mitgl. ZDF-Fernsehrat. - MdB seit Okt. 2005; Nov. 2007/Dez. 2013 Erster Parl. Geschäftsführer und seit Dez. 2013 Vors. der SPD-Fraktion.', 'Thomas', '11003820');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07761, NULL, NULL, NULL, 'Prokurist, Jurist', 'verheiratet, 4 Kinder', '27.10.1968', NULL, 'Celle', 'männlich', NULL, '18.10.2005', 'Otte', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Celle, Celle,<br/>Mitglied des Kreistages<br/><br/>Sparkasse Celle, Celle,<br/>Mitglied des Verwaltungsrates<br/><br/>Stadt Bergen, Bergen,<br/>Mitglied des Stadtrates und des Ortsrates Eversen<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Gesellschaft für Wehrtechnik e.V., Bonn,<br/>Stellv. Präsident, ehrenamtlich<br/><br/>Förderkreis Deutsches Heer e.V., Bonn,<br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Lachen Helfen e.V., Essen,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Soldaten und Veteranen Stiftung (SVS), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Sankt Barbara, Munster,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Abitur Christian-Gymnasium Hermannsburg. Ausbildung zum Bankkaufmann bei der Sparkasse Celle. Reserveoffizier Panzerbataillon 333 in Celle. Studium der Rechtswissenschaften Universität Hamburg (bac. jur.). Angestellter bei der Sparkasse Celle; Prokurist in einem mittelständ. Unternehmen. 1994 Eintritt in die CDU, seit 2012 Vors. CDU-Kreisverband Celle, seit 2007 stellv. Vors. CDU-Bezirksverb. Nordostniedersachsen, Mitgl. im Präsidium der CDU in Niedersachsen. Seit 1996 Mitgl. Stadtrat Bergen und Kreistag Celle, u. a. stellv. Landrat und Mitgl. des Verwaltungsrates der Sparkasse. 2006/12 Mitgl. im Vorst. der EVP. Seit 2012 stellv. Präs. der Deutschen Gesellschaft für Wehrtechnik e.V. (DWT). - MdB seit Okt. 2005; Mitgl. des Parlamentskreises Mittelstand, seit Jan. 2014 Vors. der AG Verteidigung und verteidigungspol. Sprecher der CDU/CSU-Fraktion.', 'Henning', '11003821');
