INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07767, NULL, NULL, NULL, 'Dipl.-Pädagogin', 'ledig', '03.11.1957', NULL, 'Coesfeld', 'weiblich', NULL, '18.10.2005', 'Rawert', NULL, 'SPD', NULL, 'katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1976/80 Studium Kath. FH NRW Abt. Münster, Abschluss Dipl.-Sozialpädagogin, 1981/82 Anerkennungsjahr Haus am Rupenhorn, 1981/86 Studium Erwachsenenbild. FU Berlin, Abschluss Dipl.-Pädagogin, 1996/97 Total Quality Management Univ. Kaiserslautern. 1985/86 Päd. Mitarbeiterin Haus am Rupenhorn, 1986/91 Geschäftsführerin b. Sozialdienst Kath. Frauen e. V. Berlin, 1991/96 BBJ Consult e. V. davon 1 Jahr in Brüssel, 1996/02 zukunft im zentrum - Servicegesellschaft f. Beschäftigungs- u. Qualifizierungsberatung mbH, 2002/04 Projektmanagerin, 2003 Dt. Frauenrat e. V., 2004/05 Zentrale Frauenbeauftragte Charité Universitätsmedizin Berlin. Seit 1987 Mitgl. der SPD, 2000/07 Landesvors. ASF, Mitgl. SPD-Landesvorst., Sprecherin d. Berliner Linken. Seit 1981 Mitgl. ver.di, Berliner Frauenbund 1945 e. V., Überparteiliche Fraueninitiative "Berlin - Stadt der Frauen", Dt.-Palästinensische Gesellschaft, Pro Familia, Verein zur Förderung des Weinbergs und Gartenarbeitsschule in Schöneberg e. V., Parl. Beirat Dt. Stiftung Weltbevölkerung, Gesellschaft f. Chancengleichheit e. V., Mitgl. attac und Friedenau-integrativ e. V., Mitgl. Kuratorium Bundesstiftung Magnus Hirschfeld, Mitgl. Beirat des Ombudsmannes für Versicherungen, Mitgl. Parl. Ring Volksbund der Kriegsgräberfürsorge, Mitgl. AWO-Parlamentariergruppe.  - MdB seit Okt. 2005; seit Okt. 2009 Sprecherin Landesgruppe Berlin der SPD-Fraktion; stellv. Mitgl. Parl. Vers. Europarat, Chairperson Sub-Committee on Disability and Inclusion; Vors. Deutsch-Maltesische Parlamentariergruppe, Mitgl. der Deutsch-Spanischen und Deutsch-Polnischen Parlamentariergruppe.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 77 (Berlin-Reinickendorf)', 'Mechthild', '11003825');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07770, NULL, NULL, NULL, 'Dipl.-Ingenieur für Informationsverarbeitung', 'verheiratet, 2 Kinder', '03.04.1954', NULL, 'Ribnitz- Damgarten', 'männlich', NULL, '18.10.2005', 'Rehberg', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>DB Station & Service AG, Frankfurt/Main, <br/>Mitglied des Aufsichtsrates<br/><br/>Flughafen Rostock-Laage-Güstrow GmbH, Laage, <br/>Mitglied des Aufsichtsrates (bis Oktober 2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Mitglied des Eisenbahninfrastrukturbeirates (bis April 2015)<br/><br/>Kreditanstalt für Wiederaufbau (KfW), Frankfurt/Main,<br/>Mitglied des Verwaltungsrates', '1960/70 zehnklassige Polytechnische Oberschule. 1970/73 Beruf mit Abitur als Facharbeiter für Datenverarbeitung. 1973/75 Grundwehrdienst. 1977/83 Hochschulfernstudium in Berlin und Dresden. 1975/89 berufliche Tätigkeit in der EDV-Branche, 1990 Geschäftsführer in der Schmuckindustrie. Seit 1984 Mitgl. der CDU, 1991/01 stellv. Landesvors. der CDU Mecklenburg-Vorpommern (M-V), 2001/05 Landesvors. der CDU M-V. 1990/05 Mitgl. des Landtages M-V, Vors. der CDU-Fraktion. - MdB seit Okt. 2005; 2009/15 Beauftragter der CDU/CSU-Fraktion für die Maritime Wirtschaft, seit 2009 Vors. der CDU/CSU-Landesgruppe Mecklenburg-Vorpommern, seit Dez. 2013 Sprecher der CDU-Landesgruppen, seit Feb. 2015 haushaltspol. Sprecher der CDU/CSU-Fraktion.', 'Eckhardt', '11003826');
