mbH, Bonn,<br/>Mitglied der Projektgruppe Schwein und des Beraterausschusses<br/><br/>LAND-DATA GmbH, Visselhövede,<br/>Mitglied des Aufsichtsrates<br/><br/>LVM Pensionsfonds-AG, Münster,<br/>Mitglied des Aufsichtsrates, jährlich, Stufe 3<br/><br/>QS Qualität und Sicherheit GmbH, Bonn,<br/>Vorsitzender des Fachbeirates Rind und Schwein<br/>Mitglied des Kuratoriums<br/><br/>R+V Allgemeine Versicherung AG, Wiesbaden,<br/>Mitglied des Ausschusses für Vorsorge- und Versicherungsfragen der deutschen Bauern, Gärtner und Winzer<br/><br/>Westfälische Provinzial Versicherung AG, Münster,<br/>Mitglied des landwirtschaftlichen Beirates<br/><br/>Wirtschaftsförderungsgesellschaft für den Kreis Borken mbH, Ahaus,<br/>Berater des Aufsichtsrates<br/><br/>WL BANK AG Westfälische Landschaft Bodenkreditbank, Münster,<br/>Mitglied des Aufsichtsrates, 2016, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Landwirtschaft und Ernährung (BLE), Bonn,<br/>Vorsitzender des Fachbeirates Vieh, Fleisch, Fleischerzeugung<br/><br/>Landwirtschaftskammer Nordrhein-Westfalen, Münster,<br/>Mitglied des Hauptausschusses und der Hauptversammlung<br/><br/>Sparkasse Westmünsterland, Ahaus,<br/>Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesmarktverband für Vieh und Fleisch, Berlin,<br/>Vorsitzender des Bundesmarktverbandes, 2016, Stufe 4<br/><br/>Deutscher Bauernverband e.V. (DBV), Berlin,<br/>Mitglied des Verbandsrates und des Präsidiums<br/>Vorsitzender des DBV-Fachausschusses Schweinefleisch<br/><br/>Stiftung LV Münster, Münster,<br/>Vorsitzender des Kuratoriums<br/><br/>Stiftung Westfälische Landschaft, Münster,<br/>Vorsitzender der Direktion, monatlich, Stufe 1<br/><br/>Stiftung Westfälische Kulturlandschaft, Münster,<br/>Vorsitzender des Vorstandes<br/><br/>Westfälisch-Lippischer Landwirtschaftsverband e.V. (WLV), Münster,<br/>Präsident, monatlich, Stufe 2<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Gesellschaft Röring GbR, Vreden<br/><br/>	Röring Landwirtschaft GbR, Vreden', 'Gymnasium Mittlere Reife. Landwirtschaftl. Lehre, höhere Landbauschule Coesfeld, Abschluss staatl. gepr. Landwirt. Seit 1985 selbstständiger Landwirt. Seit 1986 Mitgl. der CDU, Mitgl. im CDU-Kreisagrarausschuss Borken, 1987/95 im Vorstand CDU Vreden, Juli 2008/Okt. 2014 Mitgl. CDU-Bundesfachausschuss Ernährung und Landwirtschaft. Seit Mai 2012 Präsident des Westfälisch-Lippischen Landwirtschaftsverbands. Vors. Direktion Stiftung Westf. Landwirtschaft, Vors. des Vorstands Stiftung Westfälische Kulturlandschaft, Berater des Aufsichtsrats der Wirtschaftsförderungsgesellschaft für den Kreis Borken, Vors. Bundesmarkenverband für Vieh und Fleisch, seit 2012 Vors. QS-Fachbeirat Rind- und Schweinefleisch. Englisch (G). - MdB seit Okt. 2005; seit 2012 Beisitzer im Vorst. der CDU/CSU-Fraktion.', 'Johannes', '11003832');
