INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07784, NULL, NULL, NULL, 'Diplom-Sozialpädagogin (FH), Berufsbetreuerin', 'verheiratet, 4 Kinder', '14.03.1963', NULL, 'Rüsselsheim', 'weiblich', NULL, '18.10.2005', 'Scharfenberg', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>BUND Naturschutz in Bayern e.V. (BN), Regensburg, <br/>Mitglied des Vorstandes der Ortsgruppe Rehau<br/><br/>IFAF - Institut für angewandte Forschung Berlin e.V., Berlin, <br/>Mitglied des Beirates des Projekts "Gleichgeschlechtliche Lebensweisen und<br/>Selbstbestimmung im Alter" (GLESA)<br/><br/>Internationaler Bund - Freier Träger der Jugend- Sozial- und Bildungsarbeit e.V., Frankfurt/Main, <br/>Mitglied des Landeskuratoriums Bayern<br/><br/>Kind & Kegel e.V., Rehau, <br/>Mitglied des Vorstandes', '1982 Abitur an der Gustav-Heinemann-Schule in Rüsselsheim. Studium Sozialarbeit-Sozialpädagogik an der Staatlichen Fachhochschule Berlin. 1997/09 freiberufliche Berufsbetreuerin, vorher tätig im Bereich Erwachsenenbildung, offene Sozialarbeit und im Betreuungsverein des Diakonischen Werkes Wunsiedel, sozialpädagogische Familienhilfe. Seit 1999 Mitgl. von Bündnis 90/Die Grünen, 1999/13 Vorstandssprecherin im Kreisverband Hof, 2002/10 Sprecherin der Grünen im Bezirk Oberfranken. Mitgl. im Kuratorium Deutsche Altershilfe, Mitgl. Kuratorium Internationaler Bund Bayern, Mitgl. Bund Naturschutz, Schriftführerin Ortsgruppe Rehau; Mitgl. Kind & Kegel e. V., ASV Rehau und der Wasserwacht Selb. - MdB seit Okt. 2005; Sprecherin für Pflegepolitik und Altenpolitik der Fraktion Bündnis 90/Die Grünen.', 'Elisabeth', '11003835');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07788, NULL, NULL, NULL, 'MdL a. D., Ministerin für Kultus, Jugend und Sport a. D., Bundesministerin für Bildung und Forschung a. D.', 'ledig', '10.06.1955', NULL, 'Jüchen / Kreis Neuss', 'weiblich', NULL, '28.04.2014', 'Schavan', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Annette', '11003836');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07789, NULL, 'Dr.', 'Dr.', 'Volkswirt', 'verpartnert', '18.04.1972', NULL, 'Hechingen', 'männlich', NULL, '18.10.2005', 'Schick', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Campus Verlag GmbH, Frankfurt/Main, <br/>Publizistische Tätigkeit, 2013, Stufe 2<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Ehrbare Versicherungskaufleute e.V., Hamburg, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Forum Kapitalmarktinstrumente - Kapitalmarktfinanzierung e.V., München, <br/>Mitglied des Beirates<br/><br/>PLUS Psychologische Lesben- und Schwulenberatung Rhein-Neckar e.V., Mannheim, <br/>Mitglied des Vorstandes, ehrenamtlich', '1991 Abitur. Zivildienst. 1992/98 VWL-Studium in Bamberg, Madrid und Freiburg, 2002 Promotion in Finanzwissenschaft. 1998/01 wissenschaftlicher Mitarbeiter am Walter-Eucken-Institut Freiburg, 2001/04 bei der Stiftung Marktwirtschaft Berlin, 2004/05 Projektmanager bei der Bertelsmann Stiftung in Gütersloh. Seit 1996 Mitgl. von Bündnis 90/Die Grünen, 2001/07 Sprecher der Bundesarbeitsgemeinschaft Wirtschaft und Finanzen von Bündnis 90/Die Grünen, seit Nov. 2008 Mitgl. im Parteirat von Bündnis 90/Die Grünen. Englisch (f), Französisch (f), Spanisch (f). - MdB seit Okt. 2005; Dez. 2006/Nov. 2007 Obmann der Fraktion Bündnis 90/Die Grünen im Parlamentarischen Beirat für nachhaltige Entwicklung, seit 2007 finanzpolitischer Sprecher der Fraktion Bündnis 90/Die Grünen, stellv. Vors. des Finanzausschusses, seit Juni 2011 Mitgl. parl. Finanzmarktgremium.', 'Gerhard', '11003837');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07790, NULL, NULL, NULL, 'Juristin', 'keine Angaben', '23.05.1962', NULL, 'Schwarzberg', 'weiblich', NULL, '11.04.2014', 'Schieder', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Absatzförderungsfonds der deutschen Land- und Ernährungswirtschaft, Bonn, <br/>	Mitglied des Verwaltungsrates, ehrenamtlich (bis 24.06.2014)<br/>	<br/>Landkreis Schwandorf, Schwandorf, <br/>	Mitglied des Kreistages<br/>	2. Stellv. Landrätin (bis 30.04.2014)<br/>	<br/>Marktgemeinde Wernberg-Köblitz, Wernberg-Köblitz, <br/>	Mitglied des Marktrates<br/>	<br/>Sparkassenverband Bayern, München, <br/>	Mitglied des Beirates für sparkassenpolitische Grundsatzfragen<br/>	<br/>Zweckverband Sparkasse im Landkreis Schwandorf, Schwandorf, <br/>	Mitglied des Verwaltungsrates', 'Abitur 1981. Studium der Rechtswissenschaften Univ. Regensburg, 1989 1. und 1992 2. jur. Staatsexamen. Bundesvors. der Kath. Landjugendbewegung (KLJB), dann Landesgeschäftsführerin der KLJB bis zur Wahl in den bayerischen Landtag 1994. 1990 Mitgl. der SPD, seit 1993 SPD-Ortsvereinsvors. Wernberg-Köblitz, 2001/10 SPD-Kreisvors. im Landkreis Schwandorf, bis Nov. 2008 stellv. Vors. und seit Nov. 2008 Vors. SPD-Unterbezirk Schwandorf-Cham, stellv. Vors. SPD-Bezirk Oberpfalz, Mitgl. Präsidium BayernSPD. Seit 1996 Markträtin in Wernberg-Köblitz, Kreisrätin und bis April 2014 stellv. Landrätin. 1994/05 Mitgl. des bayerischen Landtages, 2002/Okt. 2005 bildungspolitische Sprecherin der SPD-Fraktion. Seit 2015 Mitgl. im Beirat des Deutsch-Tschechischen Gesprächsforums. Mitgl. KLJB, ver.di, ACE, AWO, BRK, VdK, KAB, KdFB, div. Frauenvereine und -initiativen, Lebenshilfe für geistig Behinderte e. V. Cham, Amnesty International, Gegen Vergessen - für Demokratie e. V., Naturfreunde, LBV, Bergwacht, Siedlerbund, div. Sport- und Schützenvereine, div. Feuerwehrvereine, Oberpfälzer Waldverein, div. Heimatpflege- und Kulturvereine, div. Kleintierzucht-, Obst- und Gartenbauvereine, div. Fördervereine, Eine-Welt-Hadel, Unicef und Leiterin des BDKJ-Zeltlagers Voithenberg (Furth i. W.). Englisch (f), Französisch (G). - MdB seit 2005.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 233 (Regensburg)', 'Marianne', '11003838');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07794, NULL, NULL, NULL, 'Industriekaufmann, Personalfachkaufmann', 'verheiratet, 3 Kinder', '18.05.1951', NULL, 'Essen', 'männlich', NULL, '18.10.2005', 'Schiewerling', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Deutsche Rentenversicherung Westfalen, Münster, <br/>Alternierender Vorsitzender der Vertreterversammlung, ehrenamtlich<br/><br/>Sparkasse Westmünsterland, Dülmen, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin, <br/>Vorsitzender des Beirates für Arbeit und Soziales, ehrenamtlich<br/><br/>Kolpingwerk - Landesverband Nordrhein-Westfalen e.V., Paderborn, <br/>Vorsitzender, ehrenamtlich<br/><br/>Technisches Hilfswerk Nordrhein-Westfalen, Heiligenhaus, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich', 'Industriekaufmann, Personalfachkaufmann. 1970/73 Mannesmannröhren-Werke, 1973/78 Verbandssekretär KKV - Verband der Katholiken in Wirtschaft u. Verwaltung, 1978/84 Bundessekretär BDKJ, 1984/05 Diözesansekretär Kolpingwerk Diözesanverband Münster. 1972 Eintritt in die CDU und CDA, einige Jahre Vors. CDA Nottuln und Vorstand CDA Kreis Coesfeld, Mitgl. Bundesvorst. der CDA; stellv. Vors. im Bezirksvorst. der CDU Münsterland. Einige Jahre Jugendvertreter in der Bezirksvertretung Essen-Borbeck, 1989/94 und 2004/Anfang 2006 Rat der Gemeinde Nottuln, bis Jan. 2006 Vors. des Ausschusses für Familie, Soziales, Bildung und Freizeit. Seit 1999 alternierender Vors. der Vertreterversammlung DRV Westfalen, Vors. Kolpingwerk NRW und Mitgl. versch. kulturelle und soziale Organisationen. - MdB seit Okt. 2005; arbeitsmarkt- und sozialpolitischer Sprecher der CDU/CSU-Fraktion.', 'Karl', '11003839');
