INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07803, NULL, NULL, NULL, 'Gästeführer', 'verheiratet, 3 Kinder', '12.11.1970', NULL, 'Waltrop', 'männlich', NULL, '18.10.2005', 'Schwabe', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Brot für die Welt, Berlin, <br/>	Mitglied des Ausschusses Entwicklungsdienst und humanitäre Hilfe, ehrenamtlich<br/>	<br/>Bundesverband Erneuerbare Energie e.V. (BEE), Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/>	<br/>GLOBE Deutschland, Berlin, <br/>	Vizepräsident, ehrenamtlich<br/>	<br/>GLOBE International, London, <br/>	Vizepräsident, ehrenamtlich', '1990 Abitur am Ernst-Barlach-Gymnasium. 1990/91 Wehrdienst. Anschl. Studium der Volkswirtschaftslehre sowie Studium der Landespflege, Geschichte, Politikwissenschaften und Soziologie. Tätigkeit als Mitarbeiter bei einem Bundestagsabgeordneten und einer Europaabgeordneten. Gästeführer an verschieden industriekulturellen Orten im Ruhrgebiet. 1991 Eintritt in die SPD, 2002/10 Vors. des Stadtverbandes der SPD Castrop-Rauxel, seit 2010 Vors. des Kreisverbandes der SPD Recklinghausen. 2004/10 Mitgl. im Rat der Stadt Castrop-Rauxel, 2004/05 Mitgl. im Kreistag Recklinghausen. Mitgl. beim BUND, der IGBCE, der AWO sowie des Deutsch Österreichischen Knappenvereins und FC Schalke 04. Seit 2015 Mitgl. im Aufsichtsrat der Evangelischer Verbund Ruhr gGmbH. - MdB seit Okt. 2005.', 'Frank', '11003846');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07804, NULL, NULL, NULL, 'Dipl.-Betriebswirtin, Parl. Staatssekretärin', 'verheiratet, 2 Kinder', '13.10.1962', NULL, 'Waldshut', 'weiblich', NULL, '18.10.2005', 'Schwarzelühr-Sutter', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Gesellschaft für Anlagen- und Reaktorsicherheit (GRS) mbH, Köln, <br/>	Vorsitzende des Aufsichtsrates, von Amts wegen<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Lauchringen, Lauchringen, <br/>	Mitglied des Gemeinderates, ehrenamtlich (bis Dezember 2013)<br/><br/>	Kreditanstalt für Wiederaufbau (KfW), Frankfurt/Main, <br/>	Mitglied des Mittelstandsrates, von Amts wegen<br/><br/>	Landkreis Waldshut, Waldshut-Tiengen, <br/>	Mitglied des Kreistages, ehrenamtlich<br/><br/>	Regionalverband Hochrhein-Bodensee, Waldshut-Tiengen, <br/>	Mitglied der Verbandsversammlung, ehrenamtlich (bis 15.07.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Bundesstiftung Umwelt (DBU), Osnabrück, <br/>	Vorsitzende des Kuratoriums, von Amts wegen', '1982 Abitur in Waldshut. 1983/89 Studium der Wirtschaftswissenschaften in Freiburg/Brsg. und Zürich/Schweiz, Lizenziat der Wirtschaftswissenschaften, Dipl.-Betriebswirtin Univ. Zürich. 1992/96 Marketing-Assistentin, 1997/05 Beratung und Kommunikation für Karin Rehbock-Zureich, MdB, März/Nov. 2010 Unternehmensberaterin. Seit 1994 Mitgl. SPD, seit 1999 stellv. Vors. des Kreisverb. Waldshut der Arbeitsgemeinschaft Sozialdemokratischer Frauen (ASF), seit 2001 Vors. SPD-Kreisverb. Waldshut, seit 2007 Mitgl. Landesvorst. SPD Baden-Württemberg. Seit 2004 Mitgl. Kreistag Landkreis Waldshut. Mitgl. bei ver.di, AWO, KLAR - Kein Leben mit atomaren Risiken e. V., Hospitzdienst e. V., Gegen Vergessen - Für Demokratie e. V., Eurosolar - Europäische Vereinigung für Erneuerbare Energien e. V. - MdB 2005/09 und seit Okt. 2010; seit Dez. 2013 Parl. Staatssekretärin bei der Bundesministerin für Umwelt, Naturschutz, Bau und Reaktorsicherheit; von Amts wegen Vors. Kuratorium der Dt. Bundesstiftung Umwelt (DBU) und Vors. Aufsichtsrat der Gesellschaft für Anlagen- und Reaktorsicherheit (GRS) mbH sowie Mitgl. des Mittelstandsrates der Kreditanstalt für Wiederaufbau (KfW).<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 282 (Lörrach - Müllheim)<br/>Wahlkreis 287 (Konstanz)', 'Rita', '11003847');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07806, NULL, 'Dr.', 'Dr.', 'Dipl.-Volkswirtin, Erste Parlamentarische Geschäftsführerin', 'ledig', '01.12.1960', NULL, 'Dresden', 'weiblich', NULL, '18.10.2005', 'Sitte', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Funktionen in Unternehmen: <br/>Technologie- und Gründerzentrum Halle GmbH (TGZ), Halle,<br/>Mitglied des Aufsichtsrates (bis Ende Juli 2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Halle, Halle,<br/>Mitglied des Stadtrates (bis Ende Mai 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Rosa-Luxemburg-Stiftung, Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich (bis Ende Oktober 2014)', 'Polytechn. Oberschule, 1977/79 Erweiterte Oberschule, Abschluss Abitur. 1979/83 Studium an der Martin-Luther-Universität Halle-Wittenberg, 1983 Diplom-Volkswirtin, 1983/85 Forschungsstudium und 1985/88 befristete Assistenz MLU, 1987 Promotion Dr. oec. 1988/89 2. Sekretär der FDJ-Kreisleitung der Martin-Luther-Universität, Delegierung, 1990/91 Aspirantur. 1981/89 Mitgl. der SED, seit 1990 Mitgl. der PDS/Die Linkspartei.PDS, 1997/02 Mitgl. PDS-Bundesvorstand. 1990/91 Mitgl. Stadtverordnetenvers. Halle/Saale und Fraktionsvors.,2004/14 Mitgl. Stadtrat Halle, 1990/05 Mitgl. Landtag von Sachsen-Anhalt und bis 2004 Fraktionsvors., Mitgl. Ältestenrat und in den Ausschüssen Kultur und Medien und Bildung und Wissenschaft. - MdB seit Okt. 2005; 2005/13 Obfrau im Ausschuss für Bildung, Forschung und Technikfolgenabschätzung, Berichterstatterin gegenüber dem Büro für Technikfolgenabschätzung beim Dt. Bundestag, seit Okt. 2013 Obfrau im Ausschuss für Wahlprüfung, Immunität und Geschäftsordnung; seit Okt. 2013 1. Parl. Geschäftsführerin der Fraktion DIE LINKE, Mitgl. Fraktionsvorstand, Mitgl. Ältestenrat.', 'Petra', '11003848');
