INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07813, NULL, 'Dr.', 'Dr.', 'Veterinärmedizinerin, Chemielaborantin, Wiss. Mitarbeiterin', 'verheiratet, 2 Kinder', '24.09.1960', NULL, 'Schmalkalden / Thüringen', 'weiblich', NULL, '18.10.2005', 'Tackmann', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband BioEnergie e.V. (BBE), Bonn, <br/>Mitglied des Politisch/Wissenschaftlichen Beirates', '1967/77 Polytechn. Oberschule Georg Schumann in Berlin-Lichtenberg, 1977/80 Berufsausbildung zur Chemielaborantin mit Abitur. 1980/85 Hochschulstudium an der Veterinärmedizinischen Fakultät der Humboldt-Univ. zu Berlin. 1985/86 Pflichtassistenz, 1993 Promotion. Seit 1986 wiss. Mitarbeiterin in einer Forschungseinrichtung, die sich mit wiss. Konzepten zur Verhütung, Überwachung und Bekämpfung von Infektionserregern bei Tieren und solchen, die auf Menschen übertragen werden können, beschäftigt. Ab 1992 wiss. Mitarbeiterin am Institut für Epidemiologie Wusterhausen im Friedrich-Loeffler-Institut. Ab Mitte der 90er Jahre bis 2005 Personalrätin. Mitgl. bei ver.di, Rettungshundestaffel Brandenburg e. V., NABU, Blühende Landschaften e. V. Pionier/FDJlerin. Mitgl. Volkssolidarität, Fördermitgl. der Deutschen Umwelthilfe. Seit 1979 Mitgl. der SED/SED-PDS, Ruhen der Mitgliedschaft von Ende 1990/Juni 2001, dann Reaktivierung der Mitgliedschaft in der PDS, seit 2003 Mitgl. im Landesvorst. Brandenburg der PDS/ LINKE, 2005/12 und seit 2016 stellv. Landesvors. - MdB seit Okt. 2005.', 'Kirsten', '11003853');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07814, NULL, 'Dr.', 'Dr.', 'Arzt', 'verwitwet, 5 Kinder', '17.07.1954', NULL, 'Greifswald', 'männlich', NULL, '18.10.2005', 'Terpe', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'konfessionslos', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Ärztekammer Mecklenburg-Vorpommern, Rostock, <br/>Mitglied des Vorstandes<br/><br/>Hansestadt Rostock, Rostock, <br/>Mitglied der Bürgerschaft<br/><br/>Ostseesparkasse Rostock, Rostock, <br/>Mitglied der Verbandsversammlung', '1961/73 Schulausbildung mit Abitur. 1973/76 Wehrdienst. 1976/82 Studium der Humanmedizin in Rostock mit Staatsexamen und Diplom. 1982/87 Ausbildung zum Facharzt für Pathologie, 1987 Promotion, seit 1998 Oberarzt am Institut für Pathologie der Universität Rostock. Seit Okt. 1989 Mitgl. Neues Forum, über die Wendezeit als Mitgl. des Republiksprecherrates; seit 2006 Mitgl. Bündnis 90/Die Grünen. Mitgl. Kammerversammlung und Vorstand der Ärztekammer Mecklenburg-Vorpommern und beim DRK. Englisch (G), Französisch (G), Russisch (G). - MdB seit Okt. 2005.', 'Harald', '11003854');
