INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07816, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'verheiratet', '18.10.1979', NULL, 'Hamburg', 'männlich', NULL, '18.10.2005', 'Toncar', NULL, 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Florian', '11003856');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07817, NULL, 'Dr.', 'Dr.', 'Dipl.-Volkswirt, Geschäftsführer', 'verheiratet, 2 Kinder', '01.09.1954', NULL, 'Hagen / Westfalen', 'männlich', NULL, '18.10.2005', 'Troost', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>PIW Progress-Institut für Wirtschaftsforschung GmbH, Bremen, <br/>Geschäftsführer, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Dau wat e.V., Rostock, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Institut Solidarische Moderne e.V., Berlin, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>PIW Progress-Institut für Wirtschaftsforschung GmbH, Bremen', 'Abitur 1973 in Schule Schloss Salem. Studium der Volkswirtschaftslehre in Marburg, Promotion zum Thema "Staatsverschuldung und Kreditinstitute". Seit 1981 Geschäftsführer der "Arbeitsgruppe Alternative Wirtschaftspolitik" (Memorandumgruppe). Seit 1984 Geschäftsführender Gesellschafter der PIW Progress-Institut für Wirtschaftsforschung GmbH, Bremen/Teltow. 1990/01 Geschäftsführer der "Büro für Strukturforschung Rostock gGmbH" (BÜSTRO), Rostock. Langjähriges Mitgl. u. a. bei der IG Metall, seit 2009 Mitgl. ver.di, Mitgl. ATTAC, Bund demokratischer WissenschaftlerInnen und im Förderverein gewerkschaftliche Arbeitslosenarbeit e. V.; Mitinitiator zahlreicher bundesweiter arbeitsmarktpolitischer Initiativen; Mitgl. Vorstand Institut Solidarische Moderne (ISM). Mitgl. Verwaltungsrat BaFin. 2004 Mitbegründer der "Wahlalternative", Jan. 2005/Juni 2007 Mitgl. im geschäftsführenden Bundesvorst. der Partei "Arbeit und soziale Gerechtigkeit - Die Wahlalternative" (WASG), seit Juni 2007 Mitgl. der Partei DIE LINKE und Mitgl. im erweiterten Bundesvorst., seit Juni 2012 stellv. Parteivors. DIE LINKE. - MdB seit Okt. 2005; finanzpol. Sprecher und Sprecher der Landesgruppe Sachsen der Fraktion DIE LINKE.', 'Axel', '11003857');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07818, NULL, NULL, NULL, 'Gewerkschaftssekretär, ehrenamtl. Arbeitsrichter', 'verheiratet, 2 Kinder', '11.02.1971', NULL, 'Krusel', 'männlich', NULL, '18.10.2005', 'Ulrich', NULL, 'DIE LINKE.', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>IG Metall Kaiserslautern, Kaiserslautern,<br/>Geschäftsführer und 2. Bevollmächtigter, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreissparkasse Kaiserslautern, Kaiserslautern,<br/>Mitglied des Verwaltungsrates<br/><br/>Landkreis Kaiserslautern, Kaiserslautern,<br/>Mitglied des Kreistages', '1990/97 Beschäftigung als Werkzeugmacher bei der Opel AG. Seit 1998 2. Bevollmächtigter und Geschäftsführer der IG Metall. Ehrenamtlicher Arbeitsrichter. 1998/04 Mitgl. der SPD; seit 2004 Gründungsmitgl. der Wahlalternative Arbeit und Soziale Gerechtigkeit (WASG), 2007/10 und Nov. 2012 bis Nov. 2016 Landesvors. der Partei DIE LINKE. Rheinland-Pfalz. Mitgl. Kreistag Landkreis Kaiserslautern, Verbandsgemeinderat Weilerbach sowie Mitgl. Verwaltungsrat der Kreissparkasse Kaiserslautern. - MdB seit Okt. 2005; seit der 17. WP Parl. Geschäftsführer der Fraktion DIE LINKE. und Obmann im Ausschuss für die Angelegenheiten der Europäischen Union; stellv. Vors. der Dt.-Kanadischen und der Dt.-Brasilianischen Parlamentariergruppe.', 'Alexander', '11003858');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07819, NULL, NULL, NULL, 'Geschäftsführer', 'verheiratet, 2 Kinder', '24.07.1960', NULL, 'Heidelberg', 'männlich', NULL, '18.10.2005', 'Waitz', NULL, 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Christoph', '11003859');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07822, NULL, NULL, NULL, 'Versicherungskaufmann', 'verheiratet, 2 Kinder', '15.09.1972', NULL, 'Berlin', 'männlich', NULL, '18.10.2005', 'Wegner', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung Denkmal für die ermordeten Juden Europas, Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Hauptverband für den Ausbau der Infrastrukturen und Nachhaltigkeit (INFRANEU) e.V., Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Berliner Schloss - Humboldtforum, Berlin, <br/>Mitglied des Stiftungsrates, ehrenamtlich', 'Carl-Schurz-Grundschule, Hans-Carossa-Oberschule in Spandau. 1993/94 Wehrdienst bei der Luftwaffe. 1994/97 Ausbildung zum Versicherungskaufmann. 1997/99 Vertriebsmitarbeiter in einem Versicherungsunternehmen, 1999/02 Mitarbeiter in einem familiengeführten mittelständischen Bauunternehmen, 2001/02 Mitgl. der Geschäftsleitung. Seit 1989 Mitgl. der CDU und der JU in Spandau; 1990/92 Vors. der Berliner Schüler Union; 1994/97 Vors. der JU Spandau, 2000/03 Vors. der JU Berlin; 1998/05 stellv. Vors. der CDU Spandau, seit 2005 Vors. der CDU Spandau, Dez. 2011 bis Dez. 2016 Generalsekretär der CDU Berlin. 1995/99 Mitgl. Bezirksverordnetenvers. Spandau, 1999/05 Mitgl. des Abgeordnetenhauses von Berlin, dort stellv. Vors. der CDU-Fraktion und wirtschaftspol. Sprecher. Mitgl. u. a. in der Arbeitsgemeinschaft 13. August e. V., im Förderverein Gedenkstätte Berlin-Hohenschönhausen e. V., in der Mittelstandsvereinigung, im Wirtschaftshof Spandau e. V., in der CDA, in der GdP, im Union Hilfswerk (UHW), im Reservistenverband, im Kuratorium des InfraNeu Hauptverbandes, im Kuratorium Stiftung Denkmal für die ermordeten Juden Europas, bei Hertha BSC Berlin. - MdB seit 2005; seit März 2009 Vors. der Landesgruppe Berlin in der CDU/CSU-Fraktion, seit Jan. 2014 Großstadtbeauftragter der CDU/CSU-Fraktion.', 'Kai', '11003860');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07823, NULL, NULL, NULL, 'Lehrer', 'ledig', '04.06.1967', NULL, 'Hamburg', 'männlich', NULL, '18.10.2005', 'Weinberg', '(Hamburg)', 'CDU', NULL, 'evangelisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1987 Abitur. 1987/91 Bundeswehr. Danach Studium der Geschichte, Sozialwissenschaften und Erziehungswissenschaften, 1997 1. Staatsexamen, 2001 2. Staatsexamen. 2001/05 Lehrer in Hamburg. Seit 1998 CDU-Ortsvors. Neu-Altona, seit 2016 Kreisvors. CDU Hamburg Altona/Elbvororte, Sept. 2007/11 stellv. Landesvors. CDU Hamburg, 2011/15 Landesvors. CDU Hamburg, seit 2016 stellv. Vors. CDU-Bundesfachausschuss Familie, Senioren, Frauen, Jugend, Mitgl. Grundsatzprogrammkommission der CDU Deutschland, 2011/15 Mitgl. Bundesvorst. CDU Deutschland. 1997/01 Mitgl. Bezirksvers. Hamburg-Altona. 2001/05 Mitgl. Hamburgische Bürgerschaft, stellv. Fraktionsvors., Fachsprecher für Jugend/Kinder/Familie. Seit 2005 Mitgl. Dt. Parlamentarische Gesellschaft e. V., Mitgl. Kuratorium der Bundeszentrale für politische Bildung, Mitgl. Kuratorium "Frischluft e. V."; seit Nov. 2007 stellv. Vors. Staatspolitische Gesellschaft e. V. Hamburg, Juni 2009/11 und seit Dez. 2015 Vors. Jürgen-Echternach-Stiftung für Bildung und Demokratie e. V. Hamburg. Englisch (G). - MdB seit 2005; seit Jan. 2014 Vors. der AG Familie, Senioren, Frauen und Jugend der CDU/CSU-Fraktion.', 'Marcus', '11003861');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07827, NULL, NULL, NULL, 'Rechtsanwalt, Notar', 'verheiratet, 3 Kinder', '18.11.1952', NULL, 'Berlin', 'männlich', NULL, '18.10.2005', 'Wellmann', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Kanzlei Heuking Kühn Lüer Wojtek, Berlin, <br/>	Rechtsanwalt, monatlich, Stufe 2<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Agentur für die Modernisierung der Ukraine (AMU), Wien, <br/>	Vorsitzender (bis 29.03.2015)<br/><br/>	Berlin hilft e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Deutsch-Ukrainisches Forum e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich', '1972 Abitur. Studium der Betriebswirtschaft und Rechtswissenschaft an der TU und FU Berlin, 1978 1., 1980 2. jur. Staatsexamen, 1981/85 pers. Referent des Senators für Wissenschaft und Forschung sowie Gesundheit und Soziales. Seit 1985 Rechtsanwalt, seit 1997 Notar. 1972 Eintritt in die CDU, 1979/80 Mitgl. JU-Bundesvorstand, seit 2001 Vors. CDU Ortsverband Dahlem, stellv. Kreisvors. CDU Steglitz-Zehlendorf. 2001/05 Mitgl. Abgeordnetenhaus Berlin, Sprecher Stadtentwicklung der CDU-Fraktion. Stellv. Vors. Dt.-Ukrainisches Forum, Mitgl. Freundeskreis der Musikschule und des Städtepartnerschaftsvereins Steglitz-Zehlendorf e. V., Mitgl. Verein der Freunde Domäne Dahlem e. V., Vors. Verein Berlin-Hilft e. V, Mitgl. Hertha BSC. Englisch (f). - MdB seit Okt. 2005; Hauptberichterstatter der CDU/CSU-Fraktion für Russland, Ukraine und Belarus, Mitgl. der Parl. Versammlung der OSZE (OSZE-PV) und des Europarats, Vors. der Deutsch-Ukrainischen Parlamentariergruppe, Mitgl. der Dt.-Belarussischen und Dt.-Russischen Parlamentariergruppe.', 'Karl-Georg', '11003862');
