INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07833, NULL, NULL, NULL, 'Richterin am Amtsgericht a. D.', 'verheiratet, 3 Kinder', '15.09.1962', NULL, 'Troisdorf', 'weiblich', NULL, '18.10.2005', 'Winkelmeier-Becker', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundeszentrale für politische Bildung, Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Haus der Geschichte der Bundesrepublik Deutschland, Bonn, <br/>	Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesarbeitsgemeinschaft Familienerholung (BAG FE), Köln,<br/>Vorsitzende, ehrenamtlich<br/><br/>	Bundesstiftung Magnus Hirschfeld, Berlin, <br/>	Stellv. Mitglied des Kuratoriums<br/><br/>	Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>	Deutscher Familienverband e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis Mai 2014)<br/><br/>	Elly Heuss-Knapp Stiftung - Deutsches Müttergenesungswerk, Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich (bis November 2014)<br/><br/>	Förderverein Amare e.V., Siegburg, <br/>	Vorsitzende, ehrenamtlich<br/><br/>Katholisch-Soziales Institut der Erzdiözese Köln, Siegburg, <br/>	Mitglied des Kuratoriums<br/><br/>	Katholischer Arbeitskreis für Familienerholung e.V. (KAFE e.V.), Köln, <br/>	Vorsitzende, ehrenamtlich<br/><br/>		Stiftung Benediktiner Abtei Michaelsberg, Siegburg, <br/>	Mitglied des Kuratoriums (bis 31.12.2015)<br/><br/>	Stiftung Christlich-Soziale Politik e.V. (CSP), Königswinter, <br/>	Mitglied des Vorstandes', 'Abitur. 1986 1. jur. Staatsexamen. 1987/88 Angestellte in der Bundestagsverwaltung. 1988/92 Referendariat einschl. Erziehungsurlaub, 1992 2. jur. Staatsexamen. 1992 Richterin Landgericht Bonn und Amtsgericht Siegburg. 1978 Beitritt JU, 1980 CDU, 1984 CDA, seit 2002 CDU-Kreisvorstand, seit 2010 CDU-Kreisvorsitzende, seit 2012 stellv. Landesvors. der CDU NRW. Vors. Förderverein Amare e. V. - Verein zur Unterstützung eines Kinderhilfsprojektes in Nordost-Brasilien. Mitgl. Kuratorium Bundeszentrale für politische Bildung; Bundesvors. katholischer Arbeitskreis für Familienerholung e. V., Vors. der BAG Familienerholung, Mitgl. Vorstand Stiftung Christlich-Soziale Politik e. V. (CSP), Königswinter. - MdB seit Okt. 2005; seit Jan. 2014 Vors. der AG Recht und Verbraucherschutz der CDU/CSU-Fraktion.', 'Elisabeth', '11003865');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07834, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 2 Kinder', '28.01.1971', 'Schweiz', 'Basel', 'männlich', NULL, '18.10.2005', 'Wolff', '(Rems-Murr)', 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Hartfrid', '11003866');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07835, NULL, NULL, NULL, 'Volljurist, Richter am Amtsgericht a. D.', 'verheiratet, 2 Kinder', '16.01.1960', NULL, 'Gladbeck', 'männlich', NULL, '18.10.2005', 'Wunderlich', NULL, 'DIE LINKE.', NULL, 'evangelisch-lutherisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1978 Abitur. 1987 1., 1990 2. jur. Staatsexamen. 1991/93 Staatsanwalt bei der Bezirks- und Staatsanwaltschaft Chemnitz, 1993/05 Richter am Amtsgericht Chemnitz, Register-, Jugendschöffengericht, Familienrichter und Vollstreckungsleiter für die JVA. 1999 Eintritt in die PDS, 2002 stellv. Vors. des KV Chemnitzer Land, Mitgl. Landesvorst. Die Linke Sachsen. 2004 Kreisrat der PDS im Kreistag, 2008/13 Kreisrat im Kreistag Zwickau, Stadtrat der Stadt Limbach-Oberfrohna. Mitgl. im Beirat der Behörde des Bundesbeauftragten für die Unterlagen des Staatssicherheitsdienstes der ehemaligen DDR, Mitgl. Beirat der Schlichtungsstelle der Rechtsanwaltschaft, Mitgl. UN-Women, Mitgl. Hauptausschuss des Verbands für öffentliche und private Fürsorge. Mitgl. der Volkssolidarität. - MdB seit Okt. 2005; Parl. Geschäftsführer der Fraktion DIE LINKE., Obmann der Fraktion DIE LINKE. im Ausschuss für Familie, Senioren, Frauen und Jugend, familien- und seniorenpol. Sprecher der Fraktion DIE LINKE., stellv. Mitgl. der Inneren Kommission im Ältestenrat, Mitgl. Vermittlungsausschuss.', 'Jörn', '11003867');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07836, NULL, NULL, NULL, 'Rechtsanwalt, Wirtschaftsjurist', 'verheiratet, 3 Kinder', '28.04.1956', NULL, 'München', 'männlich', NULL, '18.10.2005', 'Zeil', NULL, 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Martin', '11003868');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07837, NULL, NULL, NULL, 'Baustofftechnologin', 'verheiratet, 2 Kinder', '30.12.1960', NULL, 'Pasewalk', 'weiblich', NULL, '18.10.2005', 'Zimmermann', '(Zwickau)', 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Deutscher Gewerkschaftsbund (DGB) Bundesvorstand, Berlin, <br/>Gewerkschaftssekretärin, monatlich, Stufe 1', '1967/77 Allgemeinbild. Oberschule, 1977/80 Berufsausbildung mit Abitur, Abschluss Facharbeiter für Anlagentechnik, Abitur; 1981/84 Fachschule für Baustofftechnologie, Abschluss Baustofftechnologin. Bis 1990 tätig bei VEB Ziegelwerke Karl-Marx-Stadt, 1991 Mitarbeiterin Bereich Abfallwirtschaft Landratsamt Neustadt/Waldnaab, seit 1992 Gewerkschaftssekretärin beim DGB, seit 2001 Vors. DGB-Region Vogtland/Zwickau, seit 2009 Vors. DGB-Region Südwestsachsen, seit Febr. 2014 Arbeitsmarktreferentin DGB Sachsen. Juli/Okt. 2004 Mitglied d. Sächsischen Landtags. Seit 2007 Mitglied DIE LINKE. Gewerkschaftsmitglied seit 1977, Mitgl. Arbeitsloseninitiative Sachsen e.V. und Reichenbacher Tafel. Trägerin des Ehrenzeichens in Silber für Verdienste um das Handwerk, Ehrennadel in Silber der IHK Chemnitz. Englisch (G), Russisch (G).- MdB seit 2005; arbeitsmarktpolitische Sprecherin der Fraktion DIE LINKE; 2012/13 Vors. Ausschuss für Arbeit und Soziales; seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE, Leiterin des AK Soziales, Gesundheit und Rente.', 'Sabine', '11003869');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07841, NULL, NULL, NULL, 'Bundesministerin für Wirtschaft und Energie, Juristin', 'ledig', '16.11.1953', NULL, 'Kassel', 'weiblich', NULL, '18.10.2005', 'Zypries', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Cato GmbH, Horbach, <br/>	Vortrag und Podiumsdiskussion, 2013, Stufe 2 (3. Kongress der HUK-Coburg-Rechtsschutzversicherung, Coburg)<br/><br/>Funktionen in Unternehmen: <br/>	DEG - Deutsche Investitions- und Entwicklungsgesellschaft mbH, Köln, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Deutsche Bahn AG, Berlin, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Deutsche Bahn Mobility Logistics AG, Berlin, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn, Eschborn, <br/>	Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Gemeinsinn e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis 31.12.2014)<br/><br/>Aktive Bürgerschaft e.V., Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis 31.12.2014)<br/><br/>Bundesverband mittelständische Wirtschaft e.V. (BVMW), Berlin,<br/>Mitglied des politischen Beirates, monatlich, Stufe 1 (bis 17.12.2013)<br/><br/>Deutsch-Israelische Juristenvereinigung e.V. (DIJV), Berlin,<br/>Präsidentin, ehrenamtlich<br/><br/>Deutsche Nierenstiftung, Darmstadt,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Deutscher Behindertensportverband e.V. (DBS), Frechen,<br/>Vorsitzende des Kuratoriums, ehrenamtlich (bis 11.06.2015)<br/><br/>Deutscher Leichtathletik-Verband, Darmstadt,<br/>Compliance-Beauftragte, ehrenamtlich<br/><br/>Deutscher Turner-Bund e.V., Frankfurt/Main,<br/>Ethik-Beauftragte, ehrenamtlich<br/><br/>Deutsches Polen-Institut e.V., Darmstadt,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>HSE Stiftung, Darmstadt,<br/>Mitglied des Kuratoriums<br/><br/>Kultursommer Südhessen e.V., Darmstadt,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Schader-Stiftung, Darmstadt,<br/>Mitglied des Stiftungsrates, ehrenamtlich', '1972/77 Studium der Rechtswissenschaft in Gießen, 1980 2. jur. Staatsprüfung. 1980/85 wiss. Mitarbeiterin Univ. Gießen. 1985/88 Referentin in der Hessischen Staatskanzlei. 1988/90 wissenschaftl. Mitarbeiterin am Bundesverfassungsgericht. Ab 1991 Referatsleiterin und 1995/97 Abteilungsleiterin in der Niedersächsischen Staatskanzlei. 1997/02 Staatssekretärin. Bis 1998 im Niedersächsischen Ministerium für Frauen, Arbeit und Soziales; Nov.1998/Okt. 2002 im Bundesministerium des Innern. Okt. 2002/Okt. 2009 Bundesministerin der Justiz. Mitgl. Deutscher Juristinnenbund, ver.di. Englisch (f), Französisch (G). - MdB seit 2005; Dez. 2013/Jan. 2017 Parl. Staatssekretärin beim BMin. für Wirtschaft und Energie, seit Jan. 2017 BMin. für Wirtschaft und Energie.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 185 (Offenbach)', 'Brigitte', '11003870');
