für Verbraucher- und Tierschutzpolitik Bündnis 90/Die Grünen, Febr. 2010 Mitgl. im Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz, jetzt Ausschuss für Ernährung und Landwirtschaft.', 'Nicole', '11003884');
