INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07852, NULL, NULL, NULL, 'Historiker', '1 Kind', '06.02.1982', NULL, 'Dortmund', 'männlich', NULL, '13.05.2008', 'Sarrazin', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Zyprisches Forum e.V., Ammersbek, <br/>	Mitglied des Vorstandes<br/>	<br/>Europäische Bewegung Deutschland e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/>	<br/>Europa-Union Landesverband Hamburg e.V., Hamburg, <br/>	Stellv. Landesvorsitzender<br/>	<br/>Help - Hilfe zur Selbsthilfe e.V., Bonn, <br/>	Mitglied des Vorstandes<br/>	<br/>Institut für Europäische Politik e.V. (IEP), Berlin, <br/>	Mitglied des Kuratoriums<br/>	<br/>Südosteuropa-Gesellschaft, München, <br/>	Vizepräsident, ehrenamtlich', 'Seit 1998 Mitgl. von Bündnis 90/Die Grünen-GAL Hamburg, 1999/01 Mitgl. im Vorst. des KV Hamburg-Harburg, 2001/04 als Vorstandssprecher, 2008/11 Beisitzer im Landesvorst. Bündnis 90/Die Grünen Hamburg, 2011/15 stellv. Vors.  im Landesvorst. von Bündnis 90/Die Grünen Hamburg. 2004/08 Mitgl. der Hamburgischen Bürgerschaft. 2006/15 stellv. Landesvors. EUROPA UNION Hamburg e. V., seit 2010 Mitgl. im Vorst. Help e. V.; 2010/15 Mitgl. im Vorst. deutsch-zypriotisches Forum e. V., seit 2012 Mitgl. im Kuratorium des Instituts für Europäische Politik, seit Feb. 2014 Vizepräsident der Südosteuropa-Gesellschaft, seit Juni 2014 EBD-Vorstandsmitgl., Europäische Bewegung Deutschland e. V.. - MdB seit Mai 2008; seit 2009 Sprecher und Obmann für Europapolitik der Fraktion Bündnis 90/Die Grünen; seit 2010 Vors. der Parlamentariergruppe EUROPA UNION.', 'Manuel', '11003889');
