Rechtsanwalt Muth & Partner; 2006/07 Lehrbeauftragter für Wirtschaftsrecht Hochschule Fulda. 1993 Eintritt JU Thüringen, 1995 Eintritt CDU, 2003/09 Mitgl. im Präsidium der JU Thüringen, seit 2010 Vors. der CDU Wartburgkreis, seit 2012 Mitgl. Landesvorst. und seit Dez. 2014 stellv. Vors. der CDU Thüringen. 2004/09 Mitgl. Stadtrat Bad Salzungen, 2009/14 Mitgl. Gemeinderat Tiefenort, seit 2009 Mitgl. im Kreistag Wartburgkreis, Seit Juli 2016 Mitgl. Lenkungskreis Dt.-Russisches Rohstoff-Forum. Englisch (f). - MdB seit Mai 2008; seit Feb. 2016 Obmann im 4. Untersuchungsausschuss der 18. WP.', 'Christian', '11003890');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07856, NULL, NULL, NULL, 'Kaufmännischer Angestellter', 'verheiratet', '19.01.1965', NULL, 'Duisburg', 'männlich', NULL, '07.10.2008', 'Mahlberg', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>YARA GmbH & Co. KG, Dülmen,<br/>Verkaufsleiter<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>YARA GmbH & Co. KG, Dülmen,<br/>Verkaufsleiter, Kaufm. Angestellter (bis 30.11.2013), monatlich, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>DVV Duisburger Versorgungs- und Verkehrsgesellschaft mbH, Duisburg,<br/>Mitglied des Aufsichtsrates<br/><br/>octeo MULTISERVICES GmbH, Duisburg,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkasse Duisburg, Duisburg,<br/>Mitglied des Verwaltungsrates (bis 31.12.2014), 2013, Stufe 4<br/><br/>Westdeutscher Rundfunk (WDR), Köln,<br/>Mitglied des Rundfunkrates (bis 02.12.2016), monatlich, Stufe 1<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung "Unsere Kinder - unsere Zukunft", der Sparkasse Duisburg, Duisburg,<br/>Mitglied des Kuratoriums', '1984 Abitur. Ausbildung zum Groß- und Außenhandelskaufmann. Tätigkeit bei der Firma Klöckner & Co. in Duisburg, 1996/08 Kemira Konzern, seit Januar 2008 bei der Firma Yara. Seit 1985 Mitgl. der CDU, 1999 Vors. der CDU Duisburg. Bis 1994 Mitgl. der Bezirksvertretung Duisburg-Süd, stellv. Fraktionsvors. der CDU. 1995/05 MdL Nordrhein-Westfalen, familien- und jugendpolitischer Sprecher der CDU. - MdB Okt. 2008/09 und seit Okt. 2013.', 'Thomas', '11003893');
