uropas, Mitgl. Dt.-Arabische Freundschaftsgesellschaft, stellv. Mitgl. Kuratorium der Stiftung des Dt. Historischen Museums. Mitgl. AWO, ver.di, Deutscher Juristinnenbund, Transparency International, Deutsch-Britische Gesellschaft, Pro Asyl, Marie-Schlei-Verein, Lebenshilfe, Gegen Vergessen - für Demokratie, Förderverein Willy-Brandt-Zentrum Jerusalem. Englisch (f), Niederländisch (f), Französisch (G), Italienisch (G). - MdB seit Jan. 2009; seit Dez. 2013 stellv. Vors. der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 85 (Berlin-Marzahn - Hellersdorf)', 'Eva', '11003896');
