INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07863, NULL, NULL, NULL, 'Polizeibeamter', 'verheiratet, 3 Kinder', '19.01.1969', NULL, 'Belzig', 'männlich', NULL, '29.09.2009', 'Tempel', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Altenburger Land, Altenburg, <br/>Mitglied des Kreistages<br/><br/>Gemeinde, Saara, <br/>Mitglied des Gemeinderates', 'Polytechnische Oberschule und anschl. Berufsausbildung mit Abitur zum Landmaschinenschlosser. 1988/90 Offiziershochschule der Grenztruppen der DDR in Suhl, 1992 Beginn der Ausbildung zum mittleren Polizeivollzugsdienst, Dez. 1996/Dez. 1998 Studium an der Verwaltungsfachhochschule FB Polizei in Meiningen, Abschluss Diplomverwaltungswirt (FH). 1990/91 Projekttätigkeit im Bereich Jugendsozialarbeit in Suhl (Arbeitsbeschaffungsmaßnahme-ABM), 1991/92 Tätigkeit als Berufskraftfahrer und Schlosser, Okt. 1993/Dez. 1996 Polizeivollzugsdienst in Saalfeld, seit 1999 Kriminalbeamter im gehobenen Dienst,u. a. drei Jahre im Bereich Wirtschaftskriminalität/ Korruption. 1995/02 aktive Mitarbeit in der GdP, darunter zwei Jahre Landesvors. der Jungen Gruppe der GdP. 1990 Kandidatur bei der Landtagswahl Thüringen auf der Linken Liste/PDS für die FDJ, seit 2002 wieder Mitgl. der PDS, Mitgl. Kreisverb. Altenburger Land, seit 2014 Mitgl. im Parteivorst. DIE LINKE. Seit 2004 Mitgl. Kreistag Altenburger Land, Mitgl. Werksausschuss, bis 2014 Fraktionsvors. DIE LINKE im Kreistag. - MdB seit Sept. 2009; seit 2014 stellv. Vors. Innenausschuss, seit Nov. 2015 Leiter AK V "Demokratie, Recht und Gesellschaftsentwicklung" und stellv. Vors. der Fraktion DIE LINKE.', 'Frank', '11003899');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07864, NULL, NULL, NULL, 'Politikwissenschaftler M. A.', '2 Kinder', '06.10.1976', NULL, NULL, 'männlich', NULL, '30.09.2009', 'Kurth', '(Kyffhäuser)', 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Patrick', '11003900');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07865, NULL, NULL, NULL, 'Biologe', NULL, '01.05.1961', NULL, 'Reinbek', 'männlich', NULL, '27.10.2009', 'Aken', NULL, 'DIE LINKE.', 'van', NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Homöopathie-Stiftung Dr. Marion Meyenburg, Hamburg, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>IPPNW-Deutschland e.V., Berlin, <br/>Mitglied des wissenschaftlichen Beirates, ehrenamtlich', '1980 Abitur Sachsenwaldoberschule Reinbek. 1982/89 Studium Biologie Univ. Hamburg, 1993 Promotion. 1993/97 wiss. Mitarbeiter Univ. Hamburg, 1997/98 Kampagnenleiter Greenpeace Deutschland, Bereich Gentechnik, 1999 Gründer und Geschäftsführer Sunshine Project e. V. zur Ächtung biologischer Waffen. 2001/03  wiss. Mitarbeiter Univ. Hamburg, 2004/06 UN-Biowaffeninspektor, 2005/06 Leiter "Forschungsstelle biologische Waffen und Rüstungskontrolle" Univ. Hamburg, 2006/09 Internationaler Koordinator Greenpeace International, Amsterdam. Mitgl. VDW e. V. und IPPNW Deutschland. Seit 1977 in der Friedens-, Anti-AKW- und Gentechnikbewegung, seit 1999 Aktivist in der intern. Friedensbewegung mit Schwerpunkt Abrüstung von Massenvernichtungswaffen; bis 2007 parteilos, seit März 2007 Mitgl. der Partei DIE LINKE, 2012/14 stellv. Vors. der Partei DIE LINKE, seit Mai 2016 Mitgl. Parteivorst.. Englisch (f). - MdB seit Okt. 2009; Okt. 2009/April 2011 stellv. Vors. der Fraktion DIE LINKE.', 'Jan', '11004001');
