INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07867, NULL, NULL, NULL, 'Rechtsanwältin', 'verheiratet, 1 Kind', '22.09.1959', NULL, 'Eppstein / Ts.', 'weiblich', NULL, '27.10.2009', 'Aschenberg-Dugnus', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Christine', '11004003');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07869, NULL, NULL, NULL, 'Diplom-Betriebswirt (FH)', 'ledig', '17.04.1976', NULL, 'Regensburg', 'männlich', NULL, '27.10.2009', 'Aumer', NULL, 'CSU', NULL, 'katholisch', NULL, NULL, NULL, 'Peter', '11004004');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07871, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'verheiratet, 2 Kinder', '17.11.1950', NULL, 'Wunstorf OT Idensen', 'männlich', NULL, '27.10.2009', 'Barchmann', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>AWO Elm-Lappwald gemeinnützige GmbH, Braunschweig, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Bezirksverband Braunschweig e.V., Braunschweig, <br/>Stellv. Vorsitzender des Präsidiums, ehrenamtlich<br/><br/>AWO Kreisverband Helmstedt e.V., Helmstedt, <br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin, <br/>Stellv. Vorsitzender des Beirates für Europa, ehrenamtlich', 'Kaufmännische Lehre. 1985 Abitur am Abendgymnasium. Anschließend Studium an der Sozialakademie in Dortmund. Arbeit im Handel und anschl. in der Bundeswehrverwaltung. Seit April 1987 Sekretär im Deutschen Gewerkschaftsbund. Engagement in den DGB-Kreisen Hamburg, Hildesheim und Oldenburg, seit Nov. 1991 gewerkschaftliche Arbeit in der Region Südostniedersachsen, Betreuung der Landkreise Gifhorn und Helmstedt von Wolfsburg aus, 10-jährige Tätigkeit als DGB-Kreisvors., seit 2007 Vors. der DGB-Region Süd Ost Niedersachsen. 1979 Eintritt in die SPD, stellv. Vors. des SPD-Unterbezirks Helmstedt. - MdB seit Okt. 2009; stellv Vors. Ausschuss für Angelegenheiten der Europäischen Union, stellv. Vors. der Deutsch-Zyprischen Parlamentariergruppe, stellv. Leiter der deutschen Delegation der PV-UfM.', 'Heinz-Joachim', '11004005');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07874, NULL, NULL, NULL, 'Personalmanagementökonomin (VWA)', 'verheiratet', '03.05.1968', NULL, 'Walsum (jetzt Duisburg)', 'weiblich', NULL, '27.10.2009', 'Bas', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>	Hüttenwerke Krupp Mannesmann GmbH, Duisburg, <br/>	Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung "Humanitäre Hilfe für durch Blutprodukte HIV-infizierte<br/>	Personen", Bonn, <br/>	Mitglied des Stiftungsrates', '1984 Hauptschulabschluss mit Fachoberschulreife. 1985/87 Ausbildung zur Bürogehilfin bei der DVG Duisburg. 1994/97 Ausbildung zur Sozialversicherungsfachangestellten; 2000/02 Berufsbegleitende Fortbildung zur Krankenkassenbetriebswirtin, 2003 Erwerb der Ausbildereignung. 2005/07 Abendstudium zur Personalmanagement-Ökonomin (VWA). 1986/88 Jugend- und Auszubildendenvertreterin bei der Duisburger Verkehrsgesellschaft (DVG), 1988/98 Mitgl. im Betriebsrat und Arbeitnehmervertreterin im Aufsichtsrat der DVG, 1987/01 Sachbearbeiterin bei der DVG, später bei der BKK DVG, 2002/06 stellv. Vorstand der BKK EVS. Mitgl. bei ver.di, SJD-Die Falken Duisburg, AWO Duisburg, Frauen helfen Frauen, DRK-Kreisverband Duisburg, DRK Stiftung Duisburg (Kuratorium), Bürgerverein Neudorf, MSV Duisburg, AIDS-Hilfe Duisburg/Kreis Wesel, zebrakids e. V., KG Rote Funken, Obdachlosenhilfe Duisburg e. V., Vorsitzende Förderverein Klinikum Duisburg, Schirmherrin Malteser Hospiz St. Raphael, Mitgl. Aufsichtsrat der Hüttenwerke Krupp Mannesmann GmbH (Arbeitnehmerseite). 1988 Eintritt in die SPD Duisburg. 1990/98 Juso-Vors. der SPD Duisburg, seit 1990 im Vorst. der SPD Duisburg und seit 2006 stellv. Vors., seit 2004 Mitgl. im SPD-Regionalvorstand Niederrhein und seit 2009 im Sprecherkreis der Ruhr SPD, seit 2010 Vors. Parteirat der NRWSPD. 1994/02 Mitgl. im Rat der Stadt Duisburg. Englisch (G). - MdB seit Okt. 2009; seit 2011 Mitgl. im erw. Vorstand der SPD-Fraktion, seit Dez. 2013 Parl. Geschäftsführerin der SPD-Fraktion und im geschäftsführenden Vorst. der SPD-Fraktion.', 'Bärbel', '11004006');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07877, NULL, NULL, NULL, 'Schriftsetzer, Dipl.-Sozialwissenschaftler', 'verheiratet, 1 Kind', '30.05.1954', NULL, 'Osterholz-Scharmbeck', 'männlich', NULL, '27.10.2009', 'Behrens', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Osterholz-Scharmbeck, Osterholz-Scharmbeck, <br/>Mitglied des Stadtrates', '1970 Mittlere Reife. Lehre als Schriftsetzer. 1982 Nichtabiturientenprüfung. 2002 Abschluss Studium der Sozialwissenschaften, Nebenfach Wirtschaftswissenschaften. Arbeit im erlernten Beruf bis 1995; 1995 Selbstständigkeit als Journalist und PR-Arbeiter. 2002 ver.di-Gewerkschaftssekretär im Fachbereich Medien, Kunst und Industrie. 1972 Eintritt in die IG Druck und Papier, bis 2002 durchgehende ehrenamtl. Gewerkschaftsarbeit (IG Medien, IG Metall, DGB, ver.di). Friedensinitiative Bürgeraktion "Garlstedter Heide". Mitgl. attac, AWO, BUND und wikimedia. Ehrenamtl. Arbeitsrichter beim AG Verden. 1970/89 Mitgl. in der DKP. 2005 Mitbegründer der WASG im Landkreis Osterholz; 2015/17 Landesvors. DIE LINKE. Niedersachsen. Mitgl. im Stadtrat Osterholz-Scharmbeck.  - MdB seit Okt. 2009; Vors. 5. Parl. Untersuchungsausschuss "Abgashandel".', 'Herbert', '11004007');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07880, NULL, NULL, NULL, 'Verwaltungsvollzugsbeamter, Ortsbürgermeister', 'verheiratet, 2 Kinder', '28.10.1956', NULL, 'Magdeburg', 'männlich', NULL, '27.10.2009', 'Behrens', '(Börde)', 'CDU', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Einheitsgemeinde Barleben, Barleben, <br/>Mitglied des Gemeinderates und Ortsbürgermeister/OT Ebendorf<br/><br/>Landkreis Börde, Haldensleben, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Dorfverschönerungsverein, Barleben/OT Ebendorf, <br/>Mitglied des Vorstandes<br/><br/>Feuerwehrförderverein Ebendorf e.V., Barleben/OT Ebendorf, <br/>Mitglied des Vorstandes', 'Facharbeiterausbildung zum Kfz-Mechaniker. 1990 Geschäftsführer in der Gastronomie. 1990 Bürgermeister in Ebendorf (mittlerer Verwaltungsdienst). 2001/03 Wissenschaftlicher Mitarbeiter im Landtag. 2003 Verwaltungsvollzugsbeamter. Mitgl. der Freiwilligen Feuerwehr Ebendorf, des Kultur- und Geschichtsvereins, der Sportgemeinschaft Eintracht Ebendorf; Vorstandsmitgl. Verschönerungsverein Ebendorf und des OK-Barleben Wolmirstedt, Ehrenmitgl. im Schützenverein Ebendorf und dem Hundesportverein Ebendorf. Vertreter im Wolmirstedter Wasser- und Abwasserverband, Mitgl. in der Abfallentsorgungsgesellschaft, im Eigenbetrieb Straßenbau, stellv. Verbandsvors. im Technologiepark Ostfalen. 1992 Eintritt in die CDU, seit 2004 Ortsverbandsvors. der Ortsverbände Barleben, Ebendorf, Meitzendorf, sowie im Gemeinderat Barleben (Hauptausschuss); 1999 Mitgl. im Kreistag OK, 2007 Mitgl. im Kreistag Börde, Vorsitz des Umwelt- und Wirtschaftsausschusses; 2004 ehrenamtl. Ortsbürgermeister Ebendorf. Englisch (G), Russisch (G). - MdB seit Okt. 2009.', 'Manfred', '11004008');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07881, NULL, NULL, NULL, 'Student', 'ledig', '15.12.1986', NULL, 'Braunschweig', 'männlich', NULL, '27.10.2009', 'Bernschneider', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Florian', '11004009');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07884, NULL, NULL, NULL, 'Rechtsanwalt, Fachanwalt für gewerblichen Rechtsschutz', 'verheiratet, 2 Kinder', '25.12.1970', NULL, 'Ratingen', 'männlich', NULL, '27.10.2009', 'Beyer', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		American Chamber of Commerce in Germany e.V., Frankfurt/Main,<br/>Mitglied des Membership Committees, ehrenamtlich<br/><br/>Stiftung Haus Oberschlesien, Ratingen,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Südosteuropa-Gesellschaft e.V., München,<br/>Vizepräsident, ehrenamtlich', 'Abitur 1991. Wehrdienst. Studium der Rechts- und Staatswissenschaften in Düsseldorf, Bonn und Hagen, Studium der Geschichte und Politik in Bonn. Postgraduierten-Jurastudium in den USA (University of Virginia) mit Abschluss Master of Laws (LL.M.) Referendariat u.a. in Speyer (Deutsche Hochschule für Verwaltungswissenschaften), Chicago/USA (Brinks, Hofer, Gilson & Lione), Los Angeles/USA (Murchison & Cumming). Beruflicher Werdegang: Internationale Kanzlei Mayer Brown in Köln, BEYER Patent- und Rechtsanwälte in Ratingen mit der Spezialisierung im Bereich des Schutzes des Geistigen Eigentums (Fachanwalt für Gewerblichen Rechtsschutz). Mitgl. der CDU seit 1996. Englisch (f).  - MdB seit Okt. 2009; Berichterstatter der CDU/CSU-Fraktion für die Transatlantischen Beziehungen und für die Westbalkan-Region.', 'Peter', '11004010');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07887, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 1 Kind', '16.02.1979', NULL, 'Schongau', 'männlich', NULL, '27.10.2009', 'Bilger', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwaltskanzlei Paliakoudis-Bilger, Stuttgart,<br/>Rechtsanwalt<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>MHP Riesen Ludwigsburg, Ludwigsburg,<br/>Mitglied des Freundeskreises, ehrenamtlich<br/><br/>Schneller Stiftung - Erziehung zum Frieden, Stuttgart,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Stiftung "Zukunft und Leben", Korntal,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Stiftung Theaterhaus Stuttgart, Stuttgart,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1998 Abitur am Max-Born-Gymnasium in Backnang. 1998/99 Zivildienst bei der diakonischen Einrichtung Erlacher Höhe. 1999/04 Studium der Rechtswissenschaft an der Eberhard Karls Univ. Tübingen mit Abschluss der Ersten jur. Staatsprüfung, 2004/06 Rechtsreferendariat am Landgericht Stuttgart mit Abschluss der Zweiten jur. Staatsprüfung. 2006/09 tätig bei MVV Energiedienstleistungen GmbH. 2007 Zulassung als Rechtsanwalt. 1996 Eintritt in die CDU und Junge Union, 1998 Landesvors. der Schüler Union Baden-Württemberg, 2002/07 Bezirksvors. der JU Nordwürttemberg, 2006/11 Landesvors. der JU Baden-Württemberg, seit 2011 Bezirksvors. der CDU Nordwürttemberg. Mitgl. Eisenbahninfrastrukturbeirat, Vors. Kuratorium der Bundeszentrale für politische Bildung. - MdB seit Okt. 2009; seit 2014 Vors. der Jungen Gruppe der CDU/CSU-Fraktion, Mitgl. Gemeinsamer Ausschuss und Vermittlungsausschuss; Vors. Parlamentskreis Elektromobilität.', 'Steffen', '11004011');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07888, NULL, NULL, NULL, 'Diplom-Sozialwissenschaftler', 'ledig', '28.09.1961', NULL, 'Münster', 'männlich', NULL, '27.10.2009', 'Birkwald', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung Haus der Geschichte der Bundesrepublik Deutschland, Bonn, <br/>	Mitglied des Kuratoriums', '1981 Abitur am Städtischen Gymnasium Erftstadt-Lechenich. 1981 Studium der Politologie, Soziologie, Philosophie und der politischen Ökonomie in Köln, Bonn und Bremen, 1990 Abschluss als Dipl.-Soz.Wiss. 1990/94 Jugendbildungsreferent der JungdemokratInnen/Junge Linke NRW; 1994 Wahlkampfleiter der PDS in NRW, 1994/02 wiss. Mitarbeiter der PDS im Bundestag; 2003/05 Persönlicher Referent der Berliner Senatorin für Gesundheit, Soziales und Verbraucherschutz, Dr. Heidi Knake-Werner; 2005/09 Leiter des Abgeordnetenbüros von Prof. Dr. Lothar Bisky im Deutschen Bundestag. 1980/96 Mitgl. der Jungdemokraten/Junge Linke, 1980/82 Mitgl. der FDP, 1988/90 Mitgl. der DKP, 1993/07 Mitgl. der PDS, 2005/07 Mitgl. der WASG,  2007 Gründungsmitgl. der Partei DIE LINKE. Mitgl. der IG Metall, der Rosa-Luxemburg-Stiftung NRW und des Instituts Solidarische Moderne, ordentliches Mitgl. Kuratorium Stiftung Haus der Geschichte. Englisch (f), Französisch (G). - MdB seit Okt. 2009; rentenpol. Sprecher der Fraktion DIE LINKE., Obmann und Mitgl. im Ausschuss für Arbeit und Soziales, seit Nov. 2014 Parl. Geschäftsführer der Fraktion DIE LINKE, Mitgl. Parlamentskreis Automobiles Kulturgut; stellv. Vors. der Deutsch-Spanischen und der Deutsch-Italienischen Parlamenteriergruppe, Mitgl. der Deutsch-Französischen Parlamentariergruppe.', 'Matthias W.', '11004012');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07889, NULL, NULL, NULL, 'IT-Berater', 'verheiratet', '04.08.1974', NULL, 'Bergen', 'männlich', NULL, '27.10.2009', 'Blumenthal', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Sebastian', '11004013');
