INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07896, NULL, NULL, NULL, 'Jurist', 'verheiratet, 2 Kinder', '30.08.1954', NULL, 'Lauenburg/Elbe', 'männlich', NULL, '27.10.2009', 'Brackmann', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Raiffeisenbank Lauenburg e.G., Lauenburg, <br/>Vorsitzender des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Immobilienaufgaben, Bonn, <br/>Stellv. Vorsitzender des Verwaltungsrates, ehrenamtlich<br/><br/>Kreis Herzogtum Lauenburg, Ratzeburg, <br/>Mitglied des Kreistages, Fraktionsvorsitzender, stellv. Landrat, jährlich, Stufe 3<br/>Organisatorischer Leiter Rettungsdienst<br/>Mitglied der technischen Einsatzleitung Katastrophenschutz, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bürgerstiftung Region Lauenburg, Lauenburg, <br/>Vorsitzender des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Herzogtum Lauenburg, Mölln, <br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Verein zur Förderung der Otto-von-Bismarck-Stiftung e.V., Friedrichsruh, <br/>Vorsitzender, ehrenamtlich', '1973 Abitur. 1973/75 Zeitsoldat, Hauptmann d. R. 1975/79 Studium Rechtswiss. Univ. Kiel, 1977/79 Stipendiat KAS Institut für Begabtenförderung, 1979 1. jur. Staatsprüfung OLG Schleswig, 1979/82 Rechtsreferendar, 1982 2. jur. Staatsprüfung. 1977/81 Wahlkreisassistent MdB Olaf v. Wrangel, 1982 Referent Programmdirektor Hörfunk NDR, 1985 Abteilungsleiter Sendeleitung Hörfunk NDR, 2000 Aufbau und Leitung des Programmbereichs (Hauptabteilung) Programmbegl. Dienste/Multimedia (verantw. für alle Internet- und Videotextangeb. des NDR, tagesschau.de und Intranet). 1998 Patentanmeldung Reg. 841 DE. 1980/91 Mitgl. AR Raiffeisenbank Lauenburg e. G., seit 1991 Vors. 1993 Freiherr vom Stein Gedenkmedaille, 2003 Einsatzmedaille Fluthilfe 2002; seit 1969 Mitgl. DLRG, 2008 Verdienstabzeichen in Gold mit Brillant, DLRG Mitgliedsehrenzeichen in Silber. Seit 1991 Rettungsassistent, seit 1998 Organis. Leiter Rettungsdienst Kreis Herzogtum Lauenburg. 1972 Eintritt in die CDU, seit 1975 im CDU-Kreisvorst., 1990/94 Kreispräs.; seit 1978 Abg. des Lauenburgischen Kreistages, 1986/90 Fraktionsvors. und 1. Kreisrat, stellv. Landrat, seit 1998 Fraktionsvors. Seit Juni 2013 stellv. Vors. Verwaltungsrat Bundesanstalt für Immobilienaufgaben (BImA). - MdB seit Okt. 2009; seit März 2015 Obmann der CDU/CSU-Fraktion im Haushaltsausschuss, Vors. des Bundesfinanzierungsgremiums.', 'Norbert', '11004017');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07899, NULL, 'Dr.', 'Dr.', 'Diplom-Wirtschaftsingenieur', 'ledig', '01.08.1977', NULL, 'Ingolstadt', 'männlich', NULL, '27.10.2009', 'Brandl', NULL, 'CSU', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband eMobilität e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates<br/><br/>Gesellschaft für Wehr- und Sicherheitspolitik e.V., Bonn, <br/>Vizepräsident', '1996 Abitur am Willibald-Gymnasium Eichstätt. 1996/97 Grundwehrdienst bei der Luftwaffe in Manching-Oberstimm. 1997/03 Universität Karlsruhe (TH), Abschluss als Dipl.-Wirtschaftsingenieur; 2001/03 Institut National Polytechnique de Grenoble, Abschluss als Ingénieur en génie industriel, 2007 Technische Universität München, Promotion zum Dr. rer. nat. am Lehrstuhl für Internetbasierte Geschäftssysteme, Fakultät für Informatik. 2003/06 BMW AG, München, 2007/08 Mitgl. der Geschäftsführung bei Erhard Brandl Dipl.-Ing., Eitensheim, Jan./Sept. 2009 Unternehmensberater bei The Boston Consulting Group GmbH, München. Seit 1993 verschiedene Ämter in JU und CSU. Englisch (f), Französisch (f). - MdB seit Okt. 2009.', 'Reinhard', '11004018');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07902, NULL, NULL, NULL, 'Diplom-Betriebswirtin (FH)', '2 Kinder', '05.11.1962', NULL, 'Staßfurt', 'weiblich', NULL, '27.10.2009', 'Brehmer', NULL, 'CDU', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Salzlandkreis, Bernburg,<br/>Mitglied des Kreistages, ehrenamtlich (bis Juli 2014)<br/><br/>Salzlandsparkasse, Staßfurt,<br/>Stellv. Mitglied des Verwaltungsrates, ehrenamtlich (bis Juni 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bildungswerk der KPV Sachsen-Anhalt e.V., Magdeburg,<br/>Vorsitzende, ehrenamtlich<br/><br/>DUK & AUPU Versorgungswerk e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich (bis 31.01.2014)<br/><br/>VMDU e.V. - Verein Mittelständischer Dienstleistungsunternehmen e.V., Schwerte,<br/>Vorsitzende, ehrenamtlich (bis 10.11.2014)', '1969/79 POS Groß Börnecke, Abschluss 10. Klasse. 1979/81 Lehre VE HO Staßfurt. 1982/84 Ausbild. zum Kaufmann für Land- und Nahrungsgüterwirtschaft. 1984/89 Studium zum Ökonom AIS Weimar (Fernstudium), Abschl. Dipl.-Betriebswirt (FH); 1992/94 Weiterbild. Studieninstitut Hannover. 1981/88 Haushaltssachbearb. beim Rat des Kreises Staßfurt; 1989/90 Ökonom LPG Tarthun, 1990/94 Gemeindedirektorin in Tarthun, 1994/03 Leiterin d. gem. Verwaltungsamtes Bördeaue. 2003/07 Landrätin LK Aschersleben-Staßfurt. 2008 Geschäftsführerin Studentenwerk Magdeburg. Mitgl. u.a. Beirat Internat. Bund Kinder- und Jugendhilfezentrum Harz, 2012/14 Beirat Biosphärenreservat Karstlandschaft Südharz, 2012/14 Beiratsmitgl. DUK Versorgungswerk e.V., 2010/14 Vorstand VMDU Verein Mittelstand Dienstleistungsunternehmen e.V., Freiw. Feuerwehr Tarthun, Ehrenmitgl. Spielmannszug Tarthun e. V., bis 2014 stellv. Mitgl. Verwaltungsrat Salzlandsparkasse, seit 2010 stellv. Vors. Förderverein "Jedem Kind sein Verein", seit Feb. 2014 Mitgl. Vergabebeirat Flüchtlingshilfe Sachsen-Anhalt. 1996 stellv. Vors. und 2000/06 Vors. CDU-Kreisverb. Aschersleben-Staßfurt, 2003 Mitgl. Landesvorst. und seit 2010 stellv. Vors. CDU Sachsen-Anhalt; 2005 Eintritt in die CDA; 2007 Schatzmeisterin CDU-Kreisverb. Salzland; seit 2009 Mitgl. BV der KPV, seit 2010 stellv. Vors. KPV Sachsen-Anhalt, seit 2010 Vors. Bildungswerk KPV Sachsen-Anhalt, seit Nov. 2015 stellv. Bundesvors. der KPV. 1990/94 Mitgl. Kreistag Staßfurt, 1994/98 Mitgl. Kreistag Aschersleben-Staßfurt, stellv. Fraktionsvors. 1998/99 Vors. der CDU-Fraktion und 1999/03 Vors. Kreistag Aschersleben-Staßfurt, 2007/Juli 2014 Mitgl. Kreistag des Salzlandkreises. - MdB seit Okt. 2009; seit 2014 Vors. Ausschuss für Tourismus.', 'Heike', '11004019');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07903, NULL, NULL, NULL, 'Unternehmens-Analyst', 'verheiratet', '09.09.1945', NULL, 'Burgsteinfurt', 'männlich', NULL, '27.10.2009', 'Breil', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Klaus', '11004020');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07906, NULL, NULL, NULL, 'Steuerberater', 'verheiratet', '15.06.1968', NULL, 'Wiedenbrück', 'männlich', NULL, '27.10.2009', 'Brinkhaus', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Steuerberater, selbständig, Gütersloh<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Auswärtiges Amt, Berlin,<br/>Mitglied der Deutsch-Indischen Beratungsgruppe (DIBG), ehrenamtlich<br/><br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn,<br/>Vertrauensmann bei der LBS Westdeutsche Landesbausparkasse (bis Ende November 2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Vorsitzender des Beirates Finanzen, Steuern, Geld und Kredit, ehrenamtlich<br/><br/>Institut Finanzen und Steuern e.V. (ifst), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Ausbildung bei der Robert Bosch GmbH. Studium der Wirtschaftswissenschaften an der Universität Hohenheim, danach Referent und Kaufmännischer Leiter in der Industrie, Steuerberaterexamen, Steuerberater bei einer Wirtschaftsprüfungsgesellschaft, seit 2004 selbstständiger Steuerberater in Gütersloh mit Schwerpunkt im internationalen Rechnungswesen. 1998 Eintritt in die CDU, seit 2004 Mitgl. im CDU-Kreisvorst., seit 2009 Kreisvors., seit 2016 Vors. der CDU Ostwestfalen-Lippe und stellv. Landesvors. der CDU in Nordrhein-Westfalen. 2004/Jan. 2012 Mitgl. im Rat der Stadt Gütersloh, davon 2007/09 als Fraktionsvors. - MdB seit Okt. 2009; seit Jan. 2014 stellv. Vors. der CDU/CSU-Fraktion für den Bereich Haushalt, Finanzen und Kommunalpolitik.', 'Ralph', '11004021');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07907, NULL, NULL, NULL, 'freiberufliche Redakteurin, wissenschaftliche Mitarbeiterin', 'verheiratet, 2 Kinder', '02.04.1971', NULL, 'Hamburg', 'weiblich', NULL, '27.10.2009', 'Buchholz', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', '1990 Abitur. 1991/98 Studium Erziehungswissenschaften, Religion, Sozialwissenschaften mit Schwerpunkt Politik in Hamburg, Staatsexamen. 1995/05 Assistentin für Behinderte, 2002/05 freiberufliche Redakteurin, 2005/09 wiss. Mitarbeiterin bei MdBs der Linksfraktion. Seit 1994 aktiv in versch. sozialen Bewegungen, u. a. Studierendenproteste, Anti-Nazi-Bewegung, Friedensbewegung, Globalisierungskritische Bewegung. Mitgl. der Strömung Sozialistische Linke und Unterstützerin des Netzwerks Marx21, Mitgl. bei ver.di, attac und der Rosa-Luxemburg-Stiftung. 1994/99 Mitgl. der SPD, seit 2004 Mitgl. der WASG, später der Partei DIE LINKE, seit 2007 Mitgl. im geschäftsführenden Parteivorstand. - MdB seit Okt. 2009; Sprecherin für Verteidigungspolitik und für Religionspolitik der Fraktion DIE LINKE.', 'Christine', '11004022');
