INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07911, NULL, NULL, NULL, 'Sozialwissenschaftlerin', 'verheiratet, 3 Kinder', '03.07.1950', NULL, 'Lüdenscheid', 'weiblich', NULL, '27.10.2009', 'Crone', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>	Entwicklungsgesellschaft Interkommunales Gewerbegebiet Grünewald GmbH (EG Grünwald), Meinerzhagen/Kierspe, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich (bis Juni 2014)<br/>	<br/>Grundstücks- und Gewerbeentwicklung Kierspe GmbH, Kierspe, <br/>	Vorsitzende des Aufsichtsrates, ehrenamtlich (bis Juni 2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkasse Kierspe-Meinerzhagen, Kierspe/Meinerzhagen, <br/>	Stellv. Mitglied des Verwaltungsrates (bis Juni 2014)<br/>	<br/>Stadt Kierspe, Kierspe, <br/>	Mitglied des Gemeinderates (bis Juni 2014)', 'Mittlere Reife. Ausbildung zur Gymnastiklehrerin in Coburg, Abitur auf dem 2. Bildungsweg. Studium der Sozialwissenschaften an der Universität Wuppertal. Seit 1988 Mitgl. der SPD, bis 1999 Vorsitzende des Ortsvereins Kierspe, stellv. Vorsitzende des Unterbezirks Märkischer Kreis, Mitgl. Parteivorst. der SPD (Beisitzerin). Mitgl. der AWO, IGBCE, Mitgl. Verein "Gegen Vergessen - Für Demokratie e. V., Mitgl. Johanniter-Unfall-Hilfe, Bürgerbus Kierspe e.V., Förderverein Waldschule Märkischer Kreis e.V., Mitgl. DRK und FSC Arbeitsgruppe Deutschland e. V. 1994/2013 Mitgl. im Rat der Stadt Kierspe, 1999/07 Vors. der SPD-Fraktion. - MdB seit Okt. 2009.', 'Petra', '11004026');
