INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07915, NULL, NULL, NULL, 'Wissenschaftliche Referentin', 'verheiratet', '18.02.1976', NULL, 'Siegen', 'weiblich', NULL, '27.10.2009', 'Dörner', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung Haus der Geschichte der Bundesrepublik Deutschland, Bonn, <br/>Stellv. Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsches Kinderhilfswerk e.V., Berlin, <br/>Mitglied des Vorstandes<br/><br/>Institut Solidarische Moderne e.V., Berlin, <br/>Mitglied des Vorstandes<br/><br/>PLAN International Deutschland e.V., Hamburg, <br/>Mitglied des Kuratoriums', '1982/86 Astrid-Lindgren-Grundschule Gebhardshain, 1995 Abitur am Privaten Katholischen Gymnasium Marienstatt. Studium der Politikwissenschaften, des Öffentlichen Rechts und der Literaturwissenschaften in Bonn, York und Edinburgh; 2000 Abschluss Magistra Artium. 2003/09 Wissenschaftliche Referentin bei der nordrhein-westfälischen Landtagsfraktion Bündnis 90/Die Grünen, dort bis 2005 zuständig für den Bereich "Kinder, Jugend und Familie" sowie anschl. "Schule und Weiterbildung", 2001/03 persönliche Referentin der Fraktionsvorsitzenden. Mitgl. bei Amnesty International, Bonner Spendenparlament e. V., Frauen helfen Frauen e. V., Kulturverein Nordstadt e. V., MediNetz Bonn e. V., Ausbildung statt Abschiebung e. V., Mitgl. Versammlung der Heinrich-Böll-Stiftung, Vorst. Mieterbund Bonn und Vorst. Dt. Kinderhilfswerk. Mitglied Kuratorium Plan Deutschland, Mitgl. Hauptausschuss Deutscher Verein für öffentliche und private Fürsorge. Seit 1992 aktiv bei den Grünen, seit 1998 Mitgl., 2006/10 Mitgl. im Landesvorstand der nordrhein-westfälischen Grünen, seit 2007 Sprecherin des Bezirksverbandes Mittelrhein. 2002/09 Mitgl. der grünen Ratsfraktion in Bonn. - MdB seit Okt. 2009; seit Dez. 2013 stellv. Vors. der Fraktion Bündnis 90/Die Grünen.', 'Katja', '11004030');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07916, NULL, NULL, NULL, 'Landwirtschaftsmeister', 'verheiratet, 3 Kinder', '07.06.1955', NULL, 'Fürth', 'männlich', NULL, '27.10.2009', 'Erdel', NULL, 'FDP', NULL, 'evangelisch-lutherisch', NULL, NULL, NULL, 'Rainer', '11004031');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07919, NULL, 'Dr.', 'Dr.', 'Jugendbildungsreferent', 'verheiratet, 3 Kinder', '08.04.1965', NULL, 'Leipzig', 'männlich', NULL, '27.10.2009', 'Feist', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Israelische Gesellschaft e.V., Leipzig, <br/>Vorsitzender<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Kempe, Schemmel, Feist GbR (Musiker Gesellschaft), Leipzig', '1971/81 Allgemeinbildende polytechnische Oberschule (DDR), Abschluss 10. Klasse. 1981/83 Lehre als Facharbeiter für Heizungsinstallation. 1995/2000 Direktstudium (Sonderhochschulzugangsberechtigung) Musikwissenschaft, Soziologie und Theologie, 2000 Abschluss des Studiums mit dem akademischen Titel M. A. 2003/05 Promotionsstudium, Promotion zum Dr. phil. 1983/93 tätig als Heizungsinstallateur,  1993/95 Ausbilder für lernbehinderte, sozial benachteiligte Jugendliche, seit 1995 tätig als Jugendbildungsreferent für Kulturarbeit, Musik und Interkulturelle Arbeit. 1997/10 Vors. des Bundesverbandes Kulturarbeit in der evangelischen Jugend e. V. (vormals AG Musik), seit 2001 Mitgl. in der Gesellschaft für Musikforschung. 2004 Gründungsmitgl. BeatZentrale e. V., 2010/15 Vors. der Dt.-Israelischen Gesellschaft Leipzig e. V., seit 2010 Vors. des Leipziger Regionalausschusses "Jugend musiziert", seit 2010 Mitgl. des Parlamentarischen Forums Mittel- und Osteuropa e. V. Seit 2007 Mitgl. des CDU-Kreisverb. Leipzig-Stadt; seit 2013 Landesvors. des EAK Sachsen, seit 2014 Vors. Kreisverb. Leipzig der KPV der CDU/CSU. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Thomas', '11004032');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07922, NULL, 'Dr.', 'Dr.', 'Professor, Bürgermeister a. D., Jurist', 'verheiratet, 2 Kinder', '21.01.1960', NULL, 'Gudensberg', 'männlich', NULL, '27.10.2009', 'Franke', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Schwalm-Eder-Kreis, Homberg, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>DUK Versorgungswerk e.V., Berlin, <br/>	Mitglied des Beirates', 'Abitur an der Albert-Schweitzer-Schule in Kassel. Zivildienst AWO. Studium der Politik- und Rechtswissenschaften in Marburg und Gießen, 2. jur. Staatsexamen, Promotion im Kommunalrecht. Fachgruppenleiter "Öffentliches Recht" beim Bundesverband der Unfallversicherungsträger der öffentl. Hand. 1996 Rektor und bis heute Professor an der Hochschule der Gesetzlichen Unfallversicherung, Bad Hersfeld. Herausgeber des Nomos-Kommentars Sozialgesetzbuch VII. 1978/82 Juso-Unterbezirksvorstand, 1985/89 Gemeindevertretung Edermünde, 1997/99 stellv. Stadtverordnetenvorsteher Gudensberg, 1999/09 Bürgermeister der Stadt Gudensberg, seit 2001 im Kreistag Schwalm-Eder, Mitgl. in versch. kommunalen Aufsichtsräten und Zweckverbänden, 2006/11 Mitgl. Verbandsversammlung LWV Hessen. 2007 Bezirksvorst. und Schatzmeister der SPD Hessen-Nord. Stellv. Vors. Kurt-Schumacher-Gesellschaft, Vorstand Dt. Parlamentarische Gesellschaft, Mitgl. ver.di. Englisch (f), Französisch (G). - MdB seit Okt. 2009; 2011/13 stellv. rechtspol. Sprecher; seit Jan. 2014 Vors. Gesundheitsausschuss.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 167 (Waldeck)', 'Edgar', '11004033');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07925, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet', '30.03.1964', NULL, 'Nürnberg', 'männlich', NULL, '27.10.2009', 'Frieser', NULL, 'CSU', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Nürnberg<br/>   Mandant 1, jährlich, Stufe 3 (bis 31.05.2016)<br/>   Mandant 2, jährlich, Stufe 3 (bis 31.05.2016)<br/>   Mandant 3, monatlich, Stufe 1<br/>   Mandant 4, monatlich, Stufe 2 (bis 01.09.2016)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Kniggebund e.V., Nürnberg,<br/>Vizepräsident, ehrenamtlich<br/><br/>Fränkische Gesellschaft für Kultur, Politik und Zeitgeschichte e.V., Nürnberg,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Hans und Dorothea Doleschal Stiftung, Büchenbach,<br/>Vorsitzender des Stiftungsrates, ehrenamtlich<br/><br/>Verband Deutscher Konzertchöre e.V., Landesverband Bayern, Neuss,<br/>Vizepräsident, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>MiDa Parkverwaltungs- und Werbegesellschaft mbH, Nürnberg', '1984 Abitur am Willstätter Gymnasium. Studium der Rechtswissenschaften an der Friedrich-Alexander-Universität Erlangen-Nürnberg, 1. und 2. Staatsexamen. 1993 Mitarbeiter der SIEMENS Zentrale-Nordamerika, Legal Department - New York, USA. Seit 1994 Rechtsanwalt, 1996/2009 Syndikusanwalt, seit 2002 Geschäftsführer. Vizepräsident  Verband Deutscher Konzertchöre, Bayern, Vizepräsident Deutscher Kniggebund e. V., Gründungsvorst.  Fränkische Gesellschaft für Kultur, Politik und Zeitgeschichte, Gründungsmitgl. Deutsch-Israelische Gesellschaft Nürnberg-Mittelfranken. Mitgl. Kuratorium der Bundeszentrale für politische Bildung. Seit 2009 stellv. Bezirksvors. der CSU Nürnberg-Fürth-Schwabach. 1996/09 Stadtrat der Stadt Nürnberg, 2003/09 Fraktionsvors. der CSU-Stadtratsfraktion Nürnberg. - MdB seit Okt. 2009; 2011/14 Integrationsbeauftragter der CDU/CSU-Fraktion, seit Jan. 2014 Demografiebeauftragter der CDU/CSU-Fraktion, seit Okt. 2013 innen- und rechtspol. Sprecher der CSU-Landesgruppe, stellv. Vors. des 2. Untersuchungsausschusses.', 'Michael', '11004034');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07928, NULL, NULL, NULL, 'MdL, Diplom-Kaufmann', 'geschieden, 1 Kind', '18.06.1974', NULL, 'Neunkirchen', 'männlich', NULL, '27.10.2009', 'Funk', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Alexander', '11004035');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07931, NULL, NULL, NULL, 'Berufssoldat', 'verheiratet', '30.07.1960', NULL, 'Lübeck', 'männlich', NULL, '27.10.2009', 'Gädechens', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Feuerwehrverband e.V. (DFV), Berlin, <br/>Mitglied des Beirates', '1977 Realschulabschluss. 1977/84 Ausbildung- und Fahrenszeit als Soldat auf Zeit bei der Marine. 1984 bis 2014 Berufssoldat. Verwendung im Führungsdienst, Truppenfachlehrer, stellv. Leiter und Dienststellenleiter der Marineortungsstellen Westermarkelsdorf und Staberhuk auf Fehmarn. Mitgl. CDA, KPV und Europa Union, Mitgl. im Beirat des Deutschen Feuerwehrverbandes. 1988 Eintritt in die CDU,1991/09 Vors. CDU-Ortsverband auf Fehmarn, 1991/03 stellv. Kreisvors., seit 2003 Kreisvors. der CDU Ostholstein, seit 2004 Beisitzer in Landesvorst. CDU Schleswig-Holstein. 1990/09 Stadtvertreter der Stadt Burg/Fehmarn. 1994/98 Stadtrat, 2003/08 Erster Stadtrat und stellv. Bürgermeister Stadt Fehmarn, 2005/13 Kreistagsabg. Ostholstein, 2008/09 1. stellv. Landrat des Kreises Ostholstein. Englisch (G). - MdB seit Okt. 2009; seit 2013 Obmann der CDU/CSU-Fraktion im Verteidigungsausschuss; Mitgl. der PV der NATO, stellv. Mitgl. der Ostseeparlamentarier-Konferenz.', 'Ingo', '11004036');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07932, NULL, 'Dr.', 'Dr.', 'Unternehmer', 'verheiratet, 3 Kinder', '16.10.1949', NULL, 'Rimsting', 'männlich', NULL, '27.10.2009', 'Gambke', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Bürgerenergie Isar eG, Landshut,<br/>Stellv. Vorsitzender des Aufsichtsrates<br/><br/>MSG Lithoglas GmbH, Dresden,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Hochschule für Angewandte Wissenschaften, Landshut,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Petra-Kelly-Stiftung e.V., München,<br/>Mitglied der Grundsatzkommission<br/><br/>Verband der Sparda-Banken e.V., Frankfurt/Main,<br/>Mitglied des Beirates', 'Schulbesuch in Bonn und Gehrden bei Hannover, 1968 Abitur. Grundwehrdienst. Studium Physik TU Darmstadt, 1976 Diplom in Physik, 1981 Promotion zum Dr. rer. nat. Wissenschaftl. Tätigkeit an der University of California, San Diego, USA; 1982 Technologieberater am VDI Technologiezentrum Berlin. 1984 Eintritt bei SCHOTT, Otto Schott Forschungszentrum in Mainz, 1990 kaufm. Leitung des Werkes Landshut von SCHOTT, Gründung und Aufbau von Produktionsstätten in Tschechien, Singapur und USA, 1996/06 CEO "SCHOTT Electronic Packaging", 2000 Senior Vice President NEC SCHOTT Components Corp, (Minakuchi, Japan). Seit Anfang 2007 selbstständiger Unternehmer, Gründung und Aufbau der MSG Lithoglas GmbH, Dresden. 2012 Gründung der "Bürgerenergie Isar e.G.". Mitgl. im Kuratorium der FH Landshut. Seit 2004 Mitgl. der Partei Bündnis 90/Die Grünen. 2008/11 Stadtrat der Stadt Landshut. - MdB seit Okt. 2009; seit 2009 Mittelstandsbeauftragter der Fraktion Bündnis 90/Die Grünen; seit 2010 Vorsitzender der ASEAN-Parlamentariergruppe.', 'Thomas', '11004037');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07935, NULL, 'Dr.', 'Dr.', 'Betriebswirt, Politikwissenschaftler (M.A.)', 'verheiratet', '20.12.1971', NULL, 'Kandel', 'männlich', NULL, '27.10.2009', 'Gebhart', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Germersheim, Germersheim, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europa-Union Deutschland e.V., Kreisverband Germersheim, Germersheim, <br/>Mitglied des Vorstandes, ehrenamtlich', '1991 Abitur am Europa-Gymnasium in Wörth am Rhein. 1991 Zivildienst am St.Vincentius-Krankenhaus Karlsruhe. 1992 Studium der Betriebswirtschaftslehre und Politikwissenschaft in Mannheim und Birmingham, Abschluss Magister Artium; 2002 Promotion zum Dr. rer. pol. (Universität Mannheim). 1998 Assistent des Bundestagsabgeordneten Dr. Heiner Geißler; 2002 Angestellter der BASF-AG, Bereich Umwelt, Sicherheit und Energie. 1989 Eintritt in die Junge Union, 1996 Eintritt in die CDU, 2002 Vors. CDU-Kreisverband Germersheim, seit 2007 stellv. Vors. CDU-Bezirksverb. Rheinhessen-Pfalz. Seit 1999 Mitgl. des Kreistags Germersheim. 2003/09 MdL Rheinland-Pfalz, 2006/09 Umweltpolitischer Sprecher der CDU-Landtagsfraktion. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Thomas', '11004038');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07938, NULL, NULL, NULL, 'Bergmann, Elektrohauer', 'verheiratet, 3 Kinder', '23.05.1960', NULL, 'Bottrop', 'männlich', NULL, '27.10.2009', 'Gerdes', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Emscher Lippe Energie GmbH, Gelsenkirchen, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Bottrop, Bottrop, <br/>Mitglied des Stadtrates', 'Ausbildung zum Bergmann, Elektrohauer. Mitgl. AWO. 1977 Eintritt in die SPD, stellv. Vors. SPD- Ortsverein Boverheide, Unterbezirksvors. SPD Bottrop, Mitgl. AFA-Vorst. SPD-Unterbezirk Bottrop. Mitgl. Rat der Stadt Bottrop. - MdB seit Okt. 2009.', 'Michael', '11004039');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07941, NULL, NULL, NULL, 'Geschäftsführer, Landwirtschaftsmeister', 'verheiratet, 3 Kinder', '30.01.1956', NULL, 'Höpfingen', 'männlich', NULL, '27.10.2009', 'Gerig', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Abfallwirtschaftsgesellschaft des Neckar-Odenwald-Kreises mbH, Buchen, <br/>Mitglied des Aufsichtsrates<br/><br/>Bioenergieregion HOT GmbH, Mosbach, <br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Neckar-Odenwald-Kreis, Mosbach, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband der Deutschen Klein- und Obstbrenner e.V., Karlsruhe, <br/>1. Vorsitzender, ehrenamtlich<br/><br/>Fachagentur Nachwachsende Rohstoffe e.V., Gülzen, <br/>Mitglied des Vorstandes<br/><br/>Kreisbauernverband Neckar-Odenwald e.V., Buchen, <br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Landesverband der Maschinenringe Baden-Württemberg e.V., Stuttgart, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Ländliche Heimvolkshochschule Neckarelz e.V., Mosbach, <br/>1. Vorsitzender, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Alois und Stefan Gerig GbR, Höpfingen', '1985/09 Geschäftsführer des Maschinenrings Odenwald-Bauland und gewerblichen Tochterunternehmen. Familieneigener Ferienbauernhof. Stellv. Vors. im Kreisbauernverband, Vors. des Bundesverbandes der Deutschen Klein- und Obstbrenner e. V., Mitgl. Vorst. Fachagentur Nachwachsende Rohstoffe e. V., weitere ehrenamtl. Tätigkeiten in Vereinen und Organisationen. Seit 1997 Mitgl. der CDU, seit 2012 Vors. Landesfachausschuss "Ländlicher Raum" der CDU Baden-Württemberg. Seit 1999 Mitgl. im Kreistag Neckar-Odenwald. Englisch (G). - MdB seit Okt. 2009; 2011/15 Obmann der CDU/CSU-Fraktion im Ausschuss für Ernährung, Landwirtschaft und Verbraucherschutz, seit 2014 Ausschuss für Ernährung und Landwirtschaft und seit Jan. 2015 Vors. Ausschuss für Ernährung und Landwirtschaft.', 'Alois', '11004040');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07942, NULL, NULL, NULL, 'Kommunikationswissenschaftlerin M.A.', 'verheiratet', '15.11.1975', NULL, 'München', 'weiblich', NULL, '27.10.2009', 'Gohlke', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>			Bundeszentrale für politische Bildung, Bonn, <br/>	Mitglied des Kuratoriums (bis März 2014)<br/><br/>	FernUniversität in Hagen, Hagen, <br/>	Mitglied des Parlamentarischen Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Deutsches Studentenwerk (DSW), Berlin, <br/>	Mitglied des Kuratoriums', '1995 Abitur. 1996/03 Studium der Kommunikationswissenschaften an der LMU München. 2004/08 Angestellte bei versch. Event-Agenturen. Ab 2008 Mitarbeiterin der Bundestagsfraktion DIE LINKE. Mitgl. im Förderkreis demokratische Volks- und Hochschulbildung, im Bund demokratischer Wissenschaftlerinnen und Wissenschaftler (BdWi), der Wolfgang-Abendroth-Stiftungs-Gesellschaft, des Kurt-Eisners-Verein in Bayern, der Gewerkschaft für Erziehung und Wissenschaft (GEW) und der Vereinten Dienstleistungsgewerkschaft (ver.di). Mitgl. im Beirat des Deutschen Studentenwerks und im Parlamentarischen Beirat der Fernuniversität in Hagen. 2004 Eintritt in die WASG, 2005 Mitgl. des geschäftsführenden Landesvorst. der WASG in Bayern und 2007/14 Mitgl. im Landesvorst. der LINKEN in Bayern. - MdB seit Okt. 2009; hochschul- und wissenschaftspolitische Sprecherin der Fraktion DIE LINKE.', 'Nicole', '11004041');
