INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07946, NULL, NULL, NULL, 'Kinderpflegerin', 'verheiratet, 3 Kinder', '08.11.1955', NULL, 'Sandershausen', 'weiblich', NULL, '27.10.2009', 'Gottschalck', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>	Flughafen GmbH Kassel-Calden, Calden, <br/>	Mitglied des Beirates, ehrenamtlich (bis 25.06.2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Landkreis Kassel, Kassel, <br/>	Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Frauen helfen Frauen e.V., Baunatal, <br/>	Mitglied des Beirates, ehrenamtlich', '1961/70 Besuch von Schulen im Landkreis Kassel, Mittlere Reife. 1972 Berufsabschluss zur Kinderpflegerin. 1972/75 Gruppenleiterin im Kindergarten, 1984/96 EDV-Supporterin, 1999/05 Fraktionsreferentin, parl. Geschäftsführerin. 2005/09 MdL in Hessen. Seit 1974 Mitgl. der SPD; 1972/85 aktive Juso-Arbeit. 1989/06 Gemeindevertreterin in Niestetal, seit 1993 Kreistagsabgeordnete im Landkreis Kassel, 2006/14 Vors. und seit 2014 stellv. Vors. der Kreistagsfraktion. - MdB seit Okt. 2009.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 167 (Waldeck)', 'Ulrike', '11004043');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07948, NULL, NULL, NULL, 'Immobilienkaufmann', 'keine Angaben', '09.12.1956', NULL, 'Oberhausen', 'männlich', NULL, '27.10.2009', 'Groschek', NULL, 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Michael', '11004044');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07951, NULL, NULL, NULL, 'Geschäftsbereichsleiter', 'verheiratet, 2 Kinder', '26.07.1956', NULL, 'Marl', 'männlich', NULL, '27.10.2009', 'Groß', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesministerium für Umwelt, Naturschutz, Bau und Reaktorsicherheit, Berlin,<br/>Mitglied der Jury "Nationale Projekte des Städtebaus", ehrenamtlich<br/><br/>Bundesstiftung Baukultur, Potsdam,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsche Unternehmensinitiative für Energieeffizienz e.V. - DENEFF, Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Gütegemeinschaft Brandschutz im Ausbau e.V. (GBA), Berlin,<br/>Mitglied des Politisch-Parlamentarischen Beirates, ehrenamtlich', 'Vermessungstechniker, Fachhochschulreife. Studium, Dipl.-Sozialarbeiter. Referent beim Diakonischen Werk Westfalen, Geschäftsführer des Diakonischen Werkes Steinfurt-Coesfeld-Borken; Leiter des Geschäftsbereichs Kinder-, Jugend- und Familienhilfe im AWO-Unterbezirk Münsterland-Recklinghausen. Mitgl. u. a. ver.di und IG BCE; 2004/09 Aufsichtsratsvors. der Marler Baugesellschaft (NeuMa), Mitgl. der Stiftung Baukultur, Mitgl. im Parl. Beirat Brandschutz. Seit 1978 Mitgl. der SPD, 2005/12 stellv. Kreisverbandsvors. Recklinghausen, SPD-Stadtverbandsvors. in Marl. 1999/09 Stadtratsmitgl., 2004/09 Vors. der Ratsfraktion Marl. - MdB seit Okt. 2009; Vors. der AWO-PG der SPD-Fraktion, Mitgl. AG Demographischer Wandel und AG Kommunales, wohnungs- und baupolitischer Sprecher der SPD-Fraktion.', 'Michael', '11004045');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07953, NULL, NULL, NULL, 'Diplom-Oecotrophologin, Geschäftsführerin', 'verheiratet, 3 Kinder', '09.12.1964', NULL, 'Köln', 'weiblich', NULL, '27.10.2009', 'Grotelüschen', NULL, 'CDU', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Beratung, selbständig, Ahlhorn<br/><br/>Grotelüschen Immobilien GmbH & Co KG, Ahlhorn,<br/>Geschäftsführerin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Grotelüschen Immobilien GmbH & Co KG, Ahlhorn, <br/>Geschäftsführerin, monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>Wirtschaftsförderungsgesellschaft für den Landkreis Oldenburg mbH (WLO), Wildeshausen, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Großenkneten, Großenkneten, <br/>Mitglied des Gemeinderates<br/><br/>Landkreis Oldenburg, Wildeshausen, <br/>Mitglied des Kreistages und des Kreisausschusses', '1984 Abitur am St. Ursula Gymnasium in Brühl. 1984/90 Studium der Haushalts- und Ernährungswissenschaften an der Friedrich-Wilhelm-Univ. Bonn, Abschl. Diplom-Oecotrophologin. 1990/09 leitende Tätigkeit im Familienunternehmen, seit 2011 Geschäftsführerin der Grotelüschen Immobilien GmbH. 2010 Niedersächsische Landwirtschaftsministerin. Seit 2000 Mitgl. der CDU, seit 2002 stellv. Kreisvors. der CDU Oldenburg-Land, seit 2010 Mitgl. Landesvorst. und seit 2014 Mitgl. Präsidium der CDU Niedersachsen; seit 2012 Kreisvors. der CDU Mittelstands- und Wirtschaftsvereinigung (MIT) Oldenburg-Land. Seit 2001 Mitgl. Gemeinderat Großenkneten, seit 2006 Mitgl. Kreistag des Landkreises Oldenburg. Seit 2011 Mitgl. Aufsichtsrat der Wirtschaftsförderungsgesellschaft des Landkreises Oldenburg. Englisch (f). - MdB 2009/April 2010 und seit Okt. 2013.', 'Astrid', '11004046');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07954, NULL, NULL, NULL, 'Soziologin', 'verheiratet', '16.05.1954', NULL, 'Gadderbaum', 'weiblich', NULL, '27.10.2009', 'Groth', NULL, 'DIE LINKE.', NULL, 'evangelisch-lutherisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Gymnasium, Abitur. 1974/79 Studium Entwicklungssoziologie, Volks- und Betriebswirtschaft und Internationale Politik an der FU Berlin, Abschluss Dipl.-Soziologin. 1981/84 wiss. Mitarbeiterin beim europ. Forschungsinstitut Ecumenical Research Exchange (ERE) in Rotterdam, Niederlande. 1984/87 Ökumene Referentin in der Geschäftsstelle der Ev. Studentengemeinde (ESG) in Stuttgart. 1992/97 UN-Kommissariat für Flüchtlinge (UNHCR) in Genf, 1997/99 Direktorin der Ecumenical Coalition on Third World Tourism (ECTWT), Herausgeberin der Vierteljahreszeitschrift CONTOURS in Barbados. 2001/04 Brot für die Welt. Mitgl. Komitee für Grundrechte und Demokratie e. V., Naturfreunde e. V., Mitgl. im Business Crime Control e.V., GEW, VVN-BdA. Englisch (f), Französisch (f), Spanisch (f), Niederländisch (f). - MdB seit Okt. 2009; menschenrechtspol. Sprecherin der Fraktion DIE LINKE, Mitgl. Ausschuss für Menschenrechte und humanitäre Hilfe, Mitgl. im Migrationsausschuss des Europarats; Vors. dt.-griechische Parlamentariergruppe.', 'Annette', '11004047');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07957, NULL, NULL, NULL, 'Diplom  Marketing Fachwirt  (BAW)', 'verheiratet, 2 Kinder', '14.03.1974', NULL, 'München', 'männlich', NULL, '27.10.2009', 'Hahn', NULL, 'CSU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>IABG - Industrieanlagen-Betriebsgesellschaft mbH, Ottobrunn,<br/>Mitglied des Aufsichtsrates, 2013, Stufe 3; 2014, Stufe 4<br/><br/>Mönch Verlagsgesellschaft mbH, Bonn,<br/>Mitglied des Beirates der Zeitschrift "Wehrtechnik", ehrenamtlich<br/><br/>Quantum-Systems GmbH, Otterfing,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis München, München,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Universität der Bundeswehr München, Neubiberg,<br/>Ehrensenator, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Gesellschaft für Wehrtechnik e.V., Bonn,<br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Mitglied des Beirates für Sicherheit und Verteidigung, ehrenamtlich<br/><br/>Interessengemeinschaft Deutsche Luftwaffe e.V., Berlin,<br/>Vizepräsident, ehrenamtlich<br/><br/>Max-Planck-Institute für Astrophysik und extraterrestrische Physik, Garching bei München,<br/>Mitglied des gemeinsamen Kuratoriums, ehrenamtlich<br/><br/>Soldaten und Veteranen Stiftung (SVS), Bonn,<br/>Stellv. Vorsitzender des Kuratoriums, ehrenamtlich<br/><br/>Stiftung Lebenshilfe München, München,<br/>1. Vorsitzender, ehrenamtlich<br/><br/>Verein der Freunde und Förderer der Realschule Neubiberg e.V., Neubiberg,<br/>Mitglied des Vorstandes, ehrenamtlich', 'Abitur, Luitpold-Gymnasium München. Wehrdienst WBK VI/1. GebDiv. Bayer. Akad. für Werbung u. Marketing, Abschl. Electronic Marketing Fachwirt (BAW). Seit 2006 berufsbegl. MBA-Studiengang. 2012/15 Dozent BAW, München. Frühere Stationen: Krauss-Maffei Wegmann, Gast Service AG, Landesgeschäftsführer JU Bayern, 2003/09 Referent CSU-Landesleitung: Landesgeschäftsführer KPV, UdV und EAK, 2008/09 stellv. Leiter Politik u. Parteiarbeit. U. a. Mitgl. Freunde und Förderer Realschule Neubiberg, Vizepräs. Interessengem. Dt. Luftwaffe e. V. (IDLw), seit 2014 stellv. Vors. Kuratorium "Soldaten und Vertrauenstiftung (SVS)", Mitgl. Krieger- und Soldatenkameradschaft Putzbrunn, Sundergauer Verein zur Pflege der bay. Kultur und Traditionen, Schützenverein Wendelstoana Putzbrunn, Salutschützen Putzbrunn, FC Bayern München, Sudetendt. Landsmannschaft, TC Putzbrunn, Ayinger Freundeskreis, Förderverein Kirche St. Aegidius Keferloh e. V. Seit 2016 Ehrensenator Univ. der Bundeswehr München, seit 2015 Mitgl. gem. Kuratorium der Max-Planck-Institute f. Astrophysik u. extraterrestrische Physik, seit 2015 Vors. Stiftung Lebenshilfe München e. V., Mitgl. Keferloher Montag e. V. und DONUM VITAE in Bayern e. V., 2008/10 stellv. Vors. Aufsichtsrat Gemeindewerk Putzbrunn GmbH, seit 2010 Mitgl. Aufsichtsrat IABG, seit 2015 Mitgl. Beirat Quantum-Systems GmbH. Seit 1992 Mitgl. CSU, 1998/03 Mitgl. Landesausschuss und Deutschlandrat der JU, 1999/06 Kreisvors. JU München-Land; seit 1997 Mitgl. CSU-Kreisvorst., seit 2004 CSU-Ortsvors., seit 2005 Mitgl. Bezirksvorst. CSU Oberbayern, seit 2013 Mitgl. Parteivorst., seit 2014 Landesvors. Arbeitskreis Außen- und Sicherheitspolitik ASP der CSU, seit 2015 CSU-Kreisvors. München-Land. 1996/10 Mitgl. Gemeinderat Putzbrunn, 2005/10 dort CSU-Fraktionsvors., 2002/08, seit 2014 Kreisrat im Landkreis München. - MdB seit Okt. 2009, seit 2013 Sprecher CSU-Landesgruppe für Auswärtiges, Verteidigung, Angelegenheiten der EU, wirtsch. Zusammenarbeit und Menschenrechte.', 'Florian', '11004048');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07960, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'verheiratet, 3 Kinder', '19.12.1971', NULL, 'Heidelberg', 'männlich', NULL, '27.10.2009', 'Harbarth', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	SZA Schilling, Zutt & Anschütz Rechtsanwalts AG, Mannheim,<br/>Rechtsanwalt, 2014, Stufe 6, Gewinn; 2015, Stufe 6 Gewinn; 2016, Stufe 7 Gewinn<br/>   Mandant 01, 2013; 2014; 2015; 2016<br/>   Mandant 02, 2013<br/>   Mandant 03, 2013; 2014; 2015; 2016<br/>   Mandant 04, 2013; 2014; 2015; 2016<br/>   Mandant 05, 2013; 2014; 2015<br/>   Mandant 06, 2014<br/>   Mandant 07, 2014<br/>   Mandant 15, 2013; 2014; 2015; 2016<br/>   Mandant 16, 2014<br/>   Mandant 17, 2013<br/>   Mandant 19, 2013; 2015<br/>   Mandant 20, 2013; 2014<br/>   Mandant 21, 2014<br/>   Mandant 22, 2013; 2014; 2015; 2016<br/>   Mandant 24, 2013; 2014; 2015; 2016<br/>   Mandant 25, 2013<br/>   Mandant 26, 2013; 2014; 2015; 2016<br/>   Mandant 27, 2013<br/>   Mandant 28, 2013<br/>   Mandant 29, 2013; 2014; 2015; 2016<br/>   Mandant 30, 2013<br/>   Mandant 31, 2014<br/>   Mandant 32, 2014<br/>   Mandant 33, 2014<br/>   Mandant 34, 2014; 2015<br/>   Mandant 35, 2015<br/>   Mandant 36, 2015; 2016<br/>   Mandant 37, 2015<br/>   Mandant 38, 2015<br/>   Mandant 39, 2015<br/>   Mandant 42, 2016<br/>   Mandant 43, 2016<br/><br/>Funktionen in Unternehmen: <br/>		Dr. Wöllner Verwaltungsgesellschaft mbH, Ludwigshafen/Rhein,<br/>Stellv. Vorsitzender des Beirates (bis 31.01.2014)<br/><br/>SZA Schilling, Zutt & Anschütz Rechtsanwalts AG, Mannheim,<br/>Mitglied des Vorstandes, 2013, Stufe 10; 2014, Stufe 10; 2015, Stufe 10; 2016, Stufe 10<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Dr. Eduard Wöllner-Familienstiftung, Ludwigshafen/Rhein,<br/>Mitglied des Vorstandes<br/><br/>Wissenschaftliche Vereinigung für Unternehmens- und Gesellschaftsrecht (VGR) e.V., Frankfurt/Main,<br/>Mitglied des Vorstandes, ehrenamtlich', '1991 Abitur am Bunsen-Gymnasium Heidelberg. 1991/96 Studium der Rechtswissenschaften an der Ruprecht-Karls-Univ. Heidelberg, 1996 Erste jur. Staatsprüfung, 1997/99 jur. Vorbereitungsdienst am Kammergericht Berlin, 1998 Promotion zum Dr. iur. an der Ruprecht-Karls-Universität Heidelberg, Stipendiat der Dt. Forschungsgemeinschaft (DFG), 1999 Zweite jur. Staatsprüfung, 1999/2000 Studium der Rechtswissenschaften an der Yale Law School, New Haven, Connecticut, USA, Stipendiat des Dt. Akademischen Austauschdienstes (DAAD), 2000 Master of Laws (LL.M.) der Yale Law School. 2000 Zulassung als Rechtsanwalt, 2006/08 Partner der intern. Anwaltssozietät Shearman & Sterling LLP, seit 2008 Vorstandsmitgl. der SZA Schilling, Zutt & Anschütz Rechtsanwalts AG, seit 2004 Lehrbeauftragter an der Ruprecht-Karls-Universität Heidelberg. Seit 2012 Vorstandsmitgl. der Wissenschaftlichen Vereinigung für Unternehmens- und Gesellschaftsrecht (VGR) e.V. Mitgl. in zahlreichen Vereinen und Organisationen. 1995/97 Kreisvors. der JU Rhein-Neckar, seit 1995 Mitgl. und seit 2011 Kreisvors. der CDU Rhein-Neckar, seit 2005 Mitgl. im Bezirksvorst. CDU Nordbaden, seit 2013 Mitgl. Landesvorst. der CDU Baden-Württemberg, seit 2009 Mitgl. CDU-Bundesausschuss, seit 2010 Mitgl. BFA Wirtschaft-, Haushalts- und Finanzpolitik der CDU Deutschlands. - MdB seit Okt. 2009; 2014/16 Obmann der CDU/CSU-Fraktion im Ausschuss für Recht und Verbraucherschutz, seit Juni 2016 stellv. Vors. der CDU/CSU-Fraktion; Mitgl. Vorst. Parlamentskreis Mittelstand.', 'Stephan', '11004049');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07963, NULL, NULL, NULL, 'Dipl.-Volkswirt, Leitender Angestellter', 'verheiratet, 1 Kind', '30.05.1963', NULL, 'Hofheim am Taunus', 'männlich', NULL, '27.10.2009', 'Hardt', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Vorwerk & Co.KG, Wuppertal,<br/>Angestellter, monatlich, Stufe 2 (bis 31.12.2014); monatlich, Stufe 1 (01.01.2015 bis 30.06.2016)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Gesellschaft für Auswärtige Politik e.V., Berlin,<br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Stiftung Wissenschaft und Politik (SWP), Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich', 'Abitur. Vierjährige Dienstzeit als Offizier bei der Marine der Bundeswehr. 1986/93 Studium der Volkswirtschaftslehre in Heidelberg und Köln, Abschluss Diplom-Volkswirt. 1992/98 zunächst Abteilungsleiter für Sozialpolitik, später Büroleiter des CDU-Generalsekretärs in der Bundesgeschäftsstelle der CDU; 1999/01 Referent für Europapolitik der CDU/CSU-Bundestagsfraktion. 2001/09 Leiter Unternehmenskommunikation bei Vorwerk. 1987/89 Bundesvors. des Rings Christlich-Demokratischer Studenten (RCDS); 2003/14 Kreisvors. der CDU Wuppertal, seit 2005 stellv. Bezirksvors. der CDU Bergisch Land/Düsseldorf. 2004/09 Stadtverordneter und Vors. des Wirtschaftsausschusses in Wuppertal. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit April 2014 Koordinator der BReg für die transatlantische Zusammenarbeit; seit Sept. 2015 außenpol. Sprecher der CDU/CSU-Fraktion.', 'Jürgen', '11004050');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07966, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'verheiratet, 1 Kind', '18.05.1966', NULL, 'Lüdenscheid', 'männlich', NULL, '27.10.2009', 'Heider', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Rechtsanwalt, Lüdenscheid<br/>   Mandant 1, 2014, Stufe 1; 2015, Stufe 2<br/>   Mandant 2, 2014, Stufe 3; 2015, Stufe 3; 2016, Stufe 3<br/>   Mandant 3, 2014, Stufe 1; 2015, Stufe 1<br/>   Mandant 4, 2015, Stufe 3; 2016, Stufe 4<br/><br/>Funktionen in Unternehmen: <br/>	Ergo Versicherungsgruppe AG, Düsseldorf, <br/>	Mitglied des Beirates (bis 29.01.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post <br/>	und Eisenbahnen, Bonn, <br/>	Stellv. Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Seminar für Staatsbürgerkunde e.V., Attendorn, <br/>	Mitglied des Kuratoriums<br/><br/>	Verein zur Förderung der Wettbewerbswirtschaft e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich', '1985 Abitur am Zeppelin-Gymnasium Lüdenscheid. Grundwehrdienst. 1986/92 Studium der Rechtswissenschaften an der Universität Bonn, anschl. Referendarausbildung am OLG Koblenz, 1995 Zulassung als Rechtsanwalt, 2003 Promotion zum Dr. jur. an der Universität Bonn. 1995/05 Justiziar und Leiter der Abteilung Recht/Patente der DKR mbh, 2006/09 Rechtsanwalt und Prokurist BDO Deutsche Warentreuhand AG Wirtschaftsprüfungsgesellschaft. Mitgl. des Parlamentskreises Mittelstand, der DJK Eintracht Lüdenscheid, des Lüdenscheider Tennisvereins von 1899 e. V., des RC Lüdenscheid und des Sauerländer Gebirgsvereins. Stellv. Kreisvors. CDU Märkischer Kreis, Mitgl. CDU-Landesvorst. NRW; Bezirksvors. MIT Südwestfalen, stellv. Landesvors. MIT NRW, Mitgl. Bundesvorst. der MIT. Englisch (f). - MdB seit Okt. 2009; Mitgl. Vorst. der CDU/CSU-Fraktion.', 'Matthias', '11004051');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07969, NULL, NULL, NULL, 'Ingenieurin, selbstständige Architektin', 'verheiratet, 3 Kinder', '23.08.1961', NULL, 'Andernach', 'weiblich', NULL, '27.10.2009', 'Heil', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>RUMPF architekten + ingenieure GbR, Andernach, <br/>Architektin<br/><br/>Funktionen in Unternehmen: <br/>DRK Rettungsdienst Rhein-Mosel-Eifel GmbH, Mayen,<br/>Mitglied des Aufsichtsrates<br/><br/>Stadtwerke Andernach GmbH, Andernach,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeszentrale für politische Bildung, Bonn,<br/>Mitglied des Kuratoriums<br/><br/>Kreissparkasse Mayen, Mayen,<br/>Mitglied des Verwaltungsrates<br/><br/>Landkreis Mayen-Koblenz, Koblenz,<br/>Mitglied des Kreistages<br/><br/>Stadt Andernach, Andernach,<br/>Mitglied des Stadtrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Stiftung Verbraucherschutz, Berlin,<br/>Mitglied des Kuratoriums<br/><br/>DRK Kreisverband Mayen-Koblenz e.V., Mayen,<br/>Stellv. Vorsitzende<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Stellv. Vorsitzende des Beirates für Handel und Verbraucherschutz<br/><br/>Stiftung Datenschutz, Berlin,<br/>Mitglied des Beirates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>RUMPF architekten + ingenieure GbR, Andernach', '1981 Abitur am Bertha-von-Suttner-Gymnasium, Andernach. 1981/88 Studium der Architektur an der TU Kaiserslautern, Abschluss Diplom-Ingenieurin. 1989/90 Architektin bei RKW, Frankfurt a. M., 1991/99 Architektin im Architekturbüro Rumpf in Andernach, seit 1999 selbstständige Architektin, RUMPF architekten + ingenieure in Andernach. Mitgl. der "Aktion eine Welt", Hospizbewegung Andernach-Pellenz, Blaue Funken. Seit 2004 Mitgl. CDU-Kreisvorst. Mayen-Koblenz, seit 2006 Mitgl. des CDU-Bezirksvorstands Koblenz/Montabaur, seit 2009 Vors. des CDU-Stadtverbandes Andernach. Seit 1994 Mitgl. im Stadtrat Andernach, seit 1999 Mitgl. im Kreistag. - MdB seit Okt. 2009; seit Herbst 2010 Verbraucherschutzbeauftragte der CDU/CSU-Fraktion.', 'Mechthild', '11004052');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07971, NULL, 'Dr.', 'Dr.', 'Lehrerin, Kunstwissenschaftlerin', NULL, '17.01.1953', NULL, 'Leipzig', 'weiblich', NULL, '27.10.2009', 'Hein', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Zentrum für Produkt-, Verfahrens- und Prozessinnovation GmbH (ZPVP ), Magdeburg, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich (bis Juli 2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Magdeburg, Magdeburg, <br/>	Mitglied des Stadtrates (bis Juli 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesakademie für musikalische Jugendbildung e.V., Trossingen,<br/>Mitglied des Kuratoriums<br/><br/>Rosa-Luxemburg-Stiftung Sachsen-Anhalt, Magdeburg,<br/>Mitglied des Vorstandes, ehrenamtlich', '1959/67 POS in Leipzig, Zwenkau, Vehlefanz, 1967/71 EOS in Hennigsdorf, Abitur. Studium an der Pädagogischen Hochschule in Dresden, Abschluss 1975 als Lehrerin für Deutsch und Kunsterziehung. 1975/80 Arbeit an der EOS in Oschersleben. 1980/82 Mitarbeiterin der SED-Kreisleitung Oschersleben. 1982/86 Aspirantur für Gesellschaftswissenschaften, 1986 Promotion (Dr. phil.). 1986/89 Arbeit in der Bezirksleitung der SED in Magdeburg, zuletzt Abteilungsleiterin für Kultur. Seit 1976 Mitgl. der SED, 1990 Mitgl. der PDS, Linkspartei PDS, DIE LINKE, März 1990 Wahl zur Bezirksvors. der PDS in Magdeburg, Juli 1990/Okt. 1995 stellv. Landesvors., 1997/2005 Landesvors. der PDS, 2006/12 Mitgl. Parteivorst. der Linkspartei PDS und DIE LINKE. 1990/2006 MdL Sachsen-Anhalt, Arbeit im Ausschuss für Bildung und Wissenschaft und im Ausschuss für Kultur und Medien. 2004/14 Stadträtin in Magdeburg. Mitgl. Kuratorium der Bundeszentrale für politische Bildung, Mitgl. ver.di, Mitgl. Jugendweihe e. V. Sachsen-Anhalt, Vorstand der Rosa-Luxemburg-Stiftung Sachsen-Anhalt. Englisch (G), Russisch (G). - MdB seit 2009.', 'Rosemarie', '11004053');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07974, NULL, NULL, NULL, 'Sozialarbeiter, Theologe', 'verheiratet, 4 Kinder', '25.01.1964', NULL, 'Siegen', 'männlich', NULL, '27.10.2009', 'Heinrich', '(Chemnitz)', 'CDU', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>University of the Nations Kona, Kailua-Kona (USA), <br/>	Vortragsreihe, 2014, Stufe 1 (Gesellschaftliches Engagement, Menschenhandel, Sexual Trafficking, Religionsfreiheit)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Technische Universität Chemnitz, Chemnitz,<br/>nanett - Kompetenznetzwerk für Nanosystemintegration <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Evangelische Allianz e.V., Bad Blankenburg, <br/>	Mitglied des Hauptvorstandes, ehrenamtlich<br/>	<br/>Freiheit für die Westsahara e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Gemeinsam gegen Menschenhandel e.V., Berlin, <br/>	Vorsitzender des Vorstandes, ehrenamtlich<br/>	<br/>IJBS - Internationale Jugendbegegnungsstätte in Oswiecim/Auschwitz, Oswiecim (Polen), <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/>	<br/>Lern- und Gedenkort Kaßberg-Gefängnis e.V., Chemnitz, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/>	<br/>Perspektiven für Familien e.V. - "Haus Kinderland", Chemnitz, <br/>	Vorsitzender des Vorstandes, ehrenamtlich<br/>	<br/>Schwimm-Club Chemnitz von 1892 e.V., Chemnitz, <br/>	Präsident, ehrenamtlich<br/>	<br/>Stiftung für Grundwerte und Völkerverständigung, Berlin, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/>	<br/>The Iman Foundation, London, <br/>	Member of the Advisory Board, ehrenamtlich', '1983 Abitur. 1983/84 Zivildienst. 1984/85 Studium der Theologie für zwei Semester in Canada; 1985/86 Freiwilliges Soziales Jahr in einem Pflegeheim; 1986/90 Studium der Sozialpädagogik in Freiburg im Breisgau; 1990/95 Leiter zweier Einrichtungen der Heilsarmee Freiburg; 1995/97 Ausbildung zum Heilsarmeeoffizier, Theologiestudium; 1997/09 Leiter der Heilsarmee Chemnitz; 2002/09 Leiter der Heilsarmee-Jugendarbeit in den Neuen Bundesländern und Berlin. 1998 Gründung der Schwarzenberger Tafel; 1998/07 Vors. der Ev. Allianz Chemnitz, 2000/10 Vors. des Jugendarbeitskreises der Ev. Allianz, seit 2010 Mitgl. Hauptvorstand Ev. Allianz Deutschlands, ab Sept. 2016 Mitgl. der Kammer für nachhaltige Entwicklung der Ev. Kirche in Deutschland (EKD); Nov. 2011/16 Gründungsmitgl. und stellv. Vors. "Lern- & Gedenkort Kaßberg-Gefängnis e. V.", 2008 Gründungsmitgl. des Vereins "tellerlein-deck-dich" e. V., seit 2010 Mitgl. Amnesty International, seit April 2011 Präsident Schwimm-Club Chemnitz von 1892 e. V., 2013 Gründungsmitgl. u. Vorstandsvors. Verein "Gemeinsam gegen Menschenhandel e. V.". Seit Mai 2010 Vors. Verein Perspektiven für Familien e. V./Haus Kinderland. 1992/96 Mitgl. der Ökologisch Demokratischen Partei (ÖDP) Baden-Württembergs. Seit 2007 Mitgl. der CDU, seit 2008 stellv. Vors. der Ortsgruppe Chemnitz Süd-West, seit Nov. 2009 Kreisvors. CDU Chemnitz. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Frank', '11004054');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07977, NULL, NULL, NULL, 'Arzt', 'verheiratet, 4 Kinder', '05.06.1954', NULL, 'Düren', 'männlich', NULL, '27.10.2009', 'Henke', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>St. Antonius-Hospital, Eschweiler, <br/>Arzt, jährlich, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>Allianz Private Krankenversicherungs-AG, München, <br/>	Stellv. Vorsitzender des Ärztebeirates, jährlich, Stufe 3<br/>	<br/>Deutsche Apotheker- und Ärztebank eG, Düsseldorf, <br/>	Mitglied der Vertreterversammlung und Mitglied des Beirates<br/>	<br/>Deutsche Ärzteversicherung-AG, Köln, <br/>	Mitglied des Aufsichtsrates<br/>	Mitglied des Beirates, jährlich, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Ärztekammer Nordrhein, Düsseldorf, <br/>Präsident, monatlich, Stufe 3<br/><br/>Nordrheinische Ärzteversorgung, Düsseldorf, <br/>Vorsitzender des Verwaltungsausschusses<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeitsgemeinschaft Berufsständischer Versorgungseinrichtungen e.V. (ABV), Berlin, <br/>	Mitglied des Vorstandes<br/>	<br/>Bundesärztekammer, Berlin, <br/>	Mitglied des Vorstandes<br/>	<br/>Hans-Neuffer-Stiftung, Stuttgart, <br/>	Mitglied des Kuratoriums<br/>	<br/>Marburger Bund Bundesverband, Berlin, <br/>	1. Vorsitzender, monatlich, Stufe 2<br/>	<br/>Marburger Bund Stiftung, Berlin, <br/>	Vorsitzender des Vorstandes', '1972 Abitur Stiftisches Gymnasium Düren. 1972/79 Medizinstudium RWTH Aachen, 1979 Approbation als Arzt. Seit 1988 Facharzt für Innere Medizin, seit 1988 Oberarzt der Klinik für Hämatologie/Onkologie am St.-Antonius-Hospital Eschweiler. Seit 1988 Vorstandsmitgl. und seit 2011 Präsident Ärztekammer Nordrhein, 1989/07 2. Vors. und ab 2007 1. Vors. Marburger Bund, Bundesverb., 1991/13 1. Vors. Marburger Bund, Landesverb. NRW/Rheinland-Pfalz; seit 1995 Vorstandsmitgl. Bundesärztekammer. U. a. Vors. Dt.-Jap. Kulturges. Aachen e. V., Vors. "Ärzte helfen Obdachlosen" e. V., Dt.-Israel. Ges. Aachen e. V., Förderverein Marienhospital Aachen e. V., Förderverein Region. Onkolog. Schwerpunkt Eschweiler e. V., Ges. der Freunde und Förderer der Nordrhein-Westf. Akademie der Wissenschaften e. V., Medizinische Ges. Aachen e. V.,  Bauverein der Kath. Kirchengem. St. Adalbert, Kuratorium AIDS-Hilfe NRW, St. Vincenz-Bogenschützenges. Niederforstbach 1891 e. V., seit 2000 Mitgl. Vorst. AG berufsständ. Versorgungseinrichtungen. Delegierter des Weltärztebundes, seit 2011 Mitgl. Dt. Ges. f. Gesetzgebung e. V., Mitgl. Förderverein Kinderseele e. V., Mitgl. Gesellschaft zum Studium strukturpolitischer Fragen e. V. Seit 1992 Mitgl. der CDU; 1997/13 Mitgl. CDU-Kreisvorst. Stadt Aachen, seit 1999 Mitgl. Landesvorst. CDU NRW, 1999/03 Mitgl. CDU-BFA Forschung und Innovation und 2010/14 Mitgl. CDU-BFA Arbeit, Soziales und Gesundheit, ab 2014 Mitgl. CDU-BFA Gesundheit und Pflege, 1999/13 stellv. Vors. CDU Aachen. 1994/04 Mitgl. Sozial- und Gesundheitsaussch. Rat der Stadt Aachen. 1995/09 MdL Nordrhein-Westfalen, dort u. a. Mitgl. Ausschuss für Arbeit, Gesundheit und Soziales, 2005/09 stellv. Vors. der CDU-Fraktion. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Rudolf', '11004055');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07980, NULL, NULL, NULL, 'Oberregierungsrat a. D.', 'verheiratet, 1 Kind', '03.07.1972', NULL, 'Rheydt (jetzt Mönchengladbach)', 'männlich', NULL, '27.10.2009', 'Heveling', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Deutsche Nationalbibliothek, Frankfurt/Main, <br/>	Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>	Deutsche Welle, Bonn, <br/>	Stellv. Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>	Katholische Pfarrgemeinde St. Andreas, Korschenbroich, <br/>	Mitglied des Kirchenvorstandes, ehrenamtlich<br/><br/>	Rhein-Kreis Neuss, Neuss, <br/>	Sachkundiger Bürger im Ausschuss für Kultur, ehrenamtlich<br/><br/>	Stadt Korschenbroich, Korschenbroich, <br/>	Sachkundiger Bürger im Ausschuss für Kultur, ehrenamtlich<br/><br/>	Stiftung Deutsches Historisches Museum (DHM), Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Haus der Geschichte der Bundesrepublik Deutschland,<br/>	Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Goethe-Museum, Anton und Katharina-Kippenberg-Stiftung, Düsseldorf, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Weißer Ring e.V., Mainz, <br/>	Mitglied des Geschäftsführenden Bundesvorstandes, ehrenamtlich', '1983/92 Stiftisches Humanistisches Gymnasium Mönchengladbach, Abitur. 1992/93 Wehrdienst. 1993/97 Studium der Rechtswissenschaften an der Rheinischen Friedrich-Wilhelms-Universität in Bonn, 1998 Erstes jur. Staatsexamen, 1999/01 Referendariat und einsemestriges Ergänzungsstudium an der Deutschen Hochschule für Verwaltungswissenschaften in Speyer, 2001 Zweites jur. Staatsexamen. 2001/02 Rechtsanwalt in der Kanzlei Segbert & Partner, Korschenbroich; 2002/05 wissenschaftl. Mitarbeiter der CDU-Landtagsfraktion Nordrhein-Westfalen, dort Leiter des Referats Verkehrspolitik; 2005/09 stellv. Leiter des Ministerbüros des Finanzministeriums von Nordrhein-Westfalen. 1989 Eintritt in die Schüler Union und Junge Union, 1991 Eintritt in die CDU, seit 2000 Vors. CDU-Stadtverband Korschenbroich. 1999/09 Mitgl. Rat der Stadt Korschenbroich, 2004/09 Vors. des Ausschusses für Kultur, Familie und Soziales der Stadt Korschenbroich, 1999/02 stellv. Vors. und 2002/09 Vors. der CDU-Stadtratsfraktion Korschenbroichs. Seit 2014 Mitgl. des geschäftsführenden Vorstands des Weißen Rings e. V. - MdB seit Okt. 2009; seit der 18. WP Obmann im Ausschuss für Kultur und Medien und seit Okt. 2016 Vors. Innenausschuss.', 'Ansgar', '11004056');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07981, NULL, NULL, NULL, 'Selbstständiger Unternehmer', 'verheiratet, 3 Kinder', '06.02.1973', 'Frankreich', 'Paris', 'männlich', NULL, '27.10.2009', 'Höferlin', NULL, 'FDP', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Manuel', '11004057');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07982, NULL, NULL, NULL, 'Rechtsanwältin', 'verheiratet', '17.08.1964', NULL, 'Ludwigsburg', 'weiblich', NULL, '27.10.2009', 'Hönlinger', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Ingrid', '11004058');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07985, NULL, NULL, NULL, 'Erster Bürgermeister a. D., Bankkaufmann', 'verheiratet, 3 Kinder', '10.09.1956', NULL, 'Weiding', 'männlich', NULL, '27.10.2009', 'Holmeier', NULL, 'CSU', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Sana Kliniken des Landkreises Cham gemeinnützige GmbH, Cham,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Weiding, Weiding,<br/>1. Bürgermeister, ehrenamtlich (bis 30.04.2014), monatlich, Stufe 2<br/><br/>Landkreis Cham, Cham,<br/>Mitglied des Kreistages, Fraktionsvorsitzender<br/><br/>Zweckverband zur Wasserversorgung der Chamer Gruppe, Cham,<br/>Mitglied des Verwaltungsrates und 2. Vorsitzender (bis 30.04.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europaverband der Selbständigen - Deutschland e.V. (ESD), Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich', '1974 Fachabitur an der Fachoberschule Cham. 1974/91 Bankkaufmann bei der Sparkasse Cham. Stellv. Kreisvors. des Bayerischen Roten Kreuzes, Kreisvors. der Eisstockschützen im Landkreis Cham, Mitgl. in versch. Vereinen und Organisationen. 1974/91 Mitgl. der Jungen Union, seit 1979 Mitgl. der CSU, seit 1989 CSU-Ortsvors., 1993/2015 stellv. CSU-Kreisvors., seit Nov. 2015 Vors. CSU-Kreisverband Cham. Seit 1984 Kreisrat, seit 1998 Vors. der CSU-Kreistagsfraktion. 2002/09 Kreisvors. des Bayerischen Gemeindetages, Kreisverband Cham. Mai/Okt. 2008 Mitgl. des Bayerischen Landtags. - MdB seit Okt. 2009.', 'Karl', '11004059');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07986, NULL, NULL, NULL, 'Angestellter', NULL, '29.09.1963', NULL, 'München', 'männlich', NULL, '27.10.2009', 'Hunko', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', '1983 Abitur in Aachen. 1983/85 Zivildienst. 1985/91 Medizinstudium Freiburg. 1991/99 LKW-Fahrer, Drucker, Krankenpfleger, Publizist, in Freiburg, Aachen, Berlin. 1999/04 Ausbildung/Arbeit als Mediengestalter, Aachen. 2007/09 Mitarbeiter bei MdEP Tobias Pflüger, DIE LINKE, Brüssel. Seit 1981 aktiv in Friedens-, Umwelt- und sozialen Bewegungen, 1986/89 Bunte Liste Freiburg, 2004/06 Sprecher der Montagsdemos Aachen, 2006/07 Sprecher Kreisverband Aachen WASG, 2007/09 Mitgl. Landesvorstand DIE LINKE.NRW., seit 2014 Mitgl. Parteivorstand DIE LINKE. Mitgliedschaften: ver.di, Anti-Kriegs-Bündnis Aachen, Informationsstelle Militarisierung e. V., VVN-BdA Aachen, Mehr Demokratie e. V., attac. Englisch (f), Französisch (G), Spanisch (G). - MdB seit 2009; seit 2016 europapol. Sprecher Fraktion DIE LINKE. Parlamentarier/innengruppen: Ukraine, Zypern (Vors.), Belarus (stellv. Vors.); seit 2010 Mitglied Parl. Versammlung Europarat und dort stellv. Vors. der UEL (Linksfraktion) sowie Mitgl. Pol. Ausschuss, Sozialausschuss, Monitoring Ausschuss und Unterausschuss für die Europäische Sozialcharta. Schwerpunkte: Europa- und Außenpolitik.', 'Andrej', '11004060');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07989, NULL, NULL, NULL, 'IT-Berater', 'verheiratet, 1 Kind', '28.04.1973', NULL, 'Düsseldorf', 'männlich', NULL, '27.10.2009', 'Jarzombek', NULL, 'CDU', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Quadriga Hochschule GmbH, Berlin,<br/>Mitglied des Beirates "Politik & Public Affairs"<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Beauftragter der Bundesregierung für Kultur und Medien und Bundesministerium für Familie, Senioren, Frauen und Jugend, Berlin,<br/>Mitglied des Kuratoriums ?Ein Netz für Kinder? (bis 31.12.2013)<br/><br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Mitglied des Beirates<br/><br/>Westdeutscher Rundfunk (WDR), Köln,<br/>Stellv. Mitglied des Rundfunkrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>cnetz - Verein für Netzpolitik e.V., Berlin,<br/>Mitglied des Vorstandes<br/><br/>Digitale Stadt Düsseldorf e.V., Düsseldorf,<br/>Mitglied des Beirates<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Vorsitzender des Beirates "Digitale Agenda"<br/><br/>THW-Landesvereinigung Nordrhein-Westfalen e.V., Düsseldorf,<br/>Mitglied des Beirates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Releon GmbH & Co. KG, Düsseldorf', '1992 Abitur. Anschließend Wehrdienst. 1993 Studium der Wirtschaftswissenschaften an der Heinrich-Heine-Univ. Düsseldorf, 1996 Vordiplom der Wirtschaftswissenschaften. 1996 Existenzgründung, Gründung eines Unternehmens für IT-Dienstleistungen, bis 2013 geschäftsführender Gesellschafter, heute Gesellschafter der releon GmbH & Co. KG mit Sitz in Düsseldorf. Seit 1991 Mitgl. der CDU, 1995/01 Kreisvors. der JU Düsseldorf, 2000/06 stellv. Landesvors. der JU NRW; seit 1995 Mitgl. im Kreisvorst. der CDU Düsseldorf, seit Jan. 2014 Kreisvors., seit 2007 Mitgl. im Landesvorst. der CDU Nordrhein-Westfalen. 1994/99 Mitgl. der Bezirksvertretung 7 in Düsseldorf (Grafenberg, Gerresheim, Hubbelrath), 1999/05 Mitgl. im Rat der Stadt Düsseldorf, zuletzt schulpol. Sprecher, 2005/09 Mitgl. im Landtag von Nordrhein-Westfalen, zuletzt medienpol. Sprecher der CDU-Landtagsfraktion und Sprecher der Jungen Gruppe. - MdB seit Okt. 2009; Sprecher der CDU/CSU-Fraktion für Digitale Agenda, Mitgl. Beirat bei der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen.', 'Thomas', '11004061');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07991, NULL, NULL, NULL, 'Diplom-Kaufmann', 'verheiratet, 2 Kinder', '29.11.1962', NULL, 'Hopsten', 'männlich', NULL, '27.10.2009', 'Jasper', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Dieter', '11004062');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07994, NULL, NULL, NULL, 'Historiker', 'ledig', '08.08.1970', NULL, 'Kamen', 'männlich', NULL, '27.10.2009', 'Kaczmarek', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsches Studentenwerk e.V. (DSW), Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Informations- und Dokumentationszentrum für Antirassismusarbeit e.V. (IDA), Düsseldorf, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Internationales Bildungs- und Begegnungswerk e.V. (IBB), Dortmund, <br/>Mitglied des Kuratoriums, ehrenamtlich', 'Abitur an der Carlo-Schmid-Gesamtschule Kamen. Zivildienst im AWO-Seniorenzentrum Unna. Studium für das Lehramt der Sekundarstufen II und I in Geschichte und Sozialwissenschaft an der Universität Bochum, Staatsexamen. Oberregierungsrat im Ministerium für Schule und Weiterbildung des Landes Nordrhein-Westfalen. Vorher Jugendbildungsreferent beim SPD-Landesverband Nordrhein-Westfalen in Düsseldorf; Tätigkeit als freier Mitarbeiter im betrieblichen und außerbetrieblichen Sozialwesen des Steinkohlenbergbaus. Mitgliedschaften in ver.di, Arbeiterwohlfahrt, Förderverein Monopol 2000, Naturfreunde, Verein für Demokratie und Völkerverständigung, Mitgl. Kuratorium Internationales Bildungs- und Begegnungswerk Dortmund und im Beirat des Informations- und Dokumentationszentrums für Antirassismusarbeit e. V., Mitgl. Kuratorium Dt. Studentenwerk, Kuratorium Stiftung Lesen und Kuratorium Evangelisches Studienwerk e. V. 1988 Eintritt in die SPD, seit 1990 Mitgl. im SPD-Ortsvereinsvorst. Kamen-Mitte, seit 1999 Mitgl. im SPD-Unterbezirksvorst. Unna und hier seit 2005 Vors., seit 2006 Mitgl. des SPD-Landesvorst. Nordrhein-Westfalen. - MdB seit Okt. 2009; seit 2014 stellv. bildungspol. Sprecher der SPD-Fraktion, seit 2014 Mitgl. im SPD-Fraktionsvorstand, seit 2014 Vors. der Deutsch-Belarussischen Parlamentariergruppe.', 'Oliver', '11004063');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07995, NULL, NULL, NULL, 'Diplom-Kaufmann', 'verheiratet', '05.07.1964', NULL, 'Bad Rothenfelde', 'männlich', NULL, '27.10.2009', 'Kamp', NULL, 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Heiner', '11004064');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07998, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'eingetragene Lebenspartnerschaft', '21.08.1969', NULL, 'Stuttgart', 'männlich', NULL, '27.10.2009', 'Kaufmann', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>		Rechtsanwaltskanzlei Blaich & Partner, Stuttgart, <br/>	Rechtsanwalt<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bürger-OB - Sebastian Turner für Stuttgart e.V., Stuttgart,<br/>Vorsitzender des Vorstandes<br/><br/>Bundesstiftung Magnus Hirschfeld, Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates<br/><br/>Deutsch-Türkisches Forum Stuttgart e.V., Stuttgart,<br/>Mitglied des Kuratoriums<br/><br/>Deutsches Studentenwerk e.V. (DSW), Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Förderverein collegium iuvenum Stuttgart e.V., Stuttgart,<br/>Mitglied des Kuratoriums<br/><br/>Forum für Hochschul- und Bildungspolitik e.V., Tübingen,<br/>Vorsitzender<br/><br/>Forum Region Stuttgart e.V., Stuttgart,<br/>Mitglied des Kuratoriums (bis 07.10.2015)<br/><br/>Freunde und Förderer des Stuttgarter Oratorienchors e.V., Stuttgart,<br/>Vorsitzender des Vorstandes<br/><br/>Il Gusto Barocco e.V., Stuttgart,<br/>Vorsitzender des Kuratoriums<br/><br/>Jugend gegen AIDS e.V., Hamburg,<br/>Mitglied des Beirates<br/><br/>Max-Planck-Institut für Festkörperforschung, Stuttgart,<br/>Mitglied des Kuratoriums<br/><br/>Theodor-Heuss-Stiftung, Stuttgart,<br/>Mitglied des Kuratoriums<br/><br/>Wirtschaftsrat der CDU e.V., Berlin,<br/>Mitglied der Bundesfachkommission Wachstum und Innovation', '1989 Abitur am Solitude-Gymnasium Stuttgart-Weilimdorf. 1990/91 Zivildienst im Diakonischen Werk Württemberg. 1991/98 Studium der Rechtswissenschaften in Tübingen und Leiden/Niederlande, 1994/97 Stipendiat der Konrad-Adenauer-Stiftung (1995/96 Sprecher). 1995/96 Tätigkeit beim Europ. Parlament als Assistent der bildungspol. Sprecherin, Doris Pack MdEP. 1998/2000 wiss. Mitarbeiter bei Prof. Dr. George Turner, Univ. Hohenheim, 1998/01 Doktorarbeit bei Prof. Dr. Thomas Oppermann, Eberhard Karls Univ. Tübingen, 2000/02 Referendariat in Stuttgart und London. Seit 2002 Rechtsanwalt. Seit 2011 Kreisvors. der CDU Stuttgart, Vors. LFA Medien und Medienpolitik der CDU Baden-Württemberg, Mitgl. BFA Bildung, Forschung und Innovation der CDU Deutschlands, Mitgl. Bundesfachkommission Wachstum und Innovation des Wirtschaftsrats der CDU e. V., Vors. Vorstand der Freunde und Förderer des Stuttgarter Oratorienchors e. V., Vors. Kuratorium des Stuttgarter Barockorchesters Il Gusto Barocco e. V.; Mitgl. Kuratorium Max-Planck-Institut für Festkörperforschung Stuttgart, Mitgl. Kuratorium der Theodor-Heuss-Stiftung, Kuratorium des Deutsch-Türkischen Forums Stuttgart e. V., Kuratorium der Bundesstiftung Magnus Hirschfeld, Kuratorium des Deutschen Studentenwerks e. V., Parl. Beirat des Bundesverbands Deutscher Stiftungen e. V., Beirat von Jugend gegen AIDS e. V. - MdB seit Okt. 2009; seit 2014 Obmann der CDU/CSU-Fraktion im Ausschuss für Bildung, Forschung und Technikfolgenabschätzung.', 'Stefan', '11004065');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (07999, NULL, NULL, NULL, 'Diplom-Volkswirt (Universität)', '2 Kinder', '09.10.1953', NULL, 'Mittelberg', 'männlich', NULL, '27.10.2009', 'Kekeritz', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'konfessionslos', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1976 Fachabitur Fachoberschule Nürnberg. 1977 Studienaufenthalt in London, Studium der Englischen Sprache. Studium VWL, Abschluss Dipl.-Volkswirt Univ. Nürnberg. 1982/88 selbstständig tätig. 1988/90 Mathematik- und Englischunterricht an einer Secondary School und päd. Trainer für Junglehrer (on the job Training) in Kamerun. 1990/2000 Hausmann und Betreuung der Kinder, daneben Beratung von Existenzgründern und EDV-Beratung für Kleinunternehmer. Ab 1994 freiberufl. Dozent bei versch. priv. und öff. Bildungsträgern im Bereich EDV und Reintegration von Arbeitssuchenden, spez. Kurse für Jugendliche und Menschen ab 50. Seit 2001 tätig im Bereich der berufl. Rehabilitation im Berufsförderungswerk Nürnberg. Langjähriges Mitgl. im Bund Naturschutz Bayern, Landesbund für Vogelschutz, ver.di und Attac. Seit 1972 Mitgl. der SPD, Austritt auf Grund des NATO- Doppelbeschlusses unter Helmut Schmidt. 1977 Mitbegründer der Nürnberger Anti-Atominitiative und aktives Mitgl. der Grünen. Seit 1990 pol. Arbeit in der Kommunalpolitik, 1996/09 und seit Mai 2014 im Kreistag Neustadt/Aisch-Bad Windsheim, bis Sept. 2009 im Stadtrat in Uffenheim. Englisch (f). - MdB seit Okt. 2009; seit 2013 Sprecher für Entwicklungspolitik der Fraktion Bündnis 90/Die Grünen.', 'Uwe', '11004066');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08000, NULL, NULL, NULL, 'Rechtsanwältin', 'verheiratet, 3 Kinder', '30.11.1969', NULL, 'Berlin', 'weiblich', NULL, '27.10.2009', 'Keul', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwältin, selbständig, Nienburg', '1987 Highschool Abschluss Jacksonville, Florida, 1989 Abitur am Albert-Schweitzer-Gymnasium Nienburg/Weser. 1989/94 Studium der Rechtswissenschaften in Heidelberg, 1994/97 Referendariat am Landgerichtsbezirk Frankfurt/Oder. Seit 2000 Fachanwältin für Familienrecht, selbstständig. 2006 Eintritt in Bündnis 90/Die Grünen, 2007 Vorstandsmitgl. des Kreisverbandes Nienburg. Englisch (f), Französisch (f). - MdB seit Okt. 2009; seit Nov. 2009 Parl. Geschäftsführerin der Fraktion Bündnis 90/Die Grünen.', 'Katja', '11004067');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08003, NULL, NULL, NULL, 'Diplom-Kaufmann, Oberst a. D.', 'verheiratet, 2 Kinder', '11.09.1963', NULL, 'Pfullendorf', 'männlich', NULL, '27.10.2009', 'Kiesewetter', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>	VB-Bank Aalen eG, Aalen, <br/>	Mitglied der Vertreterversammlung, ehrenamtlich (bis 31.12.2015)<br/><br/>	Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich (bis 31.12.2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Mitglied des Beirates Zivile Krisenprävention der Bundesregierung, ehrenamtlich, Berlin <br/><br/>	Bundesakademie für Sicherheitspolitik (BAKS), Berlin, <br/>	Stellv. Sprecher des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Südosteuropa-Gesellschaft e.V., München, <br/>	Vizepräsident, ehrenamtlich (bis 31.12.2014)<br/><br/>	Verband der Reservisten der Deutschen Bundeswehr e.V., Bonn, <br/>	Präsident, ehrenamtlich (bis 28.06.2016)<br/><br/>	Volkshochschule Aalen e.V., Aalen, <br/>	Vorsitzender, ehrenamtlich', '1982 Abitur in Ellwangen/Jagst. 1982/2009 Bundeswehr. 1983/86 Studium der Wirtschaftswissenschaften in München und Austin/Texas. 1995/97 Generalstabsausbildung (Heusingerpreis). Berufliche Stationen u. a. EU-Rat Brüssel, NATO HQ in Brüssel und Mons, Bundesministerium der Verteidigung, Bataillonskommandeur, mehrere Auslandseinsätze. Mitgl. u. a. DRK, VdK, Lions. Stellv. Vors. Beirat BAKS, IPK GASP/GSVP. Bis 2016 Präsident VdRBw e. V. Seit 1981 Mitgl. der CDU, Vors. CDU-Kreisverband Ostalb; Vors. Bundesfachausschuss Außen-, Sicherheits-, Entwicklungs- und Menschenrechtspolitik CDU Deutschland. Vors. Volkshochschule Aalen und Mitgl. im Regionalverband Ostwürttemberg. Englisch (f), Französisch (f), Italienisch (G). - MdB seit Okt. 2009; Leiter dt. Delegation in der Euromediterrane Parl. Versammlung; Obmann der CDU/CSU-Fraktion für Außenpolitik.', 'Roderich', '11004068');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08004, NULL, NULL, NULL, 'Jurist', 'verheiratet, 2 Kinder', '24.01.1967', 'Türkei', 'Malatya', 'männlich', NULL, '27.10.2009', 'Kilic', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Memet', '11004069');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08005, NULL, NULL, NULL, 'Betriebswirt', 'ledig', '14.02.1985', NULL, 'Hannover', 'männlich', NULL, '27.10.2009', 'Kindler', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin,<br/>Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Israelische Gesellschaft e.V., Berlin, <br/>Vizepräsident, ehrenamtlich<br/><br/>Institut Solidarische Moderne e.V., Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich', '2004 Abitur an der Käthe-Kollwitz-Schule in Hannover. 2004/07 Duales Studium der Betriebswirtschaftslehre an der Leibniz-Akademie Hannover und bei der Bosch Rexroth Pneumatics GmbH, 2007 Studienabschluss als Betriebswirt. 2007/09 tätig im Unternehmenscontrolling der Bosch Rexroth Pneumatics GmbH. Mitgl. BUND, IG Metall, PRO ASYL, Forum Ökologisch-Soziale Marktwirtschaft (FÖS), Attac, Bund der Pfadfinderinnen und Pfadfinder (BdP), Zukunftspiloten, seit 2010 Kuratoriumsmitgl. Institut Solidarische Moderne (ISM), seit 2012 Vizepräsident Dt.-Israelische Gesellschaft (DIG). Seit 2003 aktiv bei Bündnis 90/Die Grünen, 2006/07 Schatzmeister der Grünen Jugend Niedersachsen, 2006/09 Parteirat Bündnis 90/Die Grünen Niedersachsen, 2007/09 Sprecher der Grünen Jugend Niedersachsen, 2013 Mitgl. der grünen Verhandlungskommission für die Koalition mit der SPD in Niedersachsen. - MdB seit 2009; seit 2013 Sprecher der Landesgruppe Niedersachsen der Fraktion Bündnis 90/Die Grünen, seit 2014 haushaltspolitischer Sprecher der Fraktion Bündnis 90/Die Grünen.', 'Sven-Christian', '11004070');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08008, NULL, NULL, NULL, 'Diplom-Volkswirt', 'verheiratet, 4 Kinder', '13.01.1960', NULL, 'Siegen', 'männlich', NULL, '27.10.2009', 'Klein', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn/Eschborn, <br/>Mitglied des Aufsichtsrates<br/><br/>kplan AG, Abensberg, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Heimatverein Alte Vogtei Burbach e.V., Burbach, <br/>Vorsitzender', '1979 Abitur in Neunkirchen. 1979/86 Volkswirtschaftsstudium in Bonn, 1986 Diplom-Volkswirt. 1980/84 Abgeordnetenmitarbeiter im Deutschen Bundestag; 1986/87 Praktikum in Australien. 1987/95 Leitender Mitarbeiter mittelständischer Firmen. 1983/89 Vors. der JU im Sauer-/Siegerland, seit 2001 Mitgl. im CDU-Landesvorst., seit 2003 CDU-Kreisvors. in Siegen-Wittgenstein, 2004/15 Landesvors. Ev. Arbeitskreis der CDU in NRW. 1984/05 Ratsmitgl. in Burbach, 1992/96 Bürgermeister in Burbach; 1995/09 Mitgl. Landtag von Nordrhein-Westfalen. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Volkmar', '11004071');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08009, NULL, NULL, NULL, 'Soziologin', 'ledig, 1 Kind', '06.01.1958', NULL, 'Dingen (jetzt Hamminken)', 'weiblich', NULL, '27.10.2009', 'Klein-Schmeink', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Psychisch Kranke e.V., Bonn, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Kuratorium Sport und Natur e.V., München, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Stiftung Hospizarbeit, Münster, <br/>Mitglied des Beirates, ehrenamtlich', '1977/84 Studium der Soziologie, Politikwissenschaft und Pädagogik an der Westfälischen Wilhelms-Universität Münster, Magister der Soziologie. 20 Jahre in leitender Position in der Erwachsenenbildung, 2002/09 wissenschaftliche Referentin für Arbeit, Soziales und Gesundheit und dann für Arbeitsmarkt- und Kommunalpolitik in der Grünen Landtagsfraktion NRW. Mitgl. der Grünen, seit 1986 im Kreisverband in Münster. 1993/09 Mitgl. im Rat der Stadt Münster, 1995/09 Fraktionssprecherin. - MdB seit Okt. 2009; Sprecherin für Gesundheitspolitik der Fraktion Bündnis 90/Die Grünen.', 'Maria', '11004072');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08012, NULL, NULL, NULL, 'Marketingfachmann', 'verheiratet, 1 Kind', '01.03.1967', NULL, 'Bassum', 'männlich', NULL, '27.10.2009', 'Knoerig', NULL, 'CDU', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>GoBS German open Business School Hochschule für Wirtschaft und Verwaltung gemeinnützige Gesellschaft mbH, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Wirtschaftsförderungsgesellschaft für den Landkreis Diepholz, Diepholz,<br/>Vorsitzender der Gesellschafterversammlung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeszentrale für politische Bildung, Bonn,<br/>Mitglied des Kuratoriums<br/><br/>Kreissparkasse Grafschaft Diepholz, Diepholz,<br/>Mitglied des Verwaltungsrates<br/><br/>Landkreis Diepholz, Diepholz,<br/>Mitglied des Kreistages<br/><br/>Samtgemeinde Kirchdorf, Kirchdorf,<br/>Vorsitzender des Samtgemeinderates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>CARE Deutschland-Luxemburg e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Carl-Duisberg-Förderkreis Niedersachsen e.V., Hannover,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Kinderhospiz Löwenherz e.V., Syke,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Kreissportbund Diepholz e.V., Affinghausen,<br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Sportförderverein Landkreis Diepholz e.V., Diepholz,<br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Vereinigung der Helfer und Förderer des Technischen Hilfswerkes in Niedersachsen e.V., Cloppenburg,<br/>Landesvorsitzender, ehrenamtlich', '1987 Abitur am Syker Gymnasium. 1996 Magisterabschluss der Politologie, Schwerpunkt Kommunalwissenschaften an der Universität Bonn, Nebenfächer Neuere Geschichte und Psychologie. 1987 Wehrpflicht, Eintritt in die Bundeswehr, Pressereserveoffizier, Oberstleutnant d. R. 1996 Referent für Vertriebsmarketing bei der Deutschen Telekom AG, seit 2000 Marketingfachmann im Zentralbereich des Vorstandsvorsitzenden, Hauptstadtrepräsentanz. Stellv. Vors. des Kreissportbundes Diepholz, Fachwart Boxen im Kreissportbund Diepholz, Spartenleiter Boxen im TuS Syke e. V., stellv. Vors. Sportförderverein im Landkreis Diepholz, Vors. THW-Landeshelfervereinigung in Niedersachsen, seit 2013 Mitgl. Stiftungsrat der "Stiftung Kinderhospiz Löwenherz" und seit 2016 Mitgl. Gesellschafterversammlung der Wirtschaftsförderungsgesellschaft mbH für den Kreis Diepholz. 1983 Mitgl. der Jungen Union, 1986 Mitgl. der CDU, seit 2014 Vors. CDU-Kreisverband Diepholz, seit 2011 Mitgl. Bundesvorst. CDA Deutschland. Bis 1997 Stadtratsmitgl. in Bassum, 1991/01 und seit 2011 Kreistagsabgeordneter im Landkreis Diepholz; seit 2001 Mitgl. im Samtgemeinderat Kirchdorf, seit 2011 Ratsvors. des Samtgemeinderats Kirchdorf, seit 2011 Mitgl. im Verwaltungsrat der Kreissparkasse Diepholz; 2001/06 Mitgl. im Gemeinderat Kirchdorf. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Axel', '11004073');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08013, NULL, 'Dr.', 'Dr.', 'Diplom-Biologe', 'verheiratet, 1 Kind', '04.01.1958', NULL, 'Göttingen', 'männlich', NULL, '27.10.2009', 'Knopek', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Lutz', '11004074');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08014, NULL, NULL, NULL, 'Pfarrer', 'ledig', '03.07.1971', NULL, 'Sindelfingen', 'männlich', NULL, '27.10.2009', 'Kober', NULL, 'FDP', NULL, 'evangelisch-lutherisch', NULL, NULL, NULL, 'Pascal', '11004075');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08016, NULL, NULL, NULL, 'Diplom-Ökonom', 'verheiratet, 3 Kinder', '11.09.1954', NULL, 'Sangerhausen', 'männlich', NULL, '27.10.2009', 'Koch', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Harald', '11004076');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08017, NULL, NULL, NULL, 'Betriebswirt', 'verheiratet, 3 Kinder', '25.01.1944', NULL, 'Damm', 'männlich', NULL, '27.10.2009', 'Koenigs', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>	Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Auswärtiges Amt, Berlin, <br/>	Beauftragter zur Unterstützung des Friedensprozesses in<br/>	Kolumbien, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	UNICEF Deutschland, Köln, <br/>	Mitglied des Vorstandes, ehrenamtlich', 'Studium der Betriebswirtschaftslehre. Wissenschaftlicher Tutor für Politische Ökonomie und Wissenschaftstheorie an der Freien Universität Berlin; Tätigkeiten als Übersetzer lateinamerikanischer Literatur, Buchhändler, Taxifahrer, Feingeräteelektroniker und Schweißer. 1989/99 Umweltdezernent und 1993/97 gleichzeitig Kämmerer in Frankfurt am Main; 1999/02 Stellvertreter des Sondergesandten der Vereinten Nationen im Kosovo, 2002/04 Sondergesandter der Vereinten Nationen in Guatemala und 2006/07 in Afghanistan; 2005 Beauftragter der Bundesregierung für Menschenrechtspolitik und Humanitäre Hilfe. 2008/14 im Vorstand von UNICEF Deutschland (ehrenamtl.). - MdB seit Okt. 2009; 2009/13 Vors. Ausschuss für Menschenrechte und humanitäre Hilfe, seit Jan. 2014 Menschenrechtspolitischer Sprecher der Fraktion Bündnis 90/Die Grünen; seit April 2015 Beauftragter des Bundesministers des Auswärtigen zur Unterstützung des Friedensprozesses in Kolumbien (ehrenamtl.).', 'Tom', '11004077');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08018, NULL, NULL, NULL, 'Architekt, Dipl.-Ing.', 'ledig', '05.05.1980', NULL, 'Forchheim', 'männlich', NULL, '27.10.2009', 'Körber', NULL, 'FDP', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Sebastian', '11004078');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08019, NULL, NULL, NULL, 'Diplom-Physikerin', '1 Kind', '22.02.1980', NULL, 'Schleiz', 'weiblich', NULL, '29.01.2014', 'Kolbe', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Netzwerk für Demokratie und Courage e.V., Dresden, <br/>Mitglied des Vorstandes', 'Abitur in Jena. Physik-Studium in Leipzig. 2009 Jugendbildungsreferentin bei ARBEIT UND LEBEN Sachsen. Mitgl. u. a. im Erich-Zeigner-Verein, ver.di, SGK Sachsen, "Leipzig Courage zeigen" und den SJD-Die Falken. 2002 Eintritt in die SPD, 2004/09 Vors. der Jusos Leipzig, seit 2015 Generalsekretärin der SPD Sachsen, 2014/15 Beisitzerin im Landesvorstand der SPD Sachsen. - MdB seit Okt. 2009; stellv. Vors. des Kuratoriums der Bundeszentrale für politische Bildung; in der 17. WP Vors. Enquete-Kommission "Wachstum, Wohlstand, Lebensqualität"; 2013/15 Vors. der Landesgruppe Ost der SPD-Fraktion, stellv. Sprecherin für Arbeit und Soziales der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 151 (Nordsachsen)', 'Daniela', '11004079');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08020, NULL, NULL, NULL, 'Gewerkschaftssekretärin', NULL, '07.01.1956', NULL, 'Johannisberg', 'weiblich', NULL, '27.10.2009', 'Krellmann', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>IG Metall, Frankfurt/Main, <br/>Gewerkschaftssekretärin, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landesarbeitsgericht Niedersachsen, Hannover, <br/>Richterin, ehrenamtlich', '1972/75 Berufsausbildung zur Chemielaborantin. 1979/82 Studium der Volkswirtschaft an der Hochschule für Wirtschaft und Politik in Hamburg, Abschluss Diplom-Volkswirtin. Tätigkeit als Chemielaborantin in der pharmazeutisch-chemischen Forschung; gewerkschaftliche Arbeit, z. B. in der Jugendvertretung, Vertrauensleutearbeit, Bildungsarbeit, 1984 Betreuung einer gewerkschaftlichen Arbeitsloseninitiative in Hameln, seit 1985 Gewerkschaftssekretärin der IG Metall in Hameln. Mitglied in der IG Metall, Attac, VVN und NABU. Zunächst Mitgl. der SPD, Austritt und Gründung der WASG in Hameln-Pyrmont, Eintritt in DIE LINKE. - MdB seit Okt. 2009.', 'Jutta', '11004080');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08021, NULL, NULL, NULL, 'Wissenschaftlicher Mitarbeiter', 'verheiratet, 2 Kinder', '26.07.1969', NULL, 'Zülpich', 'männlich', NULL, '27.10.2009', 'Krischer', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Agora Energiewende, SEFEP GmbH, Berlin, <br/>Mitglied des Rates der Agora, ehrenamtlich<br/><br/>AWA Entsorgung GmbH, Eschweiler, <br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Düren, Düren, <br/>Sachkundiger Bürger<br/><br/>Zweckverband Entsorgungsregion West (ZEW), Eschweiler, <br/>Mitglied der Zweckverbandsversammlung, ehrenamtlich (bis Januar 2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Erneuerbare Energie e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Deutsche Unternehmensinitiative für Energieeffizienz e.V. - DENEFF, Berlin, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Förderverein Nationalpark Eifel e.V., Schleiden, <br/>Vorsitzender, ehrenamtlich', 'Abitur. Zivildienst. Biologie-Studium an der RWTH Aachen. 1997/02 Mitarbeiter bei Michaele Hustedt, MdB; 2002/09 Wissenschaftlicher Mitarbeiter der Grünen Landtagsfraktion NRW. Vors. des Fördervereins Nationalpark Eifel, Mitgl. u.a. bei BUND, NABU, Eurosolar, Tierschutzverein Düren, Mitgl. Rat der Agora Energiewende, des Parl. Beirates des Bundesverbands Erneuerbarer Energien (BEE) und des Beirats der Unternehmensinitiative Energieeffizienz (DENEFF). Seit 1989 Mitgl. der Grünen, Vors. Kreisverband Düren, Vorstandsmitgl. Bezirksverband Mittelrhein. 1994/09 Mitgl. des Kreistags Düren, 1997/09 Vors. der Grünen- Fraktion im Kreistag Düren. Mitgl. Beirat der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen. - MdB seit Okt. 2009; seit Dez. 2013 stellv. Fraktionsvors. und Politischer Koordinator des AK Umwelt, Energie, Agrar, Verkehr und Bau der Fraktion Bündnis 90/Die Grünen.', 'Oliver', '11004081');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08022, NULL, NULL, NULL, 'Diplom-Musikerin (Klavier) mit Konzertexamen', 'ledig', '17.01.1977', NULL, 'Neuburg a. d. Donau', 'weiblich', NULL, '27.10.2009', 'Krumwiede', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'katholisch', NULL, NULL, NULL, 'Agnes', '11004082');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08024, NULL, NULL, NULL, 'Geschäftsführer', 'ledig', '10.06.1961', NULL, 'Hamburg', 'männlich', NULL, '27.10.2009', 'Kruse', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Schutzgemeinschaft Deutscher Wald Landesverband Hamburg e.V.,<br/>	Hamburg, <br/>	Geschäftsführer, monatlich, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>	UMPR GmbH, Strategische Kommunikationsberatung, Hamburg, <br/>	Mitglied des Beirates (bis Ende Mai 2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsche Unternehmensinitiative für Energieeffizienz e.V. - DENEFF,<br/>	Berlin, <br/>	Mitglied des Parlamentarischen Beirates<br/><br/>	Forum Ökologisch-Soziale Marktwirtschaft e.V. (FÖS), Berlin, <br/>	Mitglied des Beirates<br/><br/>	Stiftung Unternehmen Wald, Hamburg, <br/>	Vorsitzender<br/><br/>	Wirtschaftsrat der CDU e.V., Berlin, <br/>	Mitglied der Bundesarbeitsgruppe Staatsfinanzen<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Michael Schüller & Rüdiger Kruse GbR, Hamburg', 'Abitur am Gymnasium Altona. Studium der Medizin bis zum 2. Statsexamen Univ. Hamburg. Geschäftsführer der Schutzgemeinschaft Deutscher Wald Landesverband Hamburg e. V. (SDW); Vors. der Stiftung Unternehmen Wald. 1975/93 Mitgl. in der Jungen Union, seit 1977 Mitgl. der CDU, Ortsvors. der CDU Lokstedt-Niendorf-Schnelsen, Kreisvors. der CDU Eimsbüttel. 2001/Okt. 2009 Mitglied der Hamburgischen Bürgerschaft. - MdB seit Okt. 2009; Beauftragter für maritime Wirtschaft der CDU/CSU-Fraktion.', 'Rüdiger', '11004083');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08027, NULL, NULL, NULL, 'Bürgermeisterin, Diplom-Kauffrau', 'ledig', '20.07.1962', NULL, 'München', 'weiblich', NULL, '27.10.2009', 'Kudla', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Sparkassen Versicherung Holding AG Sachsen, Dresden, <br/>Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>ifo Institut - Leibniz-Institut für Wirtschaftsforschung an der Universität München e.V., München, <br/>Mitglied des Kuratoriums', '1981 Abitur am St.-Anna-Gymnasium. 1981/88 Studium der Betriebswirtschaftslehre mit Schwerpunkt Steuern und Bankwirtschaft an der Ludwig-Maximilians-Univ. München; 1993 Steuerberaterin, 1994 Wirtschaftsprüferin und Prokuristin. 1988/90 Wirtschaftsprüfungsgesellschaft Deloitte & Touche GmbH in München, 1990/04 Wirtschaftsprüferin und Steuerberaterin für das gleiche Unternehmen in Halle (Saale), Schwerpunkt Prüfung und betriebswirtschaftliche Beratung von insbesondere kommunalen Unternehmen in Sachsen und Sachsen-Anhalt, seit 1999 Director. Kuratoriumsmitgl. des ifo-Instituts für Wirtschaftsforschung der Univ. München, Mitgl. des Instituts für Wirtschaftsprüfer Düsseldorf und im Beirat der Sparkassenversicherung Sachsen in Dresden. 2004/05 Stadtkämmerin der Stadt Rosenheim; 2005/09 Bürgermeisterin und Beigeordnete für Finanzen der Stadt Leipzig. - MdB seit Okt. 2009.', 'Bettina', '11004084');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08028, NULL, NULL, NULL, 'Diplom-Soziologe', 'ledig', '06.09.1979', NULL, 'Dresden', 'männlich', NULL, '27.10.2009', 'Kühn', '(Dresden)', 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Dresdner Verkehrsbetriebe AG, Dresden, <br/>Mitglied des Aufsichtsrates, ehrenamtlich', '1998 Abitur am Marie-Curie Gymnasium Dresden. 1999 Zivildienst. 2000/08 Studium der Soziologie an der Technischen Universität Dresden. 2008/09 Referent der Fraktion BÜNDNIS 90/DIE GRÜNEN im Sächsischen Landtag. 1992/2000 Mitarbeit in der UNICEF-Arbeitsgruppe Dresden. 1997/98 aktiv im Stadtschülerrat. Mitglied u.a. im Umweltverband GRÜNE LIGA, Verkehrsclub Deutschland (VCD), ROBIN WOOD, Deutsches Komitee für UNICEF e.V., arche noVa - Initiative für Menschen in Not, Radio-Initiative Dresden e.V. Seit 1998 Mitgl. bei BÜNDNIS 90/DIE GRÜNEN, 2001/10 Mitgl. im Vorstand Kreisverband Dresden, davon 2003/05 und 2008/10 Sprecher des Kreisverbandes, 2007/08 Mitgl. im Landesvorstand von BÜNDNIS 90/DIE GRÜNEN Sachsen, 2010/12 und 2014/16 Mitgl. im Landesparteirat von BÜNDNIS 90/DIE GRÜNEN Sachsen. 2004/10 Mitgl. im Stadtrat von Dresden. - MdB seit Okt. 2009, seit Juni 2011 Sprecher für Verkehrspolitik der Fraktion BÜNDNIS 90/DIE GRÜNEN.', 'Stephan', '11004085');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08029, NULL, NULL, NULL, 'Technischer Angestellter', 'ledig', '13.07.1954', NULL, 'Vorsfelde', 'männlich', NULL, '27.10.2009', 'Lach', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Funktionen in Unternehmen: <br/>CongressPark Wolfsburg GmbH, Wolfsburg, <br/>Vorsitzender des Aufsichtsrates, ehrenamtlich<br/><br/>Wolfsburg AG, Wolfsburg, <br/>Mitglied des Aufsichtsrates und des Präsidiums, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Braunschweigische Landessparkasse, Braunschweig,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Stadt Wolfsburg, Wolfsburg,<br/>Bürgermeister, ehrenamtlich<br/>Mitglied des Stadtrates, ehrenamtlich<br/>Mitglied des Ortsrates, Ortsteil Vorsfelde, ehrenamtlich<br/>Ortsbürgermeister, Ortsteil Vorsfelde, ehrenamtlich<br/><br/>WAS - Wolfsburger Abfallwirtschaft und Straßenreinigung, Wolfsburg,<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>WEB - Wolfsburger Entwässerungsbetriebe, Wolfsburg,<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>WSB - Wolfsburger Struktur- und Beteiligungsgesellschaft, Wolfsburg,<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Kyffhäuser-Kreisverband Helmstedt-Wolfsburg, Wolfsburg, <br/>Vorsitzender, ehrenamtlich', 'Ausbildung zum Werkzeugmacher. 1980/09 Technischer Sachbearbeiter; seit 1970 bei Volkswagen in Wolfsburg beschäftigt. Seit 1978 Vors. der Vorsfelder Kyffhäuserkameradschaft, seit 1986 Kyffhäuser Kreisvorsitzender KV Helmstedt/Wolfsburg. Seit 1995 Mitgl. der CDU. Seit 1996 im Rat der Stadt Wolfsburg sowie im Ortsrat Vorsfelde, seit 2001 Ortsbürgermeister von Vorsfelde, 2002/09 Fraktionssprecher im Rat der Stadt Wolfsburg, 2006/11 Bürgermeister der Stadt Wolfsburg, Vorsitzender im Ausschuss Bürgerdienste und Feuerwehren. - MdB seit Okt. 2009.', 'Günter', '11004086');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08032, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 2 Kinder', '06.06.1969', NULL, 'Meran ( Südtirol )', 'männlich', NULL, '27.10.2009', 'Lange', NULL, 'CSU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Kanzlei Lange, Brendel, Gaudernack, Nördlingen,<br/>Rechtsanwalt, 2014, Stufe 4, Gewinn; 2015, Stufe 4 Gewinn; 2016, Stufe 5 Gewinn<br/>   Mandant I, 2014; 2015<br/>   Mandant K, 2015<br/><br/>DFS Deutsche Flugsicherung GmbH, Langen,<br/>Beratung, 2016, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>	DFS Deutsche Flugsicherung GmbH, Langen, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Mitglied des Eisenbahninfrastrukturbeirates<br/><br/>Donau-Ries Kliniken und Seniorenheime gKU, Donauwörth,<br/>Mitglied des Verwaltungsrates (bis 31.12.2015)<br/><br/>Landkreis Donau-Ries, Donauwörth,<br/>Mitglied des Kreistages, Fraktionsvorsitzender<br/><br/>Sparkasse Nördlingen, Nördlingen,<br/>Mitglied des Verwaltungsrates und des Zweckverbandsrates<br/><br/>Stadt Nördlingen, Nördlingen,<br/>Mitglied des Stadtrates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Kanzlei Lange, Brendel, Gaudernack, Nördlingen', '1988 Abitur am Theodor-Heuss-Gymnasium in Nördlingen. 1988/89 Grundwehrdienst in Dillingen/Donau. 1989/93 Studium der Rechtswissenschaften in Regensburg. Selbstständiger Rechtsanwalt, Fachanwalt für Arbeitsrecht und Fachanwalt für Familienrecht. 1992/99 Vors. der Jungen Union Nördlingen, 1999/11 Vors. der CSU Nördlingen, seit 2013 Kreisvors. CSU Donau-Ries. Seit 2002 Mitgl. Stadtrat Nördlingen, 2007/09 Fraktionsvors., seit 2002 Mitgl. Kreistag Donau-Ries, seit 2008 Fraktionsvors. Verwaltungsrat der Sparkasse Nördlingen. Seit 2014 Mitgl. Eisenbahninfrastrukturbeirat der Bundesnetzagentur, seit 2014 Mitgl. Beirat der DFS Deutsche Flugsicherung. Englisch (G). - MdB seit Okt. 2009; seit Jan. 2014 Vors. der AG Verkehr und digitale Infrastruktur der CDU/CSU-Fraktion, seit Juli 2016 Obmann der CDU/CSU-Fraktion im 5. Untersuchungsausschuss.', 'Ulrich', '11004087');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08033, NULL, NULL, NULL, 'Diplom-Soziologin', 'ledig', '11.12.1972', NULL, 'Neuwied', 'weiblich', NULL, '27.10.2009', 'Lay', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Stiftung Verbraucherschutz, Berlin, <br/>Mitglied des Kuratoriums', '1992 Abitur. 1992/99 Studium der Soziologie, Politik und Frauenforschung in Marburg, Frankfurt am Main, Pennsylvania, USA und Berlin, Abschluss Diplom-Soziologin. 1999/2000 wissenschaftliche Mitarbeiterin an der Freien Universität Berlin; 2000/03 Wissenschaftliche Beraterin in der PDS-Fraktion im Sächsischen Landtag; 2003/04 zunächst Redenschreiberin, dann Referentin für Verbraucherschutz im Bundesministerium für Verbraucherschutz, Ernährung und Landwirtschaft. Mitgl. Naturschutzbund BUND, ver.di, Volkssolidarität, VVN-BdA und attac. Seit 2004 Mitgl. der PDS, 2006/07 Mitgl. Parteivorst. der Linkspartei.PDS, seit 2007 Mitgl. Parteivorst. der Partei DIE LINKE, Mai 2010/Juni 2012 Bundesgeschäftsführerin und seit Juni 2012 stellv. Vors. DIE LINKE. 2004/09 Mitgl. des Sächsischen Landtags, dort stellv. Fraktionsvors. der Linksfraktion und Arbeitsmarktpolitische Sprecherin, 2007/09 Parlamentarische Geschäftsführerin der Fraktion DIE LINKE im Sächsischen Landtag. Englisch (f), Französisch (f). - MdB seit Okt. 2009; bis 2015 verbraucherpolitische Sprecherin der Fraktion DIE LINKE., seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE. und Leiterin Arbeitskreis "Struktur- und Regionalpolitik", seit 2016 Sprecherin für Mieten-, Bau- und Wohnungspolitik der Fraktion DIE LINKE.', 'Caren', '11004088');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08034, NULL, NULL, NULL, 'Geschäftsführerin', 'verheiratet, 1 Kind', '07.08.1961', NULL, 'Heidelberg', 'weiblich', NULL, '27.10.2009', 'Leidig', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Institut Solidarische Moderne e.V., Berlin, <br/>Mitglied des Vorstandes', 'Mittlere Reife. Ab 1979 Biologielaborantin im Dt. Krebsforschungszentrum, Jugendvertreterin, Personalrätin. Seit 1992 Jugendbildungsreferentin im DGB Baden-Württemberg. Ab 1996 Regionsvorsitzende DGB-Mittelbaden, 2002/09 Attac-Bundesgeschäftsführerin. Seit 2009 Mitgl. der Partei DIE LINKE., seit Mai 2016 Mitgl. im Parteivorst. Mitgl. attac, ver.di, ProAsyl, VVN-BDA, BUND, Gemeingut in BürgerInnenhand (G.i.B) e. V., Institut Solidarische Moderne (ISM) e. V., Pro Bahn e. V. - MdB seit Okt. 2009; verkehrspolitische Sprecherin der Fraktion DIE LINKE. und Koordinatorin Plan B für sozialökonomischen Umbau.', 'Sabine', '11004089');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08035, NULL, NULL, NULL, 'Gewerkschaftssekretär, Betriebswirt (VWA)', 'ledig, 1 Kind', '01.04.1965', NULL, 'Erfurt', 'männlich', NULL, '27.10.2009', 'Lemme', NULL, 'SPD', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Deutscher Gewerkschaftsbund, Berlin,<br/>Gewerkschaftssekretär, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>AOK Plus - Die Gesundheitskasse für Sachsen und Thüringen, Dresden,<br/>Mitglied des Verwaltungsrates<br/><br/>Thüringer Landesmedienanstalt (TLM), Erfurt,<br/>Mitglied des Vorstandes und der Versammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Medizinischer Dienst der Krankenversicherung Thüringen e.V. (MDK), Weimar,<br/>Mitglied des Verwaltungsrates<br/><br/>MOBIT e.V., Erfurt,<br/>Vorsitzender (bis 23.10.2014)<br/><br/>Volkssolidarität Bundesverband e.V., Berlin,<br/>Mitglied des Vorstandes und Leiter der Arbeitsgruppe Sozialpolitik', 'Polytechnische Oberschule Erfurt-Möbisburg. 1981/83 Ausbildung zum Kfz-Mechaniker. 2001/03 Studium an der Verwaltungsakademie, Abschluss Verwaltungs-Betriebswirt (VWA). 1990/09 Gewerkschaftssekretär beim DGB, zuständig für Jugend, Handwerk, Medien und Berufliche Bildung, 2004/06 DGB-Regionsvorsitzender, 2006/09 Landesvors. des DGB Thüringen und stellv. Bezirksvors. des DGB-Bezirks Hessen-Thüringen, Mitgl. MOBIT e. V., Mitgl. Verwaltungsrat der AOK PLUS, der Versammlung der Thüringer Landesmedienanstalt (TLM), Mitgl. im Bundesvorst. der Volkssolidarität, Mitgl. ver.di, Mitgl. VVN-BdA e. V., Mitgl. Ferienpark Feuerkuppe e. V., Mitgl. Freiwillige Feuerwehr Möbisburg e. V. Englisch (G), Russisch (G). - MdB seit Okt. 2009.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 189 (Eichsfeld - Nordhausen - Unstrut-Hainich-Kreis I)<br/>Wahlkreis 196 (Sonneberg - Saalfeld - Rudolstadt - Saale-Orla-Kreis)', 'Steffen-Claudio', '11004090');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08037, NULL, NULL, NULL, 'Werkzeugmacher, staatlich geprüfter Techniker für Maschinenbau', NULL, '09.05.1967', NULL, 'Apolda', 'männlich', NULL, '27.10.2009', 'Lenkert', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', '1973/83 Polytechnische Oberschule. 1983/86 Ausbildung als Werkzeugmacher bei Carl Zeiss Jena. 1986/88 Grundwehrdienst. 1991/95 Fernstudium, Abschluss als staatlich geprüfter Techniker für Maschinenbau. 1986/91 Werkzeugmacher bei Carl Zeiss Jena, 1991/96 Programmierer und Einrichter von CNC Fräsmaschinen bei der Firma Günther, 1996/99 stellv. Leiter der Musterfertigung Achsfedern bei Mubea Weißensee, 2000/02 Leiter der Qualitätssicherung bei Mubea-HZP, 2002/06 Technologe für Entwicklung, Vorserien und Serienanlauf für optische Produkte bei Carl Zeiss Jena, 2006/07 Technologe für Entwicklung, Vorserien und Serienanlauf, 2007/09 Leiter der Kleinserienmontage bei der Sypro Optics GmbH. 1983 Eintritt in die Gewerkschaft, Mitgl. der IG Metall, 2005/11 Initiator und Sprecher des Volksbegehrens "Für eine bessere Familienpolitik"; 2005 Mitgl. im Thüringer Landesförderverein Kindertagesstätten; seit 2007 Vorstandsmitgl., 2007 Mitbegründer des Betriebsrats der Sypro Optics GmbH. Seit 2010 Mitgl. "mehr Demokratie". Englisch (G). - MdB seit Okt. 2009; umweltpol. Sprecher und Sprecher für Forschungs- und Technologiepolitik der Fraktion DIE LINKE.', 'Ralph', '11004091');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08038, NULL, 'Dr.', 'Dr.', 'Bundesministerin der Verteidigung, Ärztin', 'verheiratet, 7 Kinder', '08.10.1958', NULL, 'Brüssel', 'weiblich', NULL, '27.10.2009', 'Leyen', NULL, 'CDU', 'von der', NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Christoph-Metzelder-Stiftung, Düsseldorf, <br/>Mitglied des Kuratoriums<br/><br/>Festliche Operngala Berlin, Berlin, <br/>Mitglied des Kuratoriums<br/><br/>Förderstiftung MHH PLUS, Hannover, <br/>Mitglied des Kuratoriums<br/><br/>Mädchenchor Hannover, Hannover, <br/>Mitglied des Kuratoriums<br/><br/>Stiftung Deutscher Spitzenpferdesport, Warendorf, <br/>Mitglied des Kuratoriums', '1964/71 Europäische Schule Brüssel, 1971/76 Mathematisch-naturwiss. Gymnasium Lehrte. 1977/80 Studium Volkswirtschaft in Göttingen und Münster, 1978 London School of Economics; 1980/87 Studium Medizin, Medizinische Hochschule Hannover (MHH), 1987 Staatsexamen und Approbation, 1991 Promotion, 2001 Magister Public Health (M.P.H.). 1988/92 Assistenzärztin Frauenklinik der MHH; 1992/96 Aufenthalt in Stanford, Californien/USA, 1993 Auditing guest Stanford University, Grad. School of Business, 1995 Marktanalyse, Stanford Health Services Hospital Administration; 1998/02 wiss. Mitarbeiterin MHH. Seit 1990 Mitgl. der CDU, 2001/04 kommunalpol. Mandate Region Hannover, seit Dez. 2004 Mitgl. Präsidium der CDU Deutschlands, seit Nov. 2010 stellv. Vors. der CDU Deutschlands. 2003/05 MdL Niedersachsen; 2003/05 Ministerin für Soziales, Frauen, Familie und Gesundheit in Niedersachsen. Englisch (f), Französisch (f). - MdB seit Okt. 2009; Nov. 2005/Nov. 2009 BMin. für Familie, Senioren, Frauen und Jugend, Nov. 2009/Dez. 2013 BMin. für Arbeit und Soziales, seit Dez. 2013 BMin. der Verteidigung.', 'Ursula', '11004092');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08041, NULL, NULL, NULL, 'Diplom-Betriebswirt', 'geschieden', '30.12.1972', NULL, 'Wismar', 'männlich', NULL, '27.10.2009', 'Liebich', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesstiftung zur Aufarbeitung der SED-Diktatur, Berlin,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Help - Hilfe zur Selbsthilfe e.V., Bonn, <br/>	Mitglied des Vorstandes<br/><br/>	Humanistischer Verband Deutschlands, Landesverband Berlin-Brandenburg e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich', '1991 Abitur an der Erweiterten Oberschule "Albert Einstein". 1992/95 Studium der Betriebswirtschaftslehre mit dem Schwerpunkt Wirtschaftsinformatik an der Technischen Fachhochschule Berlin, studienbegleitende Tätigkeit bei der IBM Deutschland GmbH. Mitgl. ver.di, ADFC, Solidaritätsdienst International (SODI), Verein "Helle Panke", der Gemeinschaft der Förderer von Zoo und Tierpark Berlin, Volkssolidarität, HELP-Hilfe zur Selbsthilfe e.V., Atlantik-Brücke e. V. und Verein für Pankow e. V. Seit 1990 Mitgl. der PDS, 1996 Wahl zum Bezirksvors. der PDS Marzahn, dort 1998 im Amt bestätigt, 1999 stellv. Landesvors. 2001/05 Landesvors. der PDS Berlin. 1995/09 Mitgl. des Abgeordnetenhauses von Berlin, dort in den Wissenschafts-, Wirtschafts-, Technologie-, Frauen-, Haushaltskontrollausschüssen sowie im Ausschuss für Jugend, dem Hauptausschuss und einer Enquetekommission; wirtschafts-, wissenschafts- und finanzpol. Sprecher der PDS-Fraktion, 2002/06 Vors. und 2006/09 stellv. Vors. der PDS-Fraktion im Berliner Abgeordnetenhaus. Englisch. - MdB seit Okt. 2009.', 'Stefan', '11004093');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08044, NULL, NULL, NULL, 'Dipl.-Ing. FH, Verwaltungsbetriebswirt', NULL, '12.03.1953', NULL, 'Zittau', 'männlich', NULL, '27.10.2009', 'Lietz', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Unternehmen: <br/>DRK-Blutspendedienst Mecklenburg-Vorpommern gemeinnützige GmbH, Neubrandenburg, <br/>Mitglied des Aufsichtsrates, ehrenamtlich', '1959/69 Polytechnische Oberschule. 1972/74 Grundwehrdienst. 1969/72 Berufsausbildung zum Betriebsschlosser mit Abitur. 1974/78 Studium des Allgemeinen Maschinen- und Fahrzeugbaus an der Ingenieur-Hochschule Zwickau, Abschluss Diplom-Ingenieur (FH), 1997/2000 Studium an der VWA Schwerin, Abschluss Verwaltungsbetriebswirt (VWA). 1979/92 Montage- und Abteilungsleiter im Landtechnischen Anlagenbau Rostock, Betriebsteil Wusterhusen, 1992/2006 Technischer Angestellter. Seit 1995 Mitgl. der CDU. 1990/92 Gemeindevorsteher im Seebad Lubmin, 1992/04 dort Bürgermeister, 1994/09 Mitgl. im Kreistag Ostvorpommern, 1999/09 Präsident des Kreistags; 2004/08 stellv. Vors. des Landkreistages Mecklenburg-Vorpommerns, 2008/09 Vors.; 2006/09 Mitgl. des Landtages von Mecklenburg-Vorpommern, dort Vors. Ausschuss für Landwirtschaft, Umwelt und Verbraucherschutz und Sprecher der CDU-Fraktion für Kommunal- und Umweltpolitik. Englisch (G), Russisch (G). - MdB seit Okt. 2009.', 'Matthias', '11004094');
