INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08047, NULL, NULL, NULL, 'MdB, Generalsekretär FDP', 'ledig', '07.01.1979', NULL, 'Wuppertal', 'männlich', NULL, '27.10.2009', 'Lindner', NULL, 'FDP', NULL, 'katholisch', NULL, NULL, NULL, 'Christian', '11004097');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08050, NULL, 'Dr.', 'Dr.', 'Diplom-Volkswirt', 'verheiratet', '10.08.1977', NULL, 'Paderborn', 'männlich', NULL, '27.10.2009', 'Linnemann', NULL, 'CDU', NULL, 'katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Universität Paderborn, Paderborn, <br/>Mitglied des Beirates des Kompetenzzentrums für Nachhaltige Energietechnik<br/>Mitglied des Beirates des Institutes für Leichtbau mit Hybridsystemen<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>SC Paderborn 07 e.V., Paderborn,<br/>Mitglied des Aufsichtsrates<br/><br/>Stiftung LEBENSlauf, Büren/Paderborn, <br/>Vorsitzender', '1997 Abitur, Paderborn. 1997/98 Wehrdienst, Augustdorf. 1998 Angestellter in einem mittelständischen Unternehmen (Buchhandel), Paderborn. 1999/02 Studium der Betriebswirtschaftslehre, FHDW Paderborn, Abschluss Dipl.-Kaufmann (FH). 2002/06 Promotionsstudium der Volkswirtschaftslehre, TU Chemnitz, Abschluss Dr. rer. pol. Diplom-Volkswirt. 2003/04 wiss. Mitarbeiter und Lehrbeauftragter am Lehrstuhl für Makroökonomie, TU Chemnitz. 2006/07 Assistent des Chefökonomen der Deutschen Bank, Prof. Norbert Walter, und Volkswirt bei Deutsche Bank Research, Frankfurt. 2007/09 Volkswirt bei der IKB Deutsche Industriebank, Bereich Konjunktur und Mittelstand, Düsseldorf. 2004/08 Mitgl. Rat der Gemeinde Altenbeken. Seit 2009 Mitgl. im Vorstand des Parlamentskreis Mittelstand. Seit 2009 Mitgl. im Bundesvorst. der Mittelstands- und Wirtschaftsvereinigung der CDU/CSU, seit 2013 dessen Bundesvors., damit Mitgl. im Bundesvorst. der CDU Deutschlands. Seit 2010 Gründer und Vors. der Stiftung Lebenslauf. - MdB seit Okt. 2009.', 'Carsten', '11004098');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08051, NULL, NULL, NULL, 'Notar, Sprecher für Recht und Verbraucherschutz, Obmann im Parlamentarischen Kontrollgremium, Staatssekretär a. D.', 'verheiratet, 2 Kinder', '01.02.1965', NULL, 'Marsberg', 'männlich', NULL, '27.10.2009', 'Lischka', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Gesellschaft zur Durchführung der Magdeburger Weihnachtsmärkte mbH, Magdeburg, <br/>	Mitglied der Gesellschafterversammlung, ehrenamtlich<br/><br/>	Magdeburger Hafen GmbH, Magdeburg, <br/>	Mitglied des Aufsichtsrates (bis 10.07.2014)<br/><br/>	Wohnungsbaugesellschaft Magdeburg mbH, Magdeburg, <br/>	Mitglied der Gesellschafterversammlung, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Magdeburg, Magdeburg, <br/>	Mitglied des Stadtrates, ehrenamtlich<br/><br/>	Volkshochschule Magdeburg, Magdeburg, <br/>	Vorsitzender des Beirates, ehrenamtlich (bis 10.07.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Literaturhaus Magdeburg, Magdeburg, <br/>	Stellv. Vorsitzender, ehrenamtlich<br/><br/>	Magdeburger Bündnis 50Plus, Magdeburg, <br/>	Vorsitzender, ehrenamtlich', 'Abitur. Zivildienst. Studium der Rechtswissenschaften, erstes juristisches Staatsexamen, Rechtsreferendariat am Landgericht Paderborn, 1995 zweites juristisches Staatsexamen. Notarassessor. 1998 Geschäftsführer der Notarkammer Sachsen-Anhalt. 2006 bis Oktober 2009 Staatssekretär im Ministerium für Justiz des Landes Sachsen-Anhalt. Seit 1989 Mitgl. der SPD, seit 2006 Mitgl. im Landesvorst. und seit April 2016 Vors. der SPD Sachsen-Anhalt. Seit 2004 Stadtrat in Magdeburg. - MdB seit Okt. 2009; seit Mai 2011 rechtspol. Sprecher der SPD-Fraktion, seit Okt. 2011 Mitgl. im Vorst. der SPD-Fraktion, bis Sept. 2014 Sprecher der SPD-Fraktion für Recht und Verbraucherschutz, seit Sept. 2014 innenpolitischer Sprecher; seit 2014 Obmann der SPD-Fraktion im PKGr.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 68 (Harz)<br/>Wahlkreis 71 (Anhalt)', 'Burkhard', '11004099');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08054, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'ledig', '02.10.1975', NULL, 'Berlin', 'männlich', NULL, '27.10.2009', 'Luczak', NULL, 'CDU', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Luma Hausverwaltung Jan-Marco Luczak, Berlin, <br/>	Hausverwalter<br/>	<br/>Rechtsanwälte Hengeler Mueller, Berlin, <br/>	Rechtsanwalt, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas,<br/>	Telekommunikation, Post und Eisenbahnen, Bonn, <br/>	Stellv. Mitglied des Beirates<br/>	<br/>Deutschlandradio, Köln, <br/>	Mitglied des Hörfunkrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesstiftung Magnus Hirschfeld, Berlin, <br/>	Mitglied des Kuratoriums', '1995 Abitur am Ulrich-von-Hutten-Gymnasium Berlin-Lichtenrade. Nov. 1992/Juni 1993 Besuch des Hurstpierpoint College in England. 1995/96 Grundwehrdienst im Jägerbataillon 581, Scharfschützenausbildung, März 1999 Unteroffizierslehrgang der Reserve. Studium der Rechtswissenschaften Freie Universität Berlin, 2002 erstes jur. Staatsexamen, 2008 zweites jur. Staatsexamen. 2008 Promotion an der Ludwig-Maximilians-Universität München im Europäischen Wirtschaftsverfassungsrecht. Seit 2008 Rechtsanwalt in der internationalen Wirtschaftskanzlei Hengeler Mueller. U. a. (Alt-) Stipendiat der Konrad-Adenauer-Stiftung, Mitgl. Kuratorium der Magnus-Hirschfeld-Stiftung, Mitgl. Deutschlandradio-Hörfunkrat, Mitgl. Bürgerinitiative Dresdner Bahn e. V. Seit 1998 Mitgl. der CDU, seit 2006 Vors. der CDU Lichtenrade, seit 2007 stellv. Kreisvors. der CDU Tempelhof-Schöneberg. Englisch (f), Französisch (G). - MdB seit Okt. 2009; Obmann der CDU/CSU-Fraktion im Ausschuss für Recht und Verbraucherschutz.', 'Jan-Marco', '11004100');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08055, NULL, NULL, NULL, 'Polizeibeamtin', 'verheiratet, 3 Kinder', '28.04.1964', NULL, 'Oldenburg (Oldb.)', 'weiblich', NULL, '27.10.2009', 'Lühmann', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>BTA Betriebs- und Anlagegesellschaft mbH, Berlin, <br/>	Mitglied des Aufsichtsrates, jährlich, Stufe 4<br/><br/>	Deutsche Bahn AG, Berlin, <br/>	Mitglied des Aufsichtsrates, 2015, Stufe 3<br/><br/>	DFS Deutsche Flugsicherung GmbH, Langen, <br/>	Mitglied des Beirates<br/><br/>	Nürnberger Beamten Lebensversicherung AG, Nürnberg, <br/>	Mitglied des Aufsichtsrates, jährlich, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Celle, Celle, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Berliner Republik e.V., Berlin, <br/>	Vorsitzende<br/><br/>	dbb - Deutscher Beamtenbund und Tarifunion, Berlin, <br/>	Stellv. Bundesvorsitzende, monatlich, Stufe 1', '1983 Abitur. 1999/02 Studium zum Aufstieg in den gehobenen Polizeidienst, Diplomverwaltungswirtin (FH). Schutzpolizistin im Dienst des Landes Niedersachsen. Mitgl. im Volksbund Dt. Kriegsgräberfürsorge, in der AWO. Seit 1983 Mitgl. der DPolG; stellv. Bundesvors. des Dt. Beamtenbundes und Tarifunion, Mitgl. in der Intern. Association of Women Police (IAWP) und im Europ. Network of Women Police (ENP), Vors. Fachkommission "Rechte der Frau und Gleichstellung der Geschlechter" und Mitgl. Fachkommission "Beschäftigung und soziale Angelegenheiten" der Confédération Européenne des Syndicats Indépendent (CESI). Mitgl. der SPD, stellv. Vors. Unterbezirk Celle. Mitgl. im Kreistag Celle. Englisch (f), Französisch (f). - MdB seit Okt. 2009.', 'Kirsten', '11004101');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08056, NULL, NULL, NULL, 'Unternehmensberater', 'verheiratet, 2 Kinder', '09.10.1979', NULL, 'Saarbrücken', 'männlich', NULL, '27.10.2009', 'Luksic', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Oliver', '11004102');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08057, NULL, NULL, NULL, 'Angestellter', 'verheiratet', '23.08.1969', NULL, 'Elsterwerda', 'männlich', NULL, '27.10.2009', 'Lutze', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', '1986 Abschluss der allgemeinbildenden Oberschule. 1989 Abschluss Berufsausbildung Maschinenbauer mit Abitur in einer Leipziger Gießerei. 1991/95 Studium an der Universität des Saarlandes (Konstruktions- und Fertigungstechnik). 2003/05 betriebliche Umschulung in einem Saarbrücker Einrichtungshaus zum Bürokaufmann (IHK). Nach der Berufsausbildung Weiterbeschäftigung als Reparaturschlosser, 1990/91 Montageschlosser bei einer Leiharbeitsfirma. 1995/02 Regionalbüromitarbeiter der PDS-Bundestagsfraktion in Saarbrücken und ab 2005 Wahlkreismitarbeiter von Oskar Lafontaine in Saarlouis. Mitgl. ver.di, im Beirat der Aktion 3. Welt Saar, im Vorstand der Peter-Imandt-Gesellschaft, der Gesellschaft für nachwachsende Rohstoffe und im ADFC. Bis 1994 parteilos, aber nicht unpolitisch, seit März 1995 Mitgl. der PDS, heute DIE LINKE. - MdB seit Okt. 2009.', 'Thomas', '11004103');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08060, NULL, NULL, NULL, 'Juristin', 'verheiratet', '13.06.1962', NULL, 'Stuttgart', 'weiblich', NULL, '27.10.2009', 'Maag', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>		Berlin-Chemie AG, Berlin, <br/>	Vortrag und Podiumsdiskussion, 2015, Stufe 1 (bcc-Kongress "Apple, Google & Co: Wie die 	zunehmende Digitalisierung Ihren Praxisalltag verändern wird")<br/><br/>Funktionen in Unternehmen: <br/>Barmenia Krankenversicherungen a.G., Wuppertal,<br/>Mitglied des Beirates<br/><br/>PANTHER AG, München,<br/>Mitglied des Aufsichtsrates (bis 30.11.2016)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin, <br/>	Mitglied des Kuratoriums<br/><br/>	Stiftung Bundespräsident Theodor-Heuss-Haus, Stuttgart, <br/>	Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband Herzkranke Kinder e.V. (BVHK), Aachen, <br/>	Mitglied des Beirates<br/><br/>	Stuttgarter Haus- und Grundbesitzerverein e.V., Stuttgart, <br/>	Mitglied des Beirates', 'Ev. Mörike-Gymnasium Stuttgart, Abitur. Bis 1990 Studium Rechtswissenschaften. 1990/91 Rechtsanwältin, Stuttgart. 1991/03 Verwaltung Landeshauptstadt Stuttgart, zuletzt 2003/07 Leiterin Oberbürgermeisterbüro, Stadtdirektorin; 2007/09 Abteilungsleiterin im Landtag von Baden-Württemberg, Ministerialdirigentin. 2001/03 hauptamtl. Beisitzerin an der Vergabekammer des Landes Baden-Württemberg.  - MdB seit Okt. 2009; Vors. der Gruppe der Frauen der CDU/CSU-Fraktion, Vors. der Deutsch-Ägyptischen Parlamentariergruppe.', 'Karin', '11004104');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08063, NULL, 'Dr.', 'Dr.', 'Bundesminister des Innern, Jurist', 'verheiratet, 3 Kinder', '21.01.1954', NULL, 'Bonn', 'männlich', NULL, '27.10.2009', 'Maizière', NULL, 'CDU', 'de', 'evangelisch-lutherisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Lutherdekade, Wittenberg, <br/>Mitglied des Kuratoriums zur Vorbereitung des Reformationsjubiläums 2017<br/><br/>Stiftung Denkmal für die ermordeten Juden Europas, Berlin, <br/>Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Behindertensportverband e.V. (DBS), Bonn, <br/>Mitglied des Kuratoriums<br/><br/>Deutscher Evangelischer Kirchentag, Fulda, <br/>Mitglied des Präsidiums<br/><br/>Moritzburg Kammermusikfestival, Dresden, <br/>Mitglied des Kuratoriums<br/><br/>Stiftung Deutsche Sporthilfe, Frankfurt/Main, <br/>Mitglied des Kuratoriums und Mitglied des Aufsichtsrates<br/><br/>Stiftung Deutsches Forum für Kriminalprävention, Bonn, <br/>Mitglied des Kuratoriums', '1972 Abitur. Wehrdienst. 1974/79 Studium Rechtswissenschaften und Geschichte in Münster und Freiburg, Referendarexamen; 1982 Assessorexamen; 1986 Promotion zum Dr. jur. an der Univ. Münster. 1983 Mitarbeiter der Reg. Bürgermeister von Berlin, von Weizsäcker und Diepgen, 1985/89 Leiter Grundsatzreferat der Senatskanzlei des Landes Berlin; Pressesprecher der CDU-Fraktion im Berliner Abgeordnetenhaus; 1990 Mitaufbau des Amtes des Ministerpräsidenten der letzten DDR-Regierung, Mitgl. Verhandlungsdelegation für den Einigungsvertrag; 1990/94 Staatssekretär im Kultusministerium Mecklenburg-Vorpommern, 1994/98 Chef der Staatskanzlei in Mecklenburg-Vorpommern; 1999 Berater und ab Okt. 1999 Staatsminister und Chef der Sächsischen Staatskanzlei, 2001/02 Staatsminister der Finanzen in Sachsen, 2002/04 Staatsminister der Justiz in Sachsen, 2004/05 Staatsminister des Innern in Sachsen. 2004 bis 2005 MdL in Sachsen. Seit Sept. 2003 Mitgl. Landesvorst. CDU Sachsen, seit Dezember 2012 Mitglied des Bundesvorstands der CDU Deutschlands. Seit Okt. 2010 Honorarprof. für Staatsrecht an der TU Dresden. - MdB seit Okt. 2009; Nov.2005/Okt. 2009 BMin. für besondere Aufgaben und Chef des Bundeskanzleramtes, März 2011/Dez. 2013 BMin. der Verteidigung, Okt. 2009/März 2011 und seit Dez. 2013 BMin. des Innern.', 'Thomas', '11004105');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08064, NULL, NULL, NULL, 'Studentin', 'verheiratet', '08.02.1985', NULL, 'Liegnitz', 'weiblich', NULL, '03.12.2011', 'Brugger', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		Bundesakademie für Sicherheitspolitik (BAKS), Berlin, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Experiment e.V., Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Heinrich-Böll-Stiftung e.V., Berlin, <br/>	Mitglied des Fachbeirates "Europa/Transatlantik", ehrenamtlich<br/><br/>	Institut für Friedensforschung und Sicherheitspolitik<br/>	an der Universität Hamburg (IFSH), Hamburg, <br/>	Mitglied der Kommission "Europäische Sicherheit und<br/>	Zukunft der Bundeswehr", ehrenamtlich<br/><br/>	Treuhänderische Stiftung zur Unterstützung besonderer Härtefälle<br/>	in der Bundeswehr und der ehemaligen NVA (Härtefall-Stiftung), Bonn, <br/>	Mitglied des Beirates, ehrenamtlich (bis 06.05.2014)', 'Juni 2004 Abitur am Mallinckrodt Gymnasium in Dortmund. Seit 2004 Magisterstudium der Politikwissenschaft, des Öffentlichen Rechts und der Philosophie an der Eberhard-Karls-Univ. in Tübingen, 2006/10 Stipendiatin der Heinrich-Böll-Stiftung. 2005/07 Mitgl. des Allgemeinen Studierendenausschusses (AStA) an der Univ. Tübingen, 2005/06 stellv. Vors. des AStA, 2006/07 Mitgl. des Senates der Universität Tübingen. 2005/08 Mitgl. im Kreisvorst. Tübingen, 2007/09 Landesvorsitzende der GRÜNEN JUGEND Baden-Württemberg, 2009/15 Mitgl. im Landesvorst. von BÜNDNIS 90/DIE GRÜNEN Baden-Württemberg. Seit Sept. 2015 Mitgl. im 7. Beirat der Bundesakademie für Sicherheitspolitik (BAKS). - MdB seit Okt. 2009; in der 17. WP Sprecherin für Abrüstung; in der 18. WP Sprecherin für Sicherheitspolitik und Abrüstung der Fraktion Bündnis 90/Die Grünen, Obfrau im Verteidigungsausschuss und Unterausschuss Abrüstung, Rüstungskontrolle und Nichtverbreitung.', 'Agnieszka', '11004106');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08066, NULL, NULL, NULL, 'Landwirt', 'verheiratet, 4 Kinder', '08.04.1961', NULL, 'Heidelberg', 'männlich', NULL, '27.10.2009', 'Marwitz', NULL, 'CDU', 'von der', 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Landwirt, Vierlinden<br/>	Vertragspartner 01, 2013, Stufe 5; 2014, Stufe 9<br/>	Vertragspartner 02, 2013, Stufe 5; 2014, Stufe 8<br/>	Vertragspartner 03, 2013, Stufe 5; 2014, Stufe 6<br/>	Vertragspartner 04, 2013, Stufe 3; 2014, Stufe 3<br/>	Vertragspartner 05, 2013, Stufe 3<br/>	Vertragspartner 08, 2014, Stufe 8<br/>	Vertragspartner 09, 2014, Stufe 2<br/>	Vertragspartner 14, 2014, Stufe 1<br/>	Vertragspartner 15, 2014, Stufe 1<br/>	Vertragspartner 16, 2014, Stufe 3<br/>	Vertragspartner 17, 2014, Stufe 3<br/>	Vertragspartner 18, 2014, Stufe 3<br/><br/>	Friedersdorfer Ackerbau GbR, Vierlinden, <br/>	Landwirt/Geschäftsführer, 2014, Stufe 8, Gewinn<br/>	Vertragspartner 10, 2013; 2014<br/>	Vertragspartner 11, 2013; 2014<br/>	Vertragspartner 12, 2014<br/>	Vertragspartner 13, 2014<br/>	Vertragspartner 19, 2014<br/>	Vertragspartner 20, 2014<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Domkapitel Brandenburg, Brandenburg, <br/>	Domherr<br/><br/>	Gemeinde Vierlinden, Vierlinden, <br/>	Mitglied des Gemeinderates<br/><br/>	Landkreis Märkisch-Oderland, Seelow, <br/>	Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Johanniterorden, Sektion Berlin-Brandenburg, Berlin, <br/>Mitglied des Konventes<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Dorfgut Friedersdorf GmbH & Co. KG, Vierlinden<br/><br/>	FLG Friedersdorfer Landwirtschafts-GmbH, Vierlinden<br/><br/>	Friedersdorfer Ackerbau GbR, Vierlinden', 'Abschluss Fachoberschule. Wehrdienst. Bis 1985 Ausbildung staatl. gepr. Landwirt. 1986 Übernahme Familienbetrieb im Allgäu, ab 1990 Aufbau und Betrieb von landwirtsch. Unternehmen in Friedersdorf bei Seelow, Geschäftsführer der Dorfgut Friedersdorf GmbH & Co. KG. Seit 2010 Ländervors. Evangelischer Arbeitskreis (EAK) Berlin-Brandenburg, Gemeindekirchenrat Friedersdorf, seit 1988 Mitgl. Johanniterorden, seit 1998 Vorstandsmitgl. Sektion Berlin/Brandenburg; Domherr Domkapitel Brandenburg; u. a. Mitgl. Freundeskreis Friedersdorf e. V., Rotary Frankfurt (Oder), Grundbesitzerverband, Dt. Landwirtschaftsgesellsch., Fördergesellsch. Albrecht Daniel Thaer, Bioland Brandenburg, Bauernbund. Seit 2002 Mitgl. der CDU Märkisch-Oderland, 2010/14 Kreisvors. der CDU Märkisch-Oderland. 1990 Mitgl. Gemeindevertretung Missen/Allgäu, 1993/03 Mitgl. Gemeinderat Friedersdorf, seit 2003 Mitgl. Gemeindevertretung Vierlinden, seit 1998 Mitgl. CDU-Fraktion Kreistag Märkisch-Oderland. - MdB seit Okt. 2009.', 'Hans-Georg', '11004107');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08067, NULL, NULL, NULL, 'Industriekaufmann, Bürgermeister', 'verheiratet, 2 Kinder', '28.09.1969', NULL, 'Verden (Aller)', 'männlich', NULL, '27.10.2009', 'Mattfeldt', NULL, 'CDU', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Königlich Preussische Biermanufaktur GmbH, Berlin,<br/>Geschäftsführer<br/><br/>Quint Nord Vertriebs- und Beratungs GmbH, Langwedel,<br/>Geschäftsführer, monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>EWE AG, Oldenburg, <br/>Stellv. Mitglied der Verbandsversammlung, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Verden, Verden,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Königlich Preussische Biermanufaktur GmbH, Berlin<br/><br/>Quint Nord Vertriebs- und Beratungs GmbH, Langwedel', '1989 Abitur. 1992 Berufsausbildung Industriekaufmann bei der Fa. Buss GmbH & Co. KG, Ottersberg. 1992/01 Leitender Angestellter in der Lebensmittelindustrie. 2001/09 hauptamtl. Bürgermeister Gemeinde Langwedel. 2001/09 Kreisvors. Niedersächs. Städte- und Gemeindebund, 2005/10 Vors. Etelser Schlossparkverein, 2006/13 Mitgl. Beirat der Stiftung Waldheim, Einrichtung für geistig behinderte Menschen, 2005/11 Mitgl. Verwaltungsrat der ALV (Arbeit im Landkreis Verden), stellv. Mitgl. EWE-Verbandsversammlung der EWE AG, Oldenburg. Seit 1990 Mitgl. der CDU, Mitgl. CDU-Bezirksvorst. 1991/09 Mitgl. Gemeinderat des Flecken Langwedel, 1996/01 Mitgl. Ortsrat Völkersen und stellv. Ortsbürgermeister, seit Nov. 2011 Mitgl. Kreistag Verden, Mitgl. Kreisausschuss. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2009.', 'Andreas', '11004108');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08069, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'verheiratet, 1 Kind', '18.06.1954', NULL, 'Witzenhausen', 'männlich', NULL, '27.10.2009', 'Meßmer', NULL, 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Ullrich', '11004109');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08071, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', NULL, '14.12.1964', NULL, 'Osnabrück', 'männlich', NULL, '27.10.2009', 'Middelberg', NULL, 'CDU', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Abitur am Carolinum. Jurastudium und Referendariat in Osnabrück, Bonn und Speyer. 1993 Rechtsanwalt. 1994/96 Syndikus PreussenElektra (E.ON Energie) AG, Hannover. 1997/2000 Büroleiter des Bremer Wirtschaftssenators und Aufsichtsratsvorsitzenden der Deutschen Post AG. 2001/02 Promotion zum Dr. iur. 2002/04 Leiter Unternehmensentwicklung Mitteldeutsche Flughafen AG, Leipzig. 2004/05 Beteiligungsmanager EWE AG, Oldenburg. 2005/09 Leiter Ressortkoordinierung Wirtschaft, Arbeit und Verkehr, Niedersächs. Staatskanzlei. Seit 1983 Mitgl. CDU, Vors. CDU-Bezirksverband Osnabrück-Emsland. - MdB seit Okt. 2009; stellv. Vors. Parlamentskreis Mittelstand der CDU/CSU-Fraktion, Vors. der Landesgruppe Niedersachsen.', 'Mathias', '11004110');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08072, NULL, NULL, NULL, 'Diplom-Sozialökonomin', 'verheiratet, 1 Kind', '09.01.1960', NULL, 'Hamburg-Altona', 'weiblich', NULL, '27.10.2009', 'Möhring', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Ausbildung Industriekauffrau. Über 2. Bildungsweg Studium an der Hochschule für Wirtschaft und Politik, Schwerpunkte Organisationssoziologie und Sozialpsychologie, Aufbaustudium Sozialökonomie mit Schwerpunkt "Feministische" Forschung und Frauenarbeit. Selbständige Beraterin für Betriebs- und Personalräte. Seit Juni 2007 Mitgl. der Partei DIE LINKE. - MdB seit Okt. 2009; 2009/11 und wieder seit Okt. 2013 frauenpolitische Sprecherin, Nov. 2011/Okt. 2013 1. stellv. Vors. und erneut seit Okt. 2013 stellv. Vors. der Fraktion DIE LINKE, seit 2014 stellv. Vors. Ausschuss für Familie, Senioren, Frauen und Jugend.', 'Cornelia', '11004111');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08073, NULL, NULL, NULL, 'PR-Journalistin', 'verheiratet, 2 Kinder', '01.04.1962', NULL, 'Köln', 'weiblich', NULL, '27.10.2009', 'Molitor', NULL, 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Gabriele', '11004112');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08076, NULL, NULL, NULL, 'Rechtsanwalt', '4 Kinder', '15.09.1957', NULL, 'Bochum', 'männlich', NULL, '27.10.2009', 'Monstadt', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Rechtsanwälte Klostermann, Dr. Schmidt, Monstadt, Dr. Eisbrecher, Schwerin, Rostock, Bochum, <br/>	Rechtsanwalt, monatlich, Stufe 1, Gewinn<br/>	Mandant 01, 2013; 2014; 2015<br/>	Mandant 02, 2013<br/>	Mandant 03, 2013; 2014<br/>	Mandant 04, 2013; 2014; 2015<br/>	Mandant 05, 2013; 2014; 2015<br/>	Mandant 07, 2013; 2014; 2015<br/>	Mandant 08, 2013; 2014<br/>	Mandant 09, 2013; 2014; 2015<br/>	Mandant 10, 2013<br/>	Mandant 11, 2013; 2014<br/>	Mandant 12, 2013<br/>	Mandant 13, 2013<br/>	Mandant 14, 2013; 2014<br/>	Mandant 15, 2013; 2014<br/>	Mandant 16, 2014; 2015<br/>	Mandant 17, 2014; 2015<br/>	Mandant 18, 2014; 2015<br/>	Mandant 19, 2014; 2015<br/>	Mandant 20, 2014; 2015<br/>	Mandant 21, 2014<br/>	Mandant 22, 2014<br/>	Mandant 23, 2015<br/>	Mandant 24, 2015<br/>	Mandant 25, 2015<br/>	Mandant 26, 2015<br/>	Mandant 27, 2015<br/>	Mandant 28, 2015<br/><br/>Funktionen in Unternehmen: <br/>	Mecklenburgisches Staatstheater Schwerin gemeinnützige GmbH, Schwerin, <br/>	Mitglied des Aufsichtsrates (bis Juni 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutscher Diabetiker Bund, Landesverband Mecklenburg-Vorpommern, Schwerin, <br/>	Vorsitzender, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Rechtsanwälte Klostermann, Dr. Schmidt, Monstadt, Dr. Eisbrecher GbR, Schwerin, Rostock, Bochum<br/><br/>	Redini Beteiligungs GmbH, Schwerin', 'Ausbildung mit Abitur. Grundwehrdienst. Ab 1979 Studium Rechtswiss. und Wirtschaftswiss. Univ. Bochum; Unterbrechung Studiums und Leitung elterlicher bäuerl. Betrieb; 1984 Fortsetzung Studium u. a. an der Hochschule für Verwaltungswiss. Speyer, Abschluss 1. und 2. jur. Staatsexamen. 1986 Eintritt Kanzlei Klostermann und Schmidt in Bochum. Seit 1991 Rechtsanwalt und Seniorpartner Rechtsanwaltskanzlei Klostermann Dr. Schmidt Monstadt Dr. Eisbrecher, Schwerin und Rostock. Mitgl. freiw. Feuerwehr, Kreisjagdverb., versch. Sport- und Schützenvereine. Seit 1996 Mitgl. der CDU, seit 1998 Mitgl. CDU-Kreisvorst., seit 2011 Schatzmeister CDU Mecklenburg-Vorpommern; seit 1994 Mitgl. MIT, Vors. MIT-Kreisverband Nordwestmecklenburg, seit 2009 Vors. MIT der CDU M-V; seit 2006 Vorstand EAK der CDU M-V. - MdB seit Okt. 2009, seit 2014 Mitgl. Vorstand Parlamentskreis Mittelstand (PKM).', 'Dietrich', '11004113');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08077, NULL, NULL, NULL, 'Diplom-Jurist', 'verheiratet', '22.08.1984', NULL, 'Wuppertal', 'männlich', NULL, '27.10.2009', 'Movassat', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn, Eschborn, <br/>Mitglied des Kuratoriums, ehrenamtlich', 'Juni 2004 Hochschulreife. Ab Okt. 2004 Studium Rechtswissenschaften Heinrich-Heine-Univ. Düsseldorf, April 2009 Abschluss 1. Staatsexamen. Seit April 2009 Dipl.-Jurist. Juni 2000 Eintritt in den Jugendverband [''solid] - die sozialistische Jugend, 2002/05 Landessprecher [''solid] NRW. Seit Aug. 2000 Mitgl. der PDS, jetzt DIE LINKE, 2003/07 Mitgl. Landesvorst. PDS NRW/Linkspartei.PDS NRW als jugendpolitischer Sprecher, 2006/07 Kreisvorstandsmitgl. Linkspartei.PDS Oberhausen, 2007/08 Mitgl. Landesvorst. DIE LINKE. NRW und zuständig für Inneres, Justiz und Jugend, 2008/10 Mitgl. Parteivorst. DIE LINKE. als jugendpolitischer Sprecher. 2007/09 Bezirksvertreter in Oberhausen-Sterkrade. - MdB seit Okt. 2009; Obmann der Fraktion DIE LINKE im Ausschuss für wirtschaftliche Zusammenarbeit und Entwicklung, Sprecher für Welternährung der Fraktion DIE LINKE.', 'Niema', '11004114');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08078, NULL, NULL, NULL, 'Architektin', 'ledig', '01.05.1960', NULL, 'Jülich', 'weiblich', NULL, '27.10.2009', 'Müller', '(Aachen)', 'FDP', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Petra', '11004115');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08081, NULL, NULL, NULL, 'Diplom-Juristin, MdB', 'verheiratet, 2 Kinder', '05.06.1983', NULL, 'Lebach', 'weiblich', NULL, '24.07.2010', 'Schön', '(St. Wendel)', 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Initiative Sicherer Landkreis St. Wendel e.V., St. Wendel, <br/>Vorsitzende, ehrenamtlich<br/><br/>Jochen-Rausch-Zentrum St. Wendel e.V., St. Wendel, <br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Stefan-Morsch-Stiftung, Birkenfeld/Nahe, <br/>Mitglied des Kuratoriums, ehrenamtlich', '2002 Abitur am Arnold-Janssen-Gymnasium St. Wendel. 2002/06 Studium der Rechtswissenschaften an den Univ. in Heidelberg und Saarbrücken. 2006 1. jur. Staatsexamen; 2002/06 studienbegleitende journalistische Ausbildung im Rahmen eines Stipendiums der Konrad-Adenauer-Stiftung. 2004/09 Mitgl. Saarländischer Landtag. Seit 2010 Vors. CDU-Gemeindeverband Tholey, seit 2013 Beisitzerin Bundesvorst. der Frauen Union. Seit 2006 Vors. Initiative Sicherer Landkreis St. Wendel e. V., seit 2006 2. Vors. Jochen-Rausch-Zentrum e. V., seit 2011 Mitgl. Kuratorium der Stefan-Morsch-Stiftung, seit 2014 Beirat Bundesnetzagentur. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit Jan. 2014 stellv. Vors. der CDU/CSU-Fraktion für die Bereiche Familie, Senioren, Frauen, und Jugend sowie Digitale Agenda.', 'Nadine', '11004116');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08082, NULL, NULL, NULL, 'Diplom-Sozialpädagogin', 'verheiratet, 2 Kinder', '07.10.1960', NULL, 'Frankfurt am Main', 'weiblich', NULL, '27.10.2009', 'Müller-Gemmeke', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Pliezhausen, Pliezhausen, <br/>	Mitglied des Gemeinderates, ehrenamtlich (bis 22.07.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Förderverein Offene Jugendarbeit Pliezhausen e.V., Pliezhausen, <br/>	Vorsitzende, ehrenamtlich', '1979/82 Ausbildung Erzieherin in Tübingen. 1982 Anerkennungsjahr Tübinger Verein für Sozialtherapie. 1984/88 Studium, Abschl. Dipl.-Sozialpädagogin (FH) in Reutlingen. 1983 Anna Catharina, heilpäd. Jugendheim zur See, Spanien; 1986/90 Mitarbeiterin Talheimer Verlag Mössingen; 1990/96 Familienzeit; 1997/02 Kreisgeschäftsführerin BÜNDNIS 90/DIE GRÜNEN Reutlingen. Seit 2002 selbst. Sozialpädagogin, Projektmanagement und ESF-Begleitung. Seit 2003 1. Vors. Förderverein offene Jugendarbeit in Pliezhausen. Mitgl. ver.di. Seit 1997 Mitgl. bei BÜNDNIS 90/DIE GRÜNEN, seit 1998 Mitgl. Vorst. Kreisverb. Reutlingen, 2002/09 Basisvertreterin Bundesfinanzrat, 2003/09 und seit 2015 Mitgl. Landesvorst. BÜNDNIS 90/DIE GRÜNEN Baden-Württemberg, 2007/09 Mitgl. Sprecherteam LAG Wirtschaft, Finanzen und Soziales; seit 2003 Mitgl. und 2009 Sprecherin GewerkschaftsGrün. 1994 bis 2014 Gemeinderätin in Pliezhausen, 2004/09 Kreisrätin im Landkreis Reutlingen. - MdB seit Okt. 2009.', 'Beate', '11004117');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08085, NULL, 'Dr.', 'Dr.', 'Geschäftsführender Gesellschafter', 'verheiratet, 4 Kinder', '15.05.1964', NULL, 'Kiel', 'männlich', NULL, '27.10.2009', 'Murmann', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Zöllner Holding GmbH, Kiel, <br/>	Geschäftsführer, monatlich, Stufe 2 (bis Juni 2015);<br/>	monatlich, Stufe 3 (ab Juli 2015)<br/><br/>Funktionen in Unternehmen: <br/>PEKU Folien GmbH, Neumarkt i.d. Oberpfalz, <br/>	Vorsitzender des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Helmholtz-Zentrum für Ozeanforschung Kiel (GEOMAR), Kiel, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Industrie- und Handelskammer zu Kiel, Kiel, <br/>	Mitglied der Vollversammlung, ehrenamtlich<br/><br/>	Leibniz-Institut für die Pädagogik der Naturwissenschaften und<br/>	Mathematik, Kiel, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Arbeitsgemeinschaft industrieller Forschungsvereinigungen<br/>	"Otto von Guericke" e.V. (AiF), Köln, <br/>	Mitglied des Senats, ehrenamtlich<br/><br/>	Förderverein der Technischen Fakultät der<br/>	Christian-Albrechts-Universität zu Kiel, Kiel, <br/>	Vorsitzender, ehrenamtlich<br/><br/>	Forschungsforum Schleswig-Holstein e.V., Kiel, <br/>	Präsident, ehrenamtlich<br/><br/>	Hermann-Ehlers-Stiftung e.V., Kiel, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Max-Planck-Institut für Evolutionsbiologie, Plön, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Studien- und Fördergesellschaft der Schleswig-Holsteinischen <br/>	Wirtschaft e.V., Rendsburg, <br/>	Vorsitzender des Bildungswerkes, ehrenamtlich<br/><br/>	Wirtschaftsrat der CDU e.V., Landesverband Schleswig-Holstein,<br/>	Kiel, <br/>	Kooptiertes Mitglied des Landesvorstandes, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Zöllner Holding GmbH, Kiel', '1983 Abitur an der Jungmannschule Eckernförde. 1983 Bundeswehr in Neumünster, Oberleutnant d. R. 1985 Studium Maschinenbau TU München, 1994 Promotion in Betriebswirtschaftslehre Christian-Albrechts-Univ. Kiel (DFG-Stipendium). Ab 1994 ABB Nürnberg, 1996 Leiter ABB Turbinenvertrieb für Südostasien in Kuala Lumpur, Malaysia; 1999 Leiter Marketing & International Operations TESSAG/RWE Konzern. 2001 Übernahme Familienunternehmen Zöllner Holding GmbH in Kiel in 3. Generation als Geschäftsführender Gesellschafter, Tochtergesellschaften in Deutschland, Großbritannien, Frankreich, Spanien, Polen und Brasilien. Mitgl. u. a. Vorstand Studien- und Fördergesellschaft (STFG), Präsident Forschungsforum Schleswig-Holstein, Mitgl. im Senat der AiF. Mitgl. Vorst. CDU im Kreis Plön, Bundesschatzmeister der CDU Deutschlands. - MdB seit Okt. 2009.', 'Philipp', '11004118');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08086, NULL, NULL, NULL, 'Diplom-Wirtschaftsingenieurin', 'verheiratet', '22.12.1977', NULL, 'Schwäbisch Gmünd', 'weiblich', NULL, '27.10.2009', 'Nestle', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Ingrid', '11004119');
