INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08088, NULL, NULL, NULL, 'Mitglied des Landtages', 'verheiratet, 2 Kinder', '27.04.1950', NULL, 'Trier-Kürenz', 'männlich', NULL, '27.10.2009', 'Nink', NULL, 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Manfred', '11004121');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08090, NULL, NULL, NULL, 'Kulturwissenschaftler', 'geschieden, 2 Kinder', '19.10.1957', NULL, 'Berlin', 'männlich', NULL, '27.10.2009', 'Nord', NULL, 'DIE LINKE.', NULL, 'Atheist', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Bis 1974 Schule in Ost-Berlin. 1976 Maschinen und Anlagenmonteur. Vier Jahre Volksmarine. Bis 1984 Jugendclubleiter, gleichzeitig Studium zum Kulturwissenschaftler. Hauptamtl. Funktionen in der FDJ, dann in der SED tätig und 1983 Verpflichtung als IM des MfS; nach dem demokratischen Umbruch in der DDR kritische Auseinandersetzung mit dem Realsozialismus, Zusammenarbeit mit Stefan Heym, 1994/95 dessen Mitarbeiter. Aktiv für die PDS, jetzt für die Partei DIE LINKE, bis 2012 Landesvors. DIE LINKE. Brandenburg, seit 2014 Schatzmeister DIE LINKE. - MdB seit Okt. 2009; seit 2015 Vors. der Deutsch-Polnischen Parlamentariergruppe.', 'Thomas', '11004122');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08091, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'verheiratet', '21.01.1971', NULL, 'Mölln', 'männlich', NULL, '27.10.2009', 'Notz', NULL, 'BÜNDNIS 90/DIE GRÜNEN', 'von', NULL, NULL, 'Funktionen in Unternehmen: <br/>Deutsche Telekom AG, Bonn, <br/>Mitglied des Datenschutzbeirates (bis 31.12.2013)', '1981/91 Freiherr-vom-Stein-Schule Frankfurt. 1991/92 Zivildienst Bahnhofsmission Hauptbahnhof Frankfurt. 1993/98 Jura-Studium in Heidelberg, 1998 1. Staatsexamen, Dissertation im Evangelischen Kirchenrecht, 2001/04 Referendariat und 2. Staatsexamen. Seit 2004 Rechtsanwalt in Mölln. Mitgl. Transparency International (TI) Deutschlands. Seit 1995 Mitgl. bei Bündnis 90/Die Grünen, 2002/11 Sprecher der LAG Demokratie und Recht von Bündnis 90/Die Grünen in Schleswig-Holstein, seit 2005 Mitgl. Parteirat Schleswig-Holstein, 2007/Anfang 2011 Sprecher Kreisverb. Lauenburg von Bündnis 90/Die Grünen. Seit 2004 Mitgl. für Bündnis 90/Die Grünen in der Möllner Stadtvertretung, seit Juni 2013 3. stellv. Bürgermeister der Stadt Mölln. - MdB seit Okt. 2009; seit Dez. 2013 stellv. Vors. der Fraktion Bündnis 90/Die Grünen, Obmann für Bündnis 90/Die Grünen im 1. Untersuchungsausschuss/NSA, Obmann im Ausschuss Digitale Agenda.', 'Konstantin', '11004123');
