Berlin,<br/>Mitglied des Beirates, von Amts wegen<br/><br/>Caritasstiftung Hamburg - Menschen in Not, Hamburg,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Charta der Vielfalt e.V., Berlin,<br/>Mitglied des Vorstandes, von Amts wegen<br/><br/>Deutsche Schulsportstiftung, Stuttgart,<br/>Mitglied des Kuratoriums, von Amts wegen<br/><br/>Deutscher Fußball-Bund e.V. (DFB) - Integrationspreis, Frankfurt/Main,<br/>Mitglied der Jury, von Amts wegen<br/><br/>Deutscher Verein für öffentliche und private Fürsorge e.V., Berlin,<br/>Mitglied des Hauptausschusses, von Amts wegen<br/><br/>Deutsches Institut für Menschenrechte e.V. (DIMR), Berlin,<br/>Mitglied des Kuratoriums, von Amts wegen<br/><br/>Deutsches Youth for Understanding Komitee e.V., Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Deutschlandstiftung Integration, Berlin,<br/>Mitglied des Vorstandes, von Amts wegen<br/><br/>Deutsch-Türkische Gesellschaft e.V., Berlin,<br/>Vizepräsidentin, ehrenamtlich<br/><br/>Familienplanungszentrum Hamburg e.V., Hamburg,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Forum gegen Rassismus, Dortmund,<br/>Mitglied des Plenums und der geschäftsführenden Arbeitsgruppe, von Amts wegen<br/><br/>Friedrich-Ebert-Stiftung e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Hamburger Stiftung für Migranten, Hamburg,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Informations- und Dokumentationszentrum für Antirassismusarbeit e.V. (IDA), Düsseldorf,<br/>Mitglied des Beirates, von Amts wegen<br/><br/>Internationaler Bund (IB), Verbund Nord, Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Islamisches Wissenschafts- und Bildungsinstitut e.V., Hamburg,<br/>Mitglied des Kuratoriums, ehrenamtlich (bis Januar 2014)<br/><br/>Nationaler Pakt für Ausbildung und Fachkräftenachwuchs in Deutschland, Berlin,<br/>Mitglied des Lenkungsausschusses, von Amts wegen<br/><br/>Ökumenischer Vorbereitungsausschuss zur interkulturellen Woche, Frankfurt/Main,<br/>Mitglied des Ausschusses, ehrenamtlich<br/><br/>Stiftung Urban Future Forum e.V., Frankfurt/Main,<br/>Mitglied des Kuratoriums, von Amts wegen<br/><br/>Stiftung: Bildung! Egitim!, Würselen,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>VMW - Verband der Migrantenwirtschaft, Ethnische Unternehmer und Ausländische Arbeitgeber e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich', '1994 Magister-Abschluss, Hauptfach Anglistik, Nebenfächer Spanisch und Betriebswirtschaftslehre/Personalwirtschaft. Seit 1994 wiss. Mitarbeiterin der Körber-Stiftung (ruht). Seit 2004 Mitgl. der SPD, seit Dez. 2011 stellv. Vors. der SPD. 2001/08 MdHB, Fachsprecherin für Integration und Zuwanderung; 2004/08 Mitgl. Integrationsbeirat Hamburg. Stellv. Mitgl. Kuratorium Initiative "Ein Netz für Kinder", Mitgl. Kuratorium Avicenna-Studienwerk e. V. Osnabrück, Mitgl. Kuratorium Deutsches Youth for Understanding Komitee e. V. Hamburg, Kuratoriumsmitgl. der Dt.-Türkischen Gesellschaft e. V., stellv. Vors. Familienplanungszentrum Hamburg e. V., Mitgl. Beirat Hamburger Stiftung für Migranten, seit 2012 Mitgl. Kuratorium Internationaler Bund Verbund Nord, Mitgl. Marie-Schlei-Verein, seit März 2012 Mitgl. Kuratorium Stiftung "Bildung! Egitim!", Mitgl. Beirat Verband der Migrantenwirtschaft VMW. - MdB seit Okt. 2009; März 2010/Okt. 2013 Integrationsbeauftragte der SPD-Fraktion; seit Jan. 2014 Staatsministerin bei der Bundeskanzlerin, Beauftragte der BReg. für Migration, Flüchtlinge und Integration.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 21 (Hamburg-Nord)', 'Aydan', '11004124');
