INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08097, NULL, NULL, NULL, 'Diplom-Volkswirtin', 'ledig, 1 Kind', '19.09.1968', NULL, 'Altenrheine, jetzt Rheine', 'weiblich', NULL, '27.10.2009', 'Paus', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeitsgemeinschaft City e.V., Berlin, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Europa-Union Berlin e.V., Berlin, <br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Forum Ökologisch-Soziale Marktwirtschaft e.V. (FÖS), Berlin, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Institut Finanzen und Steuern e.V., Berlin, <br/>Mitglied des Kuratoriums, ehrenamtlich', '1987/88 freiwilliges soziales Jahr im Hamburger Kinderheim St. Elisabeth. 1999 Abschluss Dipl.-Volkswirtin FU Berlin. 1998/99 wiss. Mitarbeiterin MdEP Frieder Otto Wolf (Grüne). 2005 Lehrbeauftragte VWL an der FHW Berlin. Stellv. Vors. Europa Union Berlin e. V., Genossenschaftsmitgl. Studentendorf Schlachtensee e. G., Mitgl. Attac Deutschland, Berliner Tafel, Osi-Club e.V., DLRG Scharlottenburg-Wilmersdorf, Bildungswerk Berlin der Heinrich-Böll-Stiftung, Forum Ökologisch-Soziale Marktwirtschaft, DGVN Berlin e. V, Beirat Arbeitsgemeinschaft City e. V., Beirat Berliner Steuergespräche e. V., Mitgl. Kuratorium ifst e. V. 1997/99 Mitgl. Landesvorst. Bündnis 90/Die Grünen Berlin, 1997/02 Sprecherin der BAG Wirtschaft und Finanzen, 2005/07 Sprecherin BAG Wissenschaft/Hochschule/Technologie. 1999/Okt. 2009 MdA von Berlin, dort 1999/06 europapolitische Sprecherin, 1999/2000 und 2002/04 Mitgl. Fraktionsvorst., 2001/06 stellv. Vors. Ausschuss für Wissenschaft und Forschung und hochschul- und wissenschaftspolitische Sprecherin, 1999/09 wirtschaftspol. und 2006/09 haushaltspolitische Sprecherin der Fraktion Bündnis 90/Die Grünen im Abgeordnetenhaus. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit Okt. 2013 Obfrau und Mitgl. im Finanzausschuss, Sprecherin für Steuerpolitik der Fraktion Bündnis 90/Die Grünen.', 'Lisa', '11004127');
