INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08100, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 2 Kinder', '02.03.1959', NULL, 'Most', 'männlich', NULL, '27.10.2009', 'Pitterle', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Stuttgart<br/>   Mandant 1460, 2013, Stufe 1; 2014, Stufe 1; 2016, Stufe 1<br/>   Mandant 721, 2014, Stufe 1<br/>   Mandant 1381, 2014, Stufe 1<br/>   Mandant 312, 2015, Stufe 2<br/>   Mandant 311, 2016, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Stadt Sindelfingen, Sindelfingen, <br/>	Mitglied des Gemeinderates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsch-Tschechische Juristenvereinigung e.V., Frankfurt/Main, <br/>	Mitglied des Beirates (bis 30.10.2014)<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Dr. Molnár + Partners Consulting s.r.o., Prag (bis 02.05.2014)', 'Mit 11 Jahren Umsiedlung in die BRD, seit 1970 in Sindelfingen. Abitur am Gymnasium in den Pfarrwiesen Sindelfingen. Jura-Studium. Seit 1990 Rechtsanwalt in Stuttgart, seit 2003 Fachanwalt für Arbeitsrecht. Seit der Schulzeit aktiv u. a. als Schülersprecher am Pfarrwiesengymnasium in Sindelfingen, seit dem 15. Lebensjahr Mitgl. VVN-BdA,1975/90 Kreisvors. und Mitgl. Landesvorst. VVN-BdA. 1980 Mitbegründer der Friedensbewegung im Kreis Böblingen. Seit Dez. 1990 Mitgl. der PDS, jetzt DIE LINKE. Baden-Württemberg, 1991/98 Landesschatzmeister PDS Baden-Württemberg, Gründungsmitgl. und 1998/05 Schatzmeister der Rosa-Luxemburg-Stiftung in Baden-Württemberg, seit 2002 Kreisvors. der PDS, Juli 2007/Okt. 2014 der Partei DIE LINKE im Kreis Böblingen. Seit Juni 2009 Mitgl. Gemeinderat Sindelfingen. Tschechisch (f), Englisch (G), Französisch (G), Spanisch (G). - MdB seit Okt. 2009; steuerpolitischer Sprecher der Fraktion DIE LINKE, Mitgl. der Deutsch-Tschechischen, der Deutsch-Slowakischen und der Deutsch-Portugiesischen Parlamentariergruppe, Mitgl. Wahlausschuss für die Wahl der Richter zum BVerfG, Mitgl. Vermittlungsausschuss.', 'Richard', '11004129');
