INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08109, NULL, NULL, NULL, 'Diplom-Sozialwissenschaftlerin', 'keine Angaben', '26.03.1965', NULL, 'Ibbenbüren', 'weiblich', NULL, '27.10.2009', 'Remmers', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Ingrid', '11004134');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08112, NULL, NULL, NULL, 'Bürgermeister a. D.', 'verheiratet, 2 Kinder', '24.09.1957', NULL, 'Schwäblishausen', 'männlich', NULL, '27.10.2009', 'Riebsamen', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Deutsche Krankenhausgesellschaft, Berlin, <br/>	Vortrag, 2015, Stufe 1 (DKG-Informationsveranstaltung "Krankenhausreform 2016")<br/><br/>Funktionen in Unternehmen: <br/>Kliniken Landkreis Sigmaringen GmbH, Sigmaringen, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich (bis Juni 2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Sigmaringen, Sigmaringen, <br/>	Mitglied des Kreistages (bis Juni 2014)<br/><br/>	Regionalverband Bodensee-Oberschwaben, Ravensburg, <br/>	Mitglied der Verbandsversammlung (bis Juni 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bürgerstiftung Herdwangen-Schönach, Herdwangen-Schönach, <br/>	Vorsitzender des Stiftungsrates', '1967/74 Gymnasium Sigmaringen, Mittlere Reife. 1974/79 Verwaltungsausbildung Stadt Überlingen, Verwaltungsprüfungen I und II. 1982/86 Abendstudium Verwaltungs- und Wirtschaftsakademie Konstanz, Abschluss Betriebswirt VWA, 1982/86 Abendstudium Verwaltungs- und Wirtschaftsakademie Freiburg, Abschluss Verwaltungsdiplom. 1979/82 Sachbearbeiter Stadtverwaltung Pfullendorf, 1982/86 Krankenhausverwalter in Meersburg, 1986/90 Amtsleiter Verwaltung Krankenhäuser Landratsamt Waldshut. 1990/09 Bürgermeister Gemeinde Herdwangen-Schönach. Vors. Stiftungsrat Bürgerstiftung Herdwangen-Schönach. Seit 1981 Mitgl. der CDU, seit 1991 Vorstandsmitgl. CDU-Gemeindeverb. Herdwangen-Schönach. Englisch (G). - MdB seit Okt. 2009; stellv. Vors. der AG Kommunales der CDU/CSU-Fraktion.', 'Lothar', '11004135');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08115, NULL, NULL, NULL, 'Landwirtschaftsmeister', 'verheiratet, 3 Kinder', '13.04.1960', NULL, 'Illertissen', 'männlich', NULL, '27.10.2009', 'Rief', NULL, 'CDU', NULL, 'katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Landwirt, selbständig, Kirchberg<br/>   Kunde 02, 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 04, 2013, Stufe 1; 2014, Stufe 1; 2015, Stufe 1<br/>   Kunde 06, 2015, Stufe 1; 2016, Stufe 1<br/>   Kunde 07, 2016, Stufe 1<br/>   Kunde 09, 2014, Stufe 1<br/>   Kunde 20, 2014, Stufe 1; 2015, Stufe 1<br/>   Kunde 22, 2014, Stufe 3<br/>   Vertragspartner 01, 2013, Stufe 4; 2014, Stufe 9; 2015, Stufe 9; 2016, Stufe 9<br/>   Vertragspartner 02, 2013, Stufe 1; 2014, Stufe 1; 2015, Stufe 2<br/>   Vertragspartner 03, 2014, Stufe 3<br/>   Vertragspartner 05, 2013, Stufe 3; 2014, Stufe 3; 2015, Stufe 4<br/>   Vertragspartner 06, 2014, Stufe 1<br/>   Vertragspartner 07, 2014, Stufe 3<br/>   Vertragspartner 08, 2015, Stufe 6<br/>   Vertragspartner 09, 2015, Stufe 2<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kirchberg an der Iller, Kirchberg, <br/>Mitglied des Gemeinderates (bis Mai 2014)<br/><br/>Landkreis Biberach, Biberach, <br/>Mitglied des Kreistages', 'Grundschule Kirchberg, Hauptschule Gutenzell, Erolzheim und Kirchberg. 1975/78 Ausbildung zum Landwirt. 1978/80 Fachschule für Landwirtschaft Biberach. 1980/81 Grundwehrdienst in Großengstingen und Laupheim. 1983 Bauernschule Bad Waldsee. Realschulabschluss Abendrealschule in Biberach. 1984 Meisterprüfung. 1985 Landjugendakademie Bonn. Lange Jahre im Vorst. des Grünen Kreises der Landjugend in Biberach, Jugendvertreter im Bauernverb. Biberach, 1994/10 stellv. Vors. Bauernverband Biberach bzw. Biberach-Sigmaringen. 1978/95 Mitglied der JU, seit 1985 Mitgl. der CDU; 1978/92 Ortsvors. JU Illertal, 1992/94 Kreisvors. JU Biberach, 1994/95 stellv. Bezirksvors. JU Württemberg-Hohenzollern; seit 1996 Vors. CDU-Gemeindeverb. Kirchberg, seit 1999 Kreisvors. CDU Landkreis Biberach, seit 2007 Mitgl. CDU-Landesvorst. 1989/99 und seit 2001 Mitgl. Gemeinderat Kirchberg, 1994/99 1. stellv. Bürgermeister von Kirchberg, seit 2002 Mitgl. Kreistag. - MdB seit Okt. 2009.', 'Josef', '11004136');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08116, NULL, 'Dr.', 'Dr.', 'Tierarzt, Jenaer Oberbürgermeister a. D.', '3 Kinder', '08.02.1939', NULL, 'Jena', 'männlich', NULL, '27.10.2009', 'Röhlinger', NULL, 'FDP', NULL, 'katholisch', NULL, NULL, NULL, 'Peter', '11004137');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08117, NULL, NULL, NULL, 'Journalistin und Redakteurin', 'verheiratet, 2 Kinder', '07.12.1966', NULL, 'Sassenberg', 'weiblich', NULL, '27.10.2009', 'Rößner', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Deutsche Bahn AG, Berlin, <br/>Mitglied des Beirates Leiseres Mittelrheintal<br/><br/>Kraftwerke Mainz-Wiesbaden AG, Mainz, <br/>Mitglied des Aufsichtsrates<br/><br/>Radio Mainz Live Rundfunk GmbH, Mainz, <br/>Mitglied des Programmbeirates Antenne Mainz<br/><br/>Stadtwerke Mainz AG, Mainz, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Rheinhessen gegen Rechts e.V., Ingelheim am Rhein, <br/>Mitglied des Vorstandes', '1985 Abitur in Olpe. 1985/94 Studium Musikwiss., Kunstgesch., Film- und Fernsehwissenschaften, Journalistik, Öff. Recht in Köln, Frankfurt am Main und Mainz. 1991/09 freie Journalistin, Autorin und Redakteurin. Seit 1986 Mitgl. bei BÜNDNIS 90/DIE GRÜNEN, 2001/06 Landesvors. von BÜNDNIS 90/DIE GRÜNEN in Rheinland-Pfalz. 2004/12 Mitgl. Stadtrat Mainz. Mitgl. beim BUND, VCD, seit 2008 Mitgl. Vorst. Verein Rheinhessen gegen Rechts e. V., seit 2011 Mitgl. im Vorst. Smart City e. V., Verein Für ein lebenswertes Mainz und Rheinhessen - gegen Fluglärm und den Ausbau des Frankfurter Flughafens e.V., Mitgl. Europa-Union, ver.di und Verband alleinerziehender Mütter und Väter. Mitgl. der Parlamentsgruppe Bahnlärm. - MdB seit Okt. 2009.', 'Tabea', '11004138');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08120, NULL, NULL, NULL, 'Diplom-Betriebswirt', 'verheiratet, 2 Kinder', '21.12.1955', NULL, 'Bonn', 'männlich', NULL, '27.10.2009', 'Rüddel', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Süwag Energie AG, Frankfurt/Main, <br/>Mitglied des Regionalbeirates Nord, von Amts wegen<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Neuwied, Neuwied, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Ortsgemeinde, Windhagen, <br/>Mitglied des Ortsgemeinderates, ehrenamtlich<br/><br/>Sparkasse Neuwied, Neuwied, <br/>Stellv. Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/>	<br/>Bürgerstiftung Windhagen, Windhagen, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/>	<br/>Leichtathletik Gemeinschaft (LG) Rhein-Wied, Neuwied, <br/>	Vorsitzender, ehrenamtlich<br/>	<br/>Leichtathletik-Verband Rheinland e.V., Koblenz-Oberwerth, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/>	<br/>RKK - Rheinische Karnevals-Korporationen e.V., Koblenz, <br/>	Bezirksvorsitzender, ehrenamtlich<br/>	<br/>Verein der Freunde und Förderer des Jugendzeltplatzes "Kirchwies e.V.", Kirchwies, <br/>	Finanzverwalter, ehrenamtlich', 'Volksschule, Gymnasium, Abitur. Studium Wirtschaftswiss., Dipl.-Betriebswirt. 1985 Angestellter Verlagsgruppe Mönch, Koblenz, 1987 Angestellter VF Verlagsgesellschaft Mainz, 1993/09 Geschäftsführer und Mitgesellschafter der Senioren-Residenz Bad Arolsen GmbH. Seit 1998 Präsidiumsmitgl. Rheinische Karnevals-Korporationen e. V., seit 2012 Vors. der Leichtathletik Gemeinschaft (LG) Rhein-Wied, seit Nov. 2012 Mitgl. Präsidium des Leichtathletik-Verbandes Rheinland (LVR). Seit 1972 Mitgl. der JU und der CDU; 1980/88 Kreisvors. JU Neuwied; 1982/92 stellv. CDU-Kreisvors., 2008 CDU-Kreisvors., 1988/10 Vors. CDU Windhagen, 1991/97 und 2007 Mitgl. CDU-Bezirksvorst. Koblenz-Montabaur, 1997/01 und 2003/08 Mitgl. CDU-Landesvorst. Rheinland-Pfalz, seit 2012 Beauftragter für Sportfragen der CDU Rheinland-Pfalz, seit 2014 Mitgl. Bundesfachausschuss "Gesundheit und Pflege" der CDU Deutschlands. 1984/94 und 1999 Mitgl. Kreistag Neuwied, 2004 stellv. Vors. CDU-Kreistagsfraktion; 1984 Mitgl. Ortsgemeinderat Windhagen, 1994/99 und 2004/09 1. Beigeordneter Ortsgemeinde Windhagen; 1994/99 Mitgl. Verbandsgemeinderat Asbach. Jan./Mai 1987 und Nov. 1998/Okt. 2009 MdL Rheinland-Pfalz, 2006/09 Vors. Arbeitskreis "Medien und Multimedia" der CDU-Landtagsfraktion. - MdB seit Okt. 2009; seit 2014 Berichterstatter der CDU/CSU-Fraktion für die Pflegepolitik.', 'Erwin', '11004139');
