INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08123, NULL, NULL, NULL, 'Diplom-Finanzwirt', 'verheiratet, 2 Kinder', '13.09.1948', NULL, 'Ellenbach', 'männlich', NULL, '27.10.2009', 'Schieder', '(Weiden)', 'SPD', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Werner', '11004142');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08126, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet', '30.12.1976', NULL, 'Leipzig', 'männlich', NULL, '27.10.2009', 'Schipanski', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Ilmenau<br/><br/>Funktionen in Unternehmen: <br/>Rapid Venture Accounting GmbH, Ilmenau, <br/>Mitglied des Aufsichtsrates<br/><br/>SRH Hochschule Berlin GmbH, Berlin, <br/>	Mitglied des Hochschulrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bund Heimat und Umwelt in Deutschland (BHU), Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Förderstiftung Fürstin-Anna-Luisen-Schule Bad Blankenburg,<br/>	Bad Lobenstein, <br/>	Mitglied des Stiftungsrates, ehrenamtlich (bis 22.09.2014)<br/><br/>	Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin, <br/>	Stellv. Vorsitzender des Beirates für Bildung, Forschung und<br/>	Technikfolgenabschätzung, ehrenamtlich<br/><br/>	Stiftung Caesar, Bonn, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>	Verband der privaten Hochschulen e.V., Heidelberg, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	VfB 91 Suhl e.V., Suhl, <br/>	Präsident, ehrenamtlich (bis 10.07.2015)', '1995 Abitur. 1995/96 Wehrdienst im 2./Panzergrenadierbataillon 391 Bad Salzungen. 1996/02 Studium Rechtswiss Univ. Bayreuth, 1. jur. Staatsexamen. 2001 Abschl. Zusatzstudium als Wirtschaftsjurist Univ. Bayreuth. 2003/05 Referendariat in Mainz und 2. jur. Staatsexamen. 2004 Ergänzungsstudium Dt. Hochschule für Verwaltungswiss. Speyer. 2005/09 wiss. Mitarbeiter Institut für Rechtswiss. TU Ilmenau. Seit 2006 Rechtsanwalt. Seit 1999 versch. Vorstandsämter bei Rotaract und Rotary. Seit 1994 versch. Vorstandsämter bei JU, RCDS und CDU, seit 2012 Kreisvors. der CDU Ilm-Kreis. - MdB seit Okt. 2009.', 'Tankred', '11004143');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08127, NULL, NULL, NULL, 'Gewerkschaftssekretär, Volkswirt', 'verheiratet, 2 Kinder', '25.06.1951', NULL, 'Hildesheim', 'männlich', NULL, '27.10.2009', 'Schlecht', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Volksfürsorge AG, Hamburg,<br/>Mitglied des Aufsichtsrates (bis Ende Februar 2014), jährlich, Stufe 3', 'Aufgewachsen in Hamburg. 1966 Mittlere Reife. Ausbildung zum Drucker. Zivildienst. 1973 Wechsel nach Westberlin, bis 1980 Studium zum Druck-Ingenieur, Studium VWL FU Berlin. Verlagshersteller, 1980 Wechsel nach Stuttgart, bis 2001 in der Tarifpolitik der IG Druck und Papier, ab 1989 der IG Medien. In den achtziger Jahren beteiligt an Kämpfen zur Durchsetzung der 35-Stunden-Woche, 1990/91 verantw. Beauftragter für die Tarifpolitik in der DDR bzw. den neuen Bundesländern. Seit 2001 Chefvolkswirt beim ver.di-Bundesvorstand Berlin. 1980/82 Beteiligung am Aufbau der Demokratischen Sozialisten (DS), 1982 Eintritt in die SPD nach Scheitern der DS; 2004 Unterstützung Wahlalternative 2006 bzw. WASG, 2005 Austritt aus der SPD und Eintritt in die WASG, 2006 Wahl zum Mitgl. in den Bundesvorst. der WASG, Juni 2007/Mai 2014 Mitgl. Parteivorst. Partei DIE LINKE. - MdB seit Okt. 2009.', 'Michael', '11004144');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08128, NULL, 'Dr.', 'Dr.', 'Sozialwissenschaftler', NULL, '17.04.1953', NULL, 'Bad Harzburg', 'männlich', NULL, '27.10.2009', 'Schmidt', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Unternehmen: <br/>Informationsbrief Weltwirtschaft & Entwicklung, Luxemburg, <br/>Mitglied des Herausgeber-Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung Asienhaus, Köln, <br/>Mitglied des Kuratoriums', 'Studium Sozialwissenschaften, Publizistik und Germanistik, 1978 Dipl.-Sozialwissenschaftler, Studienaufenthalte in Italien, Frankreich und den USA, 1985 Promotion. 1984/88 Redakteur der Zeitschrift "Südostasien Informationen", seit 1989 Mitherausgeber der Zeitschrift "Weltwirtschaft und Entwicklung" in Luxemburg, 2006/12 Mitherausgeber der Wochenzeitung "Der Freitag" in Berlin. 1988 Eintritt in die Partei Bündnis 90/Die Grünen, 1989/92 Geschäftsführer der Europagruppe der Grünen im EP; 1992/94 Referent für Internationale Politik des Bundesvorst. Bündnis 90/Die Grünen, 1994/96 Sprecher der Bundesarbeitsgem. Friedens- und Internationale Politik von Bündnis 90/Die Grünen, 1996/98 Mitgl. Bundesvorst., 2000/02 Mitgl. Grundsatzprogramm-Kommission, 2000/04 Vorstandsmitgl. Europäische Grüne Partei (EGP), 2000/06 Vors. Landesverb. NRW von Bündnis 90/Die Grünen. 2004/09 Mitgl. des Europäischen Parlaments, Vizepräs. Einwicklungsausschuss des EP. Englisch (f), Französisch (f), Italienisch (G). - MdB seit Okt. 2009; seit Nov. 2009 stellv. Vors. der Fraktion Bündnis 90/Die Grünen.', 'Frithjof', '11004145');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08131, NULL, NULL, NULL, 'Bürgermeister a. D.', 'verheiratet', '01.05.1968', NULL, 'Kyllburg', 'männlich', NULL, '27.10.2009', 'Schnieder', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Europa Miniköche gemeinnützige GmbH, Bartholomä,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Stellv. Mitglied des Beirates<br/><br/>Eifelkreis Bitburg-Prüm, Bitburg,<br/>Mitglied des Kreistages<br/><br/>Handwerkskammer Trier, Trier,<br/>Mitglied des Vorstandes und der Vollversammlung<br/><br/>Kreissparkasse Bitburg-Prüm, Bitburg,<br/>Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Deutsche Gesellschaft für Finanz- und Haushaltspolitik e.V., Mannheim,<br/>Mitglied des wissenschaftlichen Beirates, ehrenamtlich<br/><br/>Kulturhaus Cube 521, Marnach (Luxemburg),<br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Wirtschaftsrat der CDU e.V., Berlin,<br/>Mitglied der Bundesfachkommission Verkehr, Logistik und Infrastruktur, ehrenamtlich', '1987 Abitur. 1987/88 Grundwehrdienst. 1988/95 Studium Rechtswissenschaften in Bonn, 1995/97 Rechtsreferendar. 1998 Zulassung als Rechtsanwalt, 1999/09 Bürgermeister Verbandsgemeinde Arzfeld. Seit 2001 Vors. DRK-Ortsverein Arzfeld, seit 2007 Mitgl. Vorstand des Freundes- und Förderkreises des St. Joseph-Krankenhauses Prüm e. V., seit 2007 Mitgl. Verwaltungsrat des luxemburgischen Kulturzentrums CUBE 521, seit Mai 2011 Mitgl. Wiss. Beirat der Dt. Gesellschaft für Finanz- und Haushaltspolitik e. V. 2010/12 Bezirksvors. CDU Trier, seit Nov. 2011 Generalsekretär der CDU Rheinland-Pfalz. Seit 1999 Mitgl. Kreistag Bitburg-Prüm, seit 2009 Mitgl. Verwaltungsrat der KSK Bitburg-Prüm. - MdB seit Okt. 2009; seit 2014 Beisitzer im Vorstand der CDU/CSU-Fraktion; seit 2014 Vors. Dt.-Belgisch-Luxemburgische Parlamentariergruppe.', 'Patrick', '11004146');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08132, NULL, NULL, NULL, 'Industriekaufmann, B.A. International Business Administration', 'verheiratet', '21.02.1984', NULL, 'Frankfurt am Main', 'männlich', NULL, '27.10.2009', 'Schnurr', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Christoph', '11004147');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08133, NULL, NULL, NULL, 'Dipl.-Pol., IT-Unternehmer', 'verheiratet, 3 Kinder', '22.10.1968', NULL, 'Freiburg im Breisgau', 'männlich', NULL, '27.10.2009', 'Schulz', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Jimmy', '11004148');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08136, NULL, NULL, NULL, 'Polizeidirektor', 'verheiratet, 1 Kind', '20.05.1961', NULL, 'Andernach/Rhein', 'männlich', NULL, '27.10.2009', 'Schuster', '(Weil am Rhein)', 'CDU', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Deutsche Gesellschaft für Qualität e.V. (DGQ), Frankfurt/Main,<br/>Dozent und Prüfer, 2014, Stufe 3<br/><br/>Wirtschaftsverband Industrieunternehmen Baden, Freiburg,<br/>Beratung, 2014, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>St. Josefshaus Herten Betriebs-gemeinnützige GmbH, Rheinfelden-Herten,<br/>Mitglied der Gesellschafterversammlung, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Gesellschaft für Qualität (DQG) e.V., Frankfurt/Main,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Sportstiftung Südbaden, Lörrach,<br/>Vorsitzender des Stiftungsrates, ehrenamtlich', '1980/83 Studium FH des Bundes für öffentliche Verwaltung Köln/Lübeck, 1993/95 Deutsche Hochschule der Polizei Münster, European Quality System Manager und Auditor, Senior Quality Manager. Seit 1982 versch. Verwendungen im gehobenen und höheren Dienst der Bundespolizei (BP), zuletzt Leiter BP-Amtes/-Inspektion Weil am Rhein. Ehrenamtl. Jury-Mitgl. der Initiative Ludwig-Erhard-Preis (Deutscher Qualitätspreis), Dozent und Prüfer Deutsche Gesellschaft für Qualität e. V., Mitgl. International Police Association, Mitgl. DPolG Bundespolizeigewerkschaft, Vors. Stiftungsrat der Sportstiftung Südbaden, Vorstandsmitgl. der Dt. Gesellschaft für Qualität (DGQ) e. V. Seit 1987 Mitgl. der CDU, Vors. des CDU-Kreisverb. Lörrach, Mitgl. AK Polizei der CDU, Mitgl. im CDU-Bundesfachausschuss Innenpolitik; stellv. Vors. MIT Kreisverb. Lörrach. - MdB seit Okt. 2009; seit 2014 Obmann der AG Innen und Mitgl. im PKGr., seit 2015 Obmann im 3. Untersuchungsausschuss.', 'Armin', '11004149');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08139, NULL, NULL, NULL, 'Industriemechaniker', NULL, '23.05.1974', NULL, 'Bad Oeynhausen', 'männlich', NULL, '27.10.2009', 'Schwartze', NULL, 'SPD', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', '1990/94 Berufsausbildung. 1995 Fachabitur. 1998/09 Industriemechaniker bei der Firma Kannegiesser in Vlotho. Seit 1991 Mitgl. der IG Metall, Mitgl. der Freiwilligen Feuerwehr, der AWO, des Kinderschutzbundes Vlotho und im Vlothoer Bündnis gegen das Collegium Humanum. Seit 1994 Mitgl. der SPD, seit 2006 Vors. der SPD im Kreis Herford, seit 2014 Vors. der SPD Region Ostwestfalen. 1999/09 Kreistagsabgeordneter, 2004/09 stellv. Vors. der Kreistagsfraktion, Mitgl. im Verwaltungsrat des Klinikums Herford, Mitgl. DAK, Vors. THW-Helferverein, seit 2014 Mitgl. Verwaltungsrat der Diakonie im Kirchenkreis Vlotho. - MdB seit Okt. 2009', 'Stefan', '11004150');
