/>   Mandant 67, 2014, Stufe 1<br/>   Mandant 68, 2014, Stufe 1<br/>   Mandant 69, 2015, Stufe 1<br/>   Mandant 71, 2015, Stufe 1<br/>   Mandant 72, 2015, Stufe 1<br/>   Mandant 73, 2015, Stufe 1<br/>   Mandant 74, 2015, Stufe 1<br/>   Mandant 75, 2015, Stufe 1<br/>   Mandant 76, 2015, Stufe 1; 2016, Stufe 1<br/>   Mandant 78, 2016, Stufe 1<br/>   Mandant 79, 2016, Stufe 1<br/>   Mandant 80, 2016, Stufe 1<br/>   Mandant 81, 2016, Stufe 1<br/>   Mandant 82, 2016, Stufe 1<br/>   Mandant 83, 2016, Stufe 1', '1982 Abitur. 1982/84 Grundwehrdienst. 1984/89 Studium Rechtswissenschaften an der Univ. Bonn, 1990 1. jur. Staatsprüfung, 1993 2. jur. Staatsprüfung. 1993 Zulassung als Rechtsanwalt. Div. parteipolitisches und überparteiliches Engagement, u. a. Ende der achtziger Jahre Vors. Bürgerinitiative Steinbachtalsperre, Mitte der achtziger Jahre Referent zum Thema "Menschenrechtsverletzungen in der DDR". Seit Okt. 1982 Mitgl. der CDU, verschiedene Ämter in der CDU, Vors. des CDU-Kreisverb. Euskirchen, stellv. Vors. des CDU-Bezirksverb. Aachen. 1999/09 Ratsmitgl. der Gemeinde Weilerswist. - MdB seit Okt. 2009.', 'Detlef', '11004152');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08146, NULL, NULL, NULL, 'Diplom-Betriebswirt, Studiendirektor a. D.', 'verheiratet, 3 Kinder', '24.10.1952', NULL, 'Warendorf', 'männlich', NULL, '27.10.2009', 'Sendker', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1967 Volksschulabschluss, 1967/69 Berufsfachschule für Wirtschaft und Verwaltung (Handelsschule), 1969 mittlere Reife, 1969/71 Fachoberschule für Wirtschaft, 1971 Fachhochschulreife. 1971/76 Studium BWL FH Münster, 1976 Dipl.-Betriebswirt. 1972/73 Grundwehrdienst. 1976/79 Lehramtsstudium der Wirtschaftswiss., Erziehungswiss., kath. Theologie und Philosophie Gesamthochschule Paderborn, Okt. 1979 1. Staatsprüfung für das Lehramt in der Sekundarstufe II, Okt. 1982 2. Staatsprüfung. Seit Nov. 1982 Lehrer an der Berufsbildenden Schule (Berufskolleg) Warendorf, seit 1993 Studiendirektor. Seit Dez. 1969 Mitgl. der CDU, 1979/86 JU-Kreisvors., 1978/03 Vors. CDU-Ortsunion Ennigerloh-Westkirchen, seit Sept. 1995 Vors. CDU-Kreisverb. Warendorf-Beckum, seit 2003 stellv. Vors. CDU-Bezirksverb. Münsterland. 1979/09 Mitgl. Rat der Stadt Ennigerloh, dort Okt. 1981/Mai 2000 Vors. CDU-Fraktion. Juni 2000/Nov. 2009 MdL Nordrhein-Westfalen. Englisch (G). - MdB seit Okt. 2009; seit Jan. 2014 stellv. Vors. Ausschuss für Verkehr und digitale Infrastruktur.', 'Reinhold', '11004153');
