INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08150, NULL, 'Dr.', 'Dr.', 'Professor', 'ledig', '25.06.1971', NULL, 'Paderborn', 'männlich', NULL, '27.10.2009', 'Sensburg', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeszentrale für politische Bildung, Bonn, <br/>Mitglied des Kuratoriums<br/><br/>FernUniversität in Hagen, Hagen, <br/>Mitglied des Parlamentarischen Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Deutscher Stiftungen e.V., Berlin, <br/>	Mitglied des Parlamentarischen <br/>Beirates, ehrenamtlich<br/><br/>	Deutsche Gesellschaft für Mediation (DGM), Hagen, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/>	<br/>Deutsche Vereinigung für Parlamentsfragen e.V., Berlin, <br/>	Stellv. Vorsitzender, ehrenamtlich<br/>	<br/>Deutscher Verband für Telekommunikation und Medien (DVTM), Düsseldorf, <br/>	Mitglied des Beirates, ehrenamtlich<br/>	<br/>Franz-Stock-Komitee für Deutschland - Deutsch-Französische Gesellschaft Arnsberg e.V., Arnsberg, <br/>	Mitglied des Beirates, ehrenamtlich<br/>	<br/>KKV-Bundesverband der Katholiken in Wirtschaft und Verwaltung e.V., Essen, <br/>	Stellv. Bundesvorsitzender, ehrenamtlich<br/>	<br/>Stiftung Datenschutz, Leipzig, <br/>	Mitglied des Beirates, ehrenamtlich (bis 31.01.2016)', 'Grundschule in Brilon-Gudenhagen, danach Gymnasium Petrinum Brilon, 1991 Abitur. 1991/92 Offiziersausbildung mit Verwendungen u. a. im Einsatzführungskommando, Oberstleutnant d. R. Ab Wintersemester 1992/93 Studium der Rechts- und Politikwissenschaften an der Univ. Trier, Luxemburg und Speyer. 1997 Erstes jur. Staatsexamen und im Anschluss Magisterexamen in Politikwissenschaften. Ab Nov. 1997 Rechtsreferendar beim Oberlandesgericht in Koblenz. 1998/99 Dt. Hochschule für Verwaltungswissenschaften. 1999 Zweites jur. Staatsexamen. 1999/04 Geschäftsführer der Dt. Gesellschaft für Mediation (DGM). 1999/04 wiss. Mitarbeiter am Lehrstuhl von Prof. Dr. Katharina Gräfin von Schlieffen an der FernUniv. Hagen. 2003 Promotion zum Dr. jur. 2002/04 Dekanatsassistent von Prof. Dr. Dr. Vormbaum an der FernUniv. Hagen. 2000/06 Rechtsanwalt. 2006/08 Professor an der Fachhochschule des Bundes für öffentliche Verwaltung - Fachbereich Öffentliche Sicherheit, Abteilung Kriminalpolizei - beim Bundeskriminalamt in Wiesbaden. Seit 2008 Professor an der Fachhochschule für öffentliche Verwaltung des Landes Nordrhein-Westfalen FHöV NRW. Seit 1986 Mitgl. der JU Brilon. Seit 1989 Mitgl. der CDU, 2012/15 Kreisvors. der CDU im Hochsauerlandkreis. 2004/09 Fraktionsvors. der CDU im Rat der Stadt Brilon und stellv. Bürgermeister der Stadt Brilon. Englisch (f), Französisch (G). - MdB seit Okt. 2009.', 'Patrick', '11004155');
