INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08164, NULL, 'Dr.', 'Dr.', 'Diplom-Kaufmann, Unternehmer', 'verheiratet, 2 Kinder', '02.03.1966', NULL, 'Berlin', 'männlich', NULL, '27.10.2009', 'Steffel', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>Copa eG, Hofheim-Wallau,<br/>Mitglied des Aufsichtsrates (bis 31.12.2015)<br/><br/>Füchse Berlin Handball GmbH, Berlin,<br/>Vorsitzender des Beirates<br/><br/>Spielbank Berlin Gustav Jaenecke GmbH & Co. KG, Berlin,<br/>Mitglied des Beirates, jährlich, Stufe 3<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Füchse Berlin Reinickendorf e.V. BTSV von 1891, Berlin,<br/>Präsident, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Dresing GmbH & Co. KG, Berlin<br/><br/>Füchse Berlin Handball GmbH, Berlin<br/><br/>Füchse Sportpark GmbH, Berlin<br/><br/>Lexington Invest S.L., Malaga - Marbella, Spanien<br/><br/>Steffel Geschäftsführungsgesellschaft mbH, Berlin<br/><br/>Steffel Management & Beteiligungen GmbH, Leinfelden-Echterdingen<br/><br/>HOMETREND Rettberg GmbH & Co. KG, Seevetal (bis 31.12.2015)<br/><br/>HOMETREND Steffel Austria GmbH & Co. KG, Wien, Österreich (bis 31.12.2015)<br/><br/>INVER GmbH, Wustermark (bis 31.12.2015)<br/><br/>L. V. H. Ledergroßhandel und Vertretungen Erwin Heyse GmbH & Co. KG, Berlin (bis 07.12.2016)<br/><br/>Steffel Austria Geschäftsführungsgesellschaft mbH, Wien, Österreich (bis 31.12.2015)<br/><br/>Steffel Holding Geschäftsführung GmbH, Berlin (bis 31.12.2015)<br/><br/>Steffel Holding GmbH & Co. KG, Berlin (bis 31.12.2015)', 'Georg-Herwegh-Oberschule, Berlin-Reinickendorf, 1984 Abitur. 1985/90 FU Berlin, 1990 Dipl.-Kaufmann, 1999 Dr. rer. pol. Seit 1990 mittelständischer Unternehmer,  Steffel Management- und Beteiligungs GmbH. Präsident Füchse Berlin Reinickendorf e. V., Vors. Beirat der Füchse Berlin Handball GmbH. Aufsichtsratsmitgl. der Spielbank Berlin. Seit 1983 Mitgl. der CDU, 1997/01 Ortsvors. CDU Frohnau, seit 2001 Vors. CDU Reinickendorf, 2000/01 und seit 2009 stellv. Landesvors. CDU Berlin. 1991/09 MdA von Berlin, 2000/01 und 2006/09 Vors. Ausschuss für Wirtschaft, Betriebe und Technologie, 2005/06 Vors. Unterausschuss Sport, 1999/01 und 2006/09 stellv. Vors. und 2001/03 Vors. der CDU-Fraktion. Englisch (f). - MdB seit Okt. 2009.', 'Frank', '11004163');
