OS. 1981/83 Ausbildung Zootechniker/Mechanisator. Fernstudium FH Stadtroda und HU Berlin, 1989 Dipl.-Ing. agr. 1985/89 Schicht- und Abteilungsleiter ZBE Milchprod. Reichardtswerben, 1989/91 Leiter Gut Storkau, 1992/95 Arbeitsgruppenleiter Amt für Landwirtsch. und Flurneuordnung Süd Sachsen-Anhalt. Seit 1990 geschäftsf. Vorstand Weißenfelser Reitverein e. V., Leiter Reit-, Zucht- und Ausbildungsstall Markwerben mit Landwirtschaftsbetr., seit 1997 Inhaber Agentur für Tierversicherungen. Richter Pferdesport und -zucht. Seit 1999 Mitgl. der CDU, seit 2003 Mitgl. CDU-Kreisvorst. Weißenfels, seit 2007 stellv. Vors. CDU-Kreisverb. Burgenlandkreis, Mitarbeit CDU-LFA Landwirtschaft, 2010/12 Beisitzer CDU-Landesvorst. Sachsen-Anhalt. Seit 1994 Mitgl. Kreistag, 2004/07 stellv. CDU-Fraktionsvors., seit 2007 Vors. Kreistag; 1999/2014 Mitgl. Stadtrat Weißenfels, 2000/09 CDU-Fraktionsvors.; Mitgl. Verwaltungsrat Kreissparkasse Weißenfels/Sparkasse Burgenlandkreis; 2005/14 Vors. des Gemeinschaftsaussch. Verwaltungsgemeinsch. "Weißenfelser Land". 2010/14  1. Vizepräs. und Vors. d. LK für Pferdeleistungsprüfungen im LV d. RFV Sachsen-Anhalt. Russisch (G). - MdB seit Okt. 2009; seit Sept. 2013 stellv. Vors. der CDU-Landesgruppe Sachsen-Anhalt; stellv. Vors. Sportausschuss.', 'Dieter', '11004168');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08176, NULL, NULL, NULL, 'Jurist', 'verheiratet, 2 Kinder', '01.04.1974', NULL, 'Marktoberdorf', 'männlich', NULL, '27.10.2009', 'Stracke', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>	pro-micron GmbH & Co. KG, Kaufbeuren, <br/>	Vorsitzender des Beirates (bis 31.07.2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Stadt Kaufbeuren, Kaufbeuren, <br/>	Mitglied des Stadtrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Landesvereinigung der Helfer und Förderer des Technischen Hilfswerks in Bayern e.V., München, <br/>	Landesvorsitzender, ehrenamtlich', '1993 Abitur. 1993/94 Grundwehrdienst. 1994/99 Studium Rechtswissenschaften an der Univ. Augsburg, Stipendiat der Hanns-Seidel-Stiftung, 1999 1. jur. Staatsexamen, 2001 2. jur. Staatsexamen. 2002/05 Rechtsanwalt, 2005/06 Landesbaudirektion München, 2006/08 Leiter Abteilung Recht am Staatl. Bauamt München 1, 2008/09 Oberregierungsrat a. D. bei der Obersten Baubehörde im Bayer. Staatsministerium des Innern. Seit 2002 Stadtrat in Kaufbeuren. - MdB seit Okt. 2009; 2012/13 stellv. Vors. 2. Untersuchungsausschuss (NSU); seit 2013 stellv. Vors. sowie arbeits-, sozial-, gesundheits- und familienpolitischer Sprecher der CSU-Landesgruppe, seit 2014 Beisitzer im Fraktionsvorst. der CDU/CSU-Fraktion und Obmann im Ausschuss für Arbeit und Soziales.', 'Stephan', '11004169');
