Landeshauptstadt Hannover, Sprecherin der SPD-Ratsfraktion für Jugend und Familie. Seit 2014 Vizepräs. Special Olympics Deutschland (SOD). - MdB seit Okt. 2009; behindertenpolitische Sprecherin der SPD-Fraktion.', 'Kerstin', '11004173');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08187, NULL, 'Dr.', 'Dr.', 'Historiker, Generalsekretär der CDU Deutschlands', 'ledig', '22.08.1974', NULL, 'Frankfurt am Main', 'männlich', NULL, '27.10.2009', 'Tauber', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Christlich Demokratische Union Deutschlands, Berlin, <br/>Generalsekretär, monatlich, Stufe 3<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Main-Kinzig-Kreis, Gelnhausen,<br/>Mitglied des Kreistages<br/><br/>ZDF, Mainz,<br/>Mitglied des Fernsehrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>cnetz - Verein für Netzpolitik e.V., Berlin, <br/>	Vorsitzender (bis Februar 2014)<br/><br/>	Konrad-Adenauer-Stiftung e.V., St. Augustin, <br/>	Mitglied des Vorstandes<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>AREAL Grundstücksgesellschaft mbH, Gelnhausen (bis 01.01.2014)<br/><br/>	GbR Ulmenstr., Gelnhausen', '1994 Abitur am Grimmelshausen Gymnasium Gelnhausen. 1995/96 Wehrdienst, Nov. 2011 Beförderung Oberleutnant d. R. Studium Mittlere und Neuere Geschichte, Germanistik, Politikwiss., Abschluss M. A. mit Auszeichnung, Stipendiat der Hanns-Seidel-Stiftung. Ab 1998 stud. Hilfskraft Univ. Frankfurt am Main. 2000/01 wiss. Mitarbeiter im SFB/FK 435 "Wissenskultur und gesellschaftlicher Wandel". 2001/03 Landesgeschäftsführer JU Hessen, 2003/04 pers. Referent hess. Kultusministerin und stellv. Ministerpräs. Karin Wolff. 2004/07 Promotion Univ. Frankfurt/M. Seit 2007 Pressesprecher der DVAG in Frankfurt/M., seit 2008 Lehrbeauftragter Historisches Seminar Univ. Frankfurt am Main. Mitgl. u. a. Gelnhäuser Tafel und Verband der Reservisten der Dt. Bundeswehr. Seit 1992 Mitgl. der CDU; 2003/09 Landesvors. JU Hessen; seit Dez. 2007 Vors. CDU Gelnhausen, Mai 2008/Mai 2014 gewähltes Mitgl. zum Landesvorst. CDU Hessen, seit 2013 Generalsekretär der CDU Deutschlands. Seit 2008 Mitgl. Kreistag des Main-Kinzig-Kreises. - MdB seit Okt. 2009.', 'Peter', '11004174');
