INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08191, NULL, NULL, NULL, 'Landesgeschäftsführer', 'verheiratet, 2 Kinder', '17.04.1977', NULL, 'Saarlouis', 'männlich', NULL, '27.10.2009', 'Tressel', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsches Seminar für Tourismus Berlin e.V. (DSFT), Berlin,<br/>Mitglied des Beirates<br/><br/>Europaverband der Selbständigen - Deutschland e.V. (ESD), Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>forum anders reisen e.V., Freiburg,<br/>Mitglied des wissenschaftlichen Beirates, ehrenamtlich<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Stellv. Vorsitzender des Beirates für Verkehr, Bau und Stadtentwicklung, ehrenamtlich', '1996 Abitur am Max-Planck-Gymnasium Saarlouis. Nebenberuflich Studium Politik- und Verwaltungswissenschaft. 2003 Mitgl. Sprecherrat und Mitbegründer Bürgerinitiative gegen die Müllverbrennung im Kraftwerk Ensdorf, 2007 Mitbegründer und Mitgl. Bürgerinitiative "Bürger für Klima- und Umweltschutz e. V." gegen ein Kohlegroßkraftwerk in Ensdorf, seit 2004 Mitgl. im erweiterten Vorst. Jugend- und Kommunikationszentrum SBS (Alter Betriebshof) Saarlouis. Seit 1994 Mitgl. der Grünen, 2000/02 Landesgeschäftsführer der Saar-Grünen, 2002/04 hauptamtl. Politischer Geschäftsführer der Saar-Grünen und Mitgl. im geschäftsf. Landesvorst., 2002 und 2005 Wahlkampfleiter der saarländischen Grünen im Bundestagswahlkampf, Okt. 2004/Sept. 2009 Fraktionsgeschäftsführer der Grünen-Fraktion im Landtag des Saarlandes, seit Okt. 2004 auch ehrenamtl. Generalsekretär der Saar-Grünen und Mitgl. im geschäftsführenden Landesvorst. 2000/09 Mitgl. Rat der Gemeinde Bous, stellv. Fraktionsvors. - MdB seit Okt. 2009; tourismuspol. Sprecher der Fraktion Bündnis 90/Die Grünen, seit 2013 auch Sprecher für ländliche Räume der Fraktion Bündnis 90/Die Grünen.', 'Markus', '11004178');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08192, NULL, NULL, NULL, 'Politikwissenschaftler', 'ledig', '29.04.1982', NULL, 'Wermelskirchen', 'männlich', NULL, '27.10.2009', 'Vogel', '(Lüdenscheid)', 'FDP', NULL, 'evangelisch', NULL, NULL, NULL, 'Johannes', '11004179');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08194, NULL, NULL, NULL, 'Bezirksstadträtin a. D.', 'verheiratet, 3 Kinder', '25.04.1966', NULL, 'Bielefeld', 'weiblich', NULL, '27.10.2009', 'Vogelsang', NULL, 'CDU', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Stefanie', '11004180');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08195, NULL, NULL, NULL, 'Geschäftsführerin', NULL, '29.09.1963', NULL, 'München', 'weiblich', NULL, '27.10.2009', 'Vogler', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Gesundheitsstadt Emsdetten e.V., Emsdetten, <br/>	Mitglied des Vorstandes, ehrenamtlich<br/><br/>	Sozialpastorales Zentrum Petershof, Duisburg-Marxloh, <br/>	Mitglied des Beirates, ehrenamtlich', '1983 Abitur am Gymnasium Martinum Emsdetten. 1983/90 Studium Soziologie, Geschichte und Politikwissenschaft an der Univ. Münster; 1988/90 Referentin für Kultur und Frieden im AStA. 1990/94 Landesgeschäftsführerin der Deutschen Friedensgesellschaft (DFG-VK) NRW in Dortmund, 1995/99 Leiterin der Bundesgeschäftsstelle der DFG-VK in Velbert, 1995/01 DFG-VK-Bundessprecherin, 1999/02 Elternzeit sowie Tätigkeit als freie Journalistin u. a. bei der münster-taz, 2000/03 Redakteurin der Zeitschrift "Friedensforum", 2002/09 Geschäftsführerin beim Bund für Soziale Verteidigung in Minden. 2005 Eintritt in die WASG, 2005/07 Sprecherin WASG Kreisverb. Steinfurt, 2007/08 Kreisvorstandsmitgl. DIE LINKE. Kreisverb. Steinfurt, 2008/09 Mitgl. im Präsidium des Landesrats der Partei DIE LINKE. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2009; seit Mai 2014 stellv. Vors. Dt.-Indische Parlamentariergruppe und Mitgl. der Dt.-Nordischen Parlamentariergruppe; seit Dez. 2015 gesundheitspol. Sprecherin der Fraktion DIE LINKE.', 'Kathrin', '11004181');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08198, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'verheiratet, 3 Kinder', '10.02.1963', NULL, 'Husum', 'männlich', NULL, '27.10.2009', 'Wadephul', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Steinbach & Partner GbR, Neumünster,<br/>Rechtsanwalt, monatlich, Stufe 1, Gewinn (bis 31.12.2014)<br/><br/>Rechtsanwalt, selbständig, Kiel (ab 01.01.2015)<br/>   Mandant 1, 2015, Stufe 4; 2016, Stufe 4<br/>   Mandant 2, 2015, Stufe 3; 2016, Stufe 4<br/>   Mandant 3, 2015, Stufe 3; 2016, Stufe 3<br/>   Mandant 4, 2015, Stufe 2; 2016, Stufe 2<br/><br/>Funktionen in Unternehmen: <br/>	Norddeutsche Gesellschaft für Diakonie mbH, Rendsburg, <br/>	Mitglied des Hilfswerkausschusses (bis 31.12.2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kassenärztliche Vereinigung Schleswig-Holstein, Bad Segeberg,<br/>Vorsitzender des Berufungsausschusses für Zahnärzte und Krankenkassen<br/>Vorsitzender des Beschwerdeausschusses der Krankenkassen und Vertragsärzte, monatlich, Stufe 1<br/><br/>Kassenzahnärztliche Vereinigung Schleswig-Holstein, Kiel,<br/>unparteiisches Mitglied des Landesschiedsamtes für die zahntechnische Versorgung<br/><br/>Norddeutscher Rundfunk (NDR), Hamburg,<br/>Mitglied des Rundfunkrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Hermann Ehlers Stiftung e.V., Kiel, <br/>	Mitglied des Vorstandes', '1982 Abitur an der Meldorfer Gelehrtenschule. 1982/86 Zeitsoldat der Bundeswehr, Major d. R. 1986/91 Studium Rechtswissenschaften an der Univ. Kiel, 1991 1. jur. Staatsprüfung, 1993/95 Referendar Landgerichtsbezirk Kiel, 1995 große jur. Staatsprüfung. 1996 Promotion zum Dr. jur. Univ. Kiel. Selbstständiger Rechtsanwalt in Kiel, Fachanwalt für Medizin- und Sozialrecht. Vors. Berufungsausschuss für Zahnärzte im Zulassungsbezirk SH, Vors. Beschwerdeausschuss der Vertragsärzte und Krankenkassen in SH. 1982 Eintritt in die CDU und JU, 1992/96 Landesvors. JU Schleswig-Holstein, 1997/2000 Generalsekretär CDU SH, 2000/02 Landesvors. CDU SH, seit Januar 2006 Vors. CDU-Kreisverb. Rendsburg-Eckernförde, seit Nov. 2010 Mitgl. Bundesvorst. der CDU Deutschlands, 2014/16 stellv. Landesvors. der CDU Schleswig-Holstein. 2000/09 MdL in Schleswig-Holstein, 2005/09 Vors. CDU-Fraktion. Englisch (f). - MdB seit Okt. 2009; seit Jan. 2014 Vors. Ausschuss für Wahlprüfung, Immunität und Geschäftsordnung, altern. Vors. Vermittlungsausschuss von Bundestag und Bundesrat.', 'Johann', '11004182');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08199, NULL, 'Dr.', 'Dr.', 'Autorin', 'verheiratet', '16.07.1969', NULL, 'Jena', 'weiblich', NULL, '27.10.2009', 'Wagenknecht', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Autostadt GmbH, Wolfsburg,<br/>Kamingespräch, 2015, Stufe 1 (Goethe trifft Marx - Wie friedlich ist der Kapitalismus?)<br/><br/>Bilderhaus e.V., Gschwend,<br/>Vortrag, 2016, Stufe 1 (TTIP, Troika, NSA - wenn Institutionen der demokratischen Kontrolle entgleiten)<br/><br/>Campus Verlag GmbH, Frankfurt/Main,<br/>Publizistische Tätigkeit, 2015, Stufe 3; 2016, Stufe 3<br/><br/>CSA Celebrity Speakers GmbH, Düsseldorf,<br/>Vortrag, 2017, Stufe 2 (Reichtum ohne Gier. Wie wir uns vor dem Kapitalismus retten, CFO Club Netzwerk für Finanzexperten, Frankfurt/Main)<br/><br/>Gewerkschaft Deutscher Lokomotivführer (GDL), Frankfurt/Main,<br/>Vortrag, 2015, Stufe 1 (GDL-Betriebsrätekonferenz 2015)<br/><br/>Landesbank Berlin AG, Berlin,<br/>Streitgespräch, 2014, Stufe 3 (BerlinForum 2013)<br/><br/>Matthias Erhard Rednerdienst & Persönlichkeitsmanagement, Gräfelfing bei München,<br/>Streitgespräch, 2015, Stufe 1 (Jahresauftaktveranstaltung "CapiTalk", Sparkasse Leverkusen, Leverkusen)<br/>Vortrag, 2016, Stufe 2 (Reichtum ohne Gier - wie wir uns vor dem Kapitalismus retten, Efficiency Club, Zürich)<br/><br/>Südwestdeutscher Zeitschriftenverleger-Verband e.V., Stuttgart,<br/>Vortrag, 2013, Stufe 1 (SZV - Jahrestagung)<br/><br/>STARK! Marketing GmbH, Feldkirchen,<br/>Vortrag, 2014, Stufe 2 (5 vor 7 - Veranstaltung "Marktwirtschaft am Scheideweg", Rochus Mummert Executive Consultants GmbH, München)<br/><br/>The London Speaker Bureau, Karlsruhe,<br/>Streitgespräch, 2015, Stufe 2 (DKM Fachmesse für die Finanz- und Versicherungswirtschaft, bbg Betriebsberatungs GmbH, Bayreuth)<br/><br/>Tuttlinger Hallen, Tuttlingen,<br/>Lesung, 2013, Stufe 1 (10. Tuttlinger Literaturherbst)', '1988 Abitur in Berlin. 1990/96 Studium Philosophie und Neuere Deutsche Literatur in Jena, Berlin und Groningen, Sept. 1996 Abschluss des Studiums in Groningen mit einer Arbeit über Hegel und Marx, 2012 Promotion zum Dr. rer. pol. in Wirtschaftswissenschaften an der TU Chemnitz mit einer Arbeit zum Thema "The Limits of Choice. Saving Decisions and Basic Needs in Developed Countries". 2007/14 Mitgl. Vorstand der Partei DIE LINKE. 2004/09 MdEP, dort Mitgl. im Ausschuss für Wirtschaft und Währung, stellv. Mitgl. im Ausschuss für Industrie, Forschung und Energie. Englisch (f). - MdB seit Okt. 2009; 2009/11 wirtschaftspolitische Sprecherin und 2011/15 Erste Stellv. Vors. der Fraktion DIE LINKE., seit Okt. 2015 Vorsitzende der Fraktion DIE LINKE.', 'Sahra', '11004183');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08200, NULL, NULL, NULL, 'Geschäftsführerin', 'verheiratet, 1 Kind', '04.04.1957', NULL, 'Darmstadt', 'weiblich', NULL, '27.10.2009', 'Wagner', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'konfessionslos', NULL, NULL, NULL, 'Daniela', '11004184');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08201, NULL, NULL, NULL, 'Juristin', NULL, '17.07.1973', NULL, 'Königs Wusterhausen', 'weiblich', NULL, '27.10.2009', 'Wawzyniak', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwältin, Berlin<br/><br/>Funktionen in Unternehmen: <br/>Deutsche Telekom AG, Bonn, <br/>Mitglied des Datenschutzbeirates<br/><br/>TreuhandliegenschaftsGenossenschaft "FAIRWOHNEN" i.G., Berlin, <br/>Mitglied des Vorstandes, ehrenamtlich', '1980/90 Besuch einer POS in Königs Wusterhausen, 1990/92 Gymnasium in Königs Wusterhausen, 1992 Abitur. Okt. 1992/März 1999 Studium der Rechtswissenschaften an der Freien Univ. Berlin, 1. jur. Staatsexamen, Anfang 2002 2. jur. Staatsprüfung. 2003;Zulassung als Rechtsanwältin in Sachsen. Rechtsanwältin in Kanzleien in Potsdam und Berlin. In der 16. WP hauptberuflich Justiziarin der Bundestagsfraktion DIE LINKE sowie nebenberuflich Rechtsanwältin. 1990 Eintritt in die PDS, 1995/99 Mitgl. des Parteivorst., 2005/07 stellv. Landesvors. der Linkspartei.PDS in Berlin, 2007/16 Mitgl. des Bundesvorst. der LINKEN, Mitgl. Parteivorst. der LINKEN, 2007/11 Vors. des Bezirksverb. Friedrichshain-Kreuzberg der LINKEN in Berlin, 2008/12 stellv. Bundesvors. der LINKEN, langjährige Mitarbeit in der Bundesschiedskommission. Mitglied u. a. bei ver.di und Rote Hilfe e. V.  - MdB seit Okt. 2009.', 'Halina', '11004185');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08202, NULL, NULL, NULL, 'Soziologe', NULL, '13.02.1957', NULL, 'Bad Godesberg', 'männlich', NULL, '27.10.2009', 'Weinberg', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', '1969/76 in den Niederlanden, dort erste pol. Aktivitäten (Anti-Vietnamkriegskampagne). 1976 Schulsprecher, 1977 Abitur in Dieburg. Ab 1978 Studium Gesellschaftswiss. in Marburg, 1979 Eintritt in die GEW. Bis 1980 Zivildienst, aktiv im Bonner Friedensforum; ab 1980 wieder Studium in Marburg. Bis 1991 Projektleiter Markt-/Meinungsforschung GfK, Mitgründer Betriebsrat; gewerksch. aktiv in der Bildungsarbeit für Betriebsräte, 1991/03 selbst. geschäftsführender Gesellschafter Markt-/Meinungsforschungsinstitut, aktiv in der Bildungsarbeit der Gewerkschaft hbv, 2003 Regionalleiter Bayern ver.di Bildung+Beratung gGmbH. Mitgl. ver.di. 1980 Eintritt in den Sozialistischen Hochschulbund (SHB) und die SPD, bis 1986 Bundesvors. SHB, Beteiligung Friedensdemos, 2004 Austritt aus der SPD und Kontakt zur ASG später WASG, danach Eintritt, ab 2005 Kreisvors. WASG Nürnberg/Fürth und später Wahl in den geschäftsf. Landesvorst. der WASG Bayern, 2007/08 Landessprecher DIE LINKE. Bayern, 2007/14 Mitgl. Landesvorst. DIE LINKE. Bayern. 2008/09 Stadtrat der Stadt Nürnberg. Englisch (f), Niederländisch (f), Französisch (G). - MdB seit Okt. 2009; 2009/13 Obmann im Gesundheitsausschuss, 2013/15 Gesundheitspol. Sprecher, seit Anfang 2016 Sprecher für Krankenhauspolitik und Gesundheitsökonomie der Fraktion DIE LINKE.', 'Harald', '11004186');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08205, NULL, NULL, NULL, 'Rechtsanwältin, Bürgermeisterin a. D.', 'geschieden', '26.05.1958', NULL, 'Duisburg', 'weiblich', NULL, '27.10.2009', 'Weiss', '(Wesel I)', 'CDU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Bischöfliches Abteigymnasium und Leibniz-Gymnasium in Duisburg Hamborn, Abitur. Freiwilliges soziales Jahr. Studium der Rechtswissenschaften an der Ruhr-Univ. Bochum, 1. und 2. juristisches Staatsexamen. Rechtsanwältin in Duisburg-Hamborn und später in Dinslaken. 1992 Gründung Verein "Pangasian e. V.". Seit 1980 Mitgl. der CDU, Vors. des Duisburger CDU-Ortsverbandes Obermarxloh und danach stellv. Vors. der Kreis-CDU und Frauenunion Duisburg, 1989/98 Mitgl. der Bezirksvertretung Hamborn und dort Vors. der CDU-Fraktion, 1998 Wechsel zur CDU Dinslaken. 1999/09 direkt gewählte Bürgermeisterin der Stadt Dinslaken. 2010/16 Vors. der Frauen Union im Kreisverb. Wesel, seit Dez. 2012 Mitgl. Bundesvorst. der CDU Deutschland, seit 2016 Kreisvors. der CDU im Kreis Wesel. - MdB seit Okt. 2009; seit Jan. 2014 stellv. Vors. der CDU/CSU-Fraktion.', 'Sabine', '11004187');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08206, NULL, NULL, NULL, 'Kauffrau im Einzelhandel', '1 Kind', '25.05.1973', NULL, 'Berlin', 'weiblich', NULL, '27.10.2009', 'Werner', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Abitur. Ausbildung zur Kauffrau im Einzelhandel. Mitgl. der Gewerkschaft ver.di. Landesvors. DIE LINKE. Rheinland-Pfalz. Mitgl. Aufsichtsrat der Stadtwerke Trier. - MdB seit Okt. 2009; Mitgl. der parlamentarischen Versammlung des Europarates.', 'Katrin', '11004188');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08209, NULL, NULL, NULL, 'Kaufmännischer Angestellter', NULL, '05.01.1949', NULL, 'Büdingen/Oberhessen', 'männlich', NULL, '27.10.2009', 'Wichtel', NULL, 'CDU', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Unfallkasse Hessen, Frankfurt/Main, <br/>Mitglied des Vorstandes', '1955/63 Volksschule in Büdingen und Offenbach am Main. 1963/66 Ausbildung zum Einzelhandelskaufmann. 1971/Nov. 2012 Mitarbeiter der Fraport AG, 1975/Nov. 2010 Mitgl. des Betriebsrates, 1989/98 Leiter Bereich Sozialwesen, 2002/Mai 2010 Betriebsratsvors., 2004/12 Aufsichtsratsmitgl. und Vors. Personalausschuss. 2008 Preis "Soziale Marktwirtschaft" der Konrad-Adenauer-Stiftung. Seit 1977 Mitgl. der CDU und der CDA; 1978/01 Vorstandsmitgl. der CDU Obertshausen, 1993/01 Vors. der CDU Obertshausen, seit 2000 stellv. Kreisvors. der CDU Offenbach-Land; 1991/März 2011 stellv. Landesvors. der CDA. 1981/10 Mitgl. Stadtverordnetenversammlung der Stadt Obertshausen, 2001/10 Vorsteher der Stadtverordnetenversammlung, 1989/01 ehrenamtlicher Stadtrat. - MdB seit Okt. 2009.', 'Peter', '11004189');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08210, NULL, 'Dr.', 'Dr.', 'Diplom-Ingenieurin', '2 Kinder', '22.01.1954', NULL, 'Hannover', 'weiblich', NULL, '27.10.2009', 'Wilms', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Hochschule für Technik und Wirtschaft Dresden (HTW), Dresden, <br/>Lehrbeauftragte<br/><br/>Funktionen in Unternehmen: <br/>Stadtwerke Lübeck GmbH, Lübeck,<br/>Vorsitzende des Aufsichtsrates<br/><br/>Stadtwerke Lübeck Holding GmbH, Lübeck,<br/>Mitglied des Aufsichtsrates (bis 31.12.2013)<br/><br/>Stadtwerke Lübeck Netz GmbH, Lübeck,<br/>Vorsitzende des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landtag Schleswig-Holstein, Kiel,<br/>Mitglied des Gremiums für Fragen der deutschen Minderheit in Nordschleswig, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband eMobilität e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Förderkreis Abgasnachbehandlungstechnologien für Dieselmotoren e.V. (FAD), Dresden,<br/>Vorsitzende des Beirates, ehrenamtlich (bis November 2016)<br/><br/>Gesellschaft zum Studium strukturpolitischer Fragen e.V., Berlin,<br/>Vorsitzende des Beirates für Verkehr, ehrenamtlich<br/><br/>Stiftung Schifffahrtsstandort Deutschland, Hamburg,<br/>Mitglied des Beirates, ehrenamtlich', '1972 Abitur in Hameln. 1972/77 Studium Maschinenbau in Hannover, Abschluss Dipl.-Ingenieurin, 1981 Promotion im Fach Maschinenbau in Hamburg zum Dr.-Ing.; 1981/83 Ingenieurin in der Konstruktion in Hamburg, 1983/06 Technische Aufsichtsbeamtin Berufsgenossenschaft Bahnen; seit 2004 Lehrbeauftragte der Hochschule für Technik und Wirtschaft Dresden; seit 2006 freiberufl. Tätigkeit als Autorin und Ingenieurin. Seit Juli 2012 Mitgl. Parlamentarischer Beirat des Bundesverbandes eMobilität e.V., 2013/16 Vors. Beirat Förderkreis Abgasnachbehandlungstechnologien für Dieselmotoren e. V. (FAD), Dresden, seit 2013 Mitgl. Beirat Stiftung Schifffahrtsstandort Deutschland, Hamburg, seit 2014 Vors. Beirat Verkehr der Gesellschaft für Studium strukturpolitischer Fragen e. V., seit 2014 Vors. Aufsichtsrat Stadtwerke Lübeck GmbH/Netz Lübeck. - MdB seit Okt. 2009.', 'Valerie', '11004190');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08212, NULL, NULL, NULL, 'Ministerin a. D., Diplom-Finanzökonomin', '2 Kinder', '28.09.1960', NULL, 'Leipzig', 'weiblich', NULL, '27.10.2009', 'Ziegler', NULL, 'SPD', NULL, NULL, NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn,<br/>Vertrauensfrau bei der LBS Ostdeutsche Landesbausparkasse AG<br/><br/>Landkreis Prignitz, Perleberg,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Elly Heuss-Knapp Stiftung - Deutsches Müttergenesungswerk, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Exposure- und Dialogprogramme (EDP) e.V., Bonn,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Fürst Donnersmarck-Stiftung zu Berlin, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Israelstiftung in Deutschland, Verl,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Otto Benecke Stiftung e.V., Bonn,<br/>Stellv. Vorsitzende des Vorstandes, ehrenamtlich<br/><br/>Peter Leonhardt-Stiftung, Berlin,<br/>Vorsitzende des Kuratoriums, ehrenamtlich', 'Abitur. Ausbildung zur Finanzkauffrau. Finanzwirtschaftsstudium in Berlin, Diplomfinanzökonomin. 1984/87 in der Staatsbank Leipzig tätig, 1987/90 Ökonomin in der LPG Lenzen. 2000/04 Ministerin der Finanzen des Landes Brandenburg, 2004/09 Ministerin für Arbeit, Soziales, Gesundheit und Familie des Landes Brandenburg. 1990 Gründerin der SPD Lenzen, 2004/10 Vors. SPD-Unterbezirk Prignitz, 2000/08 stellv. Vors. SPD-Landesverb. Brandenburg. Bis 2000 Mitgl. der Stadtverordnetenversammlung Lenzen, 1993/98 ehrenamtliche Bürgermeisterin der Stadt Lenzen; seit Sept. 2008 Mitgl. Kreistag Prignitz. 1994/09 MdL in Brandenburg, 1997/2000 stellv. Vors. SPD-Landtagsfraktion, 1997/99 finanzpol. Sprecherin und Mitgl. Enquetekommission "Gemeindegebietsreform". - MdB seit Okt. 2009; 2009/13 stellv. Vors. der SPD-Fraktion, seit Dez. 2013 Parl. Geschäftsführerin der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 58 (Oberhavel - Havelland II)', 'Dagmar', '11004191');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08215, NULL, 'Dr.', 'Dr.', 'Professor, Hochschullehrer', 'verheiratet, 2 Kinder', '03.05.1961', NULL, 'Marburg/Lahn', 'männlich', NULL, '27.10.2009', 'Zimmer', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1980 Abitur in Traben-Trarbach. 1980/86 Studium Politikwiss., Neuere Geschichte, Völkerrecht in Trier, Indiana/Pennsylvania und München, 1986 M. A. 1988/91 Promotionsstudium, Promotion zum Dr. rer. pol. Univ. der Bundeswehr Hamburg, 2006 Habilitation, Univ. Köln. 1986/87 wiss. Mitarbeiter Sozialwiss. Institut der Bundeswehr, 1990/93 wiss. Mitarbeiter Forschungsinstitut der Konrad-Adenauer-Stiftung St. Augustin; 1994/98 DAAD Associate German Studies Professor, Univ. of Alberta; 1998/99 Lehrbeauftragter Politikwiss. TU Darmstadt, 1999/09 Angestellter, Stadt Frankfurt am Main, 2013 Ernennung zum Honorarprofessor, Univ. zu Köln. Seit 1979 Mitgl. der CDU, Beisitzer Kreisvorst. CDU Frankfurt/M.; seit 2005 Kreisvors. CDA Frankfurt/M., seit 2011 Landesvors. CDA Hessen und stellv. Bundesvors. CDA, seit 2012 Mitgl. Präsidium der CDU Hessen. Englisch (f), Französisch (G). - MdB seit Okt. 2009; seit 2014 Mitgl. Fraktionsvorst. der CDU/CSU-Fraktion; seit Jan 2017 Vors. Ausschuss für Menschenrechte und humanitäre Hilfe.', 'Matthias', '11004192');
