INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08222, NULL, NULL, NULL, 'Gewerkschaftssekretär', '2 Kinder', '20.06.1962', NULL, 'Heidelberg', 'männlich', NULL, '23.05.2011', 'Rebmann', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>DGB Bezirk Baden-Württemberg, Stuttgart, <br/>DGB-Regionsvorsitzender, monatlich, Stufe 1 (bis Januar 2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>AOK Baden-Württemberg, Stuttgart, <br/>Mitglied des Verwaltungsrates<br/><br/>AOK Rhein-Neckar-Odenwald, Mannheim, <br/>Mitglied des Bezirksrates', 'Seit 1991 Gewerkschaftssekretär in verschiedenen Leitungsfunktionen in Baden-Württemberg; 2009/14 DGB-Vors. Region Nordbaden. 1988 Eintritt in die SPD, 2006/09 Mitgl. SPD-Landesvorst. Baden-Württemberg, 2007/09 SPD-Führungsakademie, Vors. SPD Mannheim-Rheinau. Mitgl. IG Metall, Kath.-Arbeitnehmer-Bewegung, Freundeskreis Willy-Brandt-Zentrum Jerusalem, AWO, Naturfreunde, VVN/BdA, SC Rot-Weiß Rheinau, Bürgerverein Mannheim-Gartenstadt, Kuratorium IB Mannheim, BASF-Siedlergemeinschaft Mannheim-Rheinau-Süd, Vors. Förderverein Herschelbad Mannheim e. V., Kulturverein Mannheim-Waldhof e. V., Heimatverein Rheinau-Pfingstberg e. V. Seit 2004 AOK Bezirksrat Rhein-Neckar-Odenwald, seit 2011 Verwaltungsrat AOK Baden-Württemberg. - MdB seit Mai 2011.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 278 (Bruchsal-Schwetzingen)', 'Stefan', '11004214');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08223, NULL, NULL, NULL, 'Diplom-Agraringenieur, Landschaftsökologe', 'verheiratet, 2 Kinder', '08.07.1964', NULL, 'Göppingen', 'männlich', NULL, '25.05.2011', 'Ebner', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Beruflicher Naturschutz e.V., Regionalgruppe<br/>Baden-Württemberg, Bissingen/Teck, <br/>Mitglied im Landesvorstand, ehrenamtlich', '1983 Abitur in Ebersbach. 1984/86 Zivildienst. 1986/93 Studium Agrarwiss. Univ. Hohenheim. 1993/2000 freiberufl. Landschaftsökologe, 2000/11 staatl. Naturschutzverwaltung Baden-Württemberg. Seit 1999 Mitgl. Unabhängige Grüne Liste Kirchberg/Jagst (UGL); seit 2002 Mitgl. Bündnis 90/Die Grünen, seit 2008 Kreisvors. Bündnis 90/Die Grünen Schwäbisch Hall, 2009/11 und seit 2013 Mitgl. Landesvorst. Bündnis 90/Die Grünen Baden-Württemberg. 1999/04 Stadtrat (UGL) der Stadt Kirchberg/Jagst. Mitgl. NABU, Berufsverb. der Landschaftsökologen Baden-Württemberg (BVDL), Bundesverb. Beruflicher Naturschutz e. V. (BBN), Fachagentur Nachwachsende Rohstoffe e. V. (FNR). - MdB seit Mai 2011, 2014/16 Sprecher der Landesgruppe Baden-Württemberg der Fraktion Bündnis 90/Die Grünen.', 'Harald', '11004215');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08224, NULL, NULL, NULL, 'Studienrat', 'ledig', '12.04.1981', NULL, 'Haren an der Ems', 'männlich', NULL, '06.06.2011', 'Seiler', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'konfessionslos', NULL, NULL, NULL, 'Till', '11004216');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08225, NULL, 'Dr.', 'Dr.', 'Technischer Diplom-Volkswirt', 'keine Angaben', '11.01.1982', NULL, 'Karlsruhe', 'männlich', NULL, '09.06.2011', 'Lindner', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Karlsruher Institut für Technologie, Karlsruhe, <br/>Lehrbeauftragter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Immobilienaufgaben, Bonn, <br/>Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeitsgemeinschaft industrieller Forschungsvereinigungen <br/>	"Otto von Guericke" e.V. (AiF), Köln, <br/>	Mitglied des Senats, ehrenamtlich<br/><br/>	Deutsche Industrieforschungsgemeinschaft Konrad Zuse e.V., Berlin, <br/>	Mitglied des Senats, ehrenamtlich<br/><br/>	Europa-Union Deutschland e.V., Kreisverband Germersheim,<br/>	Germersheim, <br/>	Beisitzer des Vorstandes', 'Abitur am Europa-Gymnasium Wörth am Rhein. 2002/07 Studium der Technischen Volkswirtschaftslehre Univ. Karlsruhe (TH), Abschluss als Technischer Diplom-Volkswirt 2007; 2011 Promotion zum Doktor der Wirtschaftswissenschaften (summa cum laude) "Zur Manipulierbarkeit der Allokation öffentlicher Güter". 2001/02 Zivildienst an der Landesanstalt für Umweltschutz Baden-Württemberg. 2007/11 Wissenschaftl. Mitarbeiter am Karlsruher Institut für Technologie. Seit 1998 Mitgl. BÜNDNIS 90/DIE GRÜNEN, seit 1999 Mitgl. der Grünen Jugend, 2000 Mitgl. und Pressesprecher des Landesvorstands der Grünen Jugend Rheinland-Pfalz, 2002/04 Beisitzer im Vorstand Kreisverband Germersheim, seit Nov. 2004 Vors. Kreisverband Germersheim und Stadtverband Wörth. 2005, 2009 und 2013 Direktkandidat für den Deutschen Bundestag. Jan. 2007/Juli 2011 Mitgl. Kreistag Germersheim, 2009/Juli 2011 Mitgl. Stadtrat Wörth am Rhein, 2009/Juli 2011 Vors. der Kreistagsfraktion. - MdB seit Juni 2011; stellv. Vors. der Rheinland-Pfälzischen Landesgruppe der Grünen Bundestagsabgeordneten, in der 18. WP Obmann im Haushalts- und im Rechnungsprüfungsausschuss, stellv. Vors. der Deutsch-Kanadischen Parlamentariergruppe.', 'Tobias', '11004217');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08226, NULL, NULL, NULL, 'Diplom-Volkswirt', 'ledig', '02.09.1972', NULL, 'Sinsheim', 'männlich', NULL, '07.12.2011', 'Schneider', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch', NULL, NULL, NULL, 'Ulrich', '11004219');
