INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08228, NULL, NULL, NULL, 'Diplom-Psychologin', '4 Kinder', '20.11.1964', NULL, 'Weißenburg', 'weiblich', NULL, '16.01.2012', 'Walter-Rosenheimer', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1985 Abitur in München. Studium Kommunikationswiss., Philosophie, Geschichte und Psychologie an der Ludwig-Maximilians-Univ. München, Abschluss Dipl.-Psychologin. Freiberufliche Psychologin im Bereich Arbeitspsychologie, Coaching, Klinische Psychologie. 2009/12 Wiss. Mitarbeiterin im Bayer. Landtag mit den Schwerpunkten Wirtschafts-, Industrie-, Gesundheits- und Umweltpolitik. Seit 2002 Mitgl. von Bündnis 90/Die Grünen, 2003/09 Vors. Bündnis 90/Die Grünen Ortsverb. Germering, 2003/11 Vors. Bündnis 90/Die Grünen Kreisverb. Fürstenfeldbruck, 2004/10 Mitgl. Parteirat der bayer. Grünen, 2004/08 Sprecherin Landesarbeitskreis Frauenpolitik der bayer. Grünen, 2008/12 Delegierte Bundesarbeitsgemeinschaft Wirtschaft. Seit 2008 Kreisrätin im Kreistag Fürstenfeldbruck, 2008/14 dort Gleichstellungsreferentin. - MdB seit Jan. 2012; 2012/13 Obfrau der Fraktion Bündnis 90/Die Grünen im Wirtschaftsausschuss, seit Jan. 2012 Mitgl. der Kinderkommission, seit Dez. 2013 Sprecherin für Jugendpolitik und Ausbildung, Mitgl. Parl. Beirat für nachhaltige Entwicklung.', 'Beate', '11004221');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08229, NULL, NULL, NULL, 'Elektromeister, Geschäftsführer', 'verheiratet, 1 Kind', '08.12.1950', NULL, 'Wuppertal', 'männlich', NULL, '02.05.2012', 'Todtenhausen', NULL, 'FDP', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Manfred', '11004222');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08230, NULL, NULL, NULL, 'Diplom-Chemikerin', 'verheiratet, 3 Kinder', '23.04.1953', NULL, NULL, 'weiblich', NULL, '01.06.2012', 'Sawade', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Funktionen in Unternehmen: <br/>KreisVerkehr Schwäbisch Hall GmbH, Schwäbisch Hall,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Schwäbisch Hall, Schwäbisch Hall,<br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Bezirksverband Württemberg e.V., Stuttgart,<br/>Mitglied des Beirates (bis April 2016)<br/><br/>Förderverein für Diakonie und Nachbarschaftshilfe <br/>Gailenkirchen-Gottwollshausen, Gailenkirchen,<br/>Vorsitzende<br/><br/>pro familia Stuttgart, Stuttgart,<br/>Vorsitzende<br/><br/>Sozialdemokratische Gemeinschaft für Kommunalpolitik Baden Württemberg e.V., Heilbronn,<br/>Stellv. Vorsitzende<br/><br/>Sozialdemokratische Gemeinschaft für Kommunalpolitik in der Bundesrepublik Deutschland e.V., Berlin,<br/>Stellv. Bundesvorsitzende', '1971 Abitur, zunächst keine Zulassung zum Studium aus pol. Gründen. 1971/72 Hilfstierpflegerin Tierpark Berlin. 1972/76 Chemiestudium an der Humboldt- Univ. Berlin, Abschluss Diplom. 1976/80 Chemikerin im klinisch-chem. Bereich, danach Aufgabe der Berufstätigkeit wg. Ausreiseantrag aus der DDR in die BRD, 1982 Ausreise. 1983/84 Zusatzausbild. Informationstechnik. 1984 /91 Landesforstverwaltung BW., 1991/2012 Ministerium für Umwelt und Verkehr, heute Umweltministerium BW. 1988/94 Mitgl. GGLF, 1994 Wechsel zur ÖTV, heute Mitgl. ver.di, AWO, Gesellschaft der Freundinnen und Freunde der Freilichtspiele Schwäbisch Hall, Männer von Brettheim e. V., 1988/93 Vors. Bürgerverein Stuttgart Sillenbuch-Riedenberg, 1996/09 stellv. Vors. Mieterverein Stuttgart, seit 2004 Vors. pro familia Stuttgart. Seit 1990 Mitgl. der SPD, 1998/08 Vors. SPD-OV Stuttgart Sillenbuch-Riedenberg, 1999/01 stellv. SPD-Kreisvors., seit Juli 2009 Beirat SPD-OV Schwäbisch Hall, seit 2009 stellv. Vors. SPD-KV Schwäbisch Hall; 1997/99 Vors. SGK-KV Stuttgart, seit 1997 Mitgl. Vorst. SGK BW, seit 2003 stellv. Vors. SGK BW, seit 2003 stellv. Bundesvors. der SGK; seit März 2010 Vors. ASF - Hohenloher Frauen, seit Okt. 2011 Mitgl. Landesvorst. ASF BW. 1994/09 Mitgl. Stuttgarter Gemeinderat, bis 2009 stellv. Fraktionsvors. - MdB seit Juni 2012.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 270 (Aalen-Heidenheim)', 'Annette', '11004223');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08231, NULL, NULL, NULL, 'Schriftsteller, Lehrer', '3 Kinder', '13.03.1954', NULL, 'Wyk auf Föhr', 'männlich', NULL, '18.06.2012', 'Wagner', '(Schleswig)', 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, NULL, NULL, 'Arfst', '11004225');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08232, NULL, NULL, NULL, 'Geschäftsführer', 'verwitwet, 2 Kinder', '05.05.1958', NULL, 'Welver-Meyerich', 'männlich', NULL, '22.06.2012', 'Hellmich', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>SPD Landesverband Nordrhein-Westfalen, Düsseldorf,<br/>Geschäftsführer<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Gesellschaft für Wehrtechnik e.V., Bonn, <br/>	Mitglied des Präsidiums, ehrenamtlich', '1986/12 Hauptamtlicher Geschäftsführer für die SPD in Dortmund, Düsseldorf, Unna, Hamm und für die Ruhr-SPD; 2002/08 Geschäftsführer einer Grundstücksgesellschaft in Dortmund. Mitgl. der IG BCE, IG Metall. Mitgl. AWO, DRK, VdK, SjD-Die Falken, Förderkreis Heer, Gesellschaft für Wehr- und Sicherheitspolitik jetzt Gesellschaft für Sicherheitspolitik (GfW, Sektion Lippstadt), Mitgl. Präsidium der DWT Deutsche Gesellschaft für Wehrtechnik, Mitgl. Reservistenverband, Deutscher Bundeswehrverband, Sozialwerk der Bundeswehr; Mitgl. Borussia Dortmund, Bürgerschützenverein Bad Sassendorf, Förderverein Archi-Gymnasium und Förderverein Aldegrever Gymnasium. 1976 Eintritt in die SPD, von da an ständig ehrenamtlich in der Kommunalpolitik in Welver, Münster, Soest und Bad Sassendorf sowie im Ruhrgebiet tätig. - MdB seit Juni 2012; seit Mai 2015 Vors. Verteidigungsausschuss.', 'Wolfgang', '11004226');
