INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08238, NULL, NULL, NULL, 'Diplom-Physiker, Geschäftsführender Gesellschafter', 'verheiratet, 3 Kinder', '03.06.1968', NULL, 'Göttingen', 'männlich', NULL, '22.10.2013', 'Albani', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Hörzentrum Oldenburg GmbH, Oldenburg,<br/>	Geschäftsführer<br/><br/>	Kompetenzzentrum HörTech gemeinnützige GmbH, Oldenburg,<br/>	Geschäftsführer<br/><br/>	Medizinisches Versorgungszentrum am Evangelischen Krankenhaus<br/>	Oldenburg gemeinnützige GmbH, Oldenburg,<br/>	Prokurist<br/><br/>Funktionen in Unternehmen: <br/>	Hörzentrum Oldenburg GmbH, Oldenburg, <br/>	Geschäftsführer, monatlich, Stufe 1<br/><br/>	Kompetenzzentrum HörTech gemeinnützige GmbH, Oldenburg, <br/>	Geschäftsführer, monatlich, Stufe 2<br/><br/>	Medizinisches Versorgungszentrum am Evangelischen Krankenhaus<br/>	Oldenburg gemeinnützige GmbH, Oldenburg, <br/>	Prokurist (bis 31.12.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Niedersächsisches Ministerium für Wirtschaft, Arbeit und Verkehr, Hannover, <br/>	Themenmanager der Landesinitiative "Zukunft schmieden" (bis 31.12.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesverband für Wirtschaftsförderung und Außenwirtschaft e.V., Berlin, <br/>	Mitglied des Präsidiums<br/><br/>	Kompetenzzentrum Gesundheitswirtschaft GeWiNet e.V., Osnabrück, <br/>	Mitglied des Vorstandes', '1987 Abitur in Norderstedt. 1987/92 Mitarbeiter der Organisations- und Datenverarbeitungsabteilung, Philips-Medizin-Systeme GmbH in Hamburg. 1989/94 Studium der Physik Univ. Göttingen, Abschluss Diplom-Physiker. 1993/96 Wissenschaftlicher Mitarbeiter am Department für Medizinische Physik und Akustik, Carl von Ossietzky Universität Oldenburg. Seit 1996 Geschäftsführender Gesellschafter der Hörzentrum Oldenburg GmbH, An-Institut der Univ. Oldenburg und des Ev. Krankenhauses; seit 2001 Geschäftsführer des Kompetenzzentrums HörTech gGmbH. Seit 2007 Senator des Bundesverbandes für Wirtschaftsförderung und Außenwirtschaft, seit 2010 Vizepräsident. Seit 2007 geschäftsführender Vorstand Cluster "Auditory Valley" Hannover/Oldenburg; 2008/13 Prokurist des Medizinischen Versorgungszentrums (MEVO) am Ev. Krankenhaus Oldenburg GmbH. Seit 2013 stellv. Vors. CDU-Kreisverband Ammerland, seit 2009 stellv. Vors. CDU-Gemeindeverband Bad Zwischenahn, seit 2014 Leiter Fachausschuss "Wissenschaft, Kultur, Kirche" des CDU-Landesverbandes Oldenburg, seit 2014 Mitgl. Fachausschüsse "Wissenschaft und Kultur" sowie "Gesundheit" der CDU in Niedersachsen, seit 2014 Mitgl. CDU-Bundesfachausschuss "Bildung, Forschung und Innovation, seit 2009 Mitgl. des Wirtschaftsrates der CDU, Bundesfachkommission "Wachstum und Innovation", Berlin. Seit 2010 Beirat der Landesinitiative "BioRegioN Netzwerkinitiative Life Sciences - Niedersachsen" des Niedersächsischen Wirtschaftsministeriums in Hannover. Seit 2012 Leitung des Translational Research Center (TRC) im Rahmen des Exzellenzclusters "Hearing4All". - MdB seit Okt. 2013.', 'Stephan', '11004241');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08239, NULL, NULL, NULL, 'Diplom-Politologin', 'verheiratet, 1 Kind', '20.11.1983', NULL, 'Ulm/Donau', 'weiblich', NULL, '22.10.2013', 'Albsteiger', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>SWU Stadtwerke Ulm/Neu-Ulm GmbH, Ulm,<br/>Kommunikationsreferentin<br/><br/>Funktionen in Unternehmen: <br/>Ulm/Neu-Ulm Touristik GmbH (UNT), Ulm, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Akademie für Politische Bildung Tutzing, Tutzing, <br/>Beisitzerin des Kuratoriums (bis 18.08.2014)<br/><br/>Bundeszentrale für politische Bildung, Bonn, <br/>Stellv. Mitglied des Kuratoriums<br/><br/>Landkreis Neu-Ulm, Neu-Ulm, <br/>Mitglied des Kreistages<br/><br/>Stadt Neu-Ulm, Neu-Ulm, <br/>Mitglied des Stadtrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Institut für Europäische Politik e.V. (IEP), Berlin, <br/>Mitglied des Kuratoriums', 'Studium der Politik mit Nebenfach Volkswirtschaft Univ. Augsburg sowie an der australischen University of Adelaide, Abschluss Diplom. Bildungsreferentin in der CSU-Landesleitung. Pressereferentin bei der E.ON AG, seit Ende 2011 Sprecherin bei den Stadtwerken Ulm/Neu-Ulm GmbH. Seit 2003 Mitgl. der Jungen Union, seit 2005 Mitgl. der CSU, 2009/11 stellv. Landesvors. der Jungen Union Bayern, 2011/13  Landesvors. der Jungen Union Bayern, seit 2014 stellv. Bundesvors. der Jungen Union Deutschlands. 2008/12 Gemeinderätin in Elchingen, seit 2008 Kreisrätin in Neu-Ulm, seit 2014 Stadträtin in Neu-Ulm. - MdB seit Okt. 2013.', 'Katrin', '11004242');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08240, NULL, NULL, NULL, 'Islamwissenschaftlerin', 'verheiratet, 1 Kind', '17.10.1984', NULL, 'Greifswald', 'weiblich', NULL, '22.10.2013', 'Amtsberg', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landtag Schleswig-Holstein, Kiel,<br/>	Mitglied des Landtages', '2004 Abitur. 2004 Beginn des Studiums der Islamwissenschaften, Abschluss 2012. 2008 bis 2010 Sprecherin der Landesarbeitsgemeinschaft Europa-, Friedens und Außenpolitik der GRÜNEN Schleswig-Holstein, 2012 Kreisvors. der Kieler Grünen. Mitglied des Schleswig-Holsteinischen Landtags 2009 bis 2012. - MdB seit Okt. 2013.', 'Luise', '11004243');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08241, NULL, NULL, NULL, 'Bankkauffrau, Diplom-Religionspädagogin, Geschäftsführerin', 'verheiratet, 2 Kinder', '21.09.1955', NULL, 'Bevern', 'weiblich', NULL, '22.10.2013', 'Baehrens', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Diakonisches Werk Württemberg e.V., Stuttgart,<br/>Geschäftsführerin, Stellv. Vorsitzende', 'Diakonin in verschiedenen sozialen Arbeitsfeldern wie Familien- und Erwachsenenbildung, Gemeindearbeit und Schulsozialarbeit. 1996/13 Geschäftsführerin Diakonisches Werk Württemberg, 2002/13 stellv. Vorstandsvors. Diakonisches Werk Württemberg. 1996/13 Mitgl. Landespflegeausschuss Baden-Württemberg; bis 2013 alternierende Vors. Pflegesatzkommission SGB XI; 1998/13 Mitgl. Aufsichtsrat Nikolauspflege; 2002/13 Stiftungsvorst. agentur mehrwert; seit 2016 Vors. Kreisbehindertenring Göppingen, seit 2016 Mitgl. Sozialkammer der EKD; Mitgl. AWO, TTC Stuttgart (Tischtennis), VfB Stuttgart, Theaterhausverein Stuttgart. Seit 1988 Mitgl. der SPD. 1989/96 Mitgl. im Stuttgarter Gemeinderat (Jugend- und sozialpol. Sprecherin), 1992/96 stellv. Fraktionsvors. der SPD-Gemeinderatsfraktion. - MdB seit Okt. 2013; stellv. Sprecherin AG Gesundheit der SPD-Fraktion; stellv. Vors. Dt.-Koreanische Parlamentariergruppe.', 'Heike', '11004244');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08242, NULL, NULL, NULL, 'Völkerrechtlerin', 'verheiratet, 2 Kinder', '15.12.1980', NULL, 'Hannover', 'weiblich', NULL, '22.10.2013', 'Baerbock', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bündnis90/Die Grünen Brandenburg, Potsdam,<br/>Landesvorsitzende', '2000/04 Studium der Politikwissenschaft und Öffentliches Recht in Hamburg; gleichzeitig freie Mitarbeit bei der Hannoverschen Allgemeinen Zeitung; 2005 Master im Völkerrecht an der LSE London, Trainee beim Europarat in Straßburg sowie beim British Institute of International and Comparative Law; 2005/08 Referentin für die Brandenburger Europaabgeordnete Elisabeth Schroedter in Brüssel und Potsdam. 2008/09 Referentin für Außen- und Sicherheitspolitik bei der Grünen Bundestagsfraktion. 2009/13 Landesvors. BÜNDNIS 90/DIE GRÜNEN Brandenburg. Doktorandin im Völkerrecht, FU Berlin (ruhend). Seit 2005 Mitgl. von Bündnis 90/Die Grünen, 2009/12 Mitgl. im Vorstand der Europäischen Grünen Partei; seit 2012 Mitgl. im Parteirat von Bündnis 90/Die Grünen. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2013; klimapolitische Sprecherin der Fraktion Bündnis 90/Die Grünen; stellv. Mitgl. der PV des Europarates.', 'Annalena', '11004245');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08243, NULL, NULL, NULL, 'Hauptschullehrerin', 'verheiratet', '25.04.1964', NULL, 'Nördlingen', 'weiblich', NULL, '22.10.2013', 'Bahr', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Regierung von Schwaben, Augsburg,<br/>Lehrerin<br/><br/>Funktionen in Unternehmen: <br/>Stadtwerke Augsburg Netze GmbH, Augsburg, <br/>	Mitglied des Aufsichtsrates (bis 30.04.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Augsburg, Augsburg, <br/>	Mitglied des Stadtrates (bis 30.04.2014), monatlich, Stufe 1<br/>	<br/>Stadtsparkasse Augsburg, Augsburg, <br/>	Mitglied des Verbandsrates (bis 30.04.2014)', '1974 Theodor-Heuss-Gymnasium in Nördlingen, 1983 Abitur. 1983 Studium Lehramt für Hauptschule Englisch/Geschichte, Deutsch, Musik Univ. Augsburg, 1989 erstes Staatsexamen; 1989/91 Lehramtsanwärterin in Wemding, 1991 zweites Staatsexamen. 1991/93 Hauptschullehrerin in Monheim und Wemding, 1993 bis 2013 Hauptschullehrerin in verschiedenen Augsburger Schulen, darunter viele Jahre Albert-Einstein-Schule, zuletzt Goethe Mittelschule als Stammschule. 1987 Eintritt in die SPD, Mitgl. im Vorst. Ortsverein Jakobervorstadt/Bleich, 2009/12 dort Ortsvereinsvors., seit 2008 Mitgl. im Unterbezirksvorst. SPD Augsburg, seit 2010 Vors., stellv. Vors. der SPD Schwaben, 2015 Mitgl. Landesvorst. SPD Bayern. 2002/14 Stadträtin in Augsburg, 2008/14 stellv. Fraktionsvors. 1995/13 Vors. GEW Augsburg und Vorstandsmitgl. DGB Region Augsburg, 1998/13 Personalrätin beim Staatl. Schulamt der Stadt Augsburg, 2002/08 Vorstand VHS Augsburg, 2005/14 Steuerungsgruppe Bürgerschaftliches Engagement Stadt Augsburg (Bündnis für Augsburg), Mitgl. AWO, seit 2015 Mitgl. Kuratorium der Hochschule Augsburg. Englisch (f), Französisch (G), Latein. - MdB seit Okt. 2013.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 253 (Augsburg-Land)<br/>Wahlkreis 257 (Ostallgäu)', 'Ulrike', '11004246');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08244, NULL, 'Dr.', 'Dr.', 'Bundesministerin für Familie, Senioren, Frauen und Jugend, Juristin', '2 Kinder', '19.11.1968', NULL, 'Köln', 'weiblich', NULL, '22.10.2013', 'Barley', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Ministerium der Justiz und für Verbraucherschutz Rheinland-Pfalz, Mainz,<br/>Referentin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>		Sozialdemokratische Partei Deutschlands, Berlin,<br/>Generalsekretärin, monatlich, Stufe 3 (ab 14.12.2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>ZDF, Mainz,<br/>Mitglied des Fernsehrates', 'Gymnasium Rodenkirchen in Köln, 1987 Abitur. Anschließend Studium der Rechtswissenschaften  Philipps-Univ. Marburg, 1990 Austauschstudium  an der Université Paris XI; 1993 Erste Juristische Staatsprüfung; 1993/95 wissenschaftl. Hilfskraft an der Westfälischen Wilhelms-Universität Münster; 1995 Referendardienst in Trier; 1998 Promotion. Rechtsanwältin in einer Hamburger Großkanzlei. 1999 Wissenschaftlicher Dienst des Landtags Rheinland-Pfalz. 2001 Wissenschaftliche Mitarbeiterin am Bundesverfassungsgericht. Elternzeit. 2003 deutsche Vertreterin im Haus der Großregion, Luxemburg, 2005 Richterin am Landgericht Trier und am Amtsgericht Wittlich; seit 2008 Referentin im Ministerium der Justiz und für Verbraucherschutz in Mainz. Seit 1994 Mitgl. der SPD, seit 2005 Mitgl. Kreisvorst. Trier-Saarburg, 2010/16 Kreisvors. der SPD, Dez. 2015/Juni 2017 Generalsekretärin der SPD. - MdB seit Okt. 2013; 2013/16 Justiziarin der SPD-Fraktion; 2014/16 Mitgl. Ältestenrat. Seit Juni 2017 Bundesministerin für Familie, Senioren, Frauen und Jugend.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 201 (Mosel/Rhein-Hunsrück)<br/>Wahlkreis 203 (Bitburg)', 'Katarina', '11004247');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08246, NULL, 'Dr.', 'Dr.', 'Beamter (Leitender Regierungsdirektor) a. D.', 'verheiratet, 1 Kind', '16.01.1959', NULL, 'Bremen', 'männlich', NULL, '22.10.2013', 'Bartke', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Freie und Hansestadt Hamburg, Hamburg,<br/>Behörde für Arbeit, Soziales, Familie und Integration<br/>Leitender Regierungsdirektor<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Johann Daniel Lawaetz-Stiftung, Hamburg, <br/>Vorsitzender des Stiftungsrates (bis 31.01.2014)', '1978 Abitur in Bremen. 1979/80 Grundwehrdienst. 1987 Abschluss der einstufigen Juristenausbildung an der Univ. Hamburg; 1987 Rechtsanwalt in Hamburg-Altona; 1991 Promotion zum Dr. jur. am Hamburger Institut für Friedensforschung; 1991 Eintritt in den Dienst der Freien und Hansestadt Hamburg, Sozialbehörde, hier bis 2013 in unterschiedlichen Leitungspositionen, zuletzt als Leiter der Rechtsabteilung. 1978 Eintritt in die SPD Südbayern, München, Ortsverein Schwabing-West; 1989 Vors. des SPD-Distriktes Altona-Nord, 2004 stellv. Kreisvors. der SPD Altona, 2009 Landesvorst. der SPD Hamburg, 2010 Gründung der AG "Selbst Aktiv" für Menschen mit Behinderung in der SPD. 1986 Mitglied der Bezirksversammlung Hamburg-Altona. Mitgl. von ver.di, AWO und SoVD, seit Nov. 2016 Vors. Lebenshilfe Landesverband Hamburg e. V. - MdB seit Okt. 2013; seit Jan. 2016 Justiziar der SPD-Fraktion und Mitgl. Ältestenrat.', 'Matthias', '11004248');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08247, NULL, NULL, NULL, 'Politikwissenschaftlerin', 'verheiratet', '07.09.1984', NULL, 'München', 'weiblich', NULL, '23.01.2015', 'Obermeier', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	CSU-Fraktion im Bayerischen Landtag, München,<br/>	Referentin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>			Gemeinde Maitenbeth, Maitenbeth, <br/>	Mitglied des Gemeinderates, ehrenamtlich (bis 26.01.2015)<br/><br/>	Katholische Akademie in Bayern, München, <br/>	Mitglied des Allgemeinen Rates, ehrenamtlich<br/><br/>	Katholisches Militärbischofsamt, Berlin, <br/>	Missbrauchsbeauftragte der Katholischen Militärseelsorge, ehrenamtlich<br/><br/>	Landkreis Mühldorf a. Inn, Mühldorf a. Inn, <br/>	Mitglied des Kreistages, ehrenamtlich (bis 26.01.2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Treuhänderische Stiftung zur Unterstützung besonderer Härtefälle in der Bundeswehr und der 	ehemaligen NVA (Härtefall-Stiftung), Bonn, <br/>	Mitglied des Stiftungsrates, ehrenamtlich', '1990/94 Grundschule Maitenbeth, 1994/03 Gymnasium Gars, Abschluss Abitur. 2003/08 Studium Politikwissenschaften Ludwig-Maximilians-Univ. München, Abschluss M.A. Bis Sept. 2013 stellv. Leiterin Planungsstab der CSU-Landtagsfraktion, 2009/13  Referentin im Planungsstab der CSU-Landtagsfraktion, 2007 wiss. Mitarbeiterin im Büro des Generalsekretärs der CSU. 2010/11 Lehrbeauftragte an der Ludwig-Maximilians-Universität München. 2006/07 Assistentin des Direktors für Europäische Forschungspolitik und Innovation der Degussa Konzernrepräsentanz Brüssel. Seit 2004 Mitgl. CSU, Mitgl. der Grundsatzkommission der CSU, Mitgl. Landesvorst. des AK Außen- und Sicherheitspolitik der CSU, Schriftführerin im Kreisverb. der Frauen Union München West; 2007/15 Beisitzerin im Kreisvorst. der CSU Mühldorf am Inn, 2007/15 CSU-Ortsvors. Maitenbeth, 2009/15 stellv. Kreisvors. der Frauen Union Mühldorf am Inn, 2011/15 Beisitzerin im Bezirksvorst. der CSU Oberbayern, 2009/15 stellv. Kreisvors. der JU Mühldorf am Inn, 2013/15 Schriftführerin im Bezirksvorst. der Frauen Union Oberbayern, 2007/13 Vorstandsmitgl. der JU Oberbayern, 2009/11 Mitgl. im Landesvorst. JU Bayern. 2008/15 Gemeinderätin Maitenbeth, 2014/15 Kreisrätin in Mühldorf am Inn. Seit April 2014 Bischöfliche Beauftragte für die Prüfung von Vorwürfen sexualisierter Gewalt, Mitgl. Deutsche Härtefallstiftung. - MdB seit Okt. 2013.', 'Julia', '11004249');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08248, NULL, NULL, NULL, 'Sparkassenbetriebswirt', 'verheiratet', '19.10.1981', NULL, 'Nienburg (Weser)', 'männlich', NULL, '22.10.2013', 'Beermann', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Sparkasse Nienburg, Nienburg,<br/>Sparkassenbetriebswirt, Marktbereichsleiter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Steimbke, Steimbke,<br/>Mitglied des Gemeinderates<br/>Stellv. Bürgermeister (bis November 2016)<br/><br/>Landkreis Nienburg/Weser, Nienburg,<br/>Mitglied des Kreistages und des Kreisausschusses<br/>Stellv. Landrat<br/><br/>Samtgemeinde Steimbke, Steimbke,<br/>Mitglied des Samtgemeinderates (bis November 2016)', '1998 Realschulabschluss in Langendamm. 1998/01 Ausbildung zum Bankkaufmann bei der Sparkasse Nienburg. 2002/03 Zivildienst im Caritas Altenzentrum in Rodewald. 2005 Fortbildung zum Sparkassenfachwirt. 2006 Studium zum Sparkassenbetriebswirt an der Niedersächsischen Sparkassenakademie in Hannover. Jan. 2009/Okt. 2013 Marktbereichsleiter bei der Sparkasse Nienburg. 2011 Absolvierung der Ausbildereignungsprüfung. Seit 1997 Mitgl. der Jungen Union, seit 2001 Mitgl. der CDU, kooptiert in den JU-Landesvorst. Niedersachsen, kooptiert in den JU-Bezirksvorst. Hannover, in die CDU-Kreisvorst. Nienburg und Schaumburg sowie CDU-Bezirksvorst. Hannover. Seit 2001 Mitgl. Gemeinderat Steimbke, stellv. Bürgermeister, Schulausschussvors., Mitgl. Finanzausschuss. Seit 2016 Mitgl. Kreistag Nienburg und stellv. Landrat. Absolvent der CDU Talentschmiede 2010; Vorstandsarbeit SoVD Ortsgruppe Steimbke, 1. Vors. Schützenverein, Feuerwehr und SG Wendenborstel, ICH international childrenhelp e.V., Spielmannszug Steimbke, Mitgl. Verkehrsverein Stadthagen. - MdB seit Okt. 2013.', 'Maik', '11004250');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08250, NULL, NULL, NULL, 'Dipl.-Ing.', 'verheiratet, 4 Kinder', '08.01.1961', NULL, 'Münster', 'weiblich', NULL, '22.10.2013', 'Benning', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Benning GmbH & Co. KG, Münster,<br/>Ingenieurin<br/><br/>Landschaftsplanerin, Münster<br/><br/>Funktionen in Unternehmen: <br/>Westfälischer Zoologischer Garten Münster GmbH, Münster, <br/>Mitglied des Aufsichtsrates, ehrenamtlich', 'Bischöfliche Marienschule Münster, Abitur. Lehre im Garten- und Landschaftsbau, 1982/86 Studium der  Landespflege an der FH Weihenstephan mit den Schwerpunkten Landschaftsbau und Freiraumplanung, Abschluss Diplom-Ingenieurin. Praxisjahr in der Schweiz. Mitarbeiterin in einem Landschaftsarchitekturbüro in Düsseldorf. Studium der Geographie (Landschaftsökologie) an der WWU Münster, Abschluss Diplom-Geographin. 1990/93 Auslandsaufenthalt in Paris, freiberufliche Tätigkeit als Landschaftsplanerin. Seit 2001 Mitgl. der CDU, seit 2003 stellv. Vors. der CDU Roxel, stellv. Vors. CDU-Bezirksverband Münsterland. 2002 Sachkundige Bürgerin im Ausschuss für Umwelt und Bauwesen, 2004 direkt gewähltes Mitgl. im Rat der Stadt Münster, Mitgl. und stellv. Mitgl. in versch. Ratsausschüssen, 2004/13 stellv. Vorsitzende der CDU-Ratsfraktion, 2008/13 planungspolitische Sprecherin der CDU-Ratsfraktion. - MdB seit Okt. 2013.', 'Sybille', '11004251');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08252, NULL, 'Dr.', 'Dr.', 'Jurist', 'verheiratet, 2 Kinder', '05.07.1972', NULL, 'Osnabrück', 'männlich', NULL, '22.10.2013', 'Berghegger', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Stadt Melle, Melle,<br/>	Bürgermeister<br/><br/>Funktionen in Unternehmen: <br/>	Wohnungsbau Grönegau GmbH, Melle, <br/>	Mitglied des Aufsichtsrates und der Gesellschafterversammlung, <br/>	von Amts wegen (bis 17.07.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Kreissparkasse Melle, Melle, <br/>	Mitglied des Verwaltungsrates<br/><br/>	Osnabrücker Landschaft, Melle, <br/>	Mitglied des Landschaftsausschusses der Städtekurie (bis 17.07.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Stadtmarketingverein Melle e.V., Melle, <br/>	Mitglied des Vorstandes (bis 17.07.2014)', '1978/84 Grundschule und Orientierungsstufe Ostercappeln, 1984/91 Gymnasium Bad Essen. 1991/92 Grundwehrdienst in der Barbara-Kaserne in Delmenhorst. 1992/95 Ausbildung im gehobenen allgemeinen Verwaltungsdienst beim Landkreis Osnabrück. 1995/2000 Studium der Rechtswissenschaften Univ. Osnabrück; 2000/02 Referendariat; 2003/04 Promotion Univ. Osnabrück bei Prof. Dr. Jörn Ipsen am Institut für Kommunalrecht / Thema der Arbeit: Kommunale Vertretungsorgane und Parlamentsrecht. 2004/06 Dezernent für Finanzen und Wirtschaft bei der Stadt Melle, Nov. 2006/Okt. 2013 Hauptamtlicher Bürgermeister der Stadt Melle. 1996 Eintritt in die CDU, seit Okt. 2012 stellv. Kreisvors. der CDU im Landkreis Osnabrück, seit 2006 Mitgl. MIT der CDU/CSU. 1996/01 Mitgl. im Gemeinderat in Ostercappeln für die CDU. Seit 2006 Mitgl. Verwaltungsrat Kreissparkasse Melle, Dez. 2011/Dez. 2013 Landschaftsrat der Landschaft des ehemaligen Fürstentums Osnabrück. - MdB seit Okt. 2013.', 'André', '11004252');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08253, NULL, NULL, NULL, 'Bankfachwirtin', 'verheiratet, 3 Kinder', '08.07.1961', NULL, 'Hildesheim', 'weiblich', NULL, '22.10.2013', 'Bertram', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Deutsche Bank AG, Hannover,<br/>Bankfachwirtin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Hildesheim, Hildesheim, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Stadt Alfeld (Leine), Alfeld (Leine), <br/>Mitglied des Stadtrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Freundes- und Förderkreis Junge Union Kreisverband Hildesheim-Land, Hildesheim, <br/>Vorsitzende, ehrenamtlich', '1980 Abitur am Scharnhorst-Gymnasium Hildesheim. 1982 Abschluss Bankkauffrau; 1986/88 Bankakademie Hannover , Abschluss Bankfachwirtin. 1982/94 Deutsche Bank AG, Filialen Hildesheim, Hannover, Frankfurt, Hongkong. 2006 Eintritt in die CDU, seit 2008 Vors. Stadtverband der CDU Alfeld und stellv. Vors. CDU Kreisverb. Hildesheim, Beisitzerin im Landesvorst. der CDU Niedersachsen, seit Okt. 2016 Vors. CDU-Kreisverb. Hildesheim und stellv. Vors. CDU-Bezirksverb. Hildesheim. Seit 2011 Ratsfrau im Rat der Stadt Alfeld (Leine), 2011/13 Fraktionsvors., 2011/16 CDU-Kreistagsabgeordnete im Landkreis Hildesheim hier 2011/13 Sprecherin für Gesundheit und Soziales. Mitgl. Kuratorium Stiftung Denkmal für die ermordeten Juden Europas Berlin, Mitgl. Parlamentarierbeirat der UNESCO-Weltkulturerbestätte FAGUS-Werk Alfeld, Mitgl. im Vorst. der Heinrich-Dammann-Stiftung. - MdB seit Okt. 2013; Mitgl. Vorst. der CDU/CSU-Fraktion.', 'Ute', '11004253');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08254, NULL, NULL, NULL, 'wissenschaftlicher  Referent', 'verheiratet, 2 Kinder', '30.03.1966', NULL, 'Braubach', 'männlich', NULL, '22.10.2013', 'Blienert', NULL, 'SPD', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>SPD-Fraktion im Landtag von Nordrhein-Westfalen, Düsseldorf,<br/>Wissenschaftlicher Referent<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeszentrale für politische Bildung, Bonn, <br/>	Stellv. Mitglied des Kuratoriums<br/>	<br/>Deutsche Nationalbibliothek, Frankfurt/Main, <br/>	Stellv. Mitglied des Verwaltungsrates<br/>	<br/>Deutschlandradio, Berlin, <br/>	Mitglied des Hörfunkrates<br/>	<br/>FFA - Filmförderungsanstalt, Berlin, <br/>	Mitglied des Verwaltungsrates und Stellv. Mitglied der Vergabekommission', 'Paderborner Gymnasium Theodorianum, Abitur. Studium der Politik, Geschichte, Soziologie, Pädagogik und Sozialwissenschaften in Münster, Magister und Staatsexamen für die Sekundarstufe I. Mitgl. Kuratorium Bundeszentrale für pol. Bildung, Bonn, stellv. Mitgl. Verwaltungsrat Dt. Nationalbibliothek, Frankfurt/Main, Mitgl. Hörfunkrat Deutschlandradio, Berlin, Mitgl. Verwaltungsrat FFA - Filmförderungsanstalt, Berlin, Mitgl. AWO, ver.di und Gegen Vergessen - Für Demokratie e. V. Seit 1994 an verschiedenen Stellen in der SPD tätig, unter anderem als Geschäftsführer im Hochsauerlandkreis. Seit 2002 stellv. Vors.  Kreisverband Paderborn, seit 2011 Vors., seit 2008 Mitgl. im Regionalvorstand OWL der SPD. - MdB seit Okt. 2013.', 'Burkhard', '11004254');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08255, NULL, 'Dr.', 'Dr.', 'Europaabgeordnete a. D.', 'verheiratet, 1 Kind', '24.08.1979', NULL, 'Lörrach', 'weiblich', NULL, '22.10.2013', 'Brantner', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Mitglied des Europäischen Parlaments, Straßburg<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Avanti Europe ! e.V., Freiburg, <br/>Mitglied des Vorstandes, ehrenamtlich', 'Deutsch-Französisches Gymnasium Freiburg. Institut dEtudes Politiques, Paris, Columbia University, New York. Tätigkeiten bei United Nations Development Fund for Women, Bertelsmann Stiftung und der Univ. Mannheim. 2010 Promotion an der Universität Mannheim zum Thema Reformfähigkeit der Vereinten Nationen. Mitgl. Grüne Jugend Baden-Württemberg, Mitgl. Landes- und Bundesvorst. Mitgl. des Europäischen Parlaments für Deutschland Juli 2009/Okt. 2013. - MdB seit Okt. 2013.', 'Franziska', '11004255');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08256, NULL, 'Dr.', 'Dr.', 'Wirtschaftsberater', 'verheiratet, 2 Kinder', '14.03.1953', NULL, 'München', 'männlich', NULL, '22.10.2013', 'Brunner', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Illertisser Sonnenschein GmbH & Co KG, Babenhausen,<br/>Geschäftsführender Gesellschafter<br/><br/>Unternehmensberater und Rechtsdienstleister gemäß § 10 Abs. 1 Nr. 1 RDG, Illertissen, Neu-Ulm<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Hochschule Biberach, Biberach/Riss, <br/>Dozent<br/><br/>Illertisser Sonnenschein GmbH & Co. KG, Babenhausen, <br/>Geschäftsführender Gesellschafter<br/><br/>Unternehmensberater und Rechtsdienstleister gemäß § 10 Abs. 1 Nr. 1 RDG, Illertissen, Neu-Ulm<br/><br/>Funktionen in Unternehmen: <br/>Donau-Iller-Nahverkehrsverbund-GmbH, Ulm, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreisspitalstiftung Weißenhorn, kreiskommunale Stiftung des öffentlichen Rechts, Weißenhorn, <br/>Mitglied des Stiftungsrates<br/><br/>Landkreis Neu-Ulm, Neu-Ulm, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Bezirksverband Schwaben e.V., Stadtbergen, <br/>Bezirksrevisor<br/><br/>AWO Landesverband Bayern e.V., München, <br/>Landesrevisor<br/><br/>Sozialdemokratische Gemeinschaft für Kommunalpolitik in Bayern e.V., München, <br/>Mitglied des geschäftsführenden Vorstandes<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Illertisser Sonnenschein GmbH & Co KG, Babenhausen', 'Schule in Lindau (Bodensee). Betriebswirtschaftlehre, Rechtspflege- und Management-Studium in Reutlingen, München, Starnberg und Preßburg; 2002/05 Postgraduiertenstudium Komenius-Univ. Preßburg, Abschluss Doktor in Philosophie (doktor filozofie). 1978/90 Amtsgericht und Staatsanwaltschaft Kempten (Allgäu). 1990/02 Bürgermeister der Stadt Illertissen. Seit 2005 selbstständiger Wirtschaftsberater, Verwalter und Rechtsdienstleister, geschäftsführender Gesellschafter einer Solarkraftwerksgesellschaft; seit 2012 nebenamtliche Lehrtätigkeit an der Hochschule Biberach. Mitgl. der SPÖ in Wien-Ottakring und der Tschechischen Sozialdemokratischen Partei (CSSD), Mitgl. AWO, Ortsvorstand, Kreisvorstand, Bezirks- und Landesrevisor, Mitgl. Bayerisches Rotes Kreuz, davon 14 Jahre Bereitschaftsleiter, Mitgl. Deutsche Verkehrswacht, fünf Jahre Leiter der Gebietsverkehrswacht; Mitgl. und Vors. Freundeskreis Städtepartnerschaft Illertissen - Elbogen/Loket n.O., Verein für Landesbau und Gartenpflege Illertissen, Obst- und Gartenbauverein Au/Iller und Schwabenbühne Roth- und Illertal, Mitgl. Gebirgsjägerkameradschaft. 1982 Eintritt in die SPD, 1985/90 Ortsvereinsvors. Kempten-Nord, 1988/90 Kreisvors. Kempten (Allgäu) und stellv. Unterbezirksvors. Allgäu-Bodensee, seit 2008 stellv. Bezirksvors. der Schwaben-SPD, seit 2013 Mitgl.  Landesparteirat. Seit 1996 Kreisrat Landkreis Neu-Ulm, davon 1998/12 Fraktionsvors. Seit 1998 Aufsichtsrat für die SPD im Nahverkehrsverbund DING. Englisch (G), Französisch (G), Italienisch (G).  - MdB seit Okt. 2013; Obmann Unterausschuss Abrüstung, Rüstungskontrolle und Nichtverbreitung.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 256 (Oberallgäu)<br/>Wahlkreis 257 (Ostallgäu)', 'Karl-Heinz', '11004256');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08257, NULL, 'Dr.', 'Dr.', 'Professor für Nachhaltiges Management, Integration-und Diversity Management', 'ledig', '24.02.1974', NULL, 'Heidelberg', 'männlich', NULL, '22.10.2013', 'Castellucci', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Berater, Wiesloch<br/><br/>	IFOK GmbH, Bensheim,<br/>	Senior Berater<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>		Hochschule der Wirtschaft für Management, Mannheim, <br/>	Professur für Nachhaltiges Management, monatlich, Stufe 1<br/><br/>	Studien-Institut Rhein-Neckar gemeinnützige GmbH, Mannheim, <br/>	Vortrag 1, 2015, Stufe 1 (Moderation "Führungsklausur")<br/>	Vortrag 2, 2015, Stufe 1 (Moderation "Führungsklausur")', '1995/2000 Studium der Politik, Mittlere und Neuere Geschichte und Öffentliches Recht in Heidelberg, Mannheim und San Francisco; 2008 Promotion in Darmstadt. Stipendiat der Friedrich-Ebert-Stiftung, der Fulbright-Kommission und der Erich-Becker-Stiftung; 2000/13 Mitarbeiter IFOK Kommunikations- und Strategieberatung in Bensheim. Seit Sommersemester 2013 Professur für Nachhaltiges Management an der Hochschule der Wirtschaft für Management in Mannheim. Seit 1991 Mitgl. der SPD, 1995/01 Ortsvereinsvors. der SPD Wiesloch, 2001/09 Kreisvors. der SPD Rhein-Neckar, seit 2005 stellv. Vors. der SPD Baden-Württemberg. 1999/13 im Stadtrat der Stadt Wiesloch, 2001/13 dort Vors. der SPD-Fraktion. 2009/13 Kreisrat im Rhein-Neckar-Kreis. Beirat der Beschäftigungsinitiative Wiesloch und Umgebung e.V. und Stiftungsratsvorsitzender  der Bürgerstiftung Wiesloch. - MdB seit Okt. 2013. Vorsitzender der AG Demokratie der SPD-Fraktion; stellv. Vors. Parl. Beirat für nachhaltige Entwicklung.', 'Lars', '11004257');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08258, NULL, NULL, NULL, 'Politikwissenschaftler (M.A.),Landesgeschäftsführer SGK NRW', 'verheiratet, 2 Kinder', '01.06.1956', NULL, 'Sendenhorst', 'männlich', NULL, '22.10.2013', 'Daldrup', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Sozialdemokratische Gemeinschaft für Kommunalpolitik Nordrhein-Westfalen e.V., Düsseldorf,<br/>	Landesgeschäftsführer<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Sozialdemokratische Gemeinschaft für Kommunalpolitik Nordrhein-Westfalen e.V., Düsseldorf, <br/>	Landesgeschäftsführer, monatlich, Stufe 2 (ab 01.01.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bezirksregierung Münster, Münster, <br/>	Mitglied des Regionalrates, Fraktionsvorsitzender<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>St. Josef-Stift Sendenhorst, Sendenhorst, <br/>	Mitglied des Kuratoriums', '1976 Abitur. 1976/83 Studium der Politikwiss., Philosophie und Dt. Philologie in Münster; 1980/82 Studienaufenthalte in Budapest, 1983 Magisterexamen. 1977/78 Zivildienst Frauenklinik Münster. 1983/85 Ass. der Staatsmin. Inge Donnepp, 1985/86 Ass. des MdL, Günter Harms. 1986/90 Lehrbeauftragter FH für öffentliche Verwaltung NRW, Münster, 1991/03 Amtsleiter für Stadtentwicklung u. Wirtschaftsförderung Stadt Beckum; seit 2003 Landesgeschäftsführer der Sozialdemokratischen Gemeinschaft für Kommunalpolitik (SGK) NRW. Seit 1975 Mitgl. der SPD, seit 2000 Mitgl. SPD-Landesvorst., seit 2001 Vors. SPD-Unterbezirk Warendorf. 1979/03 Ratsmitgl. Stadt Sendenhorst, 1988/02 Fraktionsvors.; 1992/14 Mitgl. Regionalrat (Bezirksplanungsrat) Münster, 1996/14 Fraktionsvors. Seit Nov. 2013 Mitgl. im Kuratorium St. Josef-Stift Sendenhorst (ehrenamtlich); Mitgl. ver.di, BUND, Naturfördergesellschaft Sendenhorst; Schützenverein St. Martinus Sendenhorst. - MdB seit Okt. 2013; seit 2014 kommunalpol. Sprecher der SPD-Fraktion.', 'Bernhard', '11004258');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08259, NULL, 'Dr.', 'Dr.', 'Diplom-Chemiker', 'verheiratet, 2 Kinder', '27.11.1961', NULL, 'Marsassoum, Senegal', 'männlich', NULL, '22.10.2013', 'Diaby', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Ministerium für Arbeit und Soziales, Magdeburg,<br/>Referent<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Graf & Graf Literatur- und Medienagentur GmbH, Berlin,<br/>Publizistische Tätigkeit, 2015, Stufe 3; 2016, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>Bäder Halle GmbH, Halle,<br/>Mitglied des Beirates (bis Ende 2015)<br/><br/>Stadion Halle Betriebs GmbH, Halle,<br/>Mitglied des Beirates des Erdgas Sportparks (bis Ende 2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Halle, Halle,<br/>Mitglied des Stadtrates (bis Ende 2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung Bürger für Bürger, Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich', '1982/84 Hochschulstudium Univ. in Dakar (Senegal); 1985/86: Deutschkurs am Herder-Institut der Universität Leipzig. 1986/91 Studium der Chemie Martin-Luther-Univ. Halle-Wittenberg, 1992/96 Promotionsstudium Martin-Luther-Univ. Halle-Wittenberg. 1996/01 Projektleiter im Eine-Welt-Haus Halle, 2001/04 Projektleiter Interkulturelle Bildung beim DAA Halle, 2005/08 Bereichsleiter Migration und Integration der Jugendwerkstatt Frohe Zukunft Halle Saalekreis e. V., 2009/11 Leiter des EU-Projektes Empowerment von MigrantInnen zum nachhaltigen Gelingen der Integration und zur Förderung des Interkulturellen Dialogs der Jugendwerkstatt Frohe Zukunft Halle Saalekreis e. V. 2011/13 Referent im Ministerium für Arbeit und Soziales des Landes Sachsen-Anhalt. 2009/15 Mitgl. Stadtrat der Stadt Halle (Saale) für die SPD-Fraktion. 2009/11 Vors. Bundes Zuwanderungs- und Integrationsrates, 2009/11 Leiter des aus dem Europäischen und Integrationsfond finanzierten EU-Projekts "Empowerment von MigrantInnen zum nachhaltigen Gelingen der Integration und zur Förderung des Interkulturellen Dialogs".  - MdB seit Okt. 2013; stellv. Vors. Ausschuss für Menschenrechte und humanitäre Hilfe.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 73 (Burgenland-Saalekreis)', 'Karamba', '11004259');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08260, NULL, NULL, NULL, 'Diplom-Volkswirtin', 'verheiratet, 2 Kinder', '17.02.1953', NULL, 'Lübeck', 'weiblich', NULL, '22.10.2013', 'Dinges-Dierig', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>addconsulting - Alexandra Dinges-Dierig, Timmendorfer Strand,<br/>Beratung in gesellschaftlicher Verantwortung<br/><br/>Funktionen in Unternehmen: <br/>GHD GesundHeits GmbH Deutschland, Ahrensburg, <br/>Mitglied des Beirates<br/><br/>Textil Treuhand GmbH, Augsburg, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Schule Birklehof e.V., Hinterzarten, <br/>Vorsitzende des Vorstandes, ehrenamtlich', '1972 Abitur. 1977 Diplom-Volkswirtin; 1977/79 Wissenschaftliche Hilfskraft an der Albert-Ludwig-Universität Freiburg. 1981 Diplom-Handelslehrerin, 1981/91 Studienrätin an der Kaufmännischen Schule Emmendingen (Wirtschaft und Mathematik). 1991/96 Referentin im Kultusministerium des Landes Baden-Württemberg für Berufliche Gymnasien und Hochbegabtenförderung, 1996/98 Referentin des Schulausschussvorsitzenden der Kultusministerkonferenz (KMK), 1998/99 Vertreterin des Landes Baden-Württemberg im Schulausschuss der KMK und Referentin im Ministerbüro des Kultusministeriums des Landes Baden-Württemberg, 1999/2000 Leiterin des Ministerbüros im Kultusministerium des Landes Hessen; 2001/04 Leiterin des Landesinstituts für Schule und Medien, Berlin. März 2004/Mai 2008 Senatorin für Bildung und Sport von Hamburg. Seit 2009 Inhaberin einer Beratungsfirma. Mitgl. der Hamburgischen Bürgerschaft Mai 2008/Februar 2011. - MdB seit Okt. 2013.', 'Alexandra', '11004260');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08261, NULL, NULL, NULL, 'Ärztin', 'verheiratet', '15.09.1964', NULL, 'Schweinfurt', 'weiblich', NULL, '22.10.2013', 'Dittmar', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Mitglied des Bayerischen Landtages, München<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kommunalunternehmen des Landkreises Bad Kissingen, Bad Kissingen, <br/>Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Gesellschaft für politische Bildung e.V. Akademie Frankenwarte, Würzburg, <br/>Mitglied des Vorstandes, ehrenamtlich', '1979 qualifiz. Hauptschulabschluss, im Anschluss Berufsfachschule mit Berufsaufbauschule Münnerstadt, 1982 Abschluss staatl. gepr. Kinderpflegerin und Mittlere Reife. Besuch des Bayernkollegs Schweinfurt, Abitur 1985. 1987/93 Medizinstudium an der Universität Würzburg, 1993 Approbation. Weiterbild. zur Praktischen Ärztin. Anerkennung der Zusatzbez. Naturheilverfahren und Akupunktur, bis 2010 Hausärztin. 1981 Eintritt in die  SPD, seit 2008 SPD-Kreisvors. im Lkr. Bad Kissingen, seit 2008 Mitgl. im Bezirksvorst. SPD Unterfranken, seit Juni 2011 Mitgl. im Landesvorstand der BayernSPD. Seit 1990 Kreisrätin im Kreistag Bad Kissingen, 2005/08 SPD-Fraktionsvorsitzende im Kreistag; seit Mai 2008 Marktgemeinderätin Markt Maßbach. Mitgliedschaften (Auswahl): AWO, Europaunion, KIDRO (Kissinger Drogenhilfe), Kreisverkehrswacht, "Gegen Vergessen - Für Demokratie" e. V., Förderverein Fränkisches Theater Maßbach. MdL Bayern 2008/13. Englisch (G), Spanisch (G). - MdB seit Okt. 2013; stellv. gesundheitspolitische Sprecherin der SPD-Fraktion, Mitgl. erweiterter Fraktionsvorst.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 250 (Schweinfurt)', 'Sabine', '11004261');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08263, NULL, NULL, NULL, 'Bürgermeister a. D.', 'verheiratet, 3 Kinder', '08.06.1967', NULL, 'Metzingen', 'männlich', NULL, '22.10.2013', 'Donth', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Gemeinde Römerstein, Römerstein,<br/>Bürgermeister<br/><br/>Funktionen in Unternehmen: <br/>Kreiskliniken Reutlingen gemeinnützige GmbH, Reutlingen,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Amtsgericht Reutlingen, Reutlingen,<br/>Schöffe, ehrenamtlich<br/><br/>Kreissparkasse Reutlingen, Reutlingen,<br/>Mitglied des Verwaltungsrates (bis 30.09.2014)<br/><br/>Landkreis Reutlingen, Reutlingen,<br/>Mitglied des Kreistages, ehrenamtlich', 'Grundwehrdienst in Dornstadt. Studium an der FH Ludwigsburg, 1991 Abschluss als Diplom-Verwaltungswirt (FH). 1999/13 Bürgermeister von Römerstein. Ehrenamtlicher Richter am Amtsgericht Reutlingen. Mitgl. Aufsichtsrat Kreiskliniken Reutlingen, Lektor und Kommunionhelfer der katholischen Kirchengemeinde. Mitgl. der CDU seit 1989, Mitgl. im Kreis- und Bezirksvorstand der CDU. Mitgl. Kreistag Reutlingen seit 1999, 2007/13 Vors. der CDU-Fraktion. - MdB seit Okt. 2013.', 'Michael', '11004262');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08264, NULL, NULL, NULL, 'Volkswirtin', 'verheiratet, 1 Kind', '16.09.1984', NULL, 'Münster', 'weiblich', NULL, '22.10.2013', 'Dröge', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Ministerium für Klimaschutz, Umwelt, Landwirtschaft, Natur- und<br/>Verbraucherschutz des Landes Nordrhein-Westfalen, Düsseldorf,<br/>Referentin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas,<br/>Telekommunikation, Post und Eisenbahnen, Bonn, <br/>Mitglied des Beirates', '2004/10 Studium der Volkswirtschaftslehre Univ. Köln. Referentin im Ministerbüro des NRW-Umweltministeriums. Seit 2000 Mitgl. von BÜNDNIS 90/DIE GRÜNEN, 2002/06 Sprecherin der Grünen Jugend NRW, 2009/14 Kreisvors. BÜNDNIS 90/DIE GRÜNEN Köln. - MdB seit Okt. 2013.', 'Katharina', '11004263');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08266, NULL, NULL, NULL, 'Bürgermeister a. D., Diplom Kaufmann', 'verheiratet, 2 Kinder', '29.07.1971', NULL, 'Augsburg', 'männlich', NULL, '22.10.2013', 'Durz', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadt Neusäß, Neusäß,<br/>Bürgermeister<br/><br/>Funktionen in Unternehmen: <br/>IT-Gründerzentrum GmbH, Augsburg, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreissparkasse Augsburg, Augsburg, <br/>Mitglied des Verwaltungsrates<br/><br/>Landkreis Augsburg, Augsburg, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Brunnhuber Sozialstiftung, Augsburg, <br/>Mitglied des Stiftungsrates<br/><br/>Caritasverband für die Stadt und den Landkreis Augsburg e.V., Augsburg, <br/>Mitglied des Caritasrates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>AHD Vertriebs-GmbH, Neusäß<br/>Durz GbR, Neusäß', '1982/91 Rhabanus-Maurus-Gymnasium Sankt Ottilien, Abitur. 1991/93 Ausbildung bei der Kreissparkasse Augsburg, Bankkaufmann. 1993/99 Studium der Betriebswirtschaftslehre Univ. Augsburg, Dipl.-Kaufmann. 1999/08 Geschäftsführer der fabial GmbH. Mitgl. der CSU seit 1992, seit 1997 Mitgl. im Kreisvorstand. 1996/13 Mitgl. im Stadtrat Neusäß, 2002/08 stellv. Bürgermeister, 2008/13 1. Bürgermeister der Stadt Neusäß. Mitgl. Kreistag Augsburg seit 2002. - MdB seit Okt. 2013.', 'Hansjörg', '11004264');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08267, NULL, NULL, NULL, 'Bürokauffrau', 'verheiratet, 2 Kinder', '22.01.1952', NULL, 'Essen', 'weiblich', NULL, '22.10.2013', 'Eckenbach', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Essener Arbeit-Beschäftigungsgesellschaft mbH, Essen,<br/>Mitglied des Aufsichtsrates<br/><br/>Stadtwerke Essen AG, Essen,<br/>Mitglied des Aufsichtsrates (bis Oktober 2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsches Rotes Kreuz Kreisverband Essen e.V., Essen,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Sozialdienst katholischer Frauen Essen e.V., Essen,<br/>Mitglied des Vorstandes, ehrenamtlich', 'Mitglied der CDU Essen seit 1981. 1984 Fraktionsvors. der Bezirksvertretung VI - Essen-Borbeck, seit 1989 Mitgl. Rat der Stadt Essen. Mitgl. Landschaftsverband Rheinland. Mitgl. Parteivorst. der CDU Essen sowie der CDA Christlich Demokratische Arbeitnehmerschaft Essen und der KPV Kommunalpolitischen Vereinigung Essen. Mitgl. Aufsichtsräte der Stadtwerke Essen, Mitgl. Vorstand Sozialdienst kath. Frauen Essen-Mitte e. V. und Vorstand KAB Stadtverband Essen. - MdB seit Okt. 2013.', 'Jutta', '11004265');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08268, NULL, NULL, NULL, 'Staatl. geprüfte und anerkannte Erzieherin, Judolehrerin', 'verheiratet, 2 Kinder', '10.10.1960', NULL, 'Hagen (Westfalen)', 'weiblich', NULL, '22.10.2013', 'Engelmeier', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landtag Nordrhein-Westfalen, Düsseldorf,<br/>Referentin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Oberbergischer Kreis, Gummersbach, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Judo-Bund e.V., Frankfurt/Main, <br/>Vizepräsidentin, ehrenamtlich', 'Staatlich geprüfte und anerkannte Erzieherin, Judolehrerin. Bezugspädagogin an einer Förderschule für soziale und emotionale Entwicklung in Gummersbach. Seit 1992 Mitgl. der SPD, seit 2009 Mitgl. SPD-Parteivorstand, stellv. Kreisvors. SPD Oberberg, stellv. Regionalvors. der SPD Mittelrhein. Seit 2004 Kreistagsmitgl. Oberbergischer Kreis. Seit 2000 Vizepräsidentin des Deutschen Judo Bundes e. V., ehem. Mitgl. der Judo-Nationalmannschaft, seit April 2016 Vizepräsidentin des Landessportbundes NRW. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 100 (Rheinisch-Bergischer Kreis)', 'Michaela', '11004266');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08269, NULL, NULL, NULL, 'Staatlich geprüfte Informatikerin', 'verheiratet, 3 Kinder', '28.08.1961', NULL, 'Stuttgart', 'weiblich', NULL, '22.10.2013', 'Esken', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landeselternbeirat Baden-Württemberg, Stuttgart, <br/>Stellv. Vorsitzende', 'Abitur. Einige Semester Studium der Germanistik und Politikwissenschaft. Tätigkeiten als Produktionshelferin, Kellnerin, Paketbotin, Chauffeurin und Sekretärin. Ausbildung zur staatlich geprüften Informatikerin (ADV), Tätigkeit in der Programmierung. 1990 Eintritt in den SPD-Ortsverein Bad Liebenzell, seit 2010 Kreisvors. der SPD. Seit 2009 Kreisrätin. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 260 (Böblingen)', 'Saskia', '11004267');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08270, NULL, 'Dr. Dr. h.c.', 'Dr. Dr. h.c.', 'Rechtsanwalt', 'verpartnert', '14.05.1965', NULL, 'Agnetheln', 'männlich', NULL, '22.10.2013', 'Fabritius', NULL, 'CSU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwalt, selbständig, München<br/><br/>Öffentlich bestellter, allgemein beeidigter Übersetzer, Dolmetscher für Rumänisch, München<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, selbständig, München<br/><br/>Öffentlich bestellter, allgemein beeidigter Übersetzer, Dolmetscher für Rumänisch, München<br/><br/>Funktionen in Unternehmen: <br/>Autohaus Michael Schmidt GmbH, Starnberg, <br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung Flucht, Vertreibung, Versöhnung, Berlin, <br/>Mitglied des Stiftungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bavaria - Romania, Förderverein für Soziale Assistenz in Rumänien e.V., München,<br/>Vorsitzender, ehrenamtlich<br/><br/>Bund der Vertriebenen (BdV), Bonn,<br/>Präsident<br/><br/>Bundesstiftung Magnus Hirschfeld, Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Deutsches Institut für Menschenrechte e.V. (DIMR), Berlin,<br/>Mitglied des Kuratoriums<br/><br/>Föderation der Siebenbürger Sachsen in aller Welt e.V., München,<br/>Präsident<br/><br/>Stiftung Bavaria - Romania für soziale Assistenz in Rumänien, Hermannstadt,<br/>Vizepräsident, ehrenamtlich<br/><br/>Verband der Siebenbürger Sachsen in Deutschland e.V., München,<br/>Präsident', '1983 Abitur Brukenthalgym. Hermannstadt. 1985/88 Studium Sozialverwaltung Bay. BFH, Dipl.-Verwaltungswirt; 1989/91 Studium Politikwiss., Hochschule für Politik (HFP), Abschlusszertifikat; 1991/95 Studium Rechtswiss., LMU München, 1997 2. Staatsexamen; Promotion Dr. iur. (2000/03 Kooperationspromotion ULBS Hermannstadt und Eberhard-Karls-Univ. Tübingen). 1985/91 Beamter Bay. Staatsmin. für Arbeit, Sozialordnung, Familie und Frauen, Landesversicherungsanstalt (LVA) Oberbayern, 1991/97 Rentenberater/Prozessagent (Zulassung: Bay. Landessozialgericht); seit 1997 Rechtsanwalt; 1997/05 Lehrbeauftragter für Prozessrecht FHSV Meißen, seit 2003 Prof. Univ. Asoc. Europa-Universität ROGER und ULBS Hermannstadt. Präs. Bund der Vertriebenen (BdV), Präsident Verband der Siebenbürger Sachsen in Deutschland e. V., Präs. Föderation der Siebenbürger Sachsen in aller Welt, Mitgl. Sudentendeutscher Rat e. V., Vizepräs. Stiftung Bavaria-Romania für Soziale Assistenz, Vorstandsmitgl. Deutsch-Rumänisches-Forum. 2011 Träger der Europa-Medaille der Bayrischen Staatsregierung, 2011 Träger des Nationalen Verdienstordens Rumäniens. Seit 2003 Mitgl. der CSU, Mitgl. CSU-Parteivorst., stellv. Landesvors. Union der Vertriebenen und Aussiedler (UdV), Mitgl. Bundesvorst. Ost- und Mitteldeutsche Vereinigung der CDU/CSU - Union der Vertriebenen und Flüchtlinge (OMV). - MdB seit Okt. 2013; 1. stellv. Vors. der Gruppe der Vertriebenen, Aussiedler und dt. Minderheiten, stellv. Vors. Dt.-Rumänische PG; stellv. Mitgl. der PV des Europarats (PVER), dort 1. stellv. Vors. im Ausschuss für Recht und Menschenrechte und UA für Minderheitenrechte, stellv. Mitgl. der Interparl. Union (IPU), dort ord. Mitglied Ausschuss Menschenrechte von Parlamentariern; Vertreter des BT im Kuratorium der Bundesstiftung Magnus Hirschfeld; Mitgl. in der MV des Goethe-Instituts e.V. und Kuratorium Dt. Inst. für Menschenrechte (DIMR).', 'Bernd', '11004268');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08272, NULL, NULL, NULL, 'Landwirtschaftsmeister', 'verheiratet, 5 Kinder', '26.03.1963', NULL, 'Böhmenkirch', 'männlich', NULL, '22.10.2013', 'Färber', NULL, 'CDU', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Hermann Färber GbR, Böhmenkirch,<br/>Landwirtschaftsmeister<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Unternehmer, selbständig, Winterdienst und Photovoltaikanlage, Böhmenkirch<br/>Albwerk GmbH & Co KG, Geislingen, monatlich, Stufe 1<br/><br/>Hermann Färber GbR, Böhmenkirch, <br/>Geschäftsführer, monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>AR Agrar-Redaktion GmbH, Stuttgart, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Buchstelle LBV GmbH, Stuttgart, <br/>Mitglied des Aufsichtsrates<br/><br/>Volksbank Göppingen eG, Göppingen, <br/>Mitglied der Vertreterversammlung, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Jagdgenossenschaft der Gemeinde Böhmenkirch, Böhmenkirch, <br/>Mitglied des Jagdbeirates, ehrenamtlich<br/><br/>Kreisbauernverband Göppingen e.V., Eislingen/Fils, <br/>Kreisvorsitzender und Mitglied des Vorstandes<br/><br/>Kreissparkasse Göppingen, Göppingen, <br/>Mitglied des Beirates<br/><br/>Landesbauernverband Baden-Württemberg e.V., Stuttgart, <br/>Mitglied des Vorstandes und des Geschäftsführenden Vorstandes ehrenamtlich<br/><br/>Landkreis Göppingen, Göppingen, <br/>Mitglied des Kreisjagdausschusses, ehrenamtlich<br/><br/>Ministerium für Ländlichen Raum und Verbraucherschutz Baden-Württemberg, Stuttgart, <br/>Stellv. Mitglied des Landesjagdbeirates, ehrenamtlich<br/>Stellv. Mitglied des Landestierschutzbeirates, ehrenamtlich<br/><br/>Sozialversicherung für Landwirtschaft, Forsten und Gartenbau, Kassel, <br/>Vorsitzender des Bezirksbeirates<br/><br/>Tierseuchenkasse Baden-Württemberg, Stuttgart, <br/>Stellv. Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Hermann Färber GbR, Böhmenkirch', 'Ausbildung zum Mechaniker. Landwirt bzw. Landwirtschaftsmeister, selbstständiger landwirtschaftlicher Unternehmer. 1986/88 Vors. der Kreislandjugend Göppingen, seit 1999 Vors. Kreisbauernverband Göppingen und Vorstandsmitgl. im Landesbauernverband, seit 2006 Mitgl. im Geschäftsführenden Vorstand des Landesbauernverbandes in Baden-Württemberg. Mitgl. der CDU. Mitgl. des Kreistags 2004/09. Mitgl. der Freiwilligen Feuerwehr Böhmenkirch und des Musikvereins Böhmenkirch. - MdB seit Okt. 2013.', 'Hermann', '11004269');
