Emmendingen, Tabakverein Mahlberg, FC Bundestag und Hochburgverein Emmendingen. Englisch (f). - MdB seit Okt. 2013; seit Sept. 2014 Sprecher der SPD-Fraktion für Recht und Verbraucherschutz.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 285 (Rottweil-Tuttlingen)', 'Johannes', '11004270');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08275, NULL, NULL, NULL, 'Diplom-Finanzwirt  (FH)', 'verheiratet, 3 Kinder', '02.11.1965', NULL, 'Luhdorf', 'männlich', NULL, '22.10.2013', 'Feiler', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Sachsen-Anhalt, Oberfinanzdirektion, Magdeburg,<br/>Beamter in der Finanzverwaltung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Havelland, Rathenow, <br/>Mitglied des Kreistages', 'Abitur 1985 in Winsen. 1985/88 Studium der Finanzwissenschaften in der niedersächsischen Finanzverwaltung, 1988 Dipl.-Finanzwirt. Seit 1991 Finanzverwaltung des Landes Sachsen-Anhalt. Mitgl. der CDU seit 2005, 2007/11 Mitgl. Vorst. der CDU Havelland, seit 2011 stellv. Vors. der CDU Havelland und seit Juni 2015 Landesvors. der MIT Brandenburg. Mitgl. der Gemeindevertretung Havelaue 2008/12, Mitgl. Kreistag Havelland seit 2008. - MdB seit Okt. 2013.', 'Uwe', '11004271');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08277, NULL, 'Dr.', 'Dr.', 'Klassischer Philologe', 'verheiratet, 3 Kinder', '01.09.1968', NULL, 'Kiel', 'männlich', NULL, '22.10.2013', 'Felgentreu', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Schulstiftung der Evangelischen Kirche Berlin-Brandenburg-schlesische Oberlausitz, Berlin,<br/>	Lehrer<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Freie Universität, Berlin, <br/>	Privatdozent<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Atlantische Gesellschaft e.V., Berlin, <br/>	Beisitzer des Vorstandes, ehrenamtlich<br/><br/>	Deutsch-Moldauisches Forum e.V., Berlin, <br/>	Vorsitzender, ehrenamtlich<br/><br/>	Volksbund Deutsche Kriegsgräberfürsorge e.V., Landesverband Berlin, Berlin, <br/>	Landesvorsitzender', '1974/87 Schulzeit in Schleswig-Holstein. 1987/89 Wehrdienst, Ausbildung zum Reserveoffizier. 1989/95 Studium der Klassischen Philologie an der Freien Universität Berlin; 1998 Promotion; 2008 Habilitation. 1998/08 Wissenschaftl. Assistent, Wintersemester 2008/09 und Wintersemester 2011/12 Lehrstuhlvertretungen für Griechisch und Latein an der Ruhr-Universität Bochum. 2010/13 Lehrer an einem Berliner Gymnasium für Griechisch und Latein; Sommersemester 2012 Gastprofessur an der FU Berlin. 2001/11 Mitgl. Abgeordnetenhaus von Berlin, stellvertretender Fraktionsvorsitzender, rechtspolitischer Sprecher. Seit 1992 Kommunalpolitik in Neukölln, bis April 2014 Vors. der SPD Neukölln, 2012/April 2016 stellv. Landesvors. und seit April 2016 Mitgl. im Landesvorst. der SPD Berlin. Seit März 2014 Landesvors. Volksbund Deutsche Kriegegräberfürsorge Berlin e. V.- MdB seit Okt. 2013; seit Mai 2015 stellv. verteidigungspol. Sprecher der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 86 (Berlin-Lichtenberg)', 'Fritz', '11004272');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08278, NULL, 'Dr.', 'Dr.', 'Diplom-Mathematikerin', 'verheiratet, 2 Kinder', '16.12.1956', NULL, 'Wiesbaden', 'weiblich', NULL, '22.10.2013', 'Finckh-Krämer', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Presse- und Informationsamt der Bundesregierung, Berlin,<br/>Referentin<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bund für Soziale Verteidigung e.V., Minden, <br/>Mitglied des Vorstandes, ehrenamtlich (bis März 2014)<br/><br/>Plattform Zivile Konfliktbearbeitung e.V., Köln, <br/>Mitglied des Vorstandes, ehrenamtlich (bis März 2014)<br/><br/>Stiftung Friedensbildung, Marburg, <br/>Mitglied des Beirates, ehrenamtlich', '1974 Abitur am Alten Gymnasium Bremen. Studium der Mathematik mit Nebenfach Physik in Erlangen und Tübingen, 1981 Diplom; Promotion zum Dr. rer. nat. im Fach Mathematik 1986. Zuletzt Referentin im Presse- und Informationsamt der Bundesregierung. Mitgl. u. a. ver.di, AWO, Bund für Soziale Verteidigung, Plattform Zivile Konfliktbearbeitung, Öko-Institut, taz Genossenschaft. Seit 1972 Mitgl. der SPD. - MdB seit Okt. 2013; seit März 2014 Obfrau im Unterausschuss Zivile Krisenprävention, Konfliktbearbeitung und vernetztes Handeln und Sprecherin der AG Zivile Krisenprävention, seit Mai 2014 stellv. Vors. Unterausschuss Abrüstung, Rüstungskontrolle und Nichtverbreitung, Mitgl. der dt. Delegation der PV des Europarats.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 80 (Berlin-Charlottenburg-Wilmersdorf)', 'Ute', '11004273');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08279, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet', '15.04.1974', NULL, 'Bochum', 'männlich', NULL, '22.10.2013', 'Flisek', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwalt, Passau<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Flisek + Galla Rechtsanwaltsgesellschaft mbH, Passau,<br/>Rechtsanwalt, monatlich, Stufe 1 (bis Februar 2016)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Passau, Passau,<br/>Mitglied des Stadtrates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Flisek + Galla Rechtsanwaltsgesellschaft mbH, Passau (bis Februar 2016)', 'Abitur am altsprachl. Karlsgymn. in Bad Reichenhall. Wehrdienst bei den Gebirgsjägern in Berchtesgaden. Studium Rechtswiss. und Betriebswirtschaftslehre Univ. Passau, Studienaufenthalte in Santiago de Compostela (Spanien) und Lublin (Polen); Stipendiat der Friedrich-Ebert-Stiftung; 1999 1. Jur. Staatsexamen; Referendarausbild. beim Landratsamt Freyung-Grafenau, Verwaltungsgericht Regensburg, Staatsanwaltschaft Deggendorf, 2001 2. Jur. Staatsexamen; 2002 Zulassung als Rechtsanwalt. 2001/04 wiss. Assistent Lehrstuhl für IT- und Sicherheitsrecht (Univ. Passau). 2003 Gründung Rechtsanwaltskanzlei Flisek + Galla in Passau, Deggendorf, Altötting, Fachanwalt für Gewerbl. Rechtschutz, Arbeitsschwerpunkte Marken-, Patent-, Wettbewerbs- und Urheberrecht. Versch. Lehraufträge u. a. Univ. Passau, Bayer. Verwaltungsschule. Mitgl. Vorst. Verein der Festspiele Europ. Wochen e. V.; Mitgl. u. a. AWO Passau, Dt. Alpenverein Sektion Passau, Dt. Anwaltsverein Passau, Managerkreises der Friedrich-Ebert-Stiftung Berlin, Dt. Vereinigung für Gewerbl. Rechtsschutz und Urheberrecht e. V. (GRUR) und VdK e. V. Mitgl. Landesvorst. BayernSPD, SPD-Bezirksvors. Niederbayern, Unterbezirksvors. SPD Passau. Englisch (f), Spanisch (G). - MdB seit Okt. 2013; seit März 2014 Sprecher AG zum 1. Untersuchungsausschuss (NSA) und Beauftragter für Existenzgründungen der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 231 (Straubing)', 'Christian', '11004274');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08280, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'verheiratet, 3 Kinder', '12.04.1951', NULL, 'Drevenack', 'männlich', NULL, '22.10.2013', 'Freese', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>		Industriegewerkschaft Bergbau, Chemie und Energie, Hannover,<br/>	Stellv. Vorsitzender<br/><br/>Funktionen in Unternehmen: <br/>		DMT GmbH & Co. KG, Essen,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis 30.06.2014)<br/><br/>GSG Wohnungsbau Braunkohle GmbH, Köln,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis 31.12.2013)<br/><br/>Lanxess AG, Köln,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis Mai 2015), 2014, Stufe 5; 2015, Stufe 5; 2016, Stufe 4<br/><br/>Lanxess GmbH, Köln,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis Mai 2015)<br/><br/>Medizinisches Zentrum der Städteregion Aachen gemeinnützige GmbH, Würselen,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis 31.12.2013)<br/><br/>Lausitz Energie Kraftwerke AG, Cottbus,<br/>Stellv. Vorsitzender des Aufsichtsrates, 2016, Stufe 3<br/><br/>Lausitz Energie Bergbau AG, Cottbus,<br/>Stellv. Vorsitzender des Aufsichtsrates, 2015, Stufe 3<br/><br/>Vattenfall GmbH, Berlin,<br/>Mitglied des Aufsichtsrates und Mitglied des Präsidiums, 2013, Stufe 3; 2014, Stufe 3; 2015, Stufe 3; 2016, Stufe 3<br/><br/>VIVAWEST GmbH, Gelsenkirchen,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis 30.06.2014), 2013, Stufe 3<br/><br/>VIVAWEST Wohnen GmbH, Gelsenkirchen,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis 30.06.2014), 2013, Stufe 4<br/><br/>WBG Wohnungsbaugesellschaft für das Rheinische Braunkohlenrevier GmbH, Köln,<br/>Stellv. Vorsitzender des Aufsichtsrates (bis 31.12.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Deutsche Rentenversicherung Knappschaft-Bahn-See, Bochum, <br/>	Vorsitzender des Vorstandes, ehrenamtlich (bis 31.12.2013)<br/><br/>	Landkreis Spree-Neiße, Forst, <br/>	Mitglied des Kreistages (bis Mai 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Deutsche Montan Technologie für Rohstoff, Energie, Umwelt e.V. (DMT), Essen, <br/>	Stellv. Vorsitzender, ehrenamtlich (bis 31.12.2013)<br/><br/>	Erholungswerk Heinrich Imbusch e.V., Bochum, <br/>	Vorsitzender, ehrenamtlich (bis 31.12.2013)<br/><br/>	Revierarbeitsgemeinschaft für kulturelle Bergmannsbetreuung e.V. (REVAG), Herne, <br/>	Stellv. Vorsitzender, ehrenamtlich (bis 31.12.2013)<br/><br/>	Stiftung Lausitzer Braunkohle, Cottbus, <br/>	Stellv. Vorsitzender des Stiftungsrates, ehrenamtlich<br/><br/>Vereinbarungen über künftige Tätigkeiten oder Vermögensvorteile: <br/>		Industriegewerkschaft Bergbau, Chemie, Energie (IG BCE), Hannover, <br/>	Anspruch auf übergangsweise Fortzahlung der Bezüge aus der früheren Vorstandstätigkeit in Höhe von monatlich Stufe 3<br/>	bei gleichzeitiger Weiterleitung der Abgeordnetenbezüge an die IG BCE bis zum Eintritt in die gesetzliche Altersrente 	(April 2016).', '1965/68 Berufsausbildung Betriebsschlosser. 1968/76 Betriebsschlosser unter Tage. 1975/76 Akademie der Arbeit Frankfurt am Main. 1976 Gewerkschaftssekretär. 1999 Mitgl. im geschäftsführenden Hauptvorstand der IG Bergbau, Chemie, Energie, 2005/13 stellv. Vors. der IG BCE. Mitgl. der SPD seit 1970, 1993/03 Vors. SPD-Unterbezirk Spree-Neiße. Mitgl. der Stadtverordnetenversammlung Herten 1989/91, Mitgl. des Kreistags Spree-Neisse. MdL Brandenburg 1994/04. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 63 (Frankfurt (Oder) - Oder-Spree)', 'Ulrich', '11004275');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08282, NULL, NULL, NULL, 'Oberbürgermeister a.D., Jurist', 'verheiratet, 3 Kinder', '08.08.1973', NULL, 'Säckingen', 'männlich', NULL, '22.10.2013', 'Frei', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadt Donaueschingen, Donaueschingen,<br/>Oberbürgermeister<br/><br/>Funktionen in Unternehmen: <br/>Energiedienst Holding AG, Laufenburg, Schweiz,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Schwarzwald-Baar-Kreis, Villingen-Schwenningen,<br/>Mitglied des Kreistages<br/><br/>Sparkasse Schwarzwald-Baar, Villingen-Schwenningen,<br/>Mitglied des Verwaltungsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesakademie für musikalische Jugendbildung e.V., Trossingen,<br/>Mitglied des Kuratoriums<br/><br/>Kunststiftung Hohenkarpfen e.V., Hausen ob Verena,<br/>Mitglied des Kuratoriums', '1993 Abitur am Scheffelgymnasium in Bad Säckingen. 1993/94 Grundwehrdienst bei der Deutsch-Französischen Brigade. 1994/99 Studium der Rechtswissenschaften Univ. Freiburg, 1. Staatsexamen; 1999/01 Juristisches Referendariat am Landgericht Waldshut-Tiengen, 2. Staatsexamen. 1999/02 Lehrbeauftragter für Wirtschaftsrecht an der Dualen Hochschule Baden-Württemberg in Lörrach. 2001/02 Rechtsanwalt. 2002/04 Regierungsrat im Staatsministerium Baden-Württemberg, Persönlicher Referent des Staats- und Europaministers. 2004/13 Oberbürgermeister von Donaueschingen. 2006/16 Landesvors. der Kommunalpolitischen Vereinigung der CDU Baden-Württemberg,  seit 2007 stellv. Landesvors. der CDU Baden-Württemberg. 1999/2004 Stadtrat und CDU-Fraktionsvors. im Gemeinderat der Stadt Bad Säckingen; 2000/04 Mitgl. der Verbandsversammlung des Regionalverbandes Hochrhein-Bodensee, seit 2009 Mitgl. Kreistag Schwarzwald-Baar-Kreises, seit 2011 Vors. der CDU-Fraktion. - MdB seit Okt. 2013.', 'Thorsten', '11004276');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08283, NULL, 'Dr.', 'Dr.', 'Universitätsdozentin', 'verheiratet, 1 Kind', '09.10.1973', NULL, 'Bad Griesbach i. Rottal', 'weiblich', NULL, '22.10.2013', 'Freudenstein', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Universität Regensburg, Regensburg,<br/>Akademische Rätin (Dozentin für Medienwissenschaften)<br/><br/>Funktionen in Unternehmen: <br/>Stadtbau GmbH, Regensburg, <br/>Mitglied des Aufsichtsrates (bis 30.04.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Regensburg, Regensburg, <br/>Mitglied des Stadtrates', '1992 Abitur am Wilhelm-Diess-Gymmasium Pocking. 1992/93 Volontariat bei unserRadio Passau; 1994/98 Studienbegleitendes Volontariat bei der Passauer Neuen Presse, 1993/98 Studium an der Univ. Passau, 2009 Promotion zur Dr. phil. 1998/10 Journalistin beim Bayerischen Rundfunk, seit 2010 Dozentin für Medienwisssenschaft an der Universität Regensburg. CSU-Mitgl. seit 2004, Stadträtin in Regensburg seit 2008, CSU-Ortsvors. Stadtamhof/Oberer Wöhrd, stellv. CSU-Kreisvors., Mitgl. im CSU-Bezirksvorstand, Mitgl. im FU-Bezirksvorstand und FU-Landesvorstand. - MdB seit 2013.', 'Astrid', '11004277');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08284, NULL, NULL, NULL, 'Selbstständiger Wirtschaftsmediator', 'ohne Angaben', '26.12.1970', NULL, 'Stuttgart', 'männlich', NULL, '22.10.2013', 'Gastel', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>SozialJob Personaldienstleistungen, Filderstadt,<br/>Personaldienstleister<br/><br/>Mediation & Arbeitswelt, Filderstadt,<br/>Wirtschaftsmediator<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Esslingen, Esslingen, <br/>	Mitglied des Kreistages, ehrenamtlich (bis Juli 2014)<br/>	<br/>Stadt Filderstadt, Filderstadt, <br/>	Mitglied des Gemeinderates, ehrenamtlich (bis Juli 2014)<br/>	Mitglied des Betriebsausschusses der Stadtwerke, ehrenamtlich (bis Juli 2014)', 'Ausbildung zum Groß- und Außenhandelskaufmann, Ausbildung zum Altenpflegehelfer; Diplom-Sozialpädagoge (FH), Diplom-Kaufmann (FH). Verkaufs-Sachbearbeiter im Groß- und Außenhandel; zehn Jahre als Sozialpädagoge in der Jugendhilfe tätig, seit 2006 selbstständig mit dem Aufbau und Führung einer Zeitarbeits- und Personalvermittlungsfirma für Fachkräfte im sozialen Bereich, 2012 Übergabe der Firma. Arbeit als Wirtschaftsmediator, Praxisanleiter in der Ausbildung von Erzieherinnen und Erziehern. Seit 1989 Mitgl. der GRÜNEN, 1990 Mitgl. Ortsvorstand der GRÜNEN in Filderstadt, Kassierer, 1990 Mitgründung der Grünen Jugend (damals GAJ) Baden-Württemberg, drei Jahre Mitgl. Landesvorst., 1991 Kreisvorstand der GRÜNEN. 1994/2014 Stadtrat in Filderstadt, 2009/13 Fraktionsvors., 1999/2014 Mitgl. Kreistag. - MdB seit Okt. 2013; Sprecher für Bahnpolitik der Fraktion Bündnis 90/Die Grünen.', 'Matthias', '11004278');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08285, NULL, NULL, NULL, 'Referentin Landesministerium NRW', 'ledig', '05.05.1978', NULL, 'Leverkusen', 'weiblich', NULL, '22.10.2013', 'Giousouf', NULL, 'CDU', NULL, 'muslimisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Ministerium für Arbeit, Integration und Soziales des Landes Nordrhein-Westfalen, Düsseldorf,<br/>Referentin', 'Abitur. Studium der Politikwissenschaften Rheinische Friedrich-Wilhelms-Univ. Bonn. 2008 Referentin im Ministerium für Generationen, Familie, Frauen und Integration des Landes Nordrhein-Westfalen, seit 2010 Referentin im Ministerium für Arbeit, Integration und Soziales des Landes Nordrhein-Westfalen in der Integrationsabteilung, seit Okt. 2013 freigestellt. Seit 2011 Mitgl. im Landesvorst. der CDU NRW, seit 2014 stellv. Vors. CDU-Kreisverband Hagen, seit 2014 Vors. Netzwerk Integration der CDU Deutschlands, seit 2014 Vors. der Union der Vielfalt - Netzwerk Integration der CDU NRW. Seit 2015 Mitgl. Kuratorium der muslimischen Begabtenförderung AVICENNA-Studienwerk. Englisch (f), Türkisch (f). - MdB seit Okt. 2013; seit Jan. 2014 Integrationsbeauftragte der CDU/CSU-Fraktion.', 'Cemile', '11004279');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08287, NULL, NULL, NULL, 'Bankkauffrau', 'verheiratet, 1 Kind', '24.05.1965', NULL, 'Mainz', 'weiblich', NULL, '22.10.2013', 'Groden-Kranich', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rheinland-Pfalz Bank, Mainz,<br/>Bankkauffrau<br/><br/>Funktionen in Unternehmen: <br/>DRK Senioren Service Center gemeinnützige GmbH, Mainz,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>DRK-Rettungsdienst Rheinhessen-Nahe gemeinnützige GmbH, Mainz,<br/>Vorsitzende des Aufsichtsrates, ehrenamtlich<br/><br/>Stadtwerke Mainz AG, Mainz,<br/>Mitglied des Aufsichtsrates<br/><br/>Wohnbau Mainz GmbH, Mainz,<br/>Mitglied des Aufsichtsrates (bis Ende Juni 2014)<br/><br/>Zentrale Beteiligungsgesellschaft der Stadt Mainz mbH, Mainz,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Mainz, Mainz,<br/>Mitglied des Stadtrates, ehrenamtlich<br/>Ortsvorsteherin des Stadtteils Mainz-Hechtsheim, ehrenamtlich (bis 24.07.2014), monatlich, Stufe 1<br/><br/>Zweckverband Sparkasse Mainz, Mainz,<br/>Mitglied der Verbandsversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>DRK Kreisverband Mainz-Bingen e.V., Mainz,<br/>Stellv. Vorsitzende, ehrenamtlich<br/><br/>Kirchbau- und Gemeindeförderverein St. Pankratius Mainz-Hechtsheim e.V., Mainz-Hechtsheim,<br/>Vorsitzende<br/><br/>Stiftung Hoher Dom zu Mainz, Mainz,<br/>Mitglied des Stiftertages<br/><br/>Weiterbildungszentrum Ingelheim, Fridtjof-Nansen-Akademie, Ingelheim,<br/>Mitglied des Stiftungskuratoriums<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>GK Hotelbetriebs-GmbH, Mainz', '1984 Abitur am Maria-Ward Gymnasium Mainz. 1984/87 Ausbildung zur Bankkauffrau bei der LRP Landesbank Rheinland-Pfalz, heute Rheinland-Pfalz Bank Mainz; 1987/89 Traineeprogramm Wertpapierhandel-Wertpapieranalyse bei der LRP, 1989/13 Anlageberaterin bei der Rheinland-Pfalz Bank. Seit 1994 Mitgl. Ortsbeirat Mainz-Hechtsheim, seit 1999 Mitgl. Rat der Stadt Mainz; 2004/14 Ortsvorsteherin von Mainz-Hechtsheim. Stellv. Vors. der CDU-Stadtratsfraktion. Mitgl. Vorst. der CDU Hechtsheim; Mitgl. Landesvorst. der KPV Kommunalpolitische Vereinigung der CDU und der Frauen-Union Rheinland-Pfalz. - MdB seit Okt. 2013.', 'Ursula', '11004280');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08289, NULL, NULL, NULL, 'Jurist, Bezirksstadtrat a. D.', NULL, '17.04.1966', NULL, 'Berlin', 'männlich', NULL, '22.10.2013', 'Gröhler', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bezirksamt Charlottenburg-Wilmersdorf von Berlin, Berlin,<br/>Bezirksstadtrat und stellv. Bezirksbürgermeister<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Gemeinsames Juristisches Prüfungsamt der Länder Berlin und Brandenburg (GJPA), Berlin, <br/>nebenamtlicher Prüfer', '1984 Abitur am Charlottenburger Schiller-Gymnasium. Studium der Rechtswissenschaften an der FU Berlin, 1992 1. jur. Staatsexamen, 1995 2. jur. Staatsexamen mit Schwerpunkt Staats- und Verwaltungsrecht. 1991/2000 Mitgl. der Bezirksverordnetenversammlung Charlottenburg, ab 1994 Fraktionsvors. 1996/2000 Regierungsrat in der Senatsverwaltung für Bauen, Wohnen und Verkehr bzw. Senatsverwaltung für Stadtentwicklung. Seit 1999 nebenamtlicher Prüfer beim Gemeinsamen Justizprüfungsamt Berlin-Brandenburg. Ab 2001 Bezirksstadtrat für Wirtschaft, Personal und Verwaltung im fusionierten Bezirk Charlottenburg-Wilmersdorf  (bis Dez. 2001), Dez. 2001/Okt. 2011 stellv. Bezirksbürgermeister und Bezirksstadtrat für Bauwesen, Okt. 2011/13 stellv. Bezirksbürgermeister und Bezirksstadtrat für Bürgerdienste, Weiterbildung, Kultur, Hochbau und Immobilien. Mitgl. bei Hertha BSC, im Kiez-Kids e. V., im Union Hilfswerk und im Bürger für den Lietzensee e.V. und im NoonSong e. V. - MdB seit Okt. 2013; Mitgl. Hertha BSC Fanclub im Bundestag.', 'Klaus-Dieter', '11004281');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08290, NULL, NULL, NULL, 'Polizeibeamter', 'verheiratet, 2 Kinder', '14.07.1975', NULL, 'Weiden', 'männlich', NULL, '22.10.2013', 'Grötsch', NULL, 'SPD', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Polizeiinspektion Fahndung Waidhaus, Waidhaus,<br/>Polizeibeamter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Neustadt an der Waldnaab, Waldnaab,<br/>Mitglied des Kreistages<br/><br/>Markt Waidhaus, Waidhaus,<br/>Mitglied des Gemeinderates<br/><br/>Zweckverband Rettungsdienst & Feuerwehralarmierung Nordoberpfalz, Weiden,<br/>Mitglied der Verbandsversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Jugendtagungshaus Stützelvilla, Windischeschenbach,<br/>Stellv. Mitglied des Kuratoriums (bis 31.12.2015)<br/><br/>Volkshochschule Vohenstrauß e.V., Vohenstrauß,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Volksschule Waidhaus, staatl. Wirtschaftsschule in Weiden, Abschluss 1992 Mittlere Reife. Ausbildung zum Polizeibeamten in Sulzbach-Rosenberg, Nürnberg, München und Bad Reichenhall. Seit 1999 bei der Polizeiinspektion Fahndung in Waidhaus tätig. Seit 1994 Mitgl. der Jusos und der SPD Waidhaus, 1996/02 Vors. der Jusos Waidhaus, 1998/06  Vors. Juso-Unterbezirk Weiden-Neustadt-Tirschenreuth, 2002/12 Vors. SPD-Ortsverein Waidhaus, seit 2003 stellv. Vors. SPD-Kreisverband Neustadt/WN, seit 2010 Mitgl. SPD-Bezirksvorst. Oberpfalz, seit 2013 Vors. SPD-Unterbezirk Weiden-Neustadt-Tirschenreuth, seit 2017 Generalsekretär der BayernSPD. Seit 2002 Marktrat in Waidhaus, seit 2008 Kreisrat im Landkreis Neustadt/WN. Englisch (f) - MdB seit Okt. 2013; seit Juni 2014 Sprecher der SPD-Fraktion im 2. Untersuchungsausschuss (BKA), seit Okt. 2014 Mitgl. PKG, seit Nov. 2015 Sprecher der SPD-Fraktion im 3. Untersuchungsausschuss (NSU II).<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 232 (Amberg)', 'Uli', '11004282');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08292, NULL, NULL, NULL, 'Geschäftsführer, Rechtsanwalt', 'verheiratet, 3 Kinder', '21.08.1971', NULL, 'Stade', 'männlich', NULL, '22.10.2013', 'Grundmann', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwalt, Stade<br/><br/>carboNXT GmbH, Wischhafen,<br/>Geschäftsführer<br/><br/>CFK Valley Stade Recycling GmbH & Co. KG, Wischhafen,<br/>Geschäftsführer<br/><br/>Karl Meyer AG, Wischhafen,<br/>Leitender Syndikus<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Stade<br/><br/>Funktionen in Unternehmen: <br/>CFK NORD Anlagengesellschaft mbH & Co. KG, Stade, <br/>Gesellschaftervertreter<br/><br/>CFK NORD Betriebsgesellschaft mbH & Co. KG, Stade, <br/>Gesellschaftervertreter<br/><br/>Composite Campus Stade GmbH & Co. KG, Stade, <br/>Gesellschaftervertreter<br/><br/>Eisenbahn und Verkehrsbetriebe Elbe-Weser GmbH (EVB), Zeven, <br/>Mitglied des Aufsichtsrates<br/><br/>Elbe Kliniken Stade-Buxtehude GmbH, Stade, <br/>Mitglied des Aufsichtsrates<br/><br/>Existenzgründungszentrum Stade GmbH & Co. KG, Stade, <br/>Gesellschaftervertreter<br/><br/>Projektentwicklung Stade GmbH & Co. KG, Stade, <br/>Gesellschaftervertreter<br/><br/>Süderelbe AG, Hamburg, <br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Hansestadt Stade, Stade, <br/>Mitglied des Stadtrates, Beigeordneter und<br/>stellv. Bürgermeister<br/><br/>Landkreis Stade, Stade, <br/>Mitglied des Kreistages<br/><br/>Sparkasse Stade-Altes Land, Stade, <br/>Mitglied der Zweckverbandsversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>KunstSignale e.V., Stade, <br/>Mitglied des Vorstandes<br/><br/>Museumsverein Stade e.V., Stade, <br/>Mitglied des Vorstandes', '1987 Realschulabschluss in Stade. 1990 Ausbildungsabschluss zum Chemielaboranten in Buxtehude. 1993 Abitur über 2. Bildungsweg Wirtschaftsgymnasium (BBS Stade). 1995 Ende zweijähriger Bundeswehrdienstzeit als Reserveoffizier in Cuxhaven (Hauptmann d. R.). 2001 Erstes jur. Staatsexamen an der Univ. Hamburg, 2005 Zweites jur. Staatsexamen. Ab 2001 Assistent der Geschäftsleitung, anschl. Justiziar/Rechtsanwalt, Leitender Syndikus, Geschäftsführer in inhabergeführter, mittelständischer Unternehmensgruppe im Bereich der Umweltdienstleistungen. Aufsichtsratstätigkeiten in den Elbe Kliniken Stade-Buxtehude und der Eisenbahnen und Verkehrsbetriebe Elbe-Weser GmbH (EVB), Auszeichnung der aufgebauten Gesellschaft mit dem Deutschen Rohstoffeffizienzpreis 2011 und Auszeichnung "Ort im Land der Ideen 2012". 1987 Eintritt in die JU, Stadt-, Kreis- und Bezirksvors., 1987 Eintritt in die CDU, seit 2003 Vors. der CDU Hansestadt Stade, Mitgl. in übergeordneten parteipol. Gremien. Mitgl. im Rat der Hansestadt Stade, seit 2011 stellv. Bürgermeister der Hansestadt Stade, seit 2001 Abg. im Stader Kreistag, stellv. Fraktionsvors. und u. a. Vors. des Regionalplanungs- und Umweltausschusses. Englisch (G). - MdB seit Okt. 2013.', 'Oliver', '11004283');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08293, NULL, 'Dr.', 'Dr.', 'Senatorin a.D.', '1 Kind', '28.02.1949', NULL, 'Aalen', 'weiblich', NULL, '22.10.2013', 'Gundelach', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Freie Hansestadt Hamburg, Hamburg,<br/>Senatorin<br/><br/>Funktionen in Unternehmen: <br/>ESTA Bildungswerk gemeinnützige GmbH, Bad Oeynhausen, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bund Heimat und Umwelt e.V., Bonn, <br/>Präsidentin<br/><br/>Stiftung Arbeit und Umwelt der IG Bergbau, Chemie, Energie, Hannover, <br/>Stellv. Vorsitzende<br/><br/>Zentralausschuss Hamburgischer Bürgervereine von 1886 e.V., Hamburg, <br/>Präsidentin', '1959/67 Gymnasium und Abitur in Bonn. Ab 1968 Studium der Politischen Wissenschaft, Geschichte, Philosophie und Staatsrecht in Bonn, Promotion Dr. phil.; 1968/69 Pressesprecherin der CDU-Sozialausschüsse (CDA) und verantwortliche Redakteurin ihrer Monatszeitschrift. 1999/03 Staatssekretärin im Hessischen Ministerium für Umwelt, Landwirtschaft und Forsten. 2004/08 Staatsrätin der Behörde für Stadtentwicklung und Umwelt in Hamburg, 2008/2011 Präses der Behörde für Wissenschaft und Forschung, seit November 2010 zugleich Präses der Finanzbehörde und Präses der Behörde für Stadtentwicklung und Umwelt. Seit 2000 Präsidentin des Bundes Heimat und Umwelt e. V. (früher: Deutscher Heimatbund), seit 2007 stellv. Vors. Stiftung Arbeit und Umwelt der IG BCE, Vors. Bürgerverein Wilhelmsburg und Präses des Zentralausschusses Hamburgischer Bürgervereine v. 1886 e. V. - MdB seit Okt. 2013', 'Herlind', '11004284');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08294, NULL, NULL, NULL, 'Wirtschaftsprüfer, Steuerberater', 'verheiratet, 2 Kinder', '06.05.1966', NULL, 'Cuxhaven', 'männlich', NULL, '22.10.2013', 'Güntzler', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>		Wirtschaftsprüfer/Steuerberater, Göttingen, Kassel<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Prof. Dr. Ludewig und Partner GmbH, Kassel,<br/>Geschäftsführer, monatlich, Stufe 1<br/><br/>Prof. Dr. Ludewig und Sozien, Kassel,<br/>Wirtschaftsprüfer/Steuerberater, monatlich, Stufe 1<br/><br/>Quattek & Partner Steuerberatungsgesellschaft, Göttingen,<br/>Wirtschaftsprüfer/Steuerberater, monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>	ANB Energie GmbH, Göttingen,<br/>Mitglied des Beirates (bis 22.06.2015)<br/><br/>Göttinger Händelfestspiele GmbH, Göttingen,<br/>Mitglied des Aufsichtsrates<br/><br/>Göttinger Sport und Freizeit GmbH & Co. KG, Göttingen,<br/>Mitglied des Aufsichtsrates (bis Dezember 2014)<br/><br/>Göttinger Symphonieorchester GmbH, Göttingen,<br/>Mitglied des Aufsichtsrates (bis Januar 2015)<br/><br/>Grundstücksverwaltung Göttingen mbH, Göttingen,<br/>Mitglied des Beirates<br/><br/>MOORE STEPHENS Frankfurt Consulting AG <br/>Wirtschaftsprüfungsgesellschaft i.Gr., Frankfurt/Main,<br/>Mitglied des Aufsichtsrates<br/><br/>Stadtwerke Göttingen AG, Göttingen,<br/>Mitglied des Aufsichtsrates<br/><br/>Steritex KG Schneeweiss 1882 GmbH & Co., Göttingen,<br/>Vorsitzender des Beirates (bis Februar 2015)<br/><br/>Stift am Klausberg-Service GmbH, Göttingen,<br/>Mitglied des Beirates (bis 22.06.2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Evangelisches Stift Alt- und Neu-Bethlehem, Göttingen,<br/>Mitglied des Kuratoriums<br/><br/>Landkreis Göttingen, Göttingen,<br/>Mitglied des Kreistages<br/><br/>Norddeutscher Rundfunk (NDR), Hamburg,<br/>Mitglied des Rundfunkrates<br/><br/>Sparkasse Göttingen, Göttingen,<br/>Mitglied des Verwaltungsrates und der Zweckverbandsversammlung<br/><br/>Stadt Göttingen, Göttingen,<br/>Mitglied des Rates (bis Dezember 2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Arwed Löseke Hochschul-Stiftung, Hildesheim,<br/>Mitglied des Kuratoriums<br/><br/>Institut der Wirtschaftsprüfer e.V. (IDW), Düsseldorf,<br/>Mitglied des Verwaltungsrates', 'Abitur 1985. Grundwehrdienst bei der Bundeswehr. Studium der Betriebswirtschaftslehre Univ. des Saarlandes und Univ. Göttingen, 1992 Examen, Abschluss Dipl.-Kaufmann. Danach Tätigkeit in einer Wirtschaftsprüfungsgesellschaft. 1999 Bestellung zum Steuerberater. Seit 2000 Sozius der Kanzlei Prof. Dr. Ludewig und Sozien, Wirtschaftsprüfer und Steuerberater, Kassel, Geschäftsführer der Prof. Dr. Ludewig und Partner GmbH Wirtschaftsprüfungsgesellschaft, Kassel. Seit 2001 Geschäftsführer der EURATIO Prof. Dr. Ludewig und Quattek GmbH Wirtschaftsprüfungsgesellschaft, Göttingen. Seit 2002 Partner der Quattek und Partner Steuerberatungsgesellschaft, Göttingen. 2003 Bestellung zum Wirtschaftsprüfer. Mitgl. NDR-Rundfunkrat, Mitgl. Verwaltungsrat Institut der Wirtschaftsprüfer. Mitgl. der CDU seit 1989, 1990 Eintritt in die Junge Union; 1992/95 Vors. Stadtverband der Jungen Union Göttingen, 1995/2000 Vors. Bezirksverband Südniedersachsen-Hildesheim der Jungen Union, seit 1996 Mitgl. Landesvorst. der CDU Niedersachsen, seit 2014 stellv. Landesvors., 1999/05 Vors. CDU-Stadtverband Göttingen, seit 2009 Vors. CDU-Kreisverband Göttingen, seit 2013 Vors. des CDU-Bezirksverb. Hildesheim. 2001/14 Ratsherr der Stadt Göttingen und Vors. der CDU-Ratsfraktion. MdL Niedersachsen 2003/08 und 2010/13. Seit Nov. 2016 Mitgl. Kreistag Landkreis Göttingen. Englisch (G). - MdB seit Okt. 2013; seit April 2014 Schatzmeister und Vorstandsmitgl. der Landesgruppe Niedersachsen der CDU/CSU-Fraktion.', 'Fritz', '11004285');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08296, NULL, NULL, NULL, 'Bürgermeister a. D.', 'verheiratet, 1 Kind', '06.05.1966', NULL, 'Höxter', 'männlich', NULL, '22.10.2013', 'Haase', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Stadt Beverungen, Beverungen,<br/>	Bürgermeister<br/><br/>Funktionen in Unternehmen: <br/>	Energie für den Kreis Höxter eG, Beverungen, <br/>	Vorsitzender des Vorstandes, ehrenamtlich<br/><br/>	Photovoltaikanlage Grüner Weg GbR, Beverungen, <br/>	Mitglied der Gesellschafterversammlung<br/><br/>	Westfälische Provinzial Versicherung AG, Münster, <br/>	Mitglied des Kommunalen Beirates (bis 31.12.2013)<br/><br/>	Windpark Twerberg Infrastruktur- und Pool-Verwaltungs GmbH & Co.KG, Beverungen, <br/>	Mitglied der Gesellschafterversammlung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Agentur für Arbeit Paderborn, Paderborn, <br/>	Mitglied des Verwaltungsausschusses (bis 08.11.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Förderverein Kloster Herstelle, Beverungen, <br/>	Stellv. Vorsitzender, ehrenamtlich<br/><br/>	Städte- und Gemeindebund Nordrhein-Westfalen e.V., Düsseldorf, <br/>	Stellv. Kooptiertes Mitglied des Präsidiums<br/><br/>	Wirtschaftsrat der CDU e.V., Berlin, <br/>	Mitglied der Bundesfachkommissionen "Umwelt" und "Stadtentwicklung, Bau und Immobilien"', 'Studium der Verwaltungswissenschaften, 1993 Abschluss als Diplom-Verwaltungswirt (FH). 2004/13 hauptamtlicher Bürgermeister der Stadt Beverungen. Seit 1992 Mitgl. der CDU, Kreisvors. der CDU Höxter, Mitgl. im Bundes- und Landesvorstand der Kommunalpolitischen Vereinigung der CDU. Vorstandsvors. Energie für den Kreis Höxter eG. - MdB seit Okt. 2013.', 'Christian', '11004286');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08297, NULL, NULL, NULL, 'Studienrätin', 'verheiratet, 2 Kinder', '11.11.1970', NULL, 'Porz am Rhein', 'weiblich', NULL, '22.10.2013', 'Hagl-Kehl', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Freistaat Bayern,<br/>	Studienrätin am Gymnasium', '1977/86 Grund- und Hauptschule Thurmansbang. 1986/90 Ausbildung zur Damenschneiderin im Handwerk in Grafenau. 1990/97 Erziehungszeit. 1997/2000 Abendschule in Passau, Abitur am Adalbert-Stifter-Gymnasium in Passau. 2000/05 Studium Lehramt Gymnasium Deutsch und Geschichte, Zweitstudium Politikwissenschaften; 2006/08 Referendariat am Comenius-Gymnasium in Deggendorf. Seit Februar 2008 Lehrerin am Gymnasium Freyung.  - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 228 (Landshut)', 'Rita', '11004287');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08298, NULL, 'Dr.', 'Dr.', 'Dipl.-Lehrer, Mitglied des Landtages a. D.', 'verheiratet, 1 Kind', '20.04.1963', NULL, 'Berlin', 'männlich', NULL, '22.10.2013', 'Hahn', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Sächsischer Landtag, Dresden,<br/>Mitglied des Landtages<br/><br/>Funktionen in Unternehmen: <br/>OVPS - Oberelbische Verkehrsgesellschaft Pirna-Sebnitz mbH, Pirna, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Sächsische Schweiz-Osterzgebirge, Pirna, <br/>Mitglied des Kreistages', 'Berufsausbildung (Schriftsetzer) mit Abitur. 1984/89 Studium als Lehrer für Deutsch/Geschichte Humboldt-Univ. Berlin, anschl. Forschungsstudium Politikwissenschaft, 1994 Promotion zum Dr. rer. soc. 1991/94 Wissenschaftlicher Mitarbeiter der Fraktion LL/PDS im Sächsischen Landtag. Mitgl. der SED 1985/89 und der PDS (jetzt DIE LINKE) seit 1990, 1990 Mitgl. des Zentralen Runden Tisches der DDR (AG Bildung, Erziehung, Jugend), 1991 Mitgl. Bundesvorst., 1991/95 Mitgl. Landesvorst. Sachsen, 1992/99 Mitgl. Bundesparteirat der PDS. 1994 /08 Fraktionsvors. der PDS im Kreistag Sächsische Schweiz, seit 2008 Mitgl. im Kreistag Sächsische Schweiz-Osterzgebirge, 1999/02 Stadtrat in Heidenau. Mitgl. der GEW. MdL Sachsen Dez. 1994/Okt. 2013, 1995/Juli 2007 Parl. Geschäftsführer, August 2007/Juli 2012 Vors. der Fraktion DIE LINKE. - MdB seit Okt. 2013; Parl. Geschäftsführer, stellv. Vors. Parl. Kontrollgremium, sportpolitischer Sprecher der Fraktion DIE LINKE.', 'André', '11004288');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08300, NULL, NULL, NULL, 'Rechtsanwalt', 'ledig', '25.06.1969', NULL, 'Hamburg', 'männlich', NULL, '22.10.2013', 'Hakverdi', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwalt, Hamburg<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Hamburg<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Landesverband Hamburg, Hamburg,<br/>Mitglied der Landesschiedskommission, ehrenamtlich<br/><br/>Europa-Union Landesverband Hamburg e.V., Hamburg,<br/>Schatzmeister, ehrenamtlich (bis 16.09.2015)', '1988 Abitur am Gymnasium Kirchdorf/Wilhelmsburg, 1986 High School Diploma an der Simi Valley High School, CA, USA. 1994 1. jur. Staatsexamen an der Christian-Albrechts-Universität Kiel, 1995/96 Indiana University, School of Law, IN, USA; Referendariat am Oberlandesgericht Oldenburg, 1999 2. jur. Staatsexamen. 2000 Zulassung zum Rechtsanwalt, 2002 Gründung der Kanzlei Metin Hakverdi. Mitgl.  Honigfabrikverein, ESV Einigkeit, Verein Zukunft Elbinsel, der AWO, Hamburger Anwaltsverein, Förderverein Bürgerhaus Wilhelmsburg, Bürgerverein Wilhelmsburg, Mitgl. Vorstand des Kinder-, Jugend- und Familienzentrums Kirchdorf Süd und der Europa-Union Hamburg. 2002 Eintritt in die SPD, stellv. Vors. des Distrikts Wilhelmsburg-West. Mitgl. der Hamburgischen Bürgerschaft März 2008/Okt. 2013, seit April 2008 Schriftführer im Präsidium der Bürgerschaft. - MdB seit Okt. 2013.', 'Metin', '11004289');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08301, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'verheiratet, 1 Kind', '28.10.1964', NULL, 'Alpen', 'männlich', NULL, '22.10.2013', 'Hampel', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Industriegewerkschaft Bergbau, Chemie, Energie (IG BCE),<br/>	Hannover,<br/>	Gewerkschaftssekretär<br/><br/>Funktionen in Unternehmen: <br/>	BASF Coatings AG, Münster, <br/>	Mitglied des Aufsichtsrates, jährlich, Stufe 3<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Bundesstiftung Baukultur, Potsdam, <br/>	Mitglied des Stiftungsrates', '1980/82 Berufsfachschule für Sozialpädagogik, Ernährung und Hauswirtschaft, Ausbildungsgang zum Krankenpfleger; 1982/85 Ausbildung zum Bergmechaniker auf dem Bergwerk Friedrich-Heinrich in Kamp-Lintfort. 1985/91 Hydraulikschlosser unter Tage, 1991/97 Industriegewerkschaft Bergbau und Energie, Bezirk Ruhr-Nord Recklinghausen, Jugendsekretär für Bildung und Arbeitsrecht. 1994 Studium Sozial- u. Arbeitsrecht an der Sozialakademie in Dortmund. 1998/2000 Industriegewerkschaft Bergbau, Energie, Chemie (IG BCE), Bezirk Münster-Bielefeld, Betriebsbetreuung, Sozial- und Arbeitsrecht, Jugend, Bildung und Öffentlichkeitsarbeit, 2000/03 stellv. Bezirksleiter der IG BCE im Bezirk Hamm, seit 2003 Bezirksleiter im Bezirk Münster-Bielefeld. Seit 1982 Mitgl. der SPD. Englisch (G). - MdB seit Okt. 2013.', 'Ulrich', '11004290');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08302, NULL, NULL, NULL, 'Organisationsberater', 'verheiratet', '07.07.1977', NULL, 'Oberhausen', 'männlich', NULL, '22.10.2013', 'Hartmann', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>		Mitarbeiter von Martin Schulz, MdEP, Alsdorf<br/><br/>Organisationsberater und Trainer, freiberuflich, Bornheim<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Parteivorstand der Sozialdemokratischen Partei Deutschlands, Berlin,<br/>Seminardurchführung, Training, 2013, Stufe 2; 2014, Stufe 4<br/><br/>Funktionen in Unternehmen: <br/>		BRS Beteiligungsgesellschaft Bonn/Rhein-Sieg mbH, Siegburg,<br/>Persönlicher Stellvertreter der Gesellschafterversammlung und Mitglied des Verwaltungsrates (bis 21.08.2014)<br/><br/>Elektrische Bahnen der Stadt Bonn und des Rhein-Sieg-Kreises SSB GmbH, Bonn,<br/>Mitglied der Gesellschafterversammlung (bis 21.08.2014)<br/><br/>EnW Energie und Wasserversorgung Bonn/Rhein-Sieg GmbH, Bonn,<br/>Mitglied des Aufsichtsrates (bis 31.03.2014)<br/><br/>Kreisholding Rhein-Sieg GmbH, Siegburg,<br/>Stellv. Vorsitzender der Gesellschafterversammlung (bis 21.08.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahnen, Bonn,<br/>Mitglied des Eisenbahninfrastrukturbeirates<br/><br/>Kreispolizeibehörde Bonn, Bonn,<br/>Persönlicher Stellvertreter des Kreispolizeibeirates (bis 21.08.2014)<br/><br/>Kreissparkasse Köln, Köln,<br/>Mitglied des Verwaltungsrates, 2015, Stufe 3<br/><br/>Rhein-Sieg-Abfallwirtschaftsgesellschaft AöR, Siegburg,<br/>Stellv. Mitglied des Verwaltungsrates (bis 21.08.2014)<br/><br/>Rhein-Sieg-Kreis, Siegburg,<br/>Mitglied des Kreistages<br/>Fraktionsvorsitzender (bis Ende Juni 2014)<br/>Stellv. Landrat<br/><br/>Westdeutscher Rundfunk (WDR), Köln,<br/>Stellv. Mitglied des Rundfunkrates<br/><br/>Zweckverband Verkehrsverbund Rhein-Sieg (ZV VRS), Köln,<br/>Persönlicher Stellvertreter der Verbandsversammlung (bis 21.08.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Deutsch-Polnischer Partnerschaftsverein Bornheim-Zawierce e.V., Bornheim,<br/>Stellv. Vorsitzender<br/><br/>Lokalfunk Bonn/Rhein-Sieg e.V., Bonn,<br/>Mitglied der Vertreterversammlung (bis 21.08.2014)<br/><br/>Region Köln Bonn e.V., Köln,<br/>Mitglied der Mitgliederversammlung (bis 21.08.2014)', 'Clara-Schumann-Gymnasium in Bonn, Abitur. Zivildienst in einer Bildungseinrichtung. Studium der Rechtswissenschaften Univ. Köln; Stipendiat der Friedrich-Ebert-Stiftung. Freiberufliche Tätigkeit als Personal- und Organisationsberater. Ab 2011 Mitarbeiter des Europaabgeordneten und Präsidenten des europäischen Parlaments, Martin Schulz. Seit 1993 Mitgl. der SPD, Vors. der Jusos im Rhein-Sieg-Kreis, 2004 Vors. der SPD in Bornheim und 2005 Vors. der SPD im Rhein-Sieg-Kreis, seit 2014 Regionalvors. der SPD Mittelrhein. Seit 1999 Mitgl. Kreistag Rhein-Sieg, 2007/14 Vors. der SPD-Kreistagsfraktion. Ab 2014 stellv. Landrat des Rhein-Sieg-Kreises. Seit 2014 Mitgl. im Eisenbahninfrastrukturbeirat der Bundesnetzagentur. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 98 (Rhein-Sieg-Kreis II)', 'Sebastian', '11004291');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08304, NULL, NULL, NULL, 'Rechtsanwalt', 'ledig', '18.12.1977', NULL, 'Hattingen', 'männlich', NULL, '22.10.2013', 'Hauer', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>		Dr. Esch & Partner Rechtsanwälte mbB, Wuppertal,<br/>	Rechtsanwalt<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Dr. Esch & Partner Rechtsanwälte mbB, Wuppertal,<br/>Rechtsanwalt, monatlich, Stufe 1, Gewinn (bis 31.03.2014); 2014, Stufe 4 Gewinn (ab April 2014); 2015, Stufe 5 Gewinn; 2016, Stufe 4 Gewinn<br/>   Mandant 01, 2013; 2014<br/>   Mandant 02, 2013<br/>   Mandant 03, 2013; 2014<br/>   Mandant 04, 2013; 2014<br/>   Mandant 05, 2013<br/>   Mandant 06, 2013; 2014; 2015; 2016<br/>   Mandant 07, 2013<br/>   Mandant 08, 2013<br/>   Mandant 09, 2014<br/>   Mandant 10, 2014<br/>   Mandant 11, 2014<br/>   Mandant 12, 2014<br/>   Mandant 13, 2014; 2015; 2016<br/>   Mandant 14, 2014; 2015<br/>   Mandant 15, 2014; 2015<br/>   Mandant 16, 2014<br/>   Mandant 17, 2015<br/>   Mandant 18, 2015<br/>   Mandant 19, 2015<br/>   Mandant 20, 2015<br/>   Mandant 22, 2016<br/><br/>Funktionen in Unternehmen: <br/>		EVV Verwertungs- und Betriebs-GmbH, Essen,<br/>Mitglied des Aufsichtsrates<br/><br/>FVE - Fleischversorgung Essen eG, Essen,<br/>Mitglied des Aufsichtsrates und der Gesellschafterversammlung, ehrenamtlich (bis 08.11.2013)<br/><br/>Großmarkt Essen GmbH, Essen,<br/>Mitglied der Gesellschafterversammlung, ehrenamtlich (bis 08.11.2013)<br/><br/>Großmarkt Essen Grundstücksgesellschaft mbH & Co. KG, Essen,<br/>Mitglied der Gesellschafterversammlung, ehrenamtlich (bis 08.11.2013)<br/><br/>RGE Servicegesellschaft Essen mbH, Essen,<br/>Mitglied des Aufsichtsrates (bis 08.11.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Agentur für Arbeit, Essen,<br/>Mitglied des Ausschusses für anzeigepflichtige Entlassungen, ehrenamtlich (bis 08.11.2013)<br/><br/>Kreispolizeibehörde Essen, Essen,<br/>Mitglied des Beirates, ehrenamtlich (bis 08.11.2013)<br/><br/>Sparkasse Essen, Essen,<br/>Stellv. Mitglied des Verwaltungsrates<br/><br/>Stadt Essen, Essen,<br/>Mitglied des Stadtrates (bis 31.12.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesstiftung Magnus Hirschfeld, Berlin,<br/>Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Diakoniewerk Essen e.V., Essen,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Förderkreis für Schüler- und Lehrlingsbildung Essen e.V., Essen,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Friedrich-und-Wilhelm-Funke-Stiftung, Essen,<br/>Mitglied der Pflegschaft, ehrenamtlich', '1997 Abitur in Essen. 1997/98 Wehrdienst in Essen. 1998/03 Studium der Rechtswissenschaften an der Ruhr-Univ. Bochum, 2003 Erstes Jur. Staatsexamen. 2003/05 Rechtsreferendariat am Landgericht Essen sowie juristische Nebentätigkeit. 2005 Zweites Jur. Staatsexamen und Zulassung als Rechtsanwalt. Seit 2005 Rechtsanwalt und seit 2009 Partner in der Sozietät Esch & Kramer Rechtsanwälte, 2010 Fachanwalt für Bank- und Kapitalmarktrecht. 1993 Eintritt in die JU, 2000/07 Mitgl. Landesvorst. JU NRW, zuletzt Landesjustitiar, 2003/07 Kreisvors. JU Essen, 2007/10 Bezirksvors. JU Ruhrgebiet; 1994 Eintritt in die CDU, seit 2007 Mitgl. Kreisvorst. CDU Essen, 2009/15 Stadtbezirksvors., 2011/15 stellv. Kreisvors. CDU Essen, seit 2015 Kreisvors. der CDU Essen. 1999/04 Mitgl. der Essener Bezirksvertretung IX (Werden/Kettwig/Bredeney), 2004/13 Mitgl. Rat der Stadt Essen, zuletzt ordnungs- und personalpol. Sprecher sowie Mitgl. Fraktionsvorstand. - MdB seit Okt. 2013.', 'Matthias', '11004292');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08306, NULL, NULL, NULL, 'Politikwissenschaftler, Angestellter Thüringer Landesverwaltung', 'ledig', '29.04.1984', NULL, 'Weimar', 'männlich', NULL, '22.10.2013', 'Hauptmann', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Thüringer Ministerium für Bau, Landesentwicklung und Verkehr, Erfurt,<br/>Referent<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Beratender Betriebswirt, freiberuflich<br/>   Kunde 1, 2016, Stufe 4; 2017, Stufe 4<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Rhön-Rennsteig-Sparkasse, Meiningen,<br/>Mitglied des Verwaltungsrates<br/><br/>Stadt Suhl, Suhl,<br/>Mitglied des Stadtrates<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Kairos Communication GbR, Jena (bis 31.12.2013)', '2001 High School Abschluss Oak Park High School, Kansas City, Mo, USA. Abitur 2003 in Suhl. Anschließend Studium der Politikwissenschaft, der Interkulturellen Wirtschaftskommunikation und der Wirtschafts- und Sozialgeschichte in Jena, Osaka und New Heaven. 2009/10 Büroleiter und wissenschaftlicher Mitarbeiter von Christian Hirte, MdB. 2011 Absolvent der Oak Park High School, Kansas City, Mo, USA. Frühere Tätigkeiten in Brüssel und Peking. 2011/13 Geschäftsführer von Kairos Communication. Seit 2013 Angestellter der Thüringer Landesverwaltung im Thüringer Ministerium für Bau, Landesentwicklung und Verkehr. Mitgl. der Jungen Union seit 1999, seit 2003 Mitgl. der CDU, seit 2005 Mitgl. im Landesvorstand der JU Thüringen, 2012/14 Mitgl. im Bundesvorstand der JU. Seit 2014 Mitgl. im Suhler Stadtrat. - MdB seit Okt. 2013.', 'Mark', '11004293');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08307, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'ledig', '18.08.1982', NULL, 'Marburg', 'männlich', NULL, '22.10.2013', 'Heck', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwälte Graf von Westphalen, Frankfurt/Main,<br/>Rechtsanwalt<br/><br/>Philipps-Universität Marburg, Marburg,<br/>Wissenschaftlicher Mitarbeiter<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Amöneburg<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Marburg-Biedenkopf, Marburg, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Schlichtungsstelle der Rechtsanwaltschaft, Berlin, <br/>	Mitglied des Beirates, ehrenamtlich<br/><br/>Stadt Amöneburg, Amöneburg, <br/>Stadtverordneter, ehrenamtlich', '2002 Abitur an der Stiftsschule St. Johann Amöneburg. 2003 Wehrdienst und anschließend Ausbildung zum Reserveoffizier. 2003/07 Studium der Rechtswissenschaften in Marburg und Krakau (Polen), 2007 1. jur. Staatsexamen, 2011/12 Rechtsrefendariat in Frankfurt, Marburg und Speyer, 2011 LL.M-Studium in Krakau, 2012 Promotion zum Doktor der Rechte (Dr. Iur.), 2013 2. jur. Staatsexamen. 2007/13 wissenschaftlicher Mitarbeiter am Institut für Öffentliches Recht der Philipps-Universität Marburg (Prof. Dr. Steffen Detterbeck). Seit März 2013 Rechtsanwalt in einer internationalen Wirtschaftskanzlei in Frankfurt am Main. Landesvors. der Jungen Union Hessen. Seit 2001 Stadtverordneter der Stadt Amöneburg, seit 2011 Stadtverordnetenvorsteher der Stadt Amöneburg, seit 2006 Kreistagsabgeordneter in Marburg-Biedenkopf. - MdB seit Okt. 2013.', 'Stefan', '11004294');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08309, NULL, NULL, NULL, 'Geschäftsführer', 'verheiratet', '21.04.1961', NULL, 'Essen', 'männlich', NULL, '22.10.2013', 'Heidenblut', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Arbeiter-Samariter-Bund Regionalverband Ruhr e.V., Essen,<br/>	Geschäftsführer<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Arbeiter-Samariter-Bund Regionalverband Ruhr e.V., Essen, <br/>	Geschäftsführer, jährlich, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>	ASB-Betriebs gemeinnützige GmbH Ruhr, Bottrop, <br/>	Geschäftsführer, ehrenamtlich (bis 31.12.2013)<br/><br/>	ASB-Service GmbH, Essen, <br/>	Geschäftsführer (bis 31.12.2013)<br/><br/>	PerTransfer Essen GmbH, Essen, <br/>	Mitglied des Aufsichtsrates (bis 31.07.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Agentur für Arbeit Essen, Essen, <br/>	Stellv. Mitglied des Verwaltungsausschusses (bis 30.06.2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Der Paritätische Wohlfahrtsverband, Landesverband<br/>	Nordrhein-Westfalen e.V., Wuppertal, <br/>	Mitglied des Vorstandes, ehrenamtlich', 'Abitur am Gymnasium Essen Nord-Ost. Ab 1979 Helfer im Katastrophenschutz. Jurastudium in Würzburg und Bochum. Seit 1987 Geschäftsführer beim Arbeiter-Samariter-Bund in Essen, heute Regionalverband Ruhr e.V. 2009/13 Mitgl. und sozialpolitischer Sprecher der SPD-Fraktion im Rat der Stadt Essen, 2010/13 Mitgl. der SPD-Fraktion im Landschaftsverband Rheinland (LVR). Mitgl. im Beirat des JobCenter Essen. Vors. Paritätischer Wohlfahrtsverband in Essen, Mitgl. Vorstand des ASB Betreuungsvereins Ruhr e.V., stellv. Vors. der PSAG Essen. Mitgl. der AWO, Mitgl. der IG BCE. - MdB seit Okt. 2013.', 'Dirk', '11004295');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08310, NULL, NULL, NULL, 'Redakteurin', 'verheiratet, 1 Kind', '18.04.1963', NULL, 'Berlin', 'weiblich', NULL, '22.10.2013', 'Heinrich', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>DATEV eG, Nürnberg,<br/>Redakteurin', 'Diplom-Medienberaterin, TU Berlin. Redakteurin seit über 20 Jahren. Vorsitzende pro familia Nürnberg e.V., Mitgl. im Vorst. von Help - Hilfe zur Selbsthilfe e. V., Mitgl. im Parl. Beirat für Bevölkerung und Entwicklung, Mitgl. ver.di. Stadträtin in Nürnberg 2002/13. - MdB seit Okt. 2013; seit Jan. 2014 stellv. Sprecherin der SPD-Fraktion für Menschenrechte und Humanitäre Hilfe, seit März 2016 stellv. Sprecherin der SPD-Fraktion für wirtschaftliche Zusammenarbeit und Entwicklung; seit Mai 2014 Vors. der Parlamentariergruppe Maghreb-Staaten; Mitglied in der PV des Europarates.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 246 (Roth)', 'Gabriela', '11004296');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08311, NULL, NULL, NULL, 'Jurist, Bürgermeister', 'verheiratet, 2 Kinder', '15.10.1977', NULL, 'Ludwigshafen am Rhein', 'männlich', NULL, '22.10.2013', 'Held', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Gemeinnützige Wohnungsbaugenossenschaft eG (GWG),<br/>	Oppenheim,<br/>	Geschäftsführer<br/><br/>	HGO-Haus- und Grundstücksverwaltungsgesellschaft der<br/>	Gemeinnützigen Wohnungsbaugenossenschaft Oppenheim mbH,<br/>	Oppenheim,<br/>	Geschäftsführer und Makler<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	HGO-Haus- und Grundstücksverwaltungsgesellschaft der<br/>	Gemeinnützigen Wohnungsbaugenossenschaft Oppenheim mbH,<br/>	Oppenheim, <br/>	Geschäftsführer<br/><br/>Funktionen in Unternehmen: <br/>	Gemeinnützige Wohnungsbaugenossenschaft eG (GWG),<br/>	Oppenheim, <br/>	Mitglied des Vorstandes<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Stadt Oppenheim, Oppenheim, <br/>	Bürgermeister, monatlich, Stufe 1<br/><br/>	Verbandsgemeinde Rhein-Selz, Oppenheim, <br/>	1. Beigeordneter, monatlich, Stufe 1 (bis 01.08.2014)<br/>	Beauftragter für das Hallenbad<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Stiftung Zivilhospital, Oppenheim, <br/>	Vorsitzender der Stiftungskommission', 'Grundschule in Obrigheim/Pfalz, 1987/97 Gauß-Gymnasium Worms, Abitur. 1997/98 Zivildienst im Bereich Umweltschutz. 1998 Studium der Rechtswissenschaften Univ. des Saarlandes in Saarbrücken, 2000 Fortsetzung des Jura-Studiums in Mainz; 2003 erstes jur. Staatsexamen in Mainz, 2006 zweites jur. Staatsexamen in Mainz, Zulassung als Rechtsanwalt. 1995/03 freier Mitarbeiter bei der Wormser Zeitung und der Allgemeinen Zeitung; während des gesamten Studiums studentische Hilfskraft beim Bundestagsabgeordneten Klaus Hagemann; 2001 studentische Hilfskraft in der Staatskanzlei Rheinland-Pfalz in Mainz, Geschäftsstelle Tag der Deutschen Einheit; 2007 Persönlicher Referent von Landrat Ernst Walter Görisch bei der Kreisverwaltung Alzey-Worms; 2009 Wechsel zur Gemeinnützigen Wohnungsbaugenossenschaft Oppenheim eG, Bestellung als Vorstandsvorsitzender.<br/>1994 Eintritt in die SPD und Gründung der Juso-AG Grünstadt-Land. Seit 2004 Stadtbürgermeister von Oppenheim, 2009/2014 1. Beigeordneter der Verbandsgemeinde Nierstein-Oppenheim. Mitgl. im Kreistag Mainz-Bingen. Englisch (f), Französisch (f). - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 209 (Neustadt-Speyer)', 'Marcus', '11004297');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08313, NULL, NULL, NULL, 'Betriebswirt', 'verheiratet', '08.09.1978', NULL, 'Itzehoe', 'männlich', NULL, '22.10.2013', 'Helfrich', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Hamburg Netz GmbH, Hamburg,<br/>	Kaufmännischer Angestellter<br/><br/>Funktionen in Unternehmen: <br/>	Entwicklungsgesellschaft Brunsbüttel mbH, Brunsbüttel, <br/>	Mitglied des Aufsichtsrates, von Amts wegen (bis 31.12.2013)<br/>	Beratendes Mitglied des Aufsichtsrates (Gaststatus), ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Kreis Steinburg, Itzehoe, <br/>	Mitglied des Kreistages (bis 30.11.2013)<br/><br/>	Zweckverband Wasserwerk Wacken, Wacken, <br/>	Stellv. Mitglied der Verbandsversammlung (bis 30.11.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Europaverband der Selbständigen - Deutschland e.V. (ESD), Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>	THW-Landesvereinigung Schleswig-Holstein e.V., Kiel, <br/>	Stellv. Vorsitzender, ehrenamtlich<br/><br/>Wirtschaftsrat der CDU e.V., Berlin,<br/>Mitglied des Vorstandes der Sektion Dithmarschen, ehrenamtlich', '1989/99 Auguste Viktoria-Schule, Itzehoe, Abitur; 1995/96 Stanton College Preparatory School, Jacksonville, Florida, USA. 1999/2000 Grundwehrdienst, 8./ Sanitätsregiment 6, Breitenburg. 2000/04 BWL-Studium, PFH Göttingen, Dipl.-Kfm. (FH). 2005 Konzernrevision Barilla Holding S.p.A., Düsseldorf; 2005/10 verschiedene kaufmännische Funktionen in der Energiewirtschaft. 2010/13 Assistent der Geschäftsführung der Hamburg Netz GmbH. Seit 1995 Mitgl. der Jungen Union, 2000/02 Kreisvors. der JU Steinburg; seit 2002 Vorstandsmitgl. CDU Steinburg; 2010/14 Schatzmeister; seit 2014 stellv. Kreisvors. der CDU Steinburg. 2003/05 und 2008/13 Kreistagsabgeordneter im Kreis Steinburg, u. a. Vors. des Wirtschaftsausschusses. Seit 2015 stellv. Vors. THW-Landesvereinigung Scheswig-Holstein - MdB seit Okt. 2013.', 'Mark', '11004298');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08315, NULL, NULL, NULL, 'Landrat a. D., Diplom-Agraringenieur', 'verheiratet, 3 Kinder', '20.09.1957', NULL, 'Hettstedt', 'männlich', NULL, '22.10.2013', 'Hellmuth', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landkreis Stendal, Stendal,<br/>Landrat<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Teilnehmergemeinschaft Flurneuordnung, Wust, <br/>Vorsitzender des Vorstandes<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Förderkreis der Fachhochschule Stendal e.V., Stendal, <br/>Vorsitzender des Vorstandes<br/><br/>Regionalverein Altmark e.V., Stendal, <br/>Vorsitzender des Vorstandes<br/><br/>Sommerschule Wust e.V., Wust-Fischbeck, <br/>Vorsitzender des Vorstandes', '1978/83 Studium der Agrarwissenschaften Univ. Halle-Wittenberg. 1983/90 verschiedene leitende Tätigkeiten in der LPG Wust. 1990/92 Bürgermeister der Heimatgemeinde Wust, 1992/94 Landrat des Landkreises Havelberg, 1994/99 1. Beigeordneter des neuen Landkreises Stendal, 1999/13 Landrat des Landkreises Stendal. Vors. des Regionalvereines Altmark, Vors. Förderkreis der Fachhochschule Magdeburg-Stendal am Standort Stendal, Vors. der Sommerschule Wust e.V. Seit 1992 Mitgl. der CDU, seit 2009 Vors. des Ortsverbandes Schönhausen. - MdB seit Okt. 2013.', 'Jörg', '11004299');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08316, NULL, NULL, NULL, 'Diakonin', 'ledig', '12.07.1962', NULL, 'Birkenfeld', 'weiblich', NULL, '22.10.2013', 'Henn', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Seniorenhilfe Kreuznacher Diakonie, Neunkirchen,<br/>Diakonin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Neunkirchen, Neunkirchen, <br/>Mitglied des Stadtrates', 'Ausbildung zur Floristin, 1996 Umschulung zur Altenpflegerin, 2007 Ausbildung zur Diakonin. Leiterin der Tagespflege im Saarbrücker Wichernhaus und bis Okt. 2013 Diakonin bei der Seniorenhilfe der kreuznacher diakonie. Seit Aug. 2015 Mitgl. des Vorstandes der Ev. Arbeitsgemeinschaft für Soldatenbetreuung in der Bundesrepublik Deutschland e. V., seit Nov. 2015 Mitgl. des Stiftungsrates der Deutschen Härtefallstiftung. Mitgl. im Kreisvorst. der SPD Neunkirchen, dort Bildungsbeauftragte, seit 2010 Vors. des SPD-Ortsvereins Wellesweiler. 2009/14 Mitgl. im Ortsrat von Wellesweiler und im Stadtrat Neunkirchen. - MdB seit Okt. 2013.', 'Heidtrud', '11004300');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08318, NULL, 'Dr.', 'Dr.', 'Universitätsprofessor', 'verheiratet, 2 Kinder', '31.03.1958', NULL, 'Köln', 'männlich', NULL, '22.10.2013', 'Hirte', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>		Universität Hamburg, Hamburg,<br/>	Universitätsprofessor<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Universität Hamburg, Hamburg,<br/>Universitätsprofessor, monatlich, Stufe 1<br/><br/>Gutachterliche Tätigkeit, Köln<br/>   Mandant 1, Frankfurt/Main, 2014, Stufe 1<br/>   Mandant 2, Frankfurt/Main, 2014, Stufe 3<br/>   Mandant 3, 2015, Stufe 3<br/>   Mandant 4, Frankfurt/Main, 2015, Stufe 1<br/><br/>Publizistische Tätigkeit<br/>   Verlag Franz Vahlen GmbH, München, 2015, Stufe 3; 2016, Stufe 4<br/>   RWS Verlag Kommunikationsforum GmbH, Köln, 2016, Stufe 1<br/>   Verlag Walter de Gruyter GmbH, Berlin, 2016, Stufe 1<br/>   Verwertungsgesellschaft WORT (VG WORT), München, 2016, Stufe 1<br/>   Wolters Kluwer Deutschland GmbH, Neuwied, 2016, Stufe 1<br/><br/>Handelsblatt Fachmedien GmbH, Düsseldorf,<br/>Vortrag und Tagungsleitung, 2015, Stufe 1 (DER BETRIEB Tagung, "Aktuelle Aspekte der Unternehmenssanierung")<br/><br/>Wolters Kluwer Deutschland GmbH, Neuwied,<br/>Vortrag, 2014, Stufe 1 (ZInsO-Jahrestagung 2014, "Aktuelle rechtspolitische Entwicklungen im Insolvenz- und Gesellschaftsrecht")<br/><br/>Funktionen in Unternehmen: <br/>		Clairfield International Deutschland<br/>	SynCap Management GmbH, Frankfurt/Main, <br/>	Mitglied des Fachbeirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Deutsch-Amerikanische Juristen-Vereinigung e.V., Bonn, <br/>	Mitglied des Vorstandes<br/><br/>	Deutscher Juristen-Fakultätentag (DJFT), Berlin, <br/>	Mitglied des Ständigen Ausschusses<br/><br/>Max-Planck-Institute für Biologie des Alterns und für Stoffwechselforschung, Köln,<br/>Mitglied des gemeinsamen Kuratoriums, ehrenamtlich', 'Katholische Volksschule in Köln-Gartenstadt Nord, Dreikönigsgymnasium Köln. 1977 Studium der Rechtswissenschaften Univ. Köln, 1. Staatsexamen. Studienjahr 1979/80 in der Schweiz an der Université de Lausanne,  1984 Referendariat am Landgericht Köln, 1985 Promotion, 1988/89 University of California, Berkeley, 1994 Habilitation. 1993/94 Friedrich-Schiller-Universität Jena, 1999/04 Professor am Centre Universitaire de Luxembourg. 2001 Gastprofessor an der Doshisha-Universität in Kyoto und an der Korea University in Seoul. Seit 2006 Gastprofessor an der Wirtschaftsuniversität Luigi Bocconi in Mailand. 1995/2000 stellv. Mitgl. Thüringer Verfassungsgerichtshof. Seit 2000 Professor für Rechtswissenschaft an der Universität Hamburg und dort Geschäftsführender Direktor des Seminars für Handels-, Schifffahrts- und Wirtschaftsrecht. Ortsvors. der CDU-Köln Sürth. - MdB seit Okt. 2013; Vors. des Stephanuskreises der CDU/CSU-Fraktion, Vorstandsmitgl. des Parlamentskreises Mittelstand der CDU/CSU-Fraktion.', 'Heribert', '11004302');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08319, NULL, NULL, NULL, 'Politikwissenschaftler', 'keine Angaben', '22.06.1982', NULL, 'Landau in der Pfalz', 'männlich', NULL, '22.10.2013', 'Hitschler', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Land Rheinland-Pfalz, Struktur- und Genehmigungsdirektion, Neustadt,<br/>	Leiter des Referates Einheitliche Ansprechpartner und Persönlicher Referent des Präsidenten<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Landkreis Südliche Weinstraße, Landau, <br/>	Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Berliner Republik e.V., Berlin, <br/>	Stellv. Vorsitzender<br/><br/>	Trägerverein Netzwerk Berlin e.V., Berlin, <br/>	Mitglied des Vorstandes, ehrenamtlich', 'Abitur am Eduard-Spranger-Gymnasium in Landau. 2007 Magister Artium Politikwissenschaft, Öffentliches Recht, Wirtschafts- und Sozialgeschichte/Neuere Geschichte, Univ. Mannheim. 2008/10 Referent des Oberbürgermeisters der Stadt Landau; 2010 bis 2013 persönlicher Referent des Präsidenten der Struktur- und Genehmigungsdirektion Süd und Leiter des Einheitlichen Ansprechpartners. Mitherausgeber des Magazins Berliner Republik und stellv. Vors. des Vereins Berliner Republik. Seit 2010 Vors. des SPD-Unterbezirks Südpfalz, Vorstandsmitgl. SPD Pfalz. Mitgl. im Kreistag des Landkreises Südliche Weinstraße. Mitgl. u. a. ver.di, Naturfreunde, 1. FC Kaiserslautern, Europa Union, Reservistenverband, Bundeswehrsozialwerk, Vorstandsmitgl. Netzwerk Berlin und AWO Pfalz. - MdB seit Okt. 2013; stellv. Sprecher der rheinland-pfälzischen Landesgruppe.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 211 (Pirmasens)', 'Thomas', '11004303');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08321, NULL, NULL, NULL, 'Jurist', 'verheiratet, 1 Kind', '06.03.1975', NULL, 'Würzburg', 'männlich', NULL, '22.10.2013', 'Hoffmann', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadt Würzburg, Würzburg,<br/>Juristischer Kommunalbeamter<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwälte Cornea & Franz, Würzburg, <br/>Rechtsanwalt<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Marktgemeinde Zellingen, Zellingen, <br/>Mitglied des Gemeinderates, ehrenamtlich<br/><br/>Verwaltungsgemeinschaft Zellingen, Zellingen, <br/>Mitglied der Gemeinschaftsversammlung, ehrenamtlich', '1987/96 Mathematisch-Naturwissenschaftliches Johann-Schöner Gymnasium Karlstadt, Abitur 1996. 1997/03 Studium der Rechtswissenschaften an der Bayerischen Julius-Maximilians-Univ. Würzburg, 1. jur. Staatsexamen 2002, 2. jur. Staatsexamen 2005. Seit 2006 Juristischer Staatsbeamter des Freistaates Bayern in der inneren Verwaltung,  Angestellter der Regierung von Unterfranken. Seit 2006 Regierungsrat am Landratsamt Miltenberg,  Leiter der Abteilung 5 Bauaufsicht, Bauleitplanung, Wohnbauförderung und Denkmalschutz, zudem seit Sept. 2006 Leiter der Abteilung 4 Wasserrecht, Bodenschutz, Immissionsschutz, staatliches Abfallrecht und kommunale Abfallwirtschaft. Seit Nov. 2009 Leiter des FB ABD bei der Stadt Würzburg, Oberrechtsrat. Seit 2010 versch. Lehraufträge, u. a. bei der Bayerischen Verwaltungsschule und der Bayerischen Akademie für Verwaltungswissenschaften. Mitgl. in sieben Vereinen der Heimatgemeinde. Seit 2008 Marktgemeinderat in Zellingen. Seit 2006 Mitgl. der CSU, Vors. der CSU Retzbach, stellv. Kreisvors. der CSU Main Spessart. - MdB seit Okt. 2013.', 'Alexander', '11004304');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08322, NULL, 'Dr.', 'Dr.', 'Bürgermeister a. D., Rechtsanwalt', 'verheiratet, 2 Kinder', '14.06.1972', NULL, 'Großburgwedel', 'männlich', NULL, '22.10.2013', 'Hoppenstedt', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadt Burgwedel, Burgwedel,<br/>Bürgermeister<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn,<br/>Vertrauensmann bei der Bausparkasse der BHW Hameln<br/><br/>Sparkasse Hannover, Hannover, <br/>Mitglied des Verwaltungsrates', '1978/92 Schulbesuche in Thönse, Großburgwedel und Abingdon (England), Abitur am Gymnasium Großburgwedel. 1992/93 Wehrdienst und Ausbildung zum Reserveoffizier, derzeitiger Dienstgrad Oberstleutnant d. R. 1993/99 Studium der Rechtswissenschaften in Passau, Lausanne und Würzburg, Promotion. 1999/01 Referendariat in Hannover mit Stationen am Landgericht, der Staatsanwaltschaft und der Bezirksregierung. Wahlstation beim Bundesrat in Berlin und bei der Deutschen Botschaft in den USA (Washington D.C.). 2002/05 Angestellter bei der Allianz Versicherungs-AG (Zweigniederlassung Berlin), erst als Assistent der Geschäftsleitung, dann als Bereichsleiter, zeitgleich Rechtsanwalt. Mitgl. der CDU seit 1997 in versch. Funktionen, derzeit u. a. Vors. der CDU in der Region Hannover, Kreisvors. CDU Hannover-Land, Mitgl. Bezirksvorst. Hannover und Landesvorst. CDU Niedersachsen. 2005/13 Bürgermeister der Stadt Burgwedel. - MdB seit Okt. 2013; seit Dez. 2016 stellv. Vors. Ausschuss für Recht und Verbraucherschutz.', 'Hendrik', '11004305');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08323, NULL, NULL, NULL, 'Diplom-Finanzwirt', 'verwitwet, 2 Kinder', '25.09.1967', NULL, 'Osterburken', 'weiblich', NULL, '22.10.2013', 'Horb', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Land Baden-Württemberg, Stuttgart,<br/>	Angestellte der Finanzverwaltung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Evangelische Pfarrpfründestiftung Baden (EPSB), Heidelberg,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Evangelische Stiftung Pflege Schönau (ESPS), Heidelberg,<br/>Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Landratsamt Neckar-Odenwald-Kreis, Mosbach,<br/>Mitglied des Jugendhilfeausschusses<br/><br/>Stadt Osterburken, Osterburken,<br/>Mitglied des Kulturausschusses und des Schöffenwahlausschusses<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Das Internationale Jugendprogramm in Deutschland e.V., Osterburken,<br/>Mitglied des Beirates', 'Abitur am GTO Osterburken. Studium der Anglistik, evang. Theologie und BWL an der J.M. Univ. Würzburg, Erasmusstipendiatin, Auslandsstudium an der University of Wales, Swansea, Auslandssemester an der State Univ. New York/SUCO; Studium an der FH Steuern und Finanzen, Ludwigsburg. Ausbildung beim Finanzamt Calw. Sachbearbeiterin bei den Finanzämtern Mosbach, Heidelberg und Walldürn; Beauftragte für Chancengleichheit und Co-Ansprechpartner für das AGG beim Finanzamt Mosbach. 2002/06 Elternbeiratsvors KiGa St. Josef und Gründungsmitgl. der Kulturkommode Osterburken, Mitgl. im Jugendhilfeausschuss des Neckar-Odenwald-Kreises, Mitgl. Schöffenwahlausschuss, Mitgl. Kulturausschuss Osterburken, Mitgl. Dt. Steuergewerkschaft, Mitgl. Beirat Trägerverein Das Internationale Jugendprogramm in Deutschland e. V. - "The Duke of Edinburgh''s Imternational Award Germany". Ehrenamtl. Mitgl. Stiftungsräte der Ev. Stiftung Pflege Schönau (ESPS) und der Ev. Pfarrpfründestiftung Baden (EPSB). 1994 Eintrit in die CDU und Junge Union Osterburken, seit 1994 Vorstandsmitgl. Frauen Union des NOK und CDU-Stadtverb. Osterburken, seit 1995 Mitgl. Bezirksvorst. der Frauen Union Nordbaden, seit 2000 Kreisvors. der Frauen Union NOK, seit 1999 Mitgl. Landesvorst. der Frauen Union Baden Württemberg, seit 2006 Mitgl. CDU-Bezirksvorst. Nordbaden, seit 2007 Mitgl. CDU-Landesfachausschuss Europa, seit 2008 Vors. CDU-Stadtverband Osterburken und Vors. Arbeitskreis Steuern und Finanzen der CDU Nordbaden. Mitgl. der Europa-Union. Englisch (f), Französisch (G), Russisch (G), Latinum. - MdB seit Okt. 2013; seit 2013 Mitgl. Stephanuskreis der CDU/CSU-Fraktion.', 'Margaret', '11004306');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08324, NULL, NULL, NULL, 'Bankkauffrau', 'verheiratet, 3 Kinder', '19.07.1972', NULL, 'Bremen', 'weiblich', NULL, '22.10.2013', 'Hornhues', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>NordFinanz Bank AG, Bremen,<br/>Bankkauffrau<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>NordFinanz Bank AG, Bremen, <br/>Bankkauffrau (bis 15.11.2013), monatlich, Stufe 1', 'Abitur. Ausbildung zur Bankkauffrau bei der Sparkasse in Bremen (heute Greensill Bank AG). Seit 1997 Angestellte im Rechnungswesen bei der NordFinanz Bank AG, Bremen. Elternzeit 2001/09. 1991 Eintritt in die CDU und Junge Union, 1994/98 stellv. Landesvors. der Jungen Union Bremen; 2000/02 Kreisvors. der Frauenunion Bremen-Nord; seit 1996 Mitgl. CDU-Kreisvorst. Bremen-Nord, seit 2007 stellv. Stadtbezirksvors. Burglesum, seit 2010 Mitgl. CDU-Landesvorst., seit 2013 stellv. Kreisvors. CDU Bremen-Nord. Seit 1995 Mitgl. Beirat Bremen-Burglesum, 2007/12 CDU-Fraktionsvors. im Beirat Burglesum und stellv. Beiratssprecherin, 2012/13 Beiratssprecherin im Beirat Burglesum. - MdB seit Okt. 2013.', 'Bettina', '11004307');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08325, NULL, NULL, NULL, 'Zahntechniker, Filmschaffender, Autor, Berater für Afrikafragen', 'verheiratet, 4 Kinder', '03.12.1956', NULL, 'München', 'männlich', NULL, '22.10.2013', 'Huber', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Filmschaffender, München<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Afrika Direkt e.V., München, <br/>Mitglied des Vorstandes, ehrenamtlich', 'Gymnasium. Abgeschlossene Ausbildung zum Zahntechniker. Berater des äthiopischen Tourismusministers, Teilzeitberater bi-lateraler Fonds des BMELV, BMZ. Autor: Ein Niederbayer im Senegal - mein Leben zwischen zwei Welten. Blogger bei der Huffington Post. Mitgl. im Autorenverband PEN international, Ehrenkommissar der bayerischen Polizei, Gründer und Vorstandsvors. des Vereins Afrika Direkt e. V., Vorstandsvors. Afrika direkt e. V., Mitgl. Kuratorium Georg-Kraus-Stiftung, Mitgl. Parl. Beirat für Bevölkerung und Entwicklung der Stiftung Weltbevölkerung, Mitgl. Advisory Board des Institute for Cultural Diplomacy. - MdB seit Okt. 2013; Hauptberichterstatter Afrika im Auswärtigen Ausschuss; Mitgl. in der PV der NATO; stellv. Vors. Arbeitskreis Afrika der CDU/CSU-Faktion, Vors. der Parlamentariergruppe Englisch- und Portugiesischsprachige Staaten West- und Zentralafrikas.', 'Charles M.', '11004308');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08326, NULL, NULL, NULL, 'Diplom-Ingenieurin (FH) FB Architektur', 'geschieden', '09.09.1968', NULL, 'Leinefelde', 'weiblich', NULL, '22.10.2013', 'Hupach', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Wahlkreismitarbeiterin bei Jörg Kubitzki, MdL, Mühlhausen', 'Fachhochschulreife. Studium der Architektur an der Fachhochschule Erfurt, Philosophiestudium an der Georg-August-Universität in Göttingen. Weiterbildung im Mediendesign in Braunschweig. Sekretärin in der Leinefelder Baumwollspinnerei, kaufmännische Angestellte bei der Handelsorganisation in Worbis, freie Architektin und Mediendesignerin an einer Göttinger Berufsschule. 2012/13 Wahlkreismitarbeiterin beim Landtagsabgeordneten Jörg Kubitzki in Mühlhausen. Seit 2007 Mitgl. der LINKEN, Mitgl. Kreisvorst., seit 2009 Vors. Kreisverband DIE LINKE Eichsfeld, seit 2009 Mitgl. Kreistag Landkreis Eichsfeld, Nov. 2011/Nov. 2013 Mitgl. Landesvorst. der Linken. - MdB seit Okt. 2013; seit Dez. 2014 stellv. Vors. der Fraktion DIE LINKE.', 'Sigrid', '11004309');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08327, NULL, NULL, NULL, 'Selbständig', 'verheiratet', '06.12.1983', NULL, 'Husum', 'männlich', NULL, '22.10.2013', 'Ilgen', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Internationales Marketing und Vertrieb für Messen und Veranstaltungen, Husum<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Internationales Marketing und Vertrieb für Messen und Veranstaltungen, Husum', '2003 Abitur in Husum. 2003/10 Lehramtsstudium in Hamburg. Selbstständiger Veranstaltungskaufmann im internationalen Messe- und Kongressgeschäft für verschiedene in- und ausländische Veranstaltungen rund um die erneuerbare Energien. Seit 1998 Mitgl. der Jusos in Nordfriesland, seit 2004 Mitgl. der SPD, seit 2009 Vorsitzender des Husumer Ortsvereins, seit Sept. 2014 Kreisvors. der SPD-Nordfriesland. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 3 (Steinburg - Dithmarschen Süd)', 'Matthias', '11004310');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08329, NULL, NULL, NULL, 'Außendienstmitarbeiter', 'verheiratet, 2 Kinder', '27.05.1970', NULL, 'Freising', 'männlich', NULL, '22.10.2013', 'Irlstorfer', NULL, 'CSU', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>AOK Bayern Direktion München, München,<br/>	Außendienstmitarbeiter<br/><br/>Funktionen in Unternehmen: <br/>Klinikum Freising GmbH, Freising, <br/>	Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Heiliggeistspital-Stiftung, Freising, <br/>	Mitglied des Stiftungsrates (bis 30.04.2014)<br/>	<br/>Landkreis Freising, Freising, <br/>	Mitglied des Kreistages<br/>	<br/>Stadt Freising, Freising, <br/>	Mitglied des Stadtrates (bis 30.04.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Ausbildungsoffensive Freising e.V., Freising, <br/>	1. Vorsitzender<br/>	<br/>Staatliche Wirtschaftsschule Freising, Freising, <br/>	1. Vorsitzender des Freundeskreises', '1980/82 Hauptschule St. Georg Freising, 1982/86 Staatl. Wirtschaftsschule Freising. 1986/88 Ausbildung zum Bürokaufmann bei der Fa. Tengelmann & Kaisers. 1988/92 Kaufm. Angestellter bei der Fa. Tengelmann & Kaisers für Aktionsware und Neueröffnungen, 1992/93 Kaufm. Angestellter bei der Fa. F.X. Mühlbauer, Freising. Seit 1993 Außendienstmitarbeiter AOK Bayern - Die Gesundheitskasse. Mitgl. der CSU seit 1995, 1999/08 stellv. CSU-Ortsvors. Freising, 2008/14 CSU-Ortsvors. Freising, seit 2006 stellv. Kreisvors. der CSU. Stadtrat Freising 2002/14, Mitgl. im Kreistag Freising seit 2008. - MdB seit Okt. 2013.', 'Erich', '11004311');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08330, NULL, NULL, NULL, 'Diplom-Politologe', 'verheiratet, 2 Kinder', '25.05.1976', NULL, 'Pirmasens', 'männlich', NULL, '22.10.2013', 'Janecek', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Bündnis 90/Die Grünen, Landesverband Bayern, München,<br/>	Landesvorsitzender<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bündnis 90/Die Grünen, Landesverband Bayern, München,<br/>Landesvorsitzender (bis Oktober 2014), jährlich, Stufe 3<br/><br/>Bundesverband BioEnergie e.V. (BBE), Bonn,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Bundesverband der Unternehmervereinigungen e.V. (BUV), Berlin,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Verband 3D Druck e.V., Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich', '1995 Abitur am Karl-von-Closen-Gynmasium Eggenfelden. 2001 Diplom Politikwissenschaften an der Hochschule für Politik München. 2001/03 PR-Berater; 2003/05 Referent für interne Kommunikation, Grüne Bayern, 2005/08 Landesgeschäftsführer Grüne Bayern. 2000 Landesschatzmeister der Grünen Jugend Bayern, 2001/03 Vors. Grüne Jugend München, 2006/08 Vors. Grüne Neuhausen-Nymphenburg, 2008/14 Landesvors. Grüne Bayern. 2010/14 Mitgl. im Bezirksausschuss Neuhausen-Nymphenburg, 2008/13 Mitgl. Bezirkstag von Oberbayern. Mitgl. Bund Naturschutz, Verein gegen betrügerisches Einschenken. - MdB seit Okt. 2013.', 'Dieter', '11004312');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08331, NULL, NULL, NULL, 'Verwaltungsfachwirtin', 'verheiratet', '06.09.1978', NULL, 'Bremen', 'weiblich', NULL, '04.12.2015', 'Jantz-Herrmann', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Freie Hansestadt Bremen, Bremen,<br/>	Stellv. Ortsamtsleiterin im Ortsamt Vegesack<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Schwanewede, Schwanewede,<br/>Mitglied des Gemeinderates, ehrenamtlich<br/><br/>Landkreis Osterholz, Osterholz-Scharmbeck,<br/>Mitglied des Kreistages', 'Sachbearbeiterin beim Senator für Finanzen bei der Freien Hansestadt Bremen, stellv. Referatsleiterin an der Universität Bremen, stellv. Ortsamtsleiterin im Ortsamt Vegesack bei der Freien Hansestadt Bremen. Mitgl. ver.di, in der AWO und im SoVD. Aktive Kommunalpolitikerin seit 2006 im Gemeinderat der Gemeinde Schwanewede, seit Nov. 2016 Mitgl. des Kreistages Osterholz. Seit 2012 Vors. der SPD im Landkreis Osterholz, Finanzverantwortliche Bezirk Nord-Niedersachsen. - MdB seit Okt. 2013; Tierschutzbeauftragte der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 29 (Cuxhaven - Stade II)', 'Christina', '11004313');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08332, NULL, NULL, NULL, 'Bankfachwirtin', 'verheiratet, 3 Kinder', '29.11.1967', NULL, 'Oberhausen-Sterkrade', 'weiblich', NULL, '22.10.2013', 'Jörrißen', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Haus- und Wohnungsverwalterin, selbständig, Hamm<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Haus- und Wohnungsverwalterin, selbständig, Hamm<br/>	Kunde 1, monatlich, Stufe 1 (bis April 2015)', '1978/87 Gymnasium Hammonense in Hamm, Abschluss Allgemeine Hochschulreife. 1987/89 Ausbildung zur Bankkauffrau bei Deutsche Bank Hamm. 1989/93 Berufliche Tätigkeit im Überregionalen Förderkreis der Deutsche Bank in Hamm und Osnabrück, Tätigkeitsschwerpunkt Kredit-/ Firmenkundenbereich; 1991/92 nebenberufliches Studium an der Bankakademie Dortmund, Abschluss Bankfachwirt. 1993/98 Mutterschutz und Erziehungsurlaub, danach Familienpause. 2003/15 freiberufliche Tätigkeit als Hausverwalterin. Seit 2011 Gründungsmitgl. und Geschäftsführerin im Förderverein Schloss Oberwerries. 2003 Eintritt in die CDU, seit 2004 Mitgl. Kreisvorstand der Frauen Union Hamm, seit 2005 Mitgl. im Vorstand Ortsverband Heessen, 2008/13 Bezirksvorsteherin in Heessen, seit 2009 im Kreisvorst. der CDU Hamm. 2004/13 Mitgl. der Bezirksvertretung Hamm-Heessen. - MdB seit Okt. 2013.', 'Sylvia', '11004314');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08333, NULL, NULL, NULL, 'Finanzfachwirt', 'ledig', '04.06.1966', NULL, 'Saarlouis', 'männlich', NULL, '22.10.2013', 'Jost', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, NULL, NULL, 'Reinhold', '11004315');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08334, NULL, NULL, NULL, 'Oberstudienrat', 'verheiratet, 2 Kinder', '23.03.1962', NULL, 'Kusel', 'männlich', NULL, '22.10.2013', 'Jung', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Rheinland-Pfalz, Mainz,<br/>	Oberstudienrat<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Landkreis Kusel, Kusel, <br/>	Mitglied des Kreistages<br/>	Fraktionsvorsitzender (bis Juli 2014)<br/><br/>	Verbandsgemeinde Altenglan, Altenglan, <br/>	Beigeordneter, ehrenamtlich<br/>	Ortsbürgermeister der Gemeinde Rammelsbach (bis 06.07.2014),<br/>	monatlich, Stufe 1', 'Studium der Politischen Wissenschaften an der Univ. Heidelberg, Schulmusikstudium an der Musikhochschule Heidelberg-Mannheim, Aufbaustudium "Künstlerischer Abschluss im Fach Klavier". Ehemaliger Betriebsratsvors. Tätigkeit in JU und KPV, u. a. Kreisvors. JU Kusel und Landesvorstand JU Rheinland-Pfalz. 2004/14 Bürgermeister der Ortsgemeinde Rammelsbach und Fraktionsvors. im Kreistag Kusel, seit 2014 ehrenamtlicher Beigeordneter. Vors. des Turnvereins Rammelsbach.  - MdB seit Okt. 2013.', 'Xaver', '11004316');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08335, NULL, NULL, NULL, 'Diplom-Sportlehrer', 'verheiratet, 2 Kinder', '05.05.1967', NULL, 'Halle (Saale)', 'männlich', NULL, '22.10.2013', 'Junge', NULL, 'SPD', NULL, NULL, NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Sportsekundarschule Halle/Saale, 1987 Abitur am Sportgymnasium Halle/Saale. Bis 1988 Leistungssportler im Wasserspringen. 1987/93 Studium zum Diplomsportlehrer an der Univ. Leipzig (früher DHfK). 1994/01 Gesundheitsberater, stellv. Leiter Marketing und anschließend Leiter Kundencenter der ehemaligen AOK Mecklenburg-Vorpommern. 2001/13 Pressesprecher und Leiter des Amtes für Presse, Tourismus und Stadtmarketing der Hansestadt Wismar. Seit 1998 Mitgl. der SPD, seit 2012 Mitgl. im Vorst. der SPD Nordwestmecklenburg-Wismar, seit 2014 stellv. Vors. der SPD Nordwestmecklenburg-Wismar. 2011/Sept. 2013 Vors. der SPD-Fraktion im Kreistag Nordwestmecklenburg. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 12 (Schwerin-Ludwigslust-Parchim I-Nordwestmecklenburg I)', 'Frank', '11004317');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08336, NULL, NULL, NULL, 'Funkmechaniker', 'verheiratet, 2 Kinder', '19.06.1962', NULL, 'Görlitz', 'männlich', NULL, '22.10.2013', 'Jurk', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Sächsischer Landtag, Dresden,<br/>Mitglied des Landtages<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Weißkeißel, Weißkeißel, <br/>Mitglied des Gemeinderates', '1969/79 POS in Weißkeißel und Sagar. 1979/82 Ausbildung zum Funkmechaniker. 1982/86, 1988/90 beschäftigt bei der PGH Elektro-Rundfunk-Fernsehen Weißwasser, 1986/88 Wehrdienst. Seit 1989 Mitgl. der SPD, 1998/09 Mitgl. SPD-Landesvorst. Sachsen, 2004/09 SPD-Landesvors. 2004/09 Staatsminister für Wirtschaft und Arbeit und stellvertretender Ministerpräsident des Freistaats Sachsen. MdL Sachsen Okt. 1990/Okt. 2013, Nov. 2009/Okt. 2013 Vors. Ausschuss für Umwelt und Landwirtschaft. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 156 (Bautzen I)', 'Thomas', '11004318');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08338, NULL, NULL, NULL, 'Diplom Verwaltungswirtin', 'ledig', '11.07.1980', NULL, 'Gütersloh', 'weiblich', NULL, '22.10.2013', 'Kampmann', NULL, 'SPD', NULL, 'evangelisch', NULL, NULL, NULL, 'Christina', '11004319');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08339, NULL, NULL, NULL, 'Diplom-Kaufmann', 'verheiratet, 2 Kinder', '14.02.1984', NULL, 'Dortmund', 'männlich', NULL, '22.10.2013', 'Kanitz', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Gelsenwasser AG, Gelsenkirchen,<br/>Projektentwickler<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europa-Union Dortmund e.V., Berlin, <br/>Mitglied des Beirates', '1994/03 Gymnasium an der Schweizer Allee Dortmund. 2003/04 Zivildienst in der Diakonie Dortmund. 2004/09 Studium der Betriebswirtschaft Westfälische Wilhelms Univ. Münster, Abschluss als Diplom-Kaufmann. Seit 2008 Mitarbeiter der Gelsenwasser AG im Bereich Projektentwicklung. 2002 Eintritt in die Junge Union, 2005 Eintritt in die CDU, seit 2003 Mitgl. Kreisvorst. der Jungen Union Dortmund, seit 2005 Kreisvors. der Jungen Union Dortmund, seit 2007 stellv. Kreisvors. der CDU Dortmund, seit 2009 Kreisvors., seit Nov. 2012 stellv. Vors. der CDU Ruhr, seit 2017 Schatzmeister der CDU Nordrhein-Westfalen; seit Sept. 2015 Bezirksvors. der MIT-Ruhrgebiet. - MdB seit Okt. 2013.', 'Steffen', '11004320');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08341, NULL, NULL, NULL, 'Journalist', 'verheiratet, 2 Kinder', '24.12.1954', NULL, 'Witten', 'männlich', NULL, '22.10.2013', 'Kapschack', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>SPD-Fraktion im Landtag von Nordrhein-Westfalen, Düsseldorf,<br/>Pressesprecher', 'Albert-Martmöller Gymnasium Witten, Abitur. Zivildienst beim Kreisverband Witten der Arbeiterwohlfahrt. Beginn 1975/76 Studium der Wirtschaftswissenschaften Ruhr-Univ. Bochum, 1980 Diplomexamen. Ko-Autor eines Gutachtens für die Kommission der Europäischen Gemeinschaften zum Thema "Teilzeitschichtarbeit" in verschiedenen europäischen Ländern im Rahmen der Forschungsgruppe "Arbeit und Gesundheit", Dortmund. Diverse Tätigkeiten für das "Innovations- und Technologietransferzentrum der Universitäten des Ruhrgebiets" (ITZ) zu Arbeitsmarktproblemen im Ruhrgebiet. 1981 Hospitanz beim Deutschlandfunk, 1981/82 Volontariat beim Deutschlandfunk, anschließend freier Journalist. 1984 Redakteur und Moderator beim Westdeutschen Fernsehen, Landesstudio Dortmund, 1987 Wechsel ins Landesstudio Düsseldorf, Aufbau des Politikmagazins Westpol, 1995/04 Leiter der Redaktion Landespolitik, WDR-Fernsehen. 2004 Reportage-Sendung "hier und heute", zuletzt Redaktionsleiter. Seit 2010 Pressesprecher der SPD-Landtagsfraktion NRW. 1972/81 und seit 1987 Mitgl. der SPD, Mitgl. Unterbezirksvorst. der SPD Ennepe-Ruhr. Mitgl. ver.di. - MdB seit Okt. 2013.', 'Ralf', '11004321');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08342, NULL, NULL, NULL, 'Politikwissenschaftlerin', 'verheiratet, 1 Kind', '07.05.1980', NULL, 'Leipzig', 'weiblich', NULL, '22.10.2013', 'Karawanskij', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	DIE LINKE. Kreistagsfraktion im Kreistag Nordsachsen, Eilenburg,<br/>	Geschäftsführerin<br/><br/>	Wissenschaftliche Mitarbeiterin bei Dr. Cornelia Ernst, MdEP, Dresden<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Institut Solidarische Moderne e.V., Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich', '2006 Abschluss Magistra der Politik- und Kulturwissenschaften Univ. Leipzig. 2006/09 Wissenschaftliche Mitarbeiterin und Projektleiterin am Institut für Politikwissenschaft der Univ. Leipzig in verschiedenen Forschungsprojekten. 2008/13 Geschäftsführerin der Kreistagsfraktion DIE LINKE in Nordsachsen. Seit Juni 2012 Vors. der LINKEN im Kreisverband Nordwestsachsen. Mitgl. u. a. ver.di, Rosa-Luxemburg-Stiftung Sachsen. - MdB seit Okt. 2013; Sprecherin der Fraktion DIE LINKE für Kommunalfinanzen, seit Dez. 2014 Parl. Geschäftsführerin der Fraktion DIE LINKE, stellv. Vors. der Deutsch-Britischen und der Deutsch-Ukrainischen Parlamentariergruppe.', 'Susanna', '11004322');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08344, NULL, NULL, NULL, 'Leitende Angestellte im Familienbetrieb', 'verheiratet, 3 Kinder', '29.04.1971', NULL, 'Ibbenbüren', 'weiblich', NULL, '22.10.2013', 'Karliczek', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Hotel Teutoburger Wald GmbH, Tecklenburg,<br/>Leitende Angestellte<br/><br/>Funktionen in Unternehmen: <br/>Tecklenburg Touristik GmbH, Tecklenburg, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Tecklenburg, Tecklenburg, <br/>Mitglied des Stadtrates, Fraktionsvorsitzende, ehrenamtlich', '1981 Goethe-Gymnasium Ibbenbüren, 1990 Abitur. Ausbildung zur Bankkauffrau bei der Deutschen Bank AG in Osnabrück. 1993 Wechsel in den familieneigenen Hotelbetrieb; Ausbildung zur Hotelfachfrau, seit 1994 leitende Funktion im Hotel Teutoburger Wald. 2003 Studium der Betriebswirtschaftslehre an der FernUniversität in Hagen, 2008 Abschluss Diplom-Kauffrau. Seit 1998 Mitgl. der CDU, seit Januar 2011 Stadtverbandsvors. der CDU Tecklenburg. 2004 Mitgl. im Rat der Stadt Tecklenburg, ab 2009 stellv. Fraktionsvors. - MdB seit Okt. 2013; seit Jan. 2017 Parl. Geschäftsführerin der CDU/CSU-Fraktion.', 'Anja', '11004323');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08345, NULL, NULL, NULL, 'Diplom-Ökonomin', 'verheiratet', '07.01.1958', NULL, 'Radebeul', 'weiblich', NULL, '22.10.2013', 'Kassner', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landkreis Vorpommern-Rügen, Stralsund,<br/>Stellv. Landrätin', '1964/72 POS, 1972/76 Ernst-Moritz-Arndt-Schule (EOS) in Bergen auf Rügen. 1976/78 Kellnerlehre. 1981 Restaurantleiterin beim FDGB-Feriendienst in Binz. 1981/86 Fernstudium an der Handelshochschule Leipzig, Abschluss Diplom-Ökonomin des Hotel- und Gaststättenwesens. Bis 1991 Leiterin eines Hotels für den FDGB-Feriendienst, seit 1992 Übernahme eines eigenen Hotels in Putgarten. 1990 Mitgl. der Volkskammer für die PDS. 1990/2001 MdL Mecklenburg-Vorpommern; 1999/01 stellv. Landtagspräsidentin. 2001/11 Landrätin des Landkreises Rügen, 2011/13  2. Beigeordnete des Landrats. - MdB seit Okt. 2013.', 'Kerstin', '11004324');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08346, NULL, NULL, NULL, 'Gewerkschaftssekretärin', 'verheiratet, 2 Kinder', '08.07.1960', NULL, 'Marl', 'weiblich', NULL, '22.10.2013', 'Katzmarek', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Industriegewerkschaft Bergbau, Chemie, Energie (IG BCE), Hannover,<br/>Gewerkschaftssekretärin<br/><br/>Funktionen in Unternehmen: <br/>GBG-Mannheimer Wohnungsbaugesellschaft mbH, Mannheim, <br/>Mitglied des Aufsichtsrates (bis 19.11.2013)<br/><br/>Mannheimer Stadtreklame GmbH, Mannheim, <br/>Mitglied des Aufsichtsrates (bis 19.11.2013)<br/><br/>MVV GmbH, Mannheim, <br/>Mitglied des Aufsichtsrates (bis 19.11.2013)<br/><br/>Rhein-Neckar-Flugplatz GmbH, Mannheim, <br/>Mitglied des Aufsichtsrates (bis 19.11.2013<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Agentur für Arbeit, Mannheim, <br/>Mitglied des Beirates (bis Mai 2014)<br/><br/>Gemeinde Mannheim, Mannheim, <br/>Mitglied des Gemeinderates (bis 19.11.2013)<br/><br/>JobCenter gemeinsame Einrichtung, Mannheim, <br/>Mitglied des Beirates (bis 19.11.2013)<br/><br/>Verband Region Rhein-Neckar, Mannheim, <br/>Mitglied der Verbandsversammlung (bis Mai 2014)', '1990 hauptamtliche Gewerkschaftssekretärin der IG Bergbau, Chemie, Energie; 2001 Bezirksleiterin der IG Bergbau, Chemie, Energie in Karlsruhe und Rhein/ Main. Mitgl. IG Bergbau, Chemie, Energie, Arbeiterwohlfahrt, Naturfreunde e. V., Stolpersteine,  regionale Vereine. Bis Mai 2014 Mitgl. des Beirates der Agentur für Arbeit, Mannheim, bis Mai 2014 Mitgl. der Verbandsversammlung des Verbands Region Rhein-Neckar, Mannheim. Seit 1989 Mitgl. der SPD. 2009/ 13 Stadträtin in Mannheim, arbeitsmarkt- und wirtschaftspolitische Sprecherin der Fraktion. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 272 (Karlsruhe-Land)', 'Gabriele', '11004325');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08347, NULL, NULL, NULL, 'Vorsitzende der Geschäftsführung der Agentur für Arbeit Stendal', '2 Kinder', '22.03.1960', NULL, 'Aken/Elbe', 'weiblich', NULL, '22.10.2013', 'Kermer', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bundesagentur für Arbeit, Nürnberg,<br/>Geschäftsführerin', '1966/74 Polytechnische Oberschule "Werner Nolopp" Aken/Elbe, 1974/75 EOS "Johann Wolfgang Goethe" in Köthen, 1975/78 EOS "Adolf-Reichwein" Halle/Saale, Abschluss Abitur. 1978/83 Studium an der "Otto-von-Guericke" Universität Magdeburg, Abschluss Dipl.-Ingenieur Fertigungsprozessgestaltung in der metallverarbeitenden Industrie. 1983/84 Technologin bei den Pumpenwerken Halle/Saale; 1984/92 Gewerkschaftssekretärin, 1992/2013 Bundesagentur für Arbeit, ab  2007 Vors. der Geschäftsführung der Agentur für Arbeit Stendal. Seit 2012 Mitgl. der SPD. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 74 (Mansfeld)', 'Marina', '11004326');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08349, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'verheiratet', '21.09.1959', NULL, 'Bedburg', 'männlich', NULL, '22.10.2013', 'Kippels', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Rechtsanwalt, Bedburg<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Rechtsanwälte Dr. Kippels und Hans Peter Dresen GbR, Bedburg,<br/>Rechtsanwalt, 2013, Stufe 5, Gewinn; 2014, Stufe 3 Gewinn; 2015, Stufe 4 Gewinn<br/>   Mandant 01, 2013<br/>   Mandant 02, 2013<br/>   Mandant 03, 2013<br/>   Mandant 04, 2013; 2014; 2015<br/>   Mandant 05, 2013<br/>   Mandant 06, 2013<br/>   Mandant 07, 2013<br/>   Mandant 08, 2013<br/>   Mandant 09, 2013<br/>   Mandant 10, 2013<br/>   Mandant 11, 2014<br/>   Mandant 12, 2014<br/>   Mandant 13, 2014<br/>   Mandant 14, 2014<br/>   Mandant 15, 2014<br/>   Mandant 16, 2014<br/>   Mandant 17, 2014<br/>   Mandant 18, 2014<br/>   Mandant 19, 2014<br/>   Mandant 20, 2014<br/>   Mandant 21, 2014<br/>   Mandant 22, 2015<br/><br/>Funktionen in Unternehmen: <br/>Bedburger Kleinwohnungs-Genossenschaft eG, Bedburg,<br/>Vorsitzender des Aufsichtsrates<br/><br/>Energie Kompetenz Zentrum Rhein-Erft-Kreis GmbH, Kerpen-Horrem,<br/>Mitglied des Aufsichtsrates<br/><br/>Erftland Holding Gesellschaft mbH, Bergheim,<br/>Mitglied des Aufsichtsrates (bis 25.05.2015)<br/><br/>Erftland Kommunale Wohnungsgesellschaft mbH, Bergheim,<br/>Mitglied des Aufsichtsrates (bis 25.05.2015)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Kreissparkasse Köln, Köln, <br/>	Mitglied des Regionalbeirates (bis 25.05.2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europaverband der Selbständigen - Deutschland e.V. (ESD), Berlin,<br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Institut für europäische Partnerschaft und internationale Zusammenarbeit e.V. (IPZ), Hürth,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Rechtsanwälte Dr. Kippels und Hans Peter Dresen GbR, Bedburg', 'Jurastudium, 1985 1. Staatsexamen Köln, 1989 2. Staatsexamen Düsseldorf. Seit 1989 selbstständig als Anwalt in Bedburg; 1990 Promotion in Köln. Seit 1980 Mitgl. der CDU, stellv. Kreisvors. der CDU Rhein-Erft. Seit 1994 Stadtverordneter der CDU Bedburg, Ortsbürgermeister in Bedburg-Mitte. - MdB seit Okt. 2013.', 'Georg', '11004327');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08350, NULL, NULL, NULL, 'Diplom-Volkswirtin', 'verheiratet, 1 Kind', '08.10.1975', NULL, 'Berlin', 'weiblich', NULL, '22.10.2013', 'Kiziltepe', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Volkswagen AG, Wolfsburg,<br/>Referentin für den Personalvorstand', '1982/88 Kurt-Schumacher-Grundschule Berlin, 1988/95 Hermann-Hesse-Gymnasium Berlin. 1996/01 Studium der Volkswirtschaftslehre an der Technischen Universität Berlin. 2002 freie Mitarbeit beim Deutschen Gewerkschaftsbund; 2003 freie Mitarbeit beim Deutschen Institut für Wirtschaftsforschung, anschließend Dozentin für Wirtschaftspolitik an der Berufsakademie Berlin. Geschäftsführerin Steuermythen.de. 2005/12 Büroleiterin und Referentin in einem Bundestagsbüro. Seit 2012 Referentin im Stab des Arbeitsdirektors beim Volkswagen Konzern. Mitgl. der IG Metall. Seit 2005 Mitgl. der SPD. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 86 (Berlin-Lichtenberg)', 'Cansel', '11004328');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08352, NULL, NULL, NULL, 'Lehrer', NULL, '01.02.1952', NULL, 'Oberhausen', 'männlich', NULL, '22.10.2013', 'Klare', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Sozialdemokratische Partei Deutschlands, Landesverband Nordrhein-Westfalen, Düsseldorf,<br/>Geschäftsführer', 'Abitur. Studium der Germanistik und Philosophie für das Lehramt. Angestellter der Volkshochschule Moers als Lehrer für Hauptschulabschlusskurse und für Deutsch als Fremdsprache. Leiter des Lotte-Lemke-Weiterbildungswerks des Arbeiterwohlfahrt-Kreisverband Wesel e. V. Geschäftsführer der SPD in Mülheim an der Ruhr und in Essen. - MdB seit Okt. 2013.', 'Arno', '11004329');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08353, NULL, NULL, NULL, 'Personalberaterin', 'verheiratet, 2 Kinder', '19.12.1967', NULL, 'Fulda', 'weiblich', NULL, '22.10.2013', 'Kömpel', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Birgit Kömpel Unternehmensberatung, Eichenzell,<br/>Personalberaterin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Eichenzell, Eichenzell, <br/>Mitglied der Gemeindevertretung, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Grenzenlos e.V., Eichenzell, <br/>1. Vorsitzende, ehrenamtlich', 'Realschulabschluss an der Heinrich-von-Bibra Schule in Fulda. Höhere Handelsschule, Ausbildung zur Bürofachfrau. Wechsel in die Hotellerie. Weiterbildung Personalmanagement am Ealing College in London, England. Verschiedene Managementpositionen im Personalbereich in der internationalen Hotellerie. Gründung  einer Personal- und Unternehmensberatung für die Hotellerie. Seit Nov. 2007 Mitgl. im SPD-Ortsverein Eichenzell, seit 2009 stellv. Ortsvereinsvors., seit 2011 Vors., seit Sept. 2016 stellv. Vors.; seit 2009 Vors. der ASF im Unterbezirk Fulda. Englisch (f), Spanisch (G), Französisch (G). - MdB seit Okt. 2013; 1. Vors. Deutsch-Irische Parlamentariergruppe, stellv. Mitgl. dt. Delegation OSZE-PV.', 'Birgit', '11004330');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08355, NULL, NULL, NULL, 'Angestellter im öffentlichen Dienst', 'ledig', '05.12.1977', NULL, 'Kronberg im Taunus', 'männlich', NULL, '22.10.2013', 'Koob', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Kreisausschuss des Hochtaunuskreises, Bad Homburg,<br/>Angestellter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Oberusel (Taunus), Oberusel, <br/>Mitglied der Stadtverordnetenversammlung, ehrenamtlich', '1997 Abitur an der Altkönigschule Kronberg. 1997/98 Zivildienst in der Evangelischen Versöhnungsgemeinde in Oberursel (Taunus). 1998/05 Studium der Politikwissenschaft (Hauptfach), Öffentliches Recht und Privatrecht (Nebenfächer) an der Johannes Gutenberg-Univ. in Mainz. 2006/12 Persönlicher Referent des Landrats des Hochtaunuskreises, 2012/13 Pressesprecher des Hochtaunuskreises. 1993 Eintritt in die Junge Union, 1995 Eintritt in die CDU, stellv. Vors. der CDU Oberursel, Beisitzer im Kreisvorstand der CDU Hochtaunus. Stadtverordneter der Stadt Oberursel (Taunus). - MdB seit Okt. 2013.', 'Markus', '11004331');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08357, NULL, NULL, NULL, 'Betriebswirt', 'ledig', '11.06.1979', NULL, 'Zwickau', 'männlich', NULL, '22.10.2013', 'Körber', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Wirtschafts- und Unternehmensberater, selbständig, Mülsen<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Wirtschafts- und Unternehmensberater, selbständig, Mülsen<br/><br/>Funktionen in Unternehmen: <br/>Glauchau Holding GmbH, Glauchau, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Gemeinde Mülsen, Mülsen, <br/>	Mitglied des Gemeinderates (bis 13.04.2015)', 'Abitur am BSZ für Wirtschaft in Lichtenstein. Wehrdienst in Weiden in der Oberpfalz. Studium der Politikwissenschaft und Betriebswirtschaftslehre an der Technischen Universität Chemnitz. 2002/12 Mitarbeiter und Büroleiter bei einem MdB. 2012 Leiter des Büros für Wirtschaftsförderung der Stadt Zwickau; seit 2012 selbstständiger Wirtschafts- und Unternehmensberater. Seit 2002 Mitgl. der CDU, seit 2005 Vors. der CDU Mülsen, 2010/12 stellv. CDU-Kreisvors., seit 2012 Erster stellv. Vors. CDU-Kreisverband. 2009/12 Gemeinderat und stellv. Bürgermeister der Gemeinde Mülsen, Gemeinderatsmitglied der Gemeinde Mülsen bis April 2015. Seit Okt. 2013 Mitgl. Aufsichtsrat der Glauchau Holding GmbH. - MdB seit Okt. 2013.', 'Carsten', '11004332');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08358, NULL, NULL, NULL, 'Politologe, Landesvorsitzender', 'verheiratet, 2 Kinder', '09.04.1979', NULL, 'Tübingen', 'männlich', NULL, '22.10.2013', 'Kühn', '(Tübingen)', 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bündnis 90/Die Grünen Baden-Württemberg, Stuttgart,<br/>Geschäftsführender Landesvorstand<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Südwestrundfunk (SWR), Stuttgart, <br/>Stellv. Mitglied des Rundfunkrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Pro RegioStadtbahn e.V., Mössingen, <br/>Mitglied des Beirates', '1999 Abitur in Göppingen. Zivildienst beim Sozialen Friedensdienst Göppingen. 2000/09 Studium der Politikwissenschaft und Soziologie an der Eberhard-Karls-Univ. Tübingen, Abschluss Magister Artium.2004/09 Mitarbeiter bei Winfried Hermann MdB, 2009 bis 2010 Mitarbeiter in der Verwaltung der Fakultät für Wirtschaftswissenschaften an der Eberhard-Karls-Univ. Tübingen. Mitgl. im Beirat von Pro RegioStadtbahn, NABU Baden-Württemberg, LTT Freunde!, VfB Stuttgart, Natur- und Vogelschutzverein Ergenzingen.Seit 1996 aktiv bei der Grünen Jugend (damals: Grün-Alternatives Jugendbündnis), seit 1998 Mitgl. Bündnis 90/Die Grünen, 2002/09 Mitgl. Kreisvorst. Bündnis 90/Die Grünen Tübingen, seit 2007 Mitgl. Landesvorst. Bündnis 90/Die Grünen Baden-Württemberg, 2009/13 Landesvors. Bündnis 90/Die Grünen Baden-Württemberg. 2009/11 Mitgl. im Bezirksbeirat Mitte der Stadt Tübingen. - MdB seit Okt. 2013.', 'Christian', '11004333');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08359, NULL, 'Dr.', 'Dr.', 'Diplom-Sporttherapeut, Physiotherapeut', 'verheiratet, 2 Kinder', '27.09.1967', NULL, 'Magdeburg', 'männlich', NULL, '22.10.2013', 'Kühne', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Dr. Kühne Schlafkomfort GmbH, Northeim,<br/>	Geschäftsführer<br/>	<br/>Physiotherapeut, Northeim<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Physiotherapeut, Northeim (bis 28.02.2014)<br/>	Kunde K1, 2013, Stufe 4; 2014, Stufe 4<br/>	Kunde K2, 2013, Stufe 3; 2014, Stufe 3<br/>	Kunde K3, 2013, Stufe 1<br/>	Kunde K4, 2013, Stufe 3; 2014, Stufe 3<br/>	Kunde K5, 2013, Stufe 1; 2014, Stufe 1<br/>	Kunde K6, 2013, Stufe 2; 2014, Stufe 2<br/>	Kunde K7, 2013, Stufe 1<br/>	Kunde K8, 2013, Stufe 1; 2014, Stufe 2<br/>	Kunde P2,  2014, Stufe 1<br/>	Kunde U1, 2013, Stufe 3; 2014, Stufe 4<br/>	Kunde U2, 2013, Stufe 1<br/>	<br/>Dr. Kühne Schlafkomfort GmbH, Northeim, <br/>	Geschäftsführer<br/>	<br/>Dr. Roy Kühne-Verwaltungs GmbH, Northeim, <br/>	Geschäftsführer, monatlich, Stufe 2 (ab 01.03.2014)<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Dr. Kühne Schlafkomfort GmbH, Northeim<br/>	<br/>PHYSIO-Team GmbH & Co. KG i.L., Northeim<br/>	<br/>PHYSIO-Team Verwaltungs GmbH i.L., Northeim', 'Abitur. Wehrdienst. Studium Lehramt für Gymnasien an der Martin-Luther-Univ. Halle/Saale in den Fächern Biologie und Sport; Promotion. Diplom-Sporttherapeut und Mitarbeiter in einem Reha-Zentrum; Weiterbildung zum Dipl.-Sporttherapeuten und Physiotherapeuten. Inhaber eines Gesundheitszentrums in Northeim. Seit 2005 Mitgl. der CDU, seit 2007 Vors. Ortsverband Northeim, seit Nov. 2013 Vors. Kreisverband Northeim, seit März 2014 stellv. Vors. MIT Kreisverband Northeim, 2014 Vors. LFA Gesundheit Niedersachsen. - MdB seit Okt. 2013.', 'Roy', '11004334');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08360, NULL, NULL, NULL, 'Techniker', 'verheiratet, 3 Kinder', '21.05.1962', NULL, 'Braunschweig', 'männlich', NULL, '22.10.2013', 'Lagosky', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Braunschweiger Versorgungs-AG & Co. KG, Braunschweig,<br/>Betriebsratsvorsitzender, Konzernbetriebsratsvorsitzender<br/><br/>Funktionen in Unternehmen: <br/>Braunschweiger Versorgungs-Verwaltungs AG, Braunschweig, <br/>2. Stellv. Vorsitzender des Aufsichtsrates (bis 31.12.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Cremlingen, Cremlingen, <br/>Mitglied des Gemeinderates, Fraktionsvorsitzender und Mitglied des Ortsrates Abbenrode<br/><br/>Landkreis Wolfenbüttel, Wolfenbüttel, <br/>Mitglied des Kreistages, Fraktionsvorsitzender<br/><br/>Wasserverband Weddel-Lehre, Lehre, <br/>Mitglied der Verbandsversammlung', '1978/82 Ausbildung zum Energieanlagenelektroniker, 1982/84 Technikerausbildung an der Technikerschule der Stadt Braunschweig, 1984 Fachhochschulreife. Techniker, seit 1985 bei der heutigen Braunschweiger Versorgungs-AG & Co. KG, 1986/04 Technischer Angestellter, 2004/05 Regulierungsmanager, 2005/13 Betriebsratsvors., 2007/13 Konzernbetriebsratsvors. BS ENERGY, 2006/13 Mitgl. Aufsichtsrat der Braunschweiger Versorgungs-Verwaltungs-AG und zweiter stellv. Aufsichtsratsvors. 2006/12 stellv. Vors. und 2012/13 Vors. der Arbeitsgemeinschaft der Betriebsräte der VEOLIA Wasser GmbH. Seit 1994 Mitgl. der CDU, seit 2000 der CDA, 1997/02 Vors. CDU-Ortsverband Destedt, 2001/11 Vors. im CDU-Gemeindeverband Cremlingen (Landkreis Wolfenbüttel), seit 2001 stellv. Vors. CDU-Kreisverband Wolfenbüttel, seit Febr. 2016 Mitgl. Bundesfachausschuss Arbeit und Soziales der CDU Deutschlands; seit 2014 Vors. CDA-Kreisverb. Wolfenbüttel, seit 2015 Vors. CDA-Landesverb. Braunschweig. 1991/2013 im Ortsrat Abbenrode, 2001/11 Ortsbürgermeister in Abbenrode, seit 2001 im Rat der Gemeinde Cremlingen und Vors. der CDU-Fraktion. Seit 2001 Kreistagsabgeordneter im Landkreis Wolfenbüttel, 2011/12 Vors. Ausschuss für Umwelt, Landwirtschaft und Klimaschutz, seit 2012 Vors. der CDU-Kreistagsfraktion, seit 2009 in der Asse-II-Begleitgruppe. Seit 1985 Mitgl. ver.di. Mitgl. der Freiwilligen Feuerwehr, div. Mitgliedschaften in Vereinen und Verbänden. - MdB seit Okt. 2013.', 'Uwe', '11004335');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08361, NULL, 'Dr.', 'Dr.', 'Richterin am Landgericht', 'verheiratet, 2 Kinder', '27.12.1976', NULL, 'Stadtsteinach', 'weiblich', NULL, '22.10.2013', 'Launert', NULL, 'CSU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landgericht Hof, Hof,<br/>Richterin<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>KulturKreis Hof e.V., Hof, <br/>Vorsitzende des Beirates, ehrenamtlich', '1996 Abitur Caspar-Vischer-Gymnasium Kulmbach. 1996/01 Studium der Rechtswissenschaften Univ. Bayreuth, 2001 1. Staatsexamen; 2001/02 wissenschaftl. Mitarbeiterin bei Prof. Dr. Dr. Wilhelm Mößle; 2002 Abschluss zur Wirtschaftsjuristin, 2002/04 Rechtsreferendariat am Landgericht Bayreuth, Regierung von Oberfranken, Deutsche Botschaft Washington D.C., USA; 2004 2. Staatsexamen, 2013 Promotion an der Universtät Bayreuth. 2005 Richterin am Amtsgericht Hof, Betreuungs- und Nachlassangelegenheiten, 2005/07 Richterin am Landgericht Hof, Zivilsachen, 2007/09 Staatsanwältin bei der Staatsanwaltschaft Hof, allgemeine Delikte, Jugendkriminalität, Kinderpornografie, häusliche Gewalt. 2009/10 Elternzeit. Seit Januar 2011 Richterin am Landgericht Hof, allg. Zivilsachen, Arzt-, Rechtsanwalts- und Steuerberaterhaftung, Insolvenzanfechtungs- und Kapitalanlagefälle. Mitgl. CSU-Bezirksvorstand Oberfranken, Mitgl. Landesvorst. der Frauenunion, Leiterin der Projektgruppe Familie und Frauen des FU-Landesverbandes, seit Juni 2013 FU-Bezirksvors. Oberfranken, stellv. Bezirksvors. der Mittelstands-Union Oberfranken, seit 2013 Mitgl. CSU-Parteivorstand. Mitgl. Richterverein, Juristische Gesellschaft e. V., Frankenwaldverein, Verband Wohneigentum, Europaclub der FU Oberfranken, Kulturkreis Hof e. V., Obst- und Gartenbauverein Wölbattendorf. - MdB seit Okt. 2013.', 'Silke', '11004336');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08363, NULL, 'Dr.', 'Dr.', 'Dipl.-Politologin', 'verheiratet, 2 Kinder', '03.03.1975', NULL, 'Neustadt an der Weinstraße', 'weiblich', NULL, '22.10.2013', 'Leikert', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Technische Universität, Kaiserslautern,<br/>Wissenschaftliche Mitarbeiterin', '1994 Abitur am Kreuzburggymnasium Großkrotzenburg. 1994/95 Assistant Teacher, Duke of York''s Royal Military School, Dover (GB), 1995/01 Diplomstudiengang Politologie,Volkswirtschaftslehre, Statistik und Anglistik, Johann Wolfgang Goethe-Univ. Frankfurt am Main; 1997/98 ERASMUS-Auslandssemester Universität Oslo, 2003 Stipendium, German-American Fulbright Commission, Amherst (MA), 2005 Stipendium, German Marschall Fund of the United States/Streitkräfteamt der Bundeswehr; 2006 Promotion (Dr. phil.) Technische Universität Kaiserslautern. Seit 2001 Wissenschaftl. Mitarbeiterin TU Kaiserslautern, Fachgebiet Internationale Beziehungen/Außenpolitik. 2007/13 Elternzeit. 2012 Eintritt in die CDU, seit Mai 2013 Vors. der Frauen Union Main-Kinzig, Beisitzerin im Kreisvorstand der CDU Main-Kinzig. Mitgl. Kreistag Main-Kinzig-Kreis. Mitgl. im LaLeLu e. V. Bruchköbel, Mitgl. im Sterntaler e. V. Hanau. Englisch (f), Französisch (G), Norwegisch (G). - MdB seit Okt. 2013.', 'Katja', '11004337');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08364, NULL, 'Dr.', 'Dr.', 'Physiker', 'verheiratet, 2 Kinder', '21.03.1972', NULL, 'Berlin', 'männlich', NULL, '22.10.2013', 'Lengsfeld', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bayer HealthCare AG, Berlin,<br/>Wissenschaftlicher Angestellter', 'Carl-von Ossietzky-EOS in Berlin-Pankow, 1988 relegiert, Ausreise nach Großbritannien, 1989 Rückkehr, Abitur. 1991/97 Studium an der TU Berlin und UMIST Manchester, UK; Promotion am Hahn-Meitner-Institut Berlin 1998/01. 2002/13 wissenschaftl. Mitarbeiter in einem global agierenden, forschenden Pharmaunternehmen in Berlin. Mitgl. Bündnis 90/Die Grünen 1995/01. Mitgl. der CDU seit 2001. Mitgl. Bezirksverordnetenversammlung Berlin-Prenzlauer Berg 1995/99, Mitgl. Bezirksverordnetenversammlung Berlin-Pankow 2001 und 2006/11. - MdB seit Okt. 2013.', 'Philipp', '11004338');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08366, NULL, 'Dr.', 'Dr.', 'Kreisrat, Diplom-Betriebswirt (FH)', 'ledig', '23.04.1981', NULL, 'Ebersberg', 'männlich', NULL, '22.10.2013', 'Lenz', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '2000 Ausbildung zum Bankkaufmann, 2003 nebenberufl. Weiterbildung zum Fachwirt BankColleg. 2001 Grundwehrdienst, Gebirgsjägerbataillon 232 in Berchtesgaden/Strub. 2003/04 Berufsoberschule Rosenheim. 2004/08 Studium Betriebswirtschaftslehre, Schwerpunkte Steuern, Wirtschaftsprüfung und Controlling und internat. Management; 2006 Auslandsstudium Univ. of Hertfordshire, U.K.; 2008 Diplomarbeit, Allianz S.E.; 2007/08 Zusatzstudium an der Bayer. EliteAkademie, 9. Jahrgang (Förderinstitution der bayer. Wirtschaft und Universitäten); 2012 Promotion an der Ludwig-Maximilans-Univ. München. 2009/ 12 wiss. Mitarbeiter, Stipendiat der Studenten- und Graduiertenförderung der Konrad-Adenauer-Stiftung. 2013 R/G/E, Rolvering, Germann und Effing, Managementberatung. Mitgl. in zahlreichen Vereinen, u. a. bei der Freiw. Feuerwehr Frauenneuharting, Burschenverein Jakobneuharting; Mitinitiator Ideenwettbewerb GENERATION-D, Ideen für Deutschland. 2002/08 Ortsvors. der JU, seit 2005 stellv. JU-Kreisvors., seit 2009 Ortsvors. der CSU Frauenneuharting, seit 2013 stellv. Kreisvors. der CSU im Landkreis Ebersberg. Seit 2008 Kreisrat im Kreistag des Landkreises Ebersberg. - MdB seit Okt. 2013.', 'Andreas', '11004339');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08368, 'Graf', NULL, NULL, 'Landwirt, Wirtschaftsprüfer, Steuerberater', 'verheiratet', '25.05.1952', NULL, 'Köfering', 'männlich', NULL, '22.10.2013', 'Lerchenfeld', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	KPMG Bayerische Treuhandgesellschaft, Wirtschaftsprüfungsgesellschaft, Regensburg,<br/>	Wirtschaftsprüfer und Steuerberater<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Landwirt, selbständig, Köfering<br/>   Albert Alzinger, Gemling, 2014, Stufe 3<br/>   Bayernwerk AG, Regensburg, 2013, Stufe 1; 2014, Stufe 4; 2015, Stufe 4; <br/>   2016, Stufe 4<br/>   Baywa AG, München, 2013, Stufe 5; 2014, Stufe 10; 2015, Stufe 7; 2016, Stufe 9<br/>   BTZ Bayerische Trockenzwiebel GmbH, Alteglofsheim, 2014, Stufe 6; 2015, Stufe 6;<br/>   2016, Stufe 6<br/>   Four-Pack GmbH, Oldenburg, 2016, Stufe 3<br/>   Holger Lehner, Obersanding, 2015, Stufe 1<br/>   Markus Hörner, Geisling, 2014, Stufe 1<br/>   Schanderl-Agrar-Service GmbH, Wölsendorf, 2015, Stufe 1<br/>   Südstärke GmbH, Schrobenhausen, 2013, Stufe 5; 2014, Stufe 6; 2015, Stufe 7;<br/>   2016, Stufe 6<br/>   Südzucker AG, Mannheim, 2013, Stufe 6; 2014, Stufe 9; 2015, Stufe 9; <br/>   2016, Stufe 9<br/>   The Lorenz Bahlsen Snack-World GmbH & Co KG, Germany, Neunburg v. W.,<br/>   2013, Stufe 6; 2014, Stufe 7; 2015, Stufe 10; 2016, Stufe 8<br/><br/>Funktionen in Unternehmen: <br/>Krones AG, Neutraubling,<br/>Mitglied des Aufsichtsrates und des CSR-Komitees, 2014, Stufe 6; 2015, Stufe 6; 2016, Stufe 6<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Köfering, Köfering,<br/>Mitglied des Gemeinderates, ehrenamtlich<br/><br/>Landkreis Regensburg, Regensburg,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>RCI Regensburger Centrum für Interventionelle Immunologie, Regensburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Universität Regensburg, Regensburg,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bonifaziuswerk, Paderborn,<br/>Mitglied des Generalvorstandes, ehrenamtlich<br/><br/>Diözesankomitee der Katholiken im Bistum Regensburg, Regensburg,<br/>Vorsitzender, ehrenamtlich (bis Juli 2014)<br/><br/>DJK-Sportbund im Bistum Regensburg, Regensburg,<br/>Diözesanvorsitzender, ehrenamtlich<br/><br/>vbw - Vereinigung der Bayerischen Wirtschaft e.V., München,<br/>Regionalvorsitzender der Bezirksgruppe Oberpfalz, ehrenamtlich (bis Dezember 2013)<br/><br/>Verband der bayerischen Grundbesitzer e.V., München,<br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>	Schwarzer Graf GmbH & Co KG, Köfering<br/><br/>	Schwarzer Graf Verwaltungs-GmbH, Köfering', '1958/62 Volksschule Köfering, 1962/72 Albrecht-Altdorfer-Gymnasium Regensburg. 1972/73 Wehrdienst bei den Gebirgsjägern in Bad Reichenhall und Mittenwald. 1973/77 Studium Agrarwissenschaften TU München-Weihenstephan. Seit 1982 Steuerberater, seit 1984 Wirtschaftsprüfer. Mitgl. der CSU. Seit 1990 Gemeinderat Gemeinde Köfering, seit 2002 Kreisrat Landkreis Regensburg. Diözesanvors. DJK-Sportverband e. V.; Mitgl. Verband der Bayerischen Grundbesitzer; Aufsichtsrat Krones AG Neutraubling. MdL Bayern 2003/13. - MdB seit Okt. 2013.', 'Philipp', '11004340');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08370, NULL, NULL, NULL, 'Unternehmensberaterin, Betriebswirtin IHK, Wirtschafts-Mediatorin', 'geschieden, 2 Kinder', '30.06.1960', NULL, 'Kusel', 'weiblich', NULL, '22.10.2013', 'Lezius', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Antje Lezius Unternehmensberatung, Idar-Oberstein,<br/>Unternehmensberaterin', 'Berufsfachschule für Wirtschaft, Idar-Oberstein, Abschluss Mittlere Reife. Berufsbildende Schule für Wirtschaft Kirn/Nahe, Abschluss Industriekauffrau bei der Firma SIMONA GmbH, Kirn; geprüfte Betriebswirtin, IHK Bad Kreuznach, zertifizierte Wirtschaftsmediatorin IHK Koblenz sowie Business Coach und Demografie-Lotsin; Ausbildereignungsprüfung für die Ausbildung in den Berufen Kauffmann/-frau im Einzelhandel. Seit 1998 Geschäftsführende Gesellschafterin Firma Frühauf Lezius GmbH & Co. KG, Idar-Oberstein; seit 2009 selbstständige Unternehmensberaterin (ruhend). Seit Juli 2015 Kreisvors. der CDU Birkenfeld. Mitgl. Kreistag Landkreis Birkenfeld. Englisch (G). - MdB seit Okt. 2013.', 'Antje', '11004341');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08372, NULL, NULL, NULL, 'Rechtsanwältin', 'verheiratet, 1 Kind', '25.09.1970', NULL, 'Bonn', 'weiblich', NULL, '22.10.2013', 'Lindholz', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwältin, selbständig, Aschaffenburg<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwältin, selbständig, Aschaffenburg<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bayerisches Rotes Kreuz, Kreisverband Aschaffenburg, Aschaffenburg, <br/>	Stellv. Vorsitzende, ehrenamtlich<br/><br/>	Gemeinde Goldbach, Goldbach, <br/>	Mitglied des Gemeinderates (bis Oktober 2014)<br/><br/>	Landkreis Aschaffenburg, Aschaffenburg, <br/>	Mitglied des Kreistages<br/>	Stellv. Landrätin (bis April 2014), monatlich, Stufe 1<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Fränkische Musiktage - Internationales Chor Forum e.V., Alzenau-Michelbach, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Haus Mirjam, Schöllkrippen, <br/>	Mitglied des Stiftungsrates, ehrenamtlich (bis April 2014)<br/><br/>	Stiftung Weg der Hoffnung, Aschaffenburg, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>	Technisches Hilfswerk-Helfervereinigung Aschaffenburg e.V., Aschaffenburg, <br/>	Beisitzerin des Vorstandes, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Rechtsanwälte Lindholz GbR, Goldbach', '1991 Abitur am Hanns-Seidel-Gymnasium Hösbach. 1991/94 Studium der Rechtswissenschaften Johann-Wolfgang-Goethe Univ. Frankfurt und 1994/95 Julius-Maximilian-Universität Würzburg, 1. jur. Staatsexamen 1995, Referendariat am Landgericht Aschaffenburg und am Verwaltungsgericht Würzburg, 2. jur. Staatsexamen 1999. Seit 2000 selbstständige Rechtsanwältin in Aschaffenburg mit den Schwerpunkten Familienrecht und Erbrecht, seit 2007 Fachanwältin für Familienrecht. Mitgl. der Jungen Union und der CSU, 1999/03 Vors. der JU Goldbach-Hösbach, seit 1998 Mitgl. im CSU-Ortsverband Goldbach, seit 2001 stellv. Ortsvors. CSU-Ortsverband Goldbach, 1999/05 Mitgl. im CSU-Kreisvorst. Aschaffenburg-Land, seit 2005 stellv. CSU-Kreisvors. Aschaffenburg-Land, seit 2011 Schriftführerin des CSU-Bezirksvorst.; Mitgl. der Frauen Union, 2009/11 Mitgl. im Landesvorstand der Frauen Union. 2002/14 Gemeinderätin in Goldbach, Kreisrätin im Landkreis Aschaffenburg seit 2002, Mai 2008/April 2014 erste Stellv. des Landrats. Englisch (G). - MdB seit Okt. 2013.', 'Andrea', '11004342');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08373, NULL, NULL, NULL, 'Kaufmann, Oberstleutnant a. D.', 'verheiratet', '17.09.1942', NULL, 'Prenzlau', 'männlich', NULL, '22.10.2013', 'Lorenz', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>LORENZ GmbH, Hannover,<br/>Unternehmensberater<br/><br/>Funktionen in Unternehmen: <br/>Stadtwerke Hannover AG, Hannover, <br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Hannover, Hannover, <br/>Mitglied des Stadtrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Albert-Schweitzer-Familienwerk Niedersachsen e.V., Hannover, <br/>Mitglied des Vorstandes, ehrenamtlich', '32 Jahre Bundeswehr, Stabsoffizier. 1992/2013 geschäftsführender Gesellschafter der LORENZ GmbH, seit 2013 Unternehmensberater. 1986/2016 Mitgl. Rat der Stadt Hannover, seit 1996 acht Jahre Abgeordneter der Region Hannover, fünf Jahre Vizepräsident Region Hannover. Mitgl. im Vorstand des Albert-Schweitzer Familienwerks Niedersachsen e.V., Vors. des Vahrenwalder Wirtschaftsforums e.V., Mitgl. Vorstand Haus- und Grundeigentum Hannover e. V., Mitgl. Aufsichtsrat Stadtwerke Hannover AG, Kreisvors. Volksbund Deutsche Kriegsgräberfürsorge Hannover e. V.  - MdB seit Okt. 2013.', 'Wilfried', '11004343');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08374, NULL, NULL, NULL, 'Kulturwissenschaftlerin', 'verheiratet', '13.11.1958', NULL, 'Bauhaus', 'weiblich', NULL, '22.10.2013', 'Lotze', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Einzigartig - Das kleine Hotel im Wasserviertel e.K., Lüneburg,<br/>Geschäftsführende Prokuristin<br/><br/>Funktionen in Unternehmen: <br/>AWO - Soziale Dienste gemeinnützige GmbH, Lüneburg, <br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesministerium der Finanzen, Berlin, <br/>	Stellv. Mitglied des Beirates für die grafische Gestaltung der Sonderpostwertzeichen, ehrenamtlich<br/>	<br/>Hansestadt Lüneburg, Lüneburg, <br/>	Mitglied des Stadtrates, ehrenamtlich<br/>	<br/>Stiftung Archiv der Parteien und Massenorganisationen der DDR im Bundesarchiv (SAPMO), Berlin, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Stiftung Deutsches Historisches Museum (DHM), Berlin, <br/>	Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/>	<br/>Stiftung Flucht, Vertreibung, Versöhnung, Berlin, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/>	<br/>Stiftung Haus der Geschichte der Bundesrepublik Deutschland, Bonn, <br/>	Mitglied des Stiftungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Lüneburger Assistenz e.V., Lüneburg, <br/>	Beisitzerin des Vorstandes, ehrenamtlich', 'Realschule, Abitur am Abendgymnasium. Studium der Angewandten Kulturwissenschaften, Abschluss Magister Artium. Beamtin beim Deutschen Wetterdienst; Tätigkeit in der Erwachsenenbildung. 1999/09 wissenschaftliche Mitarbeiterin einer Bundestagsabgeordneten. 2010/13 Leitung eines Hotels. Seit 1986 SPD-Mitgl., seit 2004 SPD-Vorsitzende in Lüneburg.  Seit 2001 Mitgl. Rat der Hansestadt Lüneburg. Mitgl. der Arbeiterwohlfahrt, ver.di, Deutsch-Dänische Gesellschaft, Allgemeiner Deutscher Fahrrad-Club (ADFC). - MdB seit Okt. 2013.', 'Hiltrud', '11004344');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08375, NULL, 'Dr.', 'Dr.', 'Generalsekretärin', 'verheiratet, 2 Kinder', '04.02.1962', NULL, 'Dortmund', 'weiblich', NULL, '22.10.2013', 'Lücking-Michel', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Cusanuswerk, Bonn,<br/>	Generalsekretärin<br/><br/>Funktionen in Unternehmen: <br/>	Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ) GmbH, Bonn, Eschborn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundeszentrale für politische Bildung, Bonn, <br/>	Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Haus der Geschichte der Bundesrepublik Deutschland, Bonn, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Arbeitsgemeinschaft für Entwicklungshilfe (AGEH) e.V., Köln, <br/>	Vorsitzende des Vorstandes, ehrenamtlich<br/><br/>	Gemeinschaft Katholischer Männer und Frauen (KMF), Köln, <br/>	Leiterin, ehrenamtlich<br/><br/>	Katholischer Deutscher Frauenbund e.V. (KDFB), Köln, <br/>	Mitglied des Stiftungskuratoriums, ehrenamtlich<br/><br/>	Zentralkomitee der deutschen Katholiken (ZdK), Bonn, <br/>	Vizepräsidentin, ehrenamtlich', '1981 Abitur in Menden. Ab 1982 Studium der Kath. Theologie und Geschichte in Münster, Jerusalem, Tübingen und Rom, 1987 Diplom in Theologie. 1988 Staatsexamen für Lehramt/Sek II in Theologie und Geschichte. 1992 Promotion. 1991/97 Referentin im Cusanuswerk (Begabtenförderung der kath. Kirche) in Bonn. 1997/04 Abteilungsleiterin bei Misereor (Hilfswerk für Entwicklungszusammenarbeit) in Aachen. 2004/13 Generalsekretärin des Cusanuswerks in Bonn. Mitgl. der CDU seit 2004, stellv. Kreisvors. der CDU Bonn; Mitglied der CDA. Seit 2012 Vorstandsvors. Arbeitsgemeinschaft für Entwicklungshilfe e. V. (AGEH), Köln; seit 2005 Vizepräsidentin Zentralkomitee der deutschen Katholiken (ZdK), Bonn; Mitgl. Stiftungskuratorium Kath. Deutscher Frauenbund (KDFB), Köln; Mitgl. des Kuratoriums der Stiftung Haus der Geschichte der Bundesrepublik (Bonn, Leipzig, Berlin); Kuratoriumsvors. Dt. Gesellschaft für Internationale Zusammenarbeit GmbH; Kuratoriumsmitgl. Don Bosco Mondo, Bonn, Mitgl. Programmbeirat ASA-Programm, stellv. Mitgl. Kuratorium der Bundeszentrale für politische Bildung; Leiterin Gemeinschaft Kath. Männer und Frauen (KMF), Köln; Mitgl. Kuratorium Exposure und Dialog e. V., Bonn. - MdB seit Okt. 2013; stellv. Vors. der Gruppe der Frauen der CDU/CSU-Fraktion, Mitgl. Arbeitnehmergruppe der CDU/CSU-Fraktion, Mitgl. Stephanuskreis und Kardinal-Höffner-Kreis der CDU/CSU-Fraktion; Mitgl. Dt.-Israelischen und Dt.-Indische Parlamentariergruppe sowie Parlamentariergruppe SADC-Staaten (Southern African Development Community).', 'Claudia', '11004345');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08376, NULL, NULL, NULL, 'Diplom-Soziologin', 'ledig', '28.11.1979', NULL, 'Rodewisch', 'weiblich', NULL, '22.10.2013', 'Magwas', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Deutscher Bundestag, Berlin,<br/>Wissenschaftliche Mitarbeiterin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Deutschlandradio, Berlin, <br/>	Stellv. Vorsitzende des Hörfunkrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Vogtländischer Verein zu Berlin e.V., Berlin, <br/>Vorsitzende', '1998 Abitur. 1998/05 Studium der Soziologie, BWL und Psychologie an der TU Chemnitz, Abschluss als Dipl.-Soziologin. 2005/13 wissenschaftliche Mitarbeiterin und Referentin. 2001 Eintritt in die CDU, 2001/07 Vors. Junge Union Vogtland, 2003/08 Beisitzerin Landesvorstand Junge Union Sachsen & Niederschlesien, 2008/10 Beisitzerin Landesvorstand der KPV Sachsen, seit 2008 stellv. Kreisvors. CDU-Vogtland. 2003/09 Stadträtin in Auerbach, 2003/05 Kreisrätin Vogtlandkreis. Seit 2014 Vors. Vogtländischer Verein zu Berlin e. V.- MdB seit Okt. 2013.', 'Yvonne', '11004346');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08377, NULL, 'Dr.', 'Dr.', 'Geologin', 'verheiratet, 2 Kinder', '09.04.1958', NULL, 'Essen', 'weiblich', NULL, '22.10.2013', 'Malecha-Nissen', NULL, 'SPD', NULL, 'konfessionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Malecha & Nissen Energietechnik GmbH, Passade,<br/>Geschäftsführerin<br/><br/>Funktionen in Unternehmen: <br/>Abfall Wirtschaftsgesellschaft Kreis Plön mbH, Plön, <br/>Mitglied des Aufsichtsrates, ehrenamtlich (bis 10.11.2013)<br/><br/>Verkehrsbetriebe Kreis Plön GmbH, Plön, <br/>Mitglied des Aufsichtsrates, ehrenamtlich (bis 10.11.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreis Plön, Plön, <br/>Mitglied des Kreistages, ehrenamtlich (bis 10.11.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Natur- und Umweltstiftung Kreis Plön, Plön, <br/>Mitglied des Vorstandes, ehrenamtlich (bis 10.11.2013)', 'April 1990 Abschluss Studium der Geologie mit dem akad. Grad Dipl.-Geologin, Ruhr-Univ. Bochum, Nov. 1997 Dissertation zur Erlangung des Doktorgrades an der Mathematisch-Naturwissenschaftlichen Fakultät der Christian-Albrechts-Univ. zu Kiel. 1991/03 wiss. Angestellte am Forschungszentrum GEOMAR, Kiel, Abteilung Vulkanologie und Petrologie, bis 2013 Geschäftsführerin Planungsbüros für Energietechnik. Mitgl. AWO, BUND. 2011/13 stellv. Vors. des Landesvorst. der Arbeitsgemeinschaft der Selbstständigen (AGS) Schleswig-Holstein. Seit 2009 Vors. des SPD Ortsvereins Probsteierhagen, seit 2013 stellv. Vors. der SPD im Kreis Plön, 2009/11 Mitgl. des Landesvorst. der SPD Schleswig-Holstein. 2003/13 Abgeordnete des Plöner Kreistages, umweltpol. Sprecherin der Fraktion, Vors. Natur- und Umweltstiftung Kreis Plön, 2006/13 Mitgl. Hauptausschuss. Englisch (f), Französisch (G), Spanisch (G). - MdB seit Okt. 2013; Mitgl. der Querschnitts-Arbeitsgemeinschaft Migration und Integration der SPD-Fraktion, stellv. Mitgl. Eisenbahninfrastrukturbeirat bei der Bundesnetzagentur für Elektrizität, Gas, Telekommunikation, Post und Eisenbahn.', 'Birgit', '11004347');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08378, NULL, NULL, NULL, 'selbstständig', 'verheiratet, 3 Kinder', '11.02.1958', NULL, 'Düsseldorf', 'weiblich', NULL, '22.10.2013', 'Manderla', NULL, 'CDU', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Ingenieurbüro Manderla, Köln,<br/>Umweltberaterin<br/><br/>Funktionen in Unternehmen: <br/>GAG Immobilien AG, Köln, <br/>	Mitglied des Aufsichtsrates (bis 27.05.2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Brücker Informationen e.V., Köln-Brück, <br/>	Vorsitzende, ehrenamtlich<br/><br/>	Bund Katholischer Unternehmer e.V., Köln, <br/>	Stellv. Vorsitzende der Diözesangruppe Köln, ehrenamtlich<br/><br/>	Deutsche Gesellschaft für Wehrtechnik e.V., Bonn, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/><br/>	Katholische Arbeitsgemeinschaft für Soldatenbetreuung e.V., Berlin, <br/>	Vorsitzende des Vorstandes, ehrenamtlich<br/><br/>	Kleine Hände e.V., Köln, <br/>	Mitglied des Vorstandes, ehrenamtlich (bis 31.12.2014)<br/><br/>	Neue Medien für Kölner Schulen e.V., Köln, <br/>	Mitglied des Vorstandes, ehrenamtlich', 'Suitbertus-Gymnasium in Kaiserwerth. Studium der Romanistik und Anglistik Univ. Düsseldorf. Seit 1994 betriebliche Umweltfachkraft, freiberuflich tätig im familieneigenen Ingenieurbüro. Seit 1978 Mitgl. der CDU, 1996/99 Mitgl. der BV Kalk, stellv. Vors. der CDU Köln; stellv. Landesvors. der Frauen Union NRW, Vors. der Frauen Union Köln. 2000/13 Mitgl. Rat der Stadt Köln, 2006/13 Vors. des Ausschusses für Schule und Weiterbildung. Seit Mai 2015 Vors. der Kath. Arbeitsgemeinschaft für Soldatenbetreuung e. V. (KAS). - MdB seit Okt. 2013.', 'Gisela', '11004348');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08380, NULL, NULL, NULL, 'Verleger', 'verheiratet, 2 Kinder', '03.08.1962', NULL, 'Freiburg im Breisgau', 'männlich', NULL, '16.11.2013', 'Marschall', NULL, 'CDU', 'von', 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>AUDIOBUCH Verlag oHG, Freiburg,<br/>Verleger<br/><br/>Funktionen in Unternehmen: <br/>AUDIOBUCH Verlag oHG, Freiburg, <br/>Geschäftsführender Gesellschafter, 2013, Stufe 4, Gewinn; ab 2014 monatlich, Stufe 1, Gewinn<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde March, March, <br/>Mitglied des Ortschaftsrates Neuershausen<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>AUDIOBUCH Verlag oHG, Freiburg', 'Abitur am Friedrich-Gymnasium Freiburg. Studium der Romanistik und Geschichte in Köln, Sevilla und Madrid, Magister Artium (M.A.); Ausbildung zum Verlagskaufmann im Freiburger Verlag Herder. 1992/02 De Gruyter Verlag, Berlin/New York, internationale Zusammenarbeit mit Verlagspartnern und Universitäten in Europa, Asien, Südamerika, Australien, 2003 Rückkehr nach Freiburg; Gemeinsam mit Dr. Corinna Zimber Gesellschafter und Geschäftsführer des Audiobuch Verlags. Mitgl. deutsch-französischer Rotary Club Des Deux Brisach. Seit 2009 Ortsvors. der CDU March, stellv. Vors. der Kommunalpolitischen Vereinigung (KPV) der CDU Breisgau-Hochschwarzwald, Leitung des Arbeitskreises Energie der CDU Breisgau-Hochschwarzwald. - MdB seit Okt. 2013.', 'Matern', '11004349');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08381, NULL, NULL, NULL, 'Diplom-Verwaltungswirt (FH)', 'verheiratet, 1 Kind', '15.10.1953', NULL, 'Altmugl, Gem. Neualbenreuth', 'männlich', NULL, '22.10.2013', 'Meier', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>Christlich-Soziale Union, München,<br/>Büroleiter des Parteivorsitzenden Horst Seehofer<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Tirschenreuth, Tirschenreuth, <br/>	Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung Kultur- und Begegnungszentrum Abtei Waldsassen, Waldsassen,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>XertifiX e.V., Freiburg,<br/>Mitglied des Kuratoriums, ehrenamtlich', 'Studium an der Fachhochschule für öffentliche Verwaltung und Rechtspflege in Bayern, Diplom als Verwaltungswirt (FH). Verwaltungslehre. Beamtenlaufbahn für den gehobenen nichttechnischen Verwaltungsdienst im Freistaat Bayern, zuletzt Regierungsamtsrat; ab 2006 Büroleiter des Bundestagsabgeordneten Horst Seehofer, Bundesminister, seit 2009 Büroleiter des Parteivorsitzenden der CSU, MP Horst Seehofer. Eintritt in die CSU 1973, Vorstandsmitgl. im CSU-Orts- und Kreisverband Tirschenreuth, Mitgl. des CSU-Bezirksvorst. Oberpfalz, 1984 Beisitzer im Landesvorst. Bayern der Christlich Sozialen Arbeitnehmer Union (CSA),Bezirksvorstand Oberpfalz, 1988 stellv. Bezirksvors, Beisitzer im Landesvorstand Bayern der Christlich Sozialen Arbeitnehmer Union (CSA), 1998 CSA Bezirksvors. Oberpfalz, stellv. Landesvors. der CSA Bayern, seit 1988 Mitgl. Vorstand und seit März 2014 Vizepräs. der Europäischen Union (EUCDA), Brüssel, 2012 Vorstandsmitgl. des EZAB (Zentrum für Arbeitnehmerfragen), München. Seit Mai 2014 Mitgl. Kreistag Tirschenreuth. Ehrenamtl. Mitgl. Kuratorium Stiftung Kultur- und Begegnungszentrum Kloster Waldsassen, Mitgl. Kuratorium XertifiX e. V. Europamedaille der EVP-Fraktion. Ehrenvors. der Bayerischen Sportjugend, Kreis Tirschenreuth. - MdB seit Okt. 2013; stellv. Vors. der Arbeitnehmergruppe der CDU/CSU-Fraktion.', 'Reiner', '11004350');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08382, NULL, NULL, NULL, 'Diplom-Sozialpädagoge', 'verheiratet, 4 Kinder', '31.03.1966', NULL, 'Oldenburg (Oldenburg)', 'männlich', NULL, '22.10.2013', 'Meiwald', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Diplom-Sozialpädagoge in der Jugendhilfe, Westerstede<br/><br/>Funktionen in Unternehmen: <br/>EWE AG, Oldenburg, <br/>Mitglied des Aufsichtsrates, jährlich, Stufe 4<br/><br/>Kreisvolkshochschule Ammerland gemeinnützige GmbH, Westerstede, <br/>Stellv. Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Rettungsdienst Ammerland GmbH, Westerstede, <br/>Stellv. Mitglied der Gesellschafterversammlung, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Ems-Weser-Versorgungs- und Entsorgungsverband, Oldenburg, <br/>Mitglied der Verbandsversammlung und des Verbandsausschusses<br/><br/>Landkreis Ammerland, Westerstede, <br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Stadt Westerstede, Westerstede, <br/>Mitglied des Stadtrates, ehrenamtlich (bis Dezember 2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Westerstede Solar e.V., Westerstede, <br/>1. Vorsitzender, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Friederike und Peter Meiwald GbR, Westerstede (bis Dezember 2013)', '1985 Abitur in Vechta. 1991 Studienabschluss als Dipl.- Sozialpädagoge; Weiterbildung zum systemischen Familienberater, 1991/92 Anerkennungsjahr in einem Straßenkinderzentrum in Ruanda; 1993 Flüchtlingssozialarbeiter in Hannover, seit 1993 Sozialpädagoge in der Jugendhilfe, seit 2001 selbstständig in eigenem Unternehmen. Mitgl. BÜNDNIS 90/DIE GRÜNEN seit 1998, Ortsverbandsvorstand 2000/01, Kreisvorstand 2001/12, 2009/13 Mitgl. im niedersächsischen Parteirat. Geschäftsführer der Kreistagsfraktion Ammerland 2002/11, seit 2011 Mitgl. Kreistag Landkreis Ammerland, 2003/13 Ratsherr in der Stadt Westerstede, Bürgermeisterkandidat 2006. Bundestagsdirektkandidat im Wahlkreis 28 Oldenburg-Ammerland 2009. 1. Vors. Westerstede Solar e. V., Mitgl. Komera - Jugend & Entwicklung e. V., Mitgl. Bürgerbus Westerstede e. V., eirene international, Deutsch-Ausländischer Freundschaftsverein Ammerland e. V., Jugendkunstschule ABRAXAS e. V., BI Ammerländer Bürger gegen die A22/A20, Eine-Welt-Laden Äquator, Boßelverein Moorburg e.V., Heimatverein Halsbek e. V., Kuratoriumsmitgl. Don Bosco Mundo e. V. - MdB seit Okt. 2013.', 'Peter', '11004351');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08384, NULL, NULL, NULL, 'Winzer, Diplom-Betriebswirt (FH)', 'ledig', '05.07.1981', NULL, 'Worms', 'männlich', NULL, '22.10.2013', 'Metzler', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Fachhochschule  Worms, Worms,<br/>Assistent der Hochschule / Wissenschaftlicher Mitarbeiter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Fachhochschule Worms, Worms, <br/>Mitglied des Fachbereichsrates Studiengang International Management / Handelsmanagement<br/><br/>Landkreis Alzey-Worms, Alzey, <br/>Mitglied des Kreistages<br/><br/>Ortsgemeinde Dittelsheim-Heßloch, Dittelsheim-Heßloch, <br/>Mitglied des Ortsgemeinderates<br/><br/>Verbandsgemeinde Westhofen, Westhofen, <br/>Mitglied des Verbandsgemeinderates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Alumni Verein der Fachhochschule Worms, Worms, <br/>Mitglied des Vorstandes<br/><br/>Deutsch-Ukrainische Gesellschaft für Wirtschaft und Wissenschaft e.V., Berlin, <br/>Kassenprüfer', '1988/92 von Dalberg Grundschule Dittelsheim-Heßloch, 1992/98 Realschule Osthofen, Mittlere Reife. 1998/01 Ausbildung zum Winzer. 2001/02 Fachoberschule Bad-Kreuznach, Fachhochschulreife; 2003/04 IST Studieninstitut Düsseldorf, Fernstudium zum Eventmanager, 2004/08 Fachhochschule Worms, Studiengang Handelsmanagement, Diplombetriebswirt (FH); 2005/08 Fachhochschule Worms, Studentische Hilfskraft; 2008/10 Fachhochschule Worms, Studiengang International Management, Master of Arts. 2008/13 Fachhochschule Worms, Koordinator Internationaler Studentenaustausch. 2000/08 Mitgl. CDU-Kreisvorst. Alzey-Worms, seit 2001 Mitgl. CDU-Bezirksvorst. Rheinhessen-Pfalz; 2003/12 Kreisvors. der Jungen Union Alzey-Worms, 2009/13 Vors. der Jungen Union Rheinhessen-Pfalz, seit 2016 CDU-Kreisvors. Alzey-Worms. Seit 2004 Mitgl. Kreistag Alzey-Worms, stellv. Vors. der CDU-Fraktion im Verbandsgemeinderat Westhofen und 2004/13 Vors. der CDU-Fraktion im Ortsgemeinderat Dittelsheim-Heßloch. - MdB seit Okt. 2013.', 'Jan', '11004352');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08385, NULL, NULL, NULL, 'Polizeibeamtin', 'verheiratet', '17.11.1976', NULL, 'Waldbröl', 'weiblich', NULL, '22.10.2013', 'Mihalic', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Polizeipräsidium Köln, Köln,<br/>Polizeibeamtin<br/><br/>Funktionen in Unternehmen: <br/>Stadtwerke Gelsenkirchen GmbH, Gelsenkirchen, <br/>Mitglied des Aufsichtsrates (bis 21.11.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Zukunftsforum Öffentliche Sicherheit e.V., Berlin, <br/>Mitglied des Parlamentarischen Beirates, ehrenamtlich', 'Kriminologin/Polizeiwissenschaftlerin (M.A.). Seit 2006 Mitgl. Bündnis 90/Die Grünen, 2007/09 Mitgl. im Kreisvorstand der Gelsenkirchener Grünen, zunächst als Beisitzerin dann als Vorstandssprecherin, seit 2010 Mitgl. im Landesvorstand von Bündnis 90/Die Grünen NRW. 2009/13 Mitgl. im Rat der Stadt Gelsenkirchen und stellv. Vors. der Grünen-Ratsfraktion. - MdB seit Okt. 2013; Sprecherin der Fraktion Bündnis 90/Die Grünen für Innenpolitik; Obfrau im Innenausschuss; stellv. Vors. Dt.-Kroatische Parlamentariergruppe.', 'Irene', '11004353');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08386, NULL, NULL, NULL, 'freiberuflicher Gutachter und Entwickler (Diplom-Biologe)', 'geschieden', '16.05.1964', NULL, 'Lienen', 'männlich', NULL, '22.10.2013', 'Mindrup', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Freiberuflicher Diplom-Biologe, Berlin<br/><br/>	Hafenresort Silz Verwaltungs GmbH, Prien a. Chiemsee,<br/>	Geschäftsführer<br/><br/>	Klaus Mindrup Projektentwicklung I UG (haftungsbeschränkt),<br/>	Berlin,<br/>	Geschäftsführer<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Freiberuflicher Diplom-Biologe, Berlin (bis 31.12.2015)<br/>   Beratung, <br/>   GMZ Planungsgesellschaft Matthias Zinnen mbH, Berlin, 2014, Stufe 3<br/><br/>Hafenresort Silz Verwaltungs GmbH, Prien a. Chiemsee,<br/>Geschäftsführer<br/><br/>KLMI Verwaltungs UG (haftungsbeschränkt), Berlin,<br/>Geschäftsführer<br/><br/>Funktionen in Unternehmen: <br/>Wohnungsbaugenossenschaft "Bremer Höhe" eG, Berlin, <br/>	Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Land Berlin, Berlin, <br/>	Bezirksverordneter der Bezirksverordnetenversammlung Pankow <br/>	(bis 30.09.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Unabhängiges Institut für Umweltfragen e.V., Berlin,<br/>Stellv. Vorsitzender, ehrenamtlich (bis 23.05.2014)<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Ferienhausanlage Nossentin UG (haftungsbeschränkt) Co KG, Berlin<br/><br/>Hafenresort Silz Verwaltungs GmbH, Prien a. Chiemsee<br/><br/>Klaus Mindrup Projektentwicklung I UG (haftungsbeschränkt), Berlin', '1983 Abitur am Städtischen Gymnasium Lengerich. 1983/84 Zivildienst "Schule in der Widum" Lengerich (Förderschule mit Förderschwerpunkt Geistige Entwicklung). 1984/88 Studium der Biologie Univ. Osnabrück, Diplom-Biologe mit Schwerpunkt Ökologie. Seit 1988 Gutachter und Entwickler. Stellv. Vors. des Unabhängigen Instituts für Umweltfragen e. V. 1998/2014. Mitgl. Aufsichtsrat der Wohnungsbaugenossenschaft Bremer Höhe eG seit 2003. Mitgl. im Bundesvorstand des Bundesverbands Windenergie e. V. (BWE) 2009/13. Mitgl. der SPD seit Oktober 1982, zeitweilig Mitgl. im JUSO-Landesvorstand Nordrhein-Westfalen und Mitgl. im Parteirat Westliches Westfalen,  seit 2010 Mitgl. Landesvorst. der Berliner SPD. Mitgl. der Bezirksverordnetenversammlung Berlin-Prenzlauer Berg bzw. Berlin-Pankow 1999/2014, 2001/03 Vors. Ausschuss für Wirtschaft, 2004/06 Vors. Ausschuss für Finanzen, Immobilienmanagement und Personal, 2001/08 Vors. der SPD-Fraktion. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 77 (Berlin-Reinickendorf)', 'Klaus', '11004354');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08387, NULL, NULL, NULL, 'Polizeibeamtin', '1 Kind', '25.07.1958', NULL, 'Cleveland, USA', 'weiblich', NULL, '22.10.2013', 'Mittag', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Niedersachsen, Hannover,<br/>Polizeibeamtin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Ems-Weser-Versorgungs- und Entsorgungsverband (EWE), Oldenburg, <br/>	Mitglied der Verbandsversammlung<br/>	<br/>Sparkassenzweckverband Oldenburg, Oldenburg, <br/>	Mitglied der Verbandsversammlung<br/>	<br/>Stadt Delmenhorst, Delmenhorst, <br/>	Mitglied des Stadtrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	EWE Stiftung, Oldenburg, <br/>	Mitglied des Stiftungsvorstandes<br/>	<br/>Kommunalverbund Niedersachsen Bremen e.V., Delmenhorst, <br/>	Mitglied der Mitgliederversammlung<br/>	<br/>Metropolregion Bremen-Oldenburg im Nordwesten e.V., Delmenhorst, <br/>	Mitglied der Metropolversammlung<br/>	<br/>Regionale Stiftung der Landessparkasse zu Oldenburg, Oldenburg, <br/>	Mitglied des Stiftungsrates', 'Rechtsanwalts- und Notargehilfin. 1979 Eintritt in den Polizeidienst, Ausbildung in Hannoversch Münden. 1981/83 Polizeibeamtin, zunächst in Syke, dann in Delmenhorst, Arbeitsbereich Eigentumsdelikte, 2000/05 Vors. Personalrat der Polizei; 2001 Eintritt gehobener Dienst, 2004/09 Pressesprecherin Polizei. Seit 1988 Mitgl. der SPD, stellv. Vors. der SPD Weser-Ems. 1996/16 Mitgl. im Stadtrat Delmenhorst, 2006/11 Vors. SPD- Stadtratsfraktion Delmenhorst. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 32 (Cloppenburg - Vechta)', 'Susanne', '11004355');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08388, NULL, NULL, NULL, 'Schulleiter', 'verheiratet, 1 Kind', '30.08.1949', NULL, 'Schneverdingen', 'männlich', NULL, '22.10.2013', 'Möring', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Nordrhein-Westfalen, Düsseldorf,<br/>Schulleiter<br/><br/>Funktionen in Unternehmen: <br/>Kölner Verkehrs-Betriebe AG, Köln, <br/>Mitglied des Aufsichtsrates', '1968 Abitur. Wehrdienst. Studium der Geschichte und Geographie Univ. Köln, 1975 1. Staatsexamen. Nach dem 2. Staatsexamen seit Anfang 1977 Lehrer am Gymnasium, Anfang 1989 stellv. Schulleiter in Brühl, Oktober 1992 Schulleiter des Maximilian-Kolbe-Gymnasiums in Porz-Wahn. Mitgl. im Vorstand der Kölner CDU, 2004/07 Vors. CDU-Stadtbezirk Rodenkirchen und 2008/12 stellv. Vors. CDU-Kreisverband Köln. 1999/2013 Mitgl. Rat der Stadt Köln, verkehrspolitischer Sprecher der CDU-Ratsfraktion. 2004/13 Vors. Nahverkehrszweckverbandsversammlungen von VRS und NVR. 2004/13 Mitgl. Regionalrat bei der Bezirksregierung Köln, seit 2000 verkehrspol Sprecher der CDU in der Verkehrskommission des Regionalrats. - MdB seit Okt. 2013.', 'Karsten', '11004356');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08389, NULL, NULL, NULL, 'Staatsrätin a.D.', 'verheiratet, 3 Kinder', '13.10.1952', NULL, 'Lübeck', 'weiblich', NULL, '22.10.2013', 'Motschmann', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Journalistin, Bremen<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>STIFTUNG JA ZUM LEBEN, Meschede, <br/>Mitglied des Kuratoriums', 'Gymnasium am Hochrad in Hamburg, Abitur. Studium der Theologie, Romanistik und Pädagogik Univ. Kiel und Hamburg. 1975/93 Freie Journalistin und Publizistin, Herausgabe von zahlreichen Publikationen zu familien- und frauenpolitischen Themen, sowie Reportagen aus der Dritten Welt u. a. im Auftrag der Kindernothilfe Duisburg. 1986/93 freie Mitarbeiterin beim Axel-Springer-Verlag sowie 1986/91 als freie Mitarbeiterin beim Norddeutschen Rundfunk tätig. 1977/87 Mitarbeit in versch. Gremien der CDU Schleswig-Holstein, z. B. Mitgl. Landesvorst. CDU Schleswig-Holstein, stellv. Landesvors. CDU-Frauen Union Schleswig-Holstein, 1990/2006 stellv. Landesvors. CDU Bremen, seit 2012 stellv. Landesvors. CDU Bremen, 2015 Spitzenkandidatin der CDU zur Bürgerschaftswahl in Bremen, seit Dez. 2012 Mitgl. Bundesvorst. der CDU Deutschlands. 1991/99 stellv. Fraktionsvors. der CDU-Bürgerschaftsfraktion. 1999/07 Staatsrätin für Kultur. 2007/13 Mitgl. der Bremischen Bürgerschaft, 2007/11 Vors. Ausschuss für Bundes- und Europaangelegenheiten, internationale Kontakte und Entwicklungszusammenarbeit, ab Juli 2007 Vors. Petitionsausschuss, ab Juni 2011 Fraktionssprecherin der CDU-Fraktion für Kirchliche Angelegenheiten, Medien, Datenschutz, Informationsfreiheit und Petitionen. - MdB seit Okt. 2013.', 'Elisabeth', '11004357');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08390, NULL, NULL, NULL, 'Rechtsanwältin, Krankenschwester', '2 Kinder', '07.06.1959', NULL, 'Alzenau-Wasserlos', 'weiblich', NULL, '22.10.2013', 'Müller', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Angestellte Rechtsanwältin, Flörsbachtal<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Amtsgericht Gelnhausen, Gelnhausen,<br/>Betreuerin, 2013, Stufe 1; 2014, Stufe 3; 2015, Stufe 4; 2016, Stufe 3<br/><br/>Rechtsanwalt Thomas Runkel, Flörsbachtal,<br/>Rechtsanwältin (bis 30.11.2013)', '1978 Abitur an der Otto-Hahn-Schule in Hanau. 1978/80 Studium der Germanistik und Philosophie Goethe-Univ. Frankfurt/Main. 1980/83 Ausbildung zur Krankenschwester am Stadtkrankenhaus Hanau (Examen). 1983/84 Krankenschwester im Stadtkrankenhaus Hanau, 1984/85 Gemeindeschwester beim Caritas-Verband Frankfurt. 1985/91 Studium der Rechtswissenschaften Goethe-Univ. Frankfurt/Main, 1. jur. Stattsexamen, 1992/95 Referendariat beim Landgericht Hanau, 2. jur. Staatsexamen. Seit 1995 eigene Kanzlei mit Ehemann Thomas Runkel, Schwerpunkt Familienrecht (Betreuungsrecht, Sozialrecht, Sorgerecht). 1979/81 Gründungsmitglied bei "Die Grünen". Mitgl. der SPD seit 1997, 2000/05 Vors. Ortsverein Flörsbachtal, 2006/08, 2010/12 und seit Mai 2014 Mitgl. Unterbezirksvorst. der SPD Main-Kinzig, Mitgl. im Landesvorst. der SPD Hessen seit Dez. 2013. Beigeordnete und regelmäßige Vertreterin des Bürgermeisters 2001/06, Fraktionsvors. der SPD/BB-Fraktion im Gemeindeparlament 2006/09. Mitgl. Kreistag Main-Kinzig-Kreis seit 2006, Mitgl. im SPD-Fraktionsvorst. Kreis des Main-Kinzig-Kreises. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 177 (Wetterau I)', 'Bettina', '11004358');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08392, NULL, NULL, NULL, 'Journalistin', 'verheiratet', '09.04.1980', NULL, 'Herne', 'weiblich', NULL, '22.10.2013', 'Müntefering', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Journalistin, Herne<br/><br/>Funktionen in Unternehmen: <br/>Evangelische Krankenhausgemeinschaft Herne, Castrop-Rauxel <br/>gemeinnützige GmbH, Herne,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Stellv. Mitglied des Beirates<br/><br/>Die Beauftragte der Bundesregierung für Kultur und Medien, Berlin,<br/>Mitglied der Jury des Deutschen Kurzfilmpreises (bis 31.12.2016)<br/><br/>Landesanstalt für Medien Nordrhein-Westfalen (LfM), Düsseldorf,<br/>Mitglied der Landesmedienkommission (bis 26.02.2015)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>American Jewish Committee e.V. (AJC), Berlin,<br/>Mitglied des Beirates<br/><br/>Deutsch-Arabische Freundschaftsgesellschaft e.V. (DAFG), Berlin,<br/>Mitglied des Vorstandes<br/><br/>Deutsch-Türkische Gesellschaft e.V., Berlin,<br/>Vizepräsidentin<br/><br/>Deutsche Orient-Stiftung, Berlin,<br/>Vorsitzende des Kuratoriums<br/><br/>Gesellschaft der Freunde der Ruhr-Universität Bochum e. V., Bochum,<br/>Mitglied des Vorstandes<br/><br/>Hiberniaschule und Hibernia-Kolleg, Staatlich genehmigte <br/>Gesamtschule und Kolleg, Herne,<br/>Mitglied des Kuratoriums<br/><br/>Stiftung Datenschutz, Leipzig,<br/>Mitglied des Beirates (bis 31.01.2016)', '1997/98 Ausbildung mit Abschluss zur Kinderpflegerin. 2000 Abitur an der Hiberniaschule Herne. 2000/02 Freie Mitarbeiterin Lokalredaktion. 2002/07 Studium, "Journalismus und PR", Schwerpunkt Wirtschaft, Februar 2007 (B. A.). 2003/08 selbstständig tätig im Bereich Presse und PR, u. a. als Referentin für Verbände und soziale Organisationen, zunächst studienbegleitend. 2008/09 Wissenschaftl. Mitarbeiterin, Deutscher Bundestag; 2008/10 Volontariat bei der Berliner vorwärts Verlagsgesellschaft mbH, Berlin. Seit 2010 Freie Journalistin. Seit 1999 Mitgl. der SPD, 1999/04 stellv. Vors. der Jungsozialisten in Herne, seit 2000 Mitgl. Vorst. der SPD Herne, 2004/14 Mitgl. im Vorstand des SPD-Landesbezirks NRW, seit 2002 stellv. Vors. der SPD Herne, 2004/14 Mitgl. Landesvorst. der NRW SPD. 2004/13 Stadtverordnete im Rat der Stadt Herne. - MdB seit Okt. 2013.', 'Michelle', '11004359');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08393, NULL, NULL, NULL, 'Diplom-Ingenieur', 'verheiratet, 2 Kinder', '10.01.1968', NULL, 'Kelkit, Türkei', 'männlich', NULL, '22.10.2013', 'Mutlu', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Berater, freiberuflich, Berlin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Berater, freiberuflich, Berlin<br/>Bahçesehir Universität, Istanbul, Türkei, 2013, Stufe 1 (bis 30.11.2015)<br/>media consulta Germany GmbH, Berlin, 2013, Stufe 1 (bis 31.12.2013)<br/><br/>Funktionen in Unternehmen: <br/>	BAU International Berlin - University of Applied Sciences gemeinnützige GmbH, Berlin, <br/>	Mitglied des Hochschulrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundeszentrale für politische Bildung, Bonn, <br/>	Stellv. Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Stiftung Lesen, Mainz,<br/>Mitglied des Kuratoriums', '1974/85 Grund- und Oberschule in Berlin-Kreuzberg. 1985/89 Ausbildung Informationselektronik an der TU Berlin. 1989 Fachabitur. 1989/93 Studium an der TFH Berlin, Diplom-Ing. Nachrichtentechnik. 1992 Studium und Praktikum in Nebraska - USA. 1993/99 Planungsingenieur bei der Fa. E-Plus Mobilfunk GmbH. Seit 1990 Mitgl. Bündnis 90/Die Grünen, Landes- und Bundesparteitagsdelegierter. 1992/99 Mitgl. Bezirksverordnetenversammlung Kreuzberg. Mitgl. Abgeordnetenhaus Berlin 1999/Nov. 2013, bildungspolitischer Sprecher der Fraktion Bündnis 90/Die Grünen. 2008 World-Young-Leader der BMW Quandt-Stiftung, 2007 Israeli-German-Young-Leader der Bertelsmann Stiftung, 2006 Marshall-Memorial-Fellow des German-Marshall-Funds, 2000 Young Leader der Atlantik-Brücke; Mitgl. BSC Rehberge, Mitgl. Kuratorium Stiftung Lesen, Mitgl. und Mitgründer Förderverein der Aziz-Nesin-Grundschule, Gründungsmitgl. Förderverein der Dt.-Türkischen Europaschule sowie Partnerschaftsverein Kreuzberg-Kadiköy e. V. - MdB seit Okt. 2013; Sprecher für Bildungs- und Sportpolitik der Fraktion Bündnis 90/Die Grünen.', 'Özcan', '11004360');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08394, NULL, 'Dr.', 'Dr.', 'Angestellter', 'verheiratet, 2 Kinder', '19.03.1969', NULL, 'Harmonie (jetzt Eitorf)', 'männlich', NULL, '22.10.2013', 'Neu', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>DIE LINKE. Bundestagsfraktion, Berlin,<br/>Referent<br/><br/>Funktionen in Unternehmen: <br/>Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung Haus der Geschichte der Bundesrepublik Deutschland, Bonn, <br/>Mitglied des Kuratoriums', 'Gymnasium in Siegburg, Abitur. Studium der Politischen Wissenschaft Rheinische Friedrich-Wilhelms-Univ. in Bonn; Promotion 2004. 2000/02 und 2004 Auslandstätigkeit in der Organisation für Sicherheit und Zusammenarbeit in Europa (OSZE) im ehemaligen Jugoslawien. Seit 2006 Referent für Sicherheitspolitik bei der Bundestagsfraktion DIE LINKE. - MdB seit Okt. 2013; Obmann der Fraktion DIE LINKE im Verteidigungsausschuss.', 'Alexander S.', '11004361');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08396, NULL, 'Dr.', 'Dr.', 'Hochschullehrer, Dipl.-Kaufmann, M.I.P.P.', 'verheiratet, 1 Kind', '26.04.1967', NULL, 'Koblenz-Moselweiß', 'männlich', NULL, '22.10.2013', 'Nick', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Frankfurt School of Finance & Management gemeinnützige GmbH, Frankfurt/Main,<br/>Professor<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Frankfurt School of Finance & Management gemeinnützige GmbH, Frankfurt/Main, <br/>	Professor für Corporate Finance (bis 31.12.2013), monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>Böker & Paul AG - Kanzlei für Vermögensmanagement, Montabaur, <br/>	Mitglied des Aufsichtsrates<br/><br/>	MT-PE Private Equity GmbH & Co. KG, Montabaur, <br/>	Mitglied des Investitionskomitees<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkassenzweckverband Nassau, Wiesbaden, <br/>	Mitglied der Verbandsversammlung<br/><br/>	Westerwaldkreis, Montabaur, <br/>	Mitglied des Kreistages', '1986 Abitur am Mons-Tabor-Gymnasium Montabaur. 1986/90 Studium Betriebswirtschaftslehre WHU Vallendar, 1988 Auslandssemester ESC Lyon und Carnegie Mellon University Pittsburgh, USA; 1990 Dipl.-Kfm. Wissenschaftl. Mitarbeiter an der WHU; 1994 Promotion Dr. rer. pol.; 2005/06 Zweitstudium Paul H. Nitze School of Advanced International Studies (SAIS) der Johns Hopkins University, Washington DC, USA, 2006 Master of International Public Policy (M.I.P.P.); 2011 Programm "The Global Economy", Harvard Business School, Cambridge MA, USA. 1994/2005 Tätigkeit im Corporate Finance-Geschäft bei Barclays/BZW, Credit Suisse First Boston und UBS in Frankfurt/Main und London, 2006/11 Leiter Mergers & Acquisitions (M&A)-Beratung bei Sal. Oppenheim jr. & Cie. KGaA. 2012/13 Prof. für Corporate Finance an der Frankfurt School of Finance & Management. Alt-Stipendiat der Konrad Adenauer-Stiftung. 2007/13 Board of Trustees des American Institute for Contemporary German Studies (AICGS) in Washington DC. Seit 2010 Mitgl. Aufsichtsrat der Böker & Paul AG - Kanzlei für Vermögensmanagement, Montabaur. 1991/95 Kreisvors. der Jungen Union Westerwald, 1992/2000 Mitgl. Landesvorst. der Jungen Union Rheinland-Pfalz, seit 1991 Mitgl. CDU-Bezirksvorst. Koblenz-Montabaur, seit 2014 Kreisvors. CDU Westerwald. Seit 1998 Mitgl. Kreistag Westerwaldkreis. - MdB seit Okt. 2013.', 'Andreas', '11004362');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08397, NULL, NULL, NULL, 'Bankkauffrau', 'verheiratet, 2 Kinder', '16.06.1959', NULL, 'Essen', 'weiblich', NULL, '22.10.2013', 'Nissen', NULL, 'SPD', NULL, 'konfessionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Finanzberaterin, Frankfurt/Main<br/><br/>Hausverwaltung, Frankfurt/Main<br/><br/>Volkshochschule, Frankfurt/Main, Offenbach, Oberursel,<br/>Seminarleiterin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Finanzberaterin, Frankfurt/Main<br/><br/>Hausverwaltung, Frankfurt/Main<br/><br/>Volkshochschule, Frankfurt/Main, Offenbach, Oberursel, <br/>Seminarleiterin<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Kreisverband Frankfurt am Main e.V., Frankfurt/Main, <br/>Revisorin', 'Mittlere Reife am Burg-Gymnasium Bentheim. Ausbildung zur Bankkauffrau bei der Hamburger Sparkasse. Seit 1989 selbstständige Finanzberaterin, Seminarleiterin und Hausverwalterin in Frankfurt am Main. Seit 1972 aktiv in der SPD, 1975 SPD-Mitgl., 1996/14 Vors. der Arbeitsgemeinschaft sozialdemokratischer Frauen ASF, Frankfurt am Main, seit 2004 Mitgl. Bundesvorst. der ASF, seit 2005 Vors. der ASF Hessen-Süd, seit 2007 Mitgl. im Frankfurter SPD-Unterbezirksvorstand. Seit 1980 Mitgl. ver.di.  Mitgl. u. a. Allgemeiner Deutscher Fahrrad-Club (ADFC), Arbeiterwohlfahrt, 1. FFC Frankfurt (Frauenfußball), Anlaufstelle für straffällig gewordene Frauen, Jugendbegegnungsstätte Anne Frank e.V., Marie-Schlei-Verein, Netzwerk Friedenskooperative, Pro Asyl, Sozialverband VdK Deutschland. Mitglied diverser örtlicher Vereine. Englisch (f), Französisch (G). - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 182 (Frankfurt am Main I)', 'Ulli', '11004363');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08398, NULL, NULL, NULL, 'Kaufmann', 'ledig', '19.04.1941', NULL, 'Beuthen', 'männlich', NULL, '22.10.2013', 'Nowak', NULL, 'CDU', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Metzner + Meitzner GmbH + Co KG, Leverkusen,<br/>Vertrieb von Brillenfassungen<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Licon Kunststofftechnik GmbH, Leverkusen, <br/>Geschäftsführer<br/><br/>Metzner + Meitzner GmbH + Co KG, Leverkusen, <br/>Geschäftsführer<br/><br/>Metzner + Meitzner O.C.E. sp. z o o., Bielawa (Polen), <br/>Geschäftsführer<br/><br/>Tauschek Optik GmbH, Leverkusen, <br/>Geschäftsführer<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europa-Union Leverkusen e.V., Leverkusen, <br/>Mitglied des Beirates, ehrenamtlich<br/><br/>Partnerschaftsinitiative Leverkusen-Ratibor e.V., Leverkusen, <br/>Stellv. Vorsitzender, ehrenamtlich<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Licon Kunststofftechnik GmbH, Leverkusen<br/><br/>Metzner + Meitzner GmbH + Co KG, Leverkusen<br/><br/>Metzner + Meitzner O.C.E. sp. z o o., Bielawa (Polen)<br/><br/>Tauschek Optik GmbH, Leverkusen', 'Ausbildung zum Chemielaboranten. Laborant bei Bayer Leverkusen und Schering in Berlin; Hochschulreife.  Studien an den Universitäten FU Berlin, Köln und Bielefeld in Chemie, Wirtschaft und Recht. 1970 Geschäftsführender Gesellschafter von Meitzner & Meitzner Brillengestelle. Seit 1982 Mitgl. der CDU, 1997/03 CDU-Vors. in Leverkusen, 2006/08 sowie 2009 und 2011 Beisitzer CDU Schlebusch; 1997/10 Vors. MIT Leverkusen, 1999/15 Bundesvorstandsmitgl. der Mittelstands- und Wirtschaftsvereinigung der CDU/CSU, Ehrenvors. der MIT Leverkusen seit 2010. 1989/94 Mitglied des Stadtrates. - MdB seit Okt. 2013.', 'Helmut', '11004364');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08400, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 1 Kind', '16.09.1975', NULL, 'Mönchengladbach', 'männlich', NULL, '22.10.2013', 'Oellers', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwaltskanzlei Jöris & Weckmann, Heinsberg,<br/>Rechtsanwalt<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwaltskanzlei Jöris & Weckmann, Heinsberg, <br/>Rechtsanwalt<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Förderverein Bürgerhaus Horst e.V., Heinsberg, <br/>Mitglied des Vorstandes, ehenamtlich<br/><br/>Musikverein St. Josef Horst e.V., Heinsberg-Horst, <br/>Mitglied des Vorstandes, ehrenamtlich', 'Realschule Oberbruch, Cusanus-Gymnasium Erkelenz. Jurastudium in Köln; Referendardienst in Aachen. Rechtsanwalt, zugleich Fachanwalt für Arbeitsrecht in Heinsberg. Zuerst Mitgl. der Jungen Union, dort Mitgl. im Vorstand Stadtverband Heinsberg und bis 2010 im Vorstand Kreisverband Heinsberg, seit 2003 Mitgl. der CDU, seit 2007 Mitgl. Stadtverbandsvorst. Heinsberg, zunächst als Beisitzer und seit 2009 als Schatzmeister. 2004/13 Mitgl. Rat der Stadt Heinsberg. - MdB seit Okt. 2013.', 'Wilfried', '11004365');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08402, NULL, NULL, NULL, 'Dipl.-Volkswirt (Uni), Kreditanalyst im Risikomanagement', 'verheiratet, 1 Kind', '05.07.1980', NULL, 'Vilsbiburg', 'männlich', NULL, '22.10.2013', 'Oßner', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Caterpillar Financial Services GmbH, Ismaning,<br/>Kreditanalyst im Risikomanagement<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Landshut, Landshut, <br/>Mitglied des Gemeinderates und des Kreistages', '1986/90 Grundschule in Velden, 1990/99 Maximilian-von-Montgelas Gymnasium in Vilsbiburg, 1999 Abitur. 1999/2000 Grundwehrdienst bei der Luftwaffe in Germersheim und Freising. 2000/05 Studium der Diplom-Volkswirtschaftslehre Univ. Regensburg, Schwerpunkte Ökonomie des öffentlichen Sektors/Finanzierung/Statistik, 2003/04 Auslandsstudium an der Handelshochschule in Göteborg/Schweden mit den Schwerpunkten Ökonometrie/Umweltökonomie, 2005 Abschluss Dipl.-Volkswirt (Univ.). 2005 Diplomarbeit im Forschungs- und Innovationszentrum der BMW AG München & BMW Financial Services GmbH. Seit 2005: Risikomanagement beim internationalen Baumaschinenhersteller CATERPILLAR. 1997/11 Ortsvors. der Jungen Union Velden, 2005/12 Kreisvors. der Jungen Union im Landkreis Landshut, 2005/12 stellv. Kreisvors. der CSU im Landkreis Landshut, 2011/15 Ortsvors. der CSU Velden, 2011/13 Bezirksvors. der Jungen Union Niederbayern, seit 2012 Kreisvors. der CSU im Landkreis Landshut. Seit 2008 Marktrat, seit 2008 Kreisrat, Mitgl. Kreisausschuss. Mitgl. u. a. zahlreicher Sportverbände, Feuerwehr, Technisches Hilfswerk (THW), Kreiskrieger- und Soldatenkameradschaft, Mitgl. Kuratorium Hochschule Landshut. Englisch (f), Französisch (G), Schwedisch (G). - MdB seit Okt. 2013.', 'Florian', '11004366');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08403, NULL, 'Dr.', 'Dr.', 'Rechtsanwalt', 'verheiratet, 2 Kinder', '16.06.1979', NULL, 'Bünde', 'männlich', NULL, '22.10.2013', 'Ostermann', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwaltskanzlei Breit, Herford,<br/>Rechtsanwalt<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Herford, jährlich, Stufe 4<br/><br/>Funktionen in Unternehmen: <br/>AQUA MAGICA Bad Oeynhausen & Löhne GmbH, Löhne,<br/>Mitglied der Gesellschafterversammlung, ehrenamtlich (bis 31.05.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Freie Universität Berlin<br/>	Forschungsforum Öffentliche Sicherheit, Berlin, <br/>	Mitglied des Steuerungskreises, ehrenamtlich<br/><br/>	Sparkassenzweckverband im Kreis Herford, Herford, <br/>	Mitglied der Verbandsversammlung, ehrenamtlich (bis 03.07.2014)<br/><br/>	Stadt Löhne, Löhne, <br/>	Mitglied des Stadtrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Zukunftsforum Öffentliche Sicherheit e.V., Berlin, <br/>	Mitglied des Beirates, ehrenamtlich', 'Städtisches Gymnasium Löhne, 1998 Abitur. 1998/99 Grundwehrdienst. Studium der Rechtswissenschaft  Univ. Bielefeld, 1. Staatsexamen; Wissenschaftl. Hilfskraft an einem Lehrstuhl der Univ. Bielefeld, Referendariat im Bezirk des OLG Hamm, 2. Staatsexamen. Rechtsanwalt; Promotion zum Dr. jur. Univ. Bielefeld. Seit 1995 Mitgl. der CDU, seit 2012 Vors. CDU-Kreisverband Herford, seit 2014 stellv. Vors. CDU-Bezirksverband Ostwestfalen-Lippe. Seit 2002 Mitgl. Rat der Stadt Löhne, 2009/13 Vors. der CDU-Fraktion im Rat der Stadt Löhne. Englisch (G), Französisch (G). - MdB seit Okt. 2013.', 'Tim', '11004367');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08405, NULL, NULL, NULL, 'Rechtsreferendar', NULL, '23.06.1987', NULL, 'Duisburg', 'männlich', NULL, '22.10.2013', 'Özdemir', '(Duisburg)', 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>SPD-Landtagsfraktion Nordrhein-Westfalen, Düsseldorf,<br/>Referent<br/><br/>Funktionen in Unternehmen: <br/>Parea gemeinnützige Gesellschaft für soziale Dienstleistungen mbH, Greven,<br/>Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutscher Mieterbund Rhein-Ruhr e.V., Duisburg, <br/>Mitglied des Vorstandes', '1997/06 Franz-Haniel-Gymnasium Duisburg, Abitur. 2006/10 Heinrich-Heine-Univ. Düsseldorf Jurastudium mit Schwerpunkt "Öffentliches Recht", 2011 1. jur. Staatsexamen, 2011/Mai 2013 jur. Vorbereitungsdienst als Rechtsreferendar am Oberlandesgericht Düsseldorf; Febr./April 2007 Anwaltspraktikum, August/Sept. 2007 Verwaltungspraktikum in der SPD-Fraktion im Landtag Nordrhein-Westfalen. April/Nov. 2008 studentische Hilfskraft am Institut für Parteienrecht und Parteienforschung (PRuF), Düsseldorf, 2007/13 Mitarbeiter der SPD-Landtagsfraktion Nordrhein-Westfalen. Mitgl. Freundeskreis Historisches Homberg e. V., Vorstandsmitgl. Freundeskreis der Juristischen Fakultät zu Düsseldorf e. V., Mitgl. der Arbeiterwohlfahrt e. V. Kreisverb. Duisburg, Ortsgruppe Homberg, Vorstandsmitgl. im Deutschen Mieterbund Rhein-Ruhr e. V., Mitgl. Feuerwehrverein Duisburg-Homberg e. V., Senator der Karnevalsgemeinschaft Narrenzunft 1957 e. V., Gründungsmitgl. der Arbeitsgemeinschaft Westvereine Duisburg e. V., Mitgl. Baerler Heimat- und Bürgerverein 1988 e. V. und des MSV Duisburg. Gewerkschaftsmitgliedschaften, seit Juni 2010 Mitgl. der IG Bergbau, Chemie, Energie. - MdB seit Okt. 2013.', 'Mahmut', '11004368');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08406, NULL, NULL, NULL, 'Hauswirtschaftsleiterin', 'verheiratet, 3 Kinder', '01.12.1957', NULL, 'Gifhorn', 'weiblich', NULL, '22.10.2013', 'Pahlmann', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landwirtschaftlicher Betrieb, Gifhorn<br/><br/>Funktionen in Unternehmen: <br/>Gifhorner Grundstücks und Erschließungsgesellschaft mbH, Gifhorn, <br/>Vorsitzende des Aufsichtsrates<br/><br/>LSW LandE-Stadtwerke Wolfsburg GmbH & Co KG, Gifhorn, <br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Gifhorn, Gifhorn, <br/>Mitglied der Steuerungsgruppe Migration, ehrenamtlich<br/><br/>Stadt Gifhorn, Gifhorn, <br/>Mitglied des Stadtrates, ehrenamtlich', 'Abschluss der mittleren Reife, zweijährige Fachschule Hauswirtschaft, Abschluss staatlich geprüfte ländliche Hauswirtschaftsleiterin. Ausbilderin der ländlichen Hauswirtschaft. Mitarbeit im eigenen landwirtschaftlichen Betrieb. Berufenes Mitgl. der Albrecht-Thaer-Gesellschaft, Mitgl. im Landfrauenverband Gifhorn, ehrenamtliche Richterin am Landwirtschaftsgericht, Mitgl. im Bündnis für Familien. Seit 2001 Mitgl. Rat der Stadt Gifhorn, seit 2006 Beigeordnete im Verwaltungsausschuss, 2011/13 Vors. der CDU-Fraktion im Rat der Stadt Gifhorn. - MdB seit Okt. 2013; Mitgl. Fraktionsvorstand.', 'Ingrid', '11004369');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08408, NULL, NULL, NULL, 'ohne Angaben', 'verheiratet, 5 Kinder', '01.01.1961', NULL, 'Düsseldorf', 'weiblich', NULL, '22.10.2013', 'Pantel', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Stadtwerke Düsseldorf AG, Düsseldorf, <br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Düsseldorf, Düsseldorf,<br/>Mitglied des Stadtrates (bis Ende Dezember 2013)<br/><br/>Städtische Clara-Schumann-Musikschule, Düsseldorf,<br/>Mitglied des Vorstandes<br/><br/>Stadtsparkasse Düsseldorf, Düsseldorf,<br/>Persönlich stellv. Mitglied des Verwaltungsrates (bis 31.10.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Familienbund der Katholiken im Erzbistum Köln e.V., Köln, <br/>Mitglied des Vorstandes', '1980 Abitur am Leibniz-Gymnasium Düsseldorf. 1980/82 Studium Betriebswirtschaft Fernuniversität Hagen. 1984/95 selbstständige Unternehmerin im Bereich Transportwesen. 1995/01 Vollzeitpflege einer Familienangehörigen. 2001 Mitarbeit in der medizinischen Gesundheitsvorsorge. 2012 Verleihung des Bundesverdienstkreuzes am Bande. 1996 Eintritt in die CDU, 1998 Eintritt in die CDA, Mitgl. im Kreisvorstand der CDA Düsseldorf, 2002 stellv. und seit 2006 Vors. der Frauen Union Düsseldorf, seit 2009 Beisitzerin im Landesvorst. der Frauen Union NRW und seit 2013 Beisitzerin im Bundesvorst. der Frauen Union, seit 2004 Vors. des Ortsverbandes der CDU Düsseldorf-Rath, seit 2005 Mitgl. Kreisvorst. Düsseldorf, 2013/15 stellv. Kreisvors. CDU Düsseldorf, 2010/14 Mitgl. im Landesvorst. der CDU NRW. 2004 und 2009 Direktwahl in den Stadtrat der Landeshauptstadt Düsseldorf. - MdB seit Okt. 2013.', 'Sylvia', '11004370');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08409, NULL, NULL, NULL, 'Gewerkschaftssekretär', 'verheiratet', '08.06.1963', NULL, 'Bremen', 'männlich', NULL, '22.10.2013', 'Paschke', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>DGB Region Ostfriesland-Nördliches Emsland, Leer,<br/>Gewerkschaftssekretär<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Deutscher Gewerkschaftsbund, Berlin, <br/>Gewerkschaftssekretär<br/><br/>Funktionen in Unternehmen: <br/>Friesischer Rundfunk GmbH, Sande, <br/>Mitglied des Programmbeirates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Agentur für Arbeit, Leer, <br/>	Mitglied des Verwaltungsausschusses, ehrenamtlich<br/>	<br/>Agentur für Arbeit, Oldenburg, <br/>	Mitglied des Verwaltungsausschusses, ehrenamtlich (bis 31.12.2013)<br/>	<br/>Oldenburgische Industrie- und Handelskammer, Oldenburg, <br/>	Mitglied des Berufsbildungsausschusses, ehrenamtlich (bis 30.04.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeit und Leben Aurich e.V., Aurich, <br/>Vorsitzender, ehrenamtlich<br/><br/>VAO - Verbund Ausbildung Ostfriesland e.V., Leer, <br/>2. Vorsitzender, ehrenamtlich<br/><br/>Volkshochschule Emden e.V., Emden, <br/>Mitglied des Vorstandes, ehrenamtlich', 'Gymnasium in Bremen. 1980/83 Ausbildung zum Industriekaufmann. 1983/89 Tätigkeiten in den Bereichen Vertrieb, Controlling und Personal in der Industrie. 1989/2000 Gewerkschaftssekretär beim Vorstand der IG Metall Frankfurt; 2000/08 Gewerkschaftssekretär IG Metall Emden, seit 2008 Gewerkschaftssekretär beim DGB Ostfriesland-Nördliches Emsland. Mitgl. IG Metall, Mitgl. der SPD. Mitgl. Auto-Club Europa (ACE) und GUV, Arbeitskreis Erwerbslose (AK Elo)  Wittmund (Erwerbslosenberatung), 2012/16 Vors. Verwaltungsausschuss der Agentur für Arbeit Emden-Leer, seit 2009 2. Vors. der Verbundausbildung Ostfriesland, seit 2008 Mitgl. im Interregionalen Gewerkschaftsrat Weser-Ems-Noord-Niederlande. Bis 2015 Programmbeirat Friesischer Rundfunk, seit 2011 stellv. Mitgl. im Beirat der Innungskrankenkasse IKK classic, seit 2008 Vors. Arbeit und Leben, Aurich, Mitgl. THW Helfervereinigung, Mitgl. Förderverein Jugendfeuerwehr Kreis Leer, "Mach meinen Kumpel nicht an" für Gleichbehandlung gegen Fremdenfeindlichkeit und Rassismus e. V. und Dt. Parlamentarische Gesellschaft. - MdB seit Okt. 2013; Mitgl. Dt.-Niederländische und Dt.-Spanische Parlamentariergruppe und Mitgl. AK Binnenschifffahrt.', 'Markus', '11004371');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08411, NULL, NULL, NULL, 'Diplom Sozialpädagoge/Sozialarbeiter', 'verheiratet, 5 Kinder', '23.07.1947', NULL, 'Frankfurt (Oder)', 'männlich', NULL, '22.10.2013', 'Patzelt', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Caritasverband für das Erzbistum Berlin e.V., Berlin, <br/>Stellv. Vorsitzender<br/><br/>Förderverein für Kirchenmusik in Frankfurt an der Oder e.V., Frankfurt (Oder), <br/>Vorsitzender<br/><br/>Lebenshilfe Frankfurt (Oder) e.V., Frankfurt (Oder), <br/>Vorsitzender<br/><br/>Lutherstiftung zu Frankfurt an der Oder, Frankfurt (Oder), <br/>Mitglied des Vorstandes<br/><br/>Puerto Alegre e.V., Frankfurt (Oder), <br/>Mitglied des Vorstandes', 'Mittlere Reife, Betonfacharbeiter, 1967 Abitur. Kein Wehrdienst. 1971 Diplomsozialpädagoge/Sozialarbeiter, 1990 Pädagogik Didaktik für Lehrtätigkeiten, 1991 Verwaltungswissenschaft Höherer Dienst. 1971/89 Heimleiter Kinder- und Jugendheim, 1990/94 Referatsleiter Erziehungshilfen Landesregierung Magdeburg, 1994/02 Beigeordneter Bildung, Kultur, Soziales, Jugend, Gesundheit Frankfurt (Oder), 2002/10 Oberbürgermeister Frankfurt (Oder). Vorstand versch. soziale und kulturelle Vereine und Verbände, Ehrenbürger der Stadt Slubice (Polen). 1989 Mitarbeit in der Bürgerbewegung Neues Forum, dann Demokratischer Aufbruch, seit 1990 Mitgl. der CDU, 1990/94 Landkreis Schönebeck, Kreisvors., Fraktionsvors. - MdB seit Okt. 2013.', 'Martin', '11004372');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08412, NULL, 'Dr.', 'Dr.', 'Diplom-Kaufmann', 'verheiratet', '06.09.1984', 'Russland', 'Moskau', 'männlich', NULL, '22.10.2013', 'Pätzold', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Senatsverwaltung für Gesundheit und Soziales, Berlin,<br/>	Persönlicher Referent des Staatssekretärs für Soziales<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Hochschule für Technik und Wirtschaft Berlin, Berlin, <br/>	Lehrauftrag (bis 30.09.2015)', '1991/96 Grundschule der deutschen Botschaft in Moskau, Wechsel zur Martin-Niemöller-Grundschule in Berlin, 1997/04 Barnim-Gymnasium Berlin, Abitur. 2004/10 Studium der Wirtschaftswissenschaften Humboldt-Univ. Berlin, 2010 Diplom-Kaufmann. 2004/09 Mitarbeiter des Bundestagsabgeordneten Peter Rzepka; 2010 Diplomarbeit in Kooperation mit der Deutschen Bank und Führungsnachwuchskraft bei der Axel Springer AG in Berlin, Einsatz in der Verlagsgeschäftsführung der B.Z. Berlin; Jan./Dez. 2011 Promotionsstudent bei dem Wirtschaftsprüfungs- und Beratungsunternehmen Deloitte & Touche GmbH. 2011/13 Mitarbeiter im Leitungsstab der Senatsverwaltung für Gesundheit und Soziales, Persönlicher Referent des Staatssekretärs für Soziales. 2014/15 Lehrbeauftragter an der Hochschule für Technik und Wirtschaft Berlin für das Fach "Regionale wirtschaftliche Entwicklung", seit Okt. 2015 Lehrbeauftragter an der Hochschule Mittweida für das Fach "Wettbewerbspolitik". 2002 Eintritt in die CDU, Junge Union, Schüler Union, 2003/07 stellv. Kreisvors. der Jungen Union Lichtenberg, 2006/07 stellv. Ortsvors. und 2007/11 Vors. der CDU Hohenschönhausen, 2009/11 Landesvorstandsmitgl. der CDU Berlin, seit 2011 Kreisvors. der CDU Lichtenberg, seit 2017 Schatzmeister CDU Berlin. Englisch (G), Französisch (G), Russisch (G). - MdB seit Okt. 2013.', 'Martin', '11004373');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08413, NULL, NULL, NULL, 'Lehrer', NULL, '28.03.1962', NULL, 'Heringsdorf', 'männlich', NULL, '22.10.2013', 'Petzold', '(Havelland)', 'DIE LINKE.', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Ministerium für Wirtschaft und Europaangelegenheiten des Landes Brandenburg, Potsdam,<br/>Referent<br/><br/>Funktionen in Unternehmen: <br/>Havelland Kliniken GmbH Unternehmensgruppe, Nauen, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Havelland, Rathenow, <br/>Mitglied des Kreistages', 'Schulbesuch in Cottbus, Abitur in Dresden. Wehrdienst im Erzgebirge und in Stahnsdorf. 1983 Studium Pädagogische Hochschule "Karl Liebknecht" in Potsdam, 1988 Abschluss als Diplomlehrer für Musik und Deutsch; anschl. Forschungsstudium in Musikwissenschaften. Lehramtsstudium für das Fach Politische Bildung; Referendariat in Königs Wusterhausen. Bis 2005 Lehrer an der Immanuel-Kant-Gesamtschule in Falkensee. Anschließend Büroleiter MdB Dr. Kirsten Tackmann, 2009 Mitarbeiter bei MdB Sabine Stüber. Seit 2010 Referent im Ministerium für Wirtschaft und Europaangelegenheiten des Landes Brandenburg. 1990/99 MdL Brandenburg. 1999/2005 stellv. Landesvors. der PDS Brandenburg, 2005/09 Mitgl. Landesvorst. DIE LINKE in Brandenburg, Stadtvors. der LINKEN in Falkensee. Seit 2003 Mitgl. Kreistag Havelland. Mitgl. Kuratorium der Bundesstiftung Magnus Hirschfeld. - MdB seit Okt. 2013.', 'Harald', '11004374');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08414, NULL, NULL, NULL, 'Industriekauffrau', 'verheiratet, 1 Kind', '16.07.1973', NULL, 'Neustrelitz', 'weiblich', NULL, '22.10.2013', 'Pflugradt', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadtwerke Neustrelitz GmbH, Neustrelitz,<br/>Assistentin der Geschäftsführung<br/><br/>Funktionen in Unternehmen: <br/>Neustrelitzer Wohnungsgesellschaft mbH, Neustrelitz, <br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkasse Mecklenburg-Strelitz, Neustrelitz, <br/>Stellv. Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Förderverein Familienzentrum Neustrelitz e.V., Neustrelitz, <br/>Mitglied des Vorstandes<br/><br/>Landeszentrum für erneuerbare Energien Mecklenburg-Vorpommern e.V. (Leea), Neustrelitz, <br/>Mitglied des Vorstandes, ehrenamtlich', '1980/90 Polytechnische Oberschule; 1990/93 Berufsausbildung zur Industriekauffrau.<br/>1990/92 NORDAG GmbH i.L., 1992/93 Stadtwerke Neustrelitz GmbH (Fortsetzung der Ausbildung), seit 1993 Stadtwerke Neustrelitz GmbH, seit 2002 Assistentin der Geschäfts- und Betriebsleitung. Seit 2010 Landeszentrum für erneuerbare Energien Mecklenburg-Vorpommern e.V. (Leea e.V.), zweite stellv. Vorstandsvors., seit 2011 Mitgl. Freundeskreis evangelisches Alten- und Pflegeheim "Kurt Winkelmann" Neustrelitz, seit 2012 Förderverein Familienzentrum Neustrelitz, Vorstandsmitglied. Seit 2013 Mitgl. Bürgerinitiative zum Bau der Ortsumgehung B 198 Mirow, seit Mai 2014 Vorstandsmitgl. Kuratorium Sport & Natur. Seit 2015 Mitgl. AWO Mecklenburg-Strelitz e. V. Seit 2002 SPD-Mitgl. Seit 2003 Stadtvertretung Neustrelitz, Ausschussvors. Kultur- und Tourismus, Bildung und Soziales, Mitgl. im Finanzausschuss, Hauptausschuss; seit 2005 Mitgl. Aufsichtsrat der Neustrelitzer Wohnungsgesellschaft mbH; seit 2009 Fraktionsvors. SPD. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 16 (Mecklenburgische Seenplatte I - Vorpommern-Greifswald II)', 'Jeannine', '11004375');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08415, NULL, NULL, NULL, 'Dipl.-Religionspädagoge', 'verheiratet, 1 Kind', '29.04.1955', NULL, 'Koblenz', 'männlich', NULL, '22.10.2013', 'Pilger', NULL, 'SPD', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bistum Trier, Trier,<br/>Berufsschullehrer<br/><br/>Funktionen in Unternehmen: <br/>Antenne Koblenz 98.0, Koblenz, <br/>Mitglied des Beirates<br/><br/>Modernes Wohnen Koblenz eG, Koblenz, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Koblenz, Koblenz, <br/>Mitglied des Stadtrates', '1961/65 Grundschule St. Kastor in Koblenz, 1965/70 Hauptschule Overberg in Koblenz. 1972/74 Ausbildung zum Einzelhandelskaufmann in der Firma Sporthaus Stadion Koblenz, 1974/77 Angestellter der Firma Sporthaus Stadion in Koblenz. 1977/79 Zivildienst auf der Pflegestation im Blinden- und Altenheim Koblenz; 1979/80 Hilfsaltenpfleger im Blinden- und Altenheim, Koblenz, Lagerist Firma Krieger und Co., Lagerarbeiter bei Aldi, Arbeiter der Firma Stabilus, Hilfstechniker der Firma Ingenieurgesellschaft Björnsen, Mitarbeiter der Telekom (Telefonauskunft) und Möbelpacker bei der Firma Büroeinrichtungen Järgen. 1980/81 Berufsbildende Schule Koblenz-Karthause, 1981/83 Fachoberschule für Sozialwesen Koblenz-Karthause. 1983/87 Studium der Religionspädagogik in Mainz; 1987/88 Anerkennungsjahr als Religionspädagoge an der Goethe-Hauptschule Koblenz-Lützel und als Pastoraltheologe in den Gemeinden Maria-Hilf und St. Antonius Koblenz-Lützel; 1988/07 Anstellung als Religionspädagoge in der Hauptschule Koblenz-Lützel und als Pastoraltheologe in den Gemeinden Maria-Hilf/St. Antonius. 2007/10 Personalreferent im Bistum Trier im Generalvikariat Trier; seit 2010 Lehrer an der Julius-Wegeler Schule in Koblenz. Vors. SPD-Ortsverein Koblenz-Güls, stellv. Vors. Stadtverband Koblenz, Mitgl. Beirat der SPD Rheinland-Pfalz. Stadtrat der Stadt Koblenz, Sprecher der SPD-Fraktion für Jugend und Soziales. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 201 (Mosel/Rhein-Hunsrück)', 'Detlev', '11004376');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08417, NULL, NULL, NULL, 'Regionalmanagerin', 'verheiratet, 1 Kind', '04.10.1968', NULL, 'Castrop-Rauxel', 'weiblich', NULL, '22.10.2013', 'Poschmann', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Dortmunder Energie- und Wasserversorgung GmbH, Dortmund,<br/>	Kommunalmanagerin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>		Bundesministerium für Wirtschaft und Energie, Berlin, <br/>	Mitglied des Mittelstandsbeirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>			Bundesverband der Unternehmervereinigungen e.V. (BUV), Berlin, <br/>	Mitglied des Beirates<br/><br/>	Trägerverein Netzwerk Berlin e.V., Berlin, <br/>	Mitglied des Vorstandes', 'Ausbildung zur Industriekauffrau. Studium der Betriebswirtschaft an der Verwaltungs- und Wirtschaftsakademie in Dortmund, Betriebswirtin (VWA) für Grundsatzfragen und Vertragsrecht, Pressesprecherin und zuletzt Regionalmanagerin. Mitgl. bei ver.di, IGBCE, AWO,1985 Eintritt in die SJD. Seit 1985 Mitgl. der SPD, 2010/14 Vors. des Stadtbezirks Aplerbeck; seit 2012 Mitgl. des SPD-Unterbezirksvorstandes Dortmund. 1999/09 Mitgl. des Rates der Stadt Dortmund, 2004/09 stellv. Fraktionsvors. der SPD im Rat der Stadt Dortmund. Beirat des Bundesverbands Unternehmervereinigung e. V. - MdB seit Okt. 2013; seit 2014 Beauftragte der SPD-Fraktion für den Mittelstand und das Handwerk, seit 2015 stellv. Sprecherin der Arbeitsgruppe Wirtschaft und Energie der SPD-Fraktion, 2015/Ende 2016 Leiterin der Projektgruppe "Neue Erfolge - Vorsprung durch Innovation" der SPD-Fraktion; Mitgl. Mittelstandsbeirat beim BMWi; Mitgl. der Dt.-Türkischen Parlamentariergruppe.', 'Sabine', '11004377');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08418, NULL, NULL, NULL, 'Diplom-Soziologe', 'verheiratet, 2 Kinder', '02.05.1959', NULL, 'Rahden / Minden-Lübbecke', 'männlich', NULL, '22.10.2013', 'Post', '(Minden)', 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Sozialdemokratische Partei Deutschlands, Berlin,<br/>Leiter der Abteilung Internationale Politik des SPD-Parteivorstandes<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Sozialdemokratische Partei Europas, Brüssel,<br/>Generalsekretär, monatlich, Stufe 4 (bis 30.09.2014)', '1978 Abitur am Söderblom-Gymnasium in Espelkamp. Zivildienst in Minden beim DRK. Studium der Soziologie mit dem Schwerpunkt Öffentliche Verwaltung Univ. Bielefeld; Stipendiat der Friedrich-Ebert-Stiftung. 1986/90 Wissenschaftl. Mitarbeiter im Deutschen Bundestag, u. a. für Hans-Jürgen Wischnewski, 1990/99 u. a. Geschäftsführer der SPD-Gruppe im Europäischen Parlament, 1999/2013 Leiter der Abteilung Internationale Politik beim SPD-Parteivorstand in Berlin und 2002/12 stellv. Bundesgeschäftsführer. Seit 2012 Generalsekretär der Sozialdemokratischen Partei Europas. - MdB seit Okt. 2013; seit Sept. 2015 Vors. der NRW-Landesgruppe in der SPD-Fraktion.', 'Achim', '11004378');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08419, NULL, NULL, NULL, 'Diplom-Kaufmann (Univ.)', 'ledig', '27.05.1981', NULL, 'Neustadt a.d. Waldnaab', 'männlich', NULL, '22.10.2013', 'Post', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadtwerke München GmbH, München,<br/>Manager Energiepolitik<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeiterwohlfahrt Landesverband Bayern e.V., München,<br/>Revisor<br/><br/>Deutsche Unternehmensinitiative für Energieeffizienz e.V. - DENEFF, Berlin,<br/>Mitglied des Beirates<br/><br/>Diözesanrat der Katholiken der Erzdiözese München und Freising, München,<br/>Einzelpersönlichkeit in der Vollversammlung<br/><br/>Wirtschaftsforum der Sozialdemokratie in München e.V., München,<br/>Beisitzer', '1993/01 staatl. Musikinternat Max-Reger-Gymnasium in Amberg, Abitur 2001. 2001/05 Studium der Betriebswirtschaftslehre Ludwigs-Maximilians-Univ. (LMU) München sowie Univ. Passau, Abschluss Diplom-Kaufmann; Univ.-Schwerpunktsetzung Revisions- und Treuhandwesen, Bilanzanalyse, externe Rechnungslegung, Steuerrecht, Organisation und Personalwesen. 2005/09 Tätigkeit in der Wirtschaftsprüfung und Transaktionsberatung bei der PricewaterhouseCoopers AG (PwC), München. Seit April 2009 Referent des Kaufmännischen Geschäftsführers bei der Stadtwerke München GmbH.  Mitgl. der SPD, 2005/09 Vors. SPD-Ortsverein Leuchtenberg, 2007/08 Organisationsleiter des Kommunalwahlkampfes in Leuchtenberg sowie des Kreistagswahlkampfes in Neustadt a.d. Waldnaab, 2011/12 Kassier SPD-BWK München Nord. Mitgl. der Deutsch-Israelischen Gesellschaft e.V., Verein gegen betrügerisches Einschenken e.V., Arbeiterwohlfahrt München (AWO), ver.di Vereinte Dienstleistungsgewerkschaft, Förderverein NS-Dokumentationszentrum München. - MdB seit Okt. 2013.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 215 (Freising)<br/>Wahlkreis 221 (München-West/Mitte)', 'Florian', '11004379');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08420, NULL, 'Dr.', 'Dr.', 'Dipl.-Chemikerin', 'eheähnl. Lebensgemeinschaft, 1 Kind', '25.12.1962', NULL, 'Weimar', 'weiblich', NULL, '22.10.2013', 'Raatz', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>TU Bergakademie Freiberg, Freiberg,<br/>Wissenschaftliche Mitarbeiterin und Dozentin<br/><br/>Funktionen in Unternehmen: <br/>Kreiskrankenhaus Freiberg gemeinnützige GmbH, Freiberg, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Mittelsachsen, Freiberg, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeiterwohlfahrt, Landesverband Sachsen e.V., Dresden, <br/>Mitglied des Vorstandes<br/><br/>Friedrich-Ebert-Stiftung e.V., Bonn, <br/>Vorsitzende des Auswahlausschusses', '1981 Abitur. 1981/86 Chemiestudium Universität Halle, 1986 Dipl.-Chemikerin. 1986/98 wiss. Mitarbeiterin und Forschungsgruppenleiterin Forschungsinstitut für Aufbereitung in Freiberg und TU Bergakademie Freiberg, Lehrstuhl für Umweltverfahrenstechnik, 1992 Promotion zur Dr. rer nat. 2000 Habilitation zum Dr.-Ing. habil., 1999/09 Mitgl. des Sächsischen Landtags, stellv. Vors. der SPD-Fraktion und verkehrs- und hochschulpol. Sprecherin. 2010/13 Privatdozentin und wiss. Mitarbeiterin TU Bergakademie Freiberg, Institut für Energieverfahrenstechnik und Chemieingenieurwesen. Seit 1989 SPD-Mitgl. Ortsverein Freiberg, 2006/14 Beisitzerin Landesvorst. Sachsen. Seit 2008 Kreisrätin, stellv. Vors. SPD-Kreistagsfraktion und UB Mittelsachsen. Seit 2008 Mitgl. Aufsichtsrat Vereinigte Gesundheitseinrichtungen Mittelsachsen GmbH, seit 2011 Besitzerin AWO-Landesvorst. Sachsen sowie AWO-Kreisverband Freiberg, seit 2012 Vors. FES-Auswahlausschuss, Senatsmitgl. der Deutschen Industrieforschungsgemeinschaft Konrad Zuse, Mitgl. IG BCE, DECHEMA sowie zahlreicher Vereine und Verbände. - MdB seit Okt. 2013; stellv. Vors. Ausschuss für Bildung, Forschung und Technikfolgenabschätzung.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 162 (Chemnitz)<br/>Wahlkreis 165 (Zwickau)', 'Simone', '11004380');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08421, NULL, NULL, NULL, 'Regierungsdirektor', 'verheiratet, 2 Kinder', '02.09.1971', NULL, 'Fulda', 'männlich', NULL, '22.10.2013', 'Rabanus', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Hessischer Landtag, Wiesbaden,<br/>Regierungsdirektor<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Rheingau-Taunus-Kreis, Bad Schwalbach, <br/>Mitglied des Kreistages, ehrenamtlich<br/>Mitglied der Betriebskommission des Eigenbetriebes Abfallwirtschaft, ehrenamtlich<br/>Mitglied des Verwaltungsrates des Jugendbildungswerkes, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Volkshochschule Rheingau-Taunus e.V., Taunusstein, <br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Wissenschaftsforum der Sozialdemokratie in Hessen e.V., Marburg, <br/>Mitglied des Vorstandes, ehrenamtlich', '1993 Abitur. 1990/91 Zivildienst in Wiesbaden bei der Arbeiterwohlfahrt. 1993/98 Studium der Politologie an der Johann Wolfgang Goethe-Univ. Frankfurt am Main; Diplom. 1994/98  Persönlicher Mitarbeiter des Vorsitzenden der SPD-Fraktion im Hessischen Landtag, Staatsminister a. D., Armin Clauss, 1998/99 Mitarbeiter der SPD-Fraktion im Hessischen Landtag, 1999/2013 Referent der SPD-Fraktion im Hessischen Landtag. 1993 Eintritt in die SPD, 1998/99 Mitarbeit Koordination und Organisation Landtagswahlkampf der hessischen SPD; 2000 Mitarbeit und versch. Funktionen in der SPD Rheingau-Taunus. 2005 und 2009 Kandidatur für den Deutschen Bundestag im Wahlkreis Rheingau-Taunus/Limburg. Landes- und Bundesdelegierter; seit 2007 Vors. SPD Rheingau-Taunus. Seit 2001 Mitgl. Kreistag Rheingau-Taunus, seit 2006 stellv. Vors. SPD-Fraktion. Seit 2014 Mitgl. AfB-Bundesvorstand und Sprecher des "Netzwerk Berlin", stellv. Vors. der "Berliner Republik". - MdB seit Okt. 2013; Mitgl. im SPD-Fraktionsvorstand.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 179 (Wiesbaden)', 'Martin', '11004381');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08422, NULL, NULL, NULL, 'Studienrätin', '2 Kinder', '01.11.1974', NULL, 'Krefeld-Hüls', 'weiblich', NULL, '22.10.2013', 'Radomski', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Nordrhein-Westfalen, Düsseldorf,<br/>Studienrätin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Krefeld, Krefeld, <br/>Sachkundige Bürgerin im Schul- und Umweltausschuss', 'Abitur am Fichte Gymnasium in Krefeld. Studium auf Lehramt für die Fächer Biologie und Geographie an der Ruhr-Univ. Bochum. 2004 tätig an der Waldschule in Eschweiler, 2008 Wechsel zur Gesamtschule in Mönchengladbach-Hardt, seit 2013 am Maria-Sibylla-Merian Gymnasium in Krefeld. Mitgl. im Naturwissenschaftlichen Verein zu Krefeld e. V. und im Verein für Heimatkunde e. V. Krefeld, Mitgl. der Schutzgemeinschaft Deutscher Wald (SDW), seit 2003 Mitgl. im Arbeitskreis Krefelder Frauenverbände (AKF), beim Sommerspielplatz "Spiel ohne Ranzen". 1997 Eintritt in die Junge Union, seit 1998 Mitgl. der CDU Deutschlands, 2003/08 Vors. der Jungen Union Niederrhein, seit 2012 stellv. Kreisvors. der CDU Krefeld, seit 2008 Mitgl. des Vorst. der CDU Niederrhein und seit 2005 Mitgl. des Landesvorst. der CDU Nordrhein-Westfalen; Mitgl. im Vorst. der Mittelstands- und Wirtschaftsvereinigung der CDU Krefeld. Sachkundige Bürgerin im Ausschuss für Schule und Weiterbildung und im Ausschuss für Umwelt, Energie, Ver- und Entsorgung im Rat der Stadt Krefeld. - MdB seit Okt. 2013.', 'Kerstin', '11004382');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08424, NULL, NULL, NULL, 'Rechtsanwalt, Diplom-Ingenieur(FH)', 'ledig', '30.08.1964', NULL, 'München', 'männlich', NULL, '22.10.2013', 'Radwan', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Mitglied des Bayerischen Landtages, München<br/><br/>	Rechtsanwalt, München<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>GSK Stockmann & Kollegen, München (bis 31.12.2015)<br/>Rechtsanwalt, monatlich, Stufe 1<br/>   Mandant 1, monatlich, Stufe 1<br/>   Mandant 2, monatlich, Stufe 2 (bis 31.07.2015)<br/><br/>Waigel Rechtsanwälte, München (ab 01.01.2016)<br/>Rechtsanwalt, monatlich, Stufe 1<br/>   Mandant 1, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn,<br/>Vertrauensmann bei der LBS Bayerische Landesbausparkasse<br/><br/>Hochschule Rosenheim, Rosenheim,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Landkreis Miesbach, Miesbach,<br/>Mitglied des Kreistages<br/><br/>Sparkassenverband Bayern, München,<br/>Mitglied des Beirates für sparkassenpolitische Grundsatzfragen<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsch-Arabische Freundschaftsgesellschaft e.V. (DAFG), Berlin,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Deutsche Wasserwacht, Berlin,<br/>Bundesleiter, ehrenamtlich<br/><br/>Deutsches Rotes Kreuz (DRK), Berlin,<br/>Mitglied des Präsidiums, ehrenamtlich (bis 27.11.2014)<br/><br/>Diözesanrat der Katholiken der Erzdiözese München und Freising, München,<br/>Einzelpersönlichkeit in der Vollversammlung, ehrenamtlich<br/><br/>Freundeskreis Krankenhaus Agatharied, Hausham,<br/>Kooptiertes Mitglied des Vorstandes, ehrenamtlich<br/><br/>Pfarrer Walter Waldschütz-Stiftung, Holzkirchen,<br/>Vorsitzender des Stiftungsrates, ehrenamtlich<br/><br/>Studiengesellschaft für Mittelstandsfragen e.V., München,<br/>Geschäftsführender Vorstand, ehrenamtlich<br/><br/>Wirtschaftsbeirat der Union e.V., München,<br/>Mitglied des Präsidiums und Vorsitzender des Forums Berlin, ehrenamtlich<br/><br/>Young Egyptian Economic Leaders (YEEL), Kairo,<br/>Mitglied des Board of Trustees, ehrenamtlich', '1983/87 Studium Fahrzeugtechnik, Fachrichtung Luftfahrzeuge an der FH München, Abschluss Dipl.-Ing.; 1987/95 jur. Studium mit zweitem Staatsexamen an der Ludwig-Maximilians-Univ. München, 1998 Zulassung als Rechtsanwalt. Bis 1999 Mitarbeiter, zuletzt als Abteilungsleiter, eines intern. Unternehmens in der Informations- und Telekommunikationsbranche. Mitgl. CSU Orts- und Bezirkvorst.; seit 2002 Bezirksvors. Mittelstandsunion Oberbayern, Mitgl. im MU-Landesvorstand; 2005/11 Schatzmeister der CSU, Mitgl. des CSU-Parteivorstandes, seit 2014 Vors. des Versorgungswerks und Mitgl. des CSU-Parteivorstandes, seit 2014 Vors. der CSU-BWK-Konferenz für den Wahlkreis 224 (Starnberg), seit 2014 Kreisvors. der CSU Miesbach, seit 2002 Mitgl. Präsidium und seit 2015 Vors. des Forums Berlin des Wirtschaftsbeirats der Union e. V., seit 2014 Vors. Bundeswahlkreiskonferenz für den WK 224 (Starnberg). Seit 2002 Kreisrat in Miesbach. 1999/08 MdEP, 2004/08 wirtschaftspolitischer Sprecher EVP-ED-Fraktion, 2002/08 Vors. Parl. Arbeitskreis Mittelstand der EVP-ED-Fraktion;  MdL Bayern 2008/13. Seit 2013 Bundesleiter Wasserwacht (ehrenamtl.), seit 2013 Vors. Stiftungsrat der Pfarrer Walter-Waldschütz-Stiftung, Holzkirchen (ehrenamtl.), seit 2004 Geschäftsführender Vorstand der Studiengesellschaft für Mittelstandsfragen e. V. (ehrenamtl.), seit 2014 kooptiertes Mitgl. im Vorst. der Deutsch-Arabischen Freundschaftsgesellschaft e. V. (DAFG) (ehrenamtl.), seit 2016 Mitgl. im Board of Trustees bei der Initiative Young Egyptian Economic Leaders (YEEL) (ehrenamtl.), seit 2016 koopt. Mitgl. Freundeskreis Krankenhaus Agatharied e. V., seit 2016 Einzelpersönlichkeit in der Versamml. des Diözesanrates der Katholiken der Erzdiözese München und Freising. - MdB seit Okt. 2013.', 'Alexander', '11004383');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08426, NULL, NULL, NULL, 'Bürgermeister a. D., Metzgermeister', 'verheiratet, 2 Kinder', '07.01.1965', NULL, 'Straubing', 'männlich', NULL, '22.10.2013', 'Rainer', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Metzgerei Rainer, Haibach,<br/>Metzgermeister<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Metzgerei Rainer, Haibach, <br/>Metzgermeister<br/><br/>Funktionen in Unternehmen: <br/>Abwasser GmbH, Haibach, <br/>Vorsitzender des Aufsichtsrates (bis 31.03.2016)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Anstalt für Kommunale Datenverarbeitung in Bayern, München, <br/>Mitglied der Hauptversammlung (bis 30.04.2014)<br/><br/>Gemeinde Haibach, Haibach, <br/>1. Bürgermeister (bis 30.04.2014), monatlich, Stufe 2<br/><br/>Landkreis Straubing-Bogen, Straubing, <br/>Mitglied des Kreistages<br/><br/>Zweckverband für Tierkörper- und Schlachtabfallbeseitigung (ZTS), Plattling, <br/>Mitglied der Verbandsversammlung und Vorsitzender des Rechnungsprüfungsausschusses', 'Grund- und Hauptschule Haibach. 1980/83 Ausbildung zum Metzger. 1983/84 Grundwehrdienst. 1986 Meisterprüfung, 1987 Übernahme des elterlichen Betriebes. 1996/14 Erster Bürgermeister der Gemeinde Haibach, seit 2002 Kreisrat des Landkreises Straubing-Bogen, Mitgl. Kreisausschuss. Seit 1999 Mitgl. Kreisvorst. der CSU, seit 2015 Bundeswahlkreisvorsitzender, seit 2005 Ortsvors. CSU-Ortsverband Haibach, seit 2005 Kreisvors. der Mittelstandsunion; seit 2009 Bezirksvors. der KPV Niederbayern, seit 2012 stellv. Landesvors. der KPV. Seit 2008 Verbandsrat ZTS Tierkörperbeseitigung, seit 2009 Vors. im Rechnungsprüfungsausschuss ZTS. Seit 2013 Vors. der Gebietsverkehrswacht Bogen. 2000/13 ehrenamtl. Richter am Verwaltungsgericht Regensburg. - MdB seit Okt. 2013.', 'Alois', '11004384');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08427, NULL, NULL, NULL, 'Wissenschaftliche Mitarbeiterin', 'verheiratet, 2 Kinder', '11.03.1967', NULL, 'Mainz', 'weiblich', NULL, '22.10.2013', 'Renner', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Mitglied des Thüringer Landtags, Erfurt', '1987/95 Studium der Philosophie, Biologie, Kultur- und Kunstwissenschaften Univ.  Bremen. 1996/97 Bildungs- und Öffentlichkeitsreferentin beim Deutsch-Kurdischen Freundschaftsverein e. V. in Bremen, 1998/02 Kulturmanagerin im Stadtteilkulturzentrum Fuhrpark e. V., 2002/09 wissenschaftl. Mitarbeiterin für den Bereich Innenpolitik der Fraktion DIE LINKE im Thüringer Landtag. Autorin und Referentin zum Thema Rechtsextremismus. Vorstandsmitgl. der Bürgerinitiative Bittstädt-Wachsenburggemeinde e. V., geschäftsführendes Vorstandsmitgl. im Thüringer Landesverband der Verfolgten des Naziregimes (TVVdN/BdA e. V.), 1999/06 Beirat der Rosa-Luxemburg-Initiative Bremen. 1993/95 Vorstandsmitgl. im Allgemeinen Studierendenausschuss der Univ. Bremen; zahlreiche Aktivitäten/Verantwortlichkeiten im Bereich antirassistischer und antifaschistischer Kampagnen. Mitgl. der PDS bzw. DIE LINKE, 1998/01 Mitgl. Landesvorst. der PDS in Bremen, 1999 Spitzenkandidatin der PDS zur Bürgerschaftswahl in Bremen, 2005/07 Mitgl. im Stadtvorstand der LINKEN Erfurt. MdL Thüringen Sept. 2009/Okt. 2013, ab Sept. 2009 stellv. Vors. der Fraktion DIE LINKE, ab Januar 2012 stellv. Vors. Untersuchungsausschuss zur NSU. - MdB seit Okt. 2013.', 'Martina', '11004385');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08429, NULL, 'Dr.', 'Dr.', 'Unternehmensberaterin', 'verheiratet, 2 Kinder', '27.11.1962', NULL, 'Kiel', 'weiblich', NULL, '22.10.2013', 'De Ridder', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	CEDIN Consulting, Schüttorf,<br/>	Unternehmensberaterin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Unternehmensberaterin, Schüttorf<br/>   - Bauhaus-Universität Weimar, Weimar, 2015, Stufe 2<br/>   - Deutsche Sporthochschule Köln, Köln, 2013, Stufe 3<br/>   - EBZ Business School GmbH, Bochum, 2014, Stufe 3; 2015, Stufe 3<br/>   - Ernst-Moritz-Arndt-Universität Greifswald, Greifswald, 2013, Stufe 2<br/>   - Fachhochschule Aachen, Aachen, 2013, Stufe 3<br/>   - Fachhochschule Dortmund, Dortmund, 2014, Stufe 3<br/>   - Fachhochschule Düsseldorf, Düsseldorf, 2013, Stufe 3<br/>   - Fachhochschule Köln, Köln, 2014, Stufe 3<br/>   - Folkwang Universität der Künste, Essen, 2014, Stufe 3; 2015, Stufe 1<br/>   - Hochschule Bremen, Bremen, 2014, Stufe 3; 2015, Stufe 3<br/>   - Hochschule Koblenz, Koblenz, 2014, Stufe 3; 2015, Stufe 3<br/>   - Hochschule Hamburg, Hamburg, 2015, Stufe 1<br/>   - Hochschule Reutlingen, Reutlingen, 2014, Stufe 4<br/>   - Hochschule Ruhr West, Mühlheim/Ruhr, 2014, Stufe 3<br/>   - Johannes Gutenberg-Universität Mainz, Mainz, 2014, Stufe 1<br/>   - Kunde 1, 2014, Stufe 2<br/>   - Kunde 2, 2014, Stufe 2<br/>   - Kunde 3, 2015, Stufe 3<br/>   - Kunde 4, 2015, Stufe 2<br/>   - Kunde 5, 2015, Stufe 3<br/>   - Kunde 6, 2015, Stufe 3<br/>   - Landeshauptstadt Dresden, Dresden, 2013, Stufe 1; 2014, Stufe 3<br/>   - Prognos AG, Berlin, 2014, Stufe 5<br/>   - Technische Universität Ilmenau, Ilmenau, 2013, Stufe 1<br/>   - Universität Duisburg-Essen, Essen, 2014, Stufe 3<br/>   - Universität Kassel, Kassel, 2014, Stufe 4; 2015, Stufe 4<br/>   - Universität zu Köln, Köln, 2013, Stufe 1; 2015, Stufe 2<br/>   - Universität der Künste Folkwang-Essen, Essen, 2015, Stufe 1<br/>   - Universität Rostock, Rostock, 2015, Stufe 1<br/>   - Universität Basel, Basel, Schweiz, 2015, Stufe 1', 'Abitur am Königlichen Athenäum in Eupen (Belgien). Volontariat bei der Tageszeitung Grenz-Echo (Eupen/Belgien). Studium der Sozial- und Kommunikationswiss., Romanistik und Kunstpädagogik an der RWTH Aachen, am Institut Supérieur des Beaux Arts Saint Luc de Liège in Belgien und an der Georg-August-Univ. Göttingen; Promotion als Wirtschafts- und Sozialwissenschaftlerin Univ. Osnabrück. Redakteurin bei der Göttinger Woche. Wissenschaftl. Assistentin, Leiterin der Gleichstellungsbüros und hauptamtl. Gleichstellungsbeauftragte an den Universitäten Göttingen, Lüneburg, Osnabrück sowie an den Fachhochschulen Nordost-Niedersachsen (Lüneburg) und Osnabrück (einschließlich Campus Lingen); Projektleiterin bei einem Beratungsunternehmen in Gütersloh; seit 2012 freiberufliche Unternehmensberaterin. 1992 Eintritt in die SPD, 2008/11 Vors. der ASF im Landkreis Osnabrück, 2009/11 Beisitzerin im Kreisvorst. für den Landkreis Osnabrück, 2011 Landratskandidatin für SPD, Bündnis 90/Die Grünen und Bürgerforum Emlichheim im Landkreis Grafschaft Bentheim, 2011/14 SPD-Kreisvors. der Grafschaft Bentheim. Mitgl. der Arbeiterwohlfahrt (AWO), der Katholischen Arbeitnehmer-Bewegung (KAB), des Förderkreises der Städtischen Galerie Nordhorn, Mitgl. der Kunsthalle Lingen und des Meppener Kunstkreises. Auszeichnung der deutschsprachigen Gemeinschaft Belgiens, Promotionspreis von Arbeit und Leben. - MdB seit Okt. 2013.', 'Daniela', '11004386');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08430, NULL, NULL, NULL, 'Elektromeister in der Energiewirtschaft', 'verheiratet, 2 Kinder', '24.12.1962', NULL, 'Düsseldorf', 'männlich', NULL, '22.10.2013', 'Rimkus', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Stadtwerke Düsseldorf AG, Düsseldorf,<br/>	Elektromeister<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Netzgesellschaft Düsseldorf mbH, Düsseldorf, <br/>	Qualitätsmanager<br/><br/>Funktionen in Unternehmen: <br/>	Düsseldorfer Wohnungsgenossenschaft e.G., Düsseldorf, <br/>	Mitglied der Vertreterversammlung<br/><br/>	Flughafen Düsseldorf GmbH, Düsseldorf, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Jugendberufshilfe Düsseldorf GmbH, Düsseldorf, <br/>	Mitglied des Aufsichtsrates (bis 14.11.2013)<br/><br/>	Städtische Wohnungsgesellschaft Düsseldorf AG, Düsseldorf, <br/>	Mitglied des Aufsichtsrates (bis 03.07.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Bundesverband eMobilität e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates<br/><br/>	Deutscher Mieterbund NRW e.V., Düsseldorf, <br/>	Mitglied des Vorstandes<br/><br/>	Energiedialog 2050 e.V., Berlin, <br/>	Mitglied des Vorstandes', 'Fachoberschulreife 1979. Berufsausbildung, 1983 Energieanlagenelektroniker. 1983/84 Wehrdienst. Qualitätsmanager Netze, seit 1979 bei den Stadtwerken Düsseldorf. 1998 Eintritt in die SPD, 2007/11 stellv. Vors. SPD Düsseldorf, seit April 2011 Vors. der SPD Düsseldorf, seit 2012 Mitgl. Landesvorst. NRWSPD. 2009/13 Ratsmitgl. in Düsseldorf. Mitgl. AWO, ver.di - Vertrauensmann, 2002/13 Betriebsrat der Stadtwerke Düsseldorf seit 2002, Mitgl. Friedrichstädter Reserve, Närrisch Welthus, Bilker Heimatfreunde, Martinsfreunde Bilk, Förderverein Bonifatius-Schule und Hulda-Pankok-Gesamtschule, Kleingartenverein An der Südbrücke, Mitgl. ASB Arbeiter-Samariter-Bund und Mitgl. Hospizverein Caritas Garath. Seit 2014 Mitgl. im parl. Beirat des Bundesverbandes Elektromobilität, seit 2014 Mitgl. im Aufsichtsrat der Flughafen Düsseldorf GmbH, seit 2015 Beisitzer im Vorst. des Dt. Mieterbundes NRW. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 106 (Düsseldorf I)', 'Andreas', '11004387');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08431, NULL, NULL, NULL, 'Rechtsanwalt', 'ledig', '24.06.1986', NULL, 'Oldenburg (Oldenburg)', 'männlich', NULL, '22.10.2013', 'Rohde', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Rechtsanwalt, Westerstede<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Rechtsanwalt, selbständig, Wiefelstede<br/><br/>Funktionen in Unternehmen: <br/>AWO Trialog Weser-Ems gemeinnützige GmbH, Oldenburg,<br/>Mitglied des Aufsichtsrates, ehrenamtlich (bis 01.09.2016)<br/><br/>Verbundnetz Gas AG (VNG), Leipzig,<br/>Mitglied des Aufsichtsrates (bis 30.04.2016)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Ems - Weser - Elbe Versorgungs- und Entsorgungsverband (EWE-Verband), Oldenburg,<br/>Mitglied der Verbandsversammlung, ehrenamtlich<br/><br/>Gemeinde Wiefelstede, Wiefelstede,<br/>Mitglied des Gemeinderates, ehrenamtlich<br/><br/>Landkreis Ammerland, Westerstede,<br/>Mitglied des Kreistages, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Bezirksverband Weser-Ems e.V., Oldenburg,<br/>Mitglied des Gesamtvorstandes, ehrenamtlich<br/><br/>AWO Bundesverband e.V., Berlin,<br/>Mitglied des Präsidiums, ehrenamtlich<br/><br/>Versicherungsombudsmann e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich', 'Abitur. 2006 Jura Studium in Hannover, 2010 Studium als Diplom-Jurist abgeschlossen, 2011/13 Referendariat, 2013 2. jur. Examen. Rechtsanwalt. Mitgl. der SPD seit 2002. Ratsherr der Gemeinde Wiefelstede, Ammerländer Kreistagsabgeordneter, Mitgl. der Verbandsversammlung der EWE. Mitgl. der Arbeiterwohlfahrt und des Gesamtvorstandes der AWO Weser-Ems, Mitgl. ver.di, SoVD, Verein Daheim statt Heim. - MdB seit Okt. 2013.', 'Dennis', '11004388');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08432, NULL, 'Dr.', 'Dr.', 'Diplom-Volkswirt', 'verheiratet, 1 Kind', '20.10.1976', NULL, 'Saulgau', 'männlich', NULL, '22.10.2013', 'Rosemann', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>ISG Institut für Sozialforschung und Gesellschaftspolitik GmbH, Köln,<br/>Leiter des Berliner Büros<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Pro RegioStadtbahn e.V., Tübingen, <br/>Mitglied des Beirates', '1987/96 Kepler-Gymnasium Tübingen, Abitur. 1996/01 Studium der Volkswirtschaftslehre Eberhard Karls Univ. in Tübingen, Abschluss Diplom-Volkswirt. 2006 Promotion. 2002/06 Wissenschaftl.  Referent; 2007/13 Lehrbeauftragter Hochschule Pforzheim. 2006/11 Projektleiter Institut für Angewandte Wirtschaftsforschung e.V. (IAW) in Tübingen, seit 2011 Leiter des Berliner Büros ISG Institut für Sozialforschung und Gesellschaftspolitik GmbH, Köln/Berlin. 1996/2000 stellv. Ortsvereinsvors. SPD Tübingen, 2000/03 Landesvors. Juso-Landesverband Baden-Württemberg, 2003/07 Kreisvors. SPD-Kreisverband Tübingen, 2001/05 und seit 2007 Mitgl. Landesvorst. SPD Baden-Württemberg,  seit 2007 dort Mitgl. Präsidium, seit 2010 Vors. der Antragskommission der SPD Baden-Württemberg. 2004/11 Mitgl. Gemeinderat Stadt Tübingen, 2004/07 stellv. Fraktionsvors. der SPD-Fraktion und 2007/11 Fraktionsvors. - MdB seit Okt. 2013.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 289 (Reutlingen)<br/>Wahlkreis 295 (Zollernalb - Sigmaringen)', 'Martin', '11004389');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08433, NULL, NULL, NULL, 'Poltikerin', 'ledig, 1 Kind', '11.10.1975', NULL, 'Osnabrück', 'weiblich', NULL, '22.10.2013', 'Rüffer', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, NULL, NULL, 'Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesarbeitsgemeinschaft Integrationsfirmen e.V., Berlin,<br/>Mitglied des Beirates, ehrenamtlich', 'Abitur. Studium der Politikwissenschaften und öffentliches Recht in Trier. Mitarbeiterin eines Landtagsabgeordneten. Auslandsaufenthalte in USA und England. Seit 1998 Mitgl. BÜNDNIS 90/DIE GRÜNEN, 10 Jahre Sprecherin des Grünen Kreisverbandes in Trier. Mitgl. des Trierer Stadtrates. Mitglied Multikulturelles Zentrum Trier e. V., Trierer Arbeitskreis für Montessori-Pädagogik e. V. - MdB seit Okt. 2013.', 'Corinna', '11004390');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08434, NULL, NULL, NULL, 'Politologin, Kinderbeauftragte der SPD-Bundestagsfraktion, Sprecherin der Arbeitsgruppe Strategien gegen Rechtsextremismus der SPD-Bundestagsfraktion', 'ledig, 2 Kinder', '21.07.1977', NULL, 'Meißen/Sachsen', 'weiblich', NULL, '22.10.2013', 'Rüthrich', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Courage - Werkstatt für demokratische Bildungsarbeit e.V., Dresden,<br/>Geschäftsführerin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundeszentrale für politische Bildung, Bonn,<br/>Stellv. Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Courage - Werkstatt für demokratische Bildungsarbeit e.V., Dresden,<br/>Mitglied des Vorstandes, ehrenamtlich<br/><br/>Netzwerk für Demokratie und Courage e.V. (NDC), Dresden,<br/>Schatzmeisterin des Bundesverbandes und Vorsitzende des<br/>Landesverbandes Sachsen, ehrenamtlich<br/><br/>Neue Gesellschaft Sachsen e.V., Dresden,<br/>Vorsitzende, ehrenamtlich', 'Abitur. Magisterabschluss Politikwissenschaft, Soziologie, Geschichte. Trainerin in der Jugend- und Erwachsenenbildung. Ehrenamtliche Tätigkeit beim Netzwerk für Demokratie und Courage (NDC); Projektmanagerin beim NDC für Berlin und Brandenburg; Geschäftsführerin und Projektleiterin beim NDC Sachsen. Mitgliedschaften: AWO, Gegen Vergessen - für Demokratie e. V., Buntes Radebeul e. V., Bürgerinitiative Hochwasser Nünchritz, Gewerkschaft Erziehung und Wissenschaft (GEW), Landesfrauenrat Sachsen e. V., stellv. Mitgl. Kuratorium der Bundeszentrale für politische Bildung. Mitgl. Falken, 1998/2000 Falken-Landesvors. Sachsen; 1996/2000 Juso-Landesvorstandsmitgl.; 1998/02 und wieder seit 2008 SPD-Landesvorstandsmitgl. Sachsen, 1999/02 stellv. SPD-Landesvors. Sachsen, seit 2010 SPD-Unterbezirksvors. Meißen. - MdB seit Okt. 2013; seit Feb. 2014 Kinderbeauftragte der SPD-Fraktion, seit Juni 2014 Sprecherin der AG Strategien gegen Rechtsextremismus der SPD-Fraktion, seit Nov. 2015 stellv. Vors. 3. Untersuchungsausschuss (Terrorgruppe NSU II).<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 158 (Sächsische Schweiz - Osterzgebirge)<br/>Wahlkreis 159 (Dresden I)<br/>Wahlkreis 160 (Dresden II - Bautzen II)', 'Susann', '11004391');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08435, NULL, NULL, NULL, 'Technischer Oberamtsrat a.D.', 'verheiratet, 2 Kinder', '02.10.1968', NULL, 'Gemünden a.Main', 'männlich', NULL, '22.10.2013', 'Rützel', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Deutsche Bahn AG, Frankfurt/Main,<br/>Technischer Oberamtsrat<br/><br/>Funktionen in Unternehmen: <br/>Sparda-Bank, Frankfurt/Main, <br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Main-Spessart, Karlstadt, <br/>	Mitglied des Kreistages<br/><br/>	Stadt Gemünden a. Main, Gemünden a. Main, <br/>	Mitglied des Stadtrates', '1983/87 Berufsausbildung zum Maschinenschlosser bei der Deutschen Bundesbahn, 1987/89 Ausbildung zum Werkmeister (mittlere technische Beamtenlaufbahn). 1996/98 Studium zum gehobenen technischen Dienst an der FH Karlsruhe Fachrichtung Maschinentechnik und Elektrotechnik. 1990/91 Werkmeister in Würzburg und Nürnberg. 1991/94 Vors. der Jugend- u. Auszubildendenvertretung beim Präsidenten der Bundesbahndirektion Nürnberg, 1994/95 stellv.  Betriebsratsvors. in Würzburg. 1998/99 Einkauf und Materialwirtschaft in Nürnberg, 1999/04 Lehrer für Wagen- und Bremstechnik und Verladeberater in Nürnberg, 2004/08 Gruppenleiter Technische Wagenbehandlung in Nürnberg, 2008/11 Leiter Planungsgrundlagen bei DB Schenker Rail in Frankfurt am Main, 2011/13 Leiter Infrastruktur und Leiter des Railport Darmstadt bei DB Schenker Rail in Frankfurt am Main. 1992 Eintritt in die SPD, 1992/96 Mitgl. SPD-Ortsverein Rieneck, seit 1996 Mitgl.  SPD-Ortsvorst. Gemünden, seit 2004 Mitgl. SPD-Kreisvorst., seit 2008 stellv. SPD-Kreisvors. und Stadtrat in Gemünden am Main, 2009/13 1. Vors. SPD-Ortsverein Gemünden, seit 2010 Mitgl. im SPD-Bezirksvorst. Unterfranken und SPD-Unterbezirksvors. Main-Spessart/Miltenberg, ab 2012 stellv. Vors. der Unterfranken-SPD, seit 2014 Vors.; 2012/14 Vors. der AfA Unterfranken. Seit 2014 Mitgl. Kreistag Main-Spessart. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 251 (Würzburg)', 'Bernd', '11004392');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08437, NULL, NULL, NULL, 'Diplom-Verwaltungswirt (FH)', 'verheiratet, 5 Kinder', '09.12.1967', NULL, 'Emden', 'männlich', NULL, '22.10.2013', 'Saathoff', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Gemeinde Krummhörn, Krummhörn,<br/>Hauptamtlicher Bürgermeister<br/><br/>Funktionen in Unternehmen: <br/>Bürgerenergie Hinte & Krummhörn eG, Krummhörn, <br/>	Vorsitzender des Aufsichtsrates, ehrenamtlich<br/><br/>	Ostfriesische Volksbank eG, Leer, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Ostfriesland Energie eG, Krummhörn, <br/>	Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>	Post und Eisenbahnen, Bonn, <br/>	Mitglied des Beirates<br/><br/>	Deichacht Krummhörn, Krummhörn, <br/>	Mitglied des Vorstandes<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband Erneuerbare Energie e.V. (BEE), Berlin, <br/>	Mitglied des Parlamentarischen Beirates<br/><br/>	Ems-Dollart-Stiftung, Leer, <br/>	Mitglied des Kuratoriums, ehrenamtlich<br/><br/>	Stiftung Ostfriesische Volksbank, Leer, <br/>	Mitglied des Kuratoriums, ehrenamtlich', '1987 Abitur am Johannes-Althuisius-Gymnasium in Emden. 1990/93 Bezirksregierung Weser-Ems, zuletzt Regierungsinspektor z. A., 1993/2000 Fachhochschule Ostfriesland, zuletzt Regierungsoberamtsrat. 2003/13 hauptamtlicher Bürgermeister der Gemeinde Krummhörn. Mitgl. Arbeiterwohlfahrt, ver.di, Sozialverband Deutschland. Mitgl. der SPD. - MdB seit Okt. 2013.', 'Johann', '11004393');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08438, NULL, 'Dr.', 'Dr.', 'gewerkschaftlicher Politikberater', 'verheiratet, 2 Kinder', '20.01.1952', NULL, 'Warburg', 'männlich', NULL, '22.10.2013', 'Schabedoth', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Industriegewerkschaft Metall (IGM), Frankfurt/Main,<br/>Politikwissenschaftlicher Referent beim Vorstand<br/><br/>Sozialwissenschaftliche Politikberatung und publizistische Tätigkeit, Frankfurt/Main<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband eMobilität e.V., Berlin, <br/>	Mitglied des Parlamentarischen Beirates', 'Facharbeiterlehre und Tätigkeit als Elektromechaniker bei der Deutschen Bundesbahn. 1974 Abitur am Erzbischöflichen Friedrich-Spee-Kolleg in Neuss. Studium der Geschichte, Politik, Erziehungswissenschaft und Kunstgeschichte in Marburg, Staatsexamen und Politikwissenschaftliche Promotion. 1981 Arbeit für die IG Metall in Stuttgart. Seit 1987 Politikberater des Vorstandes der IG Metall Frankfurt, 2001/09 Leiter der Abteilung Gesellschaftspolitik beim Bundesvorstand des Deutschen Gewerkschaftsbundes in Berlin. Seit 1971 Mitglied der SPD. - MdB seit Okt. 2013; stellv. Vors. der Deutsch-Griechischen Parlamentariergruppe.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 181 (Main-Taunus)', 'Hans-Joachim', '11004394');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08439, NULL, NULL, NULL, 'Medienwissenschaftlerin', 'keine Angaben', '30.04.1966', NULL, 'Hüls (jetzt Krefeld)', 'weiblich', NULL, '22.10.2013', 'Schauws', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'religionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Fraktion BÜNDNIS 90/DIE GRÜNEN im Rat der Stadt Krefeld, Krefeld,<br/>	Fraktionsgeschäftsführerin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stiftung "Erinnerung, Verantwortung und Zukunft", Berlin,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesakademie für musikalische Jugendbildung e.V., Trossingen,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Villa Merländer e.V., Förderverein der NS-Dokumentationsstelle Krefeld, Krefeld,<br/>Mitglied des Kuratoriums', 'Hochschulreife. Studium der Film- und Fernsehwissenschaften, Politikwissenschaften, Neuere Geschichte, Abschluss Magistra Artium. Qualifikation Zusatzausbildung in Film- und Medienmanagement. Tätig bei Film- und Fernsehproduktionsfirmen in den Bereichen Redaktion, Dreharbeiten und Dramaturgie für TV und Kino, bei Bildungsträgern im Rheinland, Studien zur Arbeitsmarktlage, SOS Kinderdorf Niederrhein - Beratung und Betreuung. Fraktionsgeschäftsführerin. Ehrenamtl. tätig im Vorstand der Frauenberatungsstelle Krefeld e.V.; Sprecherin des Bezirksverbandes der Grünen Niederrhein-Wupper. Kommunalpolitisches Mandat bis 2009, sachkundige Bürgerin im Sozial- und im Kulturausschuss Krefeld. - MdB seit Okt. 2013.', 'Ulle', '11004395');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08440, NULL, 'Dr.', 'Dr.', 'Geschäftsführerin', 'ledig, 1 Kind', '11.09.1971', NULL, 'Berlin', 'weiblich', NULL, '22.10.2013', 'Scheer', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>UnternehmensGrün e.V. Bundesverband der grünen Wirtschaft, Berlin,<br/>Geschäftsführerin<br/><br/>Hochschule für Wirtschaft und Recht, Berlin,<br/>Lehrbeauftragte<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas,<br/>Telekommunikation, Post und Eisenbahnen, Bonn, <br/>Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband BioEnergie e.V. (BBE), Bonn,<br/>Mitglied des Politisch/Wissenschaftlichen Beirates<br/><br/>Bundesverband Erneuerbare Energie e.V. (BEE), Berlin,<br/>Stellv. Vorsitzende des Parlamentarischen Beirates<br/><br/>Forum Demokratische Linke 21 e.V., Berlin,<br/>Stellv. Vorsitzende (bis 11.07.2014)<br/><br/>Hermann-Scheer-Stiftung, Berlin,<br/>Vorsitzende des Vorstandes, ehrenamtlich', 'Schulbesuch in Bonn, Abitur 1991. Musikstudium in Essen mit Hauptfach Violine, 1996 Künstlerische Abschlussprüfung (heutiges Diplom); Jurastudium in Bonn, erstes Staatsexamen 2001; Politikwissenschaftliche Promotion, 2008 Dr. rer.pol. in Leipzig. 1993/96 Violinistin am Folkwang Kammerorchester, 1996/04 freiberufliche Tätigkeit als Violinistin. 1997/02 Freie Mitarbeiterin der Zeitschrift für Neues Energierecht; 2006/07 Wissenschaftliche Mitarbeiterin des MdB Marco Bülow; 2007/13 Geschäftsführerin von UnternehmensGrün e. V., Bundesverband der grünen Wirtschaft. Seit 1987 Mitgl. der SPD, Mitgl. im SPD-Landesvorstand Schleswig-Holstein. - MdB seit Okt. 2013.', 'Nina', '11004396');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08441, NULL, NULL, NULL, 'Qualitätstechniker, Leiter Qualitätssicherheit', 'verheiratet, 1 Kind', '07.08.1959', NULL, 'Kempen', 'männlich', NULL, '22.10.2013', 'Schiefner', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Brauerei Mönchengladbach, Mönchengladbach,<br/>Leiter der Qualitätssicherung<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Brauerei Mönchengladbach, Mönchengladbach, <br/>Leiter der Qualitätssicherung (bis 31.12.2013), 2013, Stufe 3<br/><br/>Funktionen in Unternehmen: <br/>Wirtschaftsförderungsgesellschaft für den Kreis Viersen mbH, Viersen, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Viersen, Viersen, <br/>Mitglied des Kreistages, Fraktionsvorsitzender<br/><br/>Sparkasse Krefeld, Krefeld, <br/>Mitglied des Verwaltungsrates', '1974 Hauptschlussabschluss. Berufsgrundschuljahr für Chemie, Fachoberschulreife, Ausbildung zum Chemisch-Technischen Assistenten. Mitarbeiter in der Qualitätssicherung einer Mönchengladbacher Brauerei; währenddessen Fernstudium zum Qualitätssicherungstechniker an der Technischen Fachhochschule Berlin. Seitdem Leiter der Qualitätssicherung der Mönchengladbacher Brauerei. 1975 Eintritt in die SPD, 1976/79 stellv. Vors. der JUSOS im Kreis Viersen, 1978/82 Mitgl. des Vorst. der SPD im Ortsverein Kempen, 1981/89 Vors. der SPD in St. Hubert, 1994/02 stellv. Vors. der SPD im Kreis Viersen und seit 2002 Vors., seit 2008 stellv. Vors. der SPD Niederrhein. 1983/09 Mitglied Rat der Stadt Kempen, 1984/90 Geschäftsführer der SPD-Ratsfraktion Kempen, 1990/09 Vors. der SPD-Fraktion im Rat der Stadt Kempen. Seit 2004 Mitgl. Kreistag Viersen, 2009/Dez. 2013 Vors. der Kreistagsfraktion. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 108 (Neuss I)', 'Udo', '11004397');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08443, NULL, NULL, NULL, 'Politologin', NULL, '06.09.1979', NULL, 'Cottbus', 'weiblich', NULL, '22.10.2013', 'Schimke', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bundesvereinigung der Deutschen Arbeitgeberverbände, Berlin,<br/>	Referentin<br/><br/>Funktionen in Unternehmen: <br/>Michels Kliniken GmbH & Co. KG, Berlin, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>DRK Landesverband Brandenburg e.V., Potsdam, <br/>	Mitglied des Präsidiums, ehrenamtlich<br/><br/>	McDonald´s Kinderhilfe Stiftung, München, <br/>	Mitglied des Kuratoriums', '2002/06 Deutscher Bundestag, Tätigkeit für verschiedene Abgeordnete der CDU/CSU-Bundestagsfraktion. 2006/08 Haus & Grund Deutschland, 2008/13 BDA Bundesvereinigung der Deutschen  Arbeitgeberverbände Abteilung Arbeitsmarktpolitik. 2003 Eintritt in die CDU, seit 2014 stellv. Kreisvors. CDU Dahme-Spreewald, seit April 2015 stellv. Vors. der CDU Brandenburg, seit Juli 2015 Vors. Landesfachausschuss Artbeitsmarkt und Soziales der CDU Brandenburg, Mitgl. im Bundesfachausschuss Wirtschaft und Arbeit der CDU Deutschlands. Seit 2014 Mitgl. Präsidium DRK Brandenburg, seit 2014 Beiratsmitgl. Michels Kliniken, 2015 Mitgl. Kuratorium McDonalds Kinderhilfe Stiftung, seit Nov. 2016 Mitgl. Vorst. Heimatstiftung Museumsdorf Glashütte. - MdB seit Okt. 2013; Vors. Deutsch-Spanische Parlamentariergruppe, Vorstandsmitgl. im Parlamentskreis Mittelstand, Vors. der Kommission für ein modernes Arbeits- und Sozialrecht im Parlamentskreis Mittelstand.', 'Jana', '11004398');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08444, NULL, 'Dr.', 'Dr.', 'Sprachwissenschaftlerin und Diakonin', 'verheiratet', '27.04.1959', NULL, 'Kernen im Remstal', 'weiblich', NULL, '22.10.2013', 'Schlegel', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Kultusministerium Baden-Württemberg, Stuttgart,<br/>	Persönliche Referentin des Staatssekretärs<br/><br/>	Stadt Karlsruhe, Karlsruhe,<br/>	Persönliche Referentin des Oberbürgermeisters<br/><br/>	Universität Stuttgart, Stuttgart,<br/>	SRH Hochschule Heidelberg, Heidelberg,<br/>	Lehrbeauftragte<br/><br/>Funktionen in Unternehmen: <br/>Abfallwirtschaftsgesellschaft des Neckar-Odenwald-Kreises mbH (AWN), Buchen, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Neckar-Odenwald-Kreis, Mosbach, <br/>	Mitglied des Kreistages<br/><br/>Stiftung Reichspräsident-Friedrich-Ebert-Gedenkstätte, Heidelberg,<br/>Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesakademie für musikalische Jugendbildung e.V., Trossingen,<br/>Mitglied des Kuratoriums<br/><br/>Landesverband der Schulfördervereine Baden-Württemberg e.V.,<br/>	Walddorfhäslach, <br/>	Mitglied des Vorstandes<br/><br/>	Sportkreis Mosbach e.V., Mosbach, <br/>	Vorsitzende, ehrenamtlich', '1978 Abitur. Ausbildung zur evangelischen Religionspädagogin und Diakonin in Ludwigsburg; 1982/92 Jugendreferentin und Diakonin in Stuttgart. 1992/97 Studium der Linguistik und Soziologie Univ. Stuttgart (M.A.); 2004 Promotion Univ. Mannheim. Während des Studiums Religionslehrerin in Stuttgart. Büroleiterin am Institut für Linguistik/Germanistik der Universität Stuttgart. Vier Jahre Referentin im Türkischen Generalkonsulat in Stuttgart.  Ab 2002 wissenschaftliche Mitarbeiterin der SPD-Fraktion, danach Büroleiterin von Abgeordneten im Landtag von Baden-Württemberg. 2011 Persönliche Referentin des Staatssekretärs im Kultusministerium. Kreisrätin Neckar-Odenwald-Kreis. Aufsichtsratsmitgl. Abfallwirtschaftsgesellschaft (AWN), Vors. Sportkreis Mosbach e. V., Vorstandsmitgl. Landesverband der Schulfördervereine Baden-Württemberg e. V., Mitgl. AWO. - MdB seit Okt. 2013; Mitgl. der Deutsch-Nordischen, Deutsch-Baltischen und der Deutsch-Türkischen Parlamentariergruppe.', 'Dorothee', '11004399');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08445, NULL, NULL, NULL, 'Sparkassenbetriebswirt', 'verheiratet, 2 Kinder', '24.03.1970', NULL, 'Westerstede', 'männlich', NULL, '22.10.2013', 'Schmelzle', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, NULL, NULL, 'Heiko', '11004400');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08446, NULL, NULL, NULL, 'Historikerin', '1 Kind', '13.03.1973', NULL, 'Gießen', 'weiblich', NULL, '22.10.2013', 'Schmidt', '(Wetzlar)', 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Hessischer Landtag, Wiesbaden,<br/>Regierungsoberrätin', 'Abitur an der Liebigschule in Gießen. Studium der Geschichte an der Justus-Liebig-Univ. Gießen. Abgeordnetenmitarbeiterin und wissenschaftliche Referentin, parlamentarische Referentin für Wirtschaft, Verkehr und Landesentwicklung im Wiesbadener Landtag. Mitgl. ver.di, IG Metall, AWO, Kinderschutzbund, Pro Asyl, Vors. der AWO Wetzlar. Seit dem 16. Lebensjahr Mitgl. der SPD, Engagement bei den Jusos, aktive Hochschulpolitik, Arbeit auf verschiedenen Ebenen der SPD, Mitgl. des Parteivorstands. 2009 Kandidatin der  die SPD im Lahn-Dill-Kreis für den Bundestag. - MdB seit Okt. 2013.', 'Dagmar', '11004401');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08447, NULL, NULL, NULL, 'Industriekauffrau', 'verwitwet, 2 Kinder', '02.07.1956', NULL, 'Grafenhausen', 'weiblich', NULL, '22.10.2013', 'Schmidt', '(Ühlingen)', 'CDU', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>ACO Automation Components Johannes Mergl e.K., Wutöschingen-Horheim,<br/>Industriekauffrau', 'Grundschule Grafenhausen, Hochrheingymnasium Waldshut, Abitur. 1975 Lehre als Industriekauffrau. Berufstätig als Industriekauffrau in mittelständischen Betrieben. 1992/98 Mitarbeiterin Wahlkreisbüro Werner Dörflinger, ehem. MdB. Eintritt in Junge Union mit 16, in CDU und CDA mit 18, versch. Parteiämter in Gemeinde, Kreis und Bezirk Südbaden, Schatzmeisterin im CDA-Bezirksverband Südbaden, Mitgl. CDU-Kreisvorst. Waldshut, Vors. CDA-Kreisverband Waldshut, Vors. CDU-Gemeindeverband Ühlingen-Birkendorf. Ehrenamtl. stellv. Vors. Trägerverein des Frauen- und Kinderschutzhauses Kreis Waldshut e. V. - MdB seit Okt. 2013.', 'Gabriele', '11004402');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08448, NULL, NULL, NULL, 'Beamter', 'verheiratet, 3 Kinder', '08.02.1963', NULL, 'Homberg', 'männlich', NULL, '22.10.2013', 'Schmidt', '(Berlin)', 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bundesministerium des Innern, Berlin,<br/>Beamter', '1982 Allgemeine Hochschulreife Gymnasium Philippinum. 1983/85 Wehrdienst als Sanitäter in Marburg. 1985/88 Studium Fachhochschule des Bundes in Köln, Abschluss Diplom-Verwaltungswirt. 1988/91 Statistisches Bundesamt, Wiesbaden, 1991/99 Statistisches Bundesamt, Zweigstelle Berlin, 1999/13 im Bundesministerium des Innern. Mitgl. ver.di, Greenpeace, Arbeiterwohlfahrt, Sozialdemokratische Gemeinschaft für Kommunalpolitik (SGK). 2006/13 Bezirksverordneter/Fraktionsvors. in Berlin-Treptow-Köpenick. Mitgl. im Kuratorium der Bundeszentrale für politische Bildung (bpb). - MdB seit Okt. 2013; stellv. Sprecher der Landesgruppe Ost der SPD-Fraktion, stellv. sportpolitischer Sprecher.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 85 (Berlin-Marzahn - Hellersdorf)', 'Matthias', '11004403');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08449, NULL, NULL, NULL, 'Hausfrau', 'verheiratet, 2 Kinder', '09.08.1952', NULL, 'Alstätte (jetzt Ahaus)', 'weiblich', NULL, '22.10.2013', 'Schulte', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>	Wirtschaftsförderungsgesellschaft für den Kreis Borken mbH, Ahaus, <br/>	Beratendes Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Kreis Borken, Borken, <br/>	Mitglied des Kreistages (bis März 2014)<br/><br/>	Sparkasse Westmünsterland, Münster, <br/>	Mitglied des Beirates, ehrenamtlich', 'Besuch der Volksschule in Lünten; Mittlere Reife am Werner-von-Siemens-Gymnasium in Gronau. Nach der mittleren Reife Familiengründung; etliche Jahre Tätigkeit im Verkauf von Damenoberbekleidung; Unterstützung, Versorgung und Pflege von Großeltern und Eltern bis 2011. Katholische Frauengemeinschaft; Arbeiterwohlfahrt; Gründungsmitglied des Kreisflüchtlingsrates Borken; Heimatverein Vreden-Lünten; Sportverein FC Vreden 52 e.V. Seit 1980 Mitglied der SPD; seit vielen Jahren stellvertretende Vorsitzende der SPD im Unterbezirk Borken; seit November 2012 Mitglied des Regionalvorstandes der SPD Westliches Westfalen;von 1984 bis 2004 Mitglied im Rat der Stadt Vreden; Ehrenratsfrau der Stadt Vreden; seit 1989 Mitglied des Kreistages Borken; 2004/13 Vorsitzende der SPD-Kreistagsfraktion. Mitgl. IG BCE. - MdB seit Okt. 2013.', 'Ursula', '11004404');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08450, NULL, NULL, NULL, 'Krankenschwester, Kommunikationswissenschaftlerin', 'verheiratet, 1 Kind', '31.12.1956', NULL, 'Berlin-Spandau', 'weiblich', NULL, '22.10.2013', 'Schulz-Asche', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'evangelisch', NULL, NULL, '1975 Abitur. 1979 staatl. Krankenpflegeexamen, Studium Kommunikationswissenschaften, Politologie, Geschichte, 1988 Magister Artium, Freie Universität Berlin. 1988/91 freie Gutachterin Burkina Faso, 1992/94 Entwicklungshelferin des DED, Ruanda, 1994/2000 freie Gutachterin, Kenia, Deutschland, 2000/03 wissenschaftl. Mitarbeiterin, Projektkoordinatorin, GTZ Eschborn. Mitgl. BÜNDNIS 90/DIE GRÜNEN, Okt. 1978 Gründungsmitgl. der Alternativen Liste Berlin (jetzt BÜNDNIS 90/DIE GRÜNEN), seit 1998 Mitgl. Kreisverband Main-Taunus, 2000/09 Mitgl. Kreisvorst., 2001/03 Beisitzerin im Landesvorst. Hessen, Juli 2005/Dez. 2013 Landesvors. BÜNDNIS 90/DIE GRÜNEN. 1983/85 Mitgl. Abgeordnetenhaus Berlin, Fraktionsvors. MdL Hessen 2003/Okt. 2013, seit Okt. 2005 stellv. Fraktionsvors., Sprecherin für Demografischen Wandel, Gesundheit, Behindertenpolitik, Vors. Sozialpolitischer Ausschuss seit Febr. 2012, stellv. Vors. Enquetekommission Demographischer Wandel 2003/08 und der Enquetekommission Migration und Integration in Hessen seit Januar 2010. Seit 2011 Mitgl. Kreistag Main-Taunus-Kreis. Mitgl. ver.di. Mitgl. der 13., 14. und 15. Bundesversammlung. - MdB seit Okt. 2013.', 'Kordula', '11004405');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08452, NULL, 'Dr.', 'Dr.', 'Diplom-Lehrer Biologie/Chemie', 'verheiratet, 3 Kinder', '03.07.1954', NULL, 'Döbern', 'männlich', NULL, '22.10.2013', 'Schulze', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadt Spremberg, Spremberg,<br/>Bürgermeister<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesamt für Naturschutz, Bonn, <br/>	Mitglied des Beirates der Internationalen Naturschutzakademie Insel Vilm (INA)<br/><br/>	Landkreis Spree-Neiße, Forst, <br/>	Mitglied des Kreistages', '1961/73 Schulzeit in Spremberg, 1973 Abitur. 1973/75 Grundwehrdienst in Cottbus. 1975/79 Studium in Potsdam, Abschluss Diplomlehrer für Biologie und Chemie. 1979/82 Lehrer in Spremberg und im Kreisgebiet; 1982/85 Aspirantur an der Zentrale für Wasservogelforschung der DDR, Bearbeitung ethologischer Fragestellungen, anschließend Promotion. 1985/90 Leiter "Station Junger Techniker und Naturforscher" in Spremberg. Seit Juli 1990 Amtsleiter und Dezernent im Landratsamt Spremberg.<br/>Seit 1993 Mitgl. der CDU. 1994/02 Beigeordneter des Landrates, Landkreis Spree-Neiße, 2002/13 Bürgermeister der Stadt Spremberg. - MdB seit Okt. 2013.', 'Klaus-Peter', '11004406');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08453, NULL, NULL, NULL, 'Dipl.-Betriebswirt (FH) Bürgermeister a. D.', 'verheiratet, 1 Kind', '03.03.1965', NULL, 'Berleburg', 'männlich', NULL, '22.10.2013', 'Schwarz', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Gemeinde Strullendorf, Strullendorf,<br/>Bürgermeister<br/><br/>Spielwaren - Schwarz, Strullendorf,<br/>Internetversand und Einzelhandel<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Sonnenstudio "Golden Sun" GbR, Strullendorf, <br/>	Geschäftsführer<br/>	Spielwaren - Schwarz, Strullendorf, <br/>	Internetversand und Einzelhandel<br/>	BOL, Niederlande, 2014, Stufe 2<br/>	Brandunit, Niederlande, 2014, Stufe 1<br/>	NUDRA BV, Niederlande, 2014, Stufe 4<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Bamberg, Bamberg, <br/>Mitglied des Kreistages<br/><br/>Sparkasse Bamberg, Bamberg, <br/>Mitglied der Verbandsversammlung<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Sonnenstudio "Golden Sun" GbR, Strullendorf', 'Vier Jahre Grundschule Strullendorf; zwei Jahre Hauptschule Strullendorf; vier Jahre Realschule Hirschaid mit Abschluss "Mittlerer Reife"; zwei Jahre Fachoberschule Bamberg; Studium der Betriebswirtschaftlehre mit dem Abschluss Dipl.-Betriebswirt (FH) in den Schwerpunkten Steuerrecht und Außenhandel an der Georg-Simon-Ohm-Hochschule Nürnberg. 1992 selbstständig; 1996/2013 hauptamtlicher Erster Bürgermeister der Gemeinde Strullendorf. Sozialverband VdK Deutschland; Dienstleistungsgewerkschaft ver.di; Arbeiterwohlfahrt; Wasserwacht; Feuerwehr; diverse Sportvereine. 1990/96 Gemeinderat in Strullendorf; 2002 Kreisrat im Kreistag zu Bamberg; 2008 Vorsitzender des SPD-Kreisverbandes Bamberg/Land; 2011 Beisitzer im SPD-Bezirk Oberfranken; 2012 stellvertretender Vorsitzender SPD-Unterbezirks Bamberg/Forchheim.  - MdB seit Okt. 2013.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 238 (Coburg)<br/>Wahlkreis 240 (Kulmbach)', 'Andreas', '11004407');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08454, NULL, NULL, NULL, 'Rechtsanwalts-, Notarfachangestellte', 'ledig', '12.09.1976', NULL, 'Berlin', 'weiblich', NULL, '22.10.2013', 'Schwarzer', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Jones Lang LaSalle GmbH, Frankfurt/Main,<br/>Angestellte, Property Manager<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>CBRE GmbH, Frankfurt/Main,<br/>Kaufmännische Angestellte<br/><br/>Funktionen in Unternehmen: <br/>Trägerwerk Soziale Dienste AG, Weimar,<br/>Mitglied des Kuratoriums<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Elly Heuss-Knapp Stiftung - Deutsches Müttergenesungswerk, Berlin,<br/>Mitglied des Kuratoriums', '1983 bis 1989 Besuch der Evangelischen Grundschule Neukölln; 1989 bis 1996 Besuch des Albert-Schweitzer-Gymnasiums mit Abschluss Abitur; 1996 bis 1999 Ausbildung zur Rechtsanwalts- und Notarfachangestellten. 1999 bis 2007 Rechtsanwaltsfachangestellte in einer mittelständigen Rechtsanwaltskanzlei in Berlin-Wedding; 2002 bis 2005 Wahlkreismitarbeiterin von Verena Butalikakis, MdB. 2007/13 Property Manager in einer internationalen Immobilienberatungsfirma in Berlin. Mitgl. im Unionshilfswerk, Lebenshilfe e. V. und Verein Freunde Neuköllns e. V.; Mitgl. in folgenden Fördervereinen: Förderverein der Evangelischen Schule Neukölln e.V.; Förderverein Annedore-Leber Berufsbildungswerk Berlin e. V.; Verein zur Förderung des Britzer Weinguts e. V.; Förderverein der Freiwilligen Feuerwehr Rudow e. V. Mitgl. cnetz-Verein für Netzpolitik, seit 2015 stellv. Sprecherin im cnetz, Kuratoriumsmitgl. Trägerwerk Soziale Dienste AG und Müttergenesungswerk. Mitgl. der CDU Neukölln seit 1996; Mitgl. des Vorstandes des Kreisverbandes Neukölln seit 2001; Delegierte der CDU Berlin zum Bundesparteitag seit 2011; 1999 bis 2005 Mitgl. im Vorst. der Jungen Union Neukölln; 2003 bis 2005 Mitgl. des Landesvorst. der Jungen Union Neukölln; 2003 bis 2005 Kreisvors. der Jungen Union Neukölln; 2013/15 Kreisvors. der Frauen Union Neukölln, seit 2015 stellv. Landesvors. der Lesben und Schwulen in der Union Berlin. 1999/Okt. 2013 Mitglied der Bezirksverordnetenversammlung von Berlin-Neukölln, 2006 bis 2009 stellv. Fraktionsvors., 2009/Okt. 2013 Fraktionsvors. Englisch (G), Französisch (G). - MdB seit Okt. 2013.', 'Christina', '11004408');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08456, NULL, NULL, NULL, 'Volljurist', 'verheiratet', '04.03.1975', NULL, 'Ilmenau', 'männlich', NULL, '22.10.2013', 'Sorge', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Ministerium für Wissenschaft und Wirtschaft des Landes Sachsen-Anhalt, Magdeburg,<br/>Jurist', '1993 Abitur. Bundeswehr. Studium der Rechtswissenschaften an den Univ. Jena, Halle und Lyon, Jur. Referendariat, Erstes und Zweites Jur. Staatsexamen, Stipendiat der Konrad-Adenauer-Stiftung. Anschließend tätig als Wirtschaftsanwalt und Unternehmensjurist. 2006/09 wiss. Referent der CDU-Fraktion im Landtag von Sachsen-Anhalt. 2010/13 Leitungsstab Ministerium für Wissenschaft und Wirtschaft Sachsen-Anhalt, u. a. als Persönlicher Referent der Ministerin. 1993/12 Mitgl. der JU, seit 1995 Mitgl. der CDU, 2008/12 Vors. des Bundesschiedsgerichts der JU Deutschlands, 2001/03 Landesvors. des RCDS Sachsen-Anhalt; seit 2004 Mitgl. des CDU-Kreisvorst. Magdeburg, seit 2010 stellv. Vors. des CDU-Kreisverb. Magdeburg; Mitgl. im Landesvorstand der Mittelstands- und Wirtschaftsvereinigung der CDU. 2012/15 Vors. des Landesarbeitskreises Christlich-Demokratischer Juristen (LACDJ) Sachsen-Anhalt. - MdB seit Okt. 2013.', 'Tino', '11004409');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08457, NULL, NULL, NULL, 'Oberstudienrat', 'verheiratet, 3 Kinder', '27.01.1956', NULL, 'Erpen (jetzt Dissen)', 'männlich', NULL, '22.10.2013', 'Spiering', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Berufsbildende Schulen des Landkreises Osnabrück, Osnabrück,<br/>Berufsschullehrer, Oberstudienrat<br/><br/>Funktionen in Unternehmen: <br/>BEVOS Beteiligungs- und Vermögensverwaltungsgesellschaft mbH Landkreis Onsabrück, Bohmte, <br/>Vorsitzender des Aufsichtsrates und Mitglied der Gesellschafterversammlung, ehrenamtlich<br/><br/>Energiegesellschaft Landkreis Osnabrück GmbH, Georgsmarienhütte, <br/>Stellv. Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>VARUSSCHLACHT im Osnabrücker Land GmbH - Museum und Park Kalkriese, Bramsche-Kalkriese, <br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Bad Rotenfelde, Bad Rotenfelde, <br/>Mitglied des Gemeinderates, ehrenamtlich<br/><br/>Landkreis Osnabrück, Osnabrück, <br/>Mitglied des Kreistages, jährlich, Stufe 3<br/><br/>MaßArbeit kAöR Kommunale Arbeitsvermittelung, Osnabrück, <br/>Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>Sparkasse Osnabrück, Osnabrück, <br/>Mitglied des Verwaltungsrates und der Zweckverbandsversammlung<br/><br/>Strukturkonferenz Osnabrück, Osnabrück, <br/>Stellv. Mitglied der Mitgliederversammlung', 'Ausbildung als Werkzeugmacher, Fachabitur. Studium zum Dipl.-Ingenieur, Studium zum Gewerbelehramt an der Univ. Hamburg. Oberstudienrat an der Berufsbildenden Schule Brinkstraße, Osnabrück. Seit 1976 Mitgl. der SPD. Seit 1991 Ratsmitgl. und SPD-Fraktionsvors. in der Gemeinde Bad Rothenfelde, seit 1996 Mitgl. Kreistag Osnabrück-Land, 2000/15 Vors. der SPD-Kreistagsfraktion Osnabrück-Land. Mitgl. AWO und IG  Bergbau, Chemie, Energie. Mitgl. TuS Aschenstrang, Schützenvereine Erpen und Strang, SV Bad Rothenfelde, Kunst- und Kulturverein Dissen, evangelisch-lutherische Jesus-Christus-Kirchengemeinde in Bad Rothenfelde, Gradierwerksverein, Freunde des Rosengartens.- MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 39 (Stadt Osnabrück)', 'Rainer', '11004410');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08458, NULL, NULL, NULL, 'Polizeibeamter', 'verheiratet, 2 Kinder', '26.09.1957', NULL, 'Rheydt', 'männlich', NULL, '22.10.2013', 'Spinrath', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Staatskanzlei des Landes Nordrhein-Westfalen, Düsseldorf,<br/>Koordinierung der Landesregierung für den Ausschuss der Region bei der EU (AdR)', '1966/74 Hugo-Junkers-Gymnasium in Rheydt, Mittlere Reife. 1974/77 Ausbildung zum Polizeibeamten in Linnich. 1980/81 Fachhochschulreife, 1981/84 Studium FH für öffentliche Verwaltung in Duisburg, geh. Polizeidienst, Dipl.-Verwaltungswirt. 1977/80 polizeilicher Streifendienst in Rheydt, 1984/87 Führungsaufgaben im operativen Polizeidienst in Mönchengladbach, 1987/90 freigestelltes Personalratsmitgl. Polizeipräsidium Mönchengladbach, 1990/98 beim Polizeibezirkspersonalrat Bezirksregierung Düsseldorf; 1998/01 hauptamtlich Bundesvors. GdP. 2001/05 Landesvertretung NRW EU in Brüssel, 2005/10 Innenministerium NRW, 2010/13 Europaabteilung Staatskanzlei NRW, Koordinierung der Landesregierung für den Ausschuss der Regionen der Europäischen Union (AdR). Mitgl. GdP seit 1974, Pressesprecher, langjähriger Kreisgruppenvors. Mönchengladbach, 1994/99 Bezirksverbandsvors. Düsseldorf und stellv. Landesvors. NRW, 1996/98 stellv. Bundesvors., 1998/01 hauptamtl. Bundesvors. GdP sowie Vizepräs. UISP (internationaler Dachverband der Polizeigewerkschaften, heute EuroCOP). Mitgl. DGB, 1984/98 DGB-Kreisvorst. MG, 1994/98 DGB-Landesvorst. NRW, 1998/01 DGB-Bundesvorst. Mitgl. u. a. International Police Association (IPA), Verein "Gegen Vergessen-für Demokratie", Bündnis gegen Rechts im Kreis Heinsberg, DKMS-Deutsche Knochenmarkspende e. V., AWO. Mitgl. SPD seit 1988, seit 2005 stellv. Vors. Ortsverein Geilenkirchen, seit 2006 Vors. Unterbez. Kreis Heinsberg, seit 2006 Mitgl. Regioausschuss Aachen und im Regionalausschuss Mittelrhein.  - MdB seit Okt. 2013; seit Jan. 2014 Europapolitischer Sprecher der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 88 (Aachen II)', 'Norbert', '11004411');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08459, NULL, NULL, NULL, 'PR-Senior-Beraterin', 'verheiratet', '26.08.1976', NULL, 'Oldenburg (Oldenburg)', 'weiblich', NULL, '22.10.2013', 'Stadler', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Straub & Linardatos GmbH, Hamburg,<br/>PR-Senior-Beraterin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Seevetal, Seevetal/OT Hittfeld, <br/>Beratendes Mitglied im Ausschuss Familie, Jugend, Senioren, ehrenamtlich', 'Abitur. Ausbildung zur Werbekauffrau mit Schwerpunkt PR. Beratung von Unternehmen überwiegend aus der Informationstechnologie- und Telekommunikationsbranche auf dem Gebiet der Presse- und Öffentlichkeitsarbeit als PR-Assistentin, PR-Junior-Beraterin, PR-Beraterin und PR-Senior-Beraterin; als Teamleiterin verantwortlich für Personal und Budget. - MdB seit Okt. 2013.', 'Svenja', '11004412');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08460, NULL, NULL, NULL, 'Marketing- und Kommunikationsmanagerin, Betriebsrätin', 'geschieden, 2 Kinder', '23.04.1965', NULL, 'Erlangen', 'weiblich', NULL, '22.10.2013', 'Stamm-Fibich', NULL, 'SPD', NULL, 'evangelisch-reformiert', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Siemens AG, Erlangen,<br/>Marketing- und Kommunikationsmanagerin, freigestellte Betriebsrätin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Möhrendorf, Möhrendorf, <br/>	Mitglied des Gemeinderates, ehrenamtlich (bis Februar 2016)<br/>	<br/>Landkreis Erlangen-Höchstadt, Erlangen, <br/>	Mitglied des Kreistages, ehrenamtlich', '1981 Mittlere Reife. 1981/83 Ausbildung zur Rechtsanwaltsfachangestellten. 1983/85 tätig im Ausbildungsberuf, 1986/89 Assistenz der Geschäftsleitung eines mittelständischen Dienstleistungsunternehmens, seit 1989 Siemens AG Healthcare Sector Erlangen, zuletzt freigestellte Betriebsrätin. Mitgl. der IG Metall und der Arbeiterwohlfahrt. Englisch (f). - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 246 (Roth)', 'Martina', '11004413');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08462, NULL, 'Dr.', 'Dr.', 'Diplom-Betriebswirt (FH)', 'keine Angaben', '20.04.1985', NULL, 'München', 'männlich', NULL, '22.10.2013', 'Stefinger', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Barmer GEK, München,<br/>Referent<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landeshauptstadt München, München, <br/>	Mitglied des Bezirksausschusses 16, ehrenamtlich (bis 30.04.2014)', '2001 Realschulabschluss, 2003 Fachhochschulreife. 2003/04 Zivildienst. 2004/09 Studium der Betriebswirtschaftslehre, Dipl.-Betriebswirt (FH). 2009/11 wissenschaftl. Mitarbeiter und Doktoratstudium, 2011 Promotion zum Dr. phil., 2011/13 Referent bei einer Krankenkasse. Mitgl. der Jungen Union seit 1999, der CSU seit 2001, 2009/11 Vors. der Jungen Union München, seit 2009 Ortsvors. der CSU Waldperlach und stellv. Kreisvors. der CSU München-Ost. - MdB seit Okt. 2013.', 'Wolfgang', '11004414');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08463, NULL, NULL, NULL, 'Landwirtschaftsmeister', 'ledig', '09.03.1976', NULL, 'Nordhorn', 'männlich', NULL, '22.10.2013', 'Stegemann', NULL, 'CDU', NULL, 'evangelisch-reformiert', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Landwirtschaftsbetrieb Albert Stegemann, Großringe,<br/>	Landwirtschaftsmeister<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Landwirtschaftsbetrieb Albert Stegemann, Großringe,<br/>Betriebsleiter<br/>   Vertragspartner 1, Evert Heerspink, Laar, 2013, Stufe 2<br/>   Vertragspartner 2, Klaus Gebing, Vieh- und Fleischhandel, Legden, 2013, Stufe 3;<br/>   2014, Stufe 5; 2015, Stufe 6; 2016, Stufe 8<br/>   Vertragspartner 3, Kooperative Milchverwertung e.G, Emlichheim, 2013, Stufe 10;<br/>   2014, Stufe 10; 2015, Stufe 10; 2016, Stufe 10<br/>   Vertragspartner 4, Masterrind GmbH, Bad Zwischenahn, 2013, Stufe 5; <br/>   2014, Stufe 6<br/>   Vertragspartner 5, GDF SUEZ E&P Deutschland GmbH, Lingen, 2014, Stufe 1<br/>   Vertragspartner 6, Overhoff Viehandlung Estringen GmbH & Co. KG, 2015, Stufe 1<br/>   Vertragspartner 7, Friese Landmaschinen GmbH, 2015, Stufe 4<br/>   Vertragspartner 8, Vette Agro Service GmbH & Co. KG, Hoogstede, 2016, Stufe 4<br/><br/>Funktionen in Unternehmen: <br/>	Grafschafter Volksbank eG, Nordhorn, <br/>	Mitglied der Vertreterversammlung<br/><br/>	Kooperative Milchverwertung Emlichheim-Laarwald-Wielen-Wilsum eG, Emlichheim, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Molkereigenossenschaft Emlichheimer Milch eG, Emlichheim, <br/>	Vorsitzender des Aufsichtsrates (bis 31.12.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>		Ludwig-Windthorst-Stiftung, Lingen-Holthausen, <br/>	Mitglied des Kuratoriums', 'Bis 1992 Realschule Emlichheim. 1992/93 Berufsgrundbildungsjahr Agrarwirtschaft, 1993/95 betriebliche Ausbildung mit Abschlussprüfung. 1995/96 Wehrdienst bei der Bundeswehr in Lingen. 1997/98 einjährige Fachschule Agrarwirtschaft, 2002 Abschlussprüfung staatl. gepr. Landwirtschaftsmeister. 1998/01 Mitarbeiter auf dem landw. Familienbetrieb, 2001 Übernahme des Familienbetriebes, z. Zt. Betriebsleiter eines Milchviehbetriebes. 1994 Eintritt in die Junge Union, 2002 Eintritt in die CDU, 2003/09 Bezirksvors. der Jungen Union Osnabrück-Emsland, seit 2010 Mitgl. CDU-Bezirksvorst., seit Februar 2012 CDU-Vors. der Samtgemeinde Emlichheim. - MdB seit Okt. 2013.', 'Albert', '11004415');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08465, NULL, NULL, NULL, 'Diplom-Ingenieur', 'verheiratet, 2 Kinder', '18.01.1968', NULL, 'Siegen', 'männlich', NULL, '22.10.2013', 'Stein', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Hansestadt Rostock, Rostock,<br/>Angestellter Dipl. Ingenieur', 'Universitätsabschluss als Dipl.-Ing. Architekt für Stadtplanung. 1994/06 und seit 2012 angestellter Stadtplaner der Hansestadt Rostock.  CDU-Mitgl. seit 1998. Seit 1999 Mitgl. im Kreistag, Abgeordneter im Kreistag des Landkreises Rostock, Vors. Ausschuss für Wirtschaft, Landwirtschaft, Verkehr und Kreisentwicklung; Mitgl. Landesarbeitskreis Wirtschaft und Verkehr  Landkreistag Mecklenburg-Vorpommern. 2006/11 MdL Mecklenburg-Vorpommern, Arbeitskreisleiter Verkehr, Bau, Landesentwicklung und Enquete-Kommission und Integrationspolitischer Sprecher. Vors. "Verein für Demokratie und Gesellschaft e. V.", Mitgl. Förderverein Freizeit und Begegnungsstätte Mönchhagen e. V., Förderverein zur Entwicklung und Erhaltung des Kirchenensembles Graal Müritz e. V., Rostock denkt 365°,  ADFC Rostock. Englisch (f), Französisch (G). - MdB seit Okt. 2013; Mitgl. Ostseeparlamentarierkonferenz.', 'Peter', '11004416');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08467, NULL, NULL, NULL, 'Rechtsanwalt', 'verheiratet, 2 Kinder', '19.06.1973', NULL, 'Hamburg', 'männlich', NULL, '22.10.2013', 'Steineke', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwalt, Neuruppin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, Neuruppin<br/>Mandant 1, 2013, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>PRO Klinik Holding GmbH, Neuruppin,<br/>Stellv. Mitglied der Gesellschafterversammlung<br/><br/>REG Regionalentwicklungsgesellschaft Nordwestbrandenburg mbH, Neuruppin,<br/>Mitglied des Beirates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Ostprignitz-Ruppin, Neuruppin,<br/>Mitglied des Kreistages, Fraktionsvorsitzender<br/><br/>Regionale Planungsgemeinschaft Prignitz-Oberhavel, Neuruppin,<br/>Stellv. Mitglied der Regionalversammlung<br/><br/>Stadt Neuruppin, Neuruppin,<br/>Mitglied der Stadtverordnetenversammlung<br/><br/>Stiftung Soziales Neuruppin, Neuruppin,<br/>Mitglied des Kuratoriums', '1992 Abitur. 1992/2000 Studium der Rechtswissenschaften in Hamburg, 2001/03 Referendariat. 2000/01 FAVORIT Unternehmens-Verwaltungs GmbH. 2003 bis heute Rechtsanwalt. Mitgl. der CDU. Seit 2011 Mitgl. des Kreistages Ostprignitz-Ruppin, seit 2014 Fraktionsvors. im Kreistag. Mitgl. Deutscher Anwaltverein, Haus und Grund OPR, Verschönerungsverein Neuruppin. - MdB seit Okt. 2013.', 'Sebastian', '11004417');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08468, NULL, NULL, NULL, 'Referendar', NULL, '18.06.1987', NULL, 'Bad Dürkheim', 'männlich', NULL, '22.10.2013', 'Steiniger', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Rheinland-Pfalz, Mainz,<br/>Studienreferendar<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Land Rheinland-Pfalz, Mainz, <br/>Studienreferendar, monatlich, Stufe 1 (bis 31.01.2016)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Bad Dürkheim, Bad Dürkheim, <br/>Mitglied des Stadtrates und Mitglied des Ortsbeirates Seebach<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>OMEGA Freundes- und Förderkreis e.V., Bad Dürkheim,<br/>Vorsitzender', '1997/06 Werner-Heisenberg-Gymnasium in Bad Dürkheim, Abitur. 2007 Studium auf Lehramt für Gymnasien in den Fächern Mathematik und Politikwissenschaften Univ.  Mannheim, 2013 1. Staatsexamen, Referendariat am Rudi-Stephan-Gymnasium in Worms, Stipendiat der Konrad-Adenauer-Stiftung, seit Febr. 2016 Gymnasiallehrer für Mathematik und Gemeinschaftskunde. 2002 Eintritt in die Junge Union, seit 2003 Mitgl. der CDU, Mitgl. im Orts- und Kreisvorstand der CDU Bad Dürkheim, seit 2005 Vors. der Jungen Union Bad Dürkheim, seit 2010 Vors. der Jungen Union Rheinland-Pfalz, Mitgl .im Bezirksvorstand der CDU Rheinhessen-Pfalz und im Landesvorstand der CDU Rheinland-Pfalz. Seit 2009 Mitgl. im Ortsbeirat Seebach und im Stadtrat Bad Dürkheim. DFB-Trainer-C-Lizenz, Mitgl. im Fußballverein SV Rot-Weiß Seebach, dort seit 2003 Trainer versch. Jugendmannschaften. - MdB seit Okt. 2013.', 'Johannes', '11004418');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08469, NULL, NULL, NULL, 'Mitarbeiterin im familiären Betrieb', 'verheiratet', '01.11.1967', NULL, 'Haltern am See', 'weiblich', NULL, '22.10.2013', 'Stockhofe', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Georg Stockhofe, Haltern am See,<br/>Mitarbeiterin im landwirtschaftlichen Familienunternehmen', '1987 Abitur am Gymnasium in Haltern. 1987/90 Ausbildung zur Fleischerin und Tätigkeit in dem Beruf. 1990/93 Ausbildung zur Postbeamtin im mittleren Dienst und Tätigkeit in dem Beruf; seit 1993 Mitarbeit im landwirtschaftlichen Betrieb des Ehemanns, incl. Weiterbildungsmaßnahmen im landwirtschaftlichen Bereich. Mitgl. im Verein "Behinderte wohnen in Haltern"; Mitgl. der Kath. Frauengemeinschaft Deutschland (kfd) und Mitgl. im Landfrauenverband, ehrenamtlich tätig in der Kirche am Ort. Seit März 2003 Mitgl. der CDU, sieben Jahre Vors. der Frauen Union Haltern, bis Nov. 2013 stellv. Vors., Vors. der Frauen Union Kreis Recklinghausen, Vors. im Ortsverband Haltern am See - Flaesheim. März 2011/Mai 2014 Mitgl. im Rat der Stadt Haltern am See, Mitgl. im Bau- und Verkehrsausschuss, stellv. Mitgl. im Stadtentwicklungsausschuss und im Umweltausschuss. Englisch (G), Französisch (G). - MdB seit Okt. 2013.', 'Rita', '11004419');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08470, NULL, NULL, NULL, 'Rechtsanwalt', '1 Kind', '22.09.1957', NULL, 'Hamburg', 'männlich', NULL, '22.10.2013', 'Stritzl', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwalt, Kiel<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwalt, selbständig, Kiel<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Förde Sparkasse, Kiel, <br/>Mitglied des Verwaltungsrates', 'Wehrdienst bei der Bundesmarine. Abitur am Nordseegymnasium in St. Peter-Ording. Jura-Studium, Zweites Staatsexamen. Rechtsanwalt. Justitiar und Geschäftsführer von Kieler Unternehmen. 1976 Eintritt in die JU und CDU, 1978/80 Kreisvors. der JU Nordfriesland, 1981/87 Mitgl. Bundesvorst. der JU Deutschland, 1986/92 Landesvors. der JU Schleswig-Holstein; 1991/02 stellv. Landesvors., seit 2003 Kreisvors. der CDU Kiel. 1987/09 MdL Schleswig-Holstein. - MdB seit Okt. 2013.', 'Thomas', '11004420');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08472, NULL, 'Dr.', 'Dr.', 'Rechtsanwältin', 'verheiratet, 2 Kinder', '15.02.1958', NULL, 'Reinbek', 'weiblich', NULL, '22.10.2013', 'Sütterlin-Waack', NULL, 'CDU', NULL, 'evangelisch', NULL, NULL, NULL, 'Sabine', '11004421');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08473, NULL, NULL, NULL, 'Migrantenbeauftragte a.D.', 'verheiratet, 2 Kinder', '01.01.1950', NULL, 'Yukaribalakur, Türkei', 'weiblich', NULL, '22.10.2013', 'Tank', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Bezirksamt Charlottenburg-Wilmersdorf, Berlin,<br/>Angestellte Migrantenbeauftragte<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kulturakademie Tarabya, Istanbul, <br/>	Mitglied des Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Eberhard-Schultz-Stiftung für soziale Menschenrechte und<br/>	Partizipation, Berlin, <br/>	Mitglied des Vorstandes<br/><br/>	Förderverein Pangea-Haus e.V., Berlin, <br/>	Mitglied des Beirates', 'Abitur. Arbeit als Beamtin in Istanbul, zunächst Arbeiterin, dann Sozialarbeiterin und währenddessen Zusatzausbildung als Sozialberaterin auf dem zweiten Bildungsweg. 1990 Ernennung zur ersten Migrantenbeauftragten von Charlottenburg/Wilmersdorf; 2009 vorzeitiger Ruhestand nach fast zwanzigjähriger Tätigkeit. Zuerst in der Westberliner Frauen- und Friedensbewegung aktiv, besonderes Anliegen, Menschen verschiedener Herkunftsländer, Kulturen und Religionen zu vernetzen und ihnen eine Plattform zu schaffen, um so ihren Platz in der Mehrheitsgesellschaft zu behaupten. Gründerin, Vorstandsmitgl., Vors. oder Sprecherin u. a. im Türkischen Frauenverein, im Westberliner Komitee für die Rechte der Frau, im Türkischen Bund Berlin-Brandenburg, in der Berliner Initiative gegen Gewalt gegen Frauen sowie als Migrantenbeauftragte. Beiratsmitgl. im "Pangea-Haus" Bezirksamt Charlottenburg-Wilmersdorf. 2011 gemeinsam mit dem Ehemann Gründung der Eberhard Schultz-Stiftung für soziale Menschenrechte und Partizipation mit Sitz in Berlin, die es sich zur Aufgabe gemacht hat, die sozialen Menschenrechte im Sinne der UN-Charta von 1966 zu stärken. Kein Parteimitglied. - MdB seit Okt. 2013; Sprecherin für Soziale Menschenrechte der Fraktion DIE LINKE.', 'Azize', '11004422');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08474, NULL, NULL, NULL, 'Diplom-Geographin', 'ledig', '22.07.1964', NULL, 'Vilsbiburg', 'weiblich', NULL, '22.10.2013', 'Tausend', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Funktionen in Unternehmen: <br/>Olympiapark München GmbH, München, <br/>Mitglied des Aufsichtsrates (bis 27.11.2013)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Rat der Gemeinden und Regionen Europas (RGRE)/Deutsche Sektion, Köln, <br/>Mitglied des Präsidiums', 'Studium der Wirtschaftsgeographie, Politik und Landwirtschaft an der Technischen Universität München, Abschluss 1992. 1990 Eintritt in die SPD, 1990/96 aktive Mitarbeit bei den Jusos in München und Oberbayern, div. Funktionen, 2007/14 stellv. Vors. der SPD München, seit 2009 stellv. Vors. der Oberbayern SPD, 2013/15 Beisitzerin im Vorst. der Oberbayern SPD, seit Nov. 2014 Vors. der Münchner SPD. 1996/2013 Stadträtin Landeshauptstadt München, stellv. Sprecherin der SPD im Planungsausschuss, Mitgl. Finanzausschuss, seit 1999 Leiterin Arbeitskreis "Europa und Internationale Politik", 2005/13 stellv. Vors. der SPD-Stadtratsfraktion. Mitgl. AWO, Mieterverein, IG Metall, attac, Wirtschaftsforum der Münchner SPD, Trägerverein Kulturhaus Milbertshofen, Freundinnen und Freunde Milbertshofen, Männerchor Milbertshofen, Maibaumverein Berg am Laim, Junge Arbeit Neuperlach, Förderverein des Krankenhauses Bogenhausen. - MdB seit Okt. 2013; stellv. europapolitische Sprecherin der SPD-Fraktion, Mitgl. der Arbeitsgruppe Kommunalpolitik; Mitgl. Deutsch-Baltische Parlamentariergruppe, Mitgl. Parlamentariergruppe Französischsprachige Staaten West- und Zentralafrikas.<br/><br/>Betreute Wahlkreise:<br/>Wahlkreis 220 (München-Süd)<br/>Wahlkreis 222 (München-Land)', 'Claudia', '11004423');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08476, NULL, NULL, NULL, 'Diplom-Chemieingenieur', 'ledig, 1 Kind', '06.09.1964', NULL, 'Bremerhaven', 'männlich', NULL, '22.10.2013', 'Thews', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Referent für Umwelt und Arbeitsschutz, Dortmund<br/><br/>Innovatherm GmbH, Lünen,<br/>Prokurist, Umweltbeauftragter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkasse Lünen, Lünen, <br/>	Mitglied des Verwaltungsrates (bis 31.08.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>AWO Kreisverband Unna, Kamen,<br/>Revisor<br/><br/>AWO Ortsverein Lünen-Nord, Lünen,<br/>Vorsitzender<br/><br/>Bürgermeister-Harzer-Stiftung, Lünen,<br/>Mitglied des Kuratoriums<br/><br/>Heinrich-Bußmann-Bildungs-Stiftung, Lünen,<br/>Mitglied des Vorstandes', 'Diplom Chemie-Ingenieur, Univ. Paderborn. Umweltbeauftragter, Interner Auditor, Fachkraft für Arbeitssicherheit, Prokurist und Umweltbeauftragter der INNOVATHERM GmbH in Lünen; freiberuflicher Referent für die Concada GmbH (Abfallwirtschaft, Arbeitssicherheit). Seit 1997 Mitgl. der SPD, seit 2003 Mitgl. Vorst. SPD-Ortsverein Altlünen, seit 2005 stellv. Vors. im SPD-Ortsverein Altlünen, seit 2005 Mitgl. SPD-Stadtverbandsvorst. Lünen, 2007/09 stellv. Stadtverbandsvors. SPD Lünen, seit 2009 Stadtverbandsvors. - MdB seit Okt. 2013.', 'Michael', '11004424');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08477, NULL, NULL, NULL, 'Geschäftsführerin', 'verheiratet', '22.06.1963', NULL, 'Marl', 'weiblich', NULL, '22.10.2013', 'Timmermann-Fechter', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>CDU Landesverband Nordrhein-Westfalen, Düsseldorf,<br/>Kreisgeschäftsführerin<br/><br/>Selbständige Unternehmerin/Veranstaltungs- und Marketingbüro, Marl<br/><br/>Funktionen in Unternehmen: <br/>Neue Marler Baugesellschaft mbH, Marl, <br/>Vertreterin der Stadt Marl in der Gesellschafterversammlung (bis 15.03.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkasse Vest, Recklinghausen, <br/>Stellv. Mitglied des Zweckverbandes (bis 15.03.2014)<br/><br/>Stadt Marl, Marl, <br/>Ratsmitglied und Stellv. Bürgermeisterin (bis 15.03.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Theodor Fliedner Stiftung, Mülheim an der Ruhr,<br/>Mitglied des Kuratoriums', 'Abitur. Studium der Rechtswissenschaften. Selbstständige Unternehmerin/Veranstaltungs- und Marketingbüro. Kreisgeschäftsführerin der CDU Mülheim an der Ruhr. Mitgl. in diversen kulturellen und sozialen Vereinen. Seit 1998 Mitgl. der CDU, 2000/14 Ortsverbandsvors., 2005/13 stellv. CDU-Kreisschatzmeisterin; 2005/14 Kreisvors. EAK, 2007/13 Mitgl. Landesvorst. EAK NRW. 2004/14 Ratsmitgl., 2004/09 stellv. Fraktionsvors., 2007/09 Vors. Bau-, Verkehr-, Stadtplanungs- und Wirtschaftsförderungsausschuss, 2007/09 Fraktionsgeschäftsführerin, 2009/12 Vors. Bau- und Verkehrsausschuss, 2009/14 stellv. Bürgermeisterin. Seit Okt. 2015 Kreisvors. CDU Mülheim an der Ruhr. - MdB seit Okt. 2013.', 'Astrid', '11004425');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08478, NULL, NULL, NULL, 'Koordinator Kommunikation', 'verheiratet, 2 Kinder', '25.10.1973', NULL, 'Fürth', 'männlich', NULL, '22.10.2013', 'Träger', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Sparkasse Fürth, Fürth,<br/>Koordinator Kommunikation', 'Studium der Politikwissenschaft, Medienwissenschaft und Geschichte an der Friedrich-Alexander-Univ. in Erlangen, berufsbegleitend Abschluss als Diplom-Kommunikationswirt an der Bayerischen Akademie für Werbung in Nürnberg. Volontariat zum PR-Berater in der Nürnberger Agentur König Kommunikation GmbH, anschl. selbstständiger Werbeberater. 2010/13 Koordinator in der Werbeabteilung der Sparkasse Fürth. Seit 2011 Vors. SPD-Unterbezirk Fürth, seit 2014 Vors. SPD-Bezirk Mittelfranken. 2002/13 Stadtrat in Fürth. - MdB seit Okt. 2013.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 241 (Ansbach)', 'Carsten', '11004426');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08480, NULL, 'Dr.', 'Dr.', 'Jurist, Dipl.-Kaufmann, Stadtrat', 'keine Angaben', '14.10.1975', NULL, 'Illertissen', 'männlich', NULL, '22.10.2013', 'Ullrich', NULL, 'CSU', NULL, 'katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadt Augsburg, Augsburg,<br/>Stadtrat und Ordnungsreferent', '1995 Abitur am Erasmus-Gymnasium in Amberg. 1996/01 Studium der Rechtswissenschaften und der Betriebswirtschaftslehre Univ. Augsburg und Fern-Univ. Hagen; Stipendiat der Konrad-Adenauer-Stiftung; 2001 Erstes jur. Staatsexamen, 2002 Promotion zum Dr. jur., 2004 Examen als Dipl.-Kaufmann (Univ.), 2004 Zweites jur. Staatsexamen. 2002/04 Rechtsreferendar. 2005/11 Tätigkeit als Rechtsanwalt in mittelständischen und internationalen Sozietäten. 2011/13 Berufsmäßiger Stadtrat und Leiter des Ordnungsreferats der Stadt Augsburg. Seit 1992 Mitgl. CSU; 1994/95 Landesvors. Schüler-Union Bayern, 1998/99 Landesvors. RCDS in Bayern, 2001/09 Bezirksvors. der Jungen Union Augsburg, seit 2011 stellv. Bezirksvors. der CSU-Augsburg. 2002/11 Stadtrat der Stadt Augsburg. 2003/13 Mitgl. Rechts- und Verwaltungsausschuss des Bayerischen Städtetags. Englisch (f), Französisch (f), Italienisch (f), Spanisch (f), Niederländisch (G). - MdB seit Okt. 2013.', 'Volker', '11004427');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08482, NULL, NULL, NULL, 'Erster Kreisbeigeordneter a.D.', 'verheiratet, 1 Kind', '16.05.1961', NULL, 'Ober-Wöllstadt', 'männlich', NULL, '22.10.2013', 'Veith', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Wetteraukreis, Friedberg,<br/>	Erster Kreisbeigeordneter des Kreisausschusses<br/><br/>Funktionen in Unternehmen: <br/>ekom21 GmbH, Gießen,<br/>Vorsitzender des Aufsichtsrates, ehrenamtlich<br/><br/>GZW Gesundheitszentrum Wetterau gemeinnützige GmbH, Friedberg,<br/>Mitglied des Aufsichtsrates, ehrenamtlich (bis 31.10.2016)<br/><br/>HLB Basis AG, Frankfurt/Main,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>MIEG Mittelhessische Energiegenossenschaft eG, Butzbach,<br/>Mitglied des Aufsichtsrates, ehrenamtlich (bis 30.04.2016)<br/><br/>OVAG GmbH, Friedberg,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>OVVG GmbH, Friedberg,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>saascom GmbH, Karlsruhe,<br/>Vorsitzender des Unternehmerbeirates, ehrenamtlich<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	ekom 21 - Kommunales Gebietsrechenzentrum Hessen, Gießen, <br/>	Mitglied des Verbandsvorstandes<br/><br/>	Wetteraukreis, Friedberg, <br/>	Kreisbeigeordneter, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Johanniter-Unfall-Hilfe e.V. Landesverband Hessen/Rheinland-Pfalz/Saar, Butzbach,<br/>Mitglied des Kuratoriums, ehrenamtlich<br/><br/>Lachen Helfen e.V., Essen,<br/>Mitglied des erweiterten Vorstandes, ehrenamtlich<br/><br/>Verband der Reservisten der Deutschen Bundeswehr e.V., Bonn,<br/>Präsident, ehrenamtlich', '1973 Burggymnasium Friedberg, 1980 Abitur. Studium der Rechtswissenschaften an der Justus-Liebig-Univ. Gießen, 1. und 2. jur. Staatsexamen. 1980/81 Grundwehrdienst, W 15. 1991 Rechtsanwalt, 1991 Regierungsrat, Bundesministerium der Verteidigung, Rechtsdozent, Rechtsberater und Wehrdisziplinaranwalt; 1994 Oberregierungsrat, wiss. Mitarbeiter am Bundesverwaltungsgericht, 1996 Regierungsdirektor, Hessischer Rechnungshof, Prüfungsgruppenleiter und persönlicher Referent des Präsidenten.  1998 Bürgermeister von Butzbach, 2006 Erster Kreisbeigeordneter des Wetteraukreises. Mitgl. in zahlreichen Gesellschaften und Vereinen. Seit 1985 Mitgl. der CDU. Seit 2010 Leiter einer Generalstabsabteilung einer Division des Deutschen Heeres, Oberst der Reserve, seit Nov. 2015 Stellvertreter des Präsidenten des Verbandes der Reservisten der Dt. Bundeswehr e. V., seit August 2016 Präsident. Seit 2012 Kreisvors. Kommunalpolitische Vereinigung CDU Wetterau. - MdB seit Okt. 2013.', 'Oswin', '11004428');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08483, NULL, 'Dr.', 'Dr.', 'Diplom-Umweltwissenschaftlerin', 'verheiratet', '18.01.1979', NULL, 'Bergisch Gladbach', 'weiblich', NULL, '22.10.2013', 'Verlinden', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Umweltbundesamt, Dessau-Roßlau,<br/>Wissenschaftliche Angestellte<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesnetzagentur für Elektrizität, Gas, Telekommunikation,<br/>Post und Eisenbahnen, Bonn,<br/>Stellv. Mitglied des Beirates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bundesverband BioEnergie e.V. (BBE), Bonn,<br/>Mitglied des Politischen/Wissenschaftlichen Beirates, ehrenamtlich<br/><br/>Bundesverband Erneuerbare Energie e.V. (BEE), Berlin,<br/>Stellv. Vorsitzende des Parlamentarischen Beirates, ehrenamtlich<br/><br/>Deutsche Unternehmensinitiative für Energieeffizienz e.V. - DENEFF, Berlin,<br/>Mitglied des Beirates, ehrenamtlich', '1998 Abitur. 2005 Diplom Umweltwissenschaften, Univ. Lüneburg, 2012 Promotion zum Dr. phil., Titel der Dissertation: "Energieeffizienzpolitik als Beitrag zum Klimaschutz - Analyse der Umsetzung der EU-Gebäude-Richtlinie in Deutschland (Bereich Wohngebäude)". 2005/06 Kreisgeschäftsführerin Bündnis 90/Die Grünen im Kreisverband Lüneburg. 2006/13 Wissenschaftl. Angestellte am Umweltbundesamt, Jan./Okt. 2013 Leitung des Fachgebiets "Energieeffizienz". 1998 Eintritt in die Partei Bündnis 90/Die Grünen, 1999/01 Mitgl. Landesvorst. der Grünen Jugend Niedersachsen, 2003/05 Beisitzerin im Landesvorstand Bündnis 90/Die Grünen Niedersachsen, 2005/07 und seit Nov. 2013 Mitgl. im Parteirat Bündnis 90/Die Grünen Niedersachsen. 2002/06 Ratsfrau im Stadtrat Lüneburg, 2006/11 Abgeordnete im Kreistag Lüneburg. Mitgl. u. a. Bund für Umwelt und Naturschutz Deutschland (BUND), The Compensators, der Gewerkschaft verdi, Verein zur Förderung politischen Handelns (v.f.h.), im Verkehrsclub Deutschland (VCD). - MdB seit Okt. 2013; Sprecherin für Energiepolitik der Fraktion Bündnis 90/Die Grünen, Vorstandsmitgl. Parlamentskreis Energieeffizienz des Bundestages.', 'Julia', '11004429');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08485, NULL, NULL, NULL, 'Bankkaufmann', 'verheiratet', '06.08.1973', NULL, 'Volkmarsen', 'männlich', NULL, '22.10.2013', 'Viesehon', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Raiffeisenbank Volkmarsen, Volkmarsen,<br/>Kundenberater<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Magistrat der Stadt Volkmarsen, Volkmarsen, <br/>Mitglied des Magistrats, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Hessischer Wasserverband Diemel, Hofgeismar, <br/>Mitglied der Verbandsversammlung, ehrenamtlich<br/><br/>Philippstiftung e.V., Immenhausen, <br/>Mitglied des Verwaltungsrates', 'Abitur. 1992/95 Ausbildung zum Bankkaufmann bei der Raiffeisenbank Volkmarsen eG. 1995/96 Grundwehrdienst. 1996/2000 Servicemitarbeiter bei der Raiffeisenbank Volkmarsen eG, seit 2000 Kundenberater bei der Raiffeisenbank Volkmarsen eG. 1989 Eintritt zur Jungen Union Volkmarsen, 1993 Vors. JU-Stadtverband Volkmarsen, 1994 Eintritt zur CDU Volkmarsen, seit Ende 2013 Stadtverbandsvors., 1996/98 stellv. Kreisvors. der JU Waldeck-Frankenberg, seit 2010 stellv. Vors. der CDU Waldeck-Frankenberg, seit 2015 stellv. Vors. der CDU Nordhessen, kooptiertes Mitgl. der CDU Kassel-Land, Mitgl. in den Wahlvorbereitungsausschüssen der CDU Waldeck-Frankenberg und der CDU Volkmarsen.1997/11 Fraktionsvors. der CDU Volkmarsen, seit 2011 Erster Stadtrat der Stadt Volkmarsen, stellv. Bürgermeister. - MdB seit Okt. 2013.', 'Thomas', '11004430');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08486, NULL, NULL, NULL, 'Bankkaufmann, Diplom-Ökonom', 'ledig', '16.11.1968', NULL, 'Hameln', 'männlich', NULL, '22.10.2013', 'Vietz', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>ING-DiBa AG, Hannover,<br/>Angestellter<br/><br/>Funktionen in Unternehmen: <br/>Hameln Marketing und Tourismus GmbH (HMT), Hameln, <br/>Mitglied des Aufsichtsrates<br/><br/>Zentrum für Internationale Friedenseinsätze gemeinnützige GmbH (ZIF), Berlin,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Auswärtiges Amt, Berlin,<br/>Mitglied des Beirates Zivile Krisenprävention<br/><br/>Landkreis Hameln-Pyrmont, Hameln, <br/>Mitglied des Kreistages<br/><br/>Stadt Hameln, Hameln, <br/>Mitglied des Stadtrates', '1988 Abitur am Fachgymnasium Wirtschaft, Hameln. 1988/90 Ausbildung zum Bankkaufmann bei der Deutschen Bank Hameln. 1990/91 Wehrdienst in Northeim und Hildesheim. 1991/2000 Studium der Wirtschaftswissenschaften an der Universität Hannover, Abschluss zum Diplom-Ökonom. Bereits während des Studiums 1995/2013 Mitarbeiter der ING-DiBa AG, Hannover, 2001/13 Teamleiter im Kundendialog der ING-DiBa AG, Hannover, 2007/13 Mitgl. im Betriebsrat der ING-DiBa AG, Hannover. 1987/2003 Mitgl. der Jungen Union, seit 1988 Mitgl. der CDU, 1997/2013 und seit 2015  Mitgl. im Bezirksvorstand der CDU Hannover, 1999/2004 Vors. CDU-Ortsverband Hameln-West, 2004/14 Vors. CDU-Stadtverband Hameln, seit 2014 Kreisvors. der CDU Hameln-Pyrmont. 2011/16 Mitgl. im Rat der Stadt Hameln, 2011/16 Abgeordneter im Kreistag Hameln-Pyrmont.  - MdB seit Okt. 2013.', 'Michael', '11004431');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08487, NULL, NULL, NULL, 'Oberstudienrat, Politikwissenschaftler', 'verheiratet', '15.04.1976', NULL, 'Rhede', 'männlich', NULL, '22.10.2013', 'Volmering', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Nordrhein-Westfalen, Düsseldorf,<br/>Oberstudienrat<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Sparkasse Westmünsterland, Dülmen, <br/>Mitglied des Sparkassen-Beirates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>EUREGIO e.V., Gronau, <br/>Beratendes Mitglied des EUREGIO-Rates', '1986/95 Privates Bischöfliches St.-Josef-Gymnasium Bocholt. 1995/96 Grundwehrdienst in Coesfeld. 1996/02 Studium Politikwissenschaften, Neuere und Neuste Geschichte und Wirtschaftspolitik Westfälische Wilhelms-Univ. in Münster, Abschluss Magister Artium; 2002/03 Studium der Erziehungswissenschaften Westfälische Wilhelms-Univ. Münster. 2004/06 Referendariat am Studienseminar für Lehrämter an Schulen in Bocholt, Ausbildungsschule Gymnasium Remigianum in Borken, Abschluss 2. Staatsexamen. 2006 Sozialwissenschafts-, Politik- und Geschichtslehrer am Kopernikus-Gymnasium in Neubeckum, Aug. 2006/Sept. 2013 Mariengymnasium Bocholt. 1991 Eintritt in die Junge Union, 1992 Eintritt in die CDU, 1992/01 JU-Stadtverbandsvors. Bocholt, 1996/03 Beisitzer im JU-Bezirksvorst. Münsterland, 2003/07 JU-Bezirksvors. Münsterland, 2006/12 JU-Landesvors. NRW, seit 1992 diverse Positionen auf CDU-Orts-, Stadt-, Kreis- und Bezirksverbandsebene, 2006/16 Mitgl. im CDU-Landesvorstand, 2010/14 stellv. Landesvors. der CDU NRW, Ehrenvors. der JU Bocholt. 1994/09 Mitgl. im Rat der Stadt Bocholt. - MdB seit Okt. 2013.', 'Sven', '11004432');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08489, NULL, NULL, NULL, 'Selbstständiger Kaufmann', 'geschieden, 1 Kind', '29.05.1971', NULL, 'Oberhausen', 'männlich', NULL, '22.10.2013', 'Vöpel', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Service Agentur Vöpel (SAV), Oberhausen,<br/>	Selbständiger Kaufmann im Bereich IT-Dienstleistungen<br/><br/>Funktionen in Unternehmen: <br/>	Energieversorgung Oberhausen AG, Oberhausen, <br/>	Mitglied des Aufsichtsrates (bis 30.06.2014)<br/><br/>	Revierpark Vonderort GmbH, Oberhausen, <br/>	Mitglied des Verwaltungsrates (bis 30.06.2014)<br/><br/>	WFO Wirtschaftsförderung Oberhausen GmbH, Oberhausen, <br/>	Mitglied des Aufsichtsrates (bis 30.06.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Emschergenossenschaft, Essen, <br/>	Mitglied der Genossenschaftsversammlung (bis 30.06.2014)<br/><br/>	Kreispolizeibehörde Oberhausen, Oberhausen, <br/>	Mitglied des Polizeibeirates (bis 30.06.2014)<br/><br/>	Regionalverband Ruhr, Essen, <br/>	Mitglied der Verbandsversammlung (bis 30.06.2014)<br/>	Mitglied des Betriebsausschusses der Route der Industriekultur (bis 30.06.2014)<br/>	Mitglied des Betriebsausschusses der Eigenbetriebsähnlichen Einrichtung Ruhr Grün (bis 30.06.2014)<br/><br/>	Stadt Oberhausen, Oberhausen, <br/>	Mitglied des Rates der Stadt (bis 30.06.2014)<br/>	Mitglied der Bezirksvertretung Alt-Oberhausen, Bezirksbürgermeister (bis 30.06.2014)<br/>	Mitglied des Beirates des Stadtteil-Projekts Alt-Oberhausen (Projekt Teamcity) (bis 30.06.2014)<br/>	Mitglied des Beirates des Stadtteil-Projekts Lirich (bis 30.06.2014)', '1981/91 Elsa-Brändström-Gymnasium Oberhausen, 1991 Abitur. 1991/93 Zivildienst beim Arbeitskreis Behinderter und Nichtbehinderter Katholisches Stadthaus Mülheim an der Ruhr. 1993 Studium der Rechtswissenschaften Ruhruniv. Bochum. Seit 1998 Gründer und Geschäftsführer der SAV Service Agentur Vöpel, Firma für Dienstleistungen mit Ausrichtung auf den Bereich Neue Medien, Schwerpunkt der Tätigkeit im Bereich IT-Handel und IT-Service. 1988 Eintritt in die SPD, 1988 Leiter der Juso-AG im Ortsverein Oberhausen-West, 1992/94 Vors. der Oberhausener Jungsozialisten, 1995/05 stellv. Vors. Ortsverein Oberhausen-West, seit Febr. 2005 Vors. Ortsverein Oberhausen-West; 2000 Gründungsmitgl. Arbeitskreis "Neue Medien" der Sozialdemokratischen Gemeinschaft für Kommunalpolitik NRW. 1989/94 Bürgermitgl. im Umweltausschuss der Stadt Oberhausen, 1994/99 Mitgl. der Bezirksvertretung Alt-Oberhausen, 1999/14 Mitgl. Rat der Stadt Oberhausen, 2011/14 Bezirksbürgermeister von Alt-Oberhausen. - MdB seit Okt. 2013.', 'Dirk', '11004433');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08490, NULL, NULL, NULL, 'Diplom-Sozialpädagogin', '3 Kinder', '01.06.1961', NULL, 'Recke', 'weiblich', NULL, '22.10.2013', 'Voßbeck-Kayser', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1980/84 Studium Sozialpädagogik an der Kath. Fachhochschule in Münster. 1985 Westfälisches Landeskrankenhaus Münster, 1986/13 im Fachbereich Gesundheit und Verbraucherschutz Märkischer Kreis, Fachdienst Sozialpsychiatrischer Dienst. Mitgl. in versch. psycho-sozialen Arbeitsgemeinschaften, Gesundheitskonferenz Gerontopsychiatrie + Sucht, Mitarbeiterin im Führungsstab des Krisenstabes Katastrophenschutz beim Märkischen Kreis, Mitgl. im Beirat der Justizvollzugsanstalt Iserlohn. Seit 2002 Mitgl. Ortsverband CDU Evingsen, stellv. Vors., 2002/09 stellv. Vors. CDU Altena,  seit 2008 Frauenunion Mark und Frauenunion Bezirk Südwestfalen Beisitzerin, seit 2009 Vors. CDU Altena. 2005/14 Mitgl. Aufsichtsrat Stadtwerke Altena. - MdB seit Okt. 2013.', 'Christel', '11004434');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08492, NULL, NULL, NULL, 'selbstständiger Unternehmer', 'verheiratet, 6 Kinder', '30.08.1955', NULL, 'Nibbixwoud, Niederlande', 'männlich', NULL, '22.10.2013', 'Vries', NULL, 'CDU', 'de', 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Agrarenergie Deetz GmbH & Co. KG<br/>Agrarservice de Vries & van Ginkel GbR<br/>Vrieswoud KG de Vries & van Ginkel, Zerbst/Anhalt OT Deetz,<br/>Landwirt/Geschäftsführer<br/><br/>Funktionen in Unternehmen: <br/>Milcherzeugergemeinschaft Barmke, Barmke,<br/>Mitglied des Vorstandes (bis 28.04.2014)<br/><br/>Teilnehmergemeinschaft Deetz, Deetz,<br/>Vorsitzender<br/><br/>Wolfener Recycling GmbH, Bitterfeld-Wolfen,<br/>Mitglied des Aufsichtsrates (bis 23.06.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Katholische Pfarrei Heilige Familie, Dessau-Roßlau,<br/>Mitglied des Vorstandes<br/><br/>Kreissparkasse Anhalt-Bitterfeld, Köthen,<br/>Stellv. Mitglied des Aufsichtsrates (bis 23.06.2014)<br/><br/>Landkreis Anhalt-Bitterfeld, Köthen,<br/>Mitglied des Kreistages und Vorsitzender des Ausschusses für Landwirtschaft und Umwelt<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bauernverband Sachsen-Anhalt e.V. und Kreisbauernverband, Magdeburg,<br/>Mitglied des Vorstandes<br/><br/>Naturpark Fläming e.V., Goswig/OT Jeber-Bergfrieden,<br/>Mitglied des Vorstandes<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Vrieswoud KG de Vries & van Ginkel, Zerbst/Anhalt OT Deetz', 'Landwirtschaftliche Ausbildung. Bis 1982 im Lohndienst tätig. Seit 1982 selbstständig tätig. Mitgl. im Vorstand des Landesbauernverbandes Sachsen-Anhalt, Mitgl. im Landesfachausschuss Milch; Kirchenvorstand; Vors.  Teilnehmergemeinschaft der Flurneuordnung, Mitgl. im Förderverein Schloss Zerbst, Mitgl. im Förderverein der Ganztagsschule CIERVISTI, Mitgl. im Förderverein der Grundschule Lindau. Seit 1999 Mitglied der CDU, stellv. Vors. der CDU-Anhalt-Bitterfeld, stellv. Ortsvorsitzender CDU-Ortsverband Deetz, Mitgl. im CDU-Landesfachausschuss Ernährung, Landwirtschaft und Forst, Mitgl. der Mittelstands- und Wirtschaftsvereinigung der CDU. Mitgl. im Kreistag von Anhalt-Bitterfeld, stellv. Fraktionsvors. der CDU-Fraktion im Kreistag Anhalt-Bitterfeld. -  MdB seit Okt. 2013.', 'Kees', '11004435');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08493, NULL, NULL, NULL, 'Dolmetscherin, Textilbetriebswirtin', 'keine Angaben', '28.01.1963', NULL, 'Bremen', 'weiblich', NULL, '22.10.2013', 'Wagner', NULL, 'BÜNDNIS 90/DIE GRÜNEN', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Barbara Lochbihler, Mitglied des Europäischen Parlaments,<br/>	Leiterin des Regionalbüros Kaufbeuren<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Bundeszentrale für politische Bildung, Bonn, <br/>	Stellv. Mitglied des Kuratoriums<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Treuhänderische Stiftung zur Unterstützung besonderer Härtefälle in der<br/>	Bundeswehr und der ehemaligen NVA (Härtefall-Stiftung), Bonn, <br/>	Mitglied des Stiftungsrates, ehrenamtlich', '1982 Abitur in Bremen. Ausbildung in Würzburg, 1985 Abschluss der Dolmetscherschule als staatlich geprüfte Übersetzerin mit Schwerpunkt Wirtschaft;  während dessen ein Trimester Studium an der Universität von Salford in Manchester. Fremdsprachenkorrespondentin in Bremen bei Europa Carton und Siemens Ltd. in London, 1988/90 bei John Kaldor Fabrikmaker als European Sales Coordinator in London; anschl. Fremdsprachenkorrespondentin in Mailand und bei der Weberei Fossati Lamperti in Monza. 2009/13 Leiterin des Regionalbüros von Barbara Lochbihler, MdEP. Beisitzerin im Vorstand der Münchner Grünen, Delegierte zum Bundesfrauenrat, 2011/13 Sprecherin der Bundesarbeitsgemeinschaft Frauenpolitik, seit 2009 Sprecherin des Landesarbeitskreises Frauen- und Gleichstellungspolitik. - MdB seit Okt. 2013.', 'Doris', '11004436');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08494, NULL, NULL, NULL, 'Rechtsanwältin', 'verheiratet, 2 Kinder', '15.05.1979', NULL, 'Bad Mergentheim', 'weiblich', NULL, '22.10.2013', 'Warken', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwälte Reinhart, Kober, Großkinsky, Tauberbischofsheim,<br/>	Rechtsanwältin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwälte Warken und Kollegen, Püttlingen, <br/>	Rechtsanwältin<br/><br/>Funktionen in Unternehmen: <br/>Stadtentwicklungsgesellschaft Tauberbischofsheim mbH,<br/>	Tauberbischofsheim, <br/>	Stellv. Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Main-Tauber-Kreis, Tauberbischofsheim, <br/>	Mitglied des Kreistages<br/><br/>	Stadt Tauberbischofsheim, Tauberbischofsheim, <br/>	Mitglied des Gemeinderates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bürgerstiftung Tauberbischofsheim, Tauberbischofsheim, <br/>	Mitglied des Vorstandes<br/><br/>	THW-Landesvereinigung Baden-Württemberg e.V., Stuttgart, <br/>	Präsidentin, ehrenamtlich', 'Abitur am Matthias-Grünewald-Gymnasium in Tauberbischofsheim. 1998/02 Studium der Rechtswissenschaft in Heidelberg, 2003 erstes jur. Staatsexamen; anschl. Rechtsreferendariat am Landgericht Mosbach; 2005 zweites jur. Staatsexamen. Seit 2006 zugelassen als Rechtsanwältin, Mitarbeiterin in mittelständischen Anwaltssozietäten mit Schwerpunkten im Verwaltungs- und Sozialrecht sowie im gewerblichen Rechtsschutz. Seit 2000 Mitgl. der CDU, 2006/14 stellv. Bundesvors. der Jungen Union Deutschlands, Mitgl. im Bezirksvorstand der CDU, Mitgl. im Landes- und Bezirksvorstand der Frauen Union. Seit 2015 Präsidentin der THW-Landeshelfervereinigung Baden-Württemberg. Seit 2004 Mitgl. im Stadtrat Tauberbischofsheim, seit 2014 Mitgl. im Kreistag des Main-Tauber-Kreises. - MdB seit Okt. 2013; seit Febr. 2015 Obfrau der CDU/CSU-Fraktion im 1. Untersuchungsausschuss (NSA).', 'Nina', '11004437');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08495, NULL, NULL, NULL, 'Keramikmalerin, DGB-Regionsvorsitzende Koblenz', 'keine Angaben', '24.03.1955', NULL, 'Ebernhahn', 'weiblich', NULL, '22.10.2013', 'Weber', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Deutscher Gewerkschaftsbund (DGB), Berlin,<br/>Gewerkschaftssekretärin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Deutscher Gewerkschaftsbund (DGB), Berlin, <br/>Gewerkschaftssekretärin, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Planungsgemeinschaft Mittelrhein-Westerwald, Koblenz, <br/>Mitglied des Vorstandes<br/><br/>Stadt Wirges, Wirges, <br/>Mitglied des Stadtrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Arbeiterwohlfahrt Wirges e.V., Wirges, <br/>Mitglied des Vorstandes<br/><br/>Verbraucherzentrale Rheinland-Pfalz e.V., Mainz, <br/>Mitglied des Verwaltungsrates', '1969 Ausbildung zur Keramikmalerin. Seit 1980 DGB-Gewerkschaftssekretärin, 2001/15 Vors. des DGB, Region Koblenz. Fachreferentin zu unterschiedlichen Themen der Arbeitswelt. Versichertenberaterin der Deutschen Rentenversicherung. Mitgl. der SPD seit 1972, stellv. Vors. SPD-Ortsverein Wirges. SPD-Fraktionsvors. im Stadtrat Wirges. Organisationssekretärin des DGB im nördlichen Rheinland-Pfalz, stellv. Vors. der AWO in Wirges. - MdB seit Okt. 2013.', 'Gabi', '11004438');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08497, NULL, 'HonD', 'HonD', 'Verwaltungs- und Betriebswirt', 'verheiratet, 1 Kind', '15.10.1965', NULL, 'Mayen', 'männlich', NULL, '29.04.2016', 'Weiler', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Verwaltungsgemeinschaft Bergbahnregion/Schwarzatal, Oberweißbach,<br/>	Leitung der Verwaltungsgemeinschaft<br/><br/>Funktionen in Unternehmen: <br/>	Thüga AG, München, <br/>	Mitglied des Beirates (bis 31.10.2015)<br/><br/>	Thüringer Energie AG, Erfurt, <br/>	Mitglied des Kommunalbeirates (bis 31.10.2015)<br/><br/>	Waldkrankenhaus "Rudolf Elle" GmbH, Eisenberg, <br/>	Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Gemeinde Milda Verwaltungsgemeinschaft  "Südliches Saaletal", Kahla, <br/>	Bürgermeister, ehrenamtlich, monatlich, Stufe 1<br/><br/>	JobCenter Saale-Holzland-Kreis, Eisenberg, <br/>	Mitglied des Beirates<br/><br/>	Saale-Holzland-Kreis, Eisenberg, <br/>	Mitglied des Kreistages, ehrenamtlich<br/><br/>	Zweckverband JenaWasser, Jena, <br/>	Stellv. Vorsitzender<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Deutsch-Armenisches Forum e.V., Berlin, <br/>	Präsident, ehrenamtlich', '1990 Abitur mit Auszeichnung in Köln. 1992/95 Fachhochschule für öffentliche Verwaltung in Brühl/Rheinland, Studium zum Diplom-Verwaltungswirt (FH). 1996/02 REFA-Institut Darmstadt/Dortmund, Studium zum REFA-Betriebswirt, Schwerpunkte Produktivitätssteigerung und Prozessoptimierung; 2007/09 Freie Universität Berlin, Masterstudium zum Politologen M. A. Ausbildung zum Elektroanlageninstallateur und Energieanlagenelektroniker. Lokomotivführer bei der Bundesbahn, Geschäftsführer der Firma C.I.P. Kommunale EDV-Lösungen mbH in Erfurt, versch. berufliche Stationen, seit 2013 Leitung der Verwaltungsgemeinschaft "Bergbahnregion/Schwarzatal" in Oberweißbach bis zum Eintritt in den Deutschen Bundestag im September 2013. Mitgl. der CDU, seit 2010 Vors. CDU-Ortsverband "Gebirge/Milda". Ehrenamtl. Bürgermeister der Gemeinde Milda seit 2004, seit 2014 Mitgl. Kreistag Saale-Holzland-Kreis; stellv. Vors. Wasser/Abwasserzweckverband JenaWasser. Seit 2015 Präs. Deutsch-Armenisches Forum. - MdB seit Okt. 2013.', 'Albert', '11004439');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08499, NULL, 'Dr.', 'Dr.', 'Rechtsanwältin', 'verheiratet, 2 Kinder', '11.03.1976', NULL, 'Schweinfurt', 'weiblich', NULL, '22.10.2013', 'Weisgerber', NULL, 'CSU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Europäisches Parlament, Straßburg,<br/>	Mitglied des Europäischen Parlaments<br/><br/>	GSK Stockmann & Kollegen, Frankfurt/Main,<br/>	Rechtsanwältin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>GSK Stockmann & Kollegen, Frankfurt/Berlin, <br/>	Rechtsanwältin, monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>Region Mainfranken GmbH, Würzburg, <br/>	Mitglied des Rates der Region<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesstiftung Baukultur, Potsdam, <br/>	Mitglied des Stiftungsrates<br/><br/>	Landkreis Schweinfurt, Schweinfurt, <br/>	Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>DONUM VITAE Stiftung Bayern, München, <br/>	Mitglied des Kuratoriums<br/><br/>	GE - NIE, Gewerbeverein Niederwerrn e.V., Niederwerrn, <br/>	Mitglied des Fachbeirates', '1995/2000 Studium der Rechtswissenschaft Julius-Maximilian-Univ. Würzburg, 1998 Studium des französischen und des Europarechts an der Universität Lausanne, 2000 1. jur. Staatsexamen, 2000/01 Promotionsstudium Univ. Würzburg, Stipendiatin der Konrad-Adenauer-Stiftung, 2000/02 Referendariat in Schweinfurt und Tätigkeit bei Pricewaterhouse Cooprs Veltins Rechtsanwaltsgesellschaft mbH, München. 2003 2. jur. Staatsexamen. Seit 2004 zugelassene Rechtsanwältin. Seit 1997 Mitgl. der CSU, 1999/09 stellv. JU-Bezirksvors., seit 2001 stellv. Landesvors. des AK Umweltsicherung und Landesentwicklung der CSU, 2003/11 Mitgl. im JU-Landesvorstand, seit 2003 Mitgl. im CSU-Bezirksvorstand, seit 2007 Mitgl. Landesvorst. der Frauen Union, seit 2009 Mitgl. CSU-Parteivorstand und Bezirksvors. der Frauen-Union, seit 2010 Mitgl. der Mittelstands-Union, seit 2011 stellv. FU-Landesvors. und CSU-Kreisvors. 2000/08 Gemeinderätin in Schwebheim (Lk. Schweinfurt), seit 2008 Kreisrätin im Landkreis Schweinfurt. Seit 2015 Mitgl. Stiftungsrat der Bundesstiftung Baukultur. Mehrfache Bayerische Meisterin im Tennis. 2004/Okt. 2013 Mitgl. Europäisches Parlament für Deutschland, umwelt-, verbraucherschutz-, gesundheits-, sportpolitische Sprecherin der CSU-Europagruppe. - MdB seit Okt. 2013; Obfrau der CDU/CSU-Fraktion im Ausschuss für Umwelt, Naturschutz, Bau und Reaktorsicherheit.', 'Anja', '11004440');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08501, NULL, NULL, NULL, 'Wissenschaftlicher Mitarbeiter', 'ledig', '09.06.1985', NULL, 'Torgau', 'männlich', NULL, '22.10.2013', 'Wendt', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Manfred Kolbe, MdB, Berlin,<br/>Wissenschaftlicher Mitarbeiter', 'Abitur am Joe-Polwosky-Gymnasium Torgau. Studium zum Dipl.-Verwaltungswirt (FH) und Master of Laws, LL.M., Recht der öffentlichen Verwaltung. 2007/13 stud. Hilfskraft und wissenschaftlicher Mitarbeiter des Bundestagsabgeordneten Manfred Kolbe in Berlin. 2002/05 Mitgl. im Jugendstadtrat. 2004/15 Vors. der Jungen Union Nordsachsen, seit 2016 Vors. der CDU Nordsachsen. Mitgl. MIT, Ev. Kreissynode, Initiativgruppe Geschlossener Jugendwerkhof Torgau e. V. Initiativkreis Schloß Hartenfels e. V., im Förderverein Freiwillige Feuerwehr Torgau, Mitgl. der Torgauer Geharnischten e. V., Vorstandsmitgl. Förderverein Hospizarbeit Nordsachsen.  Englisch (f), Italienisch (G), Niederländisch (G), Latein. - MdB seit Okt. 2013.', 'Marian', '11004441');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08502, NULL, NULL, NULL, 'Gewerkschaftssekretär, Chemielaborant', 'verheiratet, 3 Kinder', '30.09.1960', NULL, 'Hildesheim', 'männlich', NULL, '22.10.2013', 'Westphal', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Industrie Gewerkschaft  Bergbau, Chemie, Energie, Hannover,<br/>Vorstandssekretär<br/><br/>Funktionen in Unternehmen: <br/>CeramTec GmbH, Plochingen, <br/>Mitglied des Aufsichtsrates (bis 30.11.2013)<br/><br/>esco - european salt company GmbH & Co. KG, Hannover, <br/>Mitglied des Beirates, ehrenamtlich (bis 30.11.2013)<br/><br/>Exxon Mobil Central Europe Holding GmbH, Hamburg, <br/>Mitglied des Aufsichtsrates (bis 30.11.2013)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Gesellschaft zur Förderung des Energiewirtschaftlichen Instituts an der Universität zu Köln e.V., Köln,<br/>Mitglied des Beirates, ehrenamtlich', 'Erweiterter Sekundarabschluss I. 1978 Ausbildung zum Chemielaboranten. 1982/83 Wehrdienst beim Sanitätsbataillon 1. Nach der Ausbildung Angestellter auf dem Kalibergwerk Siegfried-Giesen. Weiterbildung zum Betriebsstatistiker, 1992/93 Studium an der Sozialakademie in Dortmund. Ab 1993 hauptamtlicher Gewerkschaftssekretär bei der IG Bergbau und Energie (IG BE) in Recklinghausen und Bochum, 1997/05 Industriegruppensekretär für Bergbau- und Energiepolitik bei der IG Bergbau, Chemie, Energie (IG BCE), 2005/13 Vorstandssekretär in der IG BCE Hauptverwaltung Hannover, zuständig für Sozialpolitik, Mitbestimmung, Betriebsverfassung, Migration/Integration. Seit 1984 Mitgl. der SPD, Vors. der SPD in der Gemeinde Giesen, stellv. Vors. SPD-Unterbezirk Hildesheim. Mitglied des Gemeinderates. Mitgl. IG BCE, AWO, Verein "Mach meinen Kumpel nicht an", Präs. Deutsch-Französische Partnerschaft Chabanais-Giesen e. V. - MdB seit Okt. 2013; seit Okt. 2015 wirtschafts- und energiepolitischer Sprecher der SPD-Fraktion.', 'Bernd', '11004442');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08504, NULL, NULL, NULL, 'Wirtschaftswissenschaftler M. Sc.', 'ledig', '10.04.1985', NULL, 'Baden-Baden', 'männlich', NULL, '22.10.2013', 'Whittaker', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Herrenknecht AG, Schwanau,<br/>Assistent der Geschäftsleitung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Partnerschaftsverein Baden-Baden, Baden-Baden, <br/>Schatzmeister', 'Abitur 2004 am Markgraf-Ludwig-Gymnasium in Baden-Baden. Zivildienst 2004/05. 2005/08 Bachelor-Studium der Volks- und Betriebswirtschaft in Bristol (Großbritannien). 2008/09 Assistent der Geschäftsleitung der LEONI AG in Roth bei Nürnberg. 2009/10 Master-Studium im Fach European Political Economy in London (Großbritannien). 2011/13 Assistent der Geschäftsleitung der Herrenknecht AG in Schwanau bei Lahr. Mitgl. der Jungen Union und der CDU. Mitgl. Gemeinderat Baden-Baden 2004/09. Mitgl. Kuratorium der Hochschule für Wirtschaft, Technik und Kultur (HWTK). - MdB seit Okt. 2013.', 'Kai', '11004443');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08505, NULL, NULL, NULL, 'Jurist', 'verheiratet, 1 Kind', '11.07.1983', NULL, 'Paderborn', 'männlich', NULL, '22.10.2013', 'Wiese', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Franz Müntefering, MdB, Berlin,<br/>	Referent<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Absatzfonds der deutschen Land- und Ernährungswirtschaft, Bonn, <br/>	Mitglied des Verwaltungsrates, ehrenamtlich<br/><br/>	Stadt Brilon, Brilon, <br/>	Mitglied des Rates der Stadt, ehrenamtlich (bis 20.08.2015)', 'Gymnasium Petrinum in Brilon, 2003 Abitur. Studium der Rechtswissenschaften Philipps-Univ. in Marburg und  Westfälische Wilhelms-Univ. in Münster, 2008 erstes jur. Staatsexamen; Referendariatszeit im Bezirk des OLG Hamm; Aufenthalt an der Deutschen Botschaft in New Delhi, 2010 zweites jur. Staatsexamen. 2010/13 Referent und Wissenschaftl. Mitarbeiter von Franz Müntefering (MdB) im Deutschen Bundestag in Berlin. Seit 2003 Mitgl. der SPD, seit 2006 Vors. der SPD Brilon, seit 2008 stellv. Vors. der SPD im Hochsauerlandkreis, seit 2012 Vors., seit 2012 stellv. Sprecher der Südwestfalen-SPD. Ab 2004 Sachkundiger Bürger im Rat, 2009/15 Mitgl. im Rat der Stadt Brilon. - MdB seit Okt. 2013; seit Jan. 2017 Parl. Staatssekretär bei der BMin. für Wirtschaft und Energie.', 'Dirk', '11004444');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08506, NULL, NULL, NULL, 'Diplom-Geograph', 'verheiratet, 2 Kinder', '24.09.1966', NULL, 'Marl', 'männlich', NULL, '22.10.2013', 'Wittke', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	CDU Nordrhein-Westfalen, Düsseldorf,<br/>	Generalsekretär<br/><br/>	Landtag Nordhrein-Westfalen, Düsseldorf,<br/>	Mitglied des Landtages<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>	Beratung<br/>Pyramis GmbH, Münster, monatlich, Stufe 1<br/><br/>Funktionen in Unternehmen: <br/>	AGR Abfallentsorgungs-Gesellschaft Ruhrgebiet mbH, Herten, <br/>	Vorsitzender des Aufsichtsrates<br/><br/>	FAKT Immobilien AG, Essen, <br/>	Mitglied des Aufsichtsrates (bis 25.11.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Regionalverband Ruhr, Essen, <br/>	Mitglied der Verbandsversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Freunde der Katholischen Akademie in Berlin e.V., Berlin, <br/>1.	 Vorsitzender, ehrenamtlich<br/><br/>	Gütegemeinschaft Brandschutz im Ausbau e.V. (GBA), Leiningen, <br/>	Mitglied des Politisch-Parlamentarischen Beirates, ehrenamtlich (bis 09.11.2015)<br/><br/>	Wirtschaftsverband Brandschutz e.V. - WVB, Berlin, <br/>	Mitglied des Parlamentarischen Beirates, ehrenamtlich (bis 09.11.2015)', 'Abitur 1986. Wehrdienst. Studium der Wirtschaftswissenschaft und Geographie Ruhr-Univ. Bochum, 1994 Diplom-Geograph. 1994/99 Projektassistent bei einer Entwicklungsagentur. 1999/04 Oberbürgermeister der Stadt Gelsenkirchen. 2005 Leiter Vertrieb bei der Montan-Grundstücksgesellschaft. Juni 2005/Febr. 2009 Minister für Bauen und Verkehr des Landes NRW. 2009/10 Mitgl. der Geschäftsführung der Hellmich-Gruppe in Duisburg. Mitgl. der CDU seit 1982, seit 2008 Bezirksvors. der CDU Ruhr, seit 2013 Kreisvors. der CDU Gelsenkirchen, 2001/10 stellv. Landesvors. und 2010/12 Generalsekretär der CDU Nordrhein-Westfalen. Mitgl. Rat der Stadt Gelsenkirchen 1989/95. 2003/04 Stellv. der Präsidentin des Deutschen Städtetages. MdL Nordrhein-Westfalen Juni 1995/Sept. 1999, Dez. 2007/Juni 2010 und Mai 2012/Okt. 2013. - MdB seit Okt. 2013.', 'Oliver', '11004445');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08507, NULL, NULL, NULL, 'MdL, Lehrerin', 'verheiratet, 2 Kinder', '15.12.1950', NULL, 'Bendorf am Rhein', 'weiblich', NULL, '22.10.2013', 'Wöllert', NULL, 'DIE LINKE.', NULL, 'konfessionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landtag Brandenburg, Potsdam,<br/>	Mitglied des Landtages<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Spree-Neiße, Forst, <br/>	Mitglied des Kreistages<br/><br/>	Stadt Spremberg, Spremberg, <br/>	Mitglied der Stadtverordnetenversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Aktion Psychisch Kranke e.V. (APK), Bonn, <br/>	Mitglied des Vorstandes, ehrenamtlich', '1967/71 Studium für das Lehramt an Unterstufen am Institut für Lehrerbildung Weißenfels. 1971/79 Lehrerin, 1979/82 Leiterin "Haus der Pioniere" in Spremberg. 1982 Direktstudium an der Bezirksparteischule Cottbus, 1983/85 externes Studium der Staatsbürgerkunde an der Pädagogischen Hochschule "Ernst Schneller" in Zwickau, Abschluss Diplom-Lehrerin. 1983/87 Lehrerin, 1987/88 stellv. Schulleiterin, 1988/90 Schulleiterin. Erweiterungsstudium Deutsch für die Sekundarstufe I an der Pädagogischen Hochschule Potsdam, 1994 Abschluss. Mitgl. der SED seit 1976, seit 1989 Mitgl. der PDS, seit Juli 2005 Die Linkspartei.PDS, seit Juni 2007 DIE LINKE. Seit 1998 Mitgl. Kreistag Spree-Neiße, seit 1990 Mitgl. der Stadtverordnetenversammlung Spremberg. MdL Brandenburg Okt. 2004/Okt. 2013, Nov. 2007/Okt. 2009 Vors. Ausschuss für Arbeit, Soziales, Gesundheit und Familie, ab Dez. 2009 Vors. Ausschuss für Arbeit, Soziales, Frauen und Familie. - MdB seit Okt. 2013.', 'Birgit', '11004446');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08508, NULL, NULL, NULL, 'Verwaltungsjuristin', '2 Kinder', '23.01.1957', NULL, 'Rheinberg', 'weiblich', NULL, '22.10.2013', 'Woltmann', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Niedersachsen, Hannover,<br/>Ministerialrätin', '1976 Abitur am Amplonius Gymnasium in Rheinberg. Studium der Rechtswissenschaften in Bonn, 1. Staatsexamen Mainz, 2. Staatsexamen Hannover. Seit 1986 Beamtin im  Landesdienst Niedersachsen, 1986/04 Dezernentin in der Agrarstrukturverwaltung des Landes Niedersachsen, seit 2005 Referentin in der Regierungsvertretung Oldenburg und seit 2006 deren stellv. Leiterin. Seit 1982 Mitgl. der CDU, seit 1999 stellv. Landesvors. im CDU-Landesverb. Oldenburg, 2008/12 Beisitzerin im Landesvorst. der CDU Niedersachsen und 2008/13 Vors. LFA Europa und Regionalentwicklung, seit 2013 Beisitzerin im Kreisvorst. der CDU Ammerland, im Kreisvorstand Frauen Union Ammerland und im Landesvorstand der Frauen Union Oldenburg, seit 2015 Beisitzerin im Bundesvorstand der Frauen-Union. 2001/11 und seit Okt. 2016 Mitgl. im Kreistag Landkreis Ammerland und im Rat der Gemeinde Bad Zwischenahn, dort Fraktionsvorsitzende und Beigeordnete. 2001/11 Aufsichtsratsvorsitzende der gemeindeeigenen Reha-Klinik. - MdB seit Okt. 2013.', 'Barbara', '11004447');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08509, NULL, NULL, NULL, 'Pharmazeutisch kaufmännische Assistentin', 'verheiratet, 2 Kinder', '27.03.1962', NULL, 'Adana, Türkei', 'weiblich', NULL, '22.10.2013', 'Yüksel', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Taxiunternehmerin, Mönchengladbach<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Mönchengladbach, Mönchengladbach,<br/>Vorsitzende des Integrationsrates (bis 02.10.2014)<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Landesintegrationsrat Nordrhein-Westfalen, Düsseldorf,<br/>Beratendes Mitglied des Vorstandes', '1997 Einritt in die SPD, ab  2005 stellv. SPD-Unterbezirksvors., seit 2014 SPD-Unterbezirksvors. Mönchengladbach. 2002/Okt. 2013 Mitgl. im Rat der Stadt Mönchengladbach, 1995/2014 Mitgl. im Integrationsrat (vormals Ausländerbeirat), 1997/2014 Vors. Integrationsrat der Stadt Mönchengladbach, 2000/14 im Vorstand Landesintegrationsrat NRW (früher LAGA NRW). 2003/13 Mitgl. WDR-Rundfunkrat. Mitgl. IGBCE. - MdB seit Okt. 2013; Vors. des Fanclubs "Fohlen des Bundestages" (Borussia Mönchengladbach).', 'Gülistan', '11004448');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08510, NULL, NULL, NULL, 'Journalist', NULL, '29.10.1954', NULL, 'Elten (jetzt Emmerich)', 'männlich', NULL, '22.10.2013', 'Zdebel', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>DIE LINKE. Nordrhein-Westfalen, Düsseldorf,<br/>Landessprecher<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Münster, Münster, <br/>Mitglied des Vergabeausschusses', '1979/80 Hochschulreferent im AStA der WWU Münster. Journalist City Magazin, Stadtblatt Münster. 1998/01 Mitarbeiter des Grünen Bundestagsabgeordneten Christian Simmert, 2001 Büroleiter des Landtagsabgeordneten Rüdiger Sagel DIE LINKE NRW, Referent des Fraktionsvorst. der NRW-Landtagsfraktion der LINKEN. 2010/12 Landessprecher DIE LINKE. 1987/89 für die GAL im Rat der Stadt Münster; 2007 Austritt aus den Grünen, Mitgl. der Partei DIE LINKE, 2008/09 stellv. Sprecher LINKE-Kreisverband Münster. 2009/13 Mitgl. Bezirksvertretung Münster-Hiltrup.- MdB seit Okt. 2013.', 'Hubertus', '11004449');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08511, NULL, NULL, NULL, 'Kaufmännischer Angestellter', 'verheiratet, 1 Kind', '09.07.1981', NULL, 'Trostberg', 'männlich', NULL, '22.10.2013', 'Zech', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>EADS Deutschland GmbH, München,<br/>Kaufmännischer Angestellter<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Scaliger Strategy Consulting GmbH, Garching,<br/>Geschäftsführender Gesellschafter, monatlich, Stufe 1<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Garching, Garching, <br/>Mitglied des Gemeinderates und Vorsitzender des Rechnungsprüfungsausschusses<br/><br/>Landkreis Altötting, Altötting, <br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Stiftung Sankt Barbara, Munster,<br/>Mitglied des Kuratoriums<br/><br/>Verband der Reservisten der Deutschen Bundeswehr e.V., Bonn,<br/>Stellv. Präsident<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Scaliger Strategy Consulting GmbH, Garching', '1994/98 Wirtschaftsschule Mühldorf. 1998/2000 Ausbildung zum Einzelhandelskaufmann bei Edeka Chiemgau; 2000/02 Berufsoberschule Altötting; 2009/10 Zertifikatsstudiengang "Human Centerd Innovation"; 2009/12 Studium der Betriebswirtschaft. 2002/10 Zeitsoldat im Gebirgspionierbataillon 8 in Brannenburg. Seit 2005 freiberuflicher Dozent u. a. bei der Handwerkskammer für München und Oberbayern, 2010/13 kaufmännischer Mitarbeiter bei Airbus Group. 2001/07 Ortsvors. der Jungen Union Garching, 2009/12 Kreisvors. der Jungen Union Altötting, seit 2011 JU-Bezirksvors. Oberbayern. Seit 2002 Gemeinderat in der Gemeinde Garching an der Alz, Mitgl. im Haupt- und Finanzausschuss, 2007/14 Referent für Stadtmarketing und Tourismus der Gemeinde Garching an der Alz, 2008/14 Fraktionssprecher der CSU-Fraktion, seit 2014 Vors. Rechnungsprüfungsausschuss Gemeinde Garching an der Alz. Seit Mai 2014 Kreisrat im Landkreis Altötting. Mitgl. in der Katholischen Arbeitnehmerbewegung, beim Sozialverband VDK, der Arbeiterwohlfahrt, im Verein Europa Union Bayern e. V. u. a. Seit Nov. 2016 Stellv. des Präsidenten des Verbands der Reservisten der Dt. Bundeswehr e. V. Ehrenkreuz der Bundeswehr 2008. - MdB seit Okt. 2013; seit Jan. 2014 Mitgl. Parl. Versammlung des Europarats, seit Jan. 2016 stellv. Fraktionsvors. der Europäischen Volkspartei im Europarat.', 'Tobias', '11004450');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08512, NULL, NULL, NULL, 'Soziale Arbeit, Koordination, Management', NULL, '12.05.1957', NULL, 'Kastek, Kasachstan', 'männlich', NULL, '22.10.2013', 'Zertik', NULL, 'CDU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Freundschaft-Druschba e.V., Schieder-Schwalenberg,<br/>Projektmanager', 'Seit 2002 Mitgl. Vorstand der Lippischen CDU, Vors. Netzwerk Aussiedler in der CDU NRW, Vors. Netzwerk Aussiedler in der CDU Deutschlands, Mitgl. Bundesvorst. der CDU Deutschlands, Mitgl. Landesvorst. der CDU NRW. Stellv. Landesvors. Bund der Vertriebenen NRW, stellv. Vors. der OMV NRW. - MdB seit Okt. 2013.', 'Heinrich', '11004451');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08514, NULL, NULL, NULL, 'Examinierte Gesundheits-und Krankenpflegerin', 'ledig, 1 Kind', '27.03.1987', NULL, 'Lichtenfels', 'weiblich', NULL, '22.10.2013', 'Zeulner', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Universität Bamberg, Bamberg,<br/>Studentin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Lichtenfels, Lichtenfels, <br/>Mitglied des Kreistages<br/><br/>Stadt Lichtenfels, Lichtenfels, <br/>Mitglied des Stadtrates', 'Examinierte Gesundheits- und Krankenpflegerin; bis Sommersemester 2013 Studium an der Univ. Bamberg, Studienfach European Economic Studies; Mitgl. der Bezirksvorstandschaft der CSU Oberfranken; Mitgl. Bezirksvorstandschaft der Jungen Union Oberfranken; Mitgl. im Stadtrat von Lichtenfels; Mitgl. im Kreistag von Lichtenfels; Mitgl. Junge Europäer Bayern. - MdB seit Okt. 2013.', 'Emmi', '11004452');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08515, NULL, NULL, NULL, 'Werkzeugmacher, Touristikfachwirt', 'verheiratet, 2 Kinder', '05.12.1970', NULL, 'Prenzlau', 'männlich', NULL, '22.10.2013', 'Zierke', NULL, 'SPD', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>tmu Tourismus Marketing Uckermark GmbH, Prenzlau,<br/>Geschäftsführer<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>tmu Tourismus Marketing Uckermark GmbH, Prenzlau, <br/>Geschäftsführer<br/><br/>Funktionen in Unternehmen: <br/>Stadtwerke Prenzlau GmbH, Prenzlau,<br/>Vorsitzender des Aufsichtsrates (bis 29.09.2014)<br/><br/>UCKERSERVICE GmbH regionale Betriebsführungsgesellschaft für<br/>Wasserver- und Abwasserentsorgung, Prenzlau,<br/>Mitglied des Aufsichtsrates (bis 29.09.2014)<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Uckermark, Prenzlau,<br/>Mitglied des Kreistages, ehrenamtlich (bis 31.12.2016)<br/><br/>Stadt Prenzlau, Prenzlau,<br/>Mitglied der Stadtverordnetenversammlung, ehrenamtlich', '1987 Lehre zum Werkzeugmacher im Armaturenwerk Prenzlau. 1990 Wehrdienst in der Vermessungseinheit II Prenzlau. 1991 Werkzeugmacher im Armaturenwerk Prenzlau. 1991 Lehre zum Reiseverkehrskaufmann (IHK Potsdam). 1993 Reiseverkehrskaufmann/Expedient bei BAF Reisen Prenzlau; 1994 Leiter der Reisebüros der Volksbank Uckermark eG. 1997 Studium zum Touristikfachwirt (IHK zu Berlin). 2003 Geschäftsführer des Tourismusverbandes Uckermark e.V. 2005 Geschäftsführer tmu Tourismus Marketing Uckermark GmbH. Mitgl. SPD-Ortsverein Prenzlau, 2015 Unterbezirksvors. SPD Uckermark. Mitgl. Stadtverordnetenversammlung Prenzlau - Fraktion der SPD. - MdB seit Okt. 2013; Sprecher der Landesgruppe Brandenburg und Vors. der Landesgruppe Ost der SPD-Fraktion.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 59 (Märkisch-Oderland - Barnim II)', 'Stefan', '11004453');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08516, NULL, NULL, NULL, 'Mediengestalterin', '3 Kinder', '17.09.1956', NULL, 'Braunschweig', 'weiblich', NULL, '22.10.2013', 'Zimmermann', NULL, 'DIE LINKE.', NULL, 'ohne Angaben', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Niedersächsischer Landtag, Hannover,<br/>Landtagsabgeordnete<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Rosa-Luxemburg-Stiftung, Berlin, <br/>Mitglied des Vorstandes', '1972 Hauptschulabschluss. Bis 1975 Kfm. Ausbildung, 2. Bildungsweg, Abitur. Studiengang Sozialwesen mit Abschluss Sozialarbeit. 15 Jahre tätig in der Behindertenhilfe im evangelischen Stift Neuerkerode, 1999/05 arbeitssuchend, Ausbildung zur Mediengestalterin. Mitgl. AG Bergen Belsen, Freiwillige Feuerwehr Kapern, IG Metall Chor Gegenwind, ver.di, VVN-BDA, Wählergemeinschaft Wolfsburger Linke; Fördermitgl. Linksjugend [´solid]. 1972/96 Mitgl. der SPD; 2002 Eintritt in die PDS, jetzt DIE LINKE, seit März 2017 Landesvors. 2006/12 Ratsfrau der Stadt Wolfsburg für die Wählergemeinschaft Wolfsburger Linke. 2008/13 MdL Niedersachsen, dort innenpol. Sprecherin. Englisch (G). - MdB seit Okt. 2013; Pflegepolitische Sprecherin der Fraktion DIE LINKE.', 'Pia', '11004454');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08517, NULL, NULL, NULL, 'Industriekauffrau, Speditionskauffrau kfm. Koordinatorin', 'geschieden, 2 Kinder', '21.07.1960', NULL, 'Straubing', 'weiblich', NULL, '22.10.2013', 'Zollner', NULL, 'CSU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Berufliche Fortbildungszentren der Bayerischen Wirtschaft (bfz) gemeinnützige GmbH, Landshut,<br/>Kaufmännische Angestellte<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Gemeinde Wallersdorf, Wallersdorf,<br/>Mitglied des Marktgemeinderates<br/><br/>Landkreis Dingolfing-Landau, Dingolfing,<br/>Mitglied des Kreistages<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>DONUM VITAE in Bayern e.V., München,<br/>Stellv. Landesvorsitzende, ehrenamtlich', 'Mittlere Reife. 1976/79 Ausbildung zur Industriekauffrau Gebr. Eicher GmbH, Landau/Isar, 1979/81 Ausbildung zur Speditionskauffrau Spedition Hamacher, Passau, 1982 Ausbildung der Ausbilder (IHK). 1982/95 selbstständige Transportunternehmerin. 1986/12 Miteigentümerin Reiterhof Zollner GdBR, Wallersdorf. Ab 2003 kaufm. Leiterin und Öffentlichkeitsbeauftragte der Unternehmensgruppe Bildungswerk der Bayerischen Wirtschaft (bbw), Landshut. Seit 1988 B-Trainerschein Reiten. Seit 1993 Richterin der Landeskommission für Pferdeleistungsprüfungen in Bayern. Seit 2014 stellv. Landesvors. Donum Vitae in Bayern e.V. 1999 Eintritt in die CSU, seit 2011 CSU-Ortsvors. Wallersdorf und stellv. CSU-Kreisvors. Dingolfing-Landau, seit 2011 Mitgl. Bezirksvorst. CSU Niederbayern, seit 2015 Mitgl. CSU-Parteivorstand; seit 2009 Landesschriftführerin FU Bayern, seit 2015 FU-Bezirksvors. Niederbayern; seit 2010 Mitgl. Bezirksvorst. Mittelstandsunion Niederbayern, seit 2016 stellv. Bezirksvors. Mittelstandsunion Niederbayern. Seit 2008 Markträtin der Marktgemeinde Wallersdorf, seit 2014 Kreisrätin Landkreis Dingolfing-Landau. - MdB seit Okt. 2013; seit 2016 Schriftführerin.', 'Gudrun', '11004455');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08518, NULL, 'Dr.', 'Dr.', 'Diplom-Kaufmann', NULL, '09.09.1981', NULL, 'Groß-Umstadt', 'männlich', NULL, '22.10.2013', 'Zimmermann', NULL, 'SPD', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Katholische Universität Eichstätt-Ingolstadt, Eichstätt,<br/>Wissenschaftlicher Mitarbeiter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Bundesanstalt für Finanzdienstleistungsaufsicht (BaFin), Bonn, <br/>Mitglied des Verwaltungsrates<br/><br/>Stadt Groß-Umstadt, Groß-Umstadt, <br/>Mitglied der Stadtverordnetenversammlung', 'Max-Planck-Gymnasium Groß-Umstadt, 2001 Abitur. 2001/02 Zivildienst in der ambulanten Pflege. 2002/07 Studium der Betriebswirtschaft KU Eichstädt-Ingolstadt und Regents College London, Abschluss Dipl.-Kaufmann; 2007/13 Promotion am Lehrstuhl für Dienstleistungsmanagement bei Prof. Dr. Dr. h.c. Bernd Stauss, Abschluss Dr. rer. pol. 2002/07 versch. Tätigkeiten u. a. bei der Deutschen Lufthansa AG, der Merck KGaA und als wiss. Hilfskraft, 2007/11 wiss. Mitarbeiter am Lehrstuhl für Dienstleistungsmanagement an der KU Eichstädt-Ingolstadt. Anschl. freiberufliche Tätigkeit als Dozent und Berater. Mitgl. u. a. ZDS, bdvb, DAV, INKontakt, THW und der AWO. Mitgl. der SPD, stellv. Vors. Unterbezirksvorst. der SPD Darmstadt-Dieburg, Mitgl. im Bezirksbeirat der SPD Hessen-Süd, Delegierter der SPD Hessen-Süd für Bundesparteitag und Parteikonvent. Seit 2006 Stadtverordneter in Groß-Umstadt, seit 2011 Mitgl. der SPD-Fraktion in der Stadtverordnetenversammlung Groß-Umstadt, seit 2011 Vors. Ausschuss für Energieangelegenheiten. - MdB seit Okt. 2013; stellv. Vors. der Youngsters der SPD-Fraktion, stellv. Vors. der hessischen Landesgruppe der SPD-Fraktion; stellv. Vors. dt.-britische Parlamentariergruppe, Mitgl. dt.-irische und dt.-portugiesische Parlamentariergruppe.<br/><br/>Betreuter Wahlkreis:<br/>Wahlkreis 185 (Offenbach)', 'Jens', '11004603');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08519, NULL, NULL, NULL, 'Geschäftsführerin', 'verheiratet, 2 Kinder', '22.10.1957', NULL, 'Welschen, Ennest', 'weiblich', NULL, '22.10.2013', 'Kovac', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Mineralienhalde Grube Clara UG (haftungsbeschränkt), Wolfach,<br/>Geschäftsführerin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Mineralienhalde Grube Clara UG (haftungsbeschränkt), Wolfach, <br/>Geschäftsführerin<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Ortenkreis Offenburg, Offenburg, <br/>Mitglied des Kreistages<br/><br/>Stadt Wolfach, Wolfach, <br/>Mitglied des Stadtrates, 2. Stellv. Bürgermeisterin<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Caritasverband Kinzigtal e.V., Haslach im Kinzigtal, <br/>Beisitzerin des Vorstandes<br/><br/>Förderverein Besucherbergwerk Oberwolfach e.V., Oberwolfach, <br/>Vorsitzende', 'Realschulabschluss. 1973/Feb. 1976 Ausbildung zur Verwaltungsbeamtin im mittleren Dienst beim Kreis Olpe, anschließend Beamtin im mittleren Dienst. Nov. 1980/Feb. 1987 Büroleiterin von Paul Breuer MdB, 1990 bis 2011 freie Journalistin, Geschäftsführerin der Mineralienhalde Grube Clara UG (haftungsbeschränkt). Seit 1993 Vors. der CDU Wolfach, seit 1999 Mitgl. des Kreisvorst. der CDU Ortenau, seit 2013 stellv. Kreisvors., seit 2013 Mitgl. im Bezirksvors. der CDU Südbaden, seit 2013 im Kreisvorstand der Frauen Union und seit 2015 im Landesvorstand der Frauen Union Baden-Württemberg, seit 2012 im CDU-Landesfachausschuss ländlicher Raum. Seit 2009 Kreisrätin im Ortenaukreis. - MdB seit Okt. 2013.', 'Kordula', '11004604');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08520, NULL, NULL, NULL, 'Diplom-Verwaltungswirt', 'verheiratet, 2 Kinder', '15.03.1965', NULL, 'Neunkirchen', 'männlich', NULL, '02.01.2014', 'Petry', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Ministerium für Inneres und Sport, Saarbrücken,<br/>	Regierungsbeschäftigter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Abwasserzweckverband Illtal, Illingen, <br/>	Mitglied des Verbandsausschusses und der Verbandsversammlung<br/><br/>	Bundesministerium der Finanzen, Berlin, <br/>	Mitglied des Beirates für die grafische Gestaltung der Sonderpost-<br/>	Wertzeichen<br/><br/>	FernUniversität in Hagen, Hagen, <br/>	Mitglied des Parlamentarischen Beirates<br/><br/>	Gemeinde Illingen, Illingen, <br/>	Mitglied des Gemeinderates, Erster Beigeordneter, ehrenamtlich<br/>	Mitglied des Ortsrates und Ortsvorsteher Welschbach<br/><br/>	Zweckverband Natura Ill-Theel, Eppelborn, <br/>	Mitglied der Verbandsversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Europaverband der Selbständigen - Deutschland e.V. (ESD), Berlin, <br/>	Mitglied des Parlamentarischen Beirates<br/><br/>	SV Eintracht Hirzweiler-Welschbach, Illingen, <br/>	Vorsitzender<br/><br/>	ver.di, Landesbezirk Saar, Saarbrücken, <br/>	Mitglied des Landesvorstandes Fachbereich 6', '1984 Abitur am Gymnasium Ottweiler. 1984/85 Studium Mathematik mit Nebenfach Informatik, 1985/89 Studium an der FH Dudweiler, Abschluss Dipl.-Verwaltungswirt. 1990/91 Zivildienst. 1988/92 Zusatzstudium Fernuniv. Hagen, Vordiplom Ökonomie. 1992/95 wissenschaftl. Mitarbeiter der SPD-Landtagsfraktion, 1995/99 persönl. Referent von Innenminister Friedel Läpple, seit 1999 Referent im höheren Dienst beim Ministerium für Inneres und Europaangelegenheiten, seit 2003 stellv. Referatsleiter, seit 2004 Mitgl. Personalrat. Seit 1990 Vors. SPD-Ortsverein Welschbach, SPD-Gemeindeverbandsvors. in Illingen, Mitgl. Landesvorst der SPD Saar. Seit 1989 Mitgl. Gemeinderat Illingen und Ortsrat Welschbach, seit 1999 Ortsvorsteher in Welschbach, 1991/04 Vors. SPD-Fraktion im Illinger Gemeinderat, seit Juli 2009 Erster Beigeordneter der Gemeinde Illingen. Mitgl. u. a. ver.di, DRK, der Lebenshilfe Neunkirchen und deutsch-polnischer Freundeskreis Illingen. - MdB seit Jan. 2014.<br/><br/>eingetreten am 2.1.2014 für Abg. Jost', 'Christian', '11004605');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08521, NULL, NULL, NULL, 'Landwirtschaftsmeister', 'verheiratet, 5 Kinder', '04.08.1953', NULL, 'Leutkirch im Allgäu', 'männlich', NULL, '01.07.2014', 'Westermayer', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landwirtschaftlicher Betrieb, Leutkirch-Reichenhofen<br/><br/>Funktionen in Unternehmen: <br/>BayWa AG, München, <br/>Mitglied des Beirates Württemberg<br/><br/>Maschinenring Service GmbH, Oberhausen, <br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Landkreis Ravensburg, Ravensburg, <br/>Mitglied des Kreistages<br/><br/>Regionalverband Bodensee-Oberschwaben, Ravensburg, <br/>Mitglied der Verbandsversammlung<br/><br/>Sozialversicherung für Landwirtschaft, Forsten und Gartenbau (SVLFG), Stuttgart, <br/>Mitglied des Beirates<br/><br/>Stadt Leutkirch, Leutkirch, <br/>Mitglied des Gemeinderates<br/><br/>Verband der Teilnehmergemeinschaften Baden-Württemberg (VTG), Neckarsulm, <br/>Präsident<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bauernverband Allgäu-Oberschwaben e.V., Bad Waldsee, <br/>Vorsitzender<br/><br/>Förderverein Albert-Schweitzer-Schule e.V., Kisslegg, <br/>Vorsitzender<br/><br/>Landesbauernverband in Baden-Württemberg e.V. (LBV), Stuttgart, <br/>Mitglied des Vorstandes<br/><br/>Landesverband der Maschinenringe Baden-Württemberg e.V., Stuttgart, <br/>Mitglied des Beirates<br/><br/>Maschinenring Württembergisches Allgäu e.V., Leutkirch, <br/>Vorsitzender<br/><br/>Beteiligungen an Kapital- oder Personengesellschaften: <br/>Verlag Schwäbischer Bauer GmbH, Ravensburg', '1980/2014 selbstständiger Unternehmer mit einem Milchviehbetrieb. Seit 1995 Vors. des Kreisbauernverbandes Allgäu-Oberschwaben. Seit 2015 Ehrenvors. des Maschinen- und Betriebshilfsrings Württembergisches Allgäu. Mitgl. des Beirates des Landesverbands der Maschinenringe in Baden-Württemberg und des Beirates der landwirtschaftlichen Sozialversicherung Baden-Württemberg. Seit 2002 Vors. des CDU Stadtverbandes in Leutkirch, seit 1989 Mitgl. des CDU-Kreisvorstandes im Kreis Ravensburg. Seit 1990 Mitgl. des Kreistages im Kreis Ravensburg, seit 1990 Mitgl. des Stadtrats der Großen Kreisstadt Leutkirch im Allgäu. - MdB seit Juli 2014, zuständig für den Wahlkreis 294 (Ravensburg).<br/><br/>eingetreten am 1.7.2014 für Abg. Schavan', 'Waldemar', '11004611');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08522, NULL, NULL, NULL, 'Student', 'verheiratet, 2 Kinder', '10.02.1986', NULL, 'Wriezen', 'männlich', NULL, '07.11.2014', 'Müller', '(Potsdam)', 'DIE LINKE.', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landtag Brandenburg, Potsdam,<br/>Mitglied des Landtages', 'Abitur 2005. Seit 2005 Studium Univ. Potsdam, Lehramt Geschichte/Lebenskunde, Ethik, Religion; 2006/09 Stipendiat der Rosa-Luxemburg-Stiftung. 2006/07 Mitgl. Studierendenparlament Univ. Potsdam, 2007/08: Mitgl. des Allgemeinen Studierendenausschusses (AStA) Univ. Potsdam. 2008/10 studentischer Mitarbeiter am Zentrum für Zeithistorische Forschung (Potsdam), 2010 Bildungsreferent des Vereins zur Förderung einer solidarischen Wirtschaftsweise und der Völkerverständigung e. V., 2010/13 Mitarbeiter von Sabine Wils, MdEP. Seit 2000 Mitgl. bei [''solid] - die sozialistische jugend / Linksjugend [''solid], 2005/06 Bundesgeschäftsführer, 2007, 2010/11  Mitgl. BundessprecherInnenrates. Mitgl. der PDS/Linkspartei.PDS /Die Linke seit 2002, seit 2012 stellv. Landesvors. DIE LINKE Brandenburg. MdL Brandenburg Okt. 2013/Okt. 2014. Mitgl. GEW, Rote Hilfe, Fördererkreis demokratischer Volks- und Hochschulbildung, attac, Freundeskreis John Heartfield, Bildungspartisanen Brandenburg e. V., SV Babelsberg 03. - MdB seit Nov. 2014.<br/><br/>eingetreten am 7. November 2014 für Abg. Golze', 'Norbert', '11004613');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08523, NULL, NULL, NULL, 'Verwaltungsfachwirtin', 'verheiratet, 2 Kinder', '05.02.1962', NULL, 'Pirmasens', 'weiblich', NULL, '12.11.2014', 'Glöckner', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Stadtverwaltung Pirmasens, Pirmasens,<br/>Verwaltungsfachwirtin, freigestellte Personalratsvorsitzende<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Unfallkasse Rheinland-Pfalz, Andernach,<br/>Mitglied der Vertreterversammlung, ehrenamtlich (bis 01.01.2016)', '1981 Abitur. 1982/85 Ausbildung zur Kauffrau für Bürokommunikation, 1988/92 Ausbildung zur Verwaltungsfachwirtin. 1996/99 berufsbegleitendes Studium, Schwerpunkt Volks- und Betriebswirtschaft. Mitgl. ver.di und IG BCE. Seit 1995 Mitgl. der SPD, stellv. Vors. SPD-Unterbezirk Pirmasens-Zweibrücken, Vorstandsmitglied der AsF im SPD-Unterbezirk Pirmasens-Zweibrücken, Vors. der SPD Pirmasens. - MdB seit Nov. 2014.<br/><br/>eingetreten am 12.11.2014 für Abg. Bätzing-Lichtenthäler', 'Angelika', '11004614');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08524, NULL, NULL, NULL, 'Polizist', NULL, '05.02.1961', NULL, 'Castrop-Rauxel', 'männlich', NULL, '01.01.2015', 'Hoffmann', '(Dortmund)', 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Nordrhein-Westfalen, Düsseldorf,<br/>	Polizeibeamter<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>	Stadt Dortmund, Dortmund, <br/>	Mitglied des Stadtrates<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>	Stadtfeuerwehrverband Dortmund e.V., Dortmund,<br/>Mitglied des Beirates, ehrenamtlich', '1980 Eintritt in den Polizeidienst. 1982 Fachprüfung für den mittleren Polizeivollzugsdienst, 1990 Fachprüfung für den gehobenen Polizeivollzugsdienst (Dipl.-Verwaltungswirt). 1999 Eintritt in die CDU. 2004/09 Mitglied in der Bezirksvertretung Dortmund Hombruch, 2011 Vors. der CDU im Stadtbezirk Dortmund Hombruch, 2014 Vors. der CDU Ortsunion Dortmund Kirchhörde. Seit 2009 Mitgl. im Rat der Stadt Dortmund, dort Mitgl. in den Ausschüssen Soziales und Wirtschaft sowie Mitgl. im Integrationsrat. Mitgl. der AWO, Gartenfreunde Kirchhörde, Siedlergemeinschaft, Schwimmverein SV Westfalen 1896, Beirat Stadtfeuerwehrverband Dortmund e.V., Mitgl. Verein Deutsche Sprache e.V. - MdB seit Jan. 2015; Mitgl. der Arbeitnehmergruppe und der AG Kommunalpolitik.<br/><br/>eingetreten am 1. Januar 2015 für Abg. Pofalla', 'Thorsten', '11004616');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08525, NULL, NULL, NULL, 'Studentin', 'verheiratet', '03.05.1989', NULL, 'Esslingen', 'weiblich', NULL, '29.10.2016', 'Kemmer', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Landtag Baden-Württemberg, Stuttgart,<br/>	Studentische Hilfskraft<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Deutsche Traumastiftung e.V., Ulm,<br/>Mitglied des Kuratoriums, ehrenamtlich', '2008 Abitur. Freiwilliges Soziales Jahr in einem Stuttgarter Krankenhaus. 2013 Bachelorabschluss an der Eberhard-Karls-Universität Tübingen, Masterstudium im Fach Volkswirtschaftlehre an der Univ. Hohenheim und an der Univ. degli studi di Pavia, Italien, 2015 Master of Science in Economics. 2012/14 Landesvors. des RCDS Baden-Württemberg; Mitgl. im Landesvorst. der JU, im Bundesvorst. der Frauen Union und im CDU-Bezirksvorst. Württemberg-Hohenzollern. - MdB seit Dez. 2014; nominiert als Direktkandidatin Wahlkreis 291 Ulm für die 19. WP.<br/><br/>eingetreten am 27.12.2014 für Abg. Dr. Schockenhoff', 'Ronja', '11004617');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08526, NULL, NULL, NULL, 'Buchhändlerin', 'ledig', '16.05.1962', NULL, 'Suhl', 'weiblich', NULL, '16.03.2015', 'Menz', NULL, 'DIE LINKE.', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>KR2 Steuerungstechnik Bremen, Bremen,<br/>	Sachbearbeiterin<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Bremische Stiftung für Rüstungskonversion und Friedensforschung, Bremen, <br/>	Mitglied des Vorstandes', 'Buchhändlerin mit Fachhochschulabschluss. Seit 1997 in Bremen beschäftigt als Sachbearbeiterin. Seit 1978 Gewerkschaftsmitgl. Aktives Mitglied im Bremer Friedensforum, seit Nov. 2006 in der Bremischen Stiftung für Rüstungskonversion und Friedensforschung, seit Okt. 2007 im Vorstand. 1981 Eintritt in die SED und Mitgl. aller Nachfolgeparteien, zwei Jahre Schatzmeisterin im PDS-Kreisverband Suhl,  viele Jahre Mitgl. des Vorstands oder der Revisionskommission sowohl in Suhl als auch in Bremen. Seit 1999 Fraktionsmitgl. und sachkundige Bürgerin im Beirat Östliche Vorstadt (Bremen). - MdB seit März 2015.<br/><br/>eingetreten am 16.3.2015 für Abg. Alpers', 'Birgit', '11004619');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08527, NULL, NULL, NULL, 'Oberstudienrätin', 'verheiratet, 2 Kinder', '21.07.1958', NULL, 'Schrobenhausen', 'weiblich', NULL, '10.04.2015', 'Eberl', NULL, 'CSU', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Gymnasiallehrerin, Freistaat Bayern', 'Abitur 1978 am Maria-Theresia-Gymnasium Augsburg. 1978/85 Studium der Mathematik und der Wirtschaftswissenschaften an der Ludwig-Maximilians-Univ. in München mit dem Abschluss des 1. Staatsexamens für das Lehramt an Gymnasien in Bayern; zweijähriger Referendardienst in Fürth, Neu-Ulm, Gersthofen und München mit Abschluss des 2. Staatsexamens für das Lehramt an Gymnasien in Bayern. 1989/98 Deutschherren-Gymnasium Aichach, 1998/99 Gymnasium Schrobenhausen, 1999/15 Deutschherren-Gymnasium Aichach. 1977/93 Junge Union; 1978/85 RCDS München; 1979 Eintritt in die CSU, seit 2011 stellv. Bezirksvors. der FU Schwaben, seit 2009 Landesschatzmeisterin der FU Bayern, Mitgl. Bezirksvorst. der CSU Schwaben. Langjähriges aktives Mitgl. (Violine) in der Philharmonie Aichach e. V.; aktives Mitgl. in der Lebenshilfe Aichach-Friedberg e. V.; organisiert im Wirtschaftsphilologenverband Bayern; organisiert im Bayerischen Philologenverband. - MdB seit April 2015.<br/><br/>eingetreten am 10.4.2015 für Abg. Dr. Gauweiler', 'Iris', '11004620');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08528, NULL, 'Dr.', 'Dr.', 'Tierärztin', 'verheiratet, 4 Kinder', '05.07.1960', NULL, 'Neuss', 'weiblich', NULL, '21.05.2015', 'Thissen', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Kreis Borken, Borken,<br/>	Amtliche Tierärztin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Tierarztpraxis Bernd Rausch, Rosendahl, <br/>	Tierärztin', '1978 Abitur am Helmholtz-Gymnasium in Bonn. 1979 freiwilliges Soziales Jahr. 1981 Studium der Tiermedizin an der Tiermedizinischen Hochschule Hannover mit Approbation im Jahre 1987. 1988/90 Assistenztierärztin, 1991 Praxis-Niederlassung. 2003 Erwerb der Zusatzbezeichnung "Verhaltenskunde und -therapie"; 2008 Promotion. Seit 1993 amtliche Tierärztin bis Februar 2014 im Kreis Steinburg, im Anschluss bis Mai 2015 im Kreis Borken. 2008/14 Mitgl. der Ratsversammlung Itzehoe. 2013/15 stellv. Kreisvors., seit Mai 2015 Kreisvors. der SPD Steinburg, seit 2013 Mitgl. des SPD-Landesparteirats Schleswig-Holstein und stellv. Landesvors. der Arbeitsgemeinschaft der Sozialdemokraten im Gesundheitswesen; aktives Mitgl. der Arbeitsgemeinschaft sozialdemokratischer Frauen. Weitere Mitgliedschaften: ver.di, Tierärztliche Vereinigung Tierschutz (TVT), Tierärztliches Forum für verantwortbare Landwirtschaft, Frauen in die Aufsichtsräte (FidAR) e. V. - MdB seit Mai 2015.<br/><br/>eingetreten am 21.5.2015 für Abg. Dr. Bartels', 'Karin', '11004621');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08529, NULL, NULL, NULL, 'Dipl.- Politologin', NULL, '31.01.1983', NULL, 'Köln', 'weiblich', NULL, '17.07.2015', 'Ryglewski', NULL, 'SPD', NULL, NULL, NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Mitglied der Bremischen Bürgerschaft, Bremen', '2002/09 Studium der Politikwissenschaft an der Univ. Bremen, Dipl.-Politologin, Nebenfach Geographie. Seit 2001 Mitgl. der SPD, 2006/08 Mitgl. im Landesvorstand der Jusos Bremen, 2008/12 Juso-Landesvors., seit 2010 stellvertretende SPD-Landesvors., Sprecherin des Themenforums Verbraucherpolitik der SPD. 2009/11 Stadtteilmanagerin in den Bremer Stadtteilen Osterfeuerberg und Woltmershausen. 2011/15 Mitgl. der Bremischen Bürgerschaft, ordentliches Mitgl. im Ausschuss für die Gleichstellung der Frau, im Parl. Untersuchungsausschuss Krankenhauskeime sowie in der städtischen Deputation für Gesundheit und der staatlichen Deputation für Wirtschaft, Arbeit und Häfen, Sprecherin für Verbraucherpolitik der SPD-Bürgerschaftsfraktion. Mitgl. der Gewerkschaft ver.di, Vorstandsmitgl. im Verwaltungsrat der Verbraucherzentrale Bremen, stellv. Mitgl. im Beirat Finanzmarktwächter. - MdB seit Juli 2015.<br/><br/>eingetreten am 17.7.2015 für Abg. Dr. Sieling', 'Sarah', '11004622');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08530, NULL, NULL, NULL, 'Versicherungskaufmann', 'geschieden', '10.01.1955', NULL, 'Duisburg', 'männlich', NULL, '20.07.2015', 'Mosblech', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, '1976 Abitur, anschl. Studium der Wirtschaftswissenschaften an der Univ. Duisburg und der Rechtswissenschaften an der Univ. Bonn. 1976/82 und 1983/86 Werkstudent bei den Niederrheinischen Gas- und Wasserwerken Duisburg. 1986/87 Lektor und 1988/92 freier Verlagsmitarbeiter des Sinusverlages in Krefeld. Seit 1989 selbständiger Versicherungsfachmann und Partner der Victoria Versicherung AG und der D.A.S. Versicherung AG, heute Partner der ERGO Versicherungsgruppe AG. Seit 1972 Mitgl. der CDU, 1976/79 Vors. JU-Ortsverband Duisburg-Hamborn und 1987/89 Vors. JU-Kreisverband Duisburg, 1978/87 stellv. Vors. JU-Bezirk Rheinisches Ruhrgebiet, seit 1993 stellv. Vors. CDU-Kreisverband Duisburg und seit 1997 Vors. des CDU-Ortsverband Duisburg-Alt-Hamborn, 1991/02 und 2004/08 stellv. Vors. OMV-Landesverbandes NRW. 1989/94 Mitgl. der Bezirksvertretung Duisburg-Hamborn, seit 1994 Mitgl. im Rat der Stadt Duisburg, zuletzt zweiter Bürgermeister. 2004/05 Mitgl. im Landtag von Nordrhein-Westfalen. - MdB seit Juli 2015.<br/><br/>eingetreten am 20.7.2015 für Abg. Philipp Mißfelder', 'Volker', '11004623');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08531, NULL, NULL, NULL, 'Diplpm Ingenieurin', '2 Kinder', '19.09.1952', NULL, 'Rösrath', 'weiblich', NULL, '01.10.2015', 'Scho-Antwerpes', NULL, 'SPD', NULL, 'evangelisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>	Stadt Köln, Köln,<br/>	Bürgermeisterin und 1. Stellvertreterin der Oberbürgermeisterin<br/><br/>Funktionen in Unternehmen: <br/>		KölnKongress GmbH, Köln, <br/>	Mitglied des Aufsichtsrates<br/><br/>	Wohnen und Leben im Alter Michaelshoven gemeinnützige GmbH, Köln, <br/>	Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>			Stadt Köln, Köln, <br/>	Bürgermeisterin und 1. Stellvertreterin der Oberbürgermeisterin, ehrenamtlich<br/>	Mitglied des Rates<br/><br/>	Zweckverband Sparkasse KölnBonn, Köln, <br/>	Mitglied der Verbandsversammlung<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>			Aidshilfe Köln e.V., Köln, <br/>	Mitglied des Vorstandes<br/><br/>	COMEDIA Förderkreis e.V., Köln, <br/>	Vorsitzende<br/><br/>	Der Paritätische Wohlfahrtsverband, Kreisgruppe Köln, Köln, <br/>	Vorsitzende<br/><br/>	Diakonie Michaelshoven e.V., Köln, <br/>	Mitglied des Kuratoriums<br/><br/>	Förderverein Glashütte Porz e.V., Köln, <br/>	Vorsitzende<br/><br/>	Kölsch Hätz Stiftung, Köln, <br/>	Mitglied des Kuratoriums<br/><br/>	Kulturforum e.V., Köln, <br/>	Vorsitzende<br/><br/>	LebensWert e.V., Köln, <br/>	Mitglied des Beirates<br/><br/>	Max-Planck-Institute für Biologie des Alterns und für Stoffwechselforschung, Köln, <br/>	Mitglied des gemeinsamen Kuratoriums<br/><br/>	Zentrum für Frühbehandlung und Frühförderung e.V., Köln, <br/>	Vorsitzende', 'Nach dem Studium bis 1983 bei der Bezirksregierung Köln in der Abteilung Städtebau tätig. Mitgliedschaften (Auswahl): Vorstand Aidshilfe Köln, Kreisvorsitzende des Paritätischen Wohlfahrtsverbandes Köln, Vorsitzende Zentrum für Frühbehandlung und Frühförderung e. V., Vorsitzende Kulturforum e. V., Vorsitzende Comedia Förderkreis e. V., Mitgl. gemeinsames Kuratorium der Max-Planck-Institute für Biologie des Alterns und für Stoffenwechselforschung, Mitgl. Kölner Runder Tisch für Integration und Runder Tisch für Flüchtlingsfragen, Vors. Kuratorium der Rhein-Flanke gGmbH. Mitgl. ver.di, Mitgl. Aufsichtsrat der KölnKongress GmbH, Region Köln/Bonn e. V., Zentral-Dombau-Verein zu Köln von 1842, Förderverein der Stadtbibliothek Köln, Mitgl. Verein "Tatort" e. V., Verbandsversammlung des Zweckverbands Sparkasse KölnBonn, Mitgl. Kuratorium SK-Stiftung Kultur und Stiftungsrat RheinEnergieStiftung Kultur. Seit 2004 im Rat der Stadt Köln, seit 2004 ehrenamtl. Bürgermeisterin der Stadt Köln, seit 2009 1. Stellvertreterin der Oberbürgermeisterin, Mitgl. in den Ratsausschüssen Kunst und Kultur sowie Schule und Weiterbildung und AG Lesben, Schwule und Transgender. - MdB seit Okt. 2015.<br/><br/>einetreten am 1.10.2015 für Abg. Kampmann', 'Elfi', '11004626');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08532, NULL, NULL, NULL, 'Dipl.-Verwaltungswirtin, Heilpraktikerin für Psychotherapie', 'verheiratet, 3 Kinder', '17.12.1959', NULL, 'Essen', 'weiblich', NULL, '21.10.2015', 'Rode-Bosse', NULL, 'SPD', NULL, NULL, NULL, NULL, '1978 Abitur. Eintritt in die Bundeswehrverwaltung und zusätzlich seit 2011 bis Mandatsannahme nebenberuflich tätig in einer eigenen Privatpraxis für Psychotherapie. Zeitweise stellv. SPD-Kreisvors. Höxter, stellv. SPD-Ortsvors. Marienmünster, sachkundige Bürgerin beim Fachausschuss der VHS Höxter-Marienmünster und stellv. Mitgl. im Ortsausschuss Altenbergen. Mitgl. bei AWO (Arbeiterwohlfahrt), OWA (Ostwestfalen-Akademie), DJH (Deutschen Jugendherbergswerk), BwSw (Bundeswehrsozialwerk), VFP (Verband freier Psychotherapeuten, Heilpraktiker für Psychotherapie, Psychologische Berater), kfd (Kath. Frauengemeinschaft), VBB (Verband der Beamten der Bundeswehrverwaltung e.V.), GHG Augustdorf (Gemeinsame Heimgesellschaft Standort Augustdorf e. V.), SOS Kinderdorf, Elternhilfe für das krebskranke Kind Göttingen, Weißer Ring, Patenschaft bei Plan, im Heimat- und Kulturverein Marienmünster und im Sportverein Altbergen. - MdB seit Okt. 2015.<br/><br/>eingetreten am 11.10.2015 für Abg. Becker', 'Petra', '11004627');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08533, NULL, NULL, NULL, 'Finanzwirtin, Stadträtin a.D.', '2 Kinder', '27.04.1959', NULL, 'Stuttgart', 'weiblich', NULL, '08.06.2016', 'Ripsam', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Land Baden-Württemberg, Stuttgart,<br/>Regierungsamtsfrau<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Schreibbüro, selbständig, Stuttgart<br/><br/>Funktionen in Unternehmen: <br/>Baden-Württembergische Bank, Stuttgart,<br/>Mitglied des Aufsichtsrates<br/><br/>Bauvereinigung Vaihingen/F. und Umgebung eG, Stuttgart,<br/>Mitglied des Aufsichtsrates<br/><br/>Stuttgarter Jugendhaus gemeinnützige GmbH, Stuttgart,<br/>Mitglied des Aufsichtsrates<br/><br/>Stuttgarter Versorgungs- und Verkehrsgesellschaft mbH (SVV), Stuttgart,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Stadt Stuttgart, Stuttgart,<br/>Mitglied des Gemeinderates, monatlich, Stufe 1<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Schwäbischer Frauenverein e.V., Stuttgart,<br/>Stellv. Vorsitzende<br/><br/>Sozialdienst katholischer Frauen e.V. (SkF), Stuttgart,<br/>Mitglied des Verwaltungsrates<br/><br/>Sudetendeutsche Landsmannschaft Landesgruppe Baden-Württemberg e.V., Stuttgart,<br/>Stellv. Kreisobfrau', 'Mittlere Reife. Ausbildung in der Steuerverwaltung des Landes Baden-Württemberg, Finanzwirtin. 2009/16 Sozialministerium Baden-Württemberg. Seit 1977 Mitgl. der CDU, 1978/08 Ortsvors. der CDU in Stuttgart, 1996/03 Mitgl. des Kreisvorstandes der CDU Stuttgart, 1998/15 Mitgl. des Landesvorstandes der FU Baden-Württemberg. Seit 1999 Mitgl. des Stadtrats der Landeshauptstadt Stuttgart, 2008/09 Fraktionsvors., Sprecherin im Jugendhilfeausschuss und 10 Jahre bildungs- und schulpol. Sprecherin. Seit 2006 Landesvors. der Union der Vertriebenen und Flüchtlinge (UdVF) Baden-Württemberg, Bundesschatzmeisterin der OMV, Kreisvors. der UdVF Stuttgart. Stellv. Kreisobfrau der Sudetendeutschen Landsmannschaft, Verwaltungsrätin beim Sozialdienst katholischer Frauen, stellv. Vors. des Schwäb. Frauenvereins e. V., Vors. Fasanerie Fasanenhof e.V. - MdB seit Juni 2016.<br/><br/>eingetreten am 8.6.16 für > Abg. Strobl', 'Iris', '11004635');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08534, NULL, NULL, NULL, 'Erste Samtgemeinderätin a. D.', '1 Kind', '04.11.1970', NULL, 'Stendal', 'weiblich', NULL, '04.06.2016', 'Rösel', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Samtgemeinde, Wesendorf,<br/>Erste Samtgemeinderätin', 'Handwerkliche Ausbildung. 1990 Abitur. Einjähriges Praktikum als Erzieherin in einem Jugendwohnheim. Ab 1991 Studium Erziehungs- und Sozialwissenschaft FU Berlin , Dipl.-Pädagogin. Erziehungsurlaub. 1999/04 Jugendpflegerin in der Samtgemeinde Brome. 2002/06 berufsbegl. Masterstudium des Sozialmanagements, Abschluss Master of Social Management. 2005/12 Kreisjugendreferentin und Jugendschutzbeauftragte des Landkreises. Juli 2012/März 2015 Leiterin Personal-, Haupt- und Schulamt der Samtgemeinde Meinersen. 2015/16 Erste Samtgemeinderätin der Samtgemeinde Wesendorf. Seit 2008 Mitgl. der CDU, 2009/13 Kreisvors. der FU Wolfsburg und Beisitzerin im Bezirksvorst. der FU Nordostniedersachsen, ab Nov. 2011 Bezirksvors. der FU Nordostniedersachsen, Mitgl. BFA Bildung, Forschung und Innovation und LFA Kultus. Bis Juli 2013 Fraktionssprecherin im Ortsrat Wolfsburg-Stadtmitte. - MdB seit Juni 2016.<br/><br/>eingetreten am 4.6.16 für Abg. Grindel', 'Kathrin', '11004636');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08535, NULL, NULL, NULL, 'Wirtschaftsingenieur', 'verheiratet, 3 Kinder', '01.04.1946', NULL, 'Paderborn', 'männlich', NULL, '06.07.2016', 'Wange', NULL, 'CDU', NULL, 'evangelisch', NULL, 'Entgeltliche Tätigkeiten neben dem Mandat: <br/>O.V.S. Organisation für Veranstaltungen und allgemeinen Service GmbH, Paderborn,<br/>Gesellschafter<br/><br/>Funktionen in Unternehmen: <br/>Energiegenossenschaft Paderborner Land eG, Salzkotten,<br/>Mitglied des Aufsichtsrates, ehrenamtlich<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>Junior Chamber International, Paderborn+Höxter, Paderborn,<br/>Senator, ehrenamtlich<br/><br/>Wirtschaftsclub Paderborn+Höxter, Paderborn,<br/>Ehrenvorsitzender, ehrenamtlich', '1962 Mittelschule in Paderborn. 1962/65 Ausbildung zum Maschinenschlosser in Paderborn. 1966/67 Grundwehrdienst in Augustdorf. 1967/68 Studium zum Maschinenbautechniker in Düren, 1970/72 Studium zum Wirtschaftsingenieur an der HWF Köln. Seit 1981 Sicherheitsfachingenieur. 1968/70 Konstrukteur bei Benteler Werke AG, 1970/73 Wirtschaftsingenieur bei Benteler Werke AG, 1973/89 Angestellter bei P. Fortmeier GmbH & Co KG, 1989/93 Bereichsleiter KaWe Elektro GmbH & Co KG, Salzkotten, 1993/04 Geschäftsführer und Prokurist der Unternehmensgruppe Technologie in Salzkotten. Seit 1984 Mitgl. der CDU, 2000/09 stellv. Vors. und seit 2009 Vors. der CDU im Kreisverband Paderborn. 1989/04 Mitgl. im Rat der Stadt Lichtenau/Westf. und Ortsvorsteher von Herbram-Wald, 1991/04 CDU-Fraktionsvors. im Rat der Stadt Lichtenau/Westf., 2004/09 Bürgermeister der Stadt Lichtenau/Westf. 2004/09 Aufsichtsratsvors. der Stadtwerke Lichtenau GmbH. 1990 Gründungsmitgl.der Wirtschaftsjunioren und des Wirtschaftsclubs Paderborn + Höxter (PB + HX), seit 2003 Träger der Goldenen Ehrennadel, seit 2005 Senator of the Junior Chamber International, seit 2006 Ehrenvors. des Wirtschaftsclubs PB + HX, seit 2009 Gründungsmitgl. und Mitgl. des Aufsichtsrates der Energiegenossenschaft Paderborner-Land eG. - MdB seit Juli 2016.<br/><br/>eingetreten am 6.7.16 für Abg. Kampeter', 'Karl-Heinz', '11004637');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08536, NULL, NULL, NULL, 'Angestellter', 'keine Angaben', '16.08.1969', NULL, 'Neuenkirchen', 'männlich', NULL, '01.09.2016', 'Coße', NULL, 'SPD', NULL, 'römisch-katholisch', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Jobcenter Kreis Steinfurt, Steinfurt,<br/>Arbeitsvermittler<br/><br/>Funktionen in Unternehmen: <br/>Beteiligungsgesellschaft des Kreises Steinfurt mbh, Steinfurt,<br/>Stellv. Mitglied der Gesellschafterversammlung<br/><br/>Gesellschaft zur Förderung gemeinnütziger Zwecke im Kreis Steinfurt mbH, Steinfurt,<br/>Stellv. Mitglied der Gesellschafterversammlung<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreis Steinfurt, Steinfurt,<br/>Mitglied des Kreistages<br/>Stellv. Landrat<br/><br/>Funktionen in Vereinen, Verbänden und Stiftungen: <br/>EUREGIO e.V., Gronau,<br/>Stellv. Vorsitzender des Euregio-Rates<br/>Vizepräsident<br/><br/>Europa-Union Deutschland, Kreisverband Steinfurt, Rheine,<br/>Stellv. Vorsitzender<br/><br/>Kreissportbund Steinfurt e.V., Steinfurt,<br/>Vizepräsident', 'Realschule, Kaufmännische Schulen Rheine, Fachoberschulreife. Bürokaufmann. Wehrdienst als Stabsdienstsoldat im D/NL Korps in Münster (9 Monate). 1997/98 Chivasso B.V., Hessisch Oldendorf, 1999/2000 Berendsohn AG, Hamburg, 2000/02 Flexarbeit GmbH, Duisburg. Seit 2002 Jobcenter Kreis Steinfurt AöR, Rheine, Arbeitsvermittler im Bereich von Aufgaben nach dem SGB II. Mitgl. ver.di, AWO, IG BCE, Europa Union, Kreisportbund, Turn- und Sportverein St. Arnold, Euregio. Seit 1986 Mitgl. der SPD, Vors. der SPD im Kreis Steinfurt. Stellv. Landrat des Kreises Steinfurt. Vizepräsident der Euregio, Vors. der SPD/PvdA-Fraktion im Euregiorat. - MdB seit Sept. 2016.<br/><br/>eingetreten am 1.9.2016 für Abg. Hinz', 'Jürgen', '11004639');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08537, NULL, NULL, NULL, 'Rechtsanwältin', 'verheiratet', '28.01.1967', NULL, 'Braunschweig', 'weiblich', NULL, '01.10.2016', 'Bähr-Losse', NULL, 'SPD', NULL, 'konfessionslos', NULL, 'Berufliche Tätigkeit vor der Mitgliedschaft im Deutschen Bundestag: <br/>Rechtsanwältin, selbständig, St. Augustin<br/><br/>Entgeltliche Tätigkeiten neben dem Mandat: <br/>Rechtsanwältin, selbständig, St. Augustin<br/><br/>Funktionen in Unternehmen: <br/>Flugplatzgesellschaft Hangelar mbH, St. Augustin,<br/>Mitglied des Aufsichtsrates<br/><br/>Funktionen in Körperschaften und Anstalten des öffentlichen Rechts: <br/>Kreispolizeibehörde Siegburg, Siegburg,<br/>Mitglied des Polizeibeirates<br/><br/>Rhein-Sieg-Kreis, Siegburg,<br/>Mitglied des Kreistages', '1987 Abitur, Jugenddorf-Christophorusschule in Braunschweig. 1987/94 Studium Rechtswissenschaften Univ.Regensburg, Göttingen und Bonn, 1994 1. jur. Staatsexamen, Justizprüfamt beim Oberlandesgericht Köln; 1997 2. jur. Staatsexamen, Landesjustizprüfamt in Nordrhein-Westfalen. Rechtsanwältin hauptsächlich im Bereich Familienrecht. Bis 2012 Beisitzerin im Stadtsportverband der Stadt Sankt Augustin, seit 2011 ehrenamtlich in einem Frauenhilfeverein tätig. Mitgl. der SPD, Feb. 2005/März 2006 stellv. Ortsvereinsvors. und 2006/10 Ortsvereinsvors. der SPD Sankt Augustin, seit Okt. 2011 Kreisvors. der AsF im Rhein-Sieg-Kreis, 2008/10 Mitgl. im Kreisvorstand der SPD Rhein-Sieg, dort seit Okt. 2011 beratendes Mitgl. 2009/14 im Rat der Stadt Sankt Augustin, seit 2009 Kreistagsabgeordnete im Rhein-Sieg-Kreis. - MdB seit Okt. 2016.<br/><br/>eingetreten am 1.10.2016 für Abg. Steinbrück', 'Bettina', '11004640');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08538, NULL, NULL, NULL, 'Gross- und Aussenhandelskaufmann', 'verheiratet, 3 Kinder', '25.01.1945', NULL, 'Wilhelmshaven', 'männlich', NULL, '01.11.2016', 'Hajek', NULL, 'CDU', NULL, 'evangelisch-lutherisch', NULL, 'Keine veröffentlichungspflichtigen Angaben', 'Acht Jahre Volksschule, zweijährige Handelsschule. Ausbildung zum Groß- und Außenhandelskaufmann. 1964/66 Bundeswehr, Grundausbildung in Budel, zahlreiche Lehrgänge und anschließend in Aurich beim Fernmelderegiment und im SOC dienstlich eingesetzt. Kaufmännischer Angestellter im Großhandel, ab 1981 Handlungsbevollmächtigter. 1972/73 berufsbegleitend betriebswirtschaftliches Seminar "Praktischer Betriebswirt" mit bestandener Abschlussprüfung in Oldenburg, 1993 Ausbildereignungsprüfung vor der Handelskammer in Bremen. Seit Nov. 2009 Rentner. 2009/16 Vors. VdK Ortsverband Bockhorn. Seit Mai 1996 Mitgl. der CDU, seit Frühjahr 2007 Vors. der Senioren-Union Friesland, ab 2010 Landesvors. der Senioren-Union der CDU in Niedersachsen, Mitgl. im Bundesvorst. der Senioren-Union, Mitgl. im Landesvorst. der CDU in Niedersachsen, Mitgl. im Landesvorst. der CDU Oldenburg. - MdB seit Nov. 2016.<br/><br/>eingetreten am 1.11.2016 für Abg. Schmelzle', 'Rainer', '11004641');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08539, NULL, 'Dr.', 'Dr.', 'Kieferorthopäde', 'verheiratet, 4 Kinder', '29.03.1967', NULL, 'Lank-Latum (jetzt Meerbusch)', 'männlich', NULL, '07.12.2016', 'Höschel', NULL, 'CDU', NULL, 'ohne Angaben', NULL, 'Keine veröffentlichungspflichtigen Angaben', '1986 Abitur am Städtischen Mataré-Gymnasium Meerbusch-Büderich. 1986/91 Studium der Zahnheilkunde an der RWTH Aachen, 1994 dort Promotion; 1995/99 Weiterbildung zum Fachzahnarzt Kieferorthopädie. 2009/11 Studium BWL am IWW-Institut der Fernuniversität Hagen, 2011 Examen Betriebswirt (IWW). 1992/93 Zeitsoldat, Stabsarzt bei der Bundeswehr und nebenberuflich Assistent in einer Praxis in Neuss. 1994/95 Angestellter Zahnarzt in Mönchengladbach, 1995/97 Weiterbildungsassistent für Kieferorthopädie in einer Gemeinschaftspraxis in Herten, 1997/99 Weiterbildungsassistent in der Abteilung für Kieferorthopädie an der Uni-Klinik Frankfurt, seit 1999 freiberufliche Tätigkeit als Kieferorthopädie mit Praxen in Düsseldorf, Mönchengladbach und Meerbusch. 1986/02 Junge Union Meerbusch, seit 2000 CDU Düsseldorf und MIT der CDU, seit 2004 Vors. des gesundheitspol. Arbeitskreises der CDU NRW und damit Gast im Landesvorst. der CDU, seit 2008 Mitgl. Bundesfachausschuss Gesundheit und Pflege der CDU Deutschlands. Seit Dez. 2008 Mitgl. des Vorstandes und seit Dez. 2012 Vors. des Vereins PVS rhein-ruhr, seit Dez. 2016 Vors. des Bundesverbandes Verrechnungsstellen Gesundheit i. G. - MdB seit Dez. 2016.<br/><br/>eingetreten am 7.12.2016 für Abg. Hintze', 'Mathias Edwin', '11004642');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08540, NULL, NULL, NULL, 'Rechtsanwalts- und Notarfachangestellte', 'verheiratet, 2 Kinder', '20.10.1958', NULL, 'Kiel', 'weiblich', NULL, '28.06.2017', 'Herdan', NULL, 'CDU', NULL, 'evangelisch', NULL, NULL, 'Ricarda-Huch-Schule in Kiel, 1977 Abitur. Ausbildung zur Rechtsanwalts- und Notarfachangestellten, Prüfung 1981. Seit 1998 in der Kommunalpolitik, seit 2003 Kreistagsabgeordnete Kreis Rendsburg-Eckernförde, seit 2013 stellv. Landrätin, 2009/12 Mitgl. im Schleswig-Holsteinischen Landtag. - MdB seit Juni 2017.<br/><br/>eingetreten am 28.6.2017 für Abg. Liebing', 'Marion Marga', '11004643');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08541, NULL, NULL, NULL, 'Immobilienmakler', 'verheiratet, 2 Kinder', '19.03.1973', NULL, 'Flensburg', 'männlich', NULL, '03.07.2017', 'Jepsen', NULL, 'CDU', NULL, 'evangelisch', NULL, NULL, '1992 Abitur. 1995 Bankkaufmann. 1995/04 Wehrersatzdienst, Bundesanstalt Technisches Hilfswerk. 1992/95 Ausbildung zum Bankkaufmann, 1995/02 Sparkassenangestellter: Privatkundenberater, stellvertretender Filialleiter, Kreditsachbearbeiter, stellv. Filialdirektor, Filialleiter, Firmenkundenbetreuer; 1997 Sparkassenfachwirt, 2000 Sparkassenbetriebswirt, 2000 Entwicklungsprogramm zur Führungskraft, 2001/02 Fachseminar Firmenkundenbetreuung; seit 2003 Immobilien- und Finanzierungsmakler, seit 2006 selbstständig. Mitgl. Heimatverein der Landschaft Angeln e. V., stellv. Vors. Förderverein Landschaftsmuseum Angeln Unewatt, 2005/10 und 2015/20 ehrenamtlicher Richter am Schleswig-Holsteinischen Verwaltungsgericht. <br/>1995 Eintritt in die CDU; 1995/08 Junge Union, u. a. Ortsvorsitzender, stellv. Kreisvors.; 1995/14 Mittelstands- und Wirtschaftsvereinigung der CDU; 1999/02 Vors. CDU-Ortsverband Ringsberg, seit 2003 Vors. CDU-Bezirksverband Amt Langballig, seit 2003 Mitgl. CDU-Kreisvorstand Schleswig-Flensburg, seit 2007 stellv. Vors. CDU-Kreisverband Schleswig-Flensburg. 2003/11 bürgerliches Mitglied im Kreistag Schleswig-Flensburg, seit 2011 Kreistagsabgeordneter Kreis Schleswig-Flensburg, seit 2013 stellv. Vors. CDU-Kreistagsfraktion Schleswig-Flensburg. - MdB seit Juli 2017.<br/><br/>eingetreten am 3.7.2017 für Abg. Dr. Sütterlin-Waack', 'Thomas', '11004644');
INSERT INTO btw17_mdb_stammdaten (id, adel, akadtitel, anredetitel, beruf, familienstand, geburtsdatum, geburtsland, geburtsort, geschlecht, historiebis, historievon, nachname, ortszusatz, parteikurz, praefix, religion, sterbedatum, veroeffentlichungspflichtiges, vitakurz, vorname, xml_id) VALUES (08542, NULL, NULL, NULL, 'Dipl.-Kaufmann', 'verheiratet', '31.10.1979', NULL, 'Köln', 'männlich', NULL, '18.07.2017', 'Uhl', NULL, 'CDU', NULL, 'römisch-katholisch', NULL, NULL, 'Grundschule Luitpold, Homburg-Erbach, Abitur am Saarpfalz-Gymnasium, Homburg. Studium der Betriebswirtschaftslehre und der Angewandten Informatik mit Schwerpunkt "Information and Business Management" an der Univ. des Saarlandes, Abschluss Dipl.-Kaufmann, "Speech Communication and Rhetoric" an der Univ. Regensburg (berufsbegleitend). Wehrdienst in Germersheim und Trier. 2012/17 Staatskanzlei des Saarlandes, zuletzt Referatsleiter in der Abteilung A (Personal, Organisatrion und Haushalt) und stellv . Chief Information Officer (CIO) der Saarländischen Landesregierung. 2009/12 Projektleiter eGovernment und elektronisches Dokumentenmanagement beim IT -Innovationszentrum. Mitgl. Europa Union Deutschlands, Gesellschaft für Informatik ( GI) e. V., Bundesverband Deutscher Volks- und Betriebswirte (bdvb), Deutsche Gesellschaft für Sprechwissenschaft und Sprecherziehung (DGSS), Gewerkschaft Deutscher Verwaltungsverband Saar (dvv). Seit 2015 Vors. CDU-Ortsverband Erbach- Reiskirchen, seit 2015 Mitgl. "Netzwerk Digitalisierung" der CDU Deutschlands, 2014/16 Mitgl. der Internationalen Kommission der Jungen Union Deutschlands, seit 2014 Vors. AK "Netzpolitik und Digitalisierung" von CDU und JU Saar, 2010/15 Vors. der JU Saar, seit 2010 Mitgl. Landesvorst. der CDU Saar, seit 2007 stellv. Vors. CDU-Stadtverband Homburg, 2005/10 Kreisvors. JU Saarpfalz, seit 2005 Mitgl. Kreisvorst. CDU Saarpfalz, 2001 bis 2005 Vors. JU-Stadtverband. Homburg, 2000/07 Gründung und Vors.JU-Ortsverband Erbach-Reiskirchen, seit 1998 Mitgl. CDU Saar, 1996/16 Mitgl. JU Saar. Seit 2004 Mitgl. Stadtrat Homburg/Saar. - MdB seit Juli 2017.<br/><br/>eingetreten am 18.7.2017 für Abg. Funk', 'Markus', '11004645');
